INSERT INTO `foods` (`id`, `name`, `name_scientific`, `description`, `itis_id`, `wikipedia_id`, `picture_file_name`, `picture_content_type`, `picture_file_size`, `picture_updated_at`, `legacy_id`, `food_group`, `food_subgroup`, `food_type`, `created_at`, `updated_at`, `creator_id`, `updater_id`, `export_to_afcdb`, `category`, `ncbi_taxonomy_id`, `export_to_foodb`, `public_id`) VALUES
(1,	'Angelica',	'Angelica keiskei',	'Angelica is a genus of about 60 species of tall biennial and perennial herbs in the family Apiaceae, native to temperate and subarctic regions of the Northern Hemisphere, reaching as far north as Iceland and Lapland. They grow to 1–3 m tall, with large bipinnate leaves and large compound umbels of white or greenish-white flowers. Some species can be found in purple moor and rush pastures.',	'',	'Angelica',	'1.jpg',	'image/jpeg',	111325,	'2012-04-20 09:29:57',	1,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:14',	'2019-05-14 18:04:13',	NULL,	2,	0,	'specific',	357850,	1,	'FOOD00001'),
(2,	'Savoy cabbage',	'Brassica oleracea var. sabauda',	'Savoy cabbage (Brassica oleracea convar. capitata var. sabauda L. ) is a variety of the cabbage, a cultivar of the plant species Brassica oleracea. Savoy cabbage is a winter vegetable. A variety of the savoy cabbage is the January King Cabbage. Savoy cabbage can be used in a variety of recipes. It pairs well with red wine, apples, spices, horseradish and meat. It can be used for roulades, in stews and soups, as well as roasted plain and drizzled with olive oil. Cabbage that is heavy for its size with leaves that are unblemished and have a bright, fresh look are signs of desirable quality. Whole cabbages are preferred whenever possible as pre-cut or preshredded cabbage has a greatly diminished vitamin content. Peak season for most cabbages runs from November through April. Fresh whole cabbage will keep in the refrigerator for one to six weeks depending on type and variety. Hard green, white or red cabbages will keep the longest while the looser Savoy and Chinese varieties need to be consumed more quickly. It is necessary to keep the outer leaves intact without washing when storing since moisture hastens decay. Cabbage provides fiber, vitamins A, C, K and B6, folate, potassium, manganese, thiamin, calcium, iron and magnesium.',	NULL,	'Savoy cabbage',	'2.jpg',	'image/jpeg',	155178,	'2012-04-20 09:39:54',	2,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	1216010,	1,	'FOOD00002'),
(3,	'Silver linden',	'Tilia argentea',	'Tilia tomentosa (Silver Lime in the UK and Silver Linden in the US) is a species of Tilia native to southeastern Europe and southwestern Asia, from Hungary and the Balkans east to western Turkey, occurring at moderate altitudes. It is a deciduous tree growing to 20–35 m tall, with a trunk up to 2 m diameter. The leaves are alternately arranged, rounded to triangular-ovate, 4–13 cm long and broad with a 2.5–4 cm petiole, green and mostly hairless above, densely white tomentose with white hairs below, and with a coarsely toothed margin. The flowers are pale yellow, hermaphrodite, produced in cymes of three to ten in mid to late summer with a pale green subtending leafy bract; they have a strong scent and are pollinated by honeybees. The nectar however contains sugars which cannot be digested by other bees, to whom the tree is somewhat toxic. The fruit is a dry nut-like drupe 8–10 mm long, downy, and slightly ribbed.',	'845789',	'Tilia tomentosa',	'3.jpg',	'image/jpeg',	56367,	'2012-04-20 09:41:25',	3,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00003'),
(4,	'Kiwi',	'Actinidia chinensis',	'The kiwifruit, often shortened to kiwi in many parts of the world, is the edible berry of a woody vine in the genus Actinidia. The most common cultivar group of kiwifruit (\'Hayward\') is oval, about the size of a large hen\'s egg (5?8 centimetres in length and 4.5?5.5 centimetres in diameter). It has a fibrous, dull greenish-brown skin and bright green or golden flesh with rows of tiny, black, edible seeds. The fruit has a soft texture and a sweet but unique flavor, and today is a commercial crop in several countries, such as Italy, New Zealand, Chile, Greece and France.',	'506775',	'Kiwifruit',	'4.jpg',	'image/jpeg',	110661,	'2012-04-20 09:32:21',	4,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	3625,	1,	'FOOD00004'),
(5,	'Allium',	'Allium',	'Allium haematochiton is a species of wild onion known by the common name redskin onion. It is native to northern Baja California and southern California. It it grows on the slopes of the coastal hills and mountains, such as those of the Peninsular Ranges, Transverse Ranges, and southern California Coast Ranges.',	'42634',	'Allium haematochiton',	'5.jpg',	'image/jpeg',	341911,	'2012-04-20 09:37:44',	5,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	4678,	1,	'FOOD00005'),
(6,	'Garden onion',	'Allium cepa',	'The onion (Allium cepa) (Latin \'cepa\' = onion), also known as the bulb onion or common onion, is used as a vegetable and is the most widely cultivated species of the genus Allium. This genus also contains several other species variously referred to as onions and cultivated for food, such as the Japanese bunching onion (A. fistulosum), the Egyptian onion (A. ×proliferum), and the Canada onion (A. canadense). The name \"wild onion\" is applied to a number of Allium species but A. cepa is exclusively known from cultivation and its ancestral wild original form is not known, although escapes from cultivation have become established in some regions.The onion is most frequently a biennial or a perennial plant, but is usually treated as an annual and harvested in its first growing season.\r\nOnions are cultivated and used around the world. As a foodstuff they are usually served cooked, as a vegetable or part of a prepared savoury dish, but can also be eaten raw or used to make pickles or chutneys. They are pungent when chopped and contain certain chemical substances which irritate the eyes. Onions contain phenolics and flavonoids that have potential anti-inflammatory, anti-cholesterol, anticancer and antioxidant properties.',	'42720',	'Onion',	'6.jpg',	'image/jpeg',	138437,	'2012-04-20 09:41:21',	6,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	1,	'specific',	4679,	1,	'FOOD00006'),
(7,	'Leek',	'Allium porrum',	'The leek is a vegetable that belongs, along with onion and garlic, to the genus Allium, currently placed in family Amaryllidaceae, subfamily Allioideae. Historically many scientific names were used for leeks, which are now treated as cultivars of Allium ampeloprasum. Two related vegetables, elephant garlic and kurrat, are also cultivars of A.  ampeloprasum, although different in their uses as food. The edible part of the leek plant is a bundle of leaf sheaths that is sometimes erroneously called a stem or stalk.',	'42659',	'Leek',	'7.jpg',	'image/jpeg',	4857,	'2012-04-20 09:33:40',	7,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00007'),
(8,	'Garlic',	'Allium sativum',	'With a history of human use of over 7,000 years, garlic (Allium sativum) is native to central Asia, and has long been a staple in the Mediterranean region, as well as a frequent seasoning in Asia, Africa, and Europe. There are two sub-varieties of allium sativum: Allium sativum var. sativum (soft-necked garlic) and Allium sativum var. ophioscorodon (hard-necked garlic). Soft-necked garlic is the most commonly found. Bulb garlic is available in many forms, including fresh, frozen, dried, fermented (black garlic) and shelf stable products (in tubes or jars). [Wikipedia]',	'42652',	'Garlic',	'8.jpg',	'image/jpeg',	545294,	'2012-04-20 09:42:05',	8,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	2,	1,	'specific',	4682,	1,	'FOOD00008'),
(9,	'Chives',	'Allium schoenoprasum',	'Chives is the common name of Allium schoenoprasum, the smallest species of the edible onions. A perennial plant, it is native to Europe, Asia and North America. A. schoenoprasum is the only species of Allium native to both the New and the Old Worlds. The name of the species derives from the Greek skhoínos and práson. Its English name, chives, derives from the French word cive, from cepa, the Latin word for onion. Chives are a commonly used herb and can be found in grocery stores or grown in home gardens. In culinary use, the scapes are diced and used as an ingredient for fish, potatoes, soups, and other dishes. Chives have insect-repelling properties that can be used in gardens to control pests.',	'42636',	'Chives',	'9.jpg',	'image/jpeg',	1411537,	'2012-04-20 09:42:09',	9,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	74900,	1,	'FOOD00009'),
(10,	'Lemon verbena',	'Aloysia triphylla',	'Aloysia citrodora is a species of flowering plant in the verbena family Verbenaceae, native to northwestern Argentina and southern Bolivia. Common names include lemon verbena and lemon beebrush. It was brought to Europe by the Spanish and the Portuguese in the 17th century.',	'32135',	'Aloysia citrodora',	'10.jpg',	'image/jpeg',	142723,	'2012-04-20 09:32:16',	10,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	542672,	1,	'FOOD00010'),
(11,	'Cashew nut',	'Anacardium occidentale',	'The cashew, or caju, is a small tree native to Brazil. Cashew nuts are the seeds of the cashew apple, and are found in the grey bump at the end of the fruit. The cashew apple itself is sweet, soft and juicy.Cashews are usually sold roasted and salted and eaten as a snack.',	'28793',	'Cashew_nut',	'11.jpg',	'image/jpeg',	670639,	'2012-04-20 09:29:53',	11,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	171929,	1,	'FOOD00011'),
(12,	'Pineapple',	'Ananas comosus',	'The Pineapple (Ananas comosus), named for its resemblance to the pine cone, is a tropical plant with edible multiple fruit consisting of coalesced berries, and the most economically significant plant in the Bromeliaceae family. Pineapples may be cultivated from a crown cutting of the fruit, possibly flowering in 20–24 months and fruiting in the following six months. Pineapple does not ripen significantly post-harvest. Pineapples are consumed fresh, cooked, juiced, and preserved, and are found in a wide array of cuisines. In addition to consumption, in the Philippines the pineapple\'s leaves are used to produce the textile fiber piña- employed as a component of wall paper and furnishings, amongst other uses.',	'42335',	'Pineapple',	'12.jpg',	'image/jpeg',	46902,	'2012-04-20 09:38:46',	12,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	4615,	1,	'FOOD00012'),
(13,	'Dill',	'Anethum graveolens',	'Dill (Anethum graveolens), also known as Lao coriander, depending on where it is grown, is either a perennial or annual herb. It is the sole species of the genus Anethum.  Dill is widely grown in Eurasia where its leaves and seeds are used as a herb or spice for flavouring food. Like caraway, the fern-like leaves of dill are aromatic and are used to flavor many foods such as gravlax (cured salmon) and other fish dishes, borscht and other soups, as well as pickles (where the dill flower is sometimes used). Dill is best when used fresh as it loses its flavor rapidly if dried; however, freeze-dried dill leaves retain their flavor relatively well for a few months [Wikipedia].',	'29584',	'Dill',	'13.jpg',	'image/jpeg',	121803,	'2012-04-20 09:32:14',	13,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	1,	'specific',	40922,	1,	'FOOD00013'),
(14,	'Custard apple',	'Annona reticulata',	'Custard apple, is a common name for a fruit, and the tree which bears it, Annona reticulata Custard apple may also refer to similar fruits produced by related trees: Annonaceae, the custard apple or soursop family. Annona cherimola, a tree and fruit also called cherimoya. Annona squamosa, a tree and fruit also called sugar apple or sweetsop Annona senegalensis, a tree and fruit called wild custard-apple Casimiroa edulis, also called white sapote, a fruit related to the citrus.',	'18099',	'Custard apple',	'14.jpg',	'image/jpeg',	29242,	'2012-04-20 09:30:49',	14,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	301862,	1,	'FOOD00014'),
(15,	'Wild celery',	'Apium graveolens',	'Wild celery is a common name for several plants Wild celery may refer to Wild growing forms of celery, Apium graveolens Angelica archangelica, cultivated as a vegetable and medicinal plant Lovage, Levisticum officinale, sometimes known as wild celery Vallisneria americana, an aquatic plant in the Hydrocharitaceae family',	'182184',	'Wild celery',	'15.jpg',	'image/jpeg',	42828,	'2012-04-23 10:40:23',	15,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	2,	0,	'specific',	4045,	1,	'FOOD00015'),
(16,	'Peanut',	'Arachis hypogaea',	'The peanut, also known as the groundnut and the goober and taxonomically classified as <i>Arachis hypogaea</i>, is a legume crop grown mainly for its edible seeds. It is widely grown in the tropics and subtropics, being important to both small and large commercial producers. It is classified as both a grain legume and, because of its high oil content, an oil crop. World annual production of shelled peanuts was 42 million tonnes in 2014. Atypically among crop plants, peanut pods develop underground rather than aboveground. It is this characteristic that the botanist Linnaeus used to assign the specific name <i>hypogaea</i>, which means \"under the earth.\" (Wikipedia)',	'26463',	'Mr. Peanut',	'16.jpg',	'image/jpeg',	285702,	'2012-04-20 09:29:07',	16,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	3818,	1,	'FOOD00016'),
(17,	'Burdock',	'Arctium lappa',	'Arctium lappa, commonly called greater burdock, gob?,edible burdock, lappa, or beggar\'s buttons, is a biennial plant of the Arctium (burdock) genus in the Asteraceae family, cultivated in gardens for its root used as a vegetable. It is an invasive weed of high-nitrogen soils.\r\nThe root contains a fair amount of gobō dietary fiber (GDF, 6g per 100g), calcium, potassium, amino acids, and is low calorie. It contains polyphenols that causes darkened surface and muddy harshness by formation of tannin-iron complexes. Those polyphenols are caffeoylquinic acid derivatives.\r\nThe root is very crisp and has a sweet, mild, and pungent flavor with a little muddy harshness that can be reduced by soaking julienned/shredded roots in water for five to ten minutes. The harshness shows excellent harmonization with pork in miso soup (tonjiru) and takikomi gohan (a Japanese-style pilaf).',	'36545',	'Arctium_lappa',	'17.jpg',	'image/jpeg',	127987,	'2012-04-20 09:34:44',	17,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:13',	NULL,	NULL,	0,	'specific',	4217,	1,	'FOOD00017'),
(18,	'Horseradish',	'Armoracia rusticana',	'Horseradish (Armoracia rusticana, syn. Cochlearia armoracia) is a perennial plant of the Brassicaceae family (which also includes mustard, wasabi, broccoli, and cabbage). The plant is probably native to southeastern Europe and western Asia. It is now popular around the world. It grows up to 1.5 metres (5 feet) tall, and is cultivated primarily for its large, white, tapered root. The intact horseradish root has hardly any aroma. When cut or grated, however, enzymes from the now-broken plant cells break down sinigrin to produce allyl isothiocyanate, which irritates the mucous membranes of the sinuses and eyes. Once exposed to air (via grating) or heat, if not used immediately or mixed in vinegar, the grated mash darkens, loses its pungency, and becomes unpleasantly bitter-tasting.',	'23044',	'Horseradish',	'18.jpg',	'image/jpeg',	133514,	'2012-04-20 09:33:47',	18,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3704,	1,	'FOOD00018'),
(19,	'Tarragon',	'Artemisia dracunculus',	'Tarragon (Artemisia dracunculus) is a species of perennial herb in the family Asteraceae. One sub-species, Artemisia dracunculus var. sativa, is cultivated for use of the leaves as an aromatic culinary herb. In some other sub-species, the characteristic aroma is largely absent. The species is polymorphic. Informal names for distinguishing the variations include \"French tarragon\" (best for culinary use), \"Russian tarragon\" (typically better than wild tarragon but not as good as so-called French tarragon for culinary use), and \"wild tarragon\" (covers various states).\nTarragon is one of the four fines herbes of French cooking, and is particularly suitable for chicken, fish and egg dishes. Tarragon is the main flavoring component of Béarnaise sauce. Fresh, lightly bruised sprigs of tarragon are steeped in vinegar to produce tarragon vinegar.\nTarragon is used to flavor a popular carbonated soft drink in the countries of Azerbaijan, Armenia, Georgia and, by extension, Russia, Ukraine and Kazakhstan. The drink, named Tarhun (Armenian pronunciation: [t???xun] ???????), is made out of sugary tarragon concentrate and colored bright green.',	'35462',	'Artemisia_dracunculus',	'19.jpg',	'image/jpeg',	91707,	'2012-04-20 09:30:20',	19,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:15',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	72341,	1,	'FOOD00019'),
(20,	'Mugwort',	'Artemisia vulgaris',	'Mugwort (Artemisia vulgaris), or common wormwood, is a medicinal and culinary herb native to Eurasia and northern Africa. Mugwort may also refer to:',	'35505',	'List of plants named mugwort',	'20.jpg',	'image/jpeg',	28425,	'2012-04-20 09:38:57',	20,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	4220,	1,	'FOOD00020'),
(21,	'Asparagus',	'Asparagus officinalis',	'Asparagus officinalis is a spring vegetable, a flowering perennial plant species in the genus Asparagus. It was once classified in the lily family, like its Allium cousins, onions and garlic, but the Liliaceae have been split and the onion-like plants are now in the family Amaryllidaceae and asparagus in the Asparagaceae. Asparagus officinalis is native to most of Europe, northern Africa and western Asia, and is widely cultivated as a vegetable crop.',	'42784',	'Asparagus',	'21.jpg',	'image/jpeg',	136631,	'2012-04-20 09:32:33',	21,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	4686,	1,	'FOOD00021'),
(22,	'Oat',	'Avena sativa',	'The common oat (Avena sativa) is a species of cereal grain grown for its seed, which is known by the same name (usually in the plural, unlike other grains). While oats are suitable for human consumption as oatmeal and rolled oats, one of the most common uses is as livestock feed.',	'41459',	'Oat',	'22.jpg',	'image/jpeg',	77135,	'2012-04-20 09:32:23',	22,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	1,	'specific',	4498,	1,	'FOOD00022'),
(23,	'Star fruit',	'Averrhoa carambola',	'Averrhoa carambola is a species of woody plant in the family Oxalidaceae; it has a number of common names including Carambola and Starfruit. This evergreen tree is native to Southeast Asia and the Indian Subcontinent. A. carambola is a small tree or shrub that grows 5–12 meters tall, with rose to red-purple flowers. The flowers are small and bell-shaped, with five petals that have whitish edges. The flowers are often produced year round under tropical conditions. The tree is cultivated in tropical and semitropical regions for its edible fruits and for medicinal uses.',	'506371',	'Averrhoa carambola',	'23.jpg',	'image/jpeg',	69876,	'2012-04-20 09:29:11',	23,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	28974,	1,	'FOOD00023'),
(24,	'Brazil nut',	'Bertholletia excelsa',	'The Brazil nut (Bertholletia excelsa) is a South American tree in the family Lecythidaceae, and also the name of the tree\'s commercially harvested edible seed.',	'21989',	'Brazil nut',	'24.jpg',	'image/jpeg',	32804,	'2012-04-20 09:40:52',	24,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3645,	1,	'FOOD00024'),
(25,	'Common beet',	'Beta vulgaris',	'The beet (Beta vulgaris) is a plant in the Chenopodiaceae family which is now included in Amaranthaceae family. It is best known in its numerous cultivated varieties, the most well known of which is the root vegetable known as the beetroot or garden beet. However, other cultivated varieties include the leaf vegetable chard, as well as the root vegetable sugar beet, which is important in the production of table sugar, and mangelwurzel, which is a fodder crop. Three subspecies are typically recognised. All cultivated varieties fall into the subspecies Beta vulgaris subsp. vulgaris, while Beta vulgaris subsp. maritima, commonly known as the sea beet, is the wild ancestor of these, and is found throughout the Mediterranean, the Atlantic coast of Europe, the Near East, and India. A second wild subspecies, Beta vulgaris subsp. adanensis, occurs from Greece to Syria. The roots are most commonly deep red-purple in color, but come in a wide variety of other shades, including golden yellow and red-and-white striped. Beta vulgaris is a herbaceous biennial or, rarely, perennial plant with leafy stems growing to 1–2 m tall. The leaves are heart-shaped, 5–20 cm long on wild plants (often much larger in cultivated plants). The flowers are produced in dense spikes; each flower is very small, 3–5 mm diameter, green or tinged reddish, with five petals; they are wind pollinated. The fruit is a cluster of hard nutlets.',	'20681',	'Beet',	'25.jpg',	'image/jpeg',	81715,	'2012-04-20 09:44:15',	25,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	161934,	1,	'FOOD00025'),
(26,	'Borage',	'Borago officinalis',	'Borage (Borago officinalis), also known as a starflower, is an annual herb. It is native to the Mediterranean region and has naturalized in many other locales. It grows satisfactorily in gardens in the UK climate, remaining in the garden from year to year by self-seeding. The leaves are edible and the plant is grown in gardens for that purpose in some parts of Europe. The plant is also commercially cultivated for borage seed oil extracted from its seeds.',	'31727',	'Borage',	'26.jpg',	'image/jpeg',	127785,	'2012-04-20 09:39:14',	26,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	13363,	1,	'FOOD00026'),
(27,	'Chinese mustard',	'Brassica juncea',	'Brassica juncea, also known as mustard greens, Indian mustard, Chinese mustard, and leaf mustard, is a species of mustard plant. Subvarieties include southern giant curled mustard, which resembles a headless cabbage such as kale, but with a distinct horseradish-mustard flavor. It is also known as green mustard cabbage.',	'23059',	'Brassica juncea',	'27.jpg',	'image/jpeg',	69555,	'2012-04-20 09:36:31',	27,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3707,	1,	'FOOD00027'),
(28,	'Swede',	'Brassica napus',	'The swede (from Swedish turnip), rutabaga, turnip, yellow turnip, or neep (Brassica napobrassica, or Brassica napus var. napobrassica, or Brassica napus subsp. rapifera) is a root vegetable that originated as a cross between the cabbage and the turnip. The roots are prepared for human food in a variety of ways, and the leaves can be eaten as a leaf vegetable. The roots and tops are also used as winter feed for livestock, when they may be fed directly, or by allowing the animals to forage the plants in the field.',	'23060',	'Rutabaga',	'28.jpg',	'image/jpeg',	252530,	'2012-04-20 09:38:44',	28,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3708,	1,	'FOOD00028'),
(29,	'Rape',	'Brassica napus var. napus',	'Rapeseed (Brassica napus), also known as rape, oilseed rape, rapa, rappi, rapaseed (and, in the case of one particular group of cultivars, canola), is a bright yellow flowering member of the family Brassicaceae (mustard or cabbage family). The name derives from the Latin for turnip, r?pa or r?pum, and is first recorded in English at the end of the 14th century. Older writers usually distinguished the turnip and rape by the adjectives round and long (-rooted), respectively. See also Brassica napobrassica, which may be considered a variety of Brassica napus. Some botanists include the closely related Brassica campestris within B. napus.. Brassica napus is cultivated mainly for its oil-rich seed, the third largest source of vegetable oil in the world.',	'530955',	'Rapeseed',	'29.jpg',	'image/jpeg',	107459,	'2012-04-20 09:32:03',	29,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	138011,	1,	'FOOD00029'),
(30,	'Common cabbage',	'Brassica oleracea',	'Brassica oleracea is the species of plant that includes many common foods as cultivars, including cabbage, broccoli, cauliflower, kale, Brussels sprouts, savoy, and Chinese kale. In its uncultivated form it is known as wild cabbage. It is native to coastal southern and western Europe. Its tolerance of salt and lime and its intolerance of competition from other plants typically restrict its natural occurrence to limestone sea cliffs, like the chalk cliffs on both sides of the English Channel.\nB. oleracea has become established as an important human food crop plant, used because of its large food reserves, which are stored over the winter in its leaves. It is rich in essential nutrients including vitamin C. A diet rich in cruciferous vegetables (e.g., cabbage, broccoli, cauliflower) is linked to a reduced risk of several human cancers.',	'23062',	'Brassica_oleracea',	'30.jpg',	'image/jpeg',	146148,	'2012-04-20 09:35:56',	32,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	2,	0,	'specific',	3712,	1,	'FOOD00030'),
(31,	'Cauliflower',	'Brassica oleracea var. botrytis',	'Cauliflower is one of several vegetables in the species Brassica oleracea, in the family Brassicaceae. It is an annual plant that reproduces by seed. Typically, only the head (the white curd) is eaten. The cauliflower head is composed of a white inflorescence meristem. Cauliflower heads resemble those in broccoli, which differs in having flower buds.\nIts name is from Latin caulis (cabbage) and flower. Brassica oleracea also includes broccoli, brussels sprouts, cabbage, collard greens, and kale, though they are of different cultivar groups.\nCauliflower is low in fat, low in carbohydrates but high in dietary fiber, folate, water, and vitamin C, possessing a high nutritional density.\nCauliflower can be roasted, boiled, fried, steamed, or eaten raw.',	'530957',	'Cauliflower',	'31.jpg',	'image/jpeg',	8882,	'2012-04-20 09:33:20',	33,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3715,	1,	'FOOD00031'),
(32,	'Brussel sprouts',	'Brassica oleracea var. gemmifera',	'The Brussels sprout is a cultivar in the Gemmifera group of cabbages, grown for its edible buds. The leafy green vegetables are typically 2.5–4 cm (0.98–1.6 in) in diameter and look like miniature cabbages. The Brussels sprout has long been popular in Brussels, Belgium, and may have originated there.',	'530959',	'Brussels sprout',	'32.jpg',	'image/jpeg',	98545,	'2012-04-20 09:29:05',	34,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	178616,	1,	'FOOD00032'),
(33,	'Kohlrabi',	'Brassica oleracea var. gongylodes',	'Kohlrabi (German turnip or turnip cabbage) (Brassica oleracea Gongylodes group) (Olkopi in Assamese and Bengali) (Monji Haak in Kashmiri) is an annual vegetable, and is a low, stout cultivar of cabbage. Kohlrabi can be eaten raw as well as cooked.\nKohlrabi stems are surrounded by two distinct fibrous layers that do not soften appreciably when cooked. These layers are generally peeled away prior to cooking or serving raw, with the result that the stems often provide a smaller amount of food than one might assume from their intact appearance.\nThe Kohlrabi root is frequently used raw in salad or slaws. It has a texture similar to that of a broccoli stem, but with a flavor that is sweeter and less vegetal.\nKohlrabi leaves are edible and can be used interchangeably with collard and kale.\nKohlrabi is an important part of the Kashmiri diet and one of the most commonly cooked foods. It is prepared with its leaves and served with a light gravy and eaten with rice.\nSome varieties are grown as feed for cattle.',	'530960',	'Kohlrabi',	'33.jpg',	'image/jpeg',	101642,	'2012-04-20 09:30:26',	35,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	109379,	1,	'FOOD00033'),
(34,	'Broccoli',	'Brassica oleracea var. italica',	'Broccoli is an edible green plant in the cabbage family, whose large flowering head is used as a vegetable. The word broccoli comes from the Italian plural of broccolo, which means \"the flowering top of a cabbage\", and is the diminutive form of brocco, meaning \"small nail\" or \"sprout\". Broccoli is often boiled or steamed but may be eaten raw.',	'530961',	'Broccoli',	'34.jpg',	'image/jpeg',	319365,	'2012-04-20 09:35:09',	36,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	1,	'specific',	36774,	1,	'FOOD00034'),
(35,	'Chinese cabbage',	'Brassica rapa',	'Chinese cabbage (Brassica rapa, subspecies pekinensis and chinensis) can refer to two distinct varieties of Chinese leaf vegetables often used in Chinese cuisine: Pekinensis (napa cabbage) and Chinensis (bok choi).\nThese vegetables are both variant cultivars or subspecies of the turnip and belong to the same genus as such Western staples as cabbage, broccoli, and cauliflower. Both have many variations in name, spelling, and scientific classification?especially the bok choy (B. rapa chinensis) variety.',	'23063',	'Chinese_cabbage',	'35.jpg',	'image/jpeg',	22799,	'2012-04-20 09:44:30',	37,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3711,	1,	'FOOD00035'),
(36,	'Turnip',	'Brassica rapa var. rapa',	'The turnip or white turnip (Brassica rapa subsp. rapa) is a root vegetable commonly grown in temperate climates worldwide for its white, bulbous taproot. Small, tender varieties are grown for human consumption, while larger varieties are grown as feed for livestock.\nIn the north of England and Scotland, turnip (or neep; the word turnip itself is an old compound of neep) refers to the larger, yellow rutabaga root vegetable which is also known as the \"swede\" (from \"Swedish turnip\").',	'526965',	'Turnip',	'36.jpg',	'image/jpeg',	54139,	'2012-04-20 09:41:32',	39,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	1,	'specific',	51350,	1,	'FOOD00036'),
(37,	'Pigeon pea',	'Cajanus cajan',	'The pigeon pea (Cajanus cajan) is a perennial legume from the family Fabaceae. Since its domestication in India at least 3,500 years ago, its seeds have become a common food grain in Asia, Africa, and Latin America. It is consumed on a large scale mainly in south Asia and is a major source of protein for the population of that subcontinent. Pigeon peas are both a food crop (dried peas, flour, or green vegetable peas) and a forage/cover crop. In combination with cereals, pigeon peas make a well-balanced human food. The dried peas may be sprouted briefly, then cooked, for a flavor different from the green or dried peas. Sprouting also enhances the digestibility of dried pigeon peas via the reduction of indigestible sugars that would otherwise remain in the cooked dried peas. Pigeon peas contain high levels of protein and the important amino acids methionine, lysine, and tryptophan. [Wikipedia]',	'26516',	'Pigeon pea',	'37.jpg',	'image/jpeg',	95750,	'2012-04-20 09:44:09',	40,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:16',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3821,	1,	'FOOD00037'),
(38,	'Tea',	'Camellia sinensis',	'Tea is an aromatic beverage commonly prepared by pouring hot or boiling water over cured leaves of the tea plant, Camellia sinensis. After water, tea is the most widely consumed beverage in the world. It has a cooling, slightly bitter, and astringent flavour that many people enjoy.',	'506801',	'Tea',	'38.jpg',	'image/jpeg',	52986,	'2012-04-20 09:36:34',	41,	'Teas',	'Teas',	'Type 1',	'2011-02-09 00:37:17',	'2019-12-11 19:31:59',	NULL,	2,	0,	'specific',	4442,	0,	'FOOD00038'),
(39,	'Capers',	'Capparis spinosa',	'Capparis spinosa, the caper bush, also called Flinders rose, is a perennial winter-deciduous plant that bears rounded, fleshy leaves and large white to pinkish-white flowers. The plant is best known for the edible flower buds (capers), often used as a seasoning, and the fruit (caper berry), both of which are usually consumed pickled. Other species of Capparis are also picked along with C. spinosa for their buds or fruits. Other parts of Capparis plants are used in the manufacture of medicines and cosmetics.',	'505885',	'Capers',	'39.jpg',	'image/jpeg',	31305,	'2012-04-20 09:32:22',	42,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	65558,	1,	'FOOD00039'),
(40,	'Pepper',	'Capsicum annuum',	'<i>Capsicum annuum</i> is a domesticated species of the plant genus <i>Capsicum</i> native to southern North America and northern South America. The three species <i>C. annuum</i>, <i>C. frutescens</i> and <i>C. chinense</i> all evolved from a single common ancestor located somewhere in the northwest Brazil - Colombia area. <i>Capsicum annuum</i> is the most common and extensively cultivated of the five domesticated capsicums. The species is a source of popular \"sweet peppers\":http://en.wikipedia.org/wiki/Bell_peppers and \"hot chilis\":http://en.wikipedia.org/wiki/Chili_pepper with numerous varieties cultivated all around the world. In American English the plant is commonly known as a chili pepper or bell pepper. In British English, the sweet varieties are called red or green peppers and the hot varieties chillies, whereas in Australian and Indian English the name capsicum is commonly used for bell peppers exclusively and chilli is often used to encompass the hotter varieties. [Wikipedia] See a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30492',	'Capsicum_annuum',	'40.jpg',	'image/jpeg',	45222,	'2012-04-20 09:37:27',	43,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	2,	0,	'specific',	4072,	1,	'FOOD00040'),
(41,	'Papaya',	'Carica papaya',	'The papaya, papaw, or pawpaw is the fruit of the plant Carica papaya, the sole species in the genus Carica of the plant family Caricaceae. It is native to the tropics of the Americas, perhaps from southern Mexico and neighbouring Central America. It was first cultivated in Mexicoseveral centuries before the emergence of the Mesoamerican classical civilizations. The papaya is a large, tree-like plant, with a single stem growing from 5 to 10 m (to ft) tall, with spirally arranged leaves confined to the top of the trunk. The lower trunk is conspicuously scarred where leaves and fruit were borne. The leaves are large, 50–70 cm in diameter, deeply palmately lobed, with seven lobes. Unusually for such large plants, the trees are dioecious. The tree is usually unbranched, unless lopped. The flowers are similar in shape to the flowers of the Plumeria, but are much smaller and wax-like. They appear on the axils of the leaves, maturing into large fruit - 15–45 cm long and 10–30 cm in diameter. The fruit is ripe when it feels soft (as soft as a ripe avocado or a bit softer) and its skin has attained an amber to orange hue. Carica papaya was the first transgenic fruit tree to have its genome deciphered.',	'22324',	'Papaya',	'41.jpg',	'image/jpeg',	67743,	'2012-04-20 09:44:24',	44,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3649,	1,	'FOOD00041'),
(42,	'Safflower',	'Carthamus tinctorius',	'Safflower is a highly branched, herbaceous, thistle-like annual. It is commercially cultivated for vegetable oil extracted from the seeds. Plants are 30 to 150 cm (to in) tall with globular flower heads having yellow, orange, or red flowers. Each branch will usually have from one to five flower heads containing 15 to 20 seeds per head. Safflower is native to arid environments having seasonal rain. It grows a deep taproot which enables it to thrive in such environments.',	'501305',	'Safflower',	'42.jpg',	'image/jpeg',	61156,	'2012-04-20 09:30:28',	45,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	4222,	1,	'FOOD00042'),
(43,	'Caraway',	'Carum carvi',	'Caraway (Carum carvi), also known as meridian fennel, or Persian cumin, is a biennial plant in the family Apiaceae, native to western Asia, Europe and Northern Africa. The plant is similar in appearance to other members of the carrot family, with finely divided, feathery leaves with thread-like divisions, growing on 20–30 cm stems. The main flower stem is 40–60 cm tall, with small white or pink flowers in umbels. Caraway fruits are crescent-shaped achenes, around 2 mm long, with five pale ridges.',	'29610',	'Caraway',	'43.jpg',	'image/jpeg',	59897,	'2012-04-20 09:38:36',	46,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	48032,	1,	'FOOD00043'),
(44,	'Pecan nut',	'Carya illinoinensis',	'The pecan (Carya illinoinensis) are the fruit of a kind of hickory tree, native to North America and Mexico. Pecans were one of the most recently domesticated major crops. Although wild pecans were well known among native and colonial Americans as a delicacy, the commercial growing of pecans in the United States did not begin until the 1880s. Today, the U.S. produces between 80% and 95% of the world\'s pecans, with an annual crop of 150–200 thousand tons.\r\n\r\nIn 100 g, pecans provide 691 Calories and over 100% of the Daily Value (DV) for total fat. Pecans are a rich source of dietary fiber (38% DV), manganese (214% DV), magnesium (34% DV), phosphorus (40% DV), zinc (48% DV) and thiamin (57% DV).[20] Pecans are also a good source (10-19% DV) of protein, iron, and B vitamins. Their fat content consists mainly of monounsaturated fatty acids, mainly oleic acid (57% of total fat), and the polyunsaturated fatty acid linoleic acid (30% of total fat) [Wikipedia]',	'19234',	'Pecan_nut',	'44.jpg',	'image/jpeg',	40083,	'2012-04-20 09:33:57',	47,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	32201,	1,	'FOOD00044'),
(45,	'Chestnut',	'Castanea',	'A chestnut is the seed of a tree related to the oak tree, which grows in the northern hemisphere. It grows its seeds in a spikey shell.\nChestnuts can be eaten raw but they do not taste very good this way. They are most often roasted before you eat them, but they can also be eaten candied, boiled, steamed, grilled or used as a stuffing.\n',	'19451',	'Chestnut',	'45.jpg',	'image/jpeg',	307496,	'2012-04-20 09:30:34',	48,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	21019,	1,	'FOOD00045'),
(46,	'Roman camomile',	'Chamaemelum nobile',	'Chamaemelum nobile, commonly known as chamomile (also spelled camomile), Roman chamomile, English chamomile, garden chamomile, ground apple, low chamomile, or whig plant, is a low perennial plant found in dry fields and around gardens and cultivated grounds in Europe, North America, and Argentina. C. nobile is, along with Matricaria chamomilla, an important source of the herbal product known as chamomile.',	'501396',	'Chamaemelum nobile',	'46.jpg',	'image/jpeg',	52596,	'2012-04-20 09:39:41',	49,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	99037,	1,	'FOOD00046'),
(47,	'Chickpea',	'Cicer arietinum',	'The chickpea (Cicer arietinum) is a legume of the family Fabaceae, subfamily Faboideae. Its seeds are high in protein. It is one of the earliest cultivated legumes: 7,500-year-old remains have been found in the Middle East. Other common names for the species include garbanzo bean, ceci bean, sanagalu, chana, hummus and Bengal gram.',	'26537',	'Chickpea',	'47.jpg',	'image/jpeg',	40809,	'2012-04-20 09:30:19',	50,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:14',	NULL,	NULL,	0,	'specific',	3827,	1,	'FOOD00047'),
(48,	'Endive',	'Cichorium endivia',	'Endive, Cichorium endivia, is a leaf vegetable belonging to the daisy family. Endive can be cooked or used raw in salads. Endive is rich in many vitamins and minerals, especially in folate and vitamins A and K, and is high in fiber. There are two main varieties of cultivated C. endivia endive: (1) Curly endive, or frisée (var crispum). This type has narrow, green, curly outer leaves. It is sometimes called chicory in the United States and is called chicorée frisée in French. Further confusion results from the fact that frisée also refers to greens lightly wilted with oil. (2) Escarole, or broad-leaved endive (var latifolia), has broad, pale green leaves and is less bitter than the other varieties. Varieties or names include broad-leaved endive, Bavarian endive, Batavian endive, grumolo, scarola, and scarole. It is eaten like other greens, sauteed, chopped into soups and stews, or as part of a green salad (Wikipedia).',	'501522',	'Endive',	'48.jpg',	'image/jpeg',	102300,	'2012-04-20 09:29:28',	51,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	114280,	1,	'FOOD00048'),
(49,	'Chicory',	'Cichorium intybus',	'Common chicory, Cichorium intybus, is a somewhat woody, perennial herbaceous plant usually with bright blue flowers, rarely white or pink. Many varieties are cultivated for salad leaves, chicons (blanched buds), or for roots (var. sativum), which are baked, ground, and used as a coffee substitute and additive. It is also grown as a forage crop for livestock. It lives as a wild plant on roadsides in its native Europe, and in North America and Australia, where it has become widely naturalized.',	'36763',	'Chicory',	'49.jpg',	'image/jpeg',	24448,	'2012-04-20 09:31:19',	52,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	13427,	1,	'FOOD00049'),
(50,	'Chinese cinnamon',	'Cinnamomum aromaticum',	'Cinnamomum cassia, called Chinese cassia or Chinese cinnamon, is an evergreen tree originating in southern China, and widely cultivated there and elsewhere in southern and eastern Asia (India, Indonesia, Laos, Malaysia, Taiwan, Thailand, and Vietnam). It is one of several species of Cinnamomum that are used primarily for their aromatic bark, which is used as a spice. In the United States of America, Chinese cassia is often sold under the culinary name of \"cinnamon\". The buds are also used as a spice, especially in India, and were once used by the ancient Romans.',	'506205',	'Chinese_cinnamon',	'50.jpg',	'image/jpeg',	191758,	'2012-04-20 09:41:16',	53,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	119260,	1,	'FOOD00050'),
(51,	'Ceylon cinnamon',	'Cinnamomum verum',	'Cinnamomum verum, called \"true cinnamon\", Ceylon cinnamon or Sri Lanka cinnamon is a small evergreen tree belonging to the family Lauraceae, native to Sri Lanka. Among other species, its inner bark is used to make cinnamon.',	'501529',	'Cinnamomum_verum',	'51.jpg',	'image/jpeg',	78970,	'2012-04-20 09:43:25',	54,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	128608,	1,	'FOOD00051'),
(52,	'Watermelon',	'Citrullus lanatus',	'Watermelon (Citrullus lanatus, family Cucurbitaceae) is a vine-like (scrambler and trailer) flowering plant originally from southern Africa. Its fruit, which is also called watermelon, is a special kind referred to by botanists as a pepo, a berry which has a thick rind and fleshy center (mesocarp and endocarp). Pepos are derived from an inferior ovary, and are characteristic of the Cucurbitaceae. The watermelon fruit, loosely considered a type of melon – although not in the genus Cucumis – has a smooth exterior rind (green, yellow and sometimes white) and a juicy, sweet interior flesh (usually deep red to pink, but sometimes orange, yellow and even green if not ripe).',	'22356',	'Watermelon',	'52.jpg',	'image/jpeg',	125818,	'2012-04-20 09:40:24',	55,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3654,	1,	'FOOD00052'),
(53,	'Lime',	'Citrus aurantiifolia',	'The Key lime (Citrus × aurantiifolia) is a citrus species with a globose fruit, 2.5-5 cm in diameter (1-2 in), that is yellow when ripe but usually picked green commercially. It is smaller and seedier, with a higher acidity, a stronger aroma, and a thinner rind, than that of the Persian lime (Citrus × latifolia). It is valued for its unique flavor compared to other limes, with the Key lime usually having a more tart and bitter flavor. The name comes from its association with the Florida Keys, where it is best known as the flavoring ingredient in Key lime pie. It is also known as West Indian lime, bartender\'s lime, Omani lime, or Mexican lime, the latter classified as a distinct race with a thicker skin and darker green color. Philippine varieties have various names, including dayap and bilolo.',	'506403',	'Citrus_aurantiifolia',	'53.jpg',	'image/jpeg',	803141,	'2012-04-20 09:37:28',	56,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	159033,	1,	'FOOD00053'),
(54,	'Lemon',	'Citrus limon',	'The lemon is a small evergreen tree native to Asia, and the tree\'s ellipsoidal yellow fruit. The fruit is used for culinary and non-culinary purposes throughout the world, primarily for its juice, though the pulp and rind are also used in cooking and baking. The juice of the lemon is about 5% to 6% citric acid, which gives lemons a sour taste. The distinctive sour taste of lemon juice makes it a key ingredient in drinks and foods such as lemonade.',	'28885',	'Lemon',	'54.jpg',	'image/jpeg',	286671,	'2012-04-20 09:34:12',	57,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	2708,	1,	'FOOD00054'),
(55,	'Pummelo',	'Citrus maxima',	'The pomelo (Citrus maxima or Citrus grandis), pummelo, pommelo, or shaddock is a crisp citrus fruit native to South and Southeast Asia. It is usually pale green to yellow when ripe, with sweet white (or, more rarely, pink or red) flesh and very thick albedo (rind pith). It is the largest citrus fruit, 15–25 centimetres (&#160) in diameter, and usually weighing 1–2 kilograms (&#160).',	'501574',	'Pomelo',	'55.jpg',	'image/jpeg',	458758,	'2012-04-20 09:39:37',	58,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	37334,	1,	'FOOD00055'),
(56,	'Mandarin orange (Clementine, Tangerine)',	'Citrus reticulata',	'The Mandarin orange, also known as the mandarin or mandarine, is a small citrus tree (Citrus reticulata) with fruit resembling other oranges. Mandarin oranges are usually eaten plain or in fruit salads. Specifically reddish-orange mandarin cultivars can be marketed as tangerines, but this is not a botanical classification. When exporting began, local Mandarin oranges were named after their port of origin.',	'28888',	'Mandarin_orange',	'56.jpg',	'image/jpeg',	100109,	'2012-04-20 09:34:11',	59,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:17',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	85571,	1,	'FOOD00056'),
(57,	'Sweet orange',	'Citrus sinensis',	'The orange (specifically, the sweet orange) is the fruit of the citrus species Citrus × sinensis in the family Rutaceae.The fruit of the Citrus sinensis is considered a sweet orange, whereas the fruit of the Citrus aurantium is considered a bitter orange. The orange is a hybrid, possibly between pomelo (Citrus maxima) and mandarin (Citrus reticulata), which has been cultivated since ancient times.',	'28889',	'Sweet_orange',	'57.jpg',	'image/jpeg',	110752,	'2012-04-20 09:36:15',	60,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	2711,	1,	'FOOD00057'),
(58,	'Coffee',	'Coffea',	'Coffee is a brewed beverage prepared from the roasted or baked seeds of several species of an evergreen shrub of the genus Coffea. The two most common sources of coffee beans are the highly regarded Coffea arabica, and the \"robusta\" form of the hardier Coffea canephora. The latter is resistant to the coffee leaf rust (Hemileia vastatrix), but has a more bitter taste. Coffee plants are cultivated in more than 70 countries, primarily in equatorial Latin America, Southeast Asia, and Africa. Once ripe, coffee \"berries\" are picked, processed and dried to yield the seeds inside. The seeds are then roasted to varying degrees, depending on the desired flavor, before being ground and brewed to create coffee.',	'35189',	'Coffee',	'58.jpg',	'image/jpeg',	105802,	'2012-04-20 09:35:09',	62,	'Coffee and coffee products',	'Coffee',	'Type 1',	'2011-02-09 00:37:18',	'2019-12-11 19:32:21',	NULL,	NULL,	0,	'generic',	13442,	0,	'FOOD00058'),
(59,	'Arabica coffee',	'Coffea arabica',	'Coffea arabica is a species of Coffea originally indigenous to the mountains of the southwestern highlands of Ethiopia. It is also known as the \"coffee shrub of Arabia\", \"mountain coffee\" or \"arabica coffee\". Coffea arabica is believed to be the first species of coffee to be cultivated, being grown in southwest Ethiopia for well over 1,000 years.\nIt is said to produce better tasting coffee than the other major commercially grown coffee species, Coffea canephora (robusta), because robusta cherries contain twice as much caffeine as arabica. Caffeine itself has a bitter taste, making robusta more bitter. C. arabica contains less caffeine than any other commercially cultivated species of coffee.',	'35190',	'Arabica_coffee',	'59.jpg',	'image/jpeg',	114786,	'2012-04-20 09:39:17',	63,	'Coffee and coffee products',	'Coffee',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	13443,	1,	'FOOD00059'),
(60,	'Robusta coffee',	'Coffea canephora',	'Robusta coffee (Coffea canephora; syn. Coffea robusta) is a variety of coffee, which has its origins in central and western sub-Saharan Africa. It is a species of flowering plant in the Rubiaceae family. Though widely known as Coffea robusta, the plant is scientifically identified as Coffea canephora, which has two main varieties - Robusta and Nganda.',	'506060',	'Robusta coffee',	'60.jpg',	'image/jpeg',	183178,	'2012-04-20 09:41:11',	64,	'Coffee and coffee products',	'Coffee',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	49390,	1,	'FOOD00060'),
(61,	'Coriander',	'Coriandrum sativum',	'Coriander (Coriandrum sativum), also known as cilantro, Chinese parsley or dhania, is an annual herb in the family Apiaceae. Coriander is native to regions spanning from southern Europe and North Africa to southwestern Asia. It is a soft, hairless plant growing to 50 cm tall. The leaves are variable in shape, broadly lobed at the base of the plant, and slender and feathery higher on the flowering stems. The flowers are borne in small umbels, white or very pale pink, asymmetrical, with the petals pointing away from the centre of the umbel longer (5–6 mm) than those pointing towards it (only 1–3 mm long). The fruit is a globular, dry schizocarp 3–5 mm (&#160) in diameter.',	'29622',	'Coriander',	'61.jpg',	'image/jpeg',	147926,	'2012-04-20 09:38:52',	65,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	4047,	1,	'FOOD00061'),
(62,	'Common hazelnut',	'Corylus avellana',	'Corylus avellana, the Common Hazel, is a species of hazel native to Europe and western Asia, from the British Isles south to Iberia, Greece, Turkey and Cyprus, north to central Scandinavia, and east to the central Ural Mountains, the Caucasus, and northwestern Iran. It is an important component of the hedgerows that were the traditional field boundaries in lowland England. The wood was traditionally grown as coppice, the poles cut being used for wattle-and-daub building and agricultural fencing. Common Hazel is cultivated for its nuts. The name hazelnut applies to the nuts of any of the species of the genus Corylus. This hazelnut or cob nut, the kernel of the seed, is edible and used raw or roasted, or ground into a paste. The cob is round, compared with the longer filbert nut.',	'501642',	'Corylus avellana',	'62.jpg',	'image/jpeg',	30284,	'2012-04-20 09:38:19',	66,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	13451,	1,	'FOOD00062'),
(63,	'Saffron',	'Crocus sativus',	'Saffron is a spice derived from the flower of Crocus sativus, commonly known as the saffron crocus. Crocus is a genus in the family Iridaceae. Saffron crocus grows to 20-30 cm (8-12 in) and bears up to four flowers, each with three vivid crimson stigmas, which are the distal end of a carpel. Together with the styles, or stalks that connect the stigmas to their host plant, the dried stigmas are used mainly in various cuisines as a seasoning and colouring agent. Saffron, long among the world\'s most costly spices by weight, is native to Greece or Southwest Asia and was first cultivated in Greece. As a genetically monomorphic clone, it was slowly propagated throughout much of Eurasia and was later brought to parts of North Africa, North America, and Oceania.\r\n\r\nSaffron\'s taste and iodoform or hay-like fragrance result from the chemicals picrocrocin and safranal. It also contains a carotenoid pigment, crocin, which imparts a rich golden-yellow hue to dishes and textiles. Its recorded history is attested in a 7th-century BC Assyrian botanical treatise compiled under Ashurbanipal, and it has been traded and used for over four millennia. Iran now accounts for approximately 90% of the world production of saffron.',	'501794',	'Saffron',	'63.jpg',	'image/jpeg',	108338,	'2012-04-20 09:42:34',	67,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	82528,	1,	'FOOD00063'),
(64,	'Muskmelon',	'Cucumis melo',	'Muskmelon (Cucumis melo) is a species of melon that has been developed into many cultivated varieties. These include smooth skinned varieties such as honeydew, crenshaw and casaba, and different netted cultivars (cantaloupe, Persian melon and Santa Claus or Christmas melon). The Armenian cucumber is also a variety of muskmelon, but its shape, taste, and culinary uses more closely resemble those of a cucumber. The large number of cultivars in this species approaches that found in wild cabbage, though morphological variation is not as extensive. It is a fruit of a type called pepo. Muskmelon is native to Persia, Anatolia, Armenia, and adjacent areas on the west and the east which is believed to be their center of origin and development, with a secondary center including the northwest provinces of India and Afghanistan. Although truly wild forms of C. melo have not been found, several related wild species have been noted in those regions.',	'22362',	'Muskmelon',	'64.jpg',	'image/jpeg',	130759,	'2012-04-20 09:39:44',	68,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3656,	1,	'FOOD00064'),
(65,	'Cucumber',	'Cucumis sativus',	'Cucumber (Cucumis sativus) is a widely cultivated plant in the gourd family Cucurbitaceae. It is a creeping vine that bears cylindrical fruits that are used as culinary vegetables. There are three main varieties of cucumber: slicing, pickling, and burpless. Within these varieties, several different cultivars have emerged. The cucumber is originally from Southern Asia, but now grows on most continents. Many different varieties are traded on the global market.',	'22364',	'Cucumber',	'65.jpg',	'image/jpeg',	117101,	'2012-04-20 09:30:14',	69,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	1,	'specific',	3659,	1,	'FOOD00065'),
(66,	'Cucurbita',	'Cucurbita',	'Cucurbita (Latin for gourd) is a genus in the gourd family Cucurbitaceae native to and originally cultivated in the Andes and Mesoamerica. The Cucurbita genus is an important source of human food and is used for other purposes such as beverages, medicine, oil, and detergent. Some Cucurbita species were brought to Europe after the discovery of America and are now used in many parts of the world. The plants, referred to as squash, pumpkin or gourd depending on species, variety and local parlance, are grown for their edible fruits and seeds. Real (bottle-)gourds, used as utensils or vessels, belong to the genus Lagenaria and are native to Africa. Lagenaria are in the same family and subfamily as Cucurbita, but different tribes.',	'22365',	'Cucurbita',	'66.jpg',	'image/jpeg',	68015,	'2012-04-20 09:30:13',	72,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3660,	1,	'FOOD00066'),
(67,	'Cumin',	'Cuminum cyminum',	'Cumin (Cuminum cyminum) is a flowering plant in the family Apiaceae as caraway, parsley, and dill., native from the east Mediterranean to India. Its seeds (each one contained within a fruit, which is dried) are used in the cuisines of many different cultures, in both whole and ground form. It also has many uses as a traditional medicinal plant.  In the ancient Egyptian civilization, cumin was used as spice and as preservative in mummification. Cumin seed is used as a spice for its distinctive flavour and aroma. Cumin can be found in some cheeses, such as Leyden cheese, and in some traditional breads from France. Cumin can be an ingredient in chili powder (often Tex-Mex or Mexican-style), and is found in achiote blends, adobos, sofrito, garam masala, curry powder, and bahaarat. In South Asian cooking, it is often combined with coriander seeds in a powdered mixture called dhana jeera. Cumin\'s distinctive flavour is strong. It has a warm aroma due to its essential oil content. Its main constituent aroma compounds are cuminaldehyde (a promising agent against alpha-synuclein aggregation) and cuminic alcohol. Other important aroma compounds of toasted cumin are the substituted pyrazines, 2-ethoxy-3-isopropylpyrazine, 2-methoxy-3-sec-butylpyrazine, and 2-methoxy-3-methylpyrazine. Other components include γ-terpinene, safranal, p-cymene and β-pinene  [Wikipedia]',	'501839',	'Cumin',	'67.jpg',	'image/jpeg',	73485,	'2012-04-20 09:32:32',	73,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	52462,	1,	'FOOD00067'),
(68,	'Turmeric',	'Curcuma longa',	'Turmeric (Curcuma longa) is a rhizomatous herbaceous perennial plant of the ginger family, Zingiberaceae. It is native to tropical Tamil Nadu, in southeast India, and needs temperatures between 20 °C and 30 °C (68 °F and 86 °F) and a considerable amount of annual rainfall to thrive. Plants are gathered annually for their rhizomes, and propagated from some of those rhizomes in the following season.\nIt is one of the key ingredients in many Asian dishes. Tamil traditional medicine, called Siddha, has recommended turmeric in food for its potential medicinal value, which is a topic of active research. Its use as a coloring agent is not of primary value in South Asian cuisine.',	'42394',	'Turmeric',	'68.jpg',	'image/jpeg',	105964,	'2012-04-20 09:37:49',	74,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	136217,	1,	'FOOD00068'),
(69,	'Quince',	'Cydonia oblonga',	'The quince (Cydonia oblonga) is the sole member of the genus Cydonia in the family Rosaceae (which also contains apples and pears, among other fruits). It is a small deciduous tree that bears a pome fruit, similar in appearance to a pear, and bright golden-yellow when mature. Throughout history the cooked fruit has been used as food, but the tree is also grown for its attractive pale pink blossom and other ornamental qualities.',	'25159',	'Quince',	'69.jpg',	'image/jpeg',	582943,	'2012-04-20 09:29:08',	75,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	36610,	1,	'FOOD00069'),
(70,	'Lemon grass',	'Cymbopogon citratus',	'Cymbopogon citratus, commonly known as lemon grass or oil grass, is a tropical plant from Southeast Asia. Cymbopogon citratus is abundant in the Philippines and Indonesia where it is known as tanglad or sereh. Its fragrant leaves are traditionally used in cooking, particularly for \"lechon\" and roasted chicken. The dried leaves can also be brewed into a tea, either alone or as a flavoring in other teas, imparting a flavor reminiscent of lemon juice but with a mild sweetness without significant sourness or tartness. [Wikipedia]',	'41613',	'Cymbopogon citratus',	'70.jpg',	'image/jpeg',	51480,	'2012-04-20 09:42:46',	76,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	66014,	1,	'FOOD00070'),
(71,	'Globe artichoke',	'Cynara scolymus',	'The globe artichoke (Cynara cardunculus var. scolymus) is a cultivated variety of a species of thistle. It is cultivated as a food. The edible matter is buds that form within the flower heads before the flowers come into bloom. The buds go away or change to a coarse, barely edible form when the flower blooms. The uncultivated or wild variety of the species is called a cardoon. It is a perennial plant native to the Mediterranean region.',	'37222',	'Artichoke',	'71.jpg',	'image/jpeg',	287703,	'2012-04-23 10:27:37',	77,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	2,	0,	'specific',	59895,	1,	'FOOD00071'),
(72,	'Wild carrot',	'Daucus carota',	'<i>Daucus carota</i>, whose common names include wild carrot, bird\'s nest, bishop\'s lace, and Queen Anne\'s lace (North America), is a flowering plant in the family <i>Apiaceae</i>, native to temperate regions of Europe, southwest Asia and naturalized to North America and Australia. Domesticated carrots are cultivars of a subspecies, <i>Daucus carota</i> subsp. <i>sativus</i>.',	'29477',	'Daucus carota',	'Carrot.jpg',	'image/jpeg',	111045,	'2015-02-27 18:22:25',	78,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	4039,	1,	'FOOD00072'),
(73,	'Japanese persimmon',	'Diospyros kaki',	'Diospyros kaki, better known as the Japanese Persimmon, Kaki Persimmon (kaki [?]) or Asian Persimmon in North America, is the most widely cultivated species of the Diospyros genus. Although its first published botanical description was not until 1780, the kaki is also among the oldest plants in cultivation, known for its use in China for more than 2000 years. In some rural Chinese communities, the kaki fruit is seen as having a great mystical power that can be harnessed to solve headaches, back pains and foot ache .',	'505970',	'Japanese_persimmon',	'73.jpg',	'image/jpeg',	78375,	'2012-04-20 09:29:39',	79,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	35925,	1,	'FOOD00073'),
(74,	'Cardamom',	'Elettaria cardamomum',	'Cardamom (or cardamon) refers to several plants of the similar genera Elettaria and Amomum in the ginger family Zingiberaceae. Both genera are native to India, Nepal and Bhutan; they are recognised by their small seed pods, triangular in cross-section and spindle-shaped, with a thin, papery, outer shell and small black seeds. Today, Guatemala is the biggest producer and exporter of cardamom in the world, followed by India. Some other countries such as Sri Lanka have also begun to cultivate it. Elettaria pods are light green while Amomum pods are larger and dark brown. It is the world\'s third most expensive spice by weight, outstripped in market value only by saffron and vanilla.',	'506505',	'Cardamom',	'74.jpg',	'image/jpeg',	63840,	'2012-04-20 09:33:35',	80,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:18',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	105181,	1,	'FOOD00074'),
(75,	'Black crowberry',	'Empetrum nigrum',	'Empetrum nigrum is a species of crowberry known as black crowberry which is native to most northern areas of the northern hemisphere, as well as the Falkland Islands in the southern hemisphere. In gardening, it can be grown in acidic soils in shady, moist areas. It can be used for the edible berries, for a purple dye, or as a ground cover. The metabolism and photosynthetic parameters of Empretrum can be altered in winter-warming experiments',	'23743',	'Empetrum nigrum',	'75.jpg',	'image/jpeg',	136568,	'2012-04-20 09:29:42',	81,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	191066,	1,	'FOOD00075'),
(76,	'Loquat',	'Eriobotrya japonica',	'The loquat (Eriobotrya japonica) is a species of flowering plant in the family Rosaceae, native to south-central China. It is a large evergreen shrub or small tree, grown commercially for its yellow fruit, and also cultivated as an ornamental plant.\nEriobotrya japonica was formerly thought to be closely related to the genus Mespilus, and is still sometimes known as the Japanese medlar. It is also known as Japanese plum and Chinese plum. In Japan it is called biwa. And in China, it is called Lo Guat (??) in Cantonese and pipa (??) in Mandarin. In Turkey it is known as malta eri?i, meaning Maltese plum.\nLoquat fruits, growing in clusters, are oval, rounded or pear-shaped, 3?5 centimetres (1?2 in) long, with a smooth or downy, yellow or orange, sometimes red-blushed skin. The succulent, tangy flesh is white, yellow or orange and sweet to subacid or acid, depending on the cultivar.',	'502403',	'Loquat',	'76.jpg',	'image/jpeg',	92789,	'2012-04-20 09:29:54',	82,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	32224,	1,	'FOOD00076'),
(77,	'Rocket salad (ssp.)',	'Eruca vesicaria ssp. sativa',	'Eruca sativa (syn. E. vesicaria subsp. sativa (Miller) Thell., Brassica eruca L.) is an edible annual plant, commonly known as salad rocket, roquette, rucola, rugula, colewort, and, in the United States, arugula. It is sometimes conflated with Diplotaxis tenuifolia, the perennial wall rocket, another plant of the Brassicaceae family, which in the past was used in the same manner. Eruca sativa, which is widely popular as a salad vegetable, is a species of Eruca native to the Mediterranean region, from Morocco and Portugal in the west to Syria, Lebanon and Turkey in the east. The Latin adjective sativa in the plant\'s binomial is derived from satum, the supine of the verb sero, meaning \"to sow\", indicating that the seeds of the plant were sown in gardens. Eruca sativa differs from E. vesicaria in having early deciduous sepals. Some botanists consider it a subspecies of Eruca vesicaria: E. vesicaria subsp. sativa. Still others do not differentiate between the two.',	'524057',	'Rocket_(salad)',	'77.jpg',	'image/jpeg',	52274,	'2012-04-20 09:36:17',	83,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	29727,	1,	'FOOD00077'),
(78,	'Wax apple',	'Eugenia javanica',	'Syzygium samarangense (syn. Eugenia javanica) is a plant species in the Myrtaceae, native to an area that includes the Greater Sunda Islands , Malay Peninsula and the Andaman and Nicobar Islands, but introduced in prehistoric times to a wider area and now widely cultivated in the tropics. English common names include Jambu air (local Indonesian and Malay name), Champoo (a transliteration of the Thai name), lembu or lian-woo (from the native Taiwanese name; Chinese: 蓮霧; pinyin: liánwù; Pe̍h-ōe-jī: ... and Malay name), wax apple, love apple, java apple, royal apple, bell fruit (or bellfruit), Jamaican apple, water apple, mountain apple, cloud apple, wax jambu, and rose apple. It is commonly known as makopa in the Philippines.\r\nThe fruit is a bell-shaped, edible berry, with colors ranging from white, pale green, or green to red, purple, or crimson, to deep purple or even black, 4-6 cm long in wild plants.',	'27192',	'Wax_apple',	'78.jpg',	'image/jpeg',	127178,	'2012-04-20 09:33:42',	84,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	119950,	1,	'FOOD00078'),
(79,	'Common buckwheat',	'Fagopyrum esculentum',	'Buckwheat (Fagopyrum esculentum) is a plant cultivated for its grain-like seeds, and also used as a cover crop. Despite the name, buckwheat is not related to wheat, as it is not a grass; instead, buckwheat is related to sorrel, knotweed, and rhubarb. The cultivation of buckwheat grain declined sharply in the 20th century with the adoption of nitrogen fertilizer that increased the productivity of other staples. A related species, Fagopyrum tataricum (Tartary buckwheat) is also cultivated as a grain in the Himalayas.',	'502589',	'Buckwheat',	'79.jpg',	'image/jpeg',	165955,	'2012-04-20 09:39:01',	85,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3617,	1,	'FOOD00079'),
(80,	'Tartary buckwheat',	'Fagopyrum tataricum',	'Tartary buckwheat (Fagopyrum tataricum) also known as duckwheat, India buckwheat, India wheat, green buckwheat, or bitter buckwheat, is a domesticated food plant in the genus Fagopyrum (sometimes merged into the genus Polygonum) in the family Polygonaceae. With another species in the same genus, common buckwheat, it is often counted as a cereal, but unlike the true cereals the buckwheats are not members of the grass family. Thus they are not related to true wheat. Tartary buckwheat is bitterer, but contains more rutin than common buckwheat. It also contains quercitrin. Tartar buckwheat was domesticated in east Asia. While it is unfamiliar to the West, it is still eaten in the Himalayan region today.',	'21283',	'Fagopyrum tataricum',	'80.jpg',	'image/jpeg',	47996,	'2012-04-20 09:33:18',	86,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	62330,	1,	'FOOD00080'),
(81,	'Fig',	'Ficus carica',	'The common fig (Ficus carica) is a species of flowering plant in the genus Ficus, from the family Moraceae, known as the common fig (or just the fig), انجیر  (Urdu), anjeer (Hindi), and dumur (Bengali). It is the source of the fruit also called the fig, and as such is an important crop in those areas where it is grown commercially. Native to the Middle East and western Asia, it has been sought out and cultivated by man since ancient times, and is now widely grown throughout the temperate world, both for its fruit and as an ornamental plant. Figs can be eaten fresh or dried, and used in jam-making. ',	'19093',	'Ficus_carica',	'81.jpg',	'image/jpeg',	309098,	'2012-04-20 09:44:32',	87,	'Fruits',	'Other fruits',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3494,	1,	'FOOD00081'),
(82,	'Fennel',	'Foeniculum vulgare',	'Fennel (Foeniculum vulgare) is a plant species in the genus Foeniculum (treated as the sole species in the genus by most botanists). It is a member of the family Apiaceae (formerly the Umbelliferae). It is a hardy, perennial, umbelliferous herb, with yellow flowers and feathery leaves. It is indigenous to the shores of the Mediterranean but has become widely naturalized in many parts of the world, especially on dry soils near the sea-coast and on riverbanks. It is a highly aromatic and flavorful herb with culinary and medicinal uses and, along with the similar-tasting anise, is one of the primary ingredients of absinthe. Florence fennel or finocchio is a selection with a swollen, bulb-like stem base that is used as a vegetable. Fennel is used as a food plant by the larvae of some Lepidoptera species including the mouse moth and the anise swallowtail.',	'29509',	'Fennel',	'82.jpg',	'image/jpeg',	102175,	'2012-04-20 09:30:27',	88,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	48038,	1,	'FOOD00082'),
(83,	'Strawberry',	'Fragaria X ananassa',	'The garden strawberry (or simply strawberry; Fragaria × ananassa) is a widely grown hybrid species of the genus Fragaria (collectively known as the strawberries). It is cultivated worldwide for its fruit. The fruit (which is not a botanical berry, but an aggregate accessory fruit) is widely appreciated for its characteristic aroma, bright red color, juicy texture, and sweetness. It is consumed in large quantities, either fresh or in such prepared foods as preserves, fruit juice, pies, ice creams, milkshakes, and chocolates. Artificial strawberry aroma is also widely used in many industrial food products. As strawberry flavor and fragrance are popular characteristics for consumers,they are used widely in a variety of manufacturing, including foods, beverages, confections, perfumes and cosmetics. Sweetness, fragrance and complex flavor are favorable attributes. In plant breeding and farming, emphasis is placed on sugars, acids, and volatile compounds, which improve the taste and fragrance of a ripe strawberry. Esters, terpenes, and furans are chemical compounds having the strongest relationships to strawberry flavor and fragrance, with a total of 31 volatile compounds significantly correlated to favorable flavor and fragrance [Wikipedia]',	'24630',	'Strawberry',	'83.jpg',	'image/jpeg',	1497236,	'2012-04-20 09:43:14',	89,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:15',	NULL,	NULL,	0,	'specific',	3747,	1,	'FOOD00083'),
(84,	'Black huckleberry',	'Gaylussacia baccata',	'Gaylussacia baccata, the Black Huckleberry, is a common huckleberry found throughout a wide area of northeastern North America. It closely resembles the blueberry plants (Vaccinium species) with which it grows, but can be readily identified by the numerous resin dots on the undersides of the leaves which glitter when held up to the light. It is a vigorous clonal colonizer.',	'23660',	'Black_huckleberry',	'84.jpg',	'image/jpeg',	43366,	'2012-04-20 09:39:49',	90,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	128893,	1,	'FOOD00084'),
(85,	'Soy bean',	'Glycine max',	'The soybean (US) or soya bean (UK) (Glycine max) is a species of legume native to East Asia, widely grown for its edible bean which has numerous uses. The plant is classed as an oilseed rather than a pulse by the UN Food and Agricultural Organization (FAO). Fat-free (defatted) soybean meal is a significant and cheap source of protein for animal feeds and many prepackaged meals; soy vegetable oil is another product of processing the soybean crop. For example, soybean products such as textured vegetable protein (TVP) are ingredients in many meat and dairy analogues. Soybeans produce significantly more protein per acre than most other uses of land. Traditional nonfermented food uses of soybeans include soy milk, and from the latter tofu and tofu skin. Fermented foods include soy sauce, fermented bean paste, natto, and tempeh, among others. The oil is used in many industrial applications. The main producers of soy are the United States (35%), Brazil (27%), Argentina (19%), China (6%) and India (4%). The beans contain significant amounts of phytic acid, alpha-linolenic acid, and isoflavones.',	'26716',	'Soybean',	'85.jpg',	'image/jpeg',	166339,	'2012-04-20 09:32:19',	91,	'Soy',	'Soy',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3847,	1,	'FOOD00085'),
(86,	'Sunflower',	'Helianthus annuus',	'Sunflower (Helianthus annuus) is an annual plant native to the Americas. It possesses a large inflorescence (flowering head), and its name is derived from the flower\'s shape and image, which is often used to depict the sun. The plant has a rough, hairy stem, broad, coarsely toothed, rough leaves and circular heads of flowers. The heads consist of many individual flowers which mature into seeds, often in the hundreds, on a receptacle base. From the Americas, sunflower seeds were brought to Europe in the 16th century, where, along with sunflower oil, they became a widespread cooking ingredient. Leaves of the sunflower can be used as cattle feed, while the stems contain a fibre which may be used in paper production.',	'36616',	'Sunflower',	'86.jpg',	'image/jpeg',	111070,	'2012-04-20 09:41:21',	92,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4232,	1,	'FOOD00086'),
(87,	'Sea-buckthornberry',	'Hippophae rhamnoides',	'Hippophae rhamnoides, common sea-buckthorn, is a species of flowering plant in the family Elaeagnaceae, native to fixed dunes and sea cliffs in Europe and Asia. It is a spiny deciduous shrub.',	'503044',	'Hippophae rhamnoides',	'87.jpg',	'image/jpeg',	63544,	'2012-04-20 09:32:28',	93,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	1,	'specific',	193516,	1,	'FOOD00087'),
(88,	'Barley',	'Hordeum vulgare',	'Barley (Hordeum vulgare L. ), a member of the grass family, is a major cereal grain. Important uses include use as animal fodder, as a source of fermentable material for beer and certain distilled beverages, and as a component of various health foods. It is used in soups and stews, and in barley bread of various cultures. Barley grains are commonly made into malt in a traditional and ancient method of preparation. In a 2007 ranking of cereal crops in the world, barley was fourth both in terms of quantity produced (136 million tons) and in area of cultivation (566,000 km²).',	'40874',	'Barley',	'88.jpg',	'image/jpeg',	306084,	'2012-04-20 09:30:44',	95,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	1,	'specific',	4513,	1,	'FOOD00088'),
(89,	'Hyssop',	'Hyssopus officinalis',	'Hyssopus officinalis, hyssop is a herbaceous plant of the genus Hyssopus native to Southern Europe, the Middle East, and the region surrounding the Caspian Sea. Due to its properties as an antiseptic, cough reliever, and expectorant, it is commonly used as an aromatic herb and medicinal plant.',	'32536',	'Hyssop',	'89.jpg',	'image/jpeg',	66318,	'2012-04-20 09:44:12',	96,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	39324,	1,	'FOOD00089'),
(90,	'Star anise',	'Illicium verum',	'Illicium verum, commonly called Star anise, star aniseed, or Chinese star anise is a spice that closely resembles anise in flavor, obtained from the star-shaped pericarp of Illicium verum, a medium-sized native evergreen tree of northeast Vietnam and southwest China. The star shaped fruits are harvested just before ripening.',	'505892',	'Illicium verum',	'90.jpg',	'image/jpeg',	395267,	'2012-04-20 09:42:16',	97,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	124778,	1,	'FOOD00090'),
(91,	'Swamp cabbage',	'Ipomoea aquatica',	'Ipomoea aquatica is a semiaquatic, tropical plant grown as a vegetable for its tender shoots and leaves. It is found throughout the tropical and subtropical regions of the world, although it is not known where it originated. This plant is known in English as water spinach, river spinach, water morning glory, water convolvulus, or by the more ambiguous names Chinese spinach, Chinese convolvulus, swamp cabbage or kangkong in Southeast Asia. Occasionally, it has also been mistakenly called \"kale\" in English, although kale is a strain of mustard belonging to the species Brassica oleracea and is completely unrelated to water spinach, which is a species of morning glory. It is known as phak bung in Thai, rau mu?ng in Vietnamese, trokuon in Khmer, kalmi shak in Bengali, kangkung in Malay and Indonesian and hayoyo in Ghana.',	'30759',	'Ipomoea_aquatica',	'91.jpg',	'image/jpeg',	907626,	'2012-04-20 09:37:36',	98,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	89636,	1,	'FOOD00091'),
(92,	'Sweet potato',	'Ipomoea batatas',	'The sweet potato (<i>Ipomoea batatas</i>) is a dicotyledonous plant that belongs to the family Convolvulaceae. Its large, starchy, sweet-tasting, tuberous roots are a root vegetable. The young leaves and shoots are sometimes eaten as greens. The sweet potato is only distantly related to the potato (<i>Solanum tuberosum</i>) and does not belong to the nightshade family, Solanaceae, but both families belong to the same taxonomic order, the Solanales. (Wikipedia)',	'30764',	'Sweet Potato Pie (album)',	'92.jpg',	'image/jpeg',	119745,	'2012-04-20 09:39:18',	99,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:19',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4120,	1,	'FOOD00092'),
(93,	'Black walnut',	'Juglans nigra',	'Juglans nigra, the eastern black walnut, a species of flowering tree in the walnut family, Juglandaceae, is native to eastern North America. It grows mostly in riparian zones, from southern Ontario, west to southeast South Dakota, south to Georgia, northern Florida and southwest to central Texas. Isolated wild trees in the upper Ottawa Valley may be an isolated native population or may have derived from planted trees.\nBlack walnut nuts are shelled commercially in the United States. The nutmeats provide a robust, distinctive, natural flavor and crunch as a food ingredient. Popular uses include ice cream, bakery goods and confections. Consumers include black walnuts in traditional treats, such as cakes, cookies, fudge, and pies, during the fall holiday season. The nuts\' nutritional profile leads to uses in other foods, such as salads, fish, pork, chicken, vegetables and pasta dishes.',	'19254',	'Black_walnut',	'93.jpg',	'image/jpeg',	80754,	'2012-04-20 09:28:57',	100,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	16719,	1,	'FOOD00093'),
(94,	'Common walnut',	'Juglans regia',	'Juglans regia, the Persian walnut, English walnut, or especially in Great Britain, common walnut, is an Old World walnut tree species native to the region stretching from the Balkans eastward to the Himalayas and southwest China. The largest forests are in Kyrgyzstan, where trees occur in extensive, nearly pure walnut forests at 1,000–2,000 m altitude—notably at Arslanbob in Jalal-Abad Province.',	'503244',	'Juglans regia',	'94.jpg',	'image/jpeg',	76420,	'2012-04-20 09:37:01',	101,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	51240,	1,	'FOOD00094'),
(95,	'Lettuce',	'Lactuca sativa',	'Around 50 AD, lettuce leaves were often cooked and served by the Romans with an oil-and-vinegar dressing; however, smaller leaves were sometimes eaten raw. During the 81?96 AD reign of Domitian, the tradition of serving a lettuce salad before a meal began. Post-Roman Europe continued the tradition of poaching lettuce, mainly with large romaine types, as well as the method of pouring a hot oil and vinegar mixture over the leaves. Today, the majority of lettuce is grown for its leaves, although one type is grown for its stem and one for its seeds, which are made into an oil. Most lettuce is used in salads, either alone or with other greens, vegetables, meats and cheeses. Romaine lettuce is often used for Caesar salads, with a dressing that includes anchovies and eggs. Lettuce leaves can also be found in soups, sandwiches and wraps, while the stems are eaten both raw and cooked. The consumption of lettuce in China developed differently from in Western countries, due to health risks and cultural aversion to eating raw leaves. In that country, \"salads\" were created from cooked vegetables and served hot or cold. Lettuce was also used in a larger variety of dishes than in Western countries, contributing to a range of dishes including bean curd and meat dishes, soups and stir-frys plain or with other vegetables. Stem lettuce, widely consumed in China, is eaten either raw or cooked, the latter primarily in soups and stir-frys.',	'36607',	'Lettuce',	'95.jpg',	'image/jpeg',	96800,	'2012-04-20 09:34:18',	102,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4236,	1,	'FOOD00095'),
(96,	'Grass pea',	'Lathyrus sativus',	'Lathyrus sativus, is a legume (family Fabaceae) commonly grown for human consumption and livestock feed in Asia and East Africa. It is a particularly important crop in areas that are prone to drought and famine, and is thought of as an \'insurance crop\' as it produces reliable yields when all other crops fail.',	'25877',	'Lathyrus sativus',	'96.jpg',	'image/jpeg',	86106,	'2012-04-20 09:38:41',	103,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3860,	1,	'FOOD00096'),
(97,	'Sweet bay',	'Laurus nobilis',	'Laurus nobilis is an aromatic evergreen tree or large shrub with green, glossy leaves, native to the Mediterranean region. It is one of the plants used for bay leaf seasoning in cooking. It is known as bay laurel, sweet bay, bay tree (esp. United Kingdom), true laurel, Grecian laurel, laurel tree or simply laurel. Laurus nobilis figures prominently in classical Greek, Roman, and Biblical culture.\nThe plant is the source of several popular herbs and one spice used in a wide variety of recipes, particularly among Mediterranean cuisines. Most commonly, the aromatic leaves are added whole to Italian pasta sauces. However, even when cooked, whole bay leaves can be sharp and abrasive enough to damage internal organs, so they are typically removed from dishes before serving, unless used as a simple garnish. Whole bay leaves have a long shelf life of about one year, under normal temperature and humidity. Bay leaves are used almost exclusively as flavor agents during the food preparation stage;\n',	'503343',	'Sweet_bay',	'97.jpg',	'image/jpeg',	105487,	'2012-04-20 09:34:43',	104,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	85223,	1,	'FOOD00097'),
(98,	'Lentils',	'Lens culinaris',	'The lentil (Lens culinaris) is an edible pulse. It is a bushy annual plant of the legume family, grown for its lens-shaped seeds. It is about 40 cm (16 in) tall and the seeds grow in pods, usually with two seeds in each.\nLentils contain dietary fiber, folate, vitamin B1, and minerals. Red (or pink) lentils contain a lower concentration of fiber than green lentils (11% rather than 31%). Health magazine has selected lentils as one of the five healthiest foods.',	'503364',	'Lentils',	'98.jpg',	'image/jpeg',	90861,	'2012-04-20 09:43:56',	105,	'Pulses',	'Lentils',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'generic',	3864,	1,	'FOOD00098'),
(99,	'Garden cress',	'Lepidium sativum',	'Cress (Lepidium sativum), sometimes referred to as garden cress to distinguish it from similar plants also referred to as cress. Garden Cress is a rather fast-growing, edible herb. Garden cress is genetically related to watercress and mustard, sharing their peppery, tangy flavor and aroma. In some regions, garden cress is known as mustard and cress, garden pepper cress, pepper grass, pepperwort or poor person\'s pepper. This annual plant can reach a height of 60 cm (~24 inches), with many branches on the upper part. The white to pinkish flowers are only 2 mm (1/12 of an inch) across, clustered in branched racemes.',	'22978',	'Garden cress',	'99.jpg',	'image/jpeg',	169763,	'2012-04-20 09:39:16',	106,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	33125,	1,	'FOOD00099'),
(100,	'Lovage',	'Levisticum officinale',	'Lovage , Levisticum officinale, is a tall perennial plant, the sole species in the genus Levisticum in the family Apiaceae, subfamily Apioideae, tribe Apieae.\nThe leaves can be used in salads, or to make soup or season broths, and the roots can be eaten as a vegetable or grated for use in salads. Its flavor and smell is somewhat similar to celery. Lovage tea can be applied to wounds as an antiseptic, or drunk to stimulate digestion. The seeds can be used as a spice, similar to fennel seeds. In the UK, an alcoholic lovage cordial is traditionally mixed with brandy in the ratio of 2:1 as a winter drink. In Romania, the leaves are the preferred seasoning for the various local broths, much more so than parsley or dill. Lovage is third in its quercetin content, behind tea and capers',	'29673',	'Lovage',	'100.jpg',	'image/jpeg',	36752,	'2012-04-20 09:37:11',	107,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	48042,	1,	'FOOD00100'),
(101,	'Flaxseed',	'Linum usitatissimum',	'Flax (also known as common flax or linseed) is a member of the genus Linum in the family Linaceae. It is a food and fibre crop that is grown in cooler regions of the world. Flax fibres are taken from the stem of the plant and are two to three times as strong as those of cotton. As well, flax fibres are naturally smooth and straight. Europe and North America depended on flax for cloth until the nineteenth century, when cotton overtook flax as the most common plant used for making linen paper. Flax is grown on the Canadian Praires for linseed oil, which is used as a drying oil in paints and varnish and in products such as linoleum and printing inks. It is native to the region extending from the eastern Mediterranean to India and was probably first domesticated in the Fertile Crescent. Flax was extensively cultivated in ancient Ethiopia and ancient Egypt. A discovery reported in 2009 of spun, dyed, and knotted wild flax fibers in a prehistoric cave in the Republic of Georgia shows that the plant was already in use by humans at the surprisingly early date of 30,000 B.C. New Zealand flax is not related to flax but was named after it, as both plants are used to produce fibers.',	'29226',	'Flax',	'101.jpg',	'image/jpeg',	106535,	'2012-04-20 09:44:20',	108,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4006,	1,	'FOOD00101'),
(102,	'Mexican oregano',	'Lippia graveolens',	'Lippia graveolens, a species of flowering plant in the verbena family, Verbenaceae, is native to the southwestern United States (Texas and southern New Mexico), Mexico, and Central America as far south as Nicaragua. Common names include Mexican oregano, redbrush lippia, orégano Cimmaron, scented lippia, and scented matgrass.\nThe essential oil of Lippia graveolens contains 0-81% thymol, 0-48% carvacrol, 3-30% para-cymene, and 0-15% eucalyptol. The first two components give the plant a flavor similar to oregano, and the leaves are widely used as an herb in Mexico and Central America.',	'32068',	'Mexican_oregano',	'102.jpg',	'image/jpeg',	88360,	'2012-04-20 09:38:17',	109,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00102'),
(103,	'Lichee',	'Litchi chinensis',	'The lychee (Litchi chinensis) (Chinese: ??; pinyin: lì zh?) is the sole member of the genus Litchi in the soapberry family, Sapindaceae. It is a tropical and subtropical fruit tree native to the Guangdong and Fujian provinces of China, and now cultivated in many parts of the world. The fresh fruit has a \"delicate, whitish pulp\" with a floral smell and a fragrant, sweet flavor. Since this perfume-like flavor is lost in the process of canning, the fruit is usually eaten fresh.',	'503504',	'Lichee',	'103.jpg',	'image/jpeg',	970479,	'2012-04-20 09:38:37',	110,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	151069,	1,	'FOOD00103'),
(104,	'Lupine',	'Lupinus',	'Lupinus, commonly known as lupin or lupine (North America), is a genus of flowering plants in the legume family, Fabaceae. The genus includes over 200 species, with centers of diversity in North and South America. Smaller centers occur in North Africa and the Mediterranean. Seeds of various species of lupins have been used as a food for over 3000 years around the Mediterrranean (Gladstones, 1970) and for as much as 6000 years in the Andean highlands (Uauy et al., 1995), but never have they been accorded the same status as soybeans or dry peas and other pulse crops. The pearl lupin of the Andean highlands of South America, Lupinus mutabilis, known locally as tarwi or chocho, was extensively cultivated, but there seems to have been no conscious genetic improvement other than to select for larger and water-permeable seeds. Users soaked the seed in running water to remove most of the bitter alkaloids and then cooked or toasted the seeds to make them edible (Hill, 1977; Aguilera and Truer, 1978), or else boiled and dried them to make kirku (Uauy et al., 1995). However, Spanish domination led to a change in the eating habits of the indigenous peoples, and only recently has interest in using lupins as a food been renewed (Hill, 1977).',	'25916',	'Lupin',	'104.jpg',	'image/jpeg',	254355,	'2012-04-20 09:28:54',	111,	'Pulses',	'Other pulses',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3869,	1,	'FOOD00104'),
(105,	'Apple',	'Malus pumila',	'The apple is the pomaceous fruit of the apple tree, species Malus domestica in the rose family. It is one of the most widely cultivated tree fruits, and the most widely known of the many members of genus Malus that are used by humans. Apples grow on small, deciduous trees. The tree originated in Central Asia, where its wild ancestor, Malus sieversii, is still found today. Apples have been grown for thousands of years in Asia and Europe, and were brought to North America by European colonists. Apples have been present in the mythology and religions of many cultures, including Norse, Greek and Christian traditions. In 2010, the fruit\'s genome was decoded, leading to new understandings of disease control and selective breeding in apple production. There are more than 7,500 known cultivars of apples, resulting in a range of desired characteristics. Different cultivars are bred for various tastes and uses, including in cooking, fresh eating and cider production. Domestic apples are generally propagated by grafting, although wild apples grow readily from seed. Trees are prone to a number of fungal, bacterial and pest problems, which can be controlled by a number of organic and non-organic means. About 69 million tonnes of apples were grown worldwide in 2010, and China produced almost half of this total. The United States is the second-leading producer, with more than 6% of world production. Turkey is third, followed by Italy, India and Poland. Apples are often eaten raw, but can also be found in many prepared foods (especially desserts) and drinks. Many beneficial health effects have been found from eating apples; however, two forms of allergies are seen to various proteins found in the fruit.',	'25262',	'Apple',	'105.jpg',	'image/jpeg',	86997,	'2012-04-20 09:44:31',	112,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	283210,	1,	'FOOD00105'),
(106,	'Mango',	'Mangifera indica',	'The mango is a fleshy stone fruit belonging to the genus Mangifera, consisting of numerous tropical fruiting trees in the flowering plant family Anacardiaceae. The mango is native to South Asia, from where it has been distributed worldwide to become one of the most cultivated fruits in the tropics. While other Mangifera species (e.g. horse mango, M. foetida) are also grown on a more localized basis, Mangifera indica – the \'common mango\' or \'Indian mango\' – is the only mango tree commonly cultivated in many tropical and subtropical regions. It is the national fruit of India, Philippines and Pakistan. In several cultures, its fruit and leaves are ritually used as floral decorations at weddings, public celebrations and religious ceremonies.',	'28803',	'Mango',	'106.jpg',	'image/jpeg',	87179,	'2012-04-20 09:35:50',	113,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	29780,	1,	'FOOD00106'),
(107,	'German camomile',	'Matricaria recutita',	'Matricaria chamomilla, commonly known as chamomile (also spelled camomile), German chamomile, Hungarian chamomile, wild chamomile or scented mayweed, is an annual plant of the composite family Asteraceae. M. chamomilla is the most popular source of the herbal product chamomile, although other species are also used as chamomile.',	'38079',	'Matricaria chamomilla',	'107.jpg',	'image/jpeg',	69315,	'2012-04-20 09:29:48',	114,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	127986,	1,	'FOOD00107'),
(108,	'Lemon balm',	'Melissa officinalis',	'Lemon balm (Melissa officinalis), not to be confused with bee balm (which is genus Monarda), is a perennial herb in the mint family Lamiaceae, native to southern Europe and the Mediterranean region. It grows to 70–150 cm tall. The leaves have a gentle lemon scent, related to mint. During summer, small white flowers full of nectar appear. These attract bees, hence the genus name Melissa (Greek for \'honey bee\'). Its flavour comes from citronellal (24%), geranial (16%), linalyl acetate (12%) and caryophyllene (12%).',	'32565',	'Melissa officinalis',	'108.jpg',	'image/jpeg',	30057,	'2012-04-20 09:33:54',	115,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	39338,	1,	'FOOD00108'),
(109,	'Mentha',	'Mentha',	'Mentha (also known as Mint, from Greek míntha, Linear B mi-ta) is a genus of flowering plants in the family Lamiaceae (mint family). The species are not clearly distinct and estimates of the number of species varies from 13 to 18. Hybridization between some of the species occurs naturally. Many other hybrids as well as numerous cultivars are known in cultivation. The genus has a subcosmopolitan distribution across Europe, Africa, Asia, Australia, and North America. Mints are aromatic, almost exclusively perennial, rarely annual, herbs. They have wide-spreading underground and overground stolons and erect, square, branched stems. The leaves are arranged in opposite pairs, from oblong to lanceolate, often downy, and with a serrate margin. Leaf colors range from dark green and gray-green to purple, blue, and sometimes pale yellow. The flowers are white to purple and produced in false whorls called verticillasters. The corolla is two-lipped with four subequal lobes, the upper lobe usually the largest. The fruit is a small, dry capsule containing one to four seeds. While the species that make up the Mentha genus are widely distributed and can be found in many environments, most Mentha grow best in wet environments and moist soils. Mints will grow 10?120 cm tall and can spread over an indeterminate area. Due to their tendency to spread unchecked, mints are considered invasive.',	'32264',	'Mentha',	'109.jpg',	'image/jpeg',	161559,	'2012-04-20 09:35:56',	116,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	21819,	1,	'FOOD00109'),
(110,	'Orange mint',	'Mentha aquatica',	'Mentha citrata (Ehrh.) (syn. Mentha × piperita L. var. citrata (Ehrh.) Briq.; syn. Mentha aquatica var. citrata (Ehrh.) Benth.; syn. Mentha odorata Sole, Mentha adspersa Moench) is an herb. It is also known as Bergamot mint, Eau-de-cologne Mint, Horsemint, Lemon Mint, Lime Mint, Orange Mint, Pineapple Mint, Su Nanesi, Water Mint, Wild Water Mint, and in Central America Yerba Buena.\nThis herb has a characteristic lemon odor when crushed. It is sometimes used to make a tea similar to lemonade.\nA tea made from the fresh or dried leaves has traditionally been used:\n-For stomach aches, nausea, parasites and other digestive disorders,\n-For nerves and sick stomach, and\n-For fevers and headaches.\nThe leaves and flowering plant have analgesic, antiseptic, antispasmodic, carminative, cholagogic, diaphoretic, and vasodilator properties. Like other members of the genus Mentha, it is best not used by pregnant women because large doses can cause miscarriage.',	'32268',	'Mentha_citrata',	'110.jpg',	'image/jpeg',	76313,	'2012-04-20 09:39:00',	117,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	190902,	1,	'FOOD00110'),
(111,	'Cornmint',	'Mentha arvensis',	'Mentha arvensis (Field Mint, Wild Mint or Corn Mint) is a species of mint with a circumboreal distribution. It is native to the temperate regions of Europe and western and central Asia, east to the Himalaya and eastern Siberia, and North America. It is a herbaceous perennial plant growing to 10–60 cm (rarely to 100 cm) tall. The leaves are in opposite pairs, simple, 2–6.5 cm long and 1–2 cm broad, hairy, and with a coarsely serrated margin. The flowers are pale purple (occasionally white or pink), in clusters on the stem, each flower 3–4 mm long. Uses & Benefits of Podina: 50x40pxThis article does not cite any references or sources. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Podina is used as a carminative and an expectorant. The plant is highly effective in treating headaches, rhinitis, cough sore throat, colic, prurigo and vomiting. It serves as a good blood cleanser, since it is antiseptic and anti-bacterial. Podina plays a significant role in alleviating swollen gums, mouth ulcers and toothaches. Crushed and bruised pudina leaves are used in treating insect bites. The decoction and infusion of its leaves and stems helps in fever, stomachaches, dysmenorrheal and diuresis. Fresh leaves of podina are crushed and sniffed for dizziness. Crushed leaves are also applied on the forehead and temple, to cure headaches. For toothaches, boil 6 tablespoons of pudina leaves in 2 glasses of water, for 15 minutes. Strain and cool the water. Divide it into two parts and take each part after 3 to 4 hours. Boil 6 tablespoons of chopped leaves in 2 glasses of water, for 15 minutes. Cool and strain. Divide the decoction into 3 parts and consume three times a day. This will help in treating coughs. For treating arthritis, take some fresh leaves and heat on low flame. Pound them and apply on the painful joints or muscles, when still warm. Soak 2 tablespoons of chopped leaves in a glass of hot water for 30 minutes and strain. Use the infusion as a mouthwash. The menthol extracted from the plant is used in preparing balms. It is used as a flavoring agent in many culinary preparations There are six subspecies: Mentha arvensis subsp. arvensis. Mentha arvensis subsp. agrestis Briq. Mentha arvensis subsp. austriaca (Jacq. ) Briq. Mentha arvensis subsp. lapponica (Wahlenb. ) Neuman Mentha arvensis subsp. palustris (Moench) Neumann Mentha arvensis subsp. parietariifolia (Becker) Briq. The related species Mentha canadensis is also included in M. arvensis by some authors as two varieties, M. arvensis var. glabrata Fernald (in reference to North American plants) and M. arvensis var. piperascens Malinv. ex L. H. Bailey (in reference to eastern Asian plants).',	'565302',	'Mentha arvensis',	'111.jpg',	'image/jpeg',	81785,	'2012-04-20 09:42:13',	118,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	292239,	1,	'FOOD00111'),
(112,	'Spearmint',	'Mentha spicata',	'Spearmint or spear mint (Mentha spicata) is a species of mint native to much of Europe and southwest Asia, though its exact natural range is uncertain due to extensive early cultivation.\nSpearmint grows well in nearly all temperate climates. Gardeners often grow it in pots or planters due to its invasive, spreading rhizomes. The plant prefers partial shade, but can flourish in full sun to mostly shade. Spearmint is best suited to loamy soils with abundant organic material.\nSpearmint leaves can be used fresh, dried, or frozen. They can also be preserved in salt, sugar, sugar syrup, alcohol, or oil. The leaves lose their aromatic appeal after the plant flowers. It can be dried by cutting just before, or right (at peak) as the flowers open, about one-half to three-quarters the way down the stalk (leaving smaller shoots room to grow). Some dispute exists as to what drying method works best; some prefer different materials (such as plastic or cloth) and different lighting conditions (such as darkness or sunlight).\nSpearmint is often cultivated for its aromatic and carminative oil, referred to as oil of spearmint. The most abundant compound in spearmint oil is R-(?)-carvone, which gives spearmint its distinctive smell. Spearmint oil also contains significant amounts of limonene, dihydrocarvone, and 1,8-cineol. Unlike peppermint oil, oil of spearmint contains minimal amounts of menthol and menthone. It is used as a flavoring for toothpaste and confectionery, and is sometimes added to shampoos and soaps.',	'32272',	'Spearmint',	'112.jpg',	'image/jpeg',	90563,	'2012-04-20 09:30:01',	119,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:20',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	29719,	1,	'FOOD00112'),
(113,	'Peppermint',	'Mentha X piperita',	'Peppermint (Mentha × piperita, also known as M. balsamea Willd.) is a hybrid mint, a cross between watermint and spearmint. The plant, indigenous to Europe, is now widespread in cultivation throughout all regions of the world. It is found wild occasionally with its parent species. Fresh or dried peppermint leaves are often used alone or with other herbs in herbal teas (tisanes, infusions). Peppermint is used for flavouring ice cream, confectionery, chewing gum, and toothpaste, and can also be found in some shampoos, soaps and skin care products. Menthol activates cold-sensitive TRPM8 receptors in the skin and mucosal tissues, and is the primary source of the cooling sensation that follows the topical application of peppermint oil. Peppermint has a high menthol content. The oil also contains menthone and carboxyl esters, particularly menthyl acetate. Dried peppermint typically has 0.3–0.4% of volatile oil containing menthol (7–48%), menthone (20–46%), menthyl acetate (3–10%), menthofuran (1–17%) and 1,8-cineol (3–6%). Peppermint oil also contains small amounts of many additional compounds including limonene, pulegone, caryophyllene and pinene.  Peppermint also contains terpenoids and flavonoids  [Wikipedia]',	'32275',	'Peppermint',	'113.jpg',	'image/jpeg',	95516,	'2012-04-23 10:30:00',	120,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	2,	0,	'specific',	34256,	1,	'FOOD00113'),
(114,	'Medlar',	'Mespilus germanica',	'Mespilus germanica, known as the medlar or common medlar, is a large shrub or small tree, and the name of the fruit of this tree. The fruit has been cultivated since Roman times, and is unusual in being available in winter, and in being eaten when \'bletted\' (browned by rot). It is eaten raw and in a range of dishes.',	'506235',	'Medlar',	'114.jpg',	'image/jpeg',	85088,	'2012-04-20 09:30:44',	121,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	36616,	1,	'FOOD00114'),
(115,	'Bitter gourd',	'Momordica charantia',	'Momordica charantia often called bitter melon, bitter gourd or bitter squash in English, has many other local names. Goya from the indigenous language of Okinawa where there is a large US military presence and karavella from Sanskrit are also used by English-language speakers. It is a tropical and subtropical vine of the family Cucurbitaceae, widely grown in Asia, Africa, and the Caribbean for its edible fruit, which is among the most bitter of all fruits. Its many varieties differ substantially in the shape and bitterness of the fruit. This is a plant of the tropics. Bitter melon originated in India, and it was carried to China in the 14th century.',	'22399',	'Bitter melon',	'115.jpg',	'image/jpeg',	72072,	'2012-04-20 09:39:26',	122,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3673,	1,	'FOOD00115'),
(116,	'Mulberry',	'Morus',	'Morus, a genus of flowering plants in the family Moraceae, comprises 10-16 species of deciduous trees commonly known as mulberries growing wild and under cultivation in many temperate world regions.\r\nThe mulberry fruit is a multiple fruit, 2-3 cm (0.79-1.18 in) long. Immature fruits are white, green, or pale yellow. In most species, the fruits turn pink and then red while ripening, then dark purple or black, and have a sweet flavor when fully ripe. The fruits of the white-fruited cultivar are white when ripe; the fruit in this cultivar is also sweet but has a very mild flavor compared with the darker variety.',	'19064',	'Mulberry',	'116.jpg',	'image/jpeg',	102907,	'2012-04-20 09:29:43',	123,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3497,	1,	'FOOD00116'),
(117,	'Black mulberry',	'Morus nigra',	'Morus nigra, the black mulberry, is a species of flowering plant in the family Moraceae, native to southwestern Asia, where it has been cultivated for so long that its precise natural range is unknown. The edible fruit is dark purple, almost black, when ripe, 2-3 centimetres (0.8-1.2 in) long, a compound cluster of several small drupes; it is richly flavoured, similar to the red mulberry (Morus rubra) but unlike the more insipid fruit of the white mulberry (Morus alba). Black (Morus nigra) mulberries are thought to have originated in the mountainous areas of Mesopotamia and Persia and are now widespread throughout Afghanistan, Iraq, Iran, India, Pakistan, Syria, and Turkey, where the tree and the fruit are known by the Persian-derived names toot (mulberry) of shahtoot (شاه توت) (king\'s or \"superior\" mulberry), or, in Arabic, shajarat tukki. Jams and sherbets are often made from the fruit in this region.',	'19069',	'Black_mulberry',	'117.jpg',	'image/jpeg',	53370,	'2012-04-20 09:30:05',	124,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	85232,	1,	'FOOD00117'),
(118,	'Nutmeg',	'Myristica fragrans',	'The nutmeg tree is any of several species of trees in genus Myristica. The most important commercial species is Myristica fragrans, an evergreen tree indigenous to the Banda Islands in the Moluccas (or Spice Islands) of Indonesia.\r\nThe nutmeg tree is important for two spices derived from the fruit: nutmeg and mace.\r\nNutmeg is the seed of the tree, roughly egg-shaped and about 20 to 30 mm (0.8 to 1.2 in) long and 15 to 18 mm (0.6 to 0.7 in) wide, and weighing between 5 and 10 g (0.2 and 0.4 oz) dried, while mace is the dried \"lacy\" reddish covering or aril of the seed. The first harvest of nutmeg trees takes place 7-9 years after planting, and the trees reach full production after twenty years. Nutmeg is usually used in powdered form. This is the only tropical fruit that is the source of two different spices. Several other commercial products are also produced from the trees, including essential oils, extracted oleoresins, and nutmeg butter .\r\nThe common or fragrant nutmeg, Myristica fragrans, native to the Banda Islands of Indonesia, is also grown in Penang Island in Malaysia and the Caribbean, especially in Grenada. It also grows in Kerala, a state in southern India. Other species of nutmeg include Papuan nutmeg M. argentea from New Guinea, and M. malabarica from India.\r\n\r\nIn low doses, nutmeg produces no noticeable physiological or neurological response, but in large doses, raw nutmeg has psychoactive effects.[citation needed] In its freshly ground form (from whole nutmegs), nutmeg contains myristicin, a monoamine oxidase inhibitor and psychoactive substance.[citation needed] Myristicin poisoning can induce convulsions, palpitations, nausea, eventual dehydration, and generalized body pain. Fatal myristicin poisonings in humans are very rare.',	'18125',	'Nutmeg',	'118.jpg',	'image/jpeg',	57288,	'2012-04-20 09:43:03',	125,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	51089,	1,	'FOOD00118'),
(119,	'Sweet basil',	'Ocimum basilicum',	'Basil, Thai basil, or sweet basil, is a common name for the culinary herb Ocimum basilicum of the family Lamiaceae (mints), sometimes known as Saint John\'s Wort in some English-speaking countries.\nBasil is originally native to India, having been cultivated there for more than 5,000 years, but was thoroughly familiar to Theophrastus and Dioscorides. It is a half-hardy annual plant, best known as a culinary herb prominently featured in Italian cuisine, and also plays a major role in Southeast Asian cuisines of Indonesia, Thailand, Vietnam, Cambodia, Laos, and the cuisine of Taiwan. Depending on the species and cultivar, the leaves may taste somewhat like anise, with a strong, pungent, often sweet smell.\nThere are many varieties of Ocimum basilicum, as well as several related species or species hybrids also called basil. The type used in Italian food is typically called sweet basil, as opposed to Thai basil (O. basilicum var. thyrsiflora), lemon basil (O. X citriodorum) and holy basil (Ocimum tenuiflorum), which are used in Asia. While most common varieties of basil are treated as annuals, some are perennial in warm, tropical climates, including holy basil and a cultivar known as \'African Blue\'.',	'32627',	'Sweet_basil',	'119.jpg',	'image/jpeg',	147279,	'2012-04-20 09:39:30',	126,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	39350,	1,	'FOOD00119'),
(120,	'Evening primrose',	'Oenothera biennis',	'Oenothera is a genus of about 145 species of herbaceous flowering plants native to the Americas. It is the type genus of the family Onagraceae. Common names include evening primrose, suncups, and sundrops. They are not closely related to the true primroses (genus Primula).\nCertain Oenothera plants have edible parts. The roots of O. biennis are reportedly edible in young plants.',	'27368',	'Evening_primrose',	'120.jpg',	'image/jpeg',	37896,	'2012-04-20 09:40:35',	127,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3942,	1,	'FOOD00120'),
(121,	'Olive',	'Olea europaea',	'The olive is the fruit of the olive tree (Olea europaea, meaning \"Oil from/of Europe\").  It is an important food crop in countries around the Mediterranean Sea, and places with a Mediterranean climate. The olive is of major agricultural importance in the Mediterranean region as the source of olive oil; it is one of the three core ingredients in Mediterranean cuisine. About 90% of all harvested olives are turned into oil, while about 10% are used as table olives. \r\n\r\nTable olives are classified into three groups according to the degree of ripeness achieved before harvesting:(1) Green olives are picked when they have obtained full size, but before the ripening cycle has begun; they are usually shades of green to yellow. (2) Semiripe or turning-colour olives are picked at the beginning of the ripening cycle, when the colour has begun to change from green to multicolour shades of red to brown. Only the skin is coloured, as the flesh of the fruit lacks pigmentation at this stage, unlike that of ripe olives. (3) Black olives or ripe olives are picked at full maturity when fully ripe. They are found in assorted shades of purple to brown to black.\r\n\r\nOlives are a rich source of vitamin E (25% of the Daily Value, DV), and contain a large amount of sodium (104% DV); other nutrients are insignificant. Green olives are 75% water, 15% fat, 4% carbohydrates and 1% protein. The polyphenol composition of olive fruits varies during fruit ripening and during processing by fermentation when olives are immersed whole in brine or crushed to produce oil. In raw fruit, total polyphenol contents, as measured by the Folin method, are 117 mg/100 g in black olives and 161 mg/100 g in green olives, compared to 55 and 21 mg/100 g for extra virgin and virgin olive oil, respectively. Olive fruit contains several types of polyphenols, mainly tyrosols, phenolic acids, flavonols and flavones, and for black olives, anthocyanins. The main bitter flavor of olives before curing results from oleuropein and its aglycone which total in content, respectively, 72 and 82 mg/100 g in black olives, and 56 and 59 mg/100 g in green olives. Polyphenol content also varies with olive cultivar (Spanish Manzanillo highest) and the manner of presentation, with plain olives having higher contents than those that are pitted or stuffed [Wikipedia].',	'32990',	'Olive',	'121.jpg',	'image/jpeg',	1384481,	'2012-04-20 09:36:03',	128,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4146,	1,	'FOOD00121'),
(122,	'Sweet marjoram',	'Origanum majorana',	'Marjoram (Origanum majorana, syn. Majorana hortensis Moench, Majorana majorana (L.) H. Karst) is a somewhat cold-sensitive perennial herb or undershrub with sweet pine and citrus flavors. In some Middle-Eastern countries, marjoram is synonymous with oregano, and there the names sweet marjoram and knotted marjoram are used to distinguish it from other plants of the genus Origanum.\nThe name marjoram (Old French majorane, Medieval Latin majorana) does not directly derive from the Latin word maior (major). Marjoram is indigenous to Cyprus and southern Turkey, and was known to the Greeks and Romans as a symbol of happiness.\nMarjoram is used for seasoning soups, stews, dressings and sauce.  Majorana hortensis herb has been used in the traditional Austrian medicine for treatment of disorders of the gastrointestinal tract and infections.',	'32631',	'Sweet_marjoram',	'122.jpg',	'image/jpeg',	104894,	'2012-04-20 09:34:48',	129,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	268884,	1,	'FOOD00122'),
(123,	'Pot marjoram',	'Origanum onites',	'Origanum onites, the Cretan oregano, Turkish oregano, pot marjoram or rίgani in Greek (Ελληνική ρίγανη), is a plant species in the genus Origanum found in Greece and Turkey. It has similar flavors as oregano. Its essential oil can be distinguished from other species such as Greek oregano (Origanum vulgare ssp. hirtum). The plant contains the chemical compounds thymol, carvacrol and cedrol.  It has antimicrobial activities. [Wikipedia]',	'506029',	'Pot_marjoram',	'123.jpg',	'image/jpeg',	1896762,	'2012-04-20 09:39:09',	130,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	452416,	1,	'FOOD00123'),
(124,	'Common oregano',	'Origanum vulgare',	'Oregano (scientific name Origanum vulgare) is a common species of Origanum, a genus of the mint family (Lamiaceae). It is native to warm-temperate western and southwestern Eurasia and the Mediterranean region.\nOregano is an important culinary herb, used for the flavour of its leaves, which can be more flavourful when dried than fresh. It has an aromatic, warm and slightly bitter taste, which can vary in intensity. Good quality oregano may be strong enough almost to numb the tongue, but the cultivars adapted to colder climates often have a lesser flavor. Factors such as climate, seasons and soil composition may affect the aromatic oils present, and this effect may be greater than the differences between the various species of plants. Among the chemical compounds contributing to the flavour are carvacrol, thymol, limonene, pinene, ocimene, and caryophyllene',	'32632',	'Oregano',	'124.jpg',	'image/jpeg',	45859,	'2012-04-20 09:28:53',	131,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	39352,	1,	'FOOD00124'),
(125,	'Rice',	'Oryza sativa',	'Rice is the seed of the monocot plants Oryza sativa (Asian rice) or Oryza glaberrima (African rice). As a cereal grain, it is the most widely consumed staple food for a large part of the world\'s human population, especially in Asia and the West Indies. It is the grain with the second-highest worldwide production, after maize (corn), according to data for 2010. Since a large portion of maize crops are grown for purposes other than human consumption, rice is the most important grain with regard to human nutrition and caloric intake, providing more than one fifth of the calories consumed worldwide by the human species. Genetic evidence has shown that rice originates from a single domestication 8,200–13,500 years ago, in the Pearl River valley region of China. Previously, archaeological evidence had suggested that rice was domesticated in the Yangtze River valley region in China. From East Asia, rice spread to Southeast and South Asia. Rice was introduced to Europe through Western Asia, and to the Americas through European colonization. There are many varieties of rice and culinary preferences tend to vary regionally. In the Far East, there is a preference for softer and stickier varieties. Because of its importance as a staple food, rice has considerable cultural importance. Rice is often directly associated with prosperity and fertility. Therefore, there is the custom of throwing rice at weddings. Rice is normally grown as an annual plant, although in tropical areas it can survive as a perennial and can produce a ratoon crop for up to 30 years. The rice plant can grow to 1–1.8 m tall, occasionally more depending on the variety and soil fertility. It has long, slender leaves 50–100 cm long and 2–2.5 cm broad. The small wind-pollinated flowers are produced in a branched arching to pendulous inflorescence 30–50 cm long. The edible seed is a grain 5–12 mm long and 2–3 mm thick. Rice cultivation is well-suited to countries and regions with low labor costs and high rainfall, as it is labor-intensive to cultivate and requires ample water. Rice can be grown practically anywhere, even on a steep hill or mountain. Although its parent species are native to Asia and certain parts of Africa, centuries of trade and exportation have made it commonplace in many cultures worldwide. The traditional method for cultivating rice is flooding the fields while, or after, setting the young seedlings. This simple method requires sound planning and servicing of the water damming and channeling, but reduces the growth of less robust weed and pest plants that have no submerged growth state, and deters vermin. While flooding is not mandatory for the cultivation of rice, all other methods of irrigation require higher effort in weed and pest control during growth periods and a different approach for fertilizing the soil. The name wild rice is usually used for species of the grass genus Zizania, both wild and domesticated, although the term may also be used for primitive or uncultivated varieties of Oryza.',	'41976',	'Rice',	'125.jpg',	'image/jpeg',	102222,	'2012-04-20 09:34:03',	132,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4530,	1,	'FOOD00125'),
(126,	'Millet',	'Panicum miliaceum',	'The millets are a group of highly variable small-seeded grasses, widely grown around the world as cereal crops or grains for both human food and fodder. They do not form a taxonomic group, but rather a functional or agronomic one. Millets are important crops in the semi-arid tropics of Asia and Africa, with 97% of millet production in developing countries. The crop is favored due to its productivity and short growing season under dry, high temperature conditions. The most widely grown millet is pearl millet, which is an important crop in India and parts of Africa. Finger millet, proso millet, and foxtail millet are also important crop species. In the developed world, millets are less important. For example, in the United States the only significant crop is proso millet, which is mostly grown for bird seed. While millets are indigenous to many parts of the world, millets most likely had an evolutionary origin in tropical western Africa, as that is where the greatest number of both wild and cultivated forms exist. Millets have been important food staples in human history, particularly in Asia and Africa, and they have been in cultivation in East Asia for the last 10,000 years.',	'40946',	'Millet',	'126.jpg',	'image/jpeg',	89513,	'2012-04-20 09:39:45',	133,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4540,	1,	'FOOD00126'),
(127,	'Poppy',	'Papaver',	'The Poppy is an Angiospermae or flowering plant of the family Papaveraceae. Ornamental poppies are grown for their colorful flowers; some varieties of poppy are used as food, whilst other varieties produce the powerful medicinal alkaloid opium which has been used since ancient times to create analgesic and narcotic medicinal and recreational drugs. Following the trench warfare of the 1st World War which took place in the poppy fields of Flanders, red poppies have become a symbol of remembrance of soldiers who have died during wartime. Poppy flowers have 4 to 6 petals, many stamens forming a conspicuous whorl in the center of the flower and an ovary consisting of from 2 to many fused carpels. Poppies can grow to be over 4 feet tall, and 6 inches across. (Simon, Chadwick, and Craker 1984) The petals are showy, may be of almost any color and some have markings. The petals are crumpled in the bud and as blooming finishes, the petals often lie flat before falling away. The poppy will become dormant after blooming. Poppies are in full bloom late spring to early summer. (Simon, Chadwick, and Craker 1984) Most species secrete latex when injured. The pollen of the oriental poppy, Papaver orientale, is dark blue. The Papaver Somniferum poppy is mainly grown in Eastern and Southern Asia, and South Eastern Europe. It is believed that it originated in the Mediterranean region. (Jonsson and Krzymanski, 1989) The pollen of the field poppy or corn poppy (Papaver rhoeas) is dark green to grey. Bees use poppies as a pollen source. Poppies belong to genera of Papaveraceae, which includes: Papaver – corn poppy, Opium poppy, Oriental poppy, Iceland poppy, and about 120 other species Eschscholzia – California poppy and relatives Meconopsis – Welsh poppy, Nepal poppy, and relatives Stylophorum – Celandine poppy or wood poppy Argemone – Prickly poppy Romneya – Matilija poppy and relatives Canbya – Pygmy poppy Stylomecon – Wind poppy Arctomecon – desert bearpaw poppy Hunnemannia – Tulip poppy Dendromecon – Tree poppy',	'18881',	'Poppy',	'127.jpg',	'image/jpeg',	190654,	'2012-04-20 09:43:00',	134,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3468,	1,	'FOOD00127'),
(128,	'Passion fruit',	'Passiflora edulis',	'Passiflora edulis is a vine species of passion flower that is native to Brazil, Paraguay and northern Argentina. Its common names include passion fruit (UK and US), passionfruit (Australia and New Zealand), and purple granadilla (South Africa). It is cultivated commercially in warmer, frost-free areas for its fruit and is widely grown in Argentina, Australia, Bolivia, Brazil, the Caribbean, Colombia, Costa Rica, Dominican Republic, East Africa, Ecuador, Haiti, Hawaii, India, Indonesia, Israel, Mexico, New Zealand, Panama, Peru, Portugal, Puerto Rico, Sri Lanka, South Africa, United States, Venezuela and Philippines. The passion fruit is round to oval, either yellow or dark purple at maturity, with a soft to firm, juicy interior filled with numerous seeds. The fruit is both eaten and juiced; passion fruit juice is often added to other fruit juices to enhance the aroma.',	'22223',	'Passiflora edulis',	'128.jpg',	'image/jpeg',	75701,	'2012-04-20 09:39:03',	135,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	78168,	1,	'FOOD00128'),
(129,	'Parsnip',	'Pastinaca sativa',	'The parsnip is a root vegetable closely related to the carrot. It is a biennial plant usually grown as an annual. Its long tuberous root has cream-colored skin and flesh and can be left in the ground when mature as it becomes sweeter in flavour after winter frosts. In its first growing season, the plant has a rosette of pinnate, mid-green leaves. If unharvested, it produces its flowering stem, topped by an umbel of small yellow flowers, in its second growing season. By this time the stem is woody and the tuber inedible. The seeds are pale brown, flat and winged.',	'29795',	'Parsnip',	'129.jpg',	'image/jpeg',	84012,	'2012-04-20 09:31:14',	136,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:21',	'2019-05-14 18:04:16',	NULL,	NULL,	1,	'specific',	4041,	1,	'FOOD00129'),
(130,	'Avocado',	'Persea americana',	'The avocado (Persea americana) is a tree native to Central Mexico, classified in the flowering plant family Lauraceae along with cinnamon, camphor and bay laurel. Avocado or alligator pear also refers to the fruit (botanically a large berry that contains a single seed) of the tree. Avocados are commercially valuable and are cultivated in tropical and Mediterranean climates throughout the world. They have a green-skinned, fleshy body that may be pear-shaped, egg-shaped, or spherical. Commercially, it ripens after harvesting. Trees are partially self-pollinating and often are propagated through grafting to maintain a predictable quality and quantity of the fruit.',	'18154',	'Avocado',	'130.jpg',	'image/jpeg',	244707,	'2012-04-20 09:33:26',	137,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	3435,	1,	'FOOD00130'),
(131,	'Parsley',	'Petroselinum crispum',	'Parsley or garden parsley (Petroselinum crispum) is a species of Petroselinum in the family Apiaceae, native to the central Mediterranean region, naturalized elsewhere in Europe, and widely cultivated as an herb, a spice and a vegetable.',	'29817',	'Parsley',	'131.jpg',	'image/jpeg',	217948,	'2012-04-20 09:42:17',	138,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:16',	NULL,	NULL,	0,	'specific',	4043,	1,	'FOOD00131'),
(132,	'Scarlet bean',	'Phaseolus coccineus',	'Phaseolus coccineus, known as runner bean, scarlet runner bean, or multiflora bean, is a plant in the Fabaceae family. Runner beans have also been called \"Oregon Lima Bean\", and in Nahuatl \"ayocotl\" or in Spanish \"ayocote\". It differs from the common bean (P. vulgaris) in several respects: the cotyledons stay in the ground during germination, and the plant is a perennial vine with tuberous roots (though it is usually treated as an annual). This species originated from the mountains of Central America. Most varieties have red flowers and multicolored seeds (though some have white flowers and white seeds), and they are often grown as ornamental plants.\nThe vine can grow to two meters (6 feet) or more in length. The green pods are edible whole before they become fibrous, and the seeds can be used fresh or as dried beans.\nThe starchy roots are still eaten by Central American Indians. In the UK, the flowers are often ignored, or treated as an attractive bonus to cultivating the plant for the beans, whereas in the US the scarlet runner is widely grown for its attractive flowers by people who would never think of eating it. The flower is known as a favourite of Hummingbirds.',	'26845',	'Phaseolus_coccineus',	'132.jpg',	'image/jpeg',	149783,	'2012-04-20 09:33:19',	139,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3886,	1,	'FOOD00132'),
(133,	'Lima bean',	'Phaseolus lunatus',	'Phaseolus lunatus is a legume. It is grown for its seed, which is eaten as a vegetable. It is commonly known as the lima bean or butter bean.',	'26850',	'Phaseolus lunatus',	'133.jpg',	'image/jpeg',	94842,	'2012-04-20 09:35:00',	140,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3884,	1,	'FOOD00133'),
(134,	'Common bean',	'Phaseolus vulgaris',	'Phaseolus vulgaris, the common bean, string bean, field bean, flageolet bean, French bean, garden bean, haricot bean, pop bean, or snap bean, is a herbaceous annual plant grown worldwide for its edible fruit, either the dry seed or the unripe fruit, both of which are referred to as beans. The leaf is also occasionally used as a vegetable, and the straw can be used for fodder. Along with other species of the bean genus (Phaseolus), it is classified botanically into the legume family (Fabaceae), most of whose members acquire nitrogen through an association with rhizobia, a species of nitrogen-fixing bacteria.',	'26857',	'Phaseolus_vulgaris',	'134.jpg',	'image/jpeg',	6202,	'2012-04-20 09:43:01',	141,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3885,	1,	'FOOD00134'),
(135,	'Date',	'Phoenix dactylifera',	'Phoenix dactylifera (date, or date palm) is a palm in the genus Phoenix, cultivated for its edible sweet fruit. The fruit is known as a date. The fruit\'s English name (through Old French), as well as the Latin species name dactylifera, both come from the Greek word for \"finger\", dáktulos, because of the fruit\'s elongated shape. Dates are oval-cylindrical, 3?7 cm long, and 2?3 cm (0.79?1.18 in) diameter, and when ripe, range from bright red to bright yellow in colour, depending on variety. Dates contain a single stone about 2?2.5 cm (0.79?0.98 in) long and 6?8 mm (0.24?0.31 in) thick. Three main cultivar groups of date exist: soft (e.g. \'Barhee\', \'Halawy\', \'Khadrawy\', \'Medjool\'), semi-dry (e.g. \'Dayri\', \'Deglet Noor\', \'Zahdi\'), and dry (e.g. \'Thoory\'). The type of fruit depends on the glucose, fructose and sucrose content.\nDry or soft dates are eaten out-of-hand, or may be pitted and stuffed with fillings such as almonds, walnuts, pecans, candied orange and lemon peel, tahini, marzipan or cream cheese.',	'42458',	'Date_(fruit)#Dates',	'135.jpg',	'image/jpeg',	126473,	'2012-04-20 09:38:15',	143,	'Fruits',	'Other fruits',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	42345,	1,	'FOOD00135'),
(136,	'Black chokeberry',	'Photinia melanocarpa',	'Aronia, the chokeberries, are deciduous shrubs in the family Rosaceae, native to eastern North America and most commonly found in wet woods and swamps. The genus is usually considered to contain two or three species, one of which is naturalized in Europe. A fourth form that has long been cultivated under the name Aronia is now considered to be an intergeneric hybrid, Sorbaronia mitschurinii.\nChokeberries are cultivated as ornamental plants and as food products. The berries can be eaten raw off the bush but are more frequently processed. Chokeberries can be found in wine, jam, syrup, juice, soft spreads, tea, salsa, chili starters, extracts, beer, ice cream, gummies and tinctures. The name \"chokeberry\" comes from the astringency of the fruits, which create a sensation making your mouth pucker.',	'565397',	'Photinia_melanocarpa',	'136.jpg',	'image/jpeg',	66882,	'2012-04-20 09:44:22',	144,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	661339,	1,	'FOOD00136'),
(137,	'Anise',	'Pimpinella anisum',	'Anise, Pimpinella anisum, also called aniseed, is a flowering plant in the family Apiaceae native to the eastern Mediterranean region and Southwest Asia. Its flavor has similarities with some other spices, such as star anise, fennel and liquorice.',	'29822',	'Anise',	'137.jpg',	'image/jpeg',	138453,	'2012-04-20 09:36:37',	145,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	271192,	1,	'FOOD00137'),
(138,	'Pine nut',	'Pinus',	'Pine nuts are the edible seeds of pines (family Pinaceae, genus Pinus). About 20 species of pine produce seeds large enough to be worth harvesting; in other pines the seeds are also edible, but are too small to be of great value as a human food.',	'18035',	'Pine nut',	'138.jpg',	'image/jpeg',	69791,	'2012-04-20 09:38:13',	146,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3337,	1,	'FOOD00138'),
(139,	'Pepper (Spice)',	'Piper nigrum',	'Black pepper (Piper nigrum) is a flowering vine in the family Piperaceae, cultivated for its fruit, which is usually dried and used as a spice and seasoning. The fruit, known as a peppercorn when dried, is approximately 5 millimetres in diameter, dark red when fully mature, and, like all drupes, contains a single seed. Peppercorns, and the ground pepper derived from them, may be described simply as pepper, or more precisely as black pepper (cooked and dried unripe fruit), green pepper (dried unripe fruit) and white pepper (dried ripe seeds). Black pepper is native to south India, and is extensively cultivated there and elsewhere in tropical regions. Currently Vietnam is the world\'s largest producer and exporter of pepper, producing 34% of the world\'s Piper nigrum crop as of 2008. Dried ground pepper has been used since antiquity for both its flavour and as a medicine. Black pepper is the world\'s most traded spice. It is one of the most common spices added to European cuisine and its descendants. The spiciness of black pepper is due to the chemical piperine, not to be confused with the capsaicin that gives fleshy peppers theirs. It is ubiquitous in the modern world, often paired with salt.',	'18310',	'Black pepper',	'139.jpg',	'image/jpeg',	165046,	'2012-04-20 09:36:32',	147,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	2,	0,	'specific',	13216,	1,	'FOOD00139'),
(140,	'Pistachio',	'Pistacia vera',	'The pistachio, Pistacia vera in the Anacardiaceae family, is a small tree originally from Greater Iran which now can also be found in regions of Syria, Lebanon, Turkey, Greece, Tunisia, Kyrgyzstan, Tajikistan, Turkmenistan, India, Pakistan, Egypt, Italy, Uzbekistan, Afghanistan (especially in the provinces of Samangan and Badghis), and the United States, specifically in California. The tree produces an important culinary nut. Pistacia vera often is confused with other species in the genus Pistacia that are also known as pistachio. These species can be distinguished from P. vera by their geographic distributions (in the wild) and their nuts which are much smaller, have a strong flavor of turpentine, and have a shell that is not hard.',	'506470',	'Pistachio',	'140.jpg',	'image/jpeg',	83025,	'2012-04-20 09:30:19',	148,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	55513,	1,	'FOOD00140'),
(141,	'Common pea',	'Pisum sativum',	'The pea is most commonly the small spherical seed or the seed-pod of the pod fruit Pisum sativum. Each pod contains several peas. Peapods are botanically a fruit, since they contain seeds developed from the ovary of a (pea) flower. However, peas are considered to be a vegetable in cooking. The name is also used to describe other edible seeds from the Fabaceae such as the pigeon pea (Cajanus cajan), the cowpea (Vigna unguiculata), and the seeds from several species of Lathyrus. P. sativum is an annual plant, with a life cycle of one year. It is a cool season crop grown in many parts of the world; planting can take place from winter to early summer depending on location. The average pea weighs between 0.1 and 0.36 grams. The immature peas (and in snow peas the tender pod as well) are used as a vegetable, fresh, frozen or canned; varieties of the species typically called field peas are grown to produce dry peas like the split pea shelled from the matured pod. These are the basis of pease porridge and pea soup, staples of medieval cuisine; in Europe, consuming fresh immature green peas was an innovation of Early Modern cuisine. The wild pea is restricted to the Mediterranean basin and the Near East. The earliest archaeological finds of peas date from the neolithic era of current Syria, Turkey and Jordan. In Egypt, early finds date from ca. 4800–4400 BC in the Nile delta area, and from ca. 3800–3600 BC in Upper Egypt. The pea was also present in Georgia in the 5th millennium BC. Farther east, the finds are younger. Peas were present in Afghanistan ca. 2000 BC, in Harappa, Pakistan, and in northwest India in 2250–1750 BC. In the second half of the 2nd millennium BC, this pulse crop appears in the Gangetic basin and southern India.',	'26867',	'Pea',	'141.jpg',	'image/jpeg',	37409,	'2012-04-20 09:29:56',	150,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	1,	'specific',	3888,	1,	'FOOD00141'),
(142,	'Purslane',	'Portulaca oleracea',	'Purslane is a common name for several plants with edible leaves and may refer to: Portulacaceae, a family of succulent flowering plants, and especially: Portulaca oleracea, a species of Portulaca eaten as a vegetable and considered a weed, known as summer purslane Portulaca grandiflora, moss rose, or moss-rose purslane Claytonia perfoliata, Miner\'s lettuce or winter purslane Claytonia sibirica, pink purslane Halimione portulacoides, sea purslane',	'20422',	'Purslane',	'142.jpg',	'image/jpeg',	35832,	'2012-04-20 09:44:26',	151,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	46147,	1,	'FOOD00142'),
(143,	'Prunus (Cherry, Plum)',	'Prunus',	'Prunus is a genus of trees and shrubs, which includes the plums, cherries, peaches, nectarines, apricots and almonds. Around 430 species are spread throughout the northern temperate regions of the globe. Many members of the genus are widely cultivated for fruit and ornament. The fruit from this genus are commonly called the stone fruit.',	'24762',	'Prunus',	'143.jpg',	'image/jpeg',	69007,	'2012-04-20 09:38:06',	152,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3754,	1,	'FOOD00143'),
(144,	'Apricot',	'Prunus armeniaca',	'An apricot is a fruit or the tree that bears the fruit. Usually, an apricot tree is from the tree species Prunus armeniaca, but the species Prunus brigantina, Prunus mandshurica, Prunus mume, and Prunus sibirica are closely related, have similar fruit, and are also called apricots.',	'24769',	'Apricot',	'144.jpg',	'image/jpeg',	836139,	'2012-04-20 09:40:16',	153,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	36596,	1,	'FOOD00144'),
(145,	'Sweet cherry',	'Prunus avium',	'Prunus avium, commonly called wild cherry, sweet cherry, bird cherry, or gean, is a species of cherry native to Europe, western Turkey, northwestern Africa, and western Asia, from the British Isles south to Morocco and Tunisia, north to the Trondheimsfjord region in Norway and east to the Caucasus and northern Iran, with a small disjunct population in the western Himalaya. This species, in the rose family (Rosaceae), has a diploid set of sixteen chromosomes (2n=16). All parts of the plant except for the ripe fruit are slightly toxic, containing cyanogenic glycosides.',	'24770',	'Prunus avium',	'145.jpg',	'image/jpeg',	100554,	'2012-04-20 09:43:12',	154,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	42229,	1,	'FOOD00145'),
(146,	'Sour cherry',	'Prunus cerasus',	'Prunus cerasus (sour cherry, tart cherry or wild cherry) is a species of Prunus in the subgenus Cerasus (cherries), native to much of Europe and southwest Asia. It is closely related to the sweet cherry (Prunus avium), but has a fruit that is more acidic, has greater nutritional benefits, and may have greater medicinal effects. Dried sour cherries are used in cooking including soups, pork dishes, cakes, tarts, and pies. Sour cherries or sour cherry syrup are used in liqueurs and drinks. In Turkey, Greece and Cyprus, sour cherries are especially prized for making spoon sweets by slowly boiling pitted sour cherries and sugar; the syrup thereof is used for vişne şurubu or vyssináda, a beverage made by diluting the syrup with ice-cold water. A particular use of sour cherries is in the production of kriek lambic, a cherry-flavored variety of a naturally fermented beer made in Belgium [Wikipedia].',	'24773',	'Prunus_cerasus',	'146.jpg',	'image/jpeg',	44111,	'2012-04-20 09:36:44',	155,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	140311,	1,	'FOOD00146'),
(147,	'European plum',	'Prunus domestica',	'Prunus domestica (sometimes referred to as Prunus × domestica) is a species of flowering plant in the family Rosaceae. A deciduous tree, it includes many varieties of the fruit trees known as plums in English, though not all plums belong to this species. The greengages and damsons also belong to subspecies of P. domestica.\nIts hybrid parentage is believed to be Prunus spinosa and Prunus cerasifera. This is the most commonly grown plum at least in Europe, and most prunes (dried plums) are made from fruits of this species.',	'24774',	'Prunus_domestica',	'147.jpg',	'image/jpeg',	93265,	'2012-04-20 09:38:56',	156,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3758,	1,	'FOOD00147'),
(148,	'Almond',	'Prunus dulcis',	'The almond (Prunus dulcis, syn. Prunus amygdalus, Amygdalus communis, Amygdalus dulcis) (or badam in Indian English, from Persian:  بادام ) is a species of tree native to the Middle East and South Asia. \"Almond\" is also the name of the edible and widely cultivated seed of this tree. Within the genus Prunus, it is classified with the peach in the subgenus Amygdalus, distinguished from the other subgenera by the corrugated shell (endocarp) surrounding the seed.\r\nThe fruit of the almond is a drupe, consisting of an outer hull and a hard shell with the seed (which is not a true nut) inside. Shelling almonds refers to removing the shell to reveal the seed. Almonds are sold shelled (i.e., after the shells are removed), or unshelled (i.e., with the shells still attached). Blanched almonds are shelled almonds that have been treated with hot water to soften the seedcoat, which is then removed to reveal the white embryo.',	'24775',	'Prunus_dulcis',	'148.jpg',	'image/jpeg',	14928,	'2012-04-20 09:29:53',	157,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3755,	1,	'FOOD00148'),
(149,	'Peach',	'Prunus persica',	'The peach (Prunus persica) is a deciduous tree, native to North-West China, in the region between the Tarim basin and the north slopes of the Kunlun Shan mountains, where it was first domesticated and cultivated. It bears an edible juicy fruit also called a peach. The species name persica refers to its widespread cultivation in Persia, whence it was transplanted to Europe. It belongs to the genus Prunus which includes the cherry and plum, in the family Rosaceae. The peach is classified with the almond in the subgenus Amygdalus, distinguished from the other subgenera by the corrugated seed shell.',	'24765',	'Peach',	'149.jpg',	'image/jpeg',	85867,	'2012-04-20 09:30:33',	158,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:22',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3760,	1,	'FOOD00149'),
(150,	'Guava',	'Psidium guajava',	'Guavas (singular guava) are plants in the Myrtle family (Myrtaceae) genus Psidium, which contains about 100 species of tropical shrubs and small trees. They are native to Mexico, Central America, and northern South America. Guavas are now cultivated and naturalized throughout the tropics and subtropics in Africa, South Asia, Southeast Asia, the Caribbean, subtropical regions of North America, Hawaii, New Zealand, Australia and Spain.\nIn many countries, guava is eaten raw, typically cut into quarters or eaten like an apple, whereas in other countries it\'s eaten with a pinch of salt and pepper, cayenne powder or a mix of spices (masala). It is known as the winter national fruit of Pakistan. In the Philippines, ripe guava is used in cooking sinigang. Guava is a popular snack in Taiwan, sold on many street corners and night markets during hot weather, accompanied by packets of dried plum powder mixed with sugar and salt for dipping. In east Asia, guava is commonly eaten with sweet and sour dried plum powder mixtures. Guava juice is popular in many countries. The fruit is also often prepared in fruit salads.',	'27240',	'Guava',	'150.jpg',	'image/jpeg',	62868,	'2012-04-20 09:43:21',	159,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	120290,	1,	'FOOD00150'),
(151,	'Pomegranate',	'Punica granatum',	'The pomegranate, scientific name Punica granatum, is a fruit-bearing deciduous shrub or small tree growing between 5–8 metres tall. Native to an area from the eastern Mediterranean Basin to India, the pomegranate has been cultivated over millennia, including today throughout the Mediterranean, Middle East and Caucasus regions, northern Africa and tropical Africa, the Indian subcontinent and the drier parts of southeast Asia. Introduced into Latin America and California by Spanish settlers in 1769, pomegranate is also cultivated in parts of California and Arizona. In the Northern Hemisphere, the fruit is typically in season from September to February. In the Southern Hemisphere, the pomegranate is in season from March to May. The pomegranate has been mentioned in many ancient texts, notably in Babylonian texts, the Book of Exodus, the Homeric Hymns and the Quran. In recent years, it has become more common in the commercial markets of North America and the Western Hemisphere. Pomegranates are used in cooking, baking, juices, smoothies and alcoholic beverages, such as martinis and wine.',	'27278',	'Pomegranate',	'151.jpg',	'image/jpeg',	268729,	'2012-04-20 09:39:58',	160,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	22663,	1,	'FOOD00151'),
(152,	'Pear',	'Pyrus communis',	'The pear is any of several tree and shrub species of genus Pyrus, in the family Rosaceae. It is also the name of the pomaceous fruit of these trees. Several species of pear are valued by humans for their edible fruit, while others are cultivated as ornamental trees. The genus Pyrus is classified in subtribe Pyrinae within tribe Pyreae.',	'25295',	'Pear',	'152.jpg',	'image/jpeg',	18086,	'2012-04-20 09:37:00',	161,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	23211,	1,	'FOOD00152'),
(153,	'Radish',	'Raphanus sativus',	'The radish (Raphanus sativus) is an edible root vegetable of the Brassicaceae family that was domesticated in Europe in pre-Roman times. They are grown and consumed throughout the world. Radishes have numerous varieties, varying in size, color and duration of required cultivation time. There are some radishes that are grown for their seeds; oilseed radishes are grown, as the name implies, for oil production. Radish can sprout from seed to small plant in as little as 3 days.',	'23290',	'Radish',	'153.jpg',	'image/jpeg',	14683,	'2012-04-20 09:36:57',	162,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3726,	1,	'FOOD00153'),
(154,	'Garden rhubarb',	'Rheum rhabarbarum',	'Rheum rhabarbarum, Rhubarb is a species of plant in the family Polygonaceae. They are herbaceous perennials growing from short, thick rhizomes. They have large leaves that are somewhat triangular, with long fleshy petioles. They have small flowers grouped in large compound leafy greenish-white to rose-red inflorescences. In culinary use, fresh raw petioles (leaf stalks) are crisp (similar to celery) with a strong, tart taste. Most commonly, the plant\'s leaf stalks are cooked with sugar and used in pies and other desserts. A number of varieties have been domesticated for human consumption, most of which are recognised as Rheum x hybridum by the Royal Horticultural Society. Rhubarb is usually considered to be a vegetable; however, in the United States, a New York court decided in 1947 that since it was used in the United States as a fruit, it was to be counted as a fruit for the purposes of regulations and duties. A side effect was a reduction on imported rhubarb tariffs, as tariffs were higher for vegetables than fruits. Rhubarb also contains glycosides especially rhein, glucorhein and emodin which impart cathartic and laxative activities to it. It is hence useful as a cathartic in case of constipation. Rhubarb, raw Nutritional value per 100 g Energy 88 kJ Carbohydrates 4.54 g - Sugars 1.1 g - Dietary fibre 1.8 g Fat 0.2 g Protein 0.9 g Water 93.61 g Folate (vit. B9) 7 μg (2%) Vitamin C 8 mg (10%) Vitamin E 0.27 mg (2%) Vitamin K 29.3 μg (28%) Calcium 86 mg (9%) Iron 0.22 mg (2%) Potassium 288 mg (6%) Sodium 4 mg (0%) Zinc 0.1 mg (1%) Percentages are relative toUS recommendations for adults.',	'504747',	'Rhubarb',	'154.jpg',	'image/jpeg',	78336,	'2012-04-20 09:36:18',	163,	'Vegetables',	'Stalk vegetables',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	3621,	1,	'FOOD00154'),
(155,	'Blackcurrant',	'Ribes nigrum',	'Blackcurrant, with the scientific name Ribes nigrum, is a species of Ribes native to central and northern Europe, and northern Asia. It is widely cultivated commercially and domestically as a temperate fruit crop for its abundant berries. It is less well known in the United States where it has been subject to restrictions as a disease vector for most of the 20th century.',	'24488',	'Blackcurrant',	'155.jpg',	'image/jpeg',	92534,	'2012-04-20 09:30:10',	164,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	78511,	1,	'FOOD00155'),
(156,	'Redcurrant',	'Ribes rubrum',	'The redcurrant (or red currant), Ribes rubrum, is a member of the genus Ribes in the gooseberry family Grossulariaceae, native to parts of western Europe. It is a deciduous shrub normally growing to 1-1.5 m tall, occasionally 2 m, with five-lobed leaves arranged spirally on the stems. The flowers are inconspicuous yellow-green, in pendulous 4–8 cm racemes, maturing into bright red translucent edible berries about 8–12 mm diameter, with 3-10 berries on each raceme. An established bush can produce 3-4 kilos of berries from mid to late summer.',	'504798',	'Redcurrant',	'156.jpg',	'image/jpeg',	91355,	'2012-04-20 09:41:09',	165,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	175228,	1,	'FOOD00156'),
(157,	'Gooseberry',	'Ribes uva-crispa',	'The gooseberry (with scientific names Ribes uva-crispa, is a species of Ribes . It is native to Europe, northwestern Africa, west, south and southeast Asia. Gooseberry bushes produce an edible fruit and are grown on both a commercial and domestic basis. Although usually placed as a subgenus within Ribes, a few taxonomists treat Grossularia as a separate genus, although hybrids between gooseberry and blackcurrant are possible. The subgenus Grossularia differs somewhat from currants, chiefly in their spiny stems, and in that their flowers grow one to three together on short stems, not in racemes. It is one of several similar species in the subgenus Grossularia; for the other related species, see the genus page Ribes.',	'504800',	'Gooseberry',	'157.jpg',	'image/jpeg',	4563702,	'2012-04-20 09:36:39',	166,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	135518,	1,	'FOOD00157'),
(158,	'Watercress',	'Rorippa nasturtium-aquaticum',	'Watercress (Nasturtium officinale), is a fast-growing, aquatic or semi-aquatic, perennial plant native to Europe and Asia, and one of the oldest known leaf vegetables consumed by humans. It is a member of the family Brassicaceae, botanically related to garden cress, mustard and radish — all noteworthy for a peppery, tangy flavour. The hollow stems of watercress are floating, and the leaves are pinnately compound. Small, white and green flowers are produced in clusters.',	'22993',	'Watercress',	'158.jpg',	'image/jpeg',	103331,	'2012-04-20 09:33:49',	167,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	135518,	1,	'FOOD00158'),
(159,	'Rosemary',	'Rosmarinus officinalis',	'Rosmarinus officinalis, commonly known as rosemary, is a woody, perennial herb with fragrant, evergreen, needle-like leaves and white, pink, purple, or blue flowers, native to the Mediterranean region. It is a member of the mint family Lamiaceae, which includes many other herbs. The name \"rosemary\" derives from the Latin for \"dew\" (ros) and \"sea\" (marinus), or \"dew of the sea\". The plant is also sometimes called anthos, from the ancient Greek word, meaning \"flower\".\r\nRosemary is used as a decorative plant in gardens and has many culinary and medical uses. The plant is said to improve the memory. The leaves are used to flavor various foods, such as stuffings and roast meats.',	'32677',	'Rosemary',	'159.jpg',	'image/jpeg',	153307,	'2012-04-20 09:36:19',	168,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	39367,	1,	'FOOD00159'),
(160,	'Rubus (Blackberry, Raspberry)',	'Rubus',	'Rubus is a large genus of flowering plants in the rose family, Rosaceae, subfamily Rosoideae. Raspberries, blackberries, and dewberries are common, widely distributed members of the genus. Most of these plants have woody stems with prickles like roses; spines, bristles, and gland-tipped hairs are also common in the genus. The Rubus fruit, sometimes called a bramble fruit, is an aggregate of drupelets. The term \"cane fruit\" (or \"cane-fruit\") applies to any Rubus species or hybrid which is commonly grown with supports such as wires or canes, including raspberries, blackberries, and hybrids such as loganberry, boysenberry and tayberry.',	'24848',	'Rubus',	'160.jpg',	'image/jpeg',	77470,	'2012-04-20 09:36:03',	170,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2020-03-12 21:00:54',	NULL,	NULL,	0,	'specific',	23216,	0,	'FOOD00160'),
(161,	'Cloudberry',	'Rubus chamaemorus',	'Rubus chamaemorus (Greek chamai \"on the ground\", moros \"mulberry\") is a rhizomatous herb native to alpine and arctic tundra and boreal forest, producing amber-colored edible fruit similar to the raspberry or blackberry. English common names include cloudberry, bakeapple (in Atlantic Canada), knotberry and knoutberry (in England), aqpik or low-bush salmonberry (in Alaska - not to be confused with true salmonberry, Rubus spectabilis), and averin or evron (in Scotland).\nUnlike most Rubus species, the cloudberry is dioecious, and fruit production by a female plant requires pollination from a male plant.\nThe cloudberry grows to 10?25 cm high. The leaves alternate between having 5 and 7 soft, handlike lobes on straight, branchless stalks. After pollination, the white (sometimes reddish-tipped) flowers form raspberry-sized berries. Encapsulating between 5 and 25 drupelets, each fruit is initially pale red, ripening into an amber color in early autumn.',	'24850',	'Cloudberry',	'161.jpg',	'image/jpeg',	363974,	'2012-04-20 09:34:45',	171,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	57936,	1,	'FOOD00161'),
(162,	'Red raspberry',	'Rubus idaeus',	'Rubus idaeus (raspberry, also called red raspberry or occasionally as European raspberry to distinguish it from other raspberries) is a red-fruited species of Rubus native to Europe and northern Asia and commonly cultivated in other temperate regions.\r\nThe fruit is red, edible, and sweet but tart-flavoured, produced in summer or early autumn; in botanical terminology, it is not a berry at all, but an aggregate fruit of numerous drupelets around a central core. In raspberries (various species of Rubus subgenus Idaeobatus), the drupelets separate from the core when picked, leaving a hollow fruit, whereas in blackberries and most other species of Rubus, the drupelets stay attached to the core.',	'24947',	'Red_raspberry',	'162.jpg',	'image/jpeg',	108009,	'2012-04-20 09:32:00',	172,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	1,	'specific',	32247,	1,	'FOOD00162'),
(163,	'Black raspberry',	'Rubus occidentalis',	'Black raspberry is a common name for three species of the genus Rubus: Rubus leucodermis, native to western North America Rubus occidentalis, native to eastern North America Rubus coreanus, also known as Korean black raspberry, native to Korea, Japan, and China A black raspberry is a small fruit that weighs between one and two grams. Almost all commercial production of black raspberries is from developed cultivars of Rubus occidentalis. Oregon accounts for over 90% of black raspberry production in the United States. Black raspberry plants yield significantly less fruit than their red counterparts and also commonly suffer from a raspberry mosaic disease complex that gives them shorter lifespans than other cane berry plants. Because of this, they can be costly to produce on a large scale.',	'24854',	'Black raspberry',	'163.jpg',	'image/jpeg',	80586,	'2012-04-20 09:29:15',	173,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	75079,	1,	'FOOD00163'),
(164,	'Sorrel',	'Rumex acetosa',	'Common sorrel or garden sorrel (Rumex acetosa), often simply called sorrel, is a perennial herb in the family Polygonaceae. Other names for sorrel include spinach dock and narrow-leaved dock. It is a common plant in grassland habitats and is cultivated as a garden herb or leaf vegetable (pot herb).',	'504901',	'Sorrel',	'164.jpg',	'image/jpeg',	50673,	'2012-04-20 09:41:31',	174,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	41241,	1,	'FOOD00164'),
(165,	'Common sage',	'Salvia officinalis',	'Salvia officinalis (sage, also called garden sage, or common sage) is a perennial, evergreen subshrub, with woody stems, grayish leaves, and blue to purplish flowers. It is a member of the family Lamiaceae and is native to the Mediterranean region, though it has naturalized in many places throughout the world. It has a long history of medicinal and culinary use, and in modern times as an ornamental garden plant. The common name \"sage\" is also used for a number of related and unrelated species.',	'32729',	'Common_sage',	'165.jpg',	'image/jpeg',	145290,	'2012-04-20 09:41:27',	175,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	38868,	1,	'FOOD00165'),
(166,	'Black elderberry',	'Sambucus nigra',	'Sambucus nigra is a species complex of flowering plants in the family Adoxaceae, native to most of Europe. Common names include elder, elderberry, black elder, European elder, European elderberry and European black elderberry, It grows in a variety of conditions including both wet and dry fertile soils, primarily in sunny locations.',	'35324',	'Sambucus nigra',	'166.jpg',	'image/jpeg',	182013,	'2012-04-20 09:43:17',	176,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:17',	NULL,	NULL,	0,	'specific',	4202,	1,	'FOOD00166'),
(167,	'Summer savory',	'Satureja hortensis',	'Summer savory (Satureja hortensis) is the better known of the savory species. It is an annual, but otherwise is similar in use and flavor to the perennial winter savory. It is used more often than winter savory, as winter savory is thought to have a slightly more bitter flavor.\nSummer savory is a traditional popular herb in Atlantic Canada, where it is used in the same way sage is elsewhere. It is the main flavoring in dressing for many fowl, mixed with ground pork and other basic ingredients to create a thick meat dressing known as \"cretonade\", which may be eaten with turkey, goose and duck. It also is used to make stews such as fricot, and in meat pies. It is usually available year-round in local grocery stores in dried form and is used in varying proportions, sometimes added to recipes in large generous heaping spoonfuls (such as in cretonade), and sometimes more subtly (as in beans, for which savory has a natural affinity). Summer savory is a characteristic ingredient of herbes de Provence, a fairly standard mixture of dried herbs sold in most French food stores. It is also widely used as a seasoning for grilled meats and barbecues, as well as in stews and sauces.',	'32308',	'Summer_savory',	'167.jpg',	'image/jpeg',	111495,	'2012-04-20 09:33:36',	177,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:23',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	49987,	1,	'FOOD00167'),
(168,	'Winter savory',	'Satureja montana',	'Winter savory (Satureja montana) is a perennial herb in the family Lamiaceae, native to warm temperate regions of southern Europe. It is a semi-evergreen, semi-woody subshrub growing to 16 in tall. The leaves are opposite, oval-lanceolate, 1–2 cm long and 5 mm broad. The flowers are white.',	'505016',	'Winter savory',	'168.jpg',	'image/jpeg',	159665,	'2012-04-20 09:40:38',	178,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	49988,	1,	'FOOD00168'),
(169,	'Rye',	'Secale cereale',	'Rye (Secale cereale) is a grass grown extensively as a grain and as a forage crop. It is a member of the wheat tribe and is closely related to barley (Hordeum) and wheat (Triticum). Rye grain is used for flour, rye bread, rye beer, some whiskeys, some vodkas, and animal fodder. It can also be eaten whole, either as boiled rye berries, or by being rolled, similar to rolled oats. Rye is a cereal grain and should not be confused with ryegrass, which is used for lawns, pasture, and hay for livestock.',	'42090',	'Rye',	'169.jpg',	'image/jpeg',	20894,	'2012-04-20 09:35:47',	179,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	1,	'specific',	4550,	1,	'FOOD00169'),
(170,	'Sesame',	'Sesamum orientale',	'Sesame is a flowering plant in the genus Sesamum. Numerous wild relatives occur in Africa and a smaller number in India. It is widely naturalized in tropical regions around the world and is cultivated for its edible seeds, which grow in pods. Sesame seed is considered to be the oldest oilseed crop known, domesticated well over 5000 years ago. Sesame is very drought-tolerant. It has been called a survivor crop, with an ability to grow where most crops fail. Sesame has one of the highest oil contents of any seed. With a rich nutty flavor, it is a common ingredient in cuisines across the world. Sesame, like other nuts and foods, can trigger allergic reactions in some people. The world harvested about 3.84 million metric tonnes of sesame seeds in 2010. The largest producer of sesame seeds in 2010 was Burma. The world\'s largest exporter of sesame seeds was India, and Japan the largest importer.',	'505186',	'Sesame',	'170.jpg',	'image/jpeg',	129804,	'2012-04-20 09:37:40',	180,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	4182,	1,	'FOOD00170'),
(171,	'Garden tomato',	'Solanum lycopersicum',	'The tomato is the edible, often red fruit/berry of the nightshade Solanum lycopersicum, commonly known as a tomato plant. The species originated in the South American Andes and its use as a food originated in Mexico, and spread throughout the world following the Spanish colonization of the Americas. Its many varieties are now widely grown, sometimes in greenhouses in cooler climates.\nThe tomato is consumed in diverse ways, including raw, as an ingredient in many dishes, sauces, salads, and drinks. While it is botanically a fruit, it is considered a vegetable for culinary purposes (as well as under U.S. customs regulations, see Nix v. Hedden), which has caused some confusion. The fruit is rich in lycopene, which may have beneficial health effects.',	'521671',	'Solanum_lycopersicum',	'171.jpg',	'image/jpeg',	99027,	'2012-04-20 09:37:18',	181,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	1,	'specific',	4081,	1,	'FOOD00171'),
(172,	'Cherry tomato',	'Solanum lycopersicum var. cerasiforme',	'A cherry tomato is a very small variety of tomato that has been cultivated since at least the early 1800s and thought to have originated in Peru and Northern Chile. Cherry tomatoes range in size from a thumbtip up to the size of a golf ball, and can range from being spherical to slightly oblong in shape. The more oblong ones often share characteristics with plum tomatoes, and are known as grape tomatoes. The berry tomato is regarded as a botanical variety of the cultivated berry, Solanum lycopersicum var. cerasiforme',	'566309',	'Cherry tomato',	'172.jpg',	'image/jpeg',	51260,	'2012-04-20 09:38:31',	182,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	195583,	1,	'FOOD00172'),
(173,	'Garden tomato (var.)',	'Solanum lycopersicum var. lycopersicum',	NULL,	'566310',	NULL,	'173.jpg',	'image/jpeg',	98009,	'2012-04-20 09:42:59',	183,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	397755,	1,	'FOOD00173'),
(174,	'Eggplant',	'Solanum melongena',	'The plant known in North America as the eggplant, Solanum melongena, is a species of flowering plant known in French and British English as the aubergine. Also known as the brinjal, brinjal eggplant, melongene, or guinea squash, it is a member of the family Solanaceae. It bears a fruit of the same name, eggplant or aubergine, widely used in cooking, most notably moussaka and ratatouille. As a nightshade (Solanum), it is closely related to both the tomato and the potato. It was domesticated in India from the wild nightshade, the thorn or bitter apple, S. incanum.',	'30446',	'Eggplant',	'174.jpg',	'image/jpeg',	43764,	'2012-04-20 09:30:03',	184,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	1,	'specific',	4111,	1,	'FOOD00174'),
(175,	'Potato',	'Solanum tuberosum',	'The potato is a starchy, tuberous crop from the perennial Solanum tuberosum of the Solanaceae family (also known as the nightshades). The word may refer to the plant itself as well as the edible tuber. In the region of the Andes, there are some other closely related cultivated potato species. Potatoes were introduced outside the Andes region four centuries ago, and have become an integral part of much of the world\'s cuisine. It is the world\'s fourth-largest food crop, following rice, wheat and maize. Long-term storage of potatoes requires specialised care in cold warehouses. Wild potato species occur throughout the Americas, from the United States to southern Chile. The potato was originally believed to have been domesticated independently in multiple locations, but later genetic testing of the wide variety of cultivars and wild species proved a single origin for potatoes in the area of present-day southern Peru and extreme northwestern Bolivia (from a species in the Solanum brevicaule complex), where they were domesticated 7,000–10,000 years ago. Following centuries of selective breeding, there are now over a thousand different types of potatoes. Of these subspecies, a variety that at one point grew in the Chiloé Archipelago left its germplasm on over 99% of the cultivated potatoes worldwide. The annual diet of an average global citizen in the first decade of the 21st century included about 33 kg of potato. However, the local importance of potato is extremely variable and rapidly changing. It remains an essential crop in Europe (especially eastern and central Europe), where per capita production is still the highest in the world, but the most rapid expansion over the past few decades has occurred in southern and eastern Asia. China is now the world\'s largest potato-producing country, and nearly a third of the world\'s potatoes are harvested in China and India.',	'505272',	'Potato',	'175.jpg',	'image/jpeg',	135158,	'2012-04-20 09:33:45',	185,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	1,	'specific',	4113,	1,	'FOOD00175'),
(176,	'Rowanberry',	'Sorbus aucuparia',	'Sorbus aucuparia, commonly called rowan and mountain-ash, is a species of deciduous tree or shrub in the rose family. It is a highly variable species, and botanists have used different definitions of the species to include or exclude trees native to certain areas; a recent definition includes trees native to most of Europe and parts of Asia, as well as northern Africa. The range extends from Madeira and Iceland to Russia and northern China. Unlike many plants with similar distributions, it is not native to Japan.\nFruit and foliage of S. aucuparia have been used by humans in the creation of dishes and beverages, as a folk medicine, and as fodder for livestock. Its tough and flexible wood has traditionally been used for woodworking. It is planted to fortify soil in mountain regions or as an ornamental tree and has several cultivars.',	'25320',	'Rowanberry',	'176.jpg',	'image/jpeg',	54406,	'2012-04-20 09:43:27',	186,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	36599,	1,	'FOOD00176'),
(177,	'Sorghum',	'Sorghum bicolor',	'Sorghum is a genus of numerous species of grasses, one of which is raised for grain and many of which are used as fodder plants, either cultivated or as part of pasture. The plants are cultivated in warmer climates worldwide. Species are native to tropical and subtropical regions of all continents in addition to the southwest Pacific and Australasia. Sorghum is in the subfamily Panicoideae and the tribe of Andropogoneae.',	'42108',	'Sorghum',	'177.jpg',	'image/jpeg',	263982,	'2012-04-20 09:29:38',	187,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	4558,	1,	'FOOD00177'),
(178,	'Spinach',	'Spinacia oleracea',	'Spinach (Spinacia oleracea) is an edible flowering plant in the family of Amaranthaceae. It is native to central and southwestern Asia. It is an annual plant, which grows to a height of up to 30 cm. Spinach may survive over winter in temperate regions. The leaves are alternate, simple, ovate to triangular-based, very variable in size from about 2–30 cm long and 1–15 cm broad, with larger leaves at the base of the plant and small leaves higher on the flowering stem. The flowers are inconspicuous, yellow-green, 3–4 mm diameter, maturing into a small, hard, dry, lumpy fruit cluster 5–10 mm across containing several seeds. Common spinach, Spinacia oleracea, was long considered to be in the Chenopodiaceae family, but in 2003, the Chenopodiaceae family was combined with the Amaranthaceae family under the family name \'Amaranthaceae\' in the order Caryophyllales. Within the Amaranthaceae family, Amaranthoideae and Chenopodioideae are now subfamilies, for the amaranths and the chenopods, respectively.',	'20709',	'Spinach',	'178.jpg',	'image/jpeg',	113714,	'2012-04-20 09:30:37',	188,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	1,	'specific',	3562,	1,	'FOOD00178'),
(179,	'Cloves',	'Syzygium aromaticum',	'Cloves are the aromatic flower buds of a tree in the family Myrtaceae, Syzygium aromaticum. They are native to the Maluku Islands in Indonesia, and are commonly used as a spice. Cloves are commercially harvested primarily in Indonesia, India, Madagascar, Zanzibar, Pakistan, Sri Lanka?and the largest producer, Pemba Island, just off the coast of Tanzania.\nThe clove tree is an evergreen that grows up to 8?12 m tall, with large leaves and sanguine flowers grouped in terminal clusters. The flower buds initially have a pale hue, gradually turn green, then transition to a bright red when ready for harvest. Cloves are harvested at 1.5?2.0 cm long, and consist of a long calyx that terminates in four spreading sepals, and four unopened petals that form a small central ball.',	'506167',	'Cloves',	'179.jpg',	'image/jpeg',	83156,	'2012-04-20 09:38:14',	189,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	219868,	1,	'FOOD00179'),
(180,	'Tamarind',	'Tamarindus indica',	'Tamarind (Tamarindus indica) is a leguminous tree in the family Fabaceae indigenous to tropical Africa. The genus Tamarindus is a monotypic taxon, having only a single species. The tamarind tree produces edible, pod-like fruit which are used extensively in cuisines around the world. Other uses include traditional medicines and metal polishes. The wood can be used in carpentry. Because of the tamarind\'s many uses, cultivation has spread around the world in tropical and subtropical zones.',	'26980',	'Tamarind',	'180.jpg',	'image/jpeg',	34947,	'2012-04-20 09:41:22',	190,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	58860,	1,	'FOOD00180'),
(181,	'Dandelion',	'Taraxacum officinale',	'Taraxacum is a large genus of flowering plants in the family Asteraceae. They are native to Eurasia and North and South America, and two species, T. officinale and T. erythrospermum, are found as weeds worldwide. Both species are edible in their entirety. The common name dandelion (from French dent-de-lion, meaning \"lion\'s tooth\") is given to members of the genus, and like other members of the Asteraceae family, they have very small flowers collected together into a composite flower head. Each single flower in a head is called a floret. Many Taraxacum species produce seeds asexually by apomixis, where the seeds are produced without pollination, resulting in offspring that are genetically identical to the parent plant.',	'36213',	'Dandelion',	'181.jpg',	'image/jpeg',	386051,	'2012-04-20 09:37:01',	192,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	50225,	1,	'FOOD00181'),
(182,	'Cocoa bean',	'Theobroma cacao',	'Cocoa bean (also cacao bean, often simply cocoa and cacao; Mayan: kakaw; Nahuatl: cacaua) is the dried and fully fermented fatty seed of Theobroma cacao, from which cocoa solids and cocoa butter are extracted. They are the basis of chocolate, as well as many Mesoamerican foods such as mole sauce and tejate. [Wikipedia]',	'505487',	'Cocoa_bean',	'182.jpg',	'image/jpeg',	209385,	'2012-04-20 09:39:56',	193,	'Cocoa and cocoa products',	'Cocoa',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	2,	0,	'specific',	3641,	1,	'FOOD00182'),
(183,	'Common thyme',	'Thymus vulgaris',	'Thymus vulgaris or common thyme is a low growing herbaceous plant, sometimes becoming somewhat woody. It is native to southern Europe, where it is often cultivated as a culinary herb. It typically grows as a sub-shrub, between 15 and 20 cm tall.',	'505501',	'Thymus vulgaris',	'183.jpg',	'image/jpeg',	46465,	'2012-04-20 09:30:37',	194,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	49992,	1,	'FOOD00183'),
(184,	'Linden',	'Tilia',	'<i>Tilia</i> is a genus of about 30 species of trees native throughout most of the temperate Northern Hemisphere. Commonly called lime trees in the British Isles, they are not related to the lime fruit. Other names include linden, and basswood for the North American species. The genus occurs in Europe and eastern North America, but the greatest species diversity is found in Asia. Under the Cronquist classification system, this genus was placed in the family Tiliaceae, but genetic research summarised by the Angiosperm Phylogeny Group has resulted in the incorporation of this genus, and of most of the previous family, into the Malvaceae.\r\n\r\n<i>Tilia</i> species are mostly large, deciduous trees, reaching typically 20 to 40 metres (65 to 130 ft) tall, with oblique-cordate leaves 6 to 20 centimetres (2 1⁄4 to 7 3⁄4 in) across. As with elms, the exact number of species is uncertain, as many if not most of the species will hybridise readily, both in the wild and in cultivation. Limes are hermaphroditic, having perfect flowers with both male and female parts, pollinated by insects.\r\n\r\nThe dried flowers are mildly sweet and sticky, and the fruit is somewhat sweet and mucilaginous. Limeflower tea has a pleasing taste, due to the aromatic volatile oil found in the flowers. The flowers, leaves, wood, and charcoal (obtained from the wood) are used for medicinal purposes. Active ingredients in the <i>Tilia</i> flowers include flavonoids (which act as antioxidants) and volatile oils. The plant also contains tannins that can act as an astringent.\r\n\r\nLinden flowers are used in herbalism for colds, cough, fever, infections, inflammation, high blood pressure, headache (particularly migraine), and as a diuretic (increases urine production), antispasmodic (reduces smooth muscle spasm along the digestive tract), and sedative. In the traditional Austrian medicine <i>Tilia</i> sp. flowers have been used internally as tea for treatment of disorders of the respiratory tract, fever and flu. New evidence shows that the flowers may be hepatoprotective. The wood is used for liver and gallbladder disorders and cellulitis (inflammation of the skin and surrounding soft tissue). That wood burned to charcoal is ingested to treat intestinal disorders and used topically to treat edema or infection such as cellulitis or ulcers of the lower leg.\r\n\r\nUsually, the double-flowered species are used to make perfumes. The leaf buds and young leaves are also edible raw. Tilia species are used as food plants by the larvae of some Lepidoptera; see List of Lepidoptera that feed on <i>Tilia</i>. (Wikipedia)',	'21535',	'',	'184.jpg',	'image/jpeg',	83579,	'2012-04-20 09:36:55',	195,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	64580,	1,	'FOOD00184'),
(185,	'Small-leaf linden',	'Tilia cordata',	'Tilia cordata (Small-leaved Lime, occasionally Small-leaved Linden or Little-leaf Linden) is a species of Tilia native to much of Europe and western Asia, north to southern Great Britain (north to about Durham), central Scandinavia, all over Romania, east to central Russia, and south to central Spain, Italy, Bulgaria, Turkey, and the Caucasus; in the south of its range it is restricted to high altitudes. It is a deciduous tree growing to 20-38 m tall, with a trunk up to 1-2 m diameter. The leaves are alternately arranged, rounded to triangular-ovate, 3-8 cm long and broad, mostly hairless (unlike the related Tilia platyphyllos) except for small tufts of brown hair in the leaf vein axils - the leaves are distinctively heart-shaped. The small yellow-green hermaphrodite flowers are produced in clusters of five to eleven in early summer with a leafy yellow-green subtending bract, have a rich, heavy scent; the trees are much visited by bees. The fruit is a dry nut-like drupe 6–7 mm long and 4 mm broad, downy at first becoming smooth at maturity, and (unlike T. platyphyllos) not ribbed. The Linden honey is considered to be valuable in both nutricional and medical aspects. It readily hybridises with Tilia platyphyllos; the hybrid is named Tilia × europaea (syn. T. × vulgaris). In Britain, it is considered an indicator of ancient woodland, and is becoming increasingly rare.',	'505507',	'Tilia cordata',	'185.jpg',	'image/jpeg',	53411,	'2012-04-20 09:30:07',	196,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:24',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	172266,	1,	'FOOD00185'),
(186,	'Fenugreek',	'Trigonella foenum-graecum',	'Fenugreek  (Trigonella foenum-graecum) is an annual plant in the family Fabaceae, with leaves consisting of three small obovate to oblong leaflets. It is cultivated worldwide as a semiarid crop. Its seeds and its leaves are common ingredients in dishes from South Asia. Fenugreek is used as a herb (dried or fresh leaves), spice (seeds), and vegetable (fresh leaves, sprouts, and microgreens). Sotolon is the chemical responsible for fenugreek\'s distinctive sweet smell. Cuboid-shaped, yellow- to amber-coloured fenugreek seeds are frequently encountered in the cuisines of the Indian subcontinent, used both whole and powdered in the preparation of pickles, vegetable dishes dal, and spice mixes such as panch phoron and sambar powder. They are often roasted to reduce bitterness and enhance flavour. Constituents of fenugreek seeds include flavonoids, alkaloids, coumarins, vitamins, and saponins; the most prevalent alkaloid is trigonelline and coumarins include cinnamic acid and scopoletin (Wikipedia).',	'505590',	'Fenugreek',	'186.jpg',	'image/jpeg',	149323,	'2012-04-20 09:44:26',	197,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	78534,	1,	'FOOD00186'),
(187,	'Common wheat',	'Triticum aestivum',	'Common wheat, Triticum aestivum (also known as bread wheat), is a cultivated wheat species.',	'42237',	'Common wheat',	'187.jpg',	'image/jpeg',	121535,	'2012-04-20 09:37:50',	198,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	4565,	1,	'FOOD00187'),
(188,	'Vaccinium (Blueberry, Cranberry, Huckleberry)',	'Vaccinium',	'Vaccinium is a genus of shrubs or dwarf shrubs in the plant Family Ericaceae. The fruit of many species are eaten by humans and some are of commercial importance, including the cranberry, blueberry, bilberry or whortleberry, lingonberry or cowberry, and huckleberry. Like many other ericaceous plants, they are generally restricted to acidic soils.',	'23571',	'Vaccinium',	'188.jpg',	'image/jpeg',	71693,	'2012-04-20 09:36:57',	199,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	13749,	1,	'FOOD00188'),
(189,	'Lowbush blueberry',	'Vaccinium angustifolium',	'Vaccinium angustifolium, commonly known as the Lowbush Blueberry, is a species of blueberry native to eastern and central Canada and the northeastern United States, growing as far south as West Virginia and west to the Great Lakes region, Minnesota and Manitoba.\nVaccinium angustifolium is a low spreading deciduous shrub growing to 60 cm tall, though usually 35 cm tall or less. The leaves are glossy blue-green in summer, turning purple in the fall. The leaf shape is broad to elliptical. Buds are brownish red in stem axils. The flowers are white, bell-shaped, 5 mm long. The fruit is a small sweet dark blue to black berry.',	'23579',	'Lowbush_blueberry',	'189.jpg',	'image/jpeg',	134931,	'2012-04-20 09:35:40',	201,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	472369,	1,	'FOOD00189'),
(190,	'Sparkleberry',	'Vaccinium arboreum',	'Vaccinium arboreum (Sparkleberry or Farkleberry) is a species of Vaccinium native to the southeastern United States, from southern Virginia west to southeastern Nebraska, south to Florida and eastern Texas, and north to Illinois. The fruit is a round dry berry about 6 mm in diameter, green at first, black when ripe, edible but bitter and tough.',	'23580',	'Sparkleberry',	'190.jpg',	'image/jpeg',	35178,	'2012-04-20 09:30:41',	202,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	229201,	1,	'FOOD00190'),
(191,	'Highbush blueberry',	'Vaccinium corymbosum',	'Vaccinium corymbosum, the Northern highbush blueberry, is a species of blueberry native to eastern North America, from the Great Lakes region east to Nova Scotia, and south through the Northeastern United States and Appalachian region, to the Southeastern United States in Mississippi. Other common names include blue huckleberry, tall huckleberry, swamp huckleberry, high blueberry, and swamp blueberry.The fruit is a 0.25–0.5 inches (6.4–12.7 mm) diameter blue-black berry. This plant is found in wooded or open areas with moist acidic soils.',	'23573',	'Vaccinium corymbosum',	'191.jpg',	'image/jpeg',	109028,	'2012-04-20 09:41:19',	203,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	69266,	1,	'FOOD00191'),
(192,	'American cranberry',	'Vaccinium macrocarpon',	'Vaccinium macrocarpon (also called Large cranberry, American Cranberry and Bearberry) is a cranberry of the subgenus Oxycoccus and genus Vaccinium. It is native to North America. Preliminary studies show V. macrocarpon fruit has antibacterial activity against the intestinal pathogens Escherichia coli and Listeria monocytogenes.',	'23599',	'Vaccinium macrocarpon',	'192.jpg',	'image/jpeg',	987225,	'2012-04-20 09:37:23',	204,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	13750,	1,	'FOOD00192'),
(193,	'Bilberry',	'Vaccinium myrtillus',	'Bilberry is any of several species of low-growing shrubs in the genus Vaccinium, bearing edible berries. The species most often referred to is Vaccinium myrtillus L. , but there are several other closely related species.',	'23605',	'Bilberry',	'193.jpg',	'image/jpeg',	115739,	'2012-04-20 09:29:13',	205,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	180763,	1,	'FOOD00193'),
(194,	'Lingonberry',	'Vaccinium vitis-idaea',	'Vaccinium vitis-idaea (lingonberry or cowberry) is a short evergreen shrub in the heath family that bears edible sour, slightly sweet, slightly bitter fruit, native to boreal forest and Arctic tundra throughout the Northern Hemisphere from Eurasia to North America. In the past it was seldom cultivated, but fruit was commonly collected in the wild. Recently, commercial cultivation has begun in the U.S. Pacific Northwest.',	'505637',	'Vaccinium vitis-idaea',	'194.jpg',	'image/jpeg',	254126,	'2012-04-20 09:43:36',	206,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	180772,	1,	'FOOD00194'),
(195,	'Vanilla',	'Vanilla',	'Vanilla is a flavor derived from orchids of the genus Vanilla, primarily from the Mexican species, flat-leaved vanilla (V. planifolia). The word vanilla, derived from the diminutive of the Spanish word vaina (vaina itself meaning sheath or pod), simply translates as little pod. Pre-Columbian Mesoamerican people cultivated the vine of the vanilla orchid, called tlilxochitl by the Aztecs, and Spanish conquistador Hernán Cortés is credited with introducing both vanilla and chocolate to Europe in the 1520s.',	'43714',	'Vanilla',	'195.jpg',	'image/jpeg',	143280,	'2012-04-20 09:43:23',	207,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	51238,	1,	'FOOD00195'),
(196,	'Common verbena',	'Verbena officinalis',	'Verbena officinalis, the Common Vervain or Common Verbena, is a perennial herb native to Europe. It grows up to a metre/yard high, with an upright habitus. The lobed leaves are toothed, the delicate spikes hold mauve flowers. This plant prefers limey soils; it is occasionally grown as an ornamental plant but perhaps more often for the powerful properties some herbalists ascribe to it. Propagation is by root cuttings or seed. It is widely naturalised outside its native range, for example in North America.',	'32110',	'Verbena officinalis',	'196.jpg',	'image/jpeg',	86786,	'2012-04-20 09:43:51',	208,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	79772,	1,	'FOOD00196'),
(197,	'Broad bean',	'Vicia faba',	'Vicia faba, also known as the broad bean, fava bean, faba bean, field bean, bell bean, or tic bean, is a species of bean (Fabaceae) native to North Africa, southwest and south Asia, and extensively cultivated elsewhere. A variety Vicia faba var. equina Pers. - horse bean has been provisionally recognized.\r\nBroad beans are eaten while still young and tender, enabling harvesting to begin as early as the middle of spring for plants started under glass or overwintered in a protected location, but even the main crop sown in early spring will be ready from mid to late summer. Horse beans, left to mature fully, are usually harvested in the late autumn. The young leaves of the plant can also be eaten either raw or cooked like spinach.',	'26339',	'Broad_bean',	'197.jpg',	'image/jpeg',	42037,	'2012-04-20 09:32:55',	209,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:18',	NULL,	NULL,	0,	'specific',	3906,	1,	'FOOD00197'),
(198,	'Adzuki bean',	'Vigna angularis',	'The azuki bean, also known as adzuki or aduki, is an annual vine, Vigna angularis, widely grown throughout East Asia and the Himalayas for its small (approximately 5 mm) bean. The cultivars most familiar in Northeast Asia have a uniform red color. However, white, black, gray and variously mottled varieties are also known. Scientists presume Vigna angularis var. nipponensis is the progenitor.',	'505691',	'Azuki bean',	'198.jpg',	'image/jpeg',	103330,	'2012-04-20 09:33:30',	210,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	3914,	1,	'FOOD00198'),
(199,	'Gram bean',	'Vigna mungo',	'Vigna mungo, known as Urad Dal, black gram, black lentil (not to be confused with the much smaller true black lentil (Lens culinaris)), white lentil, black matpe bean, is a bean grown in Indian subcontinent. It, along with the mung bean, was placed in Phaseolus, but has since been transferred to Vigna. At one time it was considered to belong to the same species as the mung bean. The product sold as \"black lentil\" is usually the whole urad bean or urad dal. The product sold as \"white lentil\" is the same lentil with the black skin removed.',	'506273',	'Vigna_mungo',	'199.jpg',	'image/jpeg',	172913,	'2012-04-20 09:30:21',	211,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	3915,	1,	'FOOD00199'),
(200,	'Mung bean',	'Vigna radiata',	'The mung or moong bean (also known as green gram or golden gram) is the seed of Vigna radiata, native to the Indian subcontinent, and mainly cultivated in China, Thailand, Philippines, Indonesia, Burma, Bangladesh and India, but also in hot and dry regions of Southern Europe and the Southern United States. It is used as a foodstuff in both savoury and sweet dishes.',	'506804',	'Mung bean',	'200.jpg',	'image/jpeg',	46739,	'2012-04-20 09:36:49',	212,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	157791,	1,	'FOOD00200'),
(201,	'Climbing bean',	'Vigna umbellata',	'Vigna umbellata (Thunb. ) Ohwi and Ohashi, previously Phaseolus calcaratus, is a warm-season annual vine legume with yellow flowers and small edible beans. It is commonly called ricebean or rice bean. To date, it is little known, little researched and little exploited. It is regarded as a minor food and fodder crop and is often grown as intercrop or mixed crop with maize (Zea mays), sorghum (Sorghum bicolor) or cowpea (V. unguiculata), as well as a sole crop in the uplands, on a very limited area. Like the other Asiatic Vigna species, ricebean is a fairly short-lived warm-season annual. Grown mainly as a dried pulse, it is also important as a fodder, a green manure and a vegetable. Ricebean is most widely grown as an intercrop, particularly of maize, throughout Indo-China and extending into southern China, India, Nepal and Bangladesh. In the past it was widely grown as lowland crop on residual soil water after the harvest of long-season rice, but it has been displaced to a great extent where shorter duration rice varieties are grown. Ricebean grows well on a range of soils. It establishes rapidly and has the potential to produce large amounts of nutritious animal fodder and high quality grain. The English language name is a literal translation of the Chinese language name.',	'506275',	'Vigna umbellata',	'201.jpg',	'image/jpeg',	88658,	'2012-04-20 09:29:16',	213,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:25',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	87088,	1,	'FOOD00201'),
(202,	'Cowpea',	'Vigna unguiculata',	'The cowpea (Vigna unguiculata) is one of several species of the widely cultivated genus Vigna. Four subspecies are recognised, of which three are cultivated: Vigna unguiculata subsp. dekindtiana, the wild relative of the cultivated subspecies Vigna unguiculata subsp. cylindrica, cultivated, catjang Vigna unguiculata subsp. sesquipedalis, cultivated, yardlong beans Vigna unguiculata subsp. unguiculata, cultivated, black-eyed pea Cowpeas are one of the most important food legume crops in the semiarid tropics covering Asia, Africa, southern Europe and Central and South America. A drought-tolerant and warm-weather crop, cowpeas are well-adapted to the drier regions of the tropics, where other food legumes do not perform well. It also has the useful ability to fix atmospheric nitrogen through its root nodules, and it grows well in poor soils with more than 85% sand and with less than 0.2% organic matter and low levels of phosphorus. In addition, it is shade tolerant, so is compatible as an intercrop with maize, millet, sorghum, sugarcane, and cotton. This makes cowpeas an important component of traditional intercropping systems, especially in the complex and elegant subsistence farming systems of the dry savannas in sub-Saharan Africa. In these systems the haulm (dried stalks) of cowpea is a valuable by-product, used as animal feed. Research in Ghana found that selecting early generations of cowpea crops to increase yield is not an effective strategy. Francis Padi from the Savannah Agricultural Research Institute in Tamale, Ghana, writing in Crop Science, suggests other methods such as bulk breeding are more efficient in developing high-yield varieties. Cowpeas are a common food item in the Southern United States, where they are often called black-eyed peas or field peas. Two subcategories of field peas are crowder peas, so called because they are crowded together in their pods, causing them to have squarish ends, and cream peas. In India, in Oriya, it is called jhudunga, in Bengali, it is called barboti kolai, in Kannada, it is called Alasande, in Telugu, it is called Alasandalu, Bobbarlu. In Hindi, it is called lobhia or bura (when used as a string bean). In Gujarati, these are called chola or chowla. In Marathi, these are called chawali or chavali. According to the USDA food database, the leaves of the cowpea plant have the highest percentage of calories from protein among vegetarian foods.',	'27018',	'Cowpea',	'202.jpg',	'image/jpeg',	74230,	'2012-04-20 09:41:44',	214,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	3917,	1,	'FOOD00202'),
(203,	'Muscadine grape',	'Vitis rotundifolia',	'Muscadine (Vitis rotundifolia) is a grapevine species native to the present-day southeastern United States that has been extensively cultivated since the 16th century. Its natural range is recognized in the following states of the US: Alabama, Arkansas, the Carolinas, Delaware, Florida, Georgia, Kentucky, Louisiana, Maryland, Missouri, Mississippi, Oklahoma, Tennessee, Texas, Virginia, and West Virginia. The plants are well adapted to their native warm and humid climate; they need fewer chilling hours than better known varieties and they thrive on summer heat. Muscadine berries range from bronze to dark purple to black in color when ripe. However, many wild varieties stay green through maturity. They have skin sufficiently tough that eating the raw fruit often involves biting a small hole in the skin to suck out the pulp inside. Muscadines are not only eaten fresh, but also are used in making wine, juice, and jelly. Muscadine grapes are rich sources of polyphenols and other nutrients studied for their potential health benefits. Gallic acid, (+)-catechin and epicatechin are the major phenolics in seeds, while ellagic acid, myricetin, quercetin, kaempferol, and trans-resveratrol are the major phenolics in the skins. In a natural setting, muscadines are important plants for improving wildlife habitat by providing cover, browse, and fruit for a wide variety of animals.',	'28609',	'Muscadine',	'203.jpg',	'image/jpeg',	78997,	'2012-04-20 09:36:58',	215,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	103349,	1,	'FOOD00203'),
(204,	'Common grape',	'Vitis vinifera',	'Vitis vinifera (Common Grape Vine) is a species of Vitis, native to the Mediterranean region, central Europe, and southwestern Asia, from Morocco and Portugal north to southern Germany and east to northern Iran. It is a liana growing to 35 yards tall, with flaky bark. The leaves are alternate, palmately lobed, 5–20 cm long and broad. The fruit is a berry, known as a grape; in the wild species it is 6 mm diameter and ripens dark purple to blackish with a pale wax bloom; in cultivated plants it is usually much larger, up to 3 cm long, and can be green, red, or purple (black). The species typically occurs in humid forests and streamsides. The wild grape is often classified as V. vinifera subsp. sylvestris (in some classifications considered Vitis sylvestris), with V. vinifera subsp. vinifera restricted to cultivated forms. Domesticated vines have hermaphrodite flowers, but subsp. sylvestris is dioecious and pollination is required for fruit to develop. The grape is eaten fresh, processed to make wine, or dried to produce raisins. Cultivars of Vitis vinifera form the basis of the majority of wines produced around the world. All of the familiar wine varieties belong to Vitis vinifera, which is cultivated on every continent except for Antarctica, and in all the major wine regions of the world.',	'28629',	'Vitis vinifera',	'204.jpg',	'image/jpeg',	61176,	'2012-04-20 09:29:18',	216,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	29760,	1,	'FOOD00204'),
(205,	'Corn',	'Zea mays',	'Maize (mayz; Zea mays subsp. mays, from Spanish: maíz after Taíno mahiz), known in some English-speaking countries as corn, is a large grain plant domesticated by indigenous peoples in Mesoamerica in prehistoric times. The leafy stalk produces ears which contain the grain, which are seeds called kernels. Maize kernels are often used in cooking as a starch.',	'42269',	'Corn',	'205.jpg',	'image/jpeg',	82516,	'2012-04-20 09:44:31',	220,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	4577,	1,	'FOOD00205'),
(206,	'Ginger',	'Zingiber officinale',	'Ginger or ginger root is the rhizome of the plant Zingiber officinale, consumed as a delicacy, medicine, or spice. It lends its name to its genus and family. Other notable members of this plant family are turmeric, cardamom, and galangal. Ginger cultivation began in South Asia and has since spread to East Africa and the Caribbean.',	'42402',	'Ginger',	'206.jpg',	'image/jpeg',	142638,	'2012-04-20 09:34:16',	221,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	94328,	1,	'FOOD00206'),
(207,	'Arctic blackberry',	'Rubus arcticus',	'Rubus arcticus, the Arctic raspberry, (includes Rubus arcticus ssp. acaulis - (Michx.)) is a species of slow-growing bramble belonging to the rose family. Its dark red fruit is considered a delicacy. In the Pacific Northwest it is sometimes called the nagoon or nagoonberry, a name which derives from the Tlingit neigóon. A measure of the quality of its fruit is expressed in its Russian name княженика knyazhenika, signifying the \"berry of princes\". It grows in northern Sweden, Norway, Finland, Russia (Siberia), in few locations in Estonia, Lithuania and in parts of North America. The fruits of the Arctic raspberry are very tasty and, among other uses, make jam and liqueur, or flavour tea.',	'24849',	'Rubus_arcticus',	'207.jpg',	'image/jpeg',	109060,	'2012-04-20 09:41:51',	222,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	70741,	1,	'FOOD00207'),
(208,	'Banana',	'Musa acuminata',	'A banana is an edible fruit produced by several kinds of large herbaceous flowering plants in the genus Musa. (In some countries, bananas used for cooking may be called plantains.) The fruit is variable in size, color and firmness, but is usually elongated and curved, with soft flesh rich in starch covered with a rind which may be green, yellow, red, purple, or brown when ripe. The fruits grow in clusters hanging from the top of the plant. Almost all modern edible parthenocarpic (seedless) bananas come from two wild species - Musa acuminata and Musa balbisiana. The scientific names of most cultivated bananas are Musa acuminata, Musa balbisiana, and Musa × paradisiaca for the hybrid Musa acuminata × M. balbisiana, depending on their genomic constitution. The old scientific name Musa sapientum is no longer used.',	'42390',	'Banana',	'208.jpg',	'image/jpeg',	1285623,	'2012-04-20 09:28:59',	223,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	4641,	1,	'FOOD00208'),
(209,	'Bayberry',	'Myrica',	'Myrica is a genus of about 35?50 species of small trees and shrubs in the family Myricaceae, order Fagales. The genus has a wide distribution, including Africa, Asia, Europe, North America and South America, and missing only from Australia. Some botanists split the genus into two genera on the basis of the catkin and fruit structure, restricting Myrica to a few species, and treating the others in Morella. The fruit is a small drupe, usually with a wax coating.\nCommon names include Bayberry, Bay-rum tree, Candleberry, Sweet Gale, and Wax-myrtle. The generic name was derived from the Greek word ?????? (myrike), meaning \"fragrance.\n',	'19260',	'Bayberry',	'209.jpg',	'image/jpeg',	28634,	'2012-04-20 09:33:24',	224,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	2,	0,	'specific',	3509,	1,	'FOOD00209'),
(210,	'Elliott\'s blueberry',	'Vaccinium elliottii',	'Vaccinum elliottii (Elliott\'s Blueberry) is a species of Vaccinium in the blueberry group (Vaccinium sect. Cyanococcus). It is native to the Southeastern United States, from southeastern Virginia south to Florida, and west to Arkansas and Texas.\nThe fruit is an edible berry 5-8 mm diameter. There are two variants one having tart shiny blue black berries and the other sweeter type having a whitish waxy bloom over the otherwise blue black berries; they ripen from late spring (in Florida) through summer (in Arkansas and Virginia).',	'23592',	'Vaccinium_elliottii',	'210.jpg',	'image/jpeg',	9422,	'2012-04-20 09:38:48',	225,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	283798,	1,	'FOOD00210'),
(211,	'Canada blueberry',	'Vaccinium myrtilloides',	'Canadian Blueberry, Vaccinium myrtilloides, is also called Common Blueberry, Velvetleaf Huckleberry, Velvetleaf Blueberry, and Sourtop Blueberry. It is a species of blueberry native to Canada and the Northeastern and Northwestern United States, as well as the Great Lakes states. The fruit is a small sweet bright blue to dark blue berry.',	'23604',	'Vaccinium myrtilloides',	'211.jpg',	'image/jpeg',	114676,	'2012-04-20 09:38:54',	226,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	1503870,	1,	'FOOD00211'),
(212,	'Bog bilberry',	'Vaccinium uliginosum',	'Vaccinium uliginosum (Bog Bilberry or Northern Bilberry) is a flowering plant in the genus Vaccinium. The fruit is a dark blue-black berry 5–8 millimetres (0.20–0.31 in) diameter, with a white flesh, edible and sweet when ripe in late summer.',	'23574',	'Vaccinium uliginosum',	'212.jpg',	'image/jpeg',	95934,	'2012-04-20 09:41:59',	227,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	190548,	1,	'FOOD00212'),
(213,	'Buffalo currant',	'Ribes aureum var. villosum',	'Ribes aureum, known commonly as the golden currant, is a species in the genus Ribes. It is native to Canada, most of the United States (except the southeast) and northern Mexico. The species Ribes odoratum is closely related, and sometimes named Ribes aureum var. villosum.\nRibes aureum is a small to medium-sized deciduous shrub, 2?3 metres (6.6?9.8 ft) tall. Leaves are green, shaped similarly to gooseberry leaves, turning red in autumn.\nThe plant blooms in spring with racemes of conspicuous golden yellow flowers, often with a pronounced fragrance similar to that of cloves or vanilla. Flowers may also be shades of cream to reddish, and are borne in clusters of up to 15. The shrub produces berries about 1 centimeter in diameter from an early age. Ripe fruits, amber yellow to black in color, are edible. The flowers are also edible.',	'530043',	'Buffalo_currant',	'213.jpg',	'image/jpeg',	66239,	'2012-04-20 09:33:31',	228,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	23283,	1,	'FOOD00213'),
(214,	'Celeriac',	'Apium graveolens var. rapaceum',	'Celeriac (Apium graveolens var. rapaceum), also called turnip-rooted celery or knob celery, is a variety of celery cultivated for its edible roots, hypocotyl, and shoots; these are sometimes collectively (but erroneously) called celery root. Celeriac is a root vegetable with a bulbous hypocotyl. In the Mediterranean Basin and in Northern Europe, celeriac grows wild and is widely cultivated. It is also cultivated in North Africa, Siberia, Southwest Asia, and North America. In North America, the Diamant cultivar predominates. Celeriac originated in the Mediterranean Basin.',	'530941',	'Celeriac',	'214.jpg',	'image/jpeg',	287967,	'2012-04-20 09:42:38',	229,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	278110,	1,	'FOOD00214'),
(215,	'Celery stalks',	'Apium graveolens var. dulce',	'Celery (Apium graveolens var. dulce) is a plant variety in the family Apiaceae, commonly used as a vegetable. The plant grows to 1 m (3.3 ft) tall. The leaves are pinnate to bipinnate with rhombic leaflets 3?6 cm long and 2?4 cm broad. The flowers are creamy-white, 2?3 mm in diameter, and are produced in dense compound umbels. The seeds are broad ovoid to globose, 1.5?2 mm long and wide.\nCelery is used around the world as a vegetable for the crisp petiole (leaf stalk). The leaves are strongly flavoured and are used less often, either as a flavouring in soups and stews or as a dried herb.',	'182185',	'Apium_graveolens',	'215.jpg',	'image/jpeg',	95996,	'2012-04-20 09:43:06',	230,	'Vegetables',	'Stalk vegetables',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	117781,	1,	'FOOD00215'),
(216,	'Chinese chives',	'Allium tuberosum',	'Allium tuberosum, (commonly known as garlic chives, Chinese chives, Oriental garlic, Chinese leek, also known by the Chinese name kow choi (also transliterated as gau choy; Chinese: ??; pinyin: Ji?cài; Wade?Giles: Chiu3-ts\'ai4; Jyutping: gau2 coi3), or the Japanese name nira, is a vegetable related to onion. The Chinese name for the species is variously adapted and transliterated as cuchay, jiucai, kucai, kuchay, or kutsay in Southeast Asian countries such as Indonesia, Malaysia and the Philippines. It is also sometimes called \"green nira grass\" where \"nira\" is Romanization of the Japanese word \"??\" which means garlic chives. The plant has a distinctive growth habit with strap-shaped leaves[5] unlike either onion or garlic, and straight thin white-flowering stalks that are much taller than the leaves. The flavor is more like garlic than chives. It grows in slowly expanding perennial clumps, but also readily sprouts from seed. In warmer areas, garlic chives may remain green all year round. In cold climates, aerial parts of garlic chives will die back completely to the ground and the roots/rhizomes will over-winter and then re-sprout in spring time.',	'506483',	'Chinese_chives',	'216.jpg',	'image/jpeg',	47909,	'2012-04-20 09:37:20',	231,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	4683,	1,	'FOOD00216'),
(217,	'European cranberry',	'Vaccinium oxycoccos',	'Vaccinium oxycoccos is a species of flowering plant in the heath family. It is known by the common names small cranberry, bog cranberry, and swamp cranberry. It is native to northern North America, Europe, and Asia. This cranberry is a small shrub. It is a trailing vine with leathery lance-shaped leaves up to a centimeter long. Flowers arise on nodding stalks a few centimeters tall. The corolla is white or pink and flexed backward away from the center of the flower. The fruit is a red berry which has spots when young. It measures up to 1.2 centimeters wide. The plant forms associations with mycorrhizae. It mainly reproduces vegetatively. This is a widespread and common species. It is an indicator of moist to wet soils which are low in nitrogen and have a high water table. It is an indicator of coniferous swamps. It grows in bogs and fens in moist forest habitat. It grows on peat which may be saturated most of the time. The soil in bogs is acidic and low in nutrients. The plant\'s mycorrhizae help it obtain nutrients in this situation. Fens have somewhat less acidic soil, which is also higher in nutrients. The plant can often be found growing on hummocks of Sphagnum mosses. Other species found in this forest understory habitat include leatherleaf (Chamaedaphne calyculata), bog rosemary (Andromeda glaucophylla), bog laurel (Kalmia polifolia), pitcher plant (Sarracenia purpurea), Labrador tea (Ledum groenlandicum), cloudberry (Rubus chamaemorus), rhodora (Rhododendron canadense), glossy buckthorn (Rhamnus frangula), sundew, cottonsedge (Eriophorum virginatum and E. angustifolium), and species of sedge and lichen. The plant easily colonizes bog habitat that has recently burned. It survives fire with its underground rhizomes. This plant has been used as a medicine and as a food by various Native-American communities. A tribe of Eskimo have cooked the cranberry with fish eggs and blubber. 40x40px Wikimedia Commons has media related to: Vaccinium oxycoccos',	'505635',	'Vaccinium oxycoccos',	'217.jpg',	'image/jpeg',	157195,	'2012-04-20 09:38:12',	232,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	516948,	1,	'FOOD00217'),
(218,	'Deerberry',	'Vaccinium stamineum',	'Vaccinium stamineum, commonly known as deerberry, squaw huckleberry or gooseberry, is a flowering shrub in the heath family. The plant is native to eastern North America from Ontario in the north, south to Florida and west to Texas. Its white, bell-shaped flowers consisting of 5 spreading petals emerge from April through June, and on rare occasions from October through November. The fruit is an edible pubescent berry. The species is highly variable and a number of varieties have been named. It is typically found in rocky or sandy soil in xeric woodlands.',	'23615',	'Vaccinium stamineum',	'218.jpg',	'image/jpeg',	42556,	'2012-04-20 09:43:34',	233,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	176259,	1,	'FOOD00218'),
(219,	'Ginseng',	'Panax',	'Ginseng is any one of 11 species of slow-growing perennial plants with fleshy roots, belonging to the genus Panax of the family Araliaceae. Ginseng is found only in the Northern Hemisphere, in North America and in eastern Asia (mostly Korea, northeastern China, Bhutan, and eastern Siberia), typically in cooler climates. Panax vietnamensis, discovered in Vietnam, is the southernmost ginseng known. This article focuses on the series Panax ginsengs, which are the adaptogenic herbs, principally Panax ginseng and P. quinquefolius. Ginseng is characterized by the presence of ginsenosides. Siberian ginseng is in the same family, but not genus, as true ginseng. Like ginseng, it is considered to be an adaptogenic herb. The active compounds in Siberian ginseng are eleutherosides, not ginsenosides. Instead of a fleshy root, Siberian ginseng has a woody root.',	'29398',	'Ginseng',	'219.jpg',	'image/jpeg',	116987,	'2012-04-23 10:47:08',	234,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	2,	0,	'specific',	4054,	1,	'FOOD00219'),
(220,	'Cascade huckleberry',	'Vaccinium deliciosum',	'Vaccinium deliciosum is a species of bilberry known by the common names Cascade bilberry, Cascade blueberry, and blueleaf huckleberry. It is native to western North America from British Columbia to Idaho to northern California, where it grows at elevations of 600 to 2000 meters in subalpine and alpine climates. Its habitat includes coniferous forests and meadows. This is a rhizomatous shrub taking a clumpy, matted form, its tangling stem rooting where its nodes touch moist substrate. It may form expansive colonies. The new green twigs are hairless and waxy. The deciduous leaves are alternately arranged. The thin oval leaf blades are up to 5 centimeters long. The edges are mostly smooth but may be serrated near the ends. Solitary flowers occur in the leaf axils. Each is 6 or 7 millimeters long, widely urn-shaped to rounded, and pale pink in color. The fruit is a waxy blue or reddish berry which may be over a centimeter wide. It is said to be particularly tasty.',	'23591',	'Vaccinium deliciosum',	'220.jpg',	'image/jpeg',	113038,	'2012-04-20 09:28:59',	235,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:26',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	190531,	1,	'FOOD00220'),
(221,	'Oval-leaf huckleberry',	'Vaccinium ovalifolium',	'Vaccinium ovalifolium (commonly known as Alaska blueberry, early blueberry, oval-leaf bilberry, oval-leaf blueberry, and oval-leaf huckleberry) is a plant in the heath family having three varieties, all of which grow in northerly regions, including the subarctic.\nVaccinium ovalifolium is used by in jams and jellies and for making liqueur. Blueberry herbal tea can be made from the leaves, or from the juice of the blueberries themselves.',	'23607',	'Vaccinium_ovalifolium',	'221.jpg',	'image/jpeg',	42257,	'2012-04-20 09:30:32',	236,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	190544,	1,	'FOOD00221'),
(222,	'Evergreen huckleberry',	'Vaccinium ovatum',	'Vaccinium ovatum is a species of flowering shrub known by the common names Evergreen Huckleberry, Winter Huckleberry and California Huckleberry. During the summer the plant produces round, edible black berries up to a centimeter in diameter.',	'23608',	'Vaccinium ovatum',	'222.jpg',	'image/jpeg',	53633,	'2012-04-20 09:32:34',	237,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	84019,	1,	'FOOD00222'),
(223,	'Red huckleberry',	'Vaccinium parvifolium',	'Red Huckleberry (Vaccinium parvifolium) is a species of Vaccinium native to the western North America, where it is common in forests from southeastern Alaska and British Columbia south through western Washington and Oregon to central California. In the Oregon Coast Range, it is the most common Vaccinium. It occurs mostly at low to middle elevations in soil enriched by decaying wood and on rotten logs, from sea level up to 1,820-metre . The fruit is an edible red to orange berry 6-millimetre (0.24 in) to 10-millimetre (0.39 in) in diameter.',	'23612',	'Vaccinium parvifolium',	'223.jpg',	'image/jpeg',	34744,	'2012-04-20 09:33:56',	238,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	180766,	1,	'FOOD00223'),
(224,	'Longan',	'Dimocarpus longan',	'Dimocarpus longan, commonly known as the longan, is a tropical tree that produces edible fruit. It is one of the better-known tropical members of the soapberry family, to which the lychee also belongs. It is native to Southern Asia.\nThe fruit is sweet, juicy and succulent in superior agricultural varieties and, apart from being eaten fresh, is also often used in East Asian soups, snacks, desserts, and sweet-and-sour foods, either fresh or dried, sometimes canned with syrup. The taste is different from lychees; while longan have a drier sweetness, lychees are often messily juicy with a more tropical, sour sweetness.',	'506072',	'Longan',	'224.jpg',	'image/jpeg',	56536,	'2012-04-20 09:36:33',	239,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	128017,	1,	'FOOD00224'),
(225,	'Macadamia nut (M. tetraphylla)',	'Macadamia tetraphylla',	'Macadamia tetraphylla is a tree in the Proteaceae family, native to southern Queensland and northern New South Wales in Australia. Common names include Macadamia Nut, Bauple Nut, Prickly Macadamia, Queensland Nut, Rough-shelled Bush Nut and Rough-shelled Queensland Nut This species has dense foliage and grows up to 18 metres in height. The leaves, which have toothed margins, are 7 to 25 cm in length. It has long, pendent creamy pink to purple flowers, followed by woody, rounded fruits which are 2 to 3 cm in diameter and contain edible seeds. It has been introduced to Mexico and has done well in the States of Michoacán and Jalisco and has become an important export crop for the Mexican market. Hawaii is the largest exporter of this crop worldwide.',	'506560',	'Macadamia tetraphylla',	'225.jpg',	'image/jpeg',	54718,	'2012-04-20 09:30:48',	240,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	512563,	1,	'FOOD00225'),
(226,	'Garden onion (var.)',	'Allium cepa var. cepa',	NULL,	'182638',	NULL,	'226.jpg',	'image/jpeg',	138437,	'2012-04-23 10:45:33',	241,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	2,	0,	'specific',	4679,	1,	'FOOD00226'),
(227,	'Summer grape',	'Vitis aestivalis',	'Vitis aestivalis (Summer Grape) is a species of grape native to eastern North America from southern Ontario east to Vermont, west to Oklahoma, and south to Florida and Texas. It is a vigorous vine, growing to 10 m or more high in trees. The leaves are 7–20 cm long, suborbicular, and usually a little broader than long; they are variable in shape, from unlobed to deeply three- or five-lobed, green above, and densely hairy below. The flowers are produced in a dense panicle 5–15 cm long. The fruit is a small grape 5–14 mm diameter, dark purple or black in color. It is the official state grape of Missouri. There are four varieties: Vitis aestivalis var. aestivalis. Vitis aestivalis var. bicolor Deam (syn. var. argentifolia Fernald; Silverleaf Grape), formerly called Vitis bicolor, but now considered a northern variation of Vitis aestivalis. Native range is in the Northeastern United States and parts of Southern Ontario. Vitis aestivalis var. lincecumii (Buckley) Munson. Vitis aestivalis var. bourquiniana, native to the south, sometimes called Vitis bourquiniana, has tomentose undersides to the leaves.',	'28607',	'Vitis aestivalis',	'227.jpg',	'image/jpeg',	146695,	'2012-04-20 09:31:55',	242,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	3605,	1,	'FOOD00227'),
(228,	'Fox grape',	'Vitis labrusca',	'Vitis labrusca (fox grape) is a species of grapevines belonging to the Vitis genus in the flowering plant family Vitaceae. The vines are native to eastern North America and are the source of many grape cultivars, including Catawba and Concord grapes, and many hybrid grape varieties such as Agawam, Alexander and Onaka. Among the characteristics of this vine species in contrast to the European wine grape Vitis vinifera are its \"slip-skin\" that allows the skin of the grape berries to easily slip off when squeezed, instead of crushing the pulp, and the presence of tendrils on every node of the cane. Another contrast with European vinifera is the characteristic \"foxy\" musk of V. labrusca, best known to most people through the Concord grape. This musk is not related to the mammalian fox, but rather to the earthy, redolent aromas characteristic of the grapes that were known by early American settlers in the New World. The term \"foxy\" became a sort of catchall for the wine tasting descriptors used for these American wines that were distinct from the familiar flavors of the European viniferous wines.',	'28608',	'Vitis_labrusca',	'228.jpg',	'image/jpeg',	71839,	'2012-04-20 09:36:54',	243,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:19',	NULL,	NULL,	0,	'specific',	103355,	1,	'FOOD00228'),
(229,	'Nectarine',	'Prunus persica var. nucipersica',	'The variety P. persica var. nucipersica (or var. nectarina), commonly called nectarine, has a smooth skin. It is on occasion referred to as a \"shaved peach\", \"fuzzy-less peach\", \"juicy peach\", or \"Brazilian peach\" due to its lack of fuzz or short hairs. Though fuzzy peaches and nectarines are regarded commercially as different fruits, with nectarines often erroneously believed to be a crossbreed between peaches and plums, or a \"peach with a plum skin\", nectarines belong to the same species as peaches. Several genetic studies have concluded nectarines are produced due to a recessive allele, whereas a fuzzy peach skin is dominant. Nectarines have arisen many times from peach trees, often as bud sports.\nAs with peaches, nectarines can be white or yellow, and clingstone or freestone. On average, nectarines are slightly smaller and sweeter than peaches, but with much overlap. The lack of skin fuzz can make nectarine skins appear more reddish than those of peaches, contributing to the fruit\'s plum-like appearance. The lack of down on nectarines\' skin also means their skin is more easily bruised than peaches.',	'530965',	'Nectarine#Nectarines',	'229.jpg',	'image/jpeg',	36256,	'2012-04-20 09:43:12',	244,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	323851,	1,	'FOOD00229'),
(230,	'Peach (var.)',	'Prunus persica var. persica',	NULL,	'530964',	NULL,	'230.jpg',	'image/jpeg',	85867,	'2012-04-20 09:38:59',	245,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	323852,	1,	'FOOD00230'),
(231,	'Pepper (C. baccatum)',	'Capsicum baccatum var. baccatum',	'Capsicum baccatum is a species of chili pepper. Like C. annuum, C. baccatum has many different varieties, e.g. \"Peppadew\":http://en.wikipedia.org/wiki/Peppadew. [Wikipedia]\r\n\r\nSee a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'530932',	'Capsicum_baccatum',	'231.jpg',	'image/jpeg',	45535,	'2012-04-20 09:36:28',	246,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	2,	0,	'specific',	165788,	1,	'FOOD00231'),
(232,	'Pepper (C. chinense)',	'Capsicum chinense',	'Capsicum chinense,  is a species of chili pepper native to the Americas. C. chinense varieties are well known for their exceptional heat and unique flavors. C. chinense is native to Central America, the Yucatan region, and the Caribbean islands. Despite its name, C. chinense or \"Chinese capsicum\" is misleading. All Capsicum species originated in the New World. Nikolaus Joseph von Jacquin (1727–1817), a Dutch botanist, erroneously named the species in 1776, because he believed they originated in China due to their prevalence in Chinese cuisine after their introduction by European explorers. C. chinense and its varieties have been used for millennia in Yucatan and Caribbean-style cooking to add a significant amount of heat to their traditional food. They are mainly used in stews and sauces, as well as marinades for meats and chicken. [Wikipedia]',	'30494',	'Capsicum_chinense',	'232.jpg',	'image/jpeg',	72726,	'2012-04-20 09:36:08',	247,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	2,	0,	'specific',	80379,	1,	'FOOD00232'),
(233,	'Pepper (Capsicum)',	'Capsicum',	'Capsicum is a genus of flowering plants in the nightshade family, Solanaceae. Its species are native to the Americas where they have been cultivated for thousands of years, but they are now also cultivated worldwide, used as spices, vegetables, and medicines, and have become a key element in many regional cuisines. Capsicum consists of approximately 20–27 species, five of which are domesticated: C. annuum (the most common and extensively cultivated, includes chillies and bell peppers), C. chinense (e.g. Habanero), C. frutescens (e.g. Tabasco), C. baccatum (e.g. Peppadew), and C. pubescens (e.g. Rocoto). [Wikipedia]\r\n\r\nSee a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30491',	'Capsicum',	'233.jpg',	'image/jpeg',	66610,	'2012-04-20 09:35:42',	248,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	2,	0,	'specific',	4071,	1,	'FOOD00233'),
(234,	'Rambutan',	'Nephelium lappaceum',	'The rambutan (taxonomic name: Nephelium lappaceum) is a medium-sized tropical tree in the family Sapindaceae. The fruit produced by the tree is also known as rambutan.\nAccording to popular belief and the origin of its name, rambutan is native to Indonesia and Malaysia. The earliest record of rambutan trees show that they were cultivated by the Malayan jungle tribes around their temporary settlements, a practice followed to date. Rambutan trees grow naturally in Thailand, Vietnam, the Philippines, and elsewhere in Southeast Asia, although its precise natural distribution is unknown. It is closely related to several other edible tropical fruits including the lychee, longan, and mamoncillo. It is native to the Indonesian Archipelago, from where it spread westwards to Thailand, Burma, Sri Lanka and India; northwards to Vietnam, and the Philippines.\nThe fruit is a round to oval single seeded berry, 3?6 cm (rarely to 8 cm) tall and 3?4 cm broad, borne in a loose pendant cluster of 10?20 together. The leathery skin is reddish (rarely orange or yellow), and covered with fleshy pliable spines, hence the name rambutan, derived from the Malay word rambut, which means hairs. The fruit flesh, which is actually the aril, is translucent, whitish or very pale pink, with a sweet, mildly acidic flavor very reminiscent of grapes.',	'506073',	'Rambutan',	'234.jpg',	'image/jpeg',	71055,	'2012-04-20 09:43:04',	249,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:27',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	151071,	1,	'FOOD00234'),
(235,	'Red rice',	'Oryza rufipogon',	'Oryza rufipogon, known as brownbeard rice,[citation needed] wild rice and red rice, is a member of the genus Oryza. It has a close evolutionary relation to Oryza sativa, the rice grown as a major food crop throughout the world. O. rufipogon is listed as a \"noxious weed\" by the United States, and is listed as a noxious weed in Alabama, California, Florida, Massachusetts, Minnesota, North Carolina, Oregon, South Carolina, and Vermont. According to the North American Plant Protection Association, O. rufipogon blends in with cultivated O. sativa so well that it cannot be detected. In this position it competes with the cultivated rice and uses valuable fertilizer and space. O. rufipogon sheds most of its seeds before the harvest, therefore contributing little to the overall yield. In addition, the rice grains produced by the plant are not eaten by consumers, who see it as a strange foreign particle in otherwise white rice.',	'504068',	'Oryza_rufipogon',	'235.jpg',	'image/jpeg',	69384,	'2012-04-20 09:32:16',	250,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	4529,	1,	'FOOD00235'),
(236,	'Annual wild rice',	'Zizania aquatica',	'Wild rice (also called Canada rice, Indian rice, and water oats) are four species of grasses forming the genus Zizania, and the grain which can be harvested from them. The grain was historically gathered and eaten in both North America and China. While it is now a delicacy in North America, the grain is eaten less in China, where the plant\'s stem is used as a vegetable.\nWild rice is not directly related to Asian rice (Oryza sativa), whose wild progenitors are O. rufipogon and O. nivara, although they are close cousins, sharing the tribe Oryzeae. Wild rice grains have a chewy outer sheath with a tender inner grain that has a slightly vegetal taste.\nThe plants grow in shallow water in small lakes and slow-flowing streams; often, only the flowering head of wild rice rises above the water. The grain is eaten by dabbling ducks and other aquatic wildlife, as well as humans.',	'41319',	'Zizania_aquatica',	'236.jpg',	'image/jpeg',	43006,	'2012-04-20 09:32:37',	251,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	75727,	1,	'FOOD00236'),
(237,	'Swiss chard',	'Beta vulgaris ssp. cicla',	'Chard (Beta vulgaris subsp. cicla), is a leafy green vegetable often used in Mediterranean cooking. The leaves can be green or reddish in color like Bibb Lettuce; chard stalks also vary in color. Chard has been bred to have highly nutritious leaves and is considered to be one of the most healthful vegetables available, making it a popular addition to healthful diets (like other green leafy vegetables). Chard has been around for centuries, but because of its similarity to beets it is difficult to determine the exact evolution of the different varieties of chard.',	'524868',	'Swiss_chard',	'237.jpg',	'image/jpeg',	3951472,	'2012-04-20 09:32:07',	252,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	1,	'specific',	1527200,	1,	'FOOD00237'),
(238,	'Lemon thyme',	'Thymus pulegioides',	'Thymus pulegioides (common names broad-leaved thyme, lemon thyme) is a species of flowering plant in the family Lamiaceae, native to Europe. Growing to 5-25 cm (2-10 in) tall by 25 cm (10 in) wide, it is a small spreading subshrub with strongly aromatic leaves, and lilac pink flowers in early summer. The specific epithet pulegioides highlights its similarity to another species within Lamiaceae, Mentha pulegium (pennyroyal).',	'505500',	'Thymus_pulegioides',	'238.jpg',	'image/jpeg',	144057,	'2012-04-20 09:38:19',	253,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	751873,	1,	'FOOD00238'),
(239,	'Tronchuda cabbage',	'Brassica oleracea var. costata',	NULL,	'530958',	NULL,	'239.jpg',	'image/jpeg',	166108,	'2012-04-20 09:41:20',	254,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	416546,	1,	'FOOD00239'),
(240,	'Japanese walnut',	'Juglans ailanthifolia',	'Juglans ailantifolia (synonyms J. cordiformis and J. sieboldiana and J. mandshurica var. sachalinensis), the Japanese Walnut (is a species of walnut native to Japan and Sakhalin. It is a deciduous tree growing to 20 m tall, rarely 30 m, and 40–80 cm stem diameter, with light grey bark. The leaves are pinnate, 50–90 cm long, with 11-17 leaflets, each leaflet 7–16 cm long and 3–5 cm broad. The whole leaf is downy-pubescent, and a somewhat brighter, yellower green than many other tree leaves. The male flowers are inconspicuous yellow-green catkins produced in spring at the same time as the new leaves appear. The female flowers have pink/ red pistils. The fruit is a nut, produced in bunches of 4-10 together; the nut is spherical, 3–5 cm long and broad, surrounded by a green husk before maturity in mid autumn.',	'503241',	'Juglans ailantifolia',	'240.jpg',	'image/jpeg',	6598,	'2012-04-20 09:33:33',	255,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	91209,	1,	'FOOD00240'),
(241,	'Welsh onion',	'Allium fistulosum',	'Allium fistulosum L. (Welsh onion, Japanese bunching onion) is a perennial onion. Other names that may be applied to this plant include green onion, spring onion, scallion, escallion, and salad onion. These names are ambiguous, as they may also be used to refer to any young green onion stalk, whether grown from Welsh onions, common onions, or other similar members of the genus Allium (see scallion). The species is very similar in taste and odor to the related common onion, Allium cepa, and hybrids between the two (tree onions) exist. The Welsh onion, however, does not develop bulbs, and possesses hollow leaves (\"fistulosum\" means \"hollow\") and scapes. Large varieties of the Welsh onion resemble the leek, such as the Japanese \'negi\', whilst smaller varieties resemble chives. Many Welsh onions can multiply by forming perennial evergreen clumps. Next to culinary use, it is also grown in a bunch as an ornamental plant.',	'185463',	'Welsh_onion',	'241.jpg',	'image/jpeg',	15355,	'2012-04-20 09:33:35',	256,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	35875,	1,	'FOOD00241'),
(242,	'Hard wheat',	'Triticum durum',	'Durum wheat or macaroni wheat (Triticum durum or Triticum turgidum subsp. durum) is the only tetraploid species of wheat of commercial importance that is widely cultivated today. It was developed by artificial selection of the domesticated emmer wheat (like emmer, durum wheat is awned) strains formerly grown in Central Europe and the Near East around 7000 BC, which developed a naked, free-threshing form. Durum in Latin means \"hard\", and the species is the hardest of all wheats. Its high protein content, as well as its strength, make durum good for special uses, the most well-known being pasta, which in Italy is exclusively made from durum wheat. Durum wheat is used extensively in breadmaking. However, it is unusual in that, despite very high protein content, it is low in desirable gluten needed to form a glutinous web necessary for bread to rise. As a result, although 100 percent durum wheat breads do exist, such as pagnotte di Enna or \"rimacinato\" bread from Sicily, as well as others, in most instances bread doughs contain only a portion of durum wheat and are supplemented substantially with commercial white flours, often those higher in gluten necessary to offset the poor gluten contribution of durum flour. When durum flour is used as the sole flour in bread, substantial additions of isolated wheat gluten are necessary to effect rising. Without it, 100 percent durum wheat breads are often heavy, with very close grain, and will split easily when risen for baking.',	'42240',	'Hard_wheat',	'242.jpg',	'image/jpeg',	49577,	'2012-04-20 09:40:44',	257,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	4567,	1,	'FOOD00242'),
(243,	'Shallot',	'Allium ascalonicum',	'The shallot (Allium cepa var. aggregatum, or the Aggregatum group A. cepa) is a botanical variety of the species Allium cepa, to which the multiplier onion also belongs. The shallot was formerly classified as a separate species, A. ascalonicum, a name now considered a synonym of the currently accepted name. The genus Allium, which includes onions and garlic as well as shallots, is now classified in the plant family Amaryllidaceae, but was formerly considered to belong to the separate family Alliaceae.',	'506481',	'Shallot',	'243.jpg',	'image/jpeg',	341911,	'2012-04-20 09:36:06',	258,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	1476995,	1,	'FOOD00243'),
(244,	'Rocket salad',	'Eruca vesicaria',	'Eruca sativa (syn. E. vesicaria subsp. sativa (Miller) Thell., Brassica eruca L.) is an edible annual plant, commonly known as salad rocket, roquette, rucola, rugula, colewort, and, in the United States, arugula. It is sometimes conflated with Diplotaxis tenuifolia, the perennial wall rocket, another plant of the Brassicaceae family, which in the past was used in the same manner. Eruca sativa, which is widely popular as a salad vegetable, is a species of Eruca native to the Mediterranean region, from Morocco and Portugal in the west to Syria, Lebanon and Turkey in the east. The Latin adjective sativa in the plant\'s binomial is derived from satum, the supine of the verb sero, meaning \"to sow\", indicating that the seeds of the plant were sown in gardens. Eruca sativa differs from E. vesicaria in having early deciduous sepals. Some botanists consider it a subspecies of Eruca vesicaria: E. vesicaria subsp. sativa. Still others do not differentiate between the two.\nEruca sativa grows 20?100 centimetres (8?39 in) in height. The leaves are deeply pinnately lobed with four to ten small lateral lobes and a large terminal lobe. The flowers are 2?4 cm (0.8?1.6 in) in diameter, arranged in a corymb in typical Brassicaceae fashion; with creamy white petals veined with purple, and with yellow stamens; the sepals are shed soon after the flower opens. The fruit is a siliqua (pod) 12?35 millimetres (0.5?1.4 in) long with an apical beak, and containing several seeds (which are edible). ',	'502429',	'Rocket_(salad)',	'244.jpg',	'image/jpeg',	70936,	'2012-04-20 09:38:53',	259,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:28',	'2019-12-11 19:32:30',	NULL,	NULL,	0,	'specific',	180536,	0,	'FOOD00244'),
(245,	'Carrot',	'Daucus carota ssp. sativus',	'The carrot (<i>Daucus carota</i> subsp. <i>sativus</i>; is a root vegetable, usually orange in colour, though purple, red, white, and yellow varieties exist. It has a crisp texture when fresh. The most commonly eaten part of a carrot is a taproot, although the greens are sometimes eaten as well. It is a domesticated form of the wild carrot Daucus carota, native to Europe and southwestern Asia. The domestic carrot has been selectively bred for its greatly enlarged and more palatable, less woody-textured edible taproot. The Food and Agriculture Organization of the United Nations (FAO) reports that world production of carrots and turnips (these plants are combined by the FAO for reporting purposes) for calendar year 2011 was almost 35.658 million tonnes. Almost half were grown in China. Carrots are widely used in many cuisines, especially in the preparation of salads, and carrot salads are a tradition in many regional cuisines. (Wikipedia)',	'524846',	'Carrot',	'245.jpg',	'image/jpeg',	15097,	'2012-04-20 09:37:51',	260,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	1,	'specific',	79200,	1,	'FOOD00245'),
(246,	'Triticale',	'X Triticosecale rimpaui',	'Triticale (× Triticosecale), is a hybrid of wheat (Triticum) and rye (Secale) first bred in laboratories during the late 19th century. The grain was originally bred in Scotland and Sweden. Commercially available triticale is almost always a second generation hybrid, i.e. , a cross between two kinds of primary (first cross) triticales. As a rule, triticale combines the yield potential and grain quality of wheat with the disease and environmental tolerance (including soil conditions) of rye. Only recently has it been developed into a commercially viable crop. Depending on the cultivar, triticale can more or less resemble either of its parents. It is grown mostly for forage or fodder, although some triticale-based foods can be purchased at health food stores or are to be found in some breakfast cereals. When crossing wheat and rye, wheat is used as the female parent and rye as the male parent (pollen donor). The resulting hybrid is sterile, and must be treated with colchicine to induce polyploidy and thus the ability to reproduce itself. The primary producers of triticale are Poland, Germany, France, Belarus and Australia. In 2009, according to the Food and Agriculture Organization (FAO), 15.0 million tons were harvested in 29 countries across the world. The triticale hybrids are all amphidiploid, which means the plant is diploid for two genomes derived from different species. In other words, triticale is an allotetraploid. In earlier years, most work was done on octoploid triticale. Different ploidy levels have been created and evaluated over time. The tetraploids showed little promise, but hexaploid triticale was successful enough to find commercial application. The CIMMYT triticale improvement program wanted to improve food production and nutrition in developing countries. Triticale has potential in the production of bread and other food products, such as cookies, pasta, pizza dough and breakfast cereals. The protein content is higher than that of wheat, although the glutenin fraction is less. The grain has also been stated to have higher levels of lysine than wheat. Assuming increased acceptance, the milling industry will have to adapt to triticale, as the milling techniques employed for wheat are unsuited to triticale. Sell et al. found triticale could be used as a feed grain, and later research found its starch was particularly readily digested. As a feed grain, triticale is already well established and of high economic importance. It has received attention as a potential energy crop, and research is currently being conducted on the use of the crop\'s biomass in bioethanol production.',	'506625',	'Triticale',	'246.jpg',	'image/jpeg',	153276,	'2012-04-20 09:43:10',	261,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00246'),
(247,	'Black cabbage',	'Brassica oleracea var. viridis',	'The acephala group refers to any type of <i>Brassica</i> which grows without the central \'head\' typical of many varieties of cabbage. These are included within the species <i>Brassica oleracea</i>, such as Kale (<i>Brassica oleracea</i> var. acephala). The name literally means \"without a head\" in contrast to those varieties known as <i>capitata</i> or \"with a head\". This group includes a number of species, both wild and cultivated, many of which are grown for their edible leafs and flowers. (Wikipedia)',	'',	'',	'247.jpg',	'image/jpeg',	91615,	'2012-04-20 09:38:53',	263,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	3713,	1,	'FOOD00247'),
(248,	'Half-highbush blueberry',	'Vaccinium angustifolium X Vaccinium corymbosum',	'\"Nutrition information studies suggest that wild blueberries help keep us healthy and may even thwart the effects of aging, particularly with respect to loss of memory and motor skills. The possible health benefits of blueberries may be related to the antioxidant capacity of the blue pigments (anthocyanins), as well as other natural compounds. Blueberries have more antioxidant capacity than 40 other fruits and vegetables tested. There is evidence that the blue in the berries may have cancer-fighting properties and protect against heart disease. Blueberries contain a number of phytochemicals that may make a positive contribution to human health. These include: antioxidants, anthocyanins, bacterial inhibitors, folic acid, vitamins A and C, carotenoids, ellagic acid, and dietary fibers. Their caloric value is low and they contain no fat.\r\n\r\nThe wild lowbush blueberry (<i>Vaccinium angustifolium</i> Ait.) is an important successional species of cleared woodland and abandoned farmland of northeastern North America where commercial, managed blueberry fields have been developed. Lowbush blueberries are a widely-grown fruit crop in the USA and Canada. These berries are noted for their small size and sweet taste.\r\n\r\nThe cultivated highbush blueberry (<i>V. corymbosum</i> L.) is a multiseed berry, with small, soft seeds. The dark blue berries are three times larger than lowbush blueberry. Highbush blueberries are cultivated mainly in USA, Canada, Australia, Argentine, Chile, New Zealand, the Netherlands, Poland, Japan, Spain and France.\r\n\r\nIn North European countries such as Norway, Sweden, Finland and Estonia, the cultivation of blueberries is being considered. The climate conditions of North Europe are suitable for the lowbush and half-highbush (<i>Vaccinium corymbosum</i> L. x <i>Vaccinium angustifolium</i> Ait.) blueberry cultivation. Bilberry (<i>V. myrtillus</i> L.) is widespread in Estonian nature and historical traditions use the fresh berries, plant leaves and dried berries as a herbal plant.\" (Starast M, Karp K, Vool E, Moor U, Tonutare T, Paal T. Chemical Composition and Quality of Cultivated and Natural Blueberry Fruit in Estonia. <i>Vegetable crops research bulletin</i>. 2007 Sep 7;66(1):143–53)',	'',	'',	'248.jpg',	'image/jpeg',	63400,	'2012-04-20 09:39:04',	264,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	934696,	1,	'FOOD00248'),
(249,	'Celery leaves',	'Apium graveolens var. secalinum',	'Chinese celery (Apium graveolens var. secalinum), is a variety of celery cultivated in East Asian countries for its edible, flavorful stalks and leaves. The stems are thinner than those of regular celery, and curved into round, hollow stalks. Also, unlike with regular celery, the leaves are used as much as the stalks.',	NULL,	'Apium_graveolens_var._secalinum',	'249.jpg',	'image/jpeg',	182470,	'2012-04-20 09:42:20',	266,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	941588,	1,	'FOOD00249'),
(250,	'Chicory leaves',	'Cichorium intybus var. foliosum',	NULL,	'781014',	NULL,	'250.jpg',	'image/jpeg',	70884,	'2012-04-20 09:43:05',	267,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	13427,	1,	'FOOD00250'),
(251,	'Komatsuna',	'Brassica rapa var. perviridis',	'Komatsuna (Brassica rapa var. perviridis or komatsuna) is a type of leaf vegetable. It is a variant of the same species as the common turnip. It is grown commercially in Japan, and Taiwan; the name is from Japanese komatsuna, \'small pine tree greens\'. It is also known as Japanese Mustard Spinach and is usually stir-fried, pickled, boiled and added to soups or used fresh in salads. It is an excellent source of calcium. It is also used for fodder in some Asian countries. The leaves of komatsuna may be eaten at any stage of their growth. In a mature plant they are dark green with slender light green stalks, around 30 cm long and 18 cm wide. It is most often grown in the spring and autumn, as it cannot endure extreme heat or cold for more than a short time.',	'532656',	'Komatsuna',	'251.jpg',	'image/jpeg',	53375,	'2012-04-20 09:37:06',	268,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	344680,	1,	'FOOD00251'),
(252,	'Pak choy',	'Brassica rapa var. chinensis',	'Chinese cabbage (Brassica rapa, subspecies pekinensis and chinensis) can refer to two distinct varieties of Chinese leaf vegetables often used in Chinese cuisine: Pekinensis (napa cabbage) and Chinensis (bok choi).\nThese vegetables are both variant cultivars or subspecies of the turnip and belong to the same genus as such Western staples as cabbage, broccoli, and cauliflower. Both have many variations in name, spelling, and scientific classification?especially the bok choy (B. rapa chinensis) variety.',	NULL,	'Pak_choy',	'252.jpg',	'image/jpeg',	77361,	'2012-04-20 09:28:58',	269,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	93385,	1,	'FOOD00252'),
(253,	'Napa cabbage',	'Brassica rapa var. pekinensis',	'Napa or Nappa cabbage (Brassica rapa subsp. pekinensis), also known as celery cabbage, is a type of Chinese cabbage originating near the Beijing region of China, and is widely used in East Asian cuisine. In much of the world, this is the vegetable referred to as \"Chinese cabbage\". Nappa cabbage is lighter in color than other Chinese cabbages such as bok choy, which is also sometimes called Chinese cabbage. In the United Kingdom, this vegetable is known as \"Chinese Leaf\", in New Zealand, as \"Wong Bok\" or \"Won bok\", and in Australia and the Philippines as \"wombok\".\nIn Korean cuisine, it is the main ingredient of baechu kimchi, the most common type of kimchi, but is also eaten raw as a wrap for pork or oysters, dipped in gochujang. The outer, tougher leaves are used in soups. The flavor has been described by some as delicate compared to bok choy or cabbage, and it can be used in stir-fry with other ingredients such as tofu, mushroom or zucchini. It is also a very common ingredient that is eaten with hot pot.',	NULL,	'Napa_cabbage',	'253.jpg',	'image/jpeg',	71346,	'2012-04-20 09:37:51',	270,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:28',	'2019-05-14 18:04:20',	NULL,	NULL,	0,	'specific',	51351,	1,	'FOOD00253'),
(254,	'Chicory roots',	'Cichorium intybus var. sativum',	'Root chicory (Cichorium intybus var. sativum) has been cultivated in Europe as a coffee substitute. The roots are baked, ground, and used as a coffee substitute and additive, especially in the Mediterranean region (where the plant is native). As a coffee additive, it is also mixed in Indian filter coffee, and in parts of Southeast Asia, South Africa and southern United States, particularly in New Orleans. It has been more widely used during economic crises such as the Great Depression in the 1930s and during World War II in Continental Europe. Chicory, with sugar beet and rye, was used as an ingredient of the East German Mischkaffee (mixed coffee), introduced during the \"East German coffee crisis\" of 1976-79.',	'781020',	'Chicory',	'254.jpg',	'image/jpeg',	68491,	'2012-04-20 09:30:08',	271,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	13427,	1,	'FOOD00254'),
(255,	'Grapefruit/Pummelo hybrid',	'Citrus paradisi X Citrus maxima',	NULL,	NULL,	NULL,	'255.jpg',	'image/jpeg',	91059,	'2012-04-20 09:39:43',	272,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	37656,	1,	'FOOD00255'),
(256,	'Grapefruit',	'Citrus X paradisi',	'The grapefruit (Citrus × paradisi) is a subtropical citrus tree known for its sour to semi-sweet fruit, an 18th-century hybrid first bred in Barbados. When found, it was named the \"forbidden fruit\"; and it has also been misidentified with the pomelo or shaddock (C. maxima), one of the parents of this hybrid, the other being sweet orange (C. × sinensis).\nThe evergreen grapefruit trees usually grow to around 5?6 meters (16?20 ft) tall, although they can reach 13?15 m (43?49 ft). The leaves are glossy dark green, long (up to 15 centimeters (5.9 in)) and thin. It produces 5 cm (2 in) white four-petaled flowers. The fruit is yellow-orange skinned and generally an oblate spheroid in shape; it ranges in diameter from 10?15 cm (3.9?5.9 in). The flesh is segmented and acidic, varying in color depending on the cultivars, which include white, pink and red pulps of varying sweetness (generally, the redder varieties are sweeter). The 1929 US Ruby Red (of the Redblush variety) has the first grapefruit patent.',	'28887',	'Grapefruit',	'256.jpg',	'image/jpeg',	66553,	'2012-04-20 09:37:45',	273,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	37656,	1,	'FOOD00256'),
(257,	'Jostaberry',	'Ribes × nidigrolaria',	'The jostaberry is a complex-cross fruit bush in the Ribes genus, involving three original species, the black currant R. nigrum, the North American coastal black gooseberry R. divaricatum, and the European gooseberry R. uva-crispa. It is similar to Ribes × culverwellii, the Jochelbeere, which is descended from just two of these species, R. nigrum and R. uva-crispa.\nThe nearly black berry, which is smaller than a gooseberry and a bit larger than a blackcurrant, is edible both raw and cooked. It is described as having a taste intermediate between a gooseberry and a blackcurrant, with the gooseberry flavor more dominant in the unripe fruit, and the blackcurrant notes developing as the fruit ripens. The ripe fruit will hang on the bush in good condition through late summer, but is very popular with birds. The somewhat unripe fruit can be used in cooking recipes as a gooseberry. Like blackcurrants the fruit freezes well, and like many other members of the Ribes genus it is rich in Vitamin C.',	NULL,	'Jostaberry',	'257.jpg',	'image/jpeg',	71257,	'2012-04-20 09:42:31',	275,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00257'),
(258,	'Kai-lan',	'Brassica oleracea var. alboglabra',	'Kai-lan (also written as gai-lan) is the Cantonese name for a vegetable that is also known as Chinese broccoli. It is a leaf vegetable featuring thick, flat, glossy blue-green leaves with thick stems and a small number of tiny, almost vestigial flower heads similar to those of broccoli. Broccoli and kai-lan belong to the same species Brassica oleracea, but kai-lan is in the group alboglabra [Latin albus+glabrus white and hairless]. Its flavor is very similar to that of broccoli, but slightly more bitter. It is also noticeably stronger. Broccolini is a hybrid between broccoli and kai-lan, produced by Mann Packing Company, Inc. Kai-lan is eaten widely in Chinese cuisine, and especially in Cantonese cuisine. Common preparations include kai-lan stir-fried with ginger and garlic, and boiled or steamed and served with oyster sauce. It is also common in Vietnamese cuisine, Myanmar and Thai cuisine. Kai-lan can be sown in late summer for early-winter harvesting. Seedlings planted in autumn will last all winter.',	'532650',	'Kai-lan',	'258.jpg',	'image/jpeg',	76467,	'2012-04-20 09:43:43',	276,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	3714,	1,	'FOOD00258'),
(259,	'Italian oregano',	'Origanum X majoricum',	'Italian oregano (<i>Origanum</i> X <i>Majoricum</i>) is a dark green bushy perennial that blooms pink to lavender. It is an aromatic herb used for flavouring.',	'',	'',	'259.jpg',	'image/jpeg',	93619,	'2012-04-20 09:38:14',	278,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	1384207,	1,	'FOOD00259'),
(260,	'Oxheart cabbage',	'Brassica oleracea var. conica',	NULL,	NULL,	NULL,	'260.jpg',	'image/jpeg',	12924,	'2012-04-20 09:37:12',	280,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00260'),
(261,	'Daikon radish',	'Raphanus sativus var. longipinnatus',	'Daikon, mooli, or white radish is a mild-flavoured, very large, white East Asian radish with a wide variety of culinary uses. Despite often being associated in Japan, it was originally cultivated in continental Asia.',	NULL,	'Daikon',	'261.jpg',	'image/jpeg',	22915,	'2012-04-20 09:44:04',	281,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	41679,	1,	'FOOD00261'),
(262,	'Black radish',	'Raphanus sativus var. niger',	'\'Black Spanish\' or \'Black Spanish Round\' occur in both round and elongated forms, and are sometimes simply called the black radish (Raphanus sativus <i>L. var. niger (M.) S.K.</i> or <i>L. ssp. niger (M.). D.C. var. albus D.C.</i>) or known by the French name <i>Gros Noir d\'Hiver</i>. It dates in Europe to 1548, and was a common garden variety in England and France during the early 19th century. It has a rough, black skin with hot-flavored, white flesh, is round or irregularly pear shaped, and grows to around 10 cm (4 in) in diameter. (Wikipedia)',	'',	'',	'262.jpg',	'image/jpeg',	101369,	'2012-04-20 09:37:53',	282,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	41679,	1,	'FOOD00262'),
(263,	'Radish (var.)',	'Raphanus sativus var. sativus',	'The radish (<i>Raphanus raphanistrum</i> subsp. <i>sativus</i>) is an edible root vegetable of the Brassicaceae family that was domesticated in Europe in pre-Roman times. Radishes are grown and consumed throughout the world, being mostly eaten raw as a crunchy salad vegetable. They have numerous varieties, varying in size, flavor, color, and length of time they take to mature. Radishes owe their sharp flavor to the various chemical compounds produced by the plants, including glucosinolate, myrosinase, and isothiocyanate. They are sometimes grown as companion plants and suffer from few pests and diseases. They germinate quickly and grow rapidly, smaller varieties being ready for consumption within a month, while larger daikon varieties take several months. Another use of radish is as cover or catch crop in winter or as a forage crop. Some radishes are grown for their seeds; daikon, for instance, may be grown for oil production. Others are used for sprouting.',	'',	'',	'263.jpg',	'image/jpeg',	175513,	'2012-04-20 09:30:53',	283,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	240228,	1,	'FOOD00263'),
(264,	'Red beetroot',	'Beta vulgaris var. rubra',	'The beetroot is the taproot portion of the beet plant, also known in North America as the table beet, garden beet, red or golden beet, or informally simply as the beet. It is several of the cultivated varieties of beet (<i>Beta vulgaris</i>) grown for their edible taproots and their greens. These varieties have been classified as <i>B. vulgaris</i> subsp. <i>vulgaris</i> Conditiva Group. Other than as a food, its uses include food coloring and as a medicinal plant. Many beet products are made from other <i>Beta vulgaris</i> varieties, particularly sugar beet. (Wikipedia)',	'',	'Beetroot',	'264.jpg',	'image/jpeg',	39556,	'2012-04-20 09:30:15',	284,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00264'),
(265,	'Sweet rowanberry',	'Grataegosorbus mitschurinii',	NULL,	NULL,	NULL,	'265.jpg',	'image/jpeg',	247840,	'2012-04-20 09:41:46',	285,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00265'),
(266,	'Pineappple sage',	'Salvia elegans',	'Salvia elegans, commonly called Pineapple sage or Tangerine Sage, is a perennial shrub native to Mexico and Guatemala. It inhabits Madrean and Mesoamerican pine-oak forests between 6,000 and 9,000 ft (1,800 and 2,700 m).\nS. elegans has tubular red flowers and an attractive scent to the leaves that is similar to pineapple. The leaves and flowers of S. elegans are edible. The plant is extensively used in Mexican traditional medicine, especially for the treatment of anxiety, and also for lowering of blood pressure. Although scientific information about these medicinal properties is scarce, a preliminary study on mice found support for the plant potentially having antidepressant and antianxiety properties. Pineapple sage has also been shown to have a dose-dependent antihypertensive effect, attributed to its action as an angiotensin II receptor antagonist and inhibitor of the angiotensin converting enzyme.',	'832880',	'Salvia_elegans',	'266.jpg',	'image/jpeg',	80063,	'2012-04-20 09:43:25',	286,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	888065,	1,	'FOOD00266'),
(267,	'Skunk currant',	'Ribes glandulosum',	'Ribes glandulosum (skunk currant) is a species of flowering plant in the family Grossulariaceae, native to northern North America. It is a deciduous shrub growing to 0.5 m tall and wide, with palmate leaves and small, spherical white fruits in summer.',	'24466',	'Ribes glandulosum',	'267.jpg',	'image/jpeg',	61729,	'2012-04-20 09:30:12',	287,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	175226,	1,	'FOOD00267'),
(268,	'Beer',	NULL,	'Beer is an alcoholic beverage produced by the saccharification of starch and fermentation of the resulting sugar. The starch and saccharification enzymes are often derived from malted cereal grains, most commonly malted barley and malted wheat. Most beer is also flavoured with hops, which add bitterness and act as a natural preservative, though other flavourings such as herbs or fruit may occasionally be included. The preparation of beer is called brewing.',	NULL,	'Beer',	'268.jpg',	'image/jpeg',	2746,	'2012-04-20 09:44:23',	289,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00268'),
(269,	'Other bread',	NULL,	'Bread is the staple food in Europe, European-derived cultures such as the Americas, and the Middle East and North Africa, as opposed to East Asia whose staple is rice. Bread is usually made from a wheat-flour dough that is cultured with yeast, allowed to rise, and finally baked in an oven. Owing to its high levels of gluten (which give the dough sponginess and elasticity), common wheat (also known as bread wheat) is the most common grain used for the preparation of bread, but bread is also made from the flour of other wheat species (including durum, spelt and emmer), rye, barley, maize (corn), and oats, usually, but not always, in combination with wheat flour. [Wikipedia]',	NULL,	'Bread',	'269.jpg',	'image/jpeg',	154670,	'2012-04-20 09:39:34',	290,	'Cereals and cereal products',	'Other breads',	'Type 2',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00269'),
(270,	'Breakfast cereal',	NULL,	'A breakfast cereal (or just cereal) is a food made from processed grains that is often eaten with the first meal of the day. It is often eaten cold, usually mixed with milk, juice, water, or yogurt, and sometimes fruit, but may be eaten dry. Some companies promote their products for the health benefits from eating oat-based and high-fiber cereals. Cereals may be fortified with vitamins. Some cereals are made with high sugar content. Many breakfast cereals are produced via extrusion. The breakfast cereal industry has gross profit margins of 40-45%, 90% penetration in some markets, and steady and continued growth throughout its history.',	NULL,	'Breakfast cereal',	'270.jpg',	'image/jpeg',	198626,	'2012-04-20 09:37:35',	291,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-02-09 00:37:29',	'2020-03-12 20:56:30',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00270'),
(272,	'Other soy product',	NULL,	NULL,	NULL,	NULL,	'272.jpg',	'image/jpeg',	41524,	'2012-04-20 09:30:20',	293,	'Soy',	'Soy products',	'Type 2',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00271'),
(273,	'Other cereal product',	NULL,	NULL,	NULL,	NULL,	'273.jpg',	'image/jpeg',	107737,	'2012-04-20 09:37:05',	294,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-02-09 00:37:29',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00272'),
(274,	'Pasta',	NULL,	'Pasta is a type of noodle and is a staple food of traditional Italian cuisine, with the first reference dating to 1154 in Sicily. It is also commonly used to refer to the variety of pasta dishes. Typically pasta is made from an unleavened dough of a durum wheat flour mixed with water and formed into sheets or various shapes, then cooked and served in any number of dishes. It can be made with flour from other cereals or grains, and eggs may be used instead of water. Pastas may be divided into two broad categories, dried (pasta secca) and fresh (pasta fresca). Chicken eggs frequently dominate as the source of the liquid component in fresh pasta. Most dried pasta is commercially produced via an extrusion process. Fresh pasta was traditionally produced by hand, sometimes with the aid of simple machines, but today many varieties of fresh pasta are also commercially produced by large scale machines, and the products are broadly available in supermarkets. Both dried and fresh pasta come in a number of shapes and varieties, with 310 specific forms known variably by over 1300 names having been recently documented. In Italy the names of specific pasta shapes or types often vary with locale. For example the form cavatelli is known by 28 different names depending on region and town. Common forms of pasta include long shapes, short shapes, tubes, flat shapes and sheets, miniature soup shapes, filled or stuffed, and specialty or decorative shapes. As a category in Italian cuisine, both dried and fresh pastas are classically used in one of three kinds of prepared dishes. As pasta asciutta (or pastasciutta) cooked pasta is plated and served with a complementary sauce or condiment. A second classification of pasta dishes is pasta in brodo in which the pasta is part of a soup-type dish. A third category is pasta al forno in which the pasta incorporated into a dish that is subsequently baked. Pasta is generally a simple dish, but comes in large varieties because it is a versatile food item. Some pasta dishes are served as a first course in Italy because the portion sizes are small and simple. The servings are usually accompanied by a side of meat. Pasta is also prepared in light lunches, such as salads or large portion sizes for dinner. It can be prepared by hand or food processor and served hot or cold. Pasta sauces vary in taste, color and texture. When choosing which type of pasta and sauce to serve together, there is a general rule that must be observed. Simple sauces like pesto are ideal for long and thin strands of pasta while tomato sauce combines well with thicker pastas. Thicker and chunkier sauces have the better ability to cling onto the holes and cuts of short, tubular, twisted pastas. Sauce should be served equally with its pasta. It is important that the sauce does not overflow the pasta. The extra sauce is left on the plate after all of the pasta is eaten.',	NULL,	'Pasta',	'274.jpg',	'image/jpeg',	2205799,	'2012-04-20 09:34:38',	297,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-02-09 00:37:29',	'2020-03-12 20:57:16',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00273'),
(275,	'Biscuit',	NULL,	'A biscuit is a baked, commonly flour-based food product. The term is applied to two distinct products in North America and the Commonwealth of Nations and Europe. For a list of varieties, see the list of biscuits and cookies.',	NULL,	'Biscuit',	'275.jpg',	'image/jpeg',	8965,	'2012-04-20 09:37:00',	298,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00274'),
(276,	'Sourdough',	NULL,	'Sourdough is a dough containing a Lactobacillus culture, usually in symbiotic combination with yeasts. It is one of two principal means of biological leavening in bread baking, along with the use of cultivated forms of yeast (Saccharomyces). It is of particular importance in baking rye-based breads, where yeast does not produce comparable results. In comparison with yeast-based breads, it produces a distinctively tangy or sour taste, mainly because of the lactic acid produced by the lactobacilli; the actual medium, known as \"starter\" or levain, is essentially an ancestral form of pre-ferment. In English-speaking countries, where wheat-based breads predominate, sourdough is no longer the standard method for bread leavening. It was gradually replaced, first by the use of barm from beermaking, then, after the confirmation of germ theory by Louis Pasteur, by cultured yeasts. However, some form of natural leaven is still used by many specialty bakeries. [Wikipedia]',	NULL,	'Sourdough',	'276.jpg',	'image/jpeg',	16948,	'2012-04-20 09:42:26',	299,	'Cereals and cereal products',	'Doughs',	'Type 2',	'2011-02-09 00:37:30',	'2020-03-12 20:57:27',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00275'),
(277,	'Spirit',	NULL,	NULL,	NULL,	'Spirit',	'277.jpg',	'image/jpeg',	194630,	'2012-04-20 09:36:55',	300,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00276'),
(278,	'Fortified wine',	NULL,	'Fortified wine is wine with an added distilled beverage. Fortified wine is distinguished from spirits made from wine in that spirits are produced by means of distillation, while fortified wine is simply wine that has had a spirit added to it. Many different styles of fortified wine have been developed, including Port, Sherry, Madeira, Marsala, Commandaria wine and the aromatized wine Vermouth.',	NULL,	'Fortified wine',	'278.jpg',	'image/jpeg',	40686,	'2012-04-20 09:33:36',	301,	'Beverages',	'Fortified wines',	'Type 2',	'2011-02-09 00:37:30',	'2019-12-11 19:32:37',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00277'),
(279,	'Other alcoholic beverage',	NULL,	NULL,	NULL,	'Alcoholic_beverage',	'279.jpg',	'image/jpeg',	73939,	'2012-04-20 09:43:36',	305,	'Beverages',	'Alcoholic beverages',	'Type 2',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00278'),
(280,	'Abalone',	'Haliotis',	'Abalone, is a common name for any of a group of small to very large edible sea snails, marine gastropod molluscs in the family Haliotidae. Other common names are ear shells, sea ears, as well as muttonfish or muttonshells in Australia, ormer in Great Britain, perlemoen and venus\'s-ears in South Africa in New Zealand. The family Haliotidae contains only one genus, Haliotis. That genus contains about four to seven subgenera. The number of species recognized worldwide ranges between 30 and 130 with over 230 species-level taxa described. The most comprehensive treatment of the family considers 56 species valid, with 18 additional subspecies. The shells of abalones have a low and open spiral structure, and are characterized by several open respiratory pores in a row near the shell\'s outer edge. The thick inner layer of the shell is composed of nacre or mother-of-pearl, which in many species is highly iridescent, giving rise to a range of strong and changeable colors, which make the shells attractive to humans as decorative objects, jewelry, and as a source of colorful mother-of-pearl. The flesh of abalones is widely considered to be a desirable food, and is consumed raw or cooked in a variety of different dishes.',	'69493',	'Abalone',	'280.jpg',	'image/jpeg',	99231,	'2012-04-20 09:41:13',	307,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	6452,	1,	'FOOD00279'),
(281,	'Abiyuch',	'Crateva religiosa',	'The flowering tree Crateva religiosa (syn Crataeva religiosa, Crateva adansonii) is called the sacred garlic pear and temple plant, and many other names in a variety of dialects, including Balai Lamok, abiyuch, barna, varuna, and bidasi. The tree is sometimes called the spider tree because the showy flowers bear long, spidery stamens. It is native to Japan, Australia, much of Southeast Asia and several South Pacific islands. It is grown elsewhere for fruit, especially in parts of the African continent. The fruit of the tree is edible. The nectar-filled flowers are attractive to a multitude of insects and birds. The pierid butterfly is a frequent visitor to this plant.',	'505883',	'Crateva religiosa',	'281.jpg',	'image/jpeg',	36878,	'2012-04-20 09:38:50',	308,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	202634,	1,	'FOOD00280'),
(282,	'Acerola',	'Malpighia emarginata',	'Malpighia emarginata is a tropical fruit-bearing shrub or small tree in the family Malpighiaceae. Common names include acerola, Barbados cherry, West Indian cherry and wild crepemyrtle. Acerola is native to South America, Southern Mexico and Central America, but is now also being grown as far north as Texas and in subtropical areas of Asia, like India. It is known for being extremely rich in vitamin C, almost as much as camu camu, although it also contains vitamins A, B1, B2 and B3 as well as carotenoids and bioflavonoids which provide important nutritive value and have antioxidant uses. The vitamin C produced by the fruit is better absorbed by human organisms than synthetic ascorbic acid.',	'29280',	'Malpighia emarginata',	'282.jpg',	'image/jpeg',	106965,	'2012-04-20 09:33:17',	309,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	151847,	1,	'FOOD00281'),
(283,	'Acorn',	'Quercus',	'The acorn, or oak nut, is the nut of the oaks and their close relatives. It usually contains a single seed (rarely two seeds), enclosed in a tough, leathery shell, and borne in a cup-shaped cupule. Acorns vary from 1–6 cm long and 0.8–4 cm broad. Acorns take between about 6 and 24 months (depending on the species) to mature; see List of Quercus species for details of oak classification, in which acorn morphology and phenology are important factors.',	'19276',	'Acorn',	'283.jpg',	'image/jpeg',	65939,	'2012-04-20 09:33:52',	310,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	3511,	1,	'FOOD00282'),
(284,	'Winter squash',	'Cucurbita maxima',	'Winter squash is a summer-growing annual vegetable, representing several species within the genus Cucurbita. It differs from summer squash in that it is harvested and eaten in the mature fruit stage, when the seeds within have matured fully and the skin has hardened into a tough rind. At this stage, most varieties of this fruit can be stored for use during the winter. It is generally cooked before eating.',	'22369',	'Winter squash',	'284.jpg',	'image/jpeg',	200081,	'2012-04-20 09:41:55',	311,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	3661,	1,	'FOOD00283'),
(285,	'Agar',	'Eucheuma',	'Agar or agar-agar is a gelatinous substance derived by boiling a polysaccharide in red algae, where it accumulates in the cell walls of agarophyte and serves as the primary structural support for the algae\'s cell walls. Agar is a mixture of two components: the linear polysaccharide agarose, and a heterogeneous mixture of smaller molecules called agaropectin. Throughout history into modern times, agar has been chiefly used as an ingredient in desserts throughout Asia and also as a solid substrate to contain culture medium for microbiological work. Agar (agar-agar) can be used as a laxative, an appetite suppressant, vegetarian gelatin substitute, a thickener for soups, in fruit preserves, ice cream, and other desserts, as a clarifying agent in brewing, and for sizing paper and fabrics. The gelling agent is an unbranched polysaccharide obtained from the cell walls of some species of red algae, primarily from the genera Gelidium and Gracilaria. For commercial purposes, it is derived primarily from Gelidium amansii. In chemical terms, agar is a polymer made up of subunits of the sugar galactose.',	'11923',	'Agar',	'285.jpg',	'image/jpeg',	65839,	'2012-04-20 09:30:09',	312,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	31444,	1,	'FOOD00284'),
(286,	'Red king crab',	'Paralithodes camtschaticus',	'The red king crab, Paralithodes camtschaticus, is a species of king crab native to the Bering Sea. It grows to a leg span of 1.8 m, and is heavily targeted by fisheries. Red king crabs can be very large, sometimes reaching a carapace width of 28 cm (11 in) and a leg span of 1.8 m (5.9 ft). It was named after the color it turns when it is cooked rather than the color of a living animal, which tends to be more burgundy. The king crab is native to the Bering Sea, north Pacific Ocean, around the Kamchatka Peninsula and neighboring Alaskan waters.',	'97935',	'Paralithodes camtschaticus',	'286.jpg',	'image/jpeg',	81345,	'2012-04-20 09:39:07',	313,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	6741,	1,	'FOOD00285'),
(287,	'Alfalfa',	'Medicago sativa',	'Alfalfa, Medicago sativa, also called lucerne, is a perennial flowering plant in the pea family Fabaceae cultivated as an important forage crop in many countries around the world. The Spanish-Arabic (according to wiktionary and the DRAE) name alfalfa is widely used, particularly in North America and Australia. But in the UK, South Africa and New Zealand, the more commonly used name is lucerne. It superficially resembles clover, with clusters of small purple flowers followed by fruits spiralled in 2 to 3 turns containing 10-20 seeds. Alfalfa is native to a warmer temperate climate such as that of Iran (where it is thought to have originated). It has been cultivated as livestock fodder since at least the era of the ancient Greeks and Romans.',	'183623',	'Alfalfa',	'287.jpg',	'image/jpeg',	145781,	'2012-04-20 09:42:00',	314,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	3879,	1,	'FOOD00286'),
(288,	'Allspice',	'Pimenta dioica',	'Allspice, also called Jamaica pepper, pepper, myrtle pepper, pimenta, pimento, English pepper or newspice, is the dried unripe fruit (\"berries\", used as a spice) of Pimenta dioica, a midcanopy tree native to the Greater Antilles, southern Mexico, and Central America, now cultivated in many warm parts of the world. The name \'allspice\' was coined as early as 1621 by the English, who thought it combined the flavour of cinnamon, nutmeg, and cloves.\nSeveral unrelated fragrant shrubs are called \"Carolina allspice\" (Calycanthus floridus), \"Japanese allspice\" (Chimonanthus praecox), or \"wild allspice\" (Lindera benzoin). Allspice is also sometimes used to refer to the herb costmary (Tanacetum balsamita).',	'27247',	'Allspice',	'288.jpg',	'image/jpeg',	112761,	'2012-04-20 09:37:09',	315,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:21',	NULL,	NULL,	0,	'specific',	375272,	1,	'FOOD00287'),
(289,	'Amaranth',	'Amaranthus',	'Amaranthus, collectively known as amaranth,[citation needed] is a cosmopolitan genus of annual or short-lived perennial plants. Catkin-like cymes of densely packed flowers grow in summer or autumn. Approximately 60 species are recognized, with inflorescences and foliage ranging from purple and red to green or gold. Members of this genus share many characteristics and uses with members of the closely related genus Celosia.\nAlthough several species are often considered weeds, people around the world value amaranths as leaf vegetables, cereals, and ornamental plants.\n\"Amaranth\" derives from Greek ????????? (amarantos), \"unfading,\" with the Greek word for \"flower,\" ????? (anthos), factoring into the word\'s development as \"amaranth.\" The more accurate \"amarant\" is an archaic variant.',	'20715',	'Amaranth',	'289.jpg',	'image/jpeg',	633428,	'2012-04-20 09:40:08',	316,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	3564,	1,	'FOOD00288'),
(290,	'Arrowhead',	'Sagittaria latifolia',	'Sagittaria latifolia is a plant found in shallow wetlands and is sometimes known as broadleaf arrowhead, duck potato, Indian potato, or wapato. This plant produces edible tubers that were extensively used by the Indigenous peoples of the Americas.',	'38908',	'Sagittaria_latifolia',	'290.jpg',	'image/jpeg',	43707,	'2012-04-20 09:38:42',	317,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	15008,	1,	'FOOD00289'),
(291,	'Arrowroot',	'Maranta arundinacea',	'Maranta arundinacea, also known as arrowroot maranta West Indian arrowroot, obedience plant, Bermuda arrowroot, araru, ararao or hulankeeriya, is a large, perennial herb found in rainforest habitats. It is cultivated for a starch obtained from the rhizomes (rootstock), which is called arrowroot. The name \'Arrowroot\' lead many ayurveda doctors to use root stock of this plant instead of Curcuma angustifolia (\"tikhur\" in Hindi,\"Koova\" in Malayalam) a precious medicinal plant.',	'503694',	'Maranta_arundinacea',	'291.jpg',	'image/jpeg',	52198,	'2012-04-20 09:39:23',	318,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	210060,	1,	'FOOD00290'),
(292,	'Asian pear',	'Pyrus pyrifolia',	'Pyrus pyrifolia is a pear tree species native to China, Japan, and Korea. The tree\'s edible fruit is known by many names, including: Asian pear, Chinese pear, Korean pear, Japanese pear, Taiwan pear, and sand pear. Along with cultivars of P. × bretschneideri and P. ussuriensis, the fruit is also called the nashi pear. Despite being colloquially known as an apple pear due to its appearance and texture, the fruit is not a hybrid of the two. Cultivars derived from Pyrus pyrifolia are grown throughout East Asia, and in other countries such as Australia, New Zealand, and the United States (e.g. , California). Traditionally in East Asia the tree\'s flowers are a popular symbol of early spring, and it is a common sight in gardens and the countryside. The fruits are generally not baked in pies or made into jams because they have a high water content and a crisp, grainy texture, very different from the buttery European varieties. They are commonly served raw and peeled. The fruit tends to be quite large and fragrant, and when carefully wrapped (it has a tendency to bruise because of its juiciness), it can last for several weeks or more in a cold, dry place.',	'25296',	'Pyrus pyrifolia',	'292.jpg',	'image/jpeg',	46639,	'2012-04-20 09:36:50',	319,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	3767,	1,	'FOOD00291'),
(293,	'Atlantic herring',	'Clupea harengus harengus',	'Atlantic herring (Clupea harengus) is a herring in the family Clupeidae. It is one of the most abundant fish species on earth. Atlantic herrings can be found on both sides of the Atlantic Ocean, congregating in large schools. They can grow up to 45 centimetres in length and weigh more than 0.5 kilograms . They feed on copepods, krill and small fish, while their natural predators are seals, whales, cod and other larger fish. The Atlantic herring fishery has long been an important part of the economy of New England and the Canadian Maritime provinces. This is because the fish congregate relatively near to the coast in massive schools, notably in the cold waters of the semi-enclosed Gulf of Maine and Gulf of St. Lawrence. North Atlantic herring schools have been measured up to 4 cubic kilometres in size, containing an estimated 4 billion fish.',	'161724',	'Atlantic herring',	'293.jpg',	'image/jpeg',	10362,	'2012-04-20 09:34:09',	320,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	7950,	1,	'FOOD00292'),
(294,	'Atlantic mackerel',	'Scomber scombrus',	'The Atlantic mackerel (Scomber scombrus), is a pelagic schooling species of mackerel found on both sides of the North Atlantic Ocean. The species is also called Boston mackerel, or just mackerel. The Atlantic Mackerel is by far the most common of the ten species of the family that are caught in British waters. It is extremely common in huge shoals migrating towards the coast to feed on small fish and prawns during the summer. Abundant in cold and temperate shelf areas, it forms large schools near the surface. They overwinter in deeper waters but move closer to shore in spring when water temperatures range between 11–14 °C (52–57 °F). In north-east Atlantic: North Sea (east) and British Isles (west). The North Sea stock decreased dramatically in the 1960s because of direct overfishing. Male and female Atlantic mackerel grow at about the same rate, reaching a maximum age of about 20 years and a maximum fork length of about 47 centimetres . Most Atlantic mackerel are sexually mature by the age of three years.',	'172414',	'Atlantic mackerel',	'294.jpg',	'image/jpeg',	60948,	'2012-04-20 09:36:52',	321,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	13677,	1,	'FOOD00293'),
(295,	'Painted comber',	'Serranus scriba',	'The painted comber (Serranus scriba) is a subtropical marine fish, classified in family Serranidae, the groupers and sea basses. It is found in the eastern Atlantic Ocean, the Mediterranean Sea, and the Black Sea. Confusingly, a synonym of this species is Perca marina, but that name (as Sebastes marinus) has incorrectly been used for a separate species, the rose fish.',	'167862',	'Painted comber',	'295.jpg',	'image/jpeg',	74307,	'2012-04-20 09:34:35',	322,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:30',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	349661,	1,	'FOOD00294'),
(296,	'Atlantic pollock',	'Pollachius pollachius',	'Pollachius pollachius is a species of marine fish in the Pollachius genus. FAO uses English name pollack for this species. Together with Pollachius virens, it may also be referred to as pollock. Other names include European pollock, lieu jaune, and lythe. It is common in the north-eastern parts of the Northern Atlantic, including the Bay of Biscay and North Sea. Adults can grow up to 130 centimetres and weigh up to 18.1 kilograms, although more commonly their maximum length is 75 centimetres .',	'164728',	'Pollachius pollachius',	'296.jpg',	'image/jpeg',	134723,	'2012-04-20 09:41:08',	323,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	185739,	1,	'FOOD00295'),
(297,	'Atlantic wolffish',	'Anarhichas lupus',	'The Atlantic wolffish (Anarhichas lupus), also known as the seawolf, Atlantic catfish, ocean catfish, devil fish, wolf eel, or sea cat, is a marine fish, the largest of the wolffish family Anarhichadidae. They are commonly sighted throughout Asia. The numbers of the Atlantic wolffish are rapidly being depleted apparently due to overfishing and bycatch, and is currently a Species of Concern according to the National Oceanic and Atmospheric Administration\'s National Marine Fisheries Service. Although it looks fearsome, the Atlantic wolffish is only a threat to humans when defending itself out of the water. Apart from their unique appearance wolffish are distinguished by the natural antifreeze they produce to keep their blood moving fluidly in their very cold habitat, involvement by both the male and female in brood bearing, and the large size of their eggs. They are also an important factor in controlling green crab and sea urchin populations, which can become overly disruptive to habitats if left unchecked. Wolffish population success is also an important indicator of the health of other bottom-dweller populations, such as cod.',	'171341',	'Atlantic wolffish',	'297.jpg',	'image/jpeg',	50517,	'2012-04-20 09:38:56',	324,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	8204,	1,	'FOOD00296'),
(298,	'Bamboo shoots',	'Phyllostachys edulis',	'Bamboo shoots or bamboo sprouts are the edible shoots (new bamboo culms that come out of the ground) of many bamboo species including Bambusa vulgaris and Phyllostachys edulis. They are used in numerous Asian dishes and broths. They are sold in various processed shapes, and are available in fresh, dried, and canned versions.',	'565400',	'Bamboo_shoots',	'298.jpg',	'image/jpeg',	432497,	'2012-04-20 09:29:18',	325,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	38705,	1,	'FOOD00297'),
(299,	'Striped bass',	'Morone saxatilis',	'The striped bass (Morone saxatilis), also called Atlantic striped bass, striper, linesider, rock, pimpfish, or rockfish, is the state fish of Maryland, Rhode Island, South Carolina, and the state saltwater (marine) fish of New York, New Jersey, Virginia, and New Hampshire. They are also found in the Minas Basin and Gaspereau River in Nova Scotia, Canada.',	'167680',	'Striped bass',	'299.jpg',	'image/jpeg',	36282,	'2012-04-20 09:34:02',	326,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	34816,	1,	'FOOD00298'),
(301,	'Beech nut',	'Fagus',	'Beech (Fagus) is a genus of deciduous trees in the family Fagaceae, native to temperate Europe, Asia and North America. Recent classification systems of the genus recognize ten to thirteen species in two distinct subgenera, Engleriana and Fagus. The Engleriana subgenus is found only in East Asia, and is notably distinct from the Fagus subgenus in that these beeches are low-branching trees, often made up of several major trunks with yellowish bark. Further differentiating characteristics include the whitish bloom on the underside of the leaves, the visible tertiary leaf veins, and a long, smooth cupule-peduncle. Fagus japonica, Fagus engleriana, and the species F. okamotoi, proposed by the bontanist Chung-Fu Shen in 1992, comprise this subgenus. The more well-known Fagus subgenus beeches are high-branching with tall, stout trunks and smooth silver-grey bark. This group includes Fagus sylvatica, Fagus grandifolia, Fagus crenata, Fagus lucida, Fagus longipetiolata, and Fagus hayatae.\nThe European beech (Fagus sylvatica) is the most commonly cultivated, although there are few important differences between species aside from detail elements such as leaf shape. The leaves of beech trees are entire or sparsely toothed, from 5?15 cm long and 4?10 cm broad. Beeches are monoecious, bearing both male and female flowers on the same plant. The small flowers are unisexual, the female flowers borne in pairs, the male flowers wind-pollinating catkins. They are produced in spring shortly after the new leaves appear. The bark is smooth and light grey. The fruit is a small, sharply three?angled nut 10?15 mm long, borne singly or in pairs in soft-spined husks 1.5?2.5 cm long, known as cupules. The husk can have a variety of spine- to scale-like appendages, the character of which is, in addition to leaf shape, one of the primary ways beeches are differentiated. The nuts are edible, though bitter (though not nearly as bitter as acorns) with a high tannin content, and are called beechnuts or beechmast.',	'19461',	'Beech',	'301.jpg',	'image/jpeg',	29680,	'2012-04-20 09:43:07',	328,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	21024,	1,	'FOOD00299'),
(302,	'Beluga whale',	'Delphinapterus leucas',	'The beluga whale or white whale (Delphinapterus leucas) is an Arctic and sub-Arctic cetacean. It is one of two members of the family Monodontidae, along with the narwhal, and the only member of the genus Delphinapterus. This marine mammal is commonly referred to simply as the melonhead, beluga or sea canary due to its high-pitched twitter',	'180483',	'Beluga_whale',	'302.jpg',	'image/jpeg',	100140,	'2012-04-20 09:39:05',	329,	'Aquatic foods',	'Cetaceans',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	9749,	0,	'FOOD00300'),
(303,	'Bison',	'Bison bison',	'Members of the genus Bison are large, even-toed ungulates within the subfamily Bovinae. There are two extant and four extinct species recognized. Of the four extinct species, three were North American; Bison antiquus, B. latifrons, and B. occidentalis. The fourth; the Bison priscus ranged across steppe environments from Western Europe, through Central Asia, and onto North America. There are two surviving species; the American bison, Bison bison, also known as the American buffalo, found only in North America, is the most numerous. It is named buffalo although it is only distantly related to the true buffalo. The North American species is composed of two subspecies, the plains bison, Bison bison bison, and the wood bison, Bison bison athabascae. The European bison Bison bonasus, or wisent is found in Europe and the Caucasus, re-introduced after being extinct in the wild. While all bison species are usually grouped into their own genus, they are sometimes included in the closely related genus Bos, together with cattle, gaur, kouprey and yaks, with which bison have a limited ability to interbreed.',	'180706',	'Bison',	'303.jpg',	'image/jpeg',	384210,	NULL,	330,	'Animal foods',	'Bovines',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:22',	NULL,	NULL,	1,	'specific',	9901,	1,	'FOOD00301'),
(305,	'Alaska blackfish',	'Dallia pectoralis',	'The Alaska blackfish, Dallia pectoralis, is a fish that grows to 7 inches in length. It is elongate and cylindrical, with a dark olive-brown coloration. Four to six dark blotches run vertically along the sides, and the belly is white. The fins have reddish-brown speckles. Once thought to be an herbivore, its primary diet is midges and mosquito insect larvae. Alaska blackfish are found in swamps, ponds, lakes, and streams with vegetation for cover, in tundra and forested locations not far inland. Their range includes Alaska and the Bering Sea islands. Alaska Natives once ate these fish and fed them to their dogs, catching them in the fall and freezing them for use over winter. The hardiness of the Alaska blackfish is of mythical proportions, including tales of reviving fish after they are frozen solid. The fish survive the cold winters by moving to a depth of 7–8 metres when the surface becomes solid ice. Large gills protected by gill covers help them to survive the winters where the water temperatures drop to 0 °C . Though the Alaskan blackfish can be supercooled for short periods at temperatures as low as −20 °C) in controlled environments without contact with ice crystals, no Alaska blackfish has ever survived for even as much as an hour under these freezing conditions. Freezing any part of the body results in necrosis.',	'162159',	'Alaska blackfish',	'305.jpg',	'image/jpeg',	134297,	'2012-04-20 09:43:38',	332,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	75939,	1,	'FOOD00302'),
(306,	'Blue crab',	'Callinectes sapidus',	'Callinectes sapidus (from the Greek calli- = \"beautiful\", nectes = \"swimmer\", and Latin sapidus = \"savory\"), the blue crab, Atlantic blue crab, or regionally as the Chesapeake blue crab, is a species of crab native to the waters of the western Atlantic Ocean and the Gulf of Mexico, and introduced internationally.\nC. sapidus is of significant culinary and economic importance in the United States, particularly in Louisiana and in the Chesapeake Bay. It is the Maryland state crustacean and is the state\'s largest commercial fishery.',	'98696',	'Callinectes_sapidus',	'306.jpg',	'image/jpeg',	69896,	'2012-04-20 09:32:04',	333,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	6763,	1,	'FOOD00303'),
(307,	'Blue mussel',	'Mytilus edulis',	'The blue mussel (Mytilus edulis) is a medium-sized edible marine bivalve mollusc in the family Mytilidae, the mussels. Blue mussels are subject to commercial use and intense aquaculture.',	'79454',	'Blue mussel',	'307.jpg',	'image/jpeg',	126578,	'2012-04-20 09:40:13',	334,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	6550,	1,	'FOOD00304'),
(308,	'Northern bluefin tuna',	'Thunnus thynnus',	'The Atlantic bluefin tuna (Thunnus thynnus) is a species of tuna in the Scombridae family. It is variously known as the northern bluefin tuna (mainly when including Pacific bluefin as a subspecies), giant bluefin tuna (for individuals exceeding 150 kilograms or around 330 pounds) and formerly as the tunny. Atlantic bluefin are native to both the western and eastern Atlantic Ocean, as well as the Mediterranean Sea. Atlantic bluefin have become extinct in the Black Sea. The Atlantic bluefin tuna is a close relative of the other two bluefin tuna species—the Pacific bluefin tuna and the southern bluefin tuna. Atlantic bluefin tuna may exceed 450 kilograms in weight, and rival the black marlin, blue marlin and swordfish as the largest Perciformes. Throughout recorded history, the Atlantic bluefin tuna has been highly prized as a food fish. Besides their commercial value as food, the great size, speed, and power they display as apex predators has attracted the admiration of fishermen, writers, and scientists. The Atlantic bluefin tuna has been the foundation of one of the world\'s most lucrative commercial fisheries. Medium-sized and large individuals are heavily targeted for the Japanese raw fish market, where all bluefin species are highly prized for sushi and sashimi. This commercial importance has led to severe overfishing. The International Commission for the Conservation of Atlantic Tunas (ICCAT) affirmed in October 2009 that Atlantic bluefin tuna stocks have declined dramatically over the last 40 years, by 72% in the Eastern Atlantic, and by 82% in the Western Atlantic. On 16 October 2009, Monaco formally recommended Endangered Atlantic bluefin tuna for an Appendix I CITES listing and international trade ban. In early 2010, European officials, led by the French ecology minister, increased pressure to ban the commercial fishing of bluefin tuna internationally. European Union nations, who are responsible for most bluefin tuna overfishing, later abstained from voting to protect the species from international trade. Most Bluefin are captured commercially by professional fishermen using longlines; purse seines, assorted hook-and-line gear, heavy rod and reels, and harpoon. Recreationally, bluefin has been one of the most important big-game species sought by sports fishermen since the 1930s, particularly in the United States but also in Canada, Spain, France and Italy.',	'172421',	'Atlantic bluefin tuna',	'308.jpg',	'image/jpeg',	40029,	'2012-04-20 09:29:06',	335,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	8237,	1,	'FOOD00305'),
(309,	'Bluefish',	'Pomatomus saltatrix',	'The bluefish (Pomatomus saltatrix) is the only extant species of the family Pomatomidae. It is a marine pelagic fish found around the world in temperate and subtropical waters, except for the northern Pacific Ocean. Bluefish are known as tailor in Australia, shad on the east coast of South Africa, elf on the west coast. Other common names are blue, chopper, and anchoa. It is good eating and a popular gamefish.\nThe bluefish is a moderately proportioned fish, with a broad, forked tail. The spiny first dorsal fin is normally folded back in a groove, as are its pectoral fins. Coloration is a grayish blue-green dorsally, fading to white on the lower sides and belly. Its single row of teeth in each jaw are uniform in size, knife-edged, and sharp. Bluefish commonly range in size from seven-inch (18-cm) \"snappers\" to much larger, sometimes weighing as much as 40 pounds (18 kg), though fish heavier than 20 pounds (9 kg) are exceptional.',	'168559',	'Bluefish',	'309.jpg',	'image/jpeg',	10960,	'2012-04-20 09:42:50',	336,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	75034,	1,	'FOOD00306'),
(310,	'Wild boar',	'Sus scrofa',	'Wild boar (Sus scrofa), also known as wild pig, is a species of the pig genus Sus, part of the biological family Suidae. The species includes many subspecies. It is the wild ancestor of the domestic pig, an animal with which it freely hybridises. Wild boar are native across much of Northern and Central Europe, the Mediterranean Region (including North Africa\'s Atlas Mountains) and much of Asia as far south as Japan and Indonesia. Populations have also been artificially introduced in some parts of the world, most notably the Americas and Australasia. Elsewhere, populations have also become established after escapes of wild boar from captivity.',	'180722',	'Wild boar',	'310.jpg',	'image/jpeg',	122002,	NULL,	337,	'Animal foods',	'Swine',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	9823,	1,	'FOOD00307'),
(311,	'Bowhead whale',	'Balaena mysticetus',	'The bowhead whale (Balaena mysticetus) is a baleen whale of the right whale family Balaenidae, in suborder Mysticeti and genus Balaena. A stocky dark-colored whale without a dorsal fin, it can grow to 20 m in length. This thick-bodied species can weigh 75 tonnes to 100 tonnes, second only to the blue whale, although the bowhead\'s maximum length is less than several other whales. It lives entirely in fertile Arctic and sub-Arctic waters, unlike other whales that migrate to feed or reproduce to low latitude waters. It was also known as Greenland right whale or Arctic whale. American whalemen called it the steeple-top, polar whale, or Russia or Russian whale. The bowhead has the largest mouth of any animal. The bowhead was an early whaling target. Its population was severely reduced before a 1966 moratorium. The population is estimated to be over 24,900 worldwide, down from an estimated 50,000 before whaling.',	'180533',	'Bowhead whale',	'311.jpg',	'image/jpeg',	24966,	'2012-04-20 09:39:08',	338,	'Aquatic foods',	'Cetaceans',	'Type 1',	'2011-02-09 00:37:31',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	27602,	0,	'FOOD00308'),
(312,	'Breadfruit',	'Artocarpus altilis',	'Breadfruit (Artocarpus altilis) is a species of flowering tree in the mulberry family, Moraceae, growing throughout Southeast Asia and most Pacific Ocean islands. Its name is derived from the texture of the cooked fruit, which has a potato-like flavor, similar to fresh-baked bread. Ancestors of the Polynesians found the trees growing in the northwest New Guinea area around 3,500 years ago. They gave up the rice cultivation they had brought with them from Taiwan, and raised breadfruit wherever they went in the Pacific (except Easter Island and New Zealand, which are too cold). Their ancient eastern Indonesian cousins spread the plant west and north through insular and coastal Southeast Asia. It has, in historical times, also been widely planted in tropical regions elsewhere.',	'184181',	'Breadfruit',	'312.jpg',	'image/jpeg',	69866,	'2012-04-20 09:30:15',	339,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:32',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	194251,	1,	'FOOD00309'),
(313,	'Breadnut tree seed',	'Brosimum alicastrum',	'Brosimum alicastrum, the breadnut or Maya nut, is a Brosimum tree species under the Moraceae family of flowering plants, whose other genera include fig and mulberries The plant is known by a range of names in indigenous Mesoamerican and other languages, including but not limited to: ramon,ojoche, ojite, ojushte, ujushte, ujuxte, capomo, mojo, ox, iximche, masica in Honduras, uje in Michoacan, and mojote in Jalisco. Two subspecies are commonly recognized: Brosimum alicastrum ssp. alicastrum Brosimum alicastrum ssp. bolivarense Distribution and habitat: The west coast of central Mexico, southern Mexico, Guatemala, El Salvador, the Caribbean, and the Amazon. Large stands in moist lowland tropical forests 300–2000 m elevation (especially 125–800 m), in humid areas where rainfall of 600–2000 mm, and average temperature 24 C / 75 F. The breadnut fruit disperses on the ground at different times throughout its range. It has a large seed covered by a thin, citrus-flavored orange-colored skin favored by a number of forest creatures. More important, the large seed which is enveloped by the tasty skin is an edible ‘nut’ that can be boiled or dried and ground into a meal for porridge or flatbread. Breadnut is nutritious and has value as a food source, and formed a part of the diet of the pre-Columbian Maya of the lowlands region in Mesoamerica, although to what extent has been a matter of some debate among Maya historians and archaeologists. It was planted by the Maya civilization two thousand years ago and it has been claimed in several articles by Dennis E. Puleston to have been a staple food in the Maya diet, although other research has downplayed its significance. In the modern era it has been marginalized as a source of nutrition and has often been characterized as a famine food. The breadnut is extremely high in fiber, calcium, potassium, folic acid, iron, zinc, protein and B vitamins. It has a low glycemic index (<50) and is very high in antioxidants. The fresh seeds can be cooked and eaten or can be set out to dry in the sun to roast and eaten later. Stewed the nut tastes like mashed potato, roasted it tastes like chocolate or coffee and can be prepared in numerous other dishes. In Petén, Guatemala, the breadnut is being cultivated for exportation and local consumption as powder, for hot beverages, and bread. The tree can reach up to 45 meters (130 feet). The tree lends its name to the Maya archaeological sites of Iximché and Topoxte, both in Guatemala and also of Tamuin (reflecting the Maya origin of the Huastec peoples). It is one of the twenty dominant species of the Maya forest. Of the dominant species, it is the only one that is wind-pollinated. It is also found in traditional Maya forest gardens.',	'19075',	'Brosimum alicastrum',	'313.jpg',	'image/jpeg',	183286,	'2012-04-20 09:35:11',	340,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:32',	'2019-05-14 18:04:22',	NULL,	2,	0,	'specific',	194253,	1,	'FOOD00310'),
(314,	'Rapini',	'Brassica ruvo',	'Rapini (commonly marketed in English as broccoli raab or rabe) is a green cruciferous vegetable. The edible parts are the leaves, buds, and stems. The buds somewhat resemble broccoli, but do not form a large head. It is known for its slightly bitter taste, and is particularly associated with Italian, Galician, and Portuguese cuisines. Within Italian cuisine, the plant is heavily associated with Southern Italian cuisine (especially Neapolitan cuisine and the cuisines of Campania and Puglia) and Roman cuisine.\nIn Italy, it is called cime di rapa (literally meaning \"turnip tops\"), rapi, or rapini; in Naples it is known as friarielli and sometimes broccoli di rapa; in Rome broccoletti; and in Portugal and Spain grelos.',	'506216',	'Rapini',	'314.jpg',	'image/jpeg',	99777,	'2012-04-20 09:33:44',	341,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:32',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	1204434,	1,	'FOOD00311'),
(316,	'Buffalo',	'Bubalus bubalis',	'\"The water buffalo or domestic Asian water buffalo (Bubalus bubalis) is a large bovid found on the Indian subcontinent to Vietnam and Peninsular Malaysia, in Sri Lanka, in Luzon Island in the Philippines, and in Borneo. The wild water buffalo (Bubalus arnee) native to Southeast Asia is considered a different species but most likely represents the ancestor of the domestic water buffalo. Water buffaloes are especially suitable for tilling rice fields, and their milk is richer in fat and protein than that of the dairy cow. The large feral population of northern Australia became established in the late 19th century, and there are smaller feral herds in New Guinea, Tunisia and northeastern Argentina. There are at least 130 million domestic water buffalo, and more human beings depend on them than on any other domestic animal.\"',	'552476',	'Bubalus_bubalis',	'316.jpg',	'image/jpeg',	6476,	NULL,	343,	'Animal foods',	'Bovines',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	89462,	1,	'FOOD00312'),
(317,	'Burbot',	'Lota lota',	'The burbot (Lota lota) or bubbot is the only gadiform (cod-like) freshwater fish. Also known as mariah, the lawyer, and (misleadingly) eelpout, the burbot is closely related to the marine common ling and the cusk. It is the only member of the genus Lota.',	'164725',	'Burbot',	'317.jpg',	'image/jpeg',	9234,	'2012-04-20 09:33:32',	344,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:32',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	69944,	1,	'FOOD00313'),
(318,	'Giant butterbur',	'Petasites japonicus',	'Petasites japonicus, also known as Fuki, bog rhubarb, or giant butterbur, is an herbaceous perennial plant in the family Asteraceae. It is native to Japan, where the spring growth is used as a vegetable. It has also been introduced to southern British Columbia by Japanese immigrants.',	'36057',	'Petasites japonicus',	'318.jpg',	'image/jpeg',	298431,	'2012-04-20 09:33:48',	345,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:33',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	186965,	1,	'FOOD00314'),
(319,	'American butterfish',	'Peprilus triacanthus',	'The American butterfish, Peprilus triacanthus, is a butterfish of the family Stromateidae. It is also known as a dollarfish, shiner, skipjack, sheepshead, or harvestfish.',	'172567',	'American butterfish',	'319.jpg',	'image/jpeg',	2027,	'2012-04-20 09:29:16',	346,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:34',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	183653,	1,	'FOOD00315'),
(320,	'Butternut',	'Juglans cinerea',	'Juglans cinerea, commonly known as Butternut or White Walnut, is a species of walnut native to the eastern United States and southeast Canada.\nJuglans cinerea is a deciduous tree growing to 20 metres (66 ft) tall, rarely 40 metres (130 ft). Butternut grows quickly, but is rather short-lived for a tree, rarely living longer than 75 years. It has a 40?80 cm stem diameter, with light gray bark.\nThe leaves are pinnate, 40?70 cm long, with 11?17 leaflets, each leaflet 5?10 cm long and 3?5 cm broad. The whole leaf is downy-pubescent, and a somewhat brighter, yellower green than many other tree leaves.\nThe fruit is a nut, produced in bunches of 2?6 together; the nut is oblong-ovoid, 3?6 cm long and 2?4 cm broad, surrounded by a green husk before maturity in mid autumn.',	'19250',	'Juglans_cinerea',	'320.jpg',	'image/jpeg',	194424,	'2012-04-20 09:38:06',	347,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	91214,	1,	'FOOD00316'),
(321,	'Butternut squash',	'Cucurbita moschata',	'Butternut squash, also known in Australia and New Zealand as butternut pumpkin, is a type of winter squash. It has a sweet, nutty taste similar to that of a pumpkin. It has yellow skin and orange fleshy pulp. When ripe, it turns increasingly deep orange, and becomes sweeter and richer. It grows on a vine. The most popular variety, the Waltham Butternut, originated in Waltham, Massachusetts, where it was developed at the Waltham Experiment Station by Robert E. Young. Dorothy Leggett, widow of Charles Leggett, claims that the Waltham Butternut squash was developed by her husband, Charles Leggett, in Stow, Massachusetts and then subsequently introduced by him to the researchers at the Waltham Field Station.',	'22370',	'Butternut squash',	'321.jpg',	'image/jpeg',	90782,	'2012-04-20 09:38:33',	348,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:22',	NULL,	NULL,	0,	'specific',	3662,	1,	'FOOD00317'),
(322,	'Calabash',	'Lagenaria siceraria',	'Lagenaria siceraria (synonym Lagenaria vulgaris Ser. ), bottle gourd, opo squash or long melon is a vine grown for its fruit, which can either be harvested young and used as a vegetable, or harvested mature, dried, and used as a bottle, utensil, or pipe. For this reason, the calabash is widely known as the bottle gourd. The fresh fruit has a light green smooth skin and a white flesh. Rounder varieties are called calabash gourds. They come in a variety of shapes, they can be huge and rounded, or small and bottle shaped, or slim and more than a meter long. The calabash was one of the first cultivated plants in the world, grown not primarily for food, but for use as a water container. The bottle gourd may have been carried from Africa to Asia, Europe and the Americas in the course of human migration. It shares its common name with that of the calabash tree.',	'22386',	'Calabash',	'322.jpg',	'image/jpeg',	66898,	'2012-04-20 09:41:07',	349,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	3668,	1,	'FOOD00318'),
(323,	'Cardoon',	'Cynara cardunculus',	'The cardoon (Cynara cardunculus), also called the artichoke thistle, cardone, cardoni, carduni or cardi, is a thistle-like plant in the family Asteraceae. It is the naturally occurring form of the same species as the globe artichoke, and has many cultivated varieties. It is native to the western and central Mediterranean region, where it was domesticated in ancient times.',	'37221',	'Cardoon',	'323.jpg',	'image/jpeg',	148506,	'2012-04-20 09:41:42',	350,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	4265,	1,	'FOOD00319'),
(325,	'Natal plum',	'Carissa macrocarpa',	'Carissa macrocarpa (Natal Plum), is a shrub native to South Africa, where it is commonly called the Large Num-Num. In Zulu, as well as in the Bantu tribes of Uganda, it is called amatungulu. In Afrikaans the fruit is called Noem-Noem. C. macrocarpa deals well with salt-laden winds, making it a good choice for coastal areas. It is commonly found in the coastal bush of the Eastern Cape and Natal. It produces shiny, deep green leaves and snowy white flowers whose perfumed scent intensifies at night. Like other Carissa species, C. macrocarpa is a spiny, evergreen shrub containing latex. They bloom for months at a time. The ornamental plump, round, crimson fruit appears in summer and fall (autumn) at the same time as the blooms. In moderate, coastal areas the fruits appear through the year. The fruit can be eaten out of hand or made into pies, jams, jellies, and sauces. Some claim that other than the fruit, the plant is poisonous. However this claim is a myth, possibly based on similarities to other plants with milky sap. The California Poison Control System rates the plant as mildly toxic. It appears in the South African National tree list as number 640.3. A traditional food plant in Africa, this little-known fruit has potential to improve nutrition, boost food security, foster rural development and support sustainable landcare.',	'501290',	'Carissa macrocarpa',	'325.jpg',	'image/jpeg',	138161,	'2012-04-20 09:39:20',	352,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	403101,	1,	'FOOD00320'),
(326,	'Carob',	'Ceratonia siliqua',	'Ceratonia siliqua, commonly known as the carob tree and St John\'s-bread, is a species of flowering evergreen shrub or tree in the pea family, Fabaceae. It is widely cultivated for its edible pods, and as an ornamental tree in gardens. The ripe, dried pod is often ground to carob powder which is used as a substitute for cocoa powder.',	'26531',	'Carob',	'326.jpg',	'image/jpeg',	39324,	'2012-04-20 09:33:23',	353,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	20340,	1,	'FOOD00321'),
(327,	'Common carp',	'Cyprinus carpio',	'The common carp (Cyprinus carpio) is a widespread freshwater fish of eutrophic waters in lakes and large rivers in Europe and Asia. The wild populations are considered vulnerable to extinction, but the species has also been domesticated and introduced into environments worldwide, and is often considered an invasive species. It gives its name to the carp family: Cyprinidae. It is on the List of the world\'s 100 worst invasive species.',	'163344',	'Common carp',	'327.jpg',	'image/jpeg',	48605,	'2012-04-20 09:34:07',	354,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	7962,	1,	'FOOD00322'),
(328,	'Cassava',	'Manihot esculenta',	'Cassava (also called yuca, mogo, or manioc) is a woody shrub cultivated in tropical and subtropical regions for its edible starchy tuberous root, a major source of carbohydrates. It differs from the similarly-spelled yucca, an unrelated fruit-bearing plant. Cassava, when dried to a starchy, powdery (or pearly) extract is called tapioca, while its fermented, flaky version is named garri. [Wikipedia]',	'503688',	'Cassava',	'328.jpg',	'image/jpeg',	632115,	'2012-04-20 09:37:15',	355,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	2,	0,	'specific',	3983,	1,	'FOOD00323'),
(329,	'Channel catfish',	'Ictalurus punctatus',	'Channel catfish, Ictalurus punctatus, is North America\'s most numerous catfish species. It is the official fish of Missouri, Iowa, Nebraska, Kansas, and Tennessee, and is informally referred to as a \"channel cat\". In the United States, they are the most fished catfish species with approximately 8 million anglers targeting them per year. The popularity of channel catfish for food has contributed to the rapid growth of aquaculture of this species in the United States.',	'163998',	'Channel_catfish',	'329.jpg',	'image/jpeg',	113579,	'2012-04-20 09:35:15',	356,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	7998,	1,	'FOOD00324'),
(330,	'Chayote',	'Sechium edule',	'The chayote (Sechium edule), also known as christophene or christophine, cho-cho, mirliton or merleton, chuchu, centinarja, pear squash, vegetable pear, chouchoute, choko, pipinola, güisquil (El Salvador) is an edible plant belonging to the gourd family Cucurbitaceae, along with melons, cucumbers and squash. Chayote is originally native to Mexico or Central America where it grows abundantly and has little commercial value, and it has been introduced as a crop all over Latin America, and worldwide. The main growing regions are Brazil, Costa Rica and Veracruz, Mexico. Costa Rican chayotes are predominantly exported to the European Union, whereas Veracruz is the main exporter of chayotes to the United States. The word chayote is a Spanish derivative of the Nahuatl word chayohtli. Chayote was one of the many foods introduced to Europe by early explorers, who brought back a wide assortment of botanical samples. The Age of Conquest also spread the plant south from Mexico, ultimately causing it to be integrated into the cuisine of many other Latin American nations. The chayote fruit is used in mostly cooked forms. When cooked, chayote is usually handled like summer squash, it is generally lightly cooked to retain the crisp flavor. Though rare and often regarded as especially unpalatable and tough in texture, raw chayote may be added to salads or salsas, most often marinated with lemon or lime juice. Whether raw or cooked, chayote is a good source of amino acids and vitamin C. Although most people are familiar only with the fruit as being edible, the root, stem, seeds and leaves are as well. The tubers of the plant are eaten like potatoes and other root vegetables, while the shoots and leaves are often consumed in salads and stir fries, especially in Asia. Like other members of the gourd family, such as cucumbers, melons, and squash, chayote has a sprawling habit, and it should only be planted if there is plenty of room in the garden. The roots are also highly susceptible to rot, especially in containers, and the plant in general is finicky to grow. However, in Australia and New Zealand, it is an easily grown yard or garden plant, set on a chicken wire support or strung against a fence.',	'22441',	'Chayote',	'330.jpg',	'image/jpeg',	2713,	'2012-04-20 09:42:21',	357,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	184140,	1,	'FOOD00325'),
(331,	'Cherimoya',	'Annona cherimola',	'The cherimoya, also spelled chirimoya, is the fruit of the species Annona cherimola, which generally is thought to be native to the Andes, although an alternative hypothesis proposes Central America as the origin of cherimoya because many of its wild relatives occur in this area. Today cherimoya is grown throughout South Asia, Central America, South America, Southern California and southern Andalucia [La Axarquia].',	'506198',	'Cherimoya',	'331.jpg',	'image/jpeg',	381567,	'2012-04-20 09:35:54',	358,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	49314,	1,	'FOOD00326'),
(332,	'Chervil',	'Anthriscus cerefolium',	'Chervil (Anthriscus cerefolium), sometimes called garden chervil to distinguish it from similar plants also called chervil, or French parsley, is a delicate annual herb related to parsley. It is commonly used to season mild-flavoured dishes and is a constituent of the French herb mixture fines herbes.',	'29587',	'Chervil',	'332.jpg',	'image/jpeg',	104369,	'2012-04-20 09:43:39',	359,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	40888,	1,	'FOOD00327'),
(333,	'Chia',	'Salvia hispanica',	'Salvia hispanica, commonly known as chia, is a species of flowering plant in the mint family, Lamiaceae, native to central and southern Mexico and Guatemala. The 16th-century Codex Mendoza provides evidence that it was cultivated by the Aztec in pre-Columbian times; economic historians have suggested it was as important as maize as a food crop. It is still used in Paraguay, Bolivia, Argentina, Mexico and Guatemala, sometimes with the seeds ground or with whole seeds used for nutritious drinks and as a food source.',	'32718',	'Salvia_hispanica',	'333.jpg',	'image/jpeg',	91556,	'2012-04-20 09:42:43',	360,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	49212,	1,	'FOOD00328'),
(334,	'Chicken',	'Gallus gallus',	'The chicken (Gallus gallus domesticus) is a domesticated fowl, a subspecies of the Red Junglefowl. As one of the most common and widespread domestic animals, with a population of more than 24 billion in 2003, there are more chickens in the world than any other species of bird. Humans keep chickens primarily as a source of food, consuming both their meat and their eggs.',	'176086',	'Chicken',	'334.jpg',	'image/jpeg',	130613,	NULL,	361,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:23',	NULL,	2,	1,	'specific',	9031,	1,	'FOOD00329'),
(335,	'Chinese broccoli',	'Brassica alboglabra',	'Kai-lan (also written as gai-lan) is the Cantonese name for a vegetable that is also known as Chinese broccoli or Chinese kale. It is a leaf vegetable featuring thick, flat, glossy blue-green leaves with thick stems and a small number of tiny flower heads similar to those of broccoli. Broccoli and kai-lan belong to the same species Brassica oleracea, but kai-lan is in the group alboglabra [Latin albus+glabrus white and hairless]. Its flavor is very similar to that of broccoli, but slightly more bitter. It is also noticeably stronger. Broccolini is a hybrid between broccoli and kai-lan, produced by Mann Packing Company, Inc.',	'506218',	'Chinese_broccoli',	'335.jpg',	'image/jpeg',	29241,	'2012-04-20 09:35:42',	362,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	3714,	1,	'FOOD00330'),
(336,	'Chinese chestnut',	'Castanea mollissima',	'Castanea mollissima (Chinese chestnut) is a member of the family Fagaceae, and a species of chestnut native to China, Taiwan, and Korea.\nThe fruit is a densely spiny cupule 4?8 cm diameter, containing two or three glossy brown nuts; these are 2?3 cm diameter on wild trees. The scientific name mollissima derives from the softly downy shoots and young leaves.',	'501318',	'Chinese_chestnut',	'336.jpg',	'image/jpeg',	104623,	'2012-04-20 09:29:45',	363,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	60419,	1,	'FOOD00331'),
(337,	'Chinese water chestnut',	'Eleocharis dulcis',	'The Chinese water chestnut (Eleocharis dulcis; synonyms E. equisetina, E. indica, E. plantaginea, E. plantaginoides, E. tuberosa, E. tumida), more often called simply the water chestnut, is a grass-like sedge grown for its edible corms. The water chestnut is actually not a nut at all, but an aquatic vegetable that grows in marshes, underwater in the mud. It has tube-shaped, leafless green stems that grow to about 1.5 metres. The water caltrop, which is also referred to by the same name, is unrelated and often confused with the water chestnut.\nThe small, rounded corms have a crisp white flesh and can be eaten raw, slightly boiled, or grilled, and are often pickled or tinned. They are a popular ingredient in Chinese dishes. In China, they are most often eaten raw, sometimes sweetened. They can also be ground into a flour form used for making water chestnut cake, which is common as part of dim sum cuisine. They are unusual among vegetables for remaining crisp even after being cooked or canned, because their cell walls are cross-linked and strengthened by certain phenolic compounds, like oligomers of ferulic acid. This property is shared by other vegetables that remain crisp in this manner, including the tiger nut and lotus root.\nThe corms are rich in carbohydrates (about 90 percent by dry weight), especially starch (about 60 percent by dry weight), and are also a good source of dietary fiber, riboflavin, vitamin B6, potassium, copper, and manganese.\nIf eaten uncooked, the surface of the plants can transmit Fasciolopsiasis.',	'506699',	'Chinese_water_chestnut',	'337.jpg',	'image/jpeg',	93907,	'2012-04-20 09:30:00',	364,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:35',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	110284,	1,	'FOOD00332'),
(338,	'Garland chrysanthemum',	'Chrysanthemum coronarium',	'The garland chrysanthemum, Chrysanthemum coronarium or Leucanthemum coronarium, also known as chrysanthemum greens or edible chrysanthemum, is native to the Mediterranean and East Asia. It is a leaf vegetable in the genus Chrysanthemum, or by some botanists in Leucanthemum.',	'35796',	'Garland chrysanthemum',	'338.jpg',	'image/jpeg',	109697,	'2012-04-20 09:28:55',	365,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	99038,	1,	'FOOD00333'),
(339,	'Cisco',	'Coregonus artedi',	'Coregonus artedi, commonly known as the cisco, is a North American species of freshwater whitefish in the family Salmonidae. The number of species and definition of species limits in North American ciscoes is a matter of debate. Accordingly, Coregonus artedi may refer either in a narrow sense to one of the several types of cisco found e.g. in the Great Lakes, or in a broad sense to the complex of all ciscoes in continental North American lakes, Coregonus artedi sensu lato.',	'623384',	'Coregonus_artedi',	'339.jpg',	'image/jpeg',	46800,	'2012-04-20 09:32:20',	366,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	36181,	1,	'FOOD00334'),
(340,	'Nuttall cockle',	'Clinocardium nuttallii',	'Clinocardium nuttallii, common name Nuttall\'s cockle, or basket cockle, is a species of large edible saltwater clam, a marine bivalve mollusc in the family Cardiidae, the cockles. This species was used by the indigenous peoples of California as food.',	'80873',	'Clinocardium nuttallii',	'340.jpg',	'image/jpeg',	2003390,	'2012-04-20 09:40:01',	367,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	410350,	1,	'FOOD00335'),
(341,	'Coconut',	'Cocos nucifera',	'The coconut tree (Cocos nucifera), is a member of the family Arecaceae (palm family). It is the only accepted species in the genus Cocos. The term coconut can refer to the entire coconut palm, the seed, or the fruit, which, botanically, is a drupe, not a nut. The spelling cocoanut is an archaic form of the word. The term is derived from 16th-century Portuguese and Spanish coco, meaning \"head\" or \"skull\", from the three indentations on the coconut shell that resemble facial features.\nFound throughout the tropic and subtropic area, the coconut is known for its great versatility as seen in the many uses of its different parts. Coconuts are part of the daily diets of many people. Coconuts are different from any other fruits because they contain a large quantity of \"water\" and when immature they are known as tender-nuts or jelly-nuts and may be harvested for drinking. When mature, they still contain some water and can be used as seednuts or processed to give oil from the kernel, charcoal from the hard shell and coir from the fibrous husk. The endosperm is initially in its nuclear phase suspended within the coconut water. As development continues, cellular layers of endosperm deposit along the walls of the coconut, becoming the edible coconut \"flesh\". When dried, the coconut flesh is called copra. The oil and milk derived from it are commonly used in cooking and frying; coconut oil is also widely used in soaps and cosmetics. The clear liquid coconut water within is drinkable. The husks and leaves can be used as material to make a variety of products for furnishing and decorating. It also has cultural and religious significance in many societies that use it.',	'42451',	'Coconut',	'341.jpg',	'image/jpeg',	16406,	'2012-04-20 09:28:56',	368,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	13894,	1,	'FOOD00336'),
(342,	'Pacific cod',	'Gadus macrocephalus',	'The Pacific cod, Gadus macrocephalus, is an important commercial food species. It is also known as gray cod or grey cod, and grayfish or greyfish. It has three separate dorsal fins, and the catfish-like whiskers on its lower jaw. In appearance, it is similar to the Atlantic cod. A bottom dweller, it is found mainly along the continental shelf and upper slopes with a range around the rim of the North Pacific Ocean, from the Yellow Sea to the Bering Strait, along the Aleutian Islands, and south to about Los Angeles, down to the depths of 900 meters (~ 3000 feet). May grow up to 1 m (39\") and weigh up to 15 kg (33 lbs). It is found in huge schools.',	'164711',	'Pacific_cod',	'342.jpg',	'image/jpeg',	15897,	'2012-04-20 09:41:24',	369,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	80720,	1,	'FOOD00337'),
(343,	'Atlantic cod',	'Gadus morhua',	'The Atlantic cod (Gadus morhua) is a well-known benthopelagic fish belonging to the family Gadidae widely consumed by humans. It is also commercially known as cod, codling or haberdine.\nIn the western Atlantic Ocean, cod has a distribution north of Cape Hatteras, North Carolina, and around both coasts of Greenland and the Labrador Sea; in the eastern Atlantic, it is found from the Bay of Biscay north to the Arctic Ocean, including the Baltic Sea, the North Sea, Sea of the Hebrides, areas around Iceland and the Barents Sea.\nIt can grow to 2 meters in length and weigh up to 96 kilograms (212 lb). It can live for 25 years and usually attains sexual maturity between ages two and four,[4] but cod in the northeast Arctic can take as long as eight years to fully mature. Colouring is brown to green, with spots on the dorsal side, shading to silver ventrally. A lateral line is clearly visible. Its habitat ranges from the shoreline down to the continental shelf.',	'164712',	'Atlantic_cod',	'343.jpg',	'image/jpeg',	33912,	'2012-04-20 09:38:04',	370,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	8049,	1,	'FOOD00338'),
(344,	'Common octopus',	'Octopus vulgaris',	'The common octopus (Octopus vulgaris) is the most studied of all octopus species. Its range in the eastern Atlantic extends from the Mediterranean Sea and the southern coast of England to at least Senegal in Africa. It also occurs off the Azores, Canary Islands, and Cape Verde Islands. The species is also common in the Western Atlantic.',	'82603',	'Common octopus',	'344.jpg',	'image/jpeg',	74161,	'2012-04-20 09:33:51',	371,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	6645,	1,	'FOOD00339'),
(345,	'Corn salad',	'Valerianella locusta',	'Valerianella locusta is a small dicot annual plant of the family Valerianaceae. It is an edible salad green with a characteristic nutty flavor, dark green color, and soft texture. Common names include corn salad (or cornsalad), lamb\'s lettuce, mâche, fetticus, feldsalat, nut lettuce, field salad and rapunzel. In restaurants that feature French cooking, this salad green may be called doucette or raiponce, as an alternative to mâche, by which it is best known.',	'35392',	'Valerianella locusta',	'345.jpg',	'image/jpeg',	151143,	'2012-04-20 09:30:11',	372,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	59166,	1,	'FOOD00340'),
(346,	'Cottonseed',	'Gossypium',	'Cottonseed is the seed of the cotton plant (gossypium). The mature seeds are brown ovoids weighing about a tenth of a gram. By weight, they are 60% cotyledon, 32% coat and 8% embryonic root and shoot. These are 20% protein, 20% oil and 3.5% starch. Fibres grow from the seed coat to form a boll of cotton lint. The boll is a protective fruit and when the plant is grown commercially, it is stripped from the seed by ginning and the lint is then processed into cotton fibre. For every hundred weight of fibre, about one hundred and sixty weight of seeds are produced. The seeds are about 15% of the value of the crop and are pressed to make oil and used as animal feed. About 5% of the seeds are used to sow the next crop.',	'21709',	'Cottonseed',	'346.jpg',	'image/jpeg',	98408,	'2012-04-20 09:43:26',	373,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	3633,	1,	'FOOD00341'),
(347,	'Catjang pea',	'Vigna unguiculata ssp. cylindrica',	'Catjang (Vigna unguiculata subsp. cylindrica) is a subspecies of cowpea. The catjang plant is native to Africa, and is an erect densely branched shrubby perennial of Old World tropics. It now grows in other warm regions, as well. In the US, it is grown primarily as fodder, but elsewhere is used as a food crop. The name comes from Indonesian and Malay kacang, a generic word for beans and nuts.',	'524854',	'Vigna_unguiculata_subsp._cylindrica',	'347.jpg',	'image/jpeg',	74029,	'2012-04-20 09:36:53',	374,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	3840,	1,	'FOOD00342'),
(348,	'Malus (Crab apple)',	'Malus',	'Malus, apple, is a genus of about 30-55 species of small deciduous trees or shrubs in the family Rosaceae, including the domesticated orchard apple (M. domestica). The other species are generally known as crabapples, crab apples, crabs, or wild apples.\r\nThe genus is native to the temperate zone of the Northern Hemisphere.\r\nThe fruit is a globose pome, varying in size from 1-4 cm (0.39-1.57 in) diameter in most of the wild species, to 6 cm (2.4 in) in M. sylvestris sieversii, 8 cm (3.1 in) in M. domestica, and even larger in certain cultivated orchard apples. The centre of the fruit contains five carpels arranged star-like, each containing one or two seeds.',	'25254',	'Malus',	'348.jpg',	'image/jpeg',	14221,	'2012-04-20 09:44:02',	375,	'Fruits',	'Pomes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	1,	'specific',	3749,	1,	'FOOD00343'),
(349,	'Squashberry',	'Viburnum edule',	'Viburnum edule, the squashberry, mooseberry, pembina, pimbina, highbush cranberry, lowbush cranberry or moosomin in Cree language, is a small shrub species. It is native to Canada and the northern parts of the US. Fruit - raw or cooked. The fully ripe fruits are mildly acid with a pleasant taste. The ovoid fruit is about 8mm long and contains a single large seed. The fruit can also be dried for winter use. It is highly valued for jam. It is best before a frost and with the skin removed. ',	'35261',	'Squashberry',	'349.jpg',	'image/jpeg',	82261,	'2012-04-20 09:33:59',	376,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	237934,	1,	'FOOD00344'),
(350,	'Atlantic croaker',	'Micropogonias undulatus',	'Atlantic croaker (Micropogonias undulatus) belongs to the family Sciaenidae and is closely related to black drum (Pogonias cromis), silver perch (Bairdiella chrysoura), spot croaker (Leiostomus xanthurus), red drum (Sciaenops ocellatus), spotted seatrout (Cynoscion nebulosus), and weakfish (Cynoscion regalis). They are commonly found in sounds and estuaries from Massachusetts to the Gulf of Mexico. The names croaker and drum are descriptive of the noise the fish makes by vibrating strong muscles against its swim bladder, which acts as a resonating chamber, much like a drum. During spawning season (August to December), croakers turn a deep golden color, from this comes the name golden croaker. When full-grown (three to four years), croakers reach between 1-1/2 feet long and 4-5 pounds, but on average are 1/2-2 pounds. They have been used for food by Native Americans, and are found in shell middens.',	'169283',	'Atlantic croaker',	'350.jpg',	'image/jpeg',	15178,	'2012-04-20 09:41:41',	377,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	29154,	1,	'FOOD00345'),
(351,	'Cusk',	'Brosme brosme',	'The cusk or tusk, Brosme brosme, is a marine cod-like fish in the ling family Lotidae. It is the only species in the genus Brosme. Other common names include brismak, brosmius, torsk and moonfish. It is easily distinguished at a glance from other cod-like fish as it has only one dorsal fin. Also characteristic is the nature of the dorsal, caudal, and anal fins, they are continuous at the base but separated by very deep notches so that they are obviously distinct. It is distributed on both sides of the North Atlantic, mostly in moderately deep water. On the North American coast, it is regularly found southward to Cape Cod and occasionally off New Jersey. Its maximum range covers most of the North Atlantic, including the waters around Iceland and the Norwegian coast. It is also found on the Mid-Atlantic Ridge [Wikipedia]',	'164740',	'Cusk (fish)',	'351.jpg',	'image/jpeg',	51963,	'2012-04-20 09:28:50',	378,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	81638,	1,	'FOOD00346'),
(352,	'Cuttlefish',	'Sepiidae',	'Cuttlefish are marine animals of the order Sepiida. They belong to the class Cephalopoda, which also includes squid, octopuses, and nautiluses. \'Cuttle\' is a reference to their unique internal shell, the cuttlebone; and despite their name, cuttlefish are true mollusks. Cuttlefish have large, W-shaped pupils, eight arms, and two tentacles furnished with denticulated suckers, with which they secure their prey. They generally range in size from 15 to 25 cm (to in), with the largest species, Sepia apama, reaching 50 cm in mantle length and over 10.5 kg in weight. Cuttlefish eat small mollusks, crabs, shrimp, fish, octopuses, worms, and other cuttlefish. Their predators include dolphins, sharks, fish, seals, seabirds, and other cuttlefish. Their life expectancy is about one to two years. Recent studies indicate cuttlefish are among the most intelligent invertebrates. Cuttlefish also have one of the largest brain-to-body size ratios of all invertebrates. The \'cuttle\' in \'cuttlefish\' comes from the Old English word cudele, meaning \'cuttlefish\', which may be cognate with the Old Norse koddi (\'cushion\') and the Middle Low German küdel (\'pouch\'). The Greco-Roman world valued the cephalopod as a source of the unique brown pigment the creature releases from its siphon when it is alarmed. The word for it in both Greek and Latin, sepia, is now used to refer to a brown pigment in English.',	'82360',	'Cuttlefish',	'352.jpg',	'image/jpeg',	127345,	'2012-04-20 09:39:57',	379,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	6608,	1,	'FOOD00347'),
(353,	'Mule deer',	'Odocoileus',	'The mule deer (Odocoileus hemionus) is a deer indigenous to western North America; it is named for its ears, which are large like those of the mule. There are believed to be several subspecies, including the black-tailed deer. Unlike its cousin, the white-tailed deer (Odocoileus virginianus), mule deer are generally more associated with the land west of the Missouri River, and more specifically with the Rocky Mountain region of North America. Mule deer have also been introduced to Argentina.',	'180697',	'Mule deer',	'353.jpg',	'image/jpeg',	142724,	NULL,	380,	'Animal foods',	'Venison',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	9871,	1,	'FOOD00348'),
(354,	'Devilfish',	'Myoxocephalus',	'<i>Myoxocephalus</i> is a genus of fish in the sculpin family Cottidae. Most species live in marine waters, but there are also three freshwater species, including two that occupy northern lakes (<i>Myoxocephalus quadricornis</i> and <i>M. thompsonii</i>). The name is derived from Greek <i>myos</i> (muscle) and <i>kephale</i> (head). (Wikipedia)',	'167311',	'',	'354.jpg',	'image/jpeg',	130385,	'2012-04-20 09:44:24',	381,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:36',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	8095,	1,	'FOOD00349'),
(355,	'Dock',	'Rumex',	'The docks and sorrels, genus Rumex L., are a genus of about 200 species of annual, biennial and perennial herbs in the buckwheat family Polygonaceae.\nMembers of this family are very common perennial herbs growing mainly in the northern hemisphere, but various species have been introduced almost everywhere.\nSome are nuisance weeds (and are sometimes called dockweed or dock weed), but some are grown for their edible leaves.\nRumex species are used as food plants by the larvae of a number of Lepidoptera species.',	'20933',	'Rumex',	'355.jpg',	'image/jpeg',	134743,	'2012-04-20 09:41:54',	382,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	3618,	1,	'FOOD00350'),
(356,	'Dolphin fish',	'Coryphaena hippurus',	'The mahi-mahi or common dolphinfish (Coryphaena hippurus) is a surface-dwelling ray-finned fish found in off-shore temperate, tropical and subtropical waters worldwide. Also known widely as dorado, it is one of two members of the Coryphaenidae family, the other being the pompano dolphinfish.\nThe name mahi-mahi means very strong in Hawaiian. In other languages the fish is known as dorade coryphène, lampuga, llampuga, lampuka, lampuki, rakingo, calitos, or maverikos.',	'168791',	'Dolphin_fish',	'356.jpg',	'image/jpeg',	146856,	'2012-04-20 09:33:38',	383,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	34814,	1,	'FOOD00351'),
(357,	'Freshwater drum',	'Aplodinotus grunniens',	'The freshwater drum, Aplodinotus grunniens, is a fish endemic to North and Central America. It is the only species in the genus Aplodinotus. The freshwater drum is a member of the family Sciaenidae, and is the only North American member of the group that inhabits freshwater for its entire life. Its generic name, Aplodinotus, comes from Greek meaning \"single back\", and the specific epithet, grunniens, comes from a Latin word meaning \"grunting\". It is given to it because of the grunting noise that mature males make. This noise comes from a special set of muscles within the body cavity that vibrate against the swim bladder. The purpose of the grunting is unknown, but due to it being present in only mature males, it is assumed to be linked to spawning.\nThe drum typically weigh 5?15 lb (2.3?6.8 kg). The world record was caught on Nickajack Lake in Tennessee, and weighed in at 54 lb 8 oz (24.7 kg). The freshwater drum is gray or silvery in turbid waters and more bronze or brown colored in clearer waters. It is a deep bodied fish with a divided dorsal fin consisting of 10 spines and 29?32 rays. It is also called shepherd\'s pie, \"perch\", silver bass, gray bass, Gasper goo, Gaspergou, gou, grunt, grunter, grinder, wuss fish, and croaker, and is commonly known as sheephead or sheepshead in parts of Canada,[5] the United Kingdom, and the United States.',	'169364',	'Freshwater_drum',	'357.jpg',	'image/jpeg',	80971,	'2012-04-20 09:34:53',	384,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	225389,	1,	'FOOD00352'),
(358,	'Mallard duck',	'Anas platyrhynchos',	'\"The mallard or wild duck (Anas platyrhynchos) is a dabbling duck which breeds throughout the temperate and subtropical Americas, Europe, Asia, and North Africa, and has been introduced to New Zealand and Australia. This duck belongs to the subfamily Anatinae of the waterfowl family Anatidae. The male birds (drakes) have a glossy green head and are grey on wings and belly, while the females have mainly brown-speckled plumage. Mallards live in wetlands, eat water plants and small animals, and are gregarious. This species is the ancestor of most breeds of domestic ducks.\"',	'175063',	'Mallard_duck',	'358.jpg',	'image/jpeg',	164203,	NULL,	385,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:23',	NULL,	2,	0,	'specific',	8839,	1,	'FOOD00353'),
(359,	'Dungeness crab',	'Cancer magister',	'The Dungeness crab, Metacarcinus magister (formerly Cancer magister), is a species of crab that inhabits eelgrass beds and water bottoms on the west coast of North America. It typically grows to 20 cm across the carapace and is a popular seafood prized for its sweet and tender flesh. Its common name comes from the port of Dungeness, Washington.',	'98675',	'Dungeness crab',	'359.jpg',	'image/jpeg',	91158,	'2012-04-20 09:39:47',	386,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	29965,	1,	'FOOD00354'),
(360,	'Durian',	'Durio zibethinus',	'The durian is the fruit of several tree species belonging to the genus Durio and the family Malvacea (although some taxonomists place Durio in a distinct family, Durionaceae).\nRegarded by many people in southeast Asia as the \"king of fruits\", the durian is distinctive for its large size, strong odour, and formidable thorn-covered husk. The fruit can grow as large as 30 centimetres (12 in) long and 15 centimetres (6 in) in diameter, and it typically weighs one to three kilograms (2 to 7 lb). Its shape ranges from oblong to round, the colour of its husk green to brown, and its flesh pale yellow to red, depending on the species.\nThe edible flesh emits a distinctive odour that is strong and penetrating even when the husk is intact. Some people regard the durian as having a pleasantly sweet fragrance; others find the aroma overpowering and revolting. The smell evokes reactions from deep appreciation to intense disgust, and has been described variously as rotten onions, turpentine, and raw sewage. The persistence of its odour has led to the fruit\'s banishment from certain hotels and public transportation in Southeast Asia.',	'506099',	'Durian',	'360.jpg',	'image/jpeg',	2958035,	'2012-04-20 09:38:23',	387,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	66656,	1,	'FOOD00355'),
(361,	'Eastern oyster',	'Crassostrea virginica',	'The eastern oyster (Crassostrea virginica) — also called Atlantic oyster or Virginia oyster — is a species of true oyster native to the eastern seaboard and Gulf of Mexico coast of North America. It is also farmed in Puget Sound, Washington, where it is known as the Totten Inlet Virginica. Eastern oysters are and have been very popular commercially. Today, less than 1% of the original 17th century population (when the original colonists arrived) is thought to remain in the Chesapeake Bay and its tributaries, although population estimates from any era are uncertain. The eastern oyster is the state shellfish of Connecticut, its shell is the state shell of Virginia and Mississippi, and its shell in cabochon form is the state gem of Louisiana.',	'79872',	'Eastern oyster',	'361.jpg',	'image/jpeg',	105681,	'2012-04-20 09:43:18',	388,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	6565,	1,	'FOOD00356'),
(362,	'Freshwater eel',	'Anguilla',	'The Anguillidae are a family of fishes that contains the freshwater eels. The 19 species and six subspecies in this family are all in genus Anguilla. They are catadromous, meaning they spend their lives in freshwater rivers, lakes, or estuaries, and return to the ocean to spawn. The young eel larvae, called leptocephali, live only in the ocean and consume small particles called marine snow. They grow larger in size, and in their next growth stage they are called glass eels. At this stage they enter estuaries, and when they become pigmented they are known as elvers. Elvers travel upstream in freshwater rivers, where they grow to adulthood. Some details of eel reproduction are as yet unknown, and the discovery of the spawning area of the American and European eels in the Sargasso Sea is one of the more famous anecdotes in the history of Ichthyology (see Eel life history). The spawning areas of some other anguillid eels, such as the Japanese eel, and the giant mottled eel were also discovered recently in the western North Pacific Ocean.',	'161126',	'Freshwater_eel',	'362.jpg',	'image/jpeg',	139262,	'2012-04-20 09:38:49',	389,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	7935,	1,	'FOOD00357'),
(363,	'Elderberry',	'Sambucus',	'Sambucus (elder or elderberry) is a genus of flowering plants in the family Adoxaceae. It was formerly placed in the honeysuckle family, Caprifoliaceae, but was reclassified due to genetic evidence. It contains between 5 and 30 species of deciduous shrubs, small trees and herbaceous perennial plants.\nThe genus occurs in temperate to subtropical regions of the world. More widespread in the Northern Hemisphere, its Southern Hemisphere occurrence is restricted to parts of Australasia and South America. Many species are widely cultivated for their ornamental leaves, flowers and fruit.\nThe leaves are pinnate with 5?9 leaflets (rarely 3 or 11). Each leaf is 5?30 cm (2.0?11.8 in) long, and the leaflets have serrated margins. They bear large clusters of small white or cream-colored flowers in late spring; these are followed by clusters of small black, blue-black, or red berries (rarely yellow or white).',	'35315',	'Elderberry',	'363.jpg',	'image/jpeg',	106275,	'2012-04-20 09:42:33',	390,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	4201,	1,	'FOOD00358'),
(364,	'Elk',	'Cervus canadensis',	'The elk or wapiti (Cervus canadensis) is one of the largest species of the Cervidae or deer family in the world, and one of the largest land mammals in North America and eastern Asia. It was long believed to be a subspecies of the European red deer (Cervus elaphus), but evidence from a 2004 study of the mitochondrial DNA indicates that the two are distinct species.',	'180695',	'Elk',	'364.jpg',	'image/jpeg',	108570,	NULL,	391,	'Animal foods',	'Venison',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:23',	NULL,	NULL,	1,	'specific',	1574408,	1,	'FOOD00359'),
(365,	'Emu',	'Dromaius novaehollandiae',	'The emu (Dromaius novaehollandiae) is the largest bird native to Australia and the only extant member of the genus Dromaius. It is the second-largest extant bird in the world by height, after its ratite relative, the ostrich. There are three subspecies of emus in Australia. The emu is common over most of mainland Australia, although it avoids heavily populated areas, dense forest, and arid areas. The soft-feathered, brown, flightless birds reach up to 2 metres in height. They have long thin necks and legs. Emus can travel great distances at a fast, economical trot and, if necessary, can sprint at 50Â km/h . Their long legs allow them to take strides of up to 275 centimetres They are opportunistically nomadic and may travel long distances to find food; they feed on a variety of plants and insects, but have been known to go for weeks without food. Emus ingest stones, glass shards and bits of metal to grind food in the digestive system. They drink infrequently, but take in copious fluids when the opportunity arises. Emus will sit in water and are also able to swim. They are curious birds who are known to follow and watch other animals and humans. Emus do not sleep continuously at night but in several short stints sitting down. Emus use their strongly clawed feet as a defence mechanism. Their legs are among the strongest of any animal, allowing them to rip metal wire fences. They are endowed with good eyesight and hearing, which allows them to detect predators in the vicinity. The plumage varies regionally, matching the surrounding environment and improving its camouflage. The feather structure prevents heat from flowing into the skin, permitting Emus to be active during the midday heat. They can tolerate a wide range of temperatures and thermoregulate effectively. Males and females are hard to distinguish visually, but can be differentiated by the types of loud sounds they emit by manipulating an inflatable neck sac. Emus breed in May and June and are not monogamous; fighting among females for a mate is common. Females can mate several times and lay several batches of eggs in one season. The animals put on weight before the breeding season, and the male does most of the incubation, losing significant weight during this time as he does not eat. The eggs hatch after around eight weeks, and the young are nurtured by their fathers. They reach full size after around six months, but can remain with their family until the next breeding season half a year later. Emus can live between 10 and 20 years in the wild and are predated by dingos, eagles and hawks. They can jump and kick to avoid dingos, but against eagles and hawks, they can only run and swerve. The Tasmanian Emu and King Island Emu subspecies that previously inhabited Tasmania and King Island became extinct after the European settlement of Australia in 1788; and the distribution of the mainland subspecies has been influenced by human activities. Once common on the east coast, emus are now uncommon; by contrast, the development of agriculture and the provision of water for stock in the interior of the continent have increased the range of the emu in arid regions, and it is of Least Concern for conservation. They were a food and fuel source for indigenous Australians and early European settlers. Emus are farmed for their meat, oil, and leather. Emu is a lean meat and while it is often claimed by marketers that the oil has anti-inflammatory and anti-oxidative effects, this has not been scientifically verified in humans. The emu is an important cultural icon of Australia. It appears on the coat of arms, various coins, features prominently in Indigenous Australian mythology, and hundreds of places are named after the bird.',	'174385',	'Emu',	'365.jpg',	'image/jpeg',	90529,	NULL,	392,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	8790,	1,	'FOOD00360'),
(366,	'Oregon yampah',	'Perideridia oregana',	'Perideridia oregana is a species of flowering plant in the carrot family known by the common name Oregon yampah or Eppaw. It is native to Oregon and California in the western United States, where it grows in woodland and other habitat. This plant is quite variable in appearance. In general, it is a perennial herb 10 to 90 centimeters tall, its green to waxy-grayish erect stem growing from a cluster of small tubers. Leaves near the base of the plant have blades 3 to 30 centimeters long divided into a variable number of leaflets, which may be subdivided into smaller segments. The inflorescence is a compound umbel of many spherical clusters of small white flowers. These yield ribbed, oblong-shaped fruits 3 to 6 millimeters long.',	'29811',	'Perideridia oregana',	'366.jpg',	'image/jpeg',	24529,	'2012-04-20 09:40:33',	393,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	234866,	1,	'FOOD00361'),
(367,	'European anchovy',	'Engraulis encrasicolus',	'The European anchovy (Engraulis encrasicolus) is a forage fish somewhat related to the herring. Anchovies are placed in the family Engraulidae. It is easily distinguished by its deeply-cleft mouth, the angle of the gape being behind the eyes. The pointed snout extends beyond the lower jaw. The fish resembles a sprat in having a forked tail and a single dorsal fin, but the body is round and slender. The maximum length is 8 1/8 in (205 mm).',	'161831',	'European anchovy',	'367.jpg',	'image/jpeg',	110838,	'2012-04-20 09:41:30',	394,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:04:23',	NULL,	NULL,	0,	'specific',	184585,	1,	'FOOD00362'),
(368,	'European chestnut',	'Castanea sativa',	'Castanea sativa is a species of deciduous tree with an edible seed. It is commonly called sweet chestnut and marron. Originally native to southeastern Europe and Asia Minor, it is now widely dispersed throughout Europe and in some localities in temperate Asia. The tree is hardy, long-lived and well known for its chestnuts, which are used as an ingredient in cooking.',	'506541',	'Castanea sativa',	'368.jpg',	'image/jpeg',	224910,	'2012-04-20 09:41:56',	395,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	21020,	1,	'FOOD00363'),
(369,	'Turbot',	'Scophthalmus maximus',	'The turbot (Scophthalmus maximus) is a species of flatfish in the family Scophthalmidae. It is a demersal fish native to marine or brackish waters of the North Atlantic, Baltic Sea and the Mediterranean Sea.',	'616195',	'Turbot',	'369.jpg',	'image/jpeg',	88008,	'2012-04-20 09:44:27',	396,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	52904,	1,	'FOOD00364'),
(370,	'Fireweed',	'Chamerion angustifolium',	'Chamerion angustifolium, commonly known as Fireweed (mainly in North America), Great Willow-herb (some parts of Canada), or Rosebay Willowherb, is a perennial herbaceous plant in the willowherb family Onagraceae. It is native throughout the temperate Northern Hemisphere, including large parts of the boreal forests. This species has been placed in the genus Chamerion (sometimes, incorrectly, given as Chamaenerion) rather than Epilobium based on several morphological distinctions: spiral (rather than opposite or whorled) leaf arrangement; absence (rather than presence) of a hypanthium; subequal stamens (rather than stamens in two unequal whorls); zygomorphic (rather than actinomorphic) stamens and stigma. Under this taxonomic arrangement, Chamerion and Epilobium are monophyletic sister genera. Two subspecies are recognized as valid: Chamerion angustifolium ssp. angustifolium Chamerion angustifolium ssp. circumvagum',	'510756',	'Chamerion angustifolium',	'370.jpg',	'image/jpeg',	131367,	'2012-04-20 09:42:37',	397,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	13055,	1,	'FOOD00365'),
(371,	'Florida pompano',	'Trachinotus carolinus',	'The Florida pompano (Trachinotus carolinus) is a species of marine fish in the Trachinotus genus of the Carangidae family. It has a compressed body and short snout; coloration varies from blue-greenish silver on the dorsal areas and silver to yellow on the body and fins. It can be found along the western coast of the Atlantic Ocean, depending on the season, and is popular for both sport and commercial fishing. Most Florida pompano caught weigh less than 3 pounds and are less than 17 inches long, though the largest individuals weigh 8–9 pounds (&#160) and reach lengths of up to 26 inches . Because it is fast-growing and desirable for food, the pompano is one of the many fish that are currently being farmed through aquaculture. The Florida city of Pompano Beach is named after the Florida pompano.',	'168708',	'Florida pompano',	'371.jpg',	'image/jpeg',	59766,	'2012-04-20 09:38:58',	398,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:37',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	173342,	1,	'FOOD00366'),
(372,	'Ginkgo nuts',	'Ginkgo biloba',	'Ginkgo, also spelled gingko and known as the maidenhair tree, is a unique species of tree with no close living relatives. The ginkgo is a living fossil, recognisably similar to fossils dating back 270 million years. Native to China, the tree is widely cultivated and introduced early in human history, and has various uses as a food and in traditional medicine.',	'183269',	'Ginkgo biloba',	'372.jpg',	'image/jpeg',	125649,	'2012-04-20 09:35:38',	399,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	3311,	1,	'FOOD00367'),
(373,	'Greylag goose',	'Anser anser',	'\"The greylag goose (also spelled graylag in the United States), Anser anser, is a bird with a wide range in the Old World. It is the type species of the genus Anser. The greylag is the largest and bulkiest of the grey geese of the genus Anser. It has a rotund, bulky body, a thick and long neck, and a large head and bill. It has pink legs and feet, and an orange or pink bill.[2] It is 74 to 91 cm (29 to 36 in) long with a wing length of 41.2 to 48 cm (16.2 to 18.9 in). It has a tail 6.2 to 6.9 cm (2.4 to 2.7 in), a bill of 6.4 to 6.9 cm (2.5 to 2.7 in) long, and a tarsus of 7.1 to 9.3 cm (2.8 to 3.7 in). It weighs 2.16 to 4.56 kg (4.8 to 10.1 lb), with a mean weight of around 3.3 kg (7.3 lb). The wingspan is 147 to 180 cm (58 to 71 in). Males are generally larger than females, with the sexual dimorphism more pronounced in the eastern subspecies rubirostris, which is larger than the nominate subspecies on average.\"',	'175028',	'Greylag_goose',	'373.jpg',	'image/jpeg',	146695,	NULL,	400,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	8843,	1,	'FOOD00368'),
(374,	'Grape',	'Vitis',	'A grape is a fruiting berry of the deciduous woody vines of the botanical genus Vitis. Grapes can be eaten raw or they can be used for making wine, jam, juice, jelly, grape seed extract, raisins, vinegar, and grape seed oil. Grapes are a non-climacteric type of fruit, generally occurring in clusters.',	'28606',	'Grape',	'374.jpg',	'image/jpeg',	308314,	'2012-04-20 09:40:20',	401,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	3603,	1,	'FOOD00369'),
(375,	'Greenland halibut/turbot',	'Reinhardtius hippoglossoides',	'The Greenland halibut or Greenland turbot (Reinhardtius hippoglossoides) belongs to the Pleuronectidae family (the right eye flounders), and is the only species of the genus Reinhardtius. It is a deepwater fish distributed from 200 to 1600 m but has been caught at depths more than 2,200 m . It is mainly found in waters with temperatures from 1-4 °C, but has also observed at sub-zero temperatures down to -2.1 °C. It has a circumpolar distribution and is found in both the Atlantic and the Pacific oceans. Its morphology with the left eye positioned on the dorsal ridge of the forehead gives it an appearance of a cyclops when looking straight at it. The central position of the left eye in the Greenland halibut probably gives it a much wider range of peripheral vision in comparison to other flatfish where the eye has migrated completely. The body shape is elongated and compressed dorsal-ventrally and muscles on both sides are equally developed. Both sides are pigmented; however the left blind side is slightly lighter in color than the right side. Its physical appearance suggests it to be a vigorous swimmer that can swim in a vertical position. Vertical swimming has been observed during tagging experiments. However, video analyzing of Greenland halibut behavior in front of a bottom trawl showed no sign of swimming in a vertical position. Even though most Greenland halibut are caught in bottom fishing gears (trawl, longline and gillnet) they have also been caught in surface drift nets which indicates that they can have a pelagic occurrence. Stomach analysis has also shown that the diet consists mostly of pelagic or bathypelagic organisms. Even though the Greenland halibut is a flatfish it does at times behave more like a roundfish.',	'172930',	'Greenland halibut',	'375.jpg',	'image/jpeg',	68044,	'2012-04-20 09:31:59',	402,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	111784,	1,	'FOOD00370'),
(376,	'Groundcherry',	'Physalis',	'Physalis is a genus of plants in the nightshade family (Solanaceae), native to warm temperate and subtropical regions of the world. All but one species are native to the New World, and most species occur in Mexico in particular. At least 46 species are endemic to the country. The genus is characterised by the small orange fruit similar in size, shape and structure to a small tomato, but partly or fully enclosed in a large papery husk derived from the calyx. Many Physalis species are called groundcherries. One name for Physalis peruviana is Cape gooseberry, not to be confused with the true gooseberries, which are of the genus Ribes in the family Grossulariaceae.\nThey are herbaceous plants growing to 0.4 to 3 m tall, similar to the common tomato, a plant of the same family, but usually with a stiffer, more upright stem. They can be either annual or perennial. Most require full sun and fairly warm to hot temperatures. Some species are sensitive to frost, but others, such as the Chinese lantern, P. alkekengi, tolerate severe cold when dormant in winter.',	'30587',	'Groundcherry',	'376.jpg',	'image/jpeg',	100723,	'2012-04-20 09:35:52',	403,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	24663,	1,	'FOOD00371'),
(377,	'Grouper',	'Epinephelus',	'Groupers are fish of any of a number of genera in the subfamily Epinephelinae of the family Serranidae, in the order Perciformes.\nNot all serranids are called groupers; the family also includes the sea basses. The common name grouper is usually given to fish in one of two large genera: Epinephelus and Mycteroperca. In addition, the species classified in the small genera Anyperidon, Cromileptes, Dermatolepis, Gracila, Saloptia, and Triso are also called groupers. Fish in the genus Plectropomus are referred to as coralgroupers. These genera are all classified in the subfamily Epiphelinae. However, some of the hamlets (genus Alphestes), the hinds (genus Cephalopholis), the lyretails (genus Variola) and some other small genera (Gonioplectrus, Niphon, Paranthias) are also in this subfamily, and occasional species in other serranid genera have common names involving the word \"grouper\". Nonetheless, the word \"grouper\" on its own is usually taken as meaning the subfamily Epinephelinae.',	'167694',	'Grouper',	'377.jpg',	'image/jpeg',	62622,	'2012-04-20 09:30:40',	404,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:23',	NULL,	NULL,	0,	'specific',	94231,	1,	'FOOD00372'),
(378,	'Guinea hen',	'Numida meleagris',	'\"The guineafowl (sometimes called guineahen) are a family of birds in the Galliformes order, although some authorities (for example the American Ornithologists\' Union) include the guineafowl as a subfamily, Numidinae, of the family Phasianidae. The guineafowl are native to Africa, but the helmeted guineafowl has been domesticated, and both feral and wild-type birds have been introduced elsewhere. This family of insect- and seed-eating, ground-nesting birds resemble partridges, but with featherless heads, though both members of the genus Guttera have a distinctive black crest, and the vulturine guineafowl has a downy brown patch on the nape. Most species of guineafowl have a dark grey or blackish plumage with dense white spots, but both members of the genus Agelastes lack the spots (as do some domestic variants of the helmeted guineafowl). While several species are relatively well known, the plumed guineafowl and the two members of the genus Agelastes remain relatively poorly known. These large birds measure from 40?71 cm (16?28 inches) in length, and weigh 700?1600 grams or 1.5-3.5 pounds.\"',	'176126',	'Guinea_hen',	'378.jpg',	'image/jpeg',	176871,	NULL,	405,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8996,	1,	'FOOD00373'),
(379,	'Haddock',	'Melanogrammus aeglefinus',	'The haddock (Melanogrammus aeglefinus) is a marine fish distributed on both sides of the North Atlantic. Haddock is a popular food fish and is widely fished commercially.\nThe haddock is easily recognized by a black lateral line running along its white side (not to be confused with pollock which has the reverse, i.e. white line on black side) and a distinctive dark blotch above the pectoral fin, often described as a \"thumbprint\" or even the \"Devil\'s thumbprint\" or \"St. Peter\'s mark\".\nHaddock is most commonly found at depths of 40 to 133 m (131 to 436 ft), but has a range as deep as 300 m (980 ft). It thrives in temperatures of 2 to 10°C (36 to 50°F). Juveniles prefer shallower waters and larger adults deeper water. Generally, adult haddock do not engage in long migratory behaviour as do the younger fish, but seasonal movements have been known to occur across all ages. Haddock feed primarily on small invertebrates, although larger members of the species may occasionally consume fish.',	'164744',	'Haddock',	'379.jpg',	'image/jpeg',	5814,	'2012-04-20 09:31:17',	406,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8056,	1,	'FOOD00374'),
(380,	'Hippoglossus (Common halibut)',	'Hippoglossus',	'Hippoglossus is a genus of righteye flounders with one species native to the Atlantic Ocean and one to the Pacific Ocean.',	'172931',	'Hippoglossus',	'380.jpg',	'image/jpeg',	59479,	'2012-04-20 09:30:42',	407,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8266,	1,	'FOOD00375'),
(381,	'Hazelnut',	'Corylus',	'A hazelnut is the nut of the hazel and is also known as cobnut or filbert nut according to species. A cob is roughly spherical to oval, about 15–25 mm long and 10–15 mm in diameter, with an outer fibrous husk surrounding a smooth shell. A filbert is more elongated, being about twice as long as it is round. The nut falls out of the husk when ripe, about seven to eight months after pollination. The kernel of the seed is edible and used raw or roasted, or ground into a paste. Hazelnuts are also used for livestock feed, as are chestnuts and acorns. The seed has a thin, dark brown skin, which is sometimes removed before cooking. Hazelnuts are produced in commercial quantities in Turkey, Italy, Greece, Georgia, in south of the Spanish region of Catalonia, in the UK county of Kent and in the American states of Oregon and Washington. Turkey is the largest producer of hazelnuts in the world with approximately 75% of worldwide production. Hazelnuts are used in confectionery to make praline, and also used in combination with chocolate for chocolate truffles and products such as Nutella and Frangelico liqueur. Hazelnut oil, pressed from hazelnuts, is strongly flavoured and used as a cooking oil. Hazelnuts are rich in protein and unsaturated fat. Moreover, they contain significant amounts of thiamine and vitamin B6, as well as smaller amounts of other B vitamins.',	'19505',	'Hazelnut',	'381.jpg',	'image/jpeg',	457813,	'2012-04-20 09:40:00',	408,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	13450,	1,	'FOOD00376'),
(382,	'Hickory nut',	'Carya',	'Hickory (from Powhatan) is a type of tree, comprising the genus Carya (Ancient Greek: κάρυον \"nut\"). The genus includes 17?19 species of deciduous trees with pinnately compound leaves and big nuts. Five or six species are native to China, Indochina, and India (State of Assam), 11 or 12 are from the United States, two to four are from Canada and four are found in Mexico. Hickory flowers are small, yellow-green catkins produced in spring. They are wind-pollinated and self-incompatible. The fruit is a globose or oval nut, 2-5 cm (0.79-1.97 in) long and 1.5-3 cm (0.59-1.18 in) diameter, enclosed in a four-valved husk, which splits open at maturity. The nut shell is thick and bony in most species, and thin in a few, notably C. illinoinensis; it is divided into two halves, which split apart when the seed germinates.',	'19223',	'Hickory_nut',	'382.jpg',	'image/jpeg',	52091,	'2012-04-20 09:29:44',	409,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	13402,	1,	'FOOD00377'),
(383,	'Horse',	'Equus caballus',	'The horse (Equus ferus caballus) is one of two extant subspecies of Equus ferus. It is an odd-toed ungulate mammal belonging to the taxonomic family Equidae. The horse has evolved over the past 45 to 55 million years from a small multi-toed creature into the large, single-toed animal of today. Humans began to domesticate horses around 4000 BC, and their domestication is believed to have been widespread by 3000 BC. Horses in the subspecies caballus are domesticated, although some domesticated populations live in the wild as feral horses. These feral populations are not true wild horses, as this term is used to describe horses that have never been domesticated, such as the endangered Przewalski\'s horse, a separate subspecies, and the only remaining true wild horse. There is an extensive, specialized vocabulary used to describe equine-related concepts, covering everything from anatomy to life stages, size, colors, markings, breeds, locomotion, and behavior.',	'180691',	'Horse',	'383.jpg',	'image/jpeg',	104049,	NULL,	410,	'Animal foods',	'Equines',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	9796,	1,	'FOOD00378'),
(384,	'Horseradish tree',	'Moringa oleifera',	'Moringa oleifera is the most widely cultivated species of the genus Moringa, which is the only genus in the family Moringaceae. English common names include: moringa, drumstick tree (from the appearance of the long, slender, triangular seed-pods), horseradish tree (from the taste of the roots, which resembles horseradish), ben oil tree or benzoil tree (from the oil which is derived from the seeds). It is a fast-growing, drought-resistant tree, native to the southern foothills of the Himalayas in northwestern India, and widely cultivated in tropical and sub-tropical areas where its young seed pods and leaves are used as a vegetable.',	'503874',	'Horseradish_tree',	'384.jpg',	'image/jpeg',	189387,	'2012-04-20 09:41:23',	411,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3735,	1,	'FOOD00379'),
(385,	'Alaska blueberry',	'Vaccinium alaskaense',	'Vaccinium ovalifolium (commonly known as Alaska blueberry, early blueberry, oval-leaf bilberry, oval-leaf blueberry, and oval-leaf huckleberry) is a plant in the heath family having three varieties, all of which grow in northerly regions, including the subarctic.\nVaccinium ovalifolium is used by in jams and jellies and for making liqueur. Blueberry herbal tea can be made from the leaves, or from the juice of the blueberries themselves.',	'23576',	'Alaska_blueberry',	'385.jpg',	'image/jpeg',	47000,	'2012-04-20 09:34:14',	412,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	190544,	1,	'FOOD00380'),
(386,	'Hyacinth bean',	'Lablab purpureus',	'Lablab purpureus, commonly known as the hyacinth bean, Indian bean, calavance, seim, Egyptian bean, njahi, bulay, bataw, a species of bean in the family Fabaceae, is widespread as a food crop throughout the tropics, especially in Africa, India, Bangladesh, and Indonesia. A traditional food plant in Africa, this little-known vegetable in the West has potential to improve nutrition, boost food security, foster rural development and support sustainable landcare.',	'503300',	'Lablab purpureus',	'386.jpg',	'image/jpeg',	111151,	'2012-04-20 09:33:00',	413,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	35936,	1,	'FOOD00381'),
(387,	'Irish moss',	'Chondrus crispus',	'Chondrus crispus ? commonly called Irish moss or carrageen moss (Irish carraigín, \"little rock\") ? is a species of red algae which grows abundantly along the rocky parts of the Atlantic coast of Europe and North America. In its fresh condition this protist is soft and cartilaginous, varying in color from a greenish-yellow, through red, to a dark purple or purplish-brown. The principal constituent is a mucilaginous body, made of the polysaccharide carrageenan which comprises about 55% by weight. The organism also consists of nearly 10% protein and about 15% mineral matter, and is rich in iodine and sulfur. When softened in water it has a sea-like odour and because of the abundant cell wall polysaccharides it will form a jelly when boiled, containing from 20 to 100 times its weight of water.',	'12092',	'Chondrus_crispus',	'387.jpg',	'image/jpeg',	150815,	'2012-04-20 09:41:13',	414,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	2769,	1,	'FOOD00382'),
(388,	'Pacific jack mackerel',	'Trachurus symmetricus',	'The Pacific jack mackerel,Trachurus symmetricus (also known as the Californian jack mackerel or simply jack mackerel), is an abundant species of pelagic marine fish in the jack family, Carangidae. The species is distributed along the western coast of North America, ranging from Alaska in the north to the Gulf of California in the south, inhabiting both offshore and inshore environments. The Pacific jack mackerel is a moderately large fish, growing to a maximum recorded length of 81 cm, although commonly seen below 55 cm. It is very similar in appearance to other members of its genus, Trachurus, especially Trachurus murphyi, which was once thought to be a subspecies of T. symmetricus, and inhabits waters further south. Pacific jack mackerel travel in large schools, ranging up to 600 miles offshore and to depths of 400 m, generally moving through the upper part of the water column.',	'168586',	'Pacific jack mackerel',	'388.jpg',	'image/jpeg',	69927,	'2012-04-20 09:40:14',	415,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:38',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	271940,	1,	'FOOD00383'),
(389,	'Jackfruit',	'Artocarpus heterophyllus',	'The jackfruit (alternately jack tree, jakfruit, or sometimes simply jack or jak; scientific name Artocarpus heterophyllus), is a species of tree in the Artocarpus genus of the mulberry family. It is native to parts of South and Southeast Asia, and is believed to have originated in the southwestern rain forests of India, in present-day Kerala, coastal Karnataka and Maharashtra. The jackfruit tree is well suited to tropical lowlands, and its fruit is the largest tree-borne fruit, reaching as much as 80 pounds in weight and up to 36 inches long and 20 inches in diameter. The jackfruit tree is widely cultivated in tropical regions of India, Bangladesh, Nepal, Sri Lanka, Vietnam, Thailand, Malaysia, Indonesia, and the Philippines. Jackfruit is also found in East Africa, e.g. , in Uganda, Tanzania, and Mauritius, as well as throughout Brazil and Caribbean nations such as Jamaica.',	'184183',	'Jackfruit',	'389.jpg',	'image/jpeg',	130285,	'2012-04-20 09:33:28',	416,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3489,	1,	'FOOD00384'),
(390,	'Japanese chestnut',	'Castanea crenata',	'Japanese Chestnut (Castanea crenata) is a species of chestnut originally native to Japan and South Korea. It is a small to medium-sized deciduous tree growing to 10-15 m tall. The leaves are similar to those of the Sweet Chestnut, though usually a little smaller, 8-19 cm long and 3-5 cm broad. The flowers of both sexes are borne in 7-20 cm long, upright catkins, the male flowers in the upper part and female flowers in the lower part. They appear in summer, and by autumn, the female flowers develop into spiny cupules containing 3-7 brownish nuts that are shed during October.',	'506540',	'Japanese Chestnut',	'390.jpg',	'image/jpeg',	143368,	'2012-04-20 09:44:15',	417,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	103480,	1,	'FOOD00385'),
(391,	'Java plum',	'Syzygium cumini',	'Syzygium cumini, jambul, jambolan, jamblang, or jamun, is an evergreen tropical tree in the flowering plant family Myrtaceae. Syzygium cumini is native to Bangladesh, India, Nepal, Pakistan, Sri Lanka, Malaysia, the Philippines, and Indonesia. The name of the fruit is sometimes mistranslated as blackberry, which is a different fruit in an unrelated family.\nThe tree was introduced to Florida, USA in 1911 by the USDA, and is also now commonly grown in Suriname and Trinidad and Tobago. In Brazil, where it was introduced from India during Portuguese colonization, it has dispersed spontaneously in the wild in some places, as its fruits are eagerly sought by various native birds such as thrushes, tanagers and the Great Kiskadee. This species is considered an invasive in Hawaii, USA. It is also illegal to grow, plant or transplant in Sanibel, Florida.\nThe fruits develop by May or June and resemble large berries. The fruit is oblong, ovoid, starts green and turns pink to shining crimson black as it matures. A variant of the tree produces white coloured fruit. The fruit has a combination of sweet, mildly sour and astringent flavour and tends to colour the tongue purple.',	'505419',	'Syzgium_cumini',	'391.jpg',	'image/jpeg',	30417,	'2012-04-20 09:43:27',	418,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	260142,	1,	'FOOD00386'),
(392,	'Jerusalem artichoke',	'Helianthus tuberosus',	'The Jerusalem artichoke (Helianthus tuberosus), also called sunroot, sunchoke, earth apple or topinambour, is a species of sunflower native to eastern North America, and found from eastern Canada and Maine west to North Dakota, and south to northern Florida and Texas. It is also cultivated widely across the temperate zone for its tuber, which is used as a root vegetable.',	'36691',	'Jerusalem artichoke',	'392.jpg',	'image/jpeg',	67392,	'2012-04-20 09:30:47',	419,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	4233,	1,	'FOOD00387'),
(393,	'Jujube',	'Ziziphus zizyphus',	'Ziziphus jujuba (from Greek ζίζυφον, zízyphon), commonly called jujube (sometimes jujuba), red date, Chinese date, Korean date, or Indian date is a species of Ziziphus in the buckthorn family (Rhamnaceae), used primarily as a shade tree that also bears fruit.\r\nThe fruit is an edible oval drupe 1.5-3 centimetres (0.59-1.18 in) deep; when immature it is smooth-green, with the consistency and taste of an apple, maturing brown to purplish-black and eventually wrinkled, looking like a small date. There is a single hard stone similar to an olive stone.',	'28598',	'Jujube',	'393.jpg',	'image/jpeg',	369552,	'2012-04-20 09:30:50',	420,	'Fruits',	'Other fruits',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	48393,	1,	'FOOD00388'),
(394,	'Jute',	'Corchorus olitorius',	'Jute is a long, soft, shiny vegetable fiber that can be spun into coarse, strong threads. It is produced from plants in the genus Corchorus, which was once classified with the family Tiliaceae, more recently with Malvaceae, and has now been reclassified as belonging to the family Sparrmanniaceae. \"Jute\" is the name of the plant or fiber that is used to make burlap, Hessian or gunny cloth.\nIn Nigeria, leaves of Corchorus olitorius are prepared in sticky soup called ewedu together with ingredients such as sweet potato, dried small fish or shrimp. The leaves are rubbed until foamy or sticky before adding to the soup. The leaves of the Jute plant are widely used in Nigeria, to prepare a sticky soup. Amongst the Yoruba of Nigeria, the leaves are called Ewedu, and in the hausa speaking northern Nigeria, the leaves are called turgunuwa, or, lallo. The jute leaves are cut into shreds and added to the soup which would normally contain other ingredients such as meat, and/or fish, pepper, onions, and other spices. Likewise, the Lugbara of Northwestern Uganda eat the leaves as soup, locally called pala bi. Jute is also a totem for Ayivu, one of the Lugbara clans.',	'21516',	'Jute',	'394.jpg',	'image/jpeg',	101062,	'2012-04-20 09:38:18',	421,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	93759,	1,	'FOOD00389'),
(395,	'Kale',	'Brassica napus var. pabularia',	'Kale or borecole is a form of cabbage, with green or purple leaves, in which the central leaves do not form a head. It is considered to be closer to wild cabbage than most domesticated forms. The species Brassica oleracea contains a wide array of vegetables, including broccoli, cauliflower, collard greens, and brussels sprouts. The cultivar group Acephala also includes spring greens and collard greens, which are extremely similar genetically.',	'530956',	'Kale',	'395.jpg',	'image/jpeg',	82699,	'2012-04-20 09:43:22',	422,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00390'),
(396,	'Kelp',	'Laminaria',	'Kelps are large seaweeds (algae) belonging to the brown algae (Phaeophyceae) in the order Laminariales. There are about 30 different genera.\nKelp grows in underwater \"forests\" (kelp forests) in shallow oceans, and is thought to have appeared in the Miocene, 23 to 5 million years ago. The organisms require nutrient-rich water with temperatures between 6 and 14 °C (43 and 57 °F). They are known for their high growth rate ? the genera Macrocystis and Nereocystis can grow as fast as half a metre a day, ultimately reaching 30 to 80 metres (100 to 260 ft).\nThrough the 19th century, the word \"kelp\" was closely associated with seaweeds that could be burned to obtain soda ash (primarily sodium carbonate). The seaweeds used included species from both the orders Laminariales and Fucales. The word \"kelp\" was also used directly to refer to these processed ashes.',	'11217',	'Kelp',	'396.jpg',	'image/jpeg',	180039,	'2012-04-20 09:32:35',	423,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	33637,	1,	'FOOD00391'),
(397,	'King mackerel',	'Scomberomorus cavalla',	'The king mackerel (Scomberomorus cavalla) is a migratory species of mackerel of the western Atlantic Ocean and Gulf of Mexico. It is an important species to both the commercial and recreational fishing industries.\nThe king mackerel is a medium-sized fish, typically encountered from five to 30 pounds, but is known to exceed 90 pounds. The entire body is covered with very small, hardly visible, loosely attached scales. The first (spiny) dorsal fin is entirely colorless and is normally folded back into a body groove, as are the pelvic fins. The lateral line starts high on the shoulder, dips abruptly at mid-body and then continues as a wavy horizontal line to the tail. Coloration is olive on the back, fading to silver with a rosy iridescence on the sides, fading to white on the belly. Fish under 10 pounds (5 kg) show yellowish-brown spots on the flanks, somewhat smaller than the spots of the Atlantic Spanish mackerel, Scomberomorus maculatus. Its cutting-edged teeth are large, uniform, closely spaced and flattened from side to side. These teeth look very similar to those of the bluefish, Pomatomus saltatrix.',	'172435',	'King_mackerel',	'397.jpg',	'image/jpeg',	115991,	'2012-04-20 09:42:53',	424,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	13679,	1,	'FOOD00392'),
(398,	'Kumquat',	'Fortunella',	'Kumquats or cumquats are a group of small fruit-bearing trees in the flowering plant family Rutaceae, either forming the genus Fortunella, or placed within Citrus sensu lato. The edible fruit closely resembles that of the orange (Citrus sinensis), but it is much smaller and ovular, being approximately the size and shape of a large olive. The English name \"kumquat\" derives from the Cantonese pronunciation gam1 gwat1 (given in Jyutping romanization).',	'500284',	'Kumquat',	'398.jpg',	'image/jpeg',	39961,	'2012-04-20 09:41:58',	425,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	2706,	1,	'FOOD00393'),
(399,	'Lambsquarters',	'Chenopodium album',	'Chenopodium album is a fast-growing weedy annual plant in the genus Chenopodium. Though cultivated in some regions, the plant is elsewhere considered a weed. Common names include lamb\'s quarters, melde, goosefoot and fat-hen, though the latter two are also applied to other species of the genus Chenopodium, for which reason it is often distinguished as white goosefoot. It is sometimes also called pigweed, although that name is often also used for Amaranthus albus. Chenopodium album is extensively cultivated and consumed in Northern India as a food crop, and in English texts it may be called by its Hindi name bathua or bathuwa.',	'20592',	'Chenopodium album',	'399.jpg',	'image/jpeg',	71195,	'2012-04-20 09:41:50',	426,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3559,	1,	'FOOD00394'),
(400,	'Leather chiton',	'Katharina tunicata',	'Katharina tunicata (Wood, 1815) is commonly known as the Black Katy chiton, Black Leather chiton, Black chiton, or Leather chiton. Capable of growing up to 12 cm, the animal is generally described as being football-shaped with a black leathery girdle in which are embedded eight protective plates. The parts of the plates that are visible are sometimes (but not always) diamond-shaped in outline. The underside of the animal is dull orange or yellow.',	'78979',	'Katharina tunicata',	'400.jpg',	'image/jpeg',	100721,	'2012-04-20 09:32:36',	427,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	34587,	0,	'FOOD00395'),
(401,	'Wild leek',	'Allium ampeloprasum',	'Allium ampeloprasum is a member of the onion genus Allium. The wild plant is commonly known as wild leek or broadleaf wild leek. Its native range is southern Europe to western Asia, but it is cultivated in many other places and has become naturalized in many countries.\nAllium ampeloprasum has been differentiated into three cultivated vegetables, namely leek, elephant garlic and kurrat. In tidewater Virginia, the plant is commonly known as the \"Yorktown Onion.\"\nWild populations produce bulbs up to 3 cm across. Scapes are round in cross-section, each up to 180 cm tall, bearing an umbel of as many as 500 flowers. Flowers are urn-shaped, up to 6 mm across; tepals white, pink or red; anthers yellow or purple; pollen yellow.',	'42708',	'Allium_ampeloprasum',	'401.jpg',	'image/jpeg',	24526,	'2012-04-20 09:39:25',	428,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	4681,	1,	'FOOD00396'),
(402,	'Common ling',	'Molva molva',	'The common ling or simply the ling, Molva molva, is a large member of a family of cod-like fishes. An ocean fish whose habitat is in the Atlantic region and can be found around Iceland, Faroe Islands, British Isles, the Norse coast and occasionally around Newfoundland, the ling has a long slender body that can reach 2 metres in length; in adulthood, it is generally a deep-running fish, spending much of its life at depths of 100 m or more; younger fish are found at shallower depths. The ling is edible; its flesh is prized and can be considered interchangeable with cod in either its fresh, salted or dried forms. The salted roe of the ling is considered a delicacy in Spain and is known as huevas de maruca. The lutefisk – ling that is first dried, then soaked in water and then steeped in a lye of soda and slaked lime – is a traditional dish at the Christmas table in Sweden, Norway and Finland.',	'164760',	'Common ling',	'402.jpg',	'image/jpeg',	219738,	'2012-04-20 09:33:29',	429,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	163112,	1,	'FOOD00397'),
(403,	'Lingcod',	'Ophiodon elongatus',	'The lingcod, Ophiodon elongatus, or ling cod, is a fish of the greenling family Hexagrammidae. It is the only extant member of the genus Ophiodon. A slightly larger, extinct species, Ophiodon ozymandias, is known from fossils from the Late Miocene of Southern California.\nOphiodon elongatus is native to the North American west coast from Shumagin Islands in the Gulf of Alaska to Baja California, Mexico. It has been observed up to a size of 152 cm (60 in) and a weight of 59 kg (130 lbs). It is spotted in various shades of grey. The lingcod is a popular eating fish, and is thus prized by anglers. Though not closely related to either ling or cod, the name \"lingcod\" originated because it somewhat resembles those fish. The lingcod\'s flesh is sometimes blue-green prior to cooking.',	'167116',	'Lingcod',	'403.jpg',	'image/jpeg',	107058,	'2012-04-20 09:34:09',	430,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	225387,	1,	'FOOD00398'),
(404,	'American lobster',	'Homarus americanus',	'The American lobster, Homarus americanus, is a species of lobster found on the Atlantic coast of North America, chiefly from Labrador to New Jersey. Within North America, it is also known as the northern lobster or Maine lobster. It can reach a body length of 64 cm, and a mass of over 20 kilograms, making it the heaviest crustacean in the world. Its closest relative is the European lobster Homarus gammarus, which can be distinguished by its coloration and the lack of spines on the underside of the rostrum. American lobsters are usually bluish green to brown with red spines, but a number of color variations have been observed.',	'97314',	'American lobster',	'404.jpg',	'image/jpeg',	87896,	'2012-04-20 09:38:47',	431,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	6706,	1,	'FOOD00399'),
(405,	'Loganberry',	'Rubus loganobaccus',	'The loganberry (Rubus × loganobaccus) is an hexaploid hybrid produced from pollination of a plant of the octaploid blackberry \'Aughinbaugh\' by a diploid red raspberry (Rubus idaeus). The plant and the fruit resemble the blackberry more than the raspberry, but the fruit color is a dark red, rather than black as in blackberries. Loganberries are cultivated commercially and by gardeners.',	'506229',	'Loganberry',	'405.jpg',	'image/jpeg',	149141,	'2012-04-20 09:31:08',	432,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:39',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00400'),
(406,	'Lotus',	'Nelumbo',	'Nelumbo is a genus of aquatic plants with large, showy flowers resembling the water lily, but not closely related to it. It is commonly called lotus, though this name may be applied to other genera, and there is an unrelated genus Lotus. The generic name is derived from the Sinhalese word Nelum. There are only two known living species in the genus. The sacred lotus (N. nucifera) is native to Asia, and is the better known of the two. It is commonly cultivated, and also used in Chinese medicine and cooking. This species is the national flower of India and Vietnam. The American lotus (N. lutea) is native to North America and the Caribbean. Horticultural hybrids have been produced between these two geographically separated species. A third, extinct species, N. aureavallis, is known from Eocene fossils from North Dakota, United States.',	'18397',	'Nelumbo',	'406.jpg',	'image/jpeg',	74143,	'2012-04-20 09:38:46',	433,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	4430,	1,	'FOOD00401'),
(407,	'Sacred lotus',	'Nelumbo nucifera',	'Nelumbo nucifera, known by numerous common names including Indian lotus, sacred lotus, bean of India, or simply lotus, is one of two species of aquatic plant in the family Nelumbonaceae. The Linnaean binomial Nelumbo nucifera (Gaertn.) is the currently recognized name for this species, which has been classified under the former names, Nelumbium speciosum (Willd.) and Nymphaea nelumbo, among others. Names other than Nelumbo nucifera (Gaertn.) are obsolete synonyms and should not be used in current works. This plant is an aquatic perennial. Under favorable circumstances its seeds may remain viable for many years, with the oldest recorded lotus germination being from that of seeds 1,300 years old recovered from a dry lakebed in northeastern China.\nA common misconception is referring to the lotus as a water lily (Nymphaea), an entirely different plant, as can be seen in the center of the flowers. Nymphaea lacks the structure that goes on to form the distinctive circular seed pod in the Nelumbo nucifera.\nNative to Tropical Asia and Queensland, Australia, it is commonly cultivated in water gardens. It is also the national flower of India and Vietnam.\nThe flowers, seeds, young leaves, and \"roots\" (rhizomes) are all edible.',	'18400',	'Nelumbo_nucifera',	'407.jpg',	'image/jpeg',	77944,	'2012-04-20 09:42:56',	434,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	4432,	1,	'FOOD00402'),
(408,	'White lupine',	'Lupinus albus',	'Lupinus albus, commonly known as the white lupin, is a member of the genus Lupinus in the family Fabaceae. It is a traditional pulse cultivated in the Mediterranean region.\nWhite lupin is distinct within the vast and polymorphous genus Lupinus L. for small variation of morphological characters. However, it has wide intraspecific variability in physiological plant properties: duration of vernalization time and growth rate, photoperiodic sensitivity, shape tolerance, drought resistance, cold- and winter-hardiness. There are winter and spring forms of white lupin. Duration of growing period under spring sowing varies from 106 to 180 days, seed mass per plant changes from 2.2 to 40 g, green mass yield per from 9 to 250 g, protein content in seed from 35.0 to 53.7%, and oil content from 6.2 to 12.0%.\n',	'503572',	'White_lupine',	'408.jpg',	'image/jpeg',	74117,	'2012-04-20 09:42:15',	435,	'Pulses',	'Other pulses',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3870,	1,	'FOOD00403'),
(409,	'Malabar spinach',	'Basella alba',	'Basella alba, or Malabar spinach, Malabar nightshade, Alugbati or Alabati in Philippines, (also Phooi leaf, Red vine spinach, Creeping spinach, Climbing spinach, Indian spinach, Philippine Spinach, Asian Spinach) is a perennial vine found in the tropics where it is widely used as a leaf vegetable.',	'192210',	'Basella alba',	'409.jpg',	'image/jpeg',	48033,	'2012-04-20 09:39:56',	436,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3589,	1,	'FOOD00404'),
(410,	'Mammee apple',	'Mammea americana',	'The mammee apple is a berry, though it is often misinterpreted to be a drupe. It is round or slightly irregular, with a brown or grey-brown 3 mm (0.12 in) thick rind. In fact, the rind consists of the exocarp and mesocarp of the fruit, while the pulp is formed from the endocarp. The stem is thick and short. The mammee apple has more or less visible floral remnant at the apex.\nMammee apples\' diameter ranges from 10 cm (3.9 in) to 20 cm (7.9 in). When unripe, the fruit is hard and heavy, but its flesh slightly softens when fully ripe. Beneath the skin, there is a white, dry membrane, whose taste is astringent, that adheres to the flesh. The flesh is orange or yellow, not fibrous, and can have various textures (crispy or juicy, firm or tender). Generally, the flesh smell is pleasant and appetizing.\nSmall fruits contain a single seed, while larger ones might have up to four. The seeds are brown, rough, oval and around 6 cm (2.4 in) long. The juice of the seed leaves an indelible stain.',	'21492',	'Mammea_americana',	'410.jpg',	'image/jpeg',	58655,	'2012-04-20 09:41:26',	437,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	198777,	1,	'FOOD00405'),
(411,	'Purple mangosteen',	'Garcinia mangostana',	'The purple mangosteen (Garcinia mangostana), colloquially known simply as mangosteen, is a tropical evergreen tree believed to have originated in the Sunda Islands and the Moluccas of Indonesia. It grows mainly in Southeast Asia, and also in tropical South American countries such as Colombia, in the state of Kerala in India and in Puerto Rico, where the tree has been introduced. The tree grows from 6 to 25 m (19.7 to 82.0 ft) tall. The fruit of the mangosteen is sweet and tangy, juicy, somewhat fibrous, with fluid-filled vesicles (like the flesh of citrus fruits), with an inedible, deep reddish-purple colored rind (exocarp) when ripe. In each fruit, the fragrant edible flesh that surrounds each seed is botanically endocarp, i.e., the inner layer of the ovary. Seeds are almond-shaped and sized.\nThe edible endocarp of the mangosteen has the same shape and size as a tangerine 4?6 centimetres (1.6?2.4 in) in diameter, but is white. The circle of wedge-shaped segments contains 4?8, rarely 9 segments, the larger ones harbouring apomictic seeds that are unpalatable unless roasted.\nThe purple mangosteen belongs to the same genus as the other, less widely known, mangosteens, such as the button mangosteen (G. prainiana) or the charichuelo (G. madruno).',	'21484',	'Purple_mangosteen',	'411.jpg',	'image/jpeg',	63989,	'2012-04-20 09:44:21',	438,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	58228,	1,	'FOOD00406'),
(412,	'Alpine sweetvetch',	'Hedysarum alpinum',	'Hedysarum alpinum is a species of flowering plant in the legume family known by the common name alpine sweetvetch. It has a circumpolar distribution, occurring throughout the northern latitudes of the Northern Hemisphere. In North America it is widespread in Canada and the northernmost United States, including Alaska. This plant is a perennial herb producing several erect stems from its caudex. It grows to 70 centimetres in height. The taproot is thick and woody, and it has rhizomes which can produce new stems. The leaves are each divided into a number of leaflets up to 3.5 centimetres long. The inflorescence is a dense raceme of flowers. The flowers are pink or pale purple and up to 1.5 centimetres long. The flowers are pollinated by insects such as the bumblebee and honeybee. The fruit is a flat legume pod which is narrowed between the seeds, with as many as 9 segments. This plant generally grows in the boreal and northern temperate climates. It occurs in tundra and taiga habitat types, in floodplains, grasslands, and dry forests. It is well adapted to calcareous soils. It is usually not a dominant species but it is considered dominant in several river deltas and plains in Alaska. It is a pioneer species on floodplains that have been recently scoured by water and ice. It grows with willows and birches along waterways and in forests dominated by spruces. It grows on grasslands with grass species such as little bluestem (Schizachyrium scoparium), Canada bluegrass (Poa compressa), and American dunegrass (Leymus mollis). Alpine sweetvetch is an important source of food for many types of animals, including black bears, grizzly bears, American bison, moose, Dall\'s sheep, and caribou. Bears are adept at digging up the nutritious roots. The roots are a primary food for grizzly bears in some areas, such as Banff National Park. In parts of Alaska this plant is a primary food for Dall\'s sheep and caribou. Many small mammals, such as voles and short-tailed weasels eat it, and a variety of birds nest in alpine sweetvetch habitat. Native Alaskan peoples used and still use the plant for food, particularly the fleshy roots. The roots are said to taste like young carrots. The Inupiat people call the plant wild potato and obtain dietary fiber from the roots. Alpine sweetvetch is the most important food source for the Dena\'ina people after wild fruit species. The Eskimo train dogs to locate stores of roots that have been cached by mice. The roots may be eaten raw or prepared in a number of ways, including boiling, roasting, and frying in grease. They are stored in lard or oil and eaten when other food stores run out.',	'26723',	'Hedysarum alpinum',	'412.jpg',	'image/jpeg',	320993,	'2012-04-20 09:33:46',	439,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	57576,	1,	'FOOD00407'),
(413,	'Milkfish',	'Chanos chanos',	'The milkfish (Chanos chanos) is the sole living species in the family Chanidae. (About seven extinct species in five additional genera have been reported. ) The Hawaiian name is awa, without initial glottal stop, not to be confused with ‘awa, with initial glottal stop, the name for Kava (Piper methysticum).',	'162838',	'Milkfish',	'413.jpg',	'image/jpeg',	68503,	'2012-04-20 09:32:13',	440,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	29144,	1,	'FOOD00408'),
(414,	'Monkfish',	'Lophius piscatorius',	'Monkfish (or headfish) is the English name of a number of types of fish in the northwest Atlantic, most notably the species of the anglerfish genus Lophius and the angelshark genus Squatina. The term is also occasionally used for a European sea monster more often called a sea monk. Monkfish is the most common English name for the genus Lophius in the northeast Atlantic but goosefish is used as the equivalent term on the eastern coast of North America. Lophius has three long filaments sprouting from the middle of the head; these are the detached and modified three first spines of the anterior dorsal fin. As in most anglerfish species, the longest filament is the first (illicium), which terminates in an irregular growth of flesh, the esca. This modified fin ray is movable in all directions. This esca is used as a lure to attract other fishes, which monkfish then typically swallow whole. Experiments have shown that whether the prey has been attracted to the lure or not is not strictly relevant, as the action of the jaws is an automatic reflex triggered by contact with the esca. It grows to a length of more than 1.5 m (5 ft); specimens of 1 m (3 ft) are common. The largest recorded specimen weighed 115 kg (253 lb) and was caught on January 7, 2012, by Frank-Rune Kopperud of Norway. The previous record holder was a specimen of 99.4 kg .',	'164501',	'Monkfish',	'414.jpg',	'image/jpeg',	120548,	'2012-04-20 09:35:48',	441,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8074,	1,	'FOOD00409'),
(416,	'Moth bean',	'Vigna aconitifolia',	'Vigna aconitifolius, called the moth bean, mat bean, Turkish gram, is a small, drought-resistant, annual, trailing herb with small yellow flowers and deeply lobed leaves, grown especially in dry parts of South Asia for its tiny edible beans, which range in color from light brown to dark reddish brown. The sprouted beans taste somewhat sweet. Matki is very popular in Maharastrian cuisine. The beans are soaked overnight to make them sprout. These sprouted beans are used for salad, misal or usal.',	'506271',	'Moth bean',	'416.jpg',	'image/jpeg',	35214,	'2012-04-20 09:37:33',	443,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3918,	1,	'FOOD00410'),
(417,	'Mountain yam',	'Dioscorea pentaphylla',	'Dioscorea pentaphylla is a species of flowering plant in the yam family known by the common name fiveleaf yam. It is native to tropical Asia or eastern Polynesia, and it is present elsewhere as an introduced species. This species is a prickly vine that twines counterclockwise around objects and other plants. It may reach 10 meters in length. The alternately arranged leaves are compound, divided into 3 to 5 leaflets each up to 10 centimeters long. The plant produces horseshoe-shaped bulbils about a centimeter long. New plants can sprout from the bulbils. Flowers are borne in spikes. The vine grows from a tuber. Specimens may be 3 pounds in weight and may be located over a meter underground. The tubers of the vine can be cooked and eaten.',	'43379',	'Dioscorea pentaphylla',	'417.jpg',	'image/jpeg',	74561,	'2012-04-20 09:42:48',	444,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	167592,	1,	'FOOD00411'),
(418,	'Striped mullet',	'Mugil cephalus',	'The flathead mullet, Mugil cephalus, is a mullet of the genus Mugil in the family Mugilidae, found in coastal tropical and subtropical waters worldwide. Its length is typically 30 to 75 centimetres (to in). This species occurs worldwide, attested by other common names for this fish: Black mullet - Cuba, US Bully mullet - Australia, Vietnam Callifaver mullet - Cuba, Netherlands Antilles, US Common grey mullet - UK Common mullet - Cuba, Netherlands Antilles, US Flathead grey mullet - India, Philippines (where it\'s known as either aligasid or talilong), UK Flathead mullet - Europe, FAO, UN, Fishbase Grey mullet - Turkey, Australia, Taiwan, Cuba, Fiji, Hong Kong, Mauritius, Netherlands Antilles, New Zealand, Spain, Tonga, UK, US, Mediterranean, Egypt Hardgut mullet - Australia Mangrove mullet - Australia Sea mullet - Australia, Fiji, Papua New Guinea, UK Striped mullet - Australia, Cuba, Mexico, UK, US. The Striped Mullet is a mainly diurnal coastal species that often enters estuaries and rivers. The Striped Mullet usually schools over sand or mud bottoms, feeding on zooplankton. The Adult fish normally feed on algae in fresh water. The maximum size the Striped Mullet may reach is approximately 120 cm, with a max weight of about 8,000 g. The species is euryhaline meaning that the fish can acclimate to different levels of salinity; this combined with the acclimation of juveniles to high water temperatures appears to be a selective advantage.',	'170335',	'Flathead mullet',	'418.jpg',	'image/jpeg',	97222,	'2012-04-20 09:39:28',	445,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	48193,	1,	'FOOD00412'),
(420,	'White mustard',	'Sinapis alba',	'White mustard (Sinapis alba) is an annual plant of the family Brassicaceae. It is sometimes also referred to as Brassica alba or B. hirta. Grown for its seeds, mustard, as fodder crop or as a green manure, it is now widespread worldwide, although it probably originated in the Mediterranean region.\nWhite mustard seeds are hard round seeds, usually around 1 to 1.5 millimetres in diameter, with a color ranging from beige or yellow to light brown. They can be used whole for pickling or toasted for use in dishes. When ground and mixed with other ingredients, a paste or more standard condiment can be produced.',	'23309',	'White_mustard',	'420.jpg',	'image/jpeg',	85377,	'2012-04-20 09:37:25',	447,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	3728,	1,	'FOOD00413'),
(421,	'Mustard spinach',	'Brassica perviridis',	'Komatsuna or Japanese mustard spinach (Brassica rapa var. perviridis) is a leaf vegetable. It is a variety of Brassica rapa, the plant species that yields the turnip, mizuna, napa cabbage, and rapini. It is grown commercially in Japan and Taiwan. The name komatsuna is from the Japanese komatsuna, \"small pine tree greens\". It is stir-fried, pickled, boiled, and added to soups or used fresh in salads. It is an excellent source of calcium.\nThe leaves of komatsuna may be eaten at any stage of their growth. In a mature plant they are dark green with slender light green stalks, around 30 centimeters (12\") long and 18 cm (7\") wide. It is most often grown in the spring and autumn, as it cannot endure extreme heat or cold for more than a short time.\nThe plant is also used for fodder in some Asian countries.',	'506223',	'Brassica_perviridis',	'421.jpg',	'image/jpeg',	53375,	'2012-04-20 09:29:19',	448,	'Vegetables',	'Cabbages',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00414'),
(422,	'New Zealand spinach',	'Tetragonia tetragonioides',	'Tetragonia tetragonioides (or previously T. expansa) is a leafy groundcover also known as New Zealand spinach, Warrigal greens, kokihi, sea spinach, Botany Bay spinach, tetragon and Cook\'s cabbage. It is native to New Zealand, Australia, Japan, Chile and Argentina. The species, rarely used by Maori or other indigenous people as a leaf vegetable, was first mentioned by Captain Cook. It was immediately picked, cooked, and pickled to help fight scurvy, and taken with the crew of the Endeavour. It spread when the explorer and botanist Joseph Banks took seeds back to Kew Gardens during the latter half of the 18th century. For two centuries, T. tetragonioides was the only cultivated vegetable to have originated from Australia and New Zealand. The species prefers a moist environment for growth. The plant has a trailing habit, and will form a thick carpet on the ground or climb though other vegetation and hang downwards. The leaves of the plant are 3–15 cm long, triangular in shape, and bright green. The leaves are thick, and covered with tiny papillae that look like waterdrops on the top and bottom of the leaves. The flowers of the plant are yellow, and the fruit is a small, hard pod covered with small horns. The plant is a halophyte and grows well in saline ground.',	'19938',	'Tetragonia tetragonioides',	'422.jpg',	'image/jpeg',	71382,	'2012-04-20 09:35:44',	449,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	45318,	1,	'FOOD00415'),
(423,	'Nopal',	'Opuntia cochenillifera',	'Nopales (for the pads) are a vegetable made from the young cladode (pad) segments of prickly pear, carefully peeled to remove the spines. These fleshy pads are flat and about hand-sized. They can be purple or green. They are particularly common in their native Mexico, where the plant is eaten commonly and regularly forms part of a variety of Mexican cuisine dishes. Farmed nopales are most often of the species Opuntia ficus-indica, although the pads of almost all Opuntia species are edible. Nopales are generally sold fresh in Mexico. In more recent years bottled, or canned versions are available mostly for export. Less often dried versions are available. Used to prepare nopalitos, they have a light, slightly tart flavor, like green beans, and a crisp, mucilaginous texture. In most recipes the mucilaginous liquid they contain is included in the cooking. They are at their most tender and juicy in the spring. Nopales are most commonly used in Mexican cuisine in dishes such as huevos con nopales, carne con nopales (meat with nopal), tacos de nopales, or simply on their own or in salads with queso panela (panela cheese). Candied nopale is called acitróne. Nopales have also grown to be an important ingredient in New Mexican cuisine and in Tejano culture (Texas).',	'19699',	'Nopal',	'423.jpg',	'image/jpeg',	94830,	'2012-04-20 09:33:50',	450,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:40',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	338184,	1,	'FOOD00416'),
(424,	'Ocean pout',	'Zoarces americanus',	'The ocean pout (Zoarces americanus) is an eelpout in the family Zoarcidae. It is found in the Northwest Atlantic Ocean, off the coast of New England and eastern Canada. The fish has antifreeze proteins in its blood, giving it the ability to survive in near-freezing waters. Scientists have done studies wherein genes are taken from the ocean pout and implanted into salmon in an attempt to make the latter grow faster. These genes transfer the ocean pout\'s tolerance for extremely cold waters to the salmon, allowing it to grow year-round. The promoter for the antifreeze protein gene is also used in conjunction with the growth hormone taken from a chinook salmon, which leads to a higher concentration of the growth hormone in the blood; causing the genetically modified salmon to grow much more rapidly than it would naturally. Controversy has arisen, as some view the altered fish as a potential threat to wild salmon stocks if it escapes or is ever released into the wild. Chefs and grocers in numerous US states have agreed not to sell the new fish over these concerns, citing concerns over its safety for human consumption. In June 2006 the Unilever company announced that it would use genetically modified yeast to grow antifreeze proteins based on a gene from the ocean pout, and use it to improve the consistency and storage properties of its ice cream brands.',	'630979',	'Ocean pout',	'424.jpg',	'image/jpeg',	76754,	'2012-04-20 09:35:10',	451,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8199,	1,	'FOOD00417'),
(425,	'North Pacific giant octopus',	'Enteroctopus dofleini',	'Enteroctopus dofleini, also known as the giant Pacific octopus or North Pacific giant octopus, is a large cephalopod belonging to the genus Enteroctopus. It can be found in the coastal North Pacific, usually at a depth of around 65 m (215 ft). It can, however, live in much shallower or much deeper waters. It is arguably the largest octopus species, based on a scientific record of a 71 kg (156 lb) individual weighed live. The alternative contender is the seven-arm octopus (Haliphron atlanticus) based on a 61 kg (134 lb) carcass estimated to have a live mass of 75 kg (165 lb). However, a number of questionable size records would suggest E. dofleini is the largest of all octopus species by a considerable margin.',	'557227',	'Enteroctopus dofleini',	'425.jpg',	'image/jpeg',	174330,	'2012-04-20 09:36:44',	452,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	267067,	1,	'FOOD00418'),
(426,	'Ohelo berry',	'Vaccinium reticulatum',	'Vaccinium reticulatum is a species of flowering plant in the heather family, Ericaceae, that is endemic to Hawaii. It grows at altitudes of 640–3,700 m on lava flows and freshly disturbed volcanic ash on Maui and Hawaii, and less commonly on Kauai, Oahu, and Molokai. Adaptations to volcanic activity include the ability to survive ash falls of over 25 cm depth.',	'23622',	'Vaccinium reticulatum',	'426.jpg',	'image/jpeg',	191287,	'2012-04-20 09:40:23',	453,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	180767,	1,	'FOOD00419'),
(427,	'Okra',	'Abelmoschus esculentus',	'Okra, known in many English-speaking countries as lady\'s fingers, bhindi or gumbo, is a flowering plant in the mallow family. It is valued for its edible green seed pods. The geographical origin of okra is disputed, with supporters of South Asian, Ethiopian and West African origins. The plant is cultivated in tropical, subtropical and warm temperate regions around the world.',	'21770',	'Okra',	'427.jpg',	'image/jpeg',	51081,	'2012-04-20 09:30:22',	454,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	455045,	1,	'FOOD00420'),
(428,	'Tunicate',	'Tunicata',	'Tunicates, previously known as Urochordata or urochordates, are members of the Tunicata, a subphylum of the phylum Chordata. They are marine filter feeders with a saclike morphology. In their respiration and feeding they take in water through an incurrent (or inhalant) siphon and expel the filtered water through an excurrent (or exhalant) siphon. Most adult tunicates are sessile and attached to rocks or similarly suitable surfaces on the ocean floor; others such as salps, doliolids and pyrosomes swim in the pelagic zone as adults. Various species are commonly known as sea squirts or sea pork. The Tunicata apparently evolved in the early Cambrian period. Despite their simple appearance, they are a sister subphylum to the Vertebrata.',	'203347',	'Tunicate',	'428.jpg',	'image/jpeg',	81801,	'2012-04-20 09:40:31',	455,	'Aquatic foods',	'Other aquatic foods',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	7712,	1,	'FOOD00421'),
(430,	'Ostrich',	'Struthio camelus',	'The Ostrich or Common Ostrich (Struthio camelus) is either one or two species of large flightless birds native to Africa, the only living member(s) of the genus Struthio, which is in the ratite family. Some analyses indicate that the Somali Ostrich may be better considered a full species separate from the Common Ostrich, but most taxonomists consider it to be a subspecies. The ostrich shares the order Struthioniformes with the kiwis, emus, rheas, and cassowaries. It is distinctive in its appearance, with a long neck and legs, and can run at up to about 70Â km/h, the fastest land speed of any bird. The ostrich is the largest living species of bird and lays the largest eggs of any living bird (extinct elephant birds of Madagascar and the giant moa of New Zealand laid larger eggs). The ostrich\'s diet consists mainly of plant matter, though it also eats invertebrates. It lives in nomadic groups of 5 to 50 birds. When threatened, the ostrich will either hide itself by lying flat against the ground, or run away. If cornered, it can attack with a kick of its powerful legs. Mating patterns differ by geographical region, but territorial males fight for a harem of two to seven females. The ostrich is farmed around the world, particularly for its feathers, which are decorative and are also used as feather dusters. Its skin is used for leather products and its meat is marketed commercially.',	'174375',	'Ostrich',	'430.jpg',	'image/jpeg',	174017,	NULL,	457,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	8801,	1,	'FOOD00422'),
(431,	'Spotted seal',	'Phoca largha',	'The spotted seal (Phoca largha, Phoca vitulina largha), also known as the larga or largha seal, is a member of the family Phocidae, and is considered a \"true seal\". It inhabits ice floes and waters of the north Pacific Ocean and adjacent seas. It is primarily found along the continental shelf of the Beaufort, Chukchi, Bering and Okhotsk Seas and south to the northern Yellow Sea and it migrates south as far as northern Huanghai and the western Sea of Japan. It is also found in Alaska from the southeastern Bristol Bay to Demarcation Point during the ice-free seasons of summer and autumn when spotted seals mate and have pups. Smaller numbers are found in the Beaufort Sea. It is sometimes mistaken for the harbor seal to which it is closely related and spotted seals and harbor seals often mingle together in areas where their habitats overlap.',	'180642',	'Spotted_seal',	'431.jpg',	'image/jpeg',	62486,	'2012-04-20 09:38:55',	458,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	39090,	0,	'FOOD00423'),
(432,	'Pacific herring',	'Clupea pallasii',	'The Pacific herring, Clupea pallasii, is a species of the herring family associated with the Pacific Ocean environment of North America and northeast Asia. It is a silvery fish with unspined fins and a deeply forked caudal fin. The distribution is widely along the California coast from Baja California north to Alaska and the Bering Sea; in Asia the distribution is south to Japan. Clupea pallasii is considered a keystone species because of its very high productivity and interactions with a large number of predators and prey. Pacific herring spawn in variable seasons, but often in the early part of the year in intertidal and sub-tidal environments, commonly on eelgrass or other submerged vegetation; however, they do not die after spawning, but can breed in successive years. According to government sources, the Pacific herring fishery collapsed in the year 1993, and is slowly recovering to commercial viability in several North American stock areas. The species is named for Peter Simon Pallas, a noted German naturalist and explorer. There are disjunct populations of Clupea pallasii in North-East Europe, which are often attributed to separate subspecies Clupea pallasii marisalbi (White Sea herring) and Clupea pallasii suworowi (Chosha herring).',	'551209',	'Pacific herring',	'432.jpg',	'image/jpeg',	40137,	'2012-04-20 09:30:36',	459,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	30724,	1,	'FOOD00424'),
(433,	'Pacific oyster',	'Crassostrea gigas',	'The Pacific oyster, Japanese oyster or Miyagi oyster (Crassostrea gigas), is an oyster native to the Pacific coast of Asia. It has become an introduced species in North America, Australia, Europe, and New Zealand.\nThe shell of Crassostrea gigas varies widely with the environment where it is attached. Its large, rounded, radial folds are often extremely rough and sharp. The two valves of the shell are slightly different in size and shape, the right valve being moderately concave. Shell colour is variable, usually pale white or off-white. Mature specimens can vary from 80 mm to 400 mm long.',	'79868',	'Pacific_oyster',	'433.jpg',	'image/jpeg',	94502,	'2012-04-20 09:41:49',	460,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	29159,	1,	'FOOD00425'),
(434,	'Pacific rockfish',	'Sebastes',	'Sebastes is a genus of fish in the family Sebastidae (though some include this in Scorpaenidae), most of which have the common name of rockfish. A few are called ocean perch, sea perch or redfish instead. Most of the Sebastes species live in the north Pacific, although two (S. capensis and S. oculatus) live in the south Pacific/Atlantic and four (S. fasciatus, S. mentella, S. norvegicus and S. viviparus) live in the north Atlantic. The coast off South California is the area of highest rockfish diversity, with 56 species living in the Southern California Bight.',	'166705',	'Sebastes',	'434.jpg',	'image/jpeg',	64327,	'2012-04-20 09:42:24',	461,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	34820,	1,	'FOOD00426'),
(435,	'Velvet duck',	'Melanitta fusca',	'The Velvet Scoter (Melanitta fusca), also called a Velvet Duck or whitewing (not to be confused with the white-winged scoter), is a large sea duck, which breeds over the far north of Europe and Asia west of the Yenisey basin. A small, isolated population nests in eastern Turkey. The East Siberian and North American White-winged Scoter is sometimes considered conspecific with the Velvet Scoter, and its two constituent subspecies are then known as M. f. stejnegeri and M. f. deglandi. Velvet and White-winged Scoter, along with the Surf Scoter, are placed in the subgenus Melanitta, distinct from the subgenus Oidemia, Black and Common Scoters. It winters further south in temperate zones, Europe as far south as Great Britain, and on the Black and Caspian Sea. Small numbers reach France and northern Spain. It forms large flocks on suitable coastal waters. These are tightly packed, and the birds tend to take off together. The lined nest is built on the ground close to the sea, lakes or rivers, in woodland or tundra, and typically contains 7â€“9 eggs. This duck dives for crustaceans and molluscs. It is characterised by its bulky shape and large bill. It is the largest scoter at 51â€“58Â cm. The male is all black, except for white around the eye and a white speculum. It has a bulbous yellow bill with a black base. The females are brown birds with two pale patches on each side of the head and white wing patches. The Velvet Scoter is one of the species to which the Agreement on the Conservation of African-Eurasian Migratory Waterbirds applies.',	'175163',	'Velvet Scoter',	'435.jpg',	'image/jpeg',	64264,	NULL,	462,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	371864,	1,	'FOOD00427'),
(436,	'Pepper (C. frutescens)',	'Capsicum annuum var. annuum',	'Capsicum frutescens is a species of chili pepper that is sometimes considered to be part of the species Capsicum annuum. Pepper cultivars in Capsicum frutescens can be annual or short-lived perennial plants. Flowers are white with a greenish white or greenish yellow corolla, and are either insect- or self-pollinated. The plants\' berries typically grow erect; ellipsoid-conical to lanceoloid shaped. They are usually very small and pungent, growing 10?20mm long and 3?7mm in diameter. Fruit typically grows a pale yellow and matures to a bright red, but can also be other colors. C. frutescens has a smaller variety of shapes compared to other Capsicum species, likely because of the lack of human selection. More recently, however, C. frutescens has been bred to produce ornamental strains, because of its large quantities of erect peppers growing in colorful ripening patterns.',	'527044',	'Capsicum_frutescens',	'436.jpg',	'image/jpeg',	80619,	'2012-04-20 09:39:22',	463,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	2,	0,	'specific',	40321,	1,	'FOOD00428'),
(437,	'Common persimmon',	'Diospyros virginiana',	'Diospyros virginiana is a persimmon species commonly called the American Persimmon, Common Persimmon, Eastern Persimmon, \"\'Simmon\", \"Possumwood\", or \"Sugar-plum\". It ranges from southern Connecticut/Long Island to Florida, and west to Texas, Louisiana, Oklahoma, and Kansas. The tree grows wild but has been cultivated for its fruit and wood since prehistoric times by Native Americans.\nThe fruit is round or oval and usually orange-yellow and sometimes bluish and from 2 through 6 cm (0.79 through 2.4 in) in diameter. In the U.S. South and Midwest, the fruits are referred to as simply Persimmons or \"\'Simmons\", and are popular in desserts and cuisine.',	'23855',	'Common_Persimmon',	'437.jpg',	'image/jpeg',	48303,	'2012-04-20 09:42:59',	464,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:24',	NULL,	NULL,	0,	'specific',	13493,	1,	'FOOD00429'),
(438,	'Pheasant',	'Phasianus colchicus',	'Pheasants refer to several genera within the subfamily Phasianinae, of the family Phasianidae in the order Galliformes. Pheasants are characterised by strong sexual dimorphism, males being highly ornate with bright colours and adornments such as wattles and long tails. Males are usually larger than females and have longer tails. Males play no part in rearing the young. Pheasants typically eat seeds and some insects. The best-known is the Common Pheasant, which is widespread throughout the world in introduced feral populations and in farm operations. Various other pheasant species are popular in aviaries, such as the Golden Pheasant (Chrysolophus pictus).',	'175905',	'Pheasant',	'438.jpg',	'image/jpeg',	172968,	NULL,	465,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	9054,	1,	'FOOD00430'),
(439,	'Northern pike',	'Esox lucius',	'The northern pike (Esox lucius), known simply as a pike in Britain, Ireland, Canada, and most parts of the USA, also called jackfish or simply \"northern\" in the Upper Midwest of the USA), is a species of carnivorous fish of the genus Esox (the pikes). They are typical of brackish and fresh waters of the Northern Hemisphere (i.e. holarctic in distribution). Pike grow to a relatively large size; lengths of 150 cm (59 in) and weights of 25 kg (55 lb) are not rare. The average length is about 70-120 cm (28-47 in). The heaviest specimen known so far was caught in 1983 at an abandoned stone quarry in Germany, where the species is known as a Hecht. She (the majority of all pikes over 8 kg or 18 lb are females) was 147 cm (58 in) long and weighed 31 kg (68 lb). The longest pike ever recorded and confirmed was 152 cm (60 in) long and weighed 28 kg (62 lb). A pike of 60.5 in (154 cm) was caught and released in May 2004 in Apisko Lake, Manitoba. Historic reports of giant pike, caught in nets in Ireland in the late 19th century, of 41-42 kg (90-93 lb) with a length of 173-175 cm (67-68 in), were researched by Fred Buller and published in The Domesday Book of Mammoth Pike. ',	'162139',	'Northern_pike',	'439.jpg',	'image/jpeg',	124128,	'2012-04-20 09:38:09',	466,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8010,	1,	'FOOD00431'),
(440,	'Pili nut',	'Canarium ovatum',	'Canarium ovatum, commonly known as pili, is a species of tropical tree belonging to the genus Canarium. It is one of approximately 600 species in the family Burseraceae. Pili are native to maritime Southeast Asia, Papua New Guinea, and Northern Australia. They are commercially cultivated in the Philippines for their edible nuts.\nThe pili fruit is a drupe, 4 to 7 cm (1.6 to 2.8 in) long, 2.3 to 3.8 cm (0.91 to 1.50 in) in diameter, and weighs 15.7 to 45.7 g (0.035 to 0.101 lb). The skin (exocarp) is smooth, thin, shiny, and turns purplish black when the fruit ripens; the pulp (mesocarp) is fibrous, fleshy, and greenish yellow in color, and the hard shell (endocarp) within protects a normally dicotyledonous embryo. The basal end of the shell (endocarp) is pointed and the apical end is more or less blunt; between the seed and the hard shell (endocarp) is a thin, brownish, fibrous seed coat developed from the inner layer of the endocarp. This thin coat usually adheres tightly to the shell and/or the seed. Much of the kernel weight is made up of the cotyledons, which are about 4.1 to 16.6% of the whole fruit; it is composed of approximately 8% carbohydrate, 11.5 to 13.9% protein, and 70% fat. Kernels from some trees may be bitter, fibrous or have a turpentine odor.',	'506413',	'Pili_nut',	'440.jpg',	'image/jpeg',	129741,	'2012-04-20 09:29:12',	467,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:41',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	43691,	1,	'FOOD00432'),
(441,	'Colorado pinyon',	'Pinus edulis',	'Pinus edulis, the Colorado pinyon, two-needle pinyon, or piñon pine, is a pine in the pinyon pine group whose ancestor was a member of the Madro-Tertiary Geoflora (a group of drought resistant trees) and is native to the United States.\nThe cones are globose, 3 centimetres (1.2 in) to 5 centimetres (2.0 in) long and broad when closed, green at first, ripening yellow-buff when 18?20 months old, with only a small number of thick scales, with typically 5-10 fertile scales. The cones open to 4 centimetres (1.6 in) - 6 centimetres (2.4 in) broad when mature, holding the seeds on the scales after opening. The seeds are 10 millimetres (0.39 in) to 14 millimetres (0.55 in) long, with a thin shell, a white endosperm, and a vestigial 1 millimetre (0.039 in) - 2 millimetres (0.079 in) wing; they are dispersed by the Pinyon Jay, which plucks the seeds out of the open cones. The jay, which uses the seeds as a food resource, stores many of the seeds for later use, and some of these stored seeds are not used and are able to grow into new trees.',	'183336',	'Colorado_Pinyon',	'441.jpg',	'image/jpeg',	159557,	'2012-04-20 09:33:39',	468,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	3340,	1,	'FOOD00433'),
(442,	'Pitanga',	'Eugenia uniflora',	'The Pitanga, Surinam Cherry, Brazilian Cherry, or Cayenne Cherry (Eugenia uniflora) is a plant in the family Myrtaceae, native to tropical South America\'s east coast ranging from Suriname to southern Brazil, as well as parts of Paraguay and Uruguay. Known as Pitanga throughout Brazil or Ñangapirí in surrounding countries, The plant is relatively pest resistant, easy to grow and high in antioxidants. The Surinam Cherry is often used in gardens as a hedge or screen. The tree was introduced to Bermuda for ornamental purposes but is now out of control and listed as an invasive species.\nFlowers develop into ribbed fruits 2 to 4 cm in diameter, starting out as green, then ranging through orange, scarlet and maroon as they ripen.',	'27224',	'Eugenia_uniflora',	'442.jpg',	'image/jpeg',	86534,	'2012-04-20 09:36:31',	469,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	119951,	1,	'FOOD00434'),
(443,	'Plains prickly pear',	'Opuntia macrorhiza',	'Opuntia macrorhiza Engelm. is a common and widespread species of cactus with the common names \"Plains Prickly Pear\" or \"Twist-spine Prickly Pear.\" It is found throughout the Great Plains of the United States, from Texas to Minnesota, as well as in the desert and Rocky Mountain states from Arizona to Idaho, with sporadic populations in the Mississippi and Ohio Valleys. It is also reported from northern Mexico, in the states of Chihuahua, Sonora, Coahuila, Nuevo León and San Luís Potosí. The species is cultivated as an ornamental in other locations.\nThe species prefers dry, sandy or gravelly soils. It is one of the shorter species of the genus, rarely over 30 cm (1 foot) tall, spreading horizontally and forming large clumps. Flowers are showy and bright yellow. Fruits are red, juicy and edible.',	'19718',	'Opuntia_macrorhiza',	'443.jpg',	'image/jpeg',	71889,	'2012-04-20 09:33:19',	470,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	1041245,	1,	'FOOD00435'),
(444,	'French plantain',	'Musa X paradisiaca',	'Musa × paradisiaca is the accepted name for the hybrid between Musa acuminata and Musa balbisiana. Most cultivated bananas and plantains are triploid cultivars either of this hybrid or of M.  acuminata. Linnaeus originally used the name M.  paradisiaca only for plantains or cooking bananas, but the modern usage includes hybrid cultivars used both for cooking and as dessert bananas.',	'42391',	'Musa × paradisiaca',	'444.jpg',	'image/jpeg',	31093,	'2012-04-20 09:38:02',	471,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	89151,	1,	'FOOD00436'),
(445,	'American pokeweed',	'Phytolacca americana',	'American Pokeweed (Phytolacca americana) is a large semi-succulent herbaceous perennial plant growing up to 10 feet (3 meters) in height. It is native to eastern North America, the Midwest, and the Gulf Coast, with more scattered populations in the far West. It is also known as Virginia poke, American nightshade, cancer jalap, coakum, garget, inkberry, pigeon berry, pocan, pokeroot, pokeweed, pokeberry, redweed, scoke, red ink plant and chui xu shang lu. Parts of this plant are highly toxic to livestock and humans, and it is considered a major pest by farmers. Nonetheless, some parts can be used as food, medicine or poison. The plant has a large white taproot, green or red stems, and large, simple leaves. White flowers are followed by purple to almost black berries, which are a good food source for songbirds such as Gray Catbird, Northern Cardinal, Brown Thrasher, and Northern Mockingbird.',	'19523',	'Phytolacca americana',	'445.jpg',	'image/jpeg',	68651,	'2012-04-20 09:38:08',	472,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	3527,	1,	'FOOD00437'),
(447,	'Opium poppy',	'Papaver somniferum',	'Papaver somniferum, the Opium poppy, is the species of plant from which opium and poppy seeds are derived. Opium is the source of many narcotics, including morphine (and its derivative heroin), thebaine, codeine, papaverine, and noscapine. The Latin botanical name means the \"sleep-bringing poppy\", referring to the sedative properties of some of these opiates.\nThe poppy is the only species of Papaveraceae that is an agricultural crop grown on a large scale. Other species, Papaver rhoeas and Papaver argemone, are important agricultural weeds, and may be mistaken for the crop.\nThe plant itself is also valuable for ornamental purposes, and has been known as the \"common garden poppy\", referencing all the group of poppy plants.\nPoppy seeds of Papaver somniferum are an important food item and the source of poppyseed oil, a healthy edible oil that has many uses.',	'18894',	'Opium_poppy',	'447.jpg',	'image/jpeg',	72650,	'2012-04-20 09:32:23',	474,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:42',	'2019-12-11 19:32:39',	NULL,	NULL,	0,	'specific',	3469,	0,	'FOOD00438'),
(448,	'Prairie turnip',	'Pediomelum esculentum',	'Psoralea esculenta (prairie turnip) is an herbaceous perennial plant native to prairies and dry woodlands of central North America, which bears a starchy tuberous root edible as a root vegetable. The plant is also known as Pediomelum esculenta. English names for the plant include tipsin, teepsenee, breadroot, breadroot scurf pea, and pomme blanche. The prairie turnip was a staple food of the Plains Indians. A closely related species, Psoralea hypogaea, the little breadroot, is also edible, although the plant and root are smaller. Another species, Psoralea argophylla, was probably harvested for food only in times of famine.',	'504177',	'Psoralea esculenta',	'448.jpg',	'image/jpeg',	41639,	'2012-04-20 09:40:40',	475,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	458363,	1,	'FOOD00439'),
(449,	'Prickly pear',	'Opuntia',	'Opuntia, also known as nopales or paddle cactus, is a genus in the cactus family, Cactaceae. Currently, only prickly pears are included in this genus of about 200 species distributed throughout most of the Americas. Chollas are now separated into the genus Cylindropuntia, which some still consider a subgenus of Opuntia. Austrocylindropuntia, Corynopuntia, and Micropuntia are also often included in the present genus, but like Cylindropuntia, they seem rather distinct. Brasiliopuntia and Miqueliopuntia are closer relatives of Opuntia.\nThe most common culinary species is the Indian fig opuntia (O. ficus-indica). Most culinary uses of the term \"prickly pear\" refer to this species. Prickly pears are also known as tuna (fruit) or nopal (paddle, plural nopales) from the Nahuatl word n?palli for the pads, or nostle, from the Nahuatl word n?chtli for the fruit; or paddle cactus.\nThe genus is named for the Ancient Greek city of Opus, where, according to Theophrastus, an edible plant grew which could be propagated by rooting its leaves.',	'19686',	'Opuntia',	'449.jpg',	'image/jpeg',	6241,	'2012-04-20 09:38:34',	476,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	106975,	1,	'FOOD00440'),
(450,	'Quinoa',	'Chenopodium quinoa',	'Quinoa, a species of goosefoot, is a grain-like crop grown primarily for its edible seeds. It is a pseudocereal rather than a true cereal, or grain, as it is not a member of the true grass family. As a chenopod, quinoa is closely related to species such as beets, spinach and tumbleweeds.',	'506567',	'Quinoa',	'450.jpg',	'image/jpeg',	43763,	'2012-04-20 09:35:49',	477,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	63459,	1,	'FOOD00441'),
(451,	'European rabbit',	'Oryctolagus',	'\"The European rabbit or common rabbit (Oryctolagus cuniculus) is a species of rabbit native to southwestern Europe (Spain and Portugal) and northwest Africa (Morocco and Algeria). It has been widely introduced elsewhere, often with devastating effects on local biodiversity. However, its decline in its native range (caused by the diseases myxomatosis and rabbit calicivirus, as well as overhunting and habitat loss), has caused the decline of its highly dependent predators, the Iberian lynx and the Spanish Imperial eagle. It is known as an invasive species because it has been introduced to countries on all continents with the exception of Antarctica and sub-Saharan Africa, and caused many problems within the environment and ecosystems. Australia has the most problems with European rabbits, due to the lack of natural predators there. The European rabbit is well known for digging networks of burrows, called warrens, where it spends most of its time when not feeding. Unlike the related hares (Lepus spp.), rabbits are altricial, the young being born blind and furless, in a fur-lined nest in the warren, and they are totally dependent upon their mother. \"',	'180128',	'European_rabbit',	'451.jpg',	'image/jpeg',	143476,	NULL,	478,	'Animal foods',	'Lagomorphs',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	9984,	1,	'FOOD00442'),
(453,	'Rainbow smelt',	'Osmerus mordax',	'The rainbow smelt, Osmerus mordax, is a species of fish of the family Osmeridae. Its distribution is circumpolar, and it has been introduced to the Great Lakes, and from there has made its way to various other places. Walleye, trout, and other larger fish prey on these smelt. The rainbow smelt prefer juvenile ciscoes, zooplankton, and other small organisms. They are anadromous spring spawners and prefer clean streams with light flow and light siltation. The rainbow smelt face several barriers. They are weak swimmers and cannot overcome most fish ladders. This prevents them from making it past the dams to the headwater streams where they spawn. The rise in erosion and dams help to decimate the smelt population in the 1980s. There are currently plans to try to reduce damming and to help control erosion. With current efforts to reduce the human impact on this and many other affected species the population is back on the rise.',	'162041',	'Rainbow smelt',	'453.jpg',	'image/jpeg',	74647,	'2012-04-20 09:37:03',	480,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8014,	1,	'FOOD00443'),
(454,	'Rainbow trout',	'Oncorhynchus mykiss',	'The rainbow trout (Oncorhynchus mykiss) is a species of salmonid native to tributaries of the Pacific Ocean in Asia and North America. The steelhead is a sea-run rainbow trout usually returning to freshwater to spawn after two to three years at sea; rainbow trout and steelhead trout are the same species. The fish are often called salmon trout. Several other fish in the salmonid family are called trout; some are anadromous like salmon, whereas others are resident in freshwater only. The species has been introduced for food or sport to at least 45 countries, and every continent except Antarctica. In some locations, such as Southern Europe, Australia and South America, they have negatively impacted upland native fish species, either by eating them, outcompeting them, transmitting contagious diseases, or hybridization with closely related species and subspecies that are native to western North America.',	'161989',	'Rainbow trout',	'454.jpg',	'image/jpeg',	77363,	'2012-04-20 09:37:55',	481,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8022,	1,	'FOOD00444'),
(455,	'Malabar plum',	'Syzygium jambos',	'Syzygium jambos is a tree originating in Southeast Asia and occurring widely elsewhere, having been introduced as an ornamental and fruit tree.\nThe edible fruit of Syzygium jambos is shaped like some kinds of guava, to which the plant is fairly closely related. In fact the fruit is so like the guava in appearance that people unfamiliar with it may mistake it for a guava on sight. However, the fragrance, flavour and texture are different, and instead of containing dozens of small, hard seeds set in a jelly-like tissue, as a guava does, the fruit of Syzygium jambos usually contains one or two large, unarmoured seeds about a cm in diameter, lying loose in a slightly fluffy cavity when ripe. Shaking a fruit to feel whether the seeds rattle, gives some indication whether it is ripe. The skin is thin and waxy. The flowers are described by some as fragrant, though this appears to be a variable attribute. The ripe fruit however, has a strong, pleasant floral bouquet, hence such common names as \"Rose apple\" and \"pomarrosa\".',	'505420',	'Malabar_plum',	'455.jpg',	'image/jpeg',	26232,	'2012-04-20 09:42:22',	482,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	334483,	1,	'FOOD00445'),
(456,	'Rose hip',	'Rosa',	'The rose hip, also known as rose haw or rose hep, is the fruit of the rose plant, that typically is red-to-orange, but ranges from dark purple to black in some species. Rose hips begin to form after successful pollination of flowers in spring or early summer, and ripen in late summer through autumn.',	'24807',	'Rose hip',	'456.jpg',	'image/jpeg',	52715,	'2012-04-20 09:38:22',	483,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	3764,	1,	'FOOD00446'),
(457,	'Roselle',	'Hibiscus sabdariffa',	'The roselle (Hibiscus sabdariffa) is a species of Hibiscus native to the west Africa, used for the production of bast fibre and as an infusion. It is an annual or perennial herb or woody-based subshrub, growing to 2?2.5 m (7?8 ft) tall. The leaves are deeply three- to five-lobed, 8?15 cm (3?6 in) long, arranged alternately on the stems.\nThe flowers are 8?10 cm (3?4 in) in diameter, white to pale yellow with a dark red spot at the base of each petal, and have a stout fleshy calyx at the base, 1?2 cm (0.39?0.79 in) wide, enlarging to 3?3.5 cm (1.2?1.4 in), fleshy and bright red as the fruit matures. It takes about six months to mature.',	'503001',	'Roselle_(plant)',	'457.jpg',	'image/jpeg',	79043,	'2012-04-20 09:43:52',	484,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	183260,	1,	'FOOD00447'),
(458,	'Orange roughy',	'Hoplostethus atlanticus',	'The orange roughy, red roughy, slimehead or deep sea perch, Hoplostethus atlanticus, is a relatively large deep-sea fish belonging to the slimehead family (Trachichthyidae). The Marine Conservation Society has categorized orange roughy as vulnerable to exploitation. It is found in 3 to 9 °C (37 to 48 °F) deep (bathypelagic, 180 to 1,800 metres waters of the Western Pacific Ocean, eastern Atlantic Ocean, Indo-Pacific, and in the Eastern Pacific off Chile. The orange roughy is notable for its extraordinary lifespan, with lifespans up to 149 years determined by scientific methods. It is important to commercial deep trawl fisheries. The fish is actually a bright, brick red color; however, the orange roughy fades to a yellowish orange after death. Like other slimeheads, the orange roughy is slow-growing and late to mature, resulting in a very low resilience. They are extremely susceptible to overfishing because of this, and many stocks have already crashed; recently discovered substitute stocks are rapidly dwindling. The flesh is firm with a mild flavour; it is sold skinned and filleted, fresh or frozen.',	'166139',	'Orange roughy',	'458.jpg',	'image/jpeg',	44101,	'2012-04-20 09:30:29',	485,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	96778,	1,	'FOOD00448'),
(459,	'Sablefish',	'Anoplopoma fimbria',	'The sablefish, Anoplopoma fimbria, is one of two members of the fish family Anoplopomatidae and the only species in the Anoplopoma genus. In English, common names for it include sable (USA), black cod (USA, UK, Canada), blue cod (UK), bluefish (UK), candlefish (UK), coal cod (UK), coalfish (Canada), beshow, and skil(fish) (Canada), although many of these names also refer to other, unrelated, species. In the USA, the FDA accepts only \"sablefish\" as the Acceptable Market Name; \"black cod\" is considered a vernacular (regional) name and should not be used as a Statement of Identity for this species. The sablefish is found in muddy sea beds in the North Pacific at depths of 300 to 2,700 m (1000 to 9000 ft) and is commercially important to Japan.\nThe white flesh of the sablefish is soft-textured and mildly flavored. It is considered a delicacy in many countries. When cooked, its flaky texture is similar to Patagonian toothfish (Chilean sea bass). The meat has a high fat content and can be prepared in many ways, including grilling, smoking, or frying, or served as sushi. Sablefish flesh is high in long-chain omega 3 fatty acids, EPA and DHA. It contains about as much as wild salmon.',	'167123',	'Sablefish',	'459.jpg',	'image/jpeg',	28530,	'2012-04-20 09:40:29',	486,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:42',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	229290,	1,	'FOOD00449'),
(460,	'Pink salmon',	'Oncorhynchus gorbuscha',	'Pink salmon or humpback salmon, Oncorhynchus gorbuscha (from a Russian name for this species gorbúša (горбуша), is a species of anadromous fish in the salmon family. It is the smallest and most abundant of the Pacific salmon.\r\nIn the ocean, pink salmon are bright silver fish. After returning to their spawning streams, their coloring changes to pale grey on the back with yellowish-white belly (although some turn an overall dull green color). As with all salmon, in addition to the dorsal fin, they also have an adipose fin. The fish is characterized by a white mouth with black gums, no teeth on the tongue, large oval-shaped black spots on the back, a v-shaped tail, and an anal fin with 13-17 soft rays. During their spawning migration, males develop a pronounced humped back, hence their nickname \"humpies\". Pink salmon average 4.8 pounds (2.2 kg) in weight. The maximum recorded size was 30 inches (76 cm) and 15 pounds (6.8 kg).',	'161975',	'Pink_salmon',	'460.jpg',	'image/jpeg',	48884,	'2012-04-20 09:43:03',	487,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8017,	1,	'FOOD00450'),
(461,	'Chum salmon',	'Oncorhynchus keta',	'The chum salmon (Oncorhynchus keta) is a species of anadromous fish in the salmon family. It is a Pacific salmon, and may also be known as dog salmon or Keta salmon, and is often marketed under the name Silverbrite salmon. The name Chum salmon comes from the Chinook Jargon term tzum, meaning \"spotted\" or \"marked\", while \"Keta\" comes from the Evenki language of Eastern Siberia via Russian.\nThe body of the chum salmon is deeper than most salmonid species. In common with other species found in the Pacific, the anal fin has 12 to 20 rays, compared with a maximum of 12 in European species. Chum have an ocean coloration of silvery blue green with some indistinct spotting in a darker shade, and a rather paler belly. When they move into fresh water the color changes to dark olive green and the belly color deepens. When adults are near spawning, they have purple blotchy streaks near the caudal peduncle, darker towards the tail. Spawning males typically grow an elongated snout or kype, their lower fins become tipped with white and they have enlarged teeth. Some researchers speculate these characteristics are used to compete for mates.',	'161976',	'Chum_salmon',	'461.jpg',	'image/jpeg',	153463,	'2012-04-20 09:35:44',	488,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8018,	1,	'FOOD00451'),
(462,	'Coho salmon',	'Oncorhynchus kisutch',	'The coho salmon, Oncorhynchus kisutch (from the Russian ????? kizhuch), is a species of anadromous fish in the salmon family. Coho salmon are also known as silver salmon or \"silvers\".\nDuring their ocean phase, coho salmon have silver sides and dark-blue backs. During their spawning phase, their jaws and teeth become hooked. After entering fresh water, they develop bright-red sides, bluish-green heads and backs, dark bellies and dark spots on their backs. Sexually maturing fish develop a light-pink or rose shading along the belly, and the males may show a slight arching of the back. Mature adults have a pronounced red skin color with darker backs and average 28 inches (71 cm) and 7 to 11 pounds (3.2 to 5.0 kg), occasionally reaching up to 36 pounds (16 kg). Mature females may be darker than males, with both showing a pronounced hook on the nose.',	'161977',	'Coho_salmon',	'462.jpg',	'image/jpeg',	66706,	'2012-04-20 09:42:43',	489,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8019,	1,	'FOOD00452'),
(463,	'Sockeye salmon',	'Oncorhynchus nerka',	'Sockeye salmon (Oncorhynchus nerka) ? also called red salmon or blueback salmon in the United States ? is an anadromous species of salmon found in the Northern Pacific Ocean and rivers discharging into it. This species is a Pacific salmon that is primarily red in hue during spawning. They can be up to 84 cm in length and weigh anywhere from 2.3 to 7 kg. A distinguishing feature of the sockeye salmon is the lack of a definite spot on the back and tail. Juveniles remain in freshwater until they are ready to migrate to the ocean, over distances of up to 1,600 km. Their diet consists primarily of zooplankton. Sockeye salmon are semelparous, dying after they spawn.\nThe sockeye salmon is sometimes called red or blueback salmon, due to its hue. Sockeye are blue tinged with silver in color while living in the ocean. When they return to spawning grounds, their bodies become red and their heads turn green. Sockeye can be anywhere from 60 to 84 centimeters in length and weigh from 2.3 to 7 kg. Two distinguishing features are their long, serrated gill rakers that range from 30 to 40 in number, and their lack of a spot on their tail or back.',	'161979',	'Sockeye_salmon',	'463.jpg',	'image/jpeg',	88237,	'2012-04-20 09:40:22',	490,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8023,	1,	'FOOD00453'),
(464,	'Chinook salmon',	'Oncorhynchus tshawytscha',	'The Chinook salmon, Oncorhynchus tshawytscha, is the largest species in the Pacific (Oncorhynchus) salmon family. Other commonly used names for the species include king salmon, Quinnat salmon, spring salmon and Tyee salmon. Chinook are anadromous fish native to the north Pacific Ocean and the river systems of western North America ranging from California to Alaska. They are also native to Asian rivers ranging from northern Japan to the Palyavaam River in the Siberian far east, although only the Kamchatka Peninsula supports relatively persistent native populations. They have been introduced to other parts of the world, including New Zealand and the Great Lakes. A large Chinook is a prized and sought-after catch for a sporting angler. The flesh of the salmon is also highly valued for its dietary nutritional content, which includes high levels of important omega-3 fatty acids. Some populations are endangered, though Chinook salmon have not been assessed for the IUCN Red List.',	'161980',	'Chinook salmon',	'464.jpg',	'image/jpeg',	13102,	'2012-04-20 09:37:21',	491,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	74940,	1,	'FOOD00454'),
(465,	'Atlantic salmon',	'Salmo salar',	'The Atlantic salmon, Salmo salar, is a fish in the family Salmonidae, which is found in the northern Atlantic Ocean and in rivers that flow into the north Atlantic and, due to human introduction, the north Pacific. It is also commercially known as bay salmon, black salmon, caplin-scull salmon, fiddler, grilse, grilt, kelt, landlocked salmon, ouananiche, outside salmon, parr, Sebago salmon, silver salmon, slink, smolt, spring salmon, or winnish.',	'161996',	'Atlantic salmon',	'465.jpg',	'image/jpeg',	401397,	'2012-04-20 09:42:45',	492,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8030,	1,	'FOOD00455'),
(466,	'Salmonberry',	'Rubus spectabilis',	'Rubus spectabilis (salmonberry) is a species of Rubus native to the west coast of North America from west central Alaska to California.\nIt is a shrub growing to 1?4 m tall, with perennial, not biennial woody stems (unlike other species). The leaves are trifoliate, 7?22 cm long, the terminal leaflet larger than the two side leaflets. The leaf margins are toothed. The flowers are 2?3 cm diameter, with five purple petals; they are produced from early spring to early summer. The fruit matures in late summer to early autumn, and resembles a large yellow to orange-red raspberry 1.5?2 cm long with many drupelets.\nIn the Pacific Northwest of North America the berries can ripen from mid-June to late July.\nSalmonberries are found in moist forests and stream margins, especially in the coastal forests. They often form large thickets, and thrive in the open spaces under stands of red alder (Alnus rubra).',	'25051',	'Salmonberry',	'466.jpg',	'image/jpeg',	33580,	'2012-04-20 09:42:03',	493,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	59499,	1,	'FOOD00456'),
(467,	'Common salsify',	'Tragopogon porrifolius',	'Tragopogon porrifolius is a plant cultivated for its ornamental flower, edible root, and herbal properties. It also grows wild in many places and is one of the most widely known species of the salsify genus, Tragopogon. It is commonly known as purple or common salsify, oyster plant, vegetable oyster, Jerusalem star, goatsbeard or simply salsify (although these last two names are also applied to other species, as well).',	'38568',	'Tragopogon porrifolius',	'467.jpg',	'image/jpeg',	53712,	'2012-04-20 09:37:42',	494,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	13731,	1,	'FOOD00457'),
(468,	'Sapodilla',	'Manilkara zapota',	'Sapodilla Cayes is an uninhabited atoll in the Gulf of Honduras. It is generally considered to be within the territorial waters of Belize, but Guatemala claims that the Belize–Guatemala maritime boundary is northwest of Sapodilla. Honduras also lays claims to Sapodilla Caye in its 1982 constitution.',	'23823',	'Sapodilla Cayes',	'468.jpg',	'image/jpeg',	55020,	'2012-04-20 09:41:09',	495,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	3741,	1,	'FOOD00458'),
(469,	'Mamey sapote',	'Pouteria sapota',	'The mamey sapote (Pouteria sapota) is a species of tree native to southern Mexico. Today, the tree is cultivated not only in Mexico, but also in Central America, the Caribbean, and South Florida for its fruit, which is commonly eaten in many Latin American countries. Mamey sapote is a large and highly ornamental evergreen tree that can reach a height of 15 to 45 meters (60 to 140 feet) at maturity. Like most fruit trees, it is mainly propagated by grafting, which ensures the new plant has the same characteristics as the parent, especially its fruit. It is also considerably faster than growing trees by seed. The fruit is about 10 to 25 cm (4 to 10 inches) long and 8 to 12 cm (3 to 5 inches) wide and has orange flesh. The fruit is eaten raw or made into milkshakes, smoothies, ice cream and fruit bars. It can be used to produce marmalade and jelly. Some consider the fruit to be an aphrodisiac. Some beauty products use oil pressed from the seed, otherwise known as sapayul oil. The brown skin has a texture somewhat between sandpaper and the fuzz on a peach. The fruit\'s texture is creamy and soft. A mamey sapote is ripe when the flesh is pink when a fleck of the skin is removed. The flesh should give slightly, as with a ripe kiwifruit. The mamey sapote is related to other sapotes such as sapodilla, abiu (P. caimito) and canistel (P. campechiana), but unrelated to the black sapote and white sapote. It should not be confused with the mammee apple. It has different names depending on the country: mamey, zapote colorado, and zapote rojo, among others.',	'23836',	'Pouteria sapota',	'469.jpg',	'image/jpeg',	91223,	'2012-04-20 09:37:07',	496,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	233744,	1,	'FOOD00459'),
(470,	'Spanish mackerel',	'Scomberomorus maculatus',	'Scomberomorini, commonly called the Spanish mackerels or Seerfishes, is a tribe of ray-finned bony fishes in the mackerel family, Scombridae – a family it shares with the mackerel, tuna and bonito tribes, plus the butterfly kingfish. This tribe comprises 21 species in 3 genera: Acanthocybium A. solandri, Wahoo Grammatorcynus G. bicarinatus, Shark mackerel G. bilineatus, Double-lined mackerel Scomberomorus S. brasiliensis, Serra Spanish mackerel S. cavalla, King mackerel S. commerson, Narrow-barred Spanish mackerel S. concolor, Monterrey Spanish mackerel S. guttatus, Indo-Pacific king mackerel S. koreanus, Korean seerfish S. lineolatus, Streaked seerfish S. maculatus, Atlantic Spanish mackerel S. multiradiatus, Papuan seerfish S. munroi, Australian spotted mackerel S. niphonius, Japanese Spanish mackerel S. plurilineatus, Kanadi kingfish S. queenslandicus, Queensland school mackerel S. regalis, Cero mackerel S. semifasciatus, Broadbarred king mackerel S. sierra, Pacific sierra S. sinensis, Chinese seerfish S. tritor, West African Spanish mackerel',	'172436',	'Spanish mackerel',	'470.jpg',	'image/jpeg',	69172,	'2012-04-20 09:38:11',	497,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	99344,	1,	'FOOD00460'),
(471,	'Pacific sardine',	'Sardinops sagax',	'The South American pilchard, Sardinops sagax, is a sardine of the Family Clupeidae, the only member of the genus Sardinops. It is found in the Indo-Pacific oceans. Its length is up to 40 cm. It has a number of other common names, some of which more appropriately refer to subspecies, including blue pilchard, Australian pilchard, blue-bait, Californian pilchard, Chilean sardine, Japanese pilchard, Pacific sardine, and Southern African pilchard.',	'161729',	'Pacific_sardine',	'471.jpg',	'image/jpeg',	27240,	'2012-04-20 09:30:28',	498,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	28381,	1,	'FOOD00461'),
(472,	'Scallop',	'Pectinidae',	'A scallop (from Old French escalope, meaning \"shell\") is a common name applied to many species of marine bivalve mollusks in the family Pectinidae, the scallops. Scallops are a cosmopolitan family, found in all of the world\'s oceans.\nMany scallops are highly prized as a food source; the name \"scallop\" is also applied to the meat of these animals when it is used as seafood. The brightly colored, fan-shaped shells of some scallops, with their radiating, fluted patterns, are valued by shell collectors, and have been used since ancient times as motifs in art and design.',	'79611',	'Scallop',	'472.jpg',	'image/jpeg',	94949,	'2012-04-20 09:32:29',	499,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	6566,	1,	'FOOD00462'),
(473,	'Scup',	'Stenotomus chrysops',	'The scup, Stenotomus chrysops, is a fish which occurs primarily in the Atlantic from Massachusetts to South Carolina. Along with many other fish of the family Sparidae, it is also commonly known as porgy. Scup grow as large as 18 in (450 mm) and weigh 3 to 4 lb, but they average ½–1 lb (0.25–0.5 kg). In the Middle Atlantic Bight, scup spawn along the inner continental shelf. Their larvae end up in inshore waters, along the coast and in estuarine areas. At two to three years of age, they mature. Scup winter along the mid and outer continental shelf. When the temperature warms in the spring they migrate inshore. They are fished for by commercial and recreational fishermen. They are a fine fish to eat because of their light flavor and are sometimes called panfish. Popular methods of cooking include but are not limited to frying, broiling and baking.',	'169182',	'Scup',	'473.jpg',	'image/jpeg',	139785,	'2012-04-20 09:36:35',	500,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	35579,	1,	'FOOD00463'),
(474,	'Sea cucumber',	'Parastichopus californicus',	'They are marine animals with a leathery skin and an elongated body containing a single, branched gonad. Sea cucumbers are found on the sea floor worldwide. The number of holothurian species worldwide is about 1250 with the greatest number being in the Asia Pacific region. Many of these are gathered for human consumption and some species are cultivated in aquaculture systems. The harvested product is variously referred to as trepang, bêche-de-mer or balate. Sea cucumbers serve a useful purpose in the marine ecosystem as they help recycle nutrients, breaking down detritus and other organic matter after which bacteria can continue the degradation process. Like all echinoderms, sea cucumbers have an endoskeleton just below the skin, calcified structures that are usually reduced to isolated microscopic ossicles (or sclerietes) joined by connective tissue. In some species these can sometimes be enlarged to flattened plates, forming an armour. In pelagic species such as Pelagothuria natatrix (Order Elasipodida, family Pelagothuriidae), the skeleton and a calcareous ring are absent. The sea cucumbers are named for their resemblance to the vegetable cucumber, but are not related to the Cucumis sativus vine.',	'158344',	'Sea cucumber',	'474.jpg',	'image/jpeg',	83363,	'2012-04-20 09:41:53',	501,	'Aquatic foods',	'Other aquatic foods',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	7689,	1,	'FOOD00464'),
(475,	'Steller sea lion',	'Eumetopias jubatus',	'The Steller sea lion (Eumetopias jubatus) also known as the northern sea lion and Steller\'s sea lion, is a near threatened species of sea lion in the northern Pacific. It is the sole member of the genus Eumetopias and the largest of the eared seals (Otariidae). Among pinnipeds, it is inferior in size only to the walrus and the two elephant seals. The species is named for the naturalist Georg Wilhelm Steller, who first described them in 1741. The Steller sea lion has attracted considerable attention in recent decades due to significant, unexplained declines in their numbers over a large portion of their range in Alaska.',	'180625',	'Steller sea lion',	'475.jpg',	'image/jpeg',	125334,	'2012-04-20 09:29:46',	502,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	34886,	0,	'FOOD00465'),
(476,	'Bearded seal',	'Erignathus barbatus',	'The bearded seal (Erignathus barbatus), also called the square flipper seal, is a medium-sized pinniped that is found in and near to the Arctic Ocean. \nDistinguishing features of this earless seal include square fore flippers and thick bristles on its muzzle. Adults are greyish-brown in colour, darker on the back; rarely with a few faint spots on the back or dark spots on the sides. Occasionally the face and neck are reddish-brown. Bearded seal pups are born with a greyish-brown natal fur with scattered patches of white on the back and head. The bearded seal is unique in the subfamily Phocinae in having two pairs of teats, a feature it shares with monk seals.\nBearded seals reach about 2.1 m (6.9 ft) to 2.7 m (8.9 ft) in nose-to-tail length and from 200 kg (441 lb) to 430 kg (948 lb) in weight. Both sexes are about the same size.\nBearded seals are a primary food source for polar bears and a secondary source for the Inuit of the Arctic coast. The Inuit language name for the seal is ugjuk (plural: ugjuit) or oogrook or oogruk. Although the meat would be eaten and the blubber burnt in the kudlik (stone lamp) the Inuit preferred the ringed seal for food and light. The skin of the bearded seal is tougher than regular seal and was used to make shoes, whips, dog sled harnesses, to cover a wooden frame boat, the Umiak and in constructing summer tents known as tupiq.',	'180655',	'Bearded_seal',	'476.jpg',	'image/jpeg',	148201,	'2012-04-20 09:41:33',	503,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:43',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	39304,	0,	'FOOD00466'),
(477,	'Ringed seal',	'Pusa hispida',	'The ringed seal (Pusa hispida), also known as the jar seal and as netsik or nattiq by the Inuit, is an earless seal inhabiting the Arctic and sub-Arctic regions. The ringed seal is a relatively small seal, rarely greater than 1.5 m in length, with a distinctive patterning of dark spots surrounded by light grey rings, whence its common name. It is the most abundant and wide-ranging ice seal in the northern hemisphere: ranging throughout the Arctic Ocean, into the Bering Sea and Okhotsk Sea as far south as the northern coast of Japan in the Pacific, and throughout the North Atlantic coasts of Greenland and Scandinavia as far south as Newfoundland, and include two freshwater subspecies in northern Europe. Ringed seals are one of the primary prey of polar bears and have long been a component of the diet of indigenous people of the Arctic.',	'622018',	'Ringed seal',	'477.jpg',	'image/jpeg',	99554,	'2012-04-20 09:37:35',	504,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	9718,	0,	'FOOD00467'),
(478,	'Sea trout',	'Salmo trutta forma trutta',	'Sea trout is the common name usually applied to anadromous (or sea-run) forms of brown trout (Salmo trutta), and is often referred to as Salmo trutta morpha trutta. Other names for anadromous brown trout are sewen (Wales), peel or peal (SW England), mort (NW England), finnock (Scotland), white trout (Ireland) and salmon trout (culinary). The term sea trout is also used to describe other anadromous salmonids--coho salmon (Oncorhynchus kisutch), brook trout (Salvelinus fontinalis), Arctic char (Salvelinus alpinus alpinus), cutthroat trout (Oncorhynchus clarkii) and Dolly Varden (Salvenlinus malma). Even some non-salmonid species are also commonly known as sea trout--Northern pikeminnow (Ptychocheilus oregonensis) and members of the weakfish family (Cynoscion). Anadromous brown trout are widely distributed in Europe along the Atlantic and Baltic coasts, the United Kingdom and the coasts of Iceland. They do not occur in the Mediterranean Sea but are found in the Black and Caspian Seas. and as far north as the Barents and Kara Seas in the Arctic Ocean. Brown trout introduced into freshwater habitats in Tasmania, Victoria, New Zealand, Falkland Islands, Kerguelen Islands, Chile and Argentina have established anadromous populations when there was suitable access to saltwater. Anadromous behavior has been reported in the Columbia river and its tributaries in the U.S. and in Canadian rivers on both the Pacific and Atlantic coasts.',	'169238',	'',	'478.jpg',	'image/jpeg',	12125,	'2012-04-20 09:40:26',	505,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	13028,	1,	'FOOD00468'),
(479,	'Sesbania flower',	'Sesbania bispinosa',	'The legume Sesbania bispinosa, also known as Sesbania aculeata (Willd.) Pers., is a small tree in the genus Sesbania.\nThe flower is the provincial flower of Phra Nakhon Si Ayutthaya Province, Thailand.\nIt is an annual shrub which can grow to seven metres in height but usually only reaches one to two metres. It sends out fibrous, pithy stems with long leaves and bears purple-spotted yellow flowers. It produces pods which contain light brown beans.\nThe plant has a great number of uses, including as green manure, rice straw, wood and fodder.',	'505187',	'Sesbania_bispinosa',	'479.jpg',	'image/jpeg',	144173,	'2012-04-20 09:40:59',	506,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	485725,	1,	'FOOD00469'),
(480,	'American shad',	'Alosa sapidissima',	'The American shad, Alosa sapidissima, is a species of anadromous fish distributed from southern Labrador to northern Florida. American shad are in family Clupeidae of order Clupeiformes. They are not closely related to the other North American shads. Rather, it seems to form a lineage that diverged from a common ancestor of the European taxa before these diversified Adult shad weigh between 3 pounds and 8 pounds and they have a delicate flavor when cooked. It is considered flavorful enough to not require sauces, herbs or spices. It can be boiled, filleted and fried in butter, or baked. Traditionally, a little vinegar is sprinkled over it on the plate. In the eastern United States, roe shad (females) are prized because the eggs are considered a delicacy.',	'161702',	'American shad',	'480.jpg',	'image/jpeg',	17146,	'2012-04-20 09:41:52',	507,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	34773,	1,	'FOOD00470'),
(481,	'Shark',	'Squaliformes',	'Sharks are a group of fish characterized by a cartilaginous skeleton, five to seven gill slits on the sides of the head, and pectoral fins that are not fused to the head. Modern sharks are classified within the clade Selachimorpha (or Selachii) and are the sister group to the rays. However, the term \"shark\" has also been used for extinct members of the subclass Elasmobranchii outside the Selachimorpha, such as Cladoselache and Xenacanthus. Under this broader definition, the earliest known sharks date from more than 420 million years ago.\nSince then, sharks have diversified into over 470 species. They range in size from the small dwarf lanternshark (Etmopterus perryi), a deep sea species of only 17 centimetres (6.7 in) in length, to the whale shark (Rhincodon typus), the largest fish in the world, which reaches approximately 12 metres (39 ft). Sharks are found in all seas and are common to depths of 2,000 metres (6,600 ft). They generally do not live in freshwater although there are a few known exceptions, such as the bull shark and the river shark, which can survive in both seawater and freshwater. They breathe through five to seven gill slits. Sharks have a covering of dermal denticles that protects their skin from damage and parasites in addition to improving their fluid dynamics. They have several sets of replaceable teeth.\nWell-known species such as the great white shark, tiger shark, blue shark, mako shark, and the hammerhead shark are apex predators?organisms at the top of their underwater food chain.',	'160602',	'Shark',	'481.jpg',	'image/jpeg',	65426,	'2012-04-20 09:30:18',	508,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	282414,	1,	'FOOD00471'),
(482,	'Sheefish',	'Stenodus leucichthys',	'Stenodus leucichthys is a species of freshwater whitefish in the family Salmonidae. In the strict sense its natural distribution is restricted to the Caspian Sea basin, and it is known as beloribitsa. The beloribitsa is now considered extinct in the wild, but survives in cultured stocks.',	'162006',	'Stenodus leucichthys',	'482.jpg',	'image/jpeg',	45167,	'2012-04-20 09:33:58',	509,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	59296,	1,	'FOOD00472'),
(483,	'Sheep (Mutton, Lamb)',	'Ovis aries',	'\"Sheep (Ovis aries) are quadrupedal, ruminant mammals typically kept as livestock. Like all ruminants, sheep are members of the order Artiodactyla, the even-toed ungulates. Although the name \"\"sheep\"\" applies to many species in the genus Ovis, in everyday usage it almost always refers to Ovis aries. Numbering a little over one billion, domestic sheep are also the most numerous species of sheep. An adult female sheep is referred to as a ewe (/ju?/), an intact male as a ram or occasionally a tup, a castrated male as a wether, and a younger sheep as a lamb. Domestic sheep are relatively small ruminants, usually with a crimped hair called wool and often with horns forming a lateral spiral. Domestic sheep differ from their wild relatives and ancestors in several respects, having become uniquely neotenic as a result of selective breeding by humans. A few primitive breeds of sheep retain some of the characteristics of their wild cousins, such as short tails. Depending on breed, domestic sheep may have no horns at all (i.e. polled), or horns in both sexes, or in males only. Most horned breeds have a single pair, but a few breeds may have several.\"',	'552475',	'Sheep',	'483.jpg',	'image/jpeg',	102547,	NULL,	510,	'Animal foods',	'Ovis',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	9940,	1,	'FOOD00473'),
(484,	'Sheepshead',	'Archosargus probatocephalus',	'The sheepshead, Archosargus probatocephalus, is a marine fish that grows to 30 in (760 mm), but commonly reaches 10 to 20 in. It is deep and compressed in body shape, with 5 to 6 dark bars on the side of the body over a gray background. It has sharp dorsal spines. Its diet consists of oysters, clams, and other bivalves, and barnacles, fiddler crabs, and other crustaceans. It has a hard mouth, with several rows of stubby teeth, which help crush the shells of prey.',	'169189',	'Archosargus_probatocephalus',	'484.jpg',	'image/jpeg',	19137,	'2012-04-20 09:35:41',	511,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	119682,	1,	'FOOD00474'),
(485,	'Hedge mustard',	'Sisymbrium',	'Hedge mustard (Sisymbrium officinale) is a plant in the family Brassicaceae. It is found on roadsides and wasteland, and as a weed of arable land. A native of Europe and North Africa, it is now well-established throughout the world.\nIt is distinct from the mustard plants which belong to the genus Brassica.\nThe Hedge-mustard is food for the caterpillars of some Lepidoptera, such as the small white (Pieris rapae).\nThis plant is widely cultivated across Europe for its edible leaves and seeds. It is widely used as a condiment in Northern Europe (particularly Denmark, Norway and Germany).\nThe leaves have a bitter cabbage-like flavour and they are used either in salads or cooked as a pot herb (in cultivar versions). The seeds have been used to make mustard pastes in Europe.',	'23311',	'Hedge_mustard',	'485.jpg',	'image/jpeg',	131157,	'2012-04-20 09:33:25',	512,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	3729,	1,	'FOOD00475'),
(486,	'Skipjack tuna',	'Katsuwonus pelamis',	'The skipjack tuna, Katsuwonus pelamis, is a medium-sized perciform fish in the tuna family, Scombridae. It is otherwise known as the aku, arctic bonito, mushmouth, oceanic bonito, striped tuna, or victor fish. It grows up to 1 m (3 ft) in length. It is a cosmopolitan pelagic fish found in tropical and warm-temperate waters. It is a very important species for fisheries.',	'172401',	'Skipjack tuna',	'486.jpg',	'image/jpeg',	76866,	'2012-04-20 09:36:26',	513,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	8226,	1,	'FOOD00476'),
(487,	'Snapper',	'Lutjanidae',	'Snappers are a family of perciform fish, Lutjanidae, mainly marine, but with some members inhabiting estuaries, feeding in fresh water. Some are important food fish. One of the best known is the red snapper.\nSnappers inhabit tropical and subtropical regions of all oceans. They can grow to about 1 m (3.3 ft) in length. Most feed on crustaceans or other fish, though a few are plankton-feeders. They can be kept in aquaria, but mostly grow too fast to be popular aquarium fish. They live at depths reaching 450 m (1,480 ft).',	'168845',	'Lutjanidae',	'487.jpg',	'image/jpeg',	14590,	'2012-04-20 09:32:14',	514,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	30850,	1,	'FOOD00477'),
(488,	'Soursop',	'Annona muricata',	'Soursop is the fruit of Annona muricata, a broadleaf, flowering, evergreen tree native to Mexico, Cuba, Central America, the Caribbean and northern South America: Colombia, Brazil, Peru, Ecuador and Venezuela. Soursop is also produced in Somalia. Today, it is also grown in some areas of Southeast Asia, as well as in some Pacific islands. It was most likely brought from Mexico to the Philippines by way of the Manila-Acapulco Galleon trade. It is in the same genus as the chirimoya and the same family as the pawpaw. Soursop, raw, edible parts Nutritional value per 100 g Energy 276 kJ Carbohydrates 16.84 g - Sugars 13.54 g - Dietary fiber 3.3 g Fat 0.30 g Protein 1.00 g Vitamin A equiv. 0 μg (0%) Thiamine (vit. B1) 0.070 mg (6%) Riboflavin (vit. B2) 0.050 mg (4%) Niacin (vit. B3) 0.900 mg (6%) Vitamin B6 0.059 mg (5%) Folate (vit. B9) 14 μg (4%) Vitamin C 20.6 mg (25%) Calcium 14 mg (1%) Iron 0.6 mg (5%) Magnesium 21 mg (6%) Phosphorus 27 mg (4%) Potassium 278 mg (6%) Zinc 0.1 mg (1%) Percentages are relative toUS recommendations for adults. The soursop is adapted to areas of high humidity and relatively warm winters; temperatures below 5 °C will cause damage to leaves and small branches, and temperatures below 3 °C can be fatal. The fruit becomes dry and is no longer good for concentrate. Other common names include: Evo, Aluguntugui guanábana, graviola, anona, corossol, sorsaka, adunu, Brazilian pawpaw, guyabano, guanavana, toge-banreisi, durian benggala, nangka blanda, sirsak, zuurzak and nangka londa. In Malayalam, it is called mullaatha, literally thorny custard apple. The other lesser-known Indian names are shul-ram-fal and Lakshmana Phala. and in Harar (Ethiopia) in Harari language known for centuries as Amba Shoukh (Thorny Mango or Thorny Fruit). The flavour has been described as a combination of strawberry and pineapple, with sour citrus flavour notes contrasting with an underlying creamy flavour reminiscent of coconut or banana.',	'18098',	'Soursop',	'488.jpg',	'image/jpeg',	36221,	'2012-04-20 09:32:33',	515,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:25',	NULL,	NULL,	0,	'specific',	13337,	1,	'FOOD00478'),
(489,	'Spelt',	'Triticum spelta',	'Spelt, also known as dinkel wheat, or hulled wheat, is a species of wheat cultivated since 5000 BCE. Spelt was an important staple in parts of Europe from the Bronze Age to medieval times; it now survives as a relict crop in Central Europe and northern Spain and has found a new market as a health food. Spelt is sometimes considered a subspecies of the closely related species common wheat (T. aestivum), in which case its botanical name is considered to be Triticum aestivum subsp. spelta. It is a hexaploid wheat, which means it has six sets of chromosomes.',	'42243',	'Spelt',	'489.jpg',	'image/jpeg',	30542,	'2012-04-20 09:40:12',	516,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	58933,	1,	'FOOD00479'),
(490,	'Spirulina',	'Spirulina',	'<i>Spirulina</i> represents a biomass of cyanobacteria (blue-green algae) that can be consumed by humans and other animals. There are two species, <i>Arthrospira platensis</i> and <i>Arthrospira maxima</i>.\r\n\r\n<i>Arthrospira</i> is cultivated worldwide; used as a dietary supplement as well as a whole food; and is also available in tablet, flake and powder form. It is also used as a feed supplement in the aquaculture, aquarium and poultry industries. (Wikipedia)',	'1053',	'',	'490.jpg',	'image/jpeg',	55030,	'2012-04-20 09:37:34',	517,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	551299,	1,	'FOOD00480'),
(491,	'Squab',	'Columba',	'In culinary terminology, squab is a young domestic pigeon or its meat. The meat is widely described as tasting like dark chicken. The term is probably of Scandinavian origin; the Swedish word skvabb means \"loose, fat flesh\". It formerly applied to all dove and pigeon species, such as the Wood Pigeon, the Mourning Dove, and the now-extinct Passenger Pigeon, and their meat. More recently, squab meat comes almost entirely from domesticated pigeons. The meat of dove and pigeon gamebirds hunted primarily for sport is rarely called squab.',	'177062',	'Squab_(food)',	'491.jpg',	'image/jpeg',	291724,	NULL,	518,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8931,	1,	'FOOD00481'),
(493,	'Strawberry guava',	'Psidium cattleianum',	'Psidium cattleianum, named in honour of notable English horticulturist William Cattley, commonly known as Cattley guava or Peruvian guava, is a small tree (2?6 m tall), bearing small red or yellow fruit, which are somewhat sour but sometimes eaten or made into jam. The red-fruited variety, PSIDIUM LITTORALE Var. Longipes, is known as strawberry guava; the yellow-fruited variety, PSIDIUM LITTORALE Var. Littorale (Lucidum) is variously known as lemon guava, \"\"Yellow-fruited Cherry Guava\"\", and in Hawaii as waiaw? and is usually smaller. Native to Brazil and adjacent tropical South America, it is closely related to common guava (P. guajava), and like that species is a widespread, highly invasive species in tropical areas, especially Hawai?i. It tends to form dense, monotypic stands which prevent regrowth of native species, and is very difficult to eradicate; it also provides refuge for fruit flies which cause extensive agricultural damage. As an invasive species, it is sometimes erroneously called Chinese guava. Cherry Guava is sporadically naturalised in coastal areas of Queensland and northern New South Wales. It is also naturalised on Lord Howe Island, Norfolk Island and Christmas Island (Navie 2004; Queensland Herbarium 2008).The yellow variety bears even more heavily than the red and generally has larger fruit. \nThe fruit can be eaten whole as both the thin skin and soft, juicy interior are edible. Strawberry guavas taste like a passionfruit mixed with strawberry; the yellow variety lacks the astringency of the red and is preferred by some people.  The skin is also edible and tastes a bit like rose petals but is often removed for a sweeter flavour. The seeds are small and white in colour and can be roasted as a substitute for coffee. Its leaves may be brewed for tea.',	'27239',	'Strawberry_guava',	'493.jpg',	'image/jpeg',	44892,	'2012-04-20 09:33:34',	520,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	375274,	1,	'FOOD00482'),
(494,	'Greater sturgeon',	'Acipenser',	'<i>Acipenser</i> is a genus of sturgeons. With 17 species, many of which are threatened, it is the largest genus in the order Acipenseriformes. (Wikipedia)',	'161065',	'',	'494.jpg',	'image/jpeg',	27793,	'2012-04-20 09:43:52',	521,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:44',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	7901,	1,	'FOOD00483'),
(495,	'White sucker',	'Catostomus commersonii',	'The white sucker (Catostomus commersonii) is a freshwater Cypriniform fish inhabiting the upper Midwest and Northeast in North America, but is also found as far south as Georgia and New Mexico in the south. The fish is commonly known as a \"sucker\" due to its fleshy papillose lips that suck up organic matter from the bottom of rivers and streams.\nOther common names for the white sucker include bay fish, brook sucker, common sucker, and mullet. The white sucker is often confused with the longnose sucker (Catostomus catostomus), because they look very similar.\nIt is a long, round-bodied fish with a dark green, grey, copper, brown, or black back and sides and a light underbelly. The fish also has typical features of primitive cypriniformes fishes, such as a homocercal tail, cycloid scales, as well as dorsal, pectoral, and pelvic fin rays. When fullgrown, it can reach lengths between 12 and 20 inches long and weigh anywhere from 2 to 6 pounds. The fish\'s suckermouth with its fleshy lips are located in the inferior position at the bottom of its head, as the fish obtains its food from bottom surfaces. These fish are also commonly mistaken for different types of Suckers and Redhorse, but can be distinguished by its complete lateral line system containing 55-85 small scales.',	'553273',	'White_sucker',	'495.jpg',	'image/jpeg',	54244,	'2012-04-20 09:38:50',	522,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	7971,	1,	'FOOD00484'),
(496,	'Sugar apple',	'Annona squamosa',	'Sugar-apple is the fruit of Annona squamosa, the most widely grown species of Annona and a native of the tropical Americas and West Indies.\nThe fruit is round to conical, 5?10 cm (2.0?3.9 in) in diameter and 6?10 cm (2.4?3.9 in) long, and weighing 100?240 g (3.5?8.5 oz), with a thick rind composed of knobby segments. The color is typically pale green to blue-green, with a deep pink blush in certain varieties, and typically has a bloom. It is unique among Annona fruits in being segmented, and the segments tend to separate when ripe, exposing the interior.\nThe flesh is fragrant and sweet, creamy white to light yellow, and resembles and tastes like custard. It is found adhering to 13?16 mm (0.51?0.63 in) long seeds to form individual segments arranged in a single layer around the conical core. It is soft, slightly grainy, and slippery. The hard, shiny seeds may number 20-38 or more per fruit, and have a brown to black coat, although varieties exist that are almost seedless.',	'18100',	'Sugar_apple',	'496.jpg',	'image/jpeg',	8760,	'2012-04-20 09:32:15',	523,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	301693,	1,	'FOOD00485'),
(497,	'Pumpkinseed sunfish',	'Lepomis gibbosus',	'The pumpkinseed sunfish (Lepomis gibbosus) is a freshwater fish of the sunfish family (Centrarchidae) of order Perciformes. It is also referred to as pond perch, common sunfish, punkys, sunfish, and sunny.\nPumpkinseeds typically are 6-8 inches in length, but can grow up to 10 inches. They typically weigh less than 1 pound, with the world record being 1 pound 6 ounces. They are orange, green, yellow or blue in color, with speckles over their sides and back and a yellow-orange breast and belly. The coloration of the ctenoid scales of the pumpkinseed is one of the most vibrant of any freshwater fish and can range from an olive-green or brown to bright orange and blue. The sides are covered with vertical bars that are a faint green or blue, which are typically more prevalent in female pumpkinseeds. Orange spots may cover the dorsal, anal, and caudal fins and the cheeks have blue lines across them. The pumpkinseed is noted for the orange-red spot on the margin of its black gill cover. The pectoral fins of a pumpkinseed can be amber or clear, while the dorsal spines are black. Pumpkinseeds have a small body that is shaped much like that of a pumpkinseed, giving them their common name. They have a small mouth with an upper jaw stopping right under the eye.',	'168144',	'Pumpkinseed',	'497.jpg',	'image/jpeg',	181189,	'2012-04-20 09:35:57',	524,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	270329,	1,	'FOOD00486'),
(498,	'Swordfish',	'Xiphias gladius',	'Swordfish, also known as broadbill in some countries, are large, highly migratory, predatory fish characterized by a long, flat bill. They are a popular sport fish of the billfish category, though elusive. Swordfish are elongated, round-bodied, and lose all teeth and scales by adulthood. These fish are found widely in tropical and temperate parts of the Atlantic, Pacific and Indian oceans, and can typically be found from near the surface to a depth of 550 m . They commonly reach 3 m in length, and the maximum reported is 4.55 m in length and 650 kg in weight. They are the sole member of their family Xiphiidae.',	'172482',	'Swordfish',	'498.jpg',	'image/jpeg',	67420,	'2012-04-20 09:38:03',	525,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8245,	1,	'FOOD00487'),
(499,	'Taro',	'Colocasia esculenta',	'Taro is a common name for the corms and tubers of several plants in the Araceae family. Of these, Colocasia esculenta is the most widely cultivated. Taro is native to southeast Asia. It is a perennial, tropical plant primarily grown as a root vegetable for its edible starchy corm, and as a leaf vegetable. It is a food staple in African, Oceanic and Asian cultures and is believed to have been one of the earliest cultivated plants. Colocasia is thought to have originated in the Indo-Malayan region, perhaps in eastern India and Bangladesh, and spread eastward into Southeast Asia, eastern Asia, and the Pacific islands; westward to Egypt and the eastern Mediterranean; and then southward and westward from there into East Africa and West Africa, whence it spread to the Caribbean and Americas. It is known by many local names and often referred to as \'elephant ears\' when grown as an ornamental plant.',	'42549',	'Taro',	'499.jpg',	'image/jpeg',	126657,	'2012-04-20 09:37:53',	526,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	4460,	1,	'FOOD00488'),
(500,	'Teff',	'Eragrostis tef',	'Eragrostis tef, teff, Williams lovegrass, annual bunch grass, taf (Tigrinya: ጣፍ? ṭaff; Amharic: ጤፍ? ṭēff) and xaafii (Oromo)), is an annual grass, a species of lovegrass native to the northern Ethiopian Highlands and Eritrean Highlands of the Horn of Africa. The word \"tef\" is connected by folk etymology to the Ethio-Semitic root \"\\tff\\\", which means \"lost\" (because of the small size of the grain).\r\nEragrostis tef has an attractive nutrition profile, being high in dietary fiber and iron and providing protein and calcium. It is similar to millet and quinoa in cooking, but the seed is much smaller and cooks faster, thus using less fuel.',	'40738',	'Teff',	'500.jpg',	'image/jpeg',	129416,	'2012-04-20 09:38:48',	527,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	110835,	1,	'FOOD00489'),
(501,	'Tilefish',	'Lopholatilus chamaeleonticeps',	'The great northern tilefish (Lopholatilus chamaeleonticeps), or golden tile, is the largest species in the family Malacanthidae (tilefishes), which grows to an average length between 38 and 44 inches (970 and 1,120 mm). The great northern tilefish is a slow-growing and long-lived species, which has four stages of life. After hatching from eggs, the larvae will be found in plankton. As they grow into juveniles, the individuals will seek shelter until finding or making their own burrows. As adults, the tilefish will continue to expand its burrow in the sediment throughout its life. The diet of the larvae is unknown, but presumed to consist of zooplankton; juveniles and adults feed upon various benthic invertebrates, crustaceans and fish. After reaching sexual maturity between 5 and 7 years of age, females will lay eggs throughout the mating season for the male to fertilize, with each female laying an average of 2.3 million eggs.',	'168546',	'Lopholatilus_chamaeleonticeps',	'501.jpg',	'image/jpeg',	129328,	'2012-04-20 09:30:02',	528,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	390349,	1,	'FOOD00490'),
(502,	'Mexican groundcherry',	'Physalis philadelphica var. immaculata',	'The tomatillo (Physalis philadelphica) is a plant of the nightshade family, related to the cape gooseberry, bearing small, spherical and green or green-purple fruit of the same name. Tomatillos originated in Mexico,[1] and are a staple of that country\'s cuisine. Tomatillos are grown as annuals throughout the Western Hemisphere. Tomatillos are generally eaten fried, boiled or steamed.\nThe tomatillo fruit is surrounded by an inedible, paper-like husk formed from the calyx. As the fruit matures, it fills the husk and can split it open by harvest. The husk turns brown, and the fruit can be several colors when ripe, including yellow, red, green, or even purple. Tomatillos are the key ingredient in fresh and cooked Mexican and Central-American green sauces. The freshness and greenness of the husk are quality criteria. Fruit should be firm and bright green, as the green color and tart flavor are the main culinary contributions of the fruit. Purple and red-ripening cultivars often have a slight sweetness, unlike the green- and yellow-ripening cultivars, and are therefore somewhat more suitable for fruit-like uses like jams and preserves. Like their close relatives cape gooseberries, tomatillos have a high pectin content. Another characteristic is they tend to have a varying degree of a sappy sticky coating, mostly when used on the green side out of the husk.',	'529632',	'Mexican_Groundcherry',	'502.jpg',	'image/jpeg',	2962,	'2012-04-20 09:38:44',	529,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	374021,	1,	'FOOD00491'),
(503,	'Towel gourd',	'Luffa aegyptiaca',	'Luffa is a genus of tropical and subtropical vines classified in the cucumber family. In everyday non-technical usage the name, also spelled loofah, usually refers to the fruit of the two species Luffa aegyptiaca and Luffa acutangula. The fruit of these species is cultivated and eaten as a vegetable. The fruit must be harvested at a young stage of development to be edible. The vegetable is popular in China and southeast Asia. When the fruit is fully ripened it is very fibrous. The fully developed fruit is the source of the loofah scrubbing sponge which is used in bathrooms and kitchens as a sponge tool. Luffa are not frost-hardy, and require 150 to 200 warm days to mature.',	'503570',	'Luffa',	'503.jpg',	'image/jpeg',	244634,	'2012-04-20 09:37:26',	530,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	3670,	1,	'FOOD00492'),
(504,	'Salmonidae (Salmon, Trout)',	'Salmonidae',	'Salmonidae are a family of ray-finned fish, the only living family currently placed in the order Salmoniformes. It includes salmon, trout, chars, freshwater whitefishes and graylings. The Atlantic salmon and trout of genus Salmo give the family and order their names. Salmonids have a relatively primitive appearance among the teleost fish, with the pelvic fins being placed far back, and an adipose fin towards the rear of the back. They are slender fish, with rounded scales and forked tails. Their mouths contain a single row of sharp teeth. Although the smallest species is just 13 centimetres long as an adult, most are much larger, and the largest can reach 2 metres . All salmonids spawn in fresh water, but in many cases, the fish spend most of their lives at sea, returning to the rivers only to reproduce. This life cycle is described as anadromous. They are predators, feeding on small crustaceans, aquatic insects, and smaller fish.',	'161931',	'Salmonidae',	'504.jpg',	'image/jpeg',	40317,	'2012-04-20 09:38:51',	531,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8015,	1,	'FOOD00493'),
(505,	'Turkey',	'Meleagris gallopavo',	'\"The wild turkey (Meleagris gallopavo) is native to North America and is the heaviest member of the diverse Galliformes. It is the same species as the domestic turkey, which was originally derived from a southern Mexican subspecies of wild turkey (not the related ocellated turkey). Adult wild turkeys have long reddish-yellow to grayish-green legs. The body feathers are generally blackish and dark brown overall with a coppery sheen that becomes more complex in adult males. Adult males, called toms or gobblers, have a large, featherless, reddish head, red throat, and red wattles on the throat and neck. The head has fleshy growths called caruncles. Juvenile males are called jakes, the difference between an adult male and a juvenile is that the jake has a very short beard and his tail fan has longer feathers in the middle. The adult male\'s tail fan will be all the same length. When males are excited, a fleshy flap on the bill expands, and this, the wattles and the bare skin of the head and neck all become engorged with blood, almost concealing the eyes and bill. The long fleshy object over a male\'s beak is called a snood. When a male turkey is excited, its head turns blue; when ready to fight, it turns red. Each foot has three toes in front, with a shorter, rear-facing toe in back; males have a spur behind each of their lower legs.\"',	'176136',	'Meleagris_gallopavo',	'505.jpg',	'image/jpeg',	191689,	NULL,	532,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	9103,	1,	'FOOD00494'),
(506,	'Cattle (Beef, Veal)',	'Bos taurus',	'Cattle (colloquially cows) are the most common type of large domesticated ungulates. They are a prominent modern member of the subfamily Bovinae, are the most widespread species of the genus Bos, and are most commonly classified collectively as Bos primigenius. Cattle are raised as livestock for meat (beef and veal), as dairy animals for milk and other dairy products, and as draft animals (oxen or bullocks) (pulling carts, plows and the like). Other products include leather and dung for manure or fuel. In some regions, such as parts of India, cattle have significant religious meaning. From as few as 80 progenitors domesticated in southeast Turkey about 10,500 years ago, an estimated 1.3 billion cattle are in the world today. In 2009, cattle became the first livestock animal to have a fully mapped genome.',	'183838',	'Cattle',	'506.jpg',	'image/jpeg',	187822,	NULL,	533,	'Animal foods',	'Bovines',	'Type 1',	'2018-01-18 03:18:03',	'2020-03-12 20:57:36',	NULL,	NULL,	1,	'specific',	9913,	1,	'FOOD00495'),
(507,	'Walleye',	'Sander vitreus',	'Walleye (Sander vitreus, formerly Stizostedion vitreum) is a freshwater perciform fish native to most of Canada and to the northern United States. It is a North American close relative of the European pikeperch. The walleye is sometimes called the yellow walleye to distinguish it from the blue walleye, which is an extinct subspecies formerly found in the southern Great Lakes. In some parts of its range, the walleye is known as the Colored Pike, Yellow Pike or Pickerel (esp. in English-speaking Canada), although the fish is not related to other species of pikes which are members of the family Esocidae. Genetically, walleyes show a fair amount of variation across watersheds. In general, fish within a watershed are quite similar and are genetically distinct from those of nearby watersheds. The species has been artificially propagated for over a century and has been planted on top of existing populations or introduced into waters naturally devoid of the species, sometimes reducing the overall genetic distinctiveness of populations.',	'650173',	'Walleye',	'507.jpg',	'image/jpeg',	62703,	'2012-04-20 09:44:19',	534,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	283036,	1,	'FOOD00496'),
(508,	'Alaska pollock',	'Theragra chalcogramma',	'Alaska pollock or walleye pollock (Theragra chalcogramma) is a species of the cod family Gadidae. Alaska pollock is a semipelagic schooling fish widely distributed in the North Pacific with largest concentrations found in the eastern Bering Sea. While related to the common Atlantic pollock species of the same family, the Alaska pollock is not a member of the same Pollachius genus. Rather, recent research suggests that it is more closely related to Atlantic cod, and that Alaska pollock should be moved back to genus Gadus in which it was originally described as Gadus chalcogrammus. Furthermore, Norwegian pollock (Theragra finnmarchica), a rare fish of Norwegian waters, is likely the same species as the Alaska pollock.',	'164722',	'Alaska pollock',	'508.jpg',	'image/jpeg',	62703,	'2012-04-20 09:32:02',	535,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	1042646,	1,	'FOOD00497'),
(509,	'Wasabi',	'Wasabia japonica',	'Wasabi (ワサビ or わさび（山葵）, earlier 和佐比; Eutrema japonicum or Wasabia japonica) is a plant of the Brassicaceae family, which includes cabbages, horseradish, and mustard. It is also called Japanese horseradish, although horseradish is a different plant (which is generally used as a substitute for wasabi, due to the scarcity of the wasabi plant). Its stem is used as a condiment and has an extremely strong pungency more akin to hot mustard than the capsaicin in a chili pepper, producing vapours that stimulate the nasal passages more than the tongue. The plant grows naturally along stream beds in mountain river valleys in Japan. The two main cultivars in the marketplace are E. japonicum \'Daruma\' and \'Mazuma\', but there are many others. The origin of wasabi cuisine has been clarified from the oldest historical records; it takes its rise in Nara prefecture, and more recently has seen a surge in popularity from the early 1990s to mid 2000s. The plant grows naturally along stream beds in mountain river valleys in Japan. The two main cultivars in the marketplace are W. japonica \'Daruma\' and \'Mazuma\', but there are many others. The chemical in wasabi that provides for its initial pungency is the volatile allyl isothiocyanate, which is produced by hydrolysis of natural thioglucosides (conjugates of the sugar glucose, and sulfur-containing organic compounds); the hydrolysis reaction is catalyzed by myrosinase and occurs when the enzyme is released on cell rupture caused by maceration – e.g., grating – of the plant. The same compound is responsible for the pungency of horseradish and mustard. Allyl isothiocyanate can also be released when the wasabi plants have been damaged, because it is being used as a defense mechanism. Research has shown that such isothiocyanates inhibit microbe growth, perhaps with implications for preserving food against spoilage and suppressing oral bacterial growth. [Wikipedia]',	'506210',	'Wasabi',	'509.jpg',	'image/jpeg',	51475,	'2012-04-20 09:39:13',	536,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	75806,	1,	'FOOD00498'),
(510,	'Wax gourd',	'Benincasa hispida',	'The winter melon, also called white gourd, winter gourd, tallow gourd, Chinese preserving melon, or ash gourd, is a vine grown for its very large fruit, eaten as a vegetable when mature. It is the only member of the genus Benincasa. The fruit is fuzzy when young. The immature melon has thick white flesh that is sweet when eaten. By maturity, the fruit loses its hairs and develops a waxy coating, giving rise to the name wax gourd, and providing a long shelf life. The melon may grow as large as 80 cm in length. Although the fruit is referred to as a \"melon,\" the fully grown crop is not sweet. Originally cultivated in Southeast Asia, the winter melon is now widely grown in East Asia and South Asia as well.\nWinter melon is also a common name for members of the Inodorus cultivar group of the muskmelon (Cucumis melo L), more commonly known as casaba or honeydew melons.',	'505894',	'Wax_gourd',	'510.jpg',	'image/jpeg',	39955,	'2012-04-20 09:39:24',	537,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	102211,	1,	'FOOD00499'),
(511,	'Whelk',	'Buccinidae',	'Whelk is a common name that is applied to various kinds of sea snail, many of which have historically been used, or are still used, by humans for food. Although a number of whelks are relatively large and are in the family Buccinidae (the true whelks), the word whelk is also applied to some other marine gastropod mollusc species within several families of sea snails that are not very closely related.',	'73726',	'Whelk',	'511.jpg',	'image/jpeg',	100731,	'2012-04-20 09:39:24',	538,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:45',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	37796,	1,	'FOOD00500'),
(512,	'Coalfish pollock',	'Pollachius virens',	'Saithe, Pollachius virens, is a species of marine fish in the Pollachius genus. Together with Pollachius pollachius it is generally referred to in the U.S. as Pollock. Other names include the Boston blues (separate from bluefish), coalfish (or coley) and saithe in the UK.\nThis species can be separated from P. pollachius by looking at the relative lengths of the upper and lower jaws. P. pollachius has a longer underslung lower jaw while Pollachius virens has approximately equal upper and lower jaw lengths. This gives a very different profile to the head. In general P. pollachius is a brown or golden colour with a dark back while P. virens is bright silver with a very dark green back. P. virens generally appears to have relatively larger eyes. The lateral line of P. pollachius has a noticeable kink over the pectoral fins while that of P. virens is straighter. The flesh of Coalfish (P. virens) is darkly coloured (hence the common name) while that of P. pollachius is similar to other members of the Cod family. This dark colour in the fresh uncooked flesh may have led to the undeserved reputation of this fish as poor for eating.\nIt is common in the northern parts of the Northern Atlantic, including the Bay of Biscay. Adults can grow up to 130 centimetres (51 in) and weigh up to 32 kilograms (71 lb); the species is of great commercial value to fisheries. The fish can be found close to the shore, particularly in rocky areas but larger examples tend to be found around off-shore wrecks and reefs. The largest coalfish ever caught was 50 pounds (23 kg) at Saltstraumen.',	'164727',	'Pollachius_virens',	'512.jpg',	'image/jpeg',	63164,	'2012-04-20 09:37:17',	539,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8060,	1,	'FOOD00501'),
(513,	'Broad whitefish',	'Coregonus nasus',	'The broad whitefish (Coregonus nasus) is a freshwater whitefish species. Dark silvery in colour, and like a herring in its shape, its distinctive features include a convex head, short gill rakers, and a mild overbite. It is found in the Arctic-draining streams, lakes, and rivers of far eastern Russia and North America. Its prey includes larval insects, snails, and shellfish. It is eaten by humans and brown bears.',	'161936',	'Broad whitefish',	'513.jpg',	'image/jpeg',	68773,	'2012-04-20 09:34:15',	540,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	348707,	1,	'FOOD00502'),
(514,	'Whitefish',	'Coregonus',	'Coregonus is a diverse genus of fish in the salmon family (Salmonidae). The type species is Coregonus lavaretus. The Coregonus species are known as whitefishes. The genus contains at least 68 described extant taxa, but the true number of species is a matter of debate.\nSeveral species, including the Arctic cisco (C. autumnalis), the Bering cisco (C. laurettae), and the least cisco (C. sardinella) are anadromous, moving between salt water and fresh water.\nThe genus was previously subdivided into two subgenera Coregonus (\"true whitefishes\") and Leucichthys (\"ciscoes\"), Coregonus comprising taxa with sub-terminal mouth and usually a benthic feeding habit, Leucichthys those with terminal or supra-terminal mouth and usually a pelagic plankton-feeding habit. This classification is not natural however: based on molecular data, ciscoes comprise two distinct lineages within the genus. Moreover, the genus Stenodus is not phylogenetically distinct from Coregonus.\nMany whitefish species or ecotypes, especially from the Great Lakes and the Alpine lakes of Europe, have gone extinct over the past century or are endangered. All Coregonus species are protected under appendix III of the Bern Convention.',	'161932',	'Coregonus',	'514.jpg',	'image/jpeg',	55556,	'2012-04-20 09:44:01',	541,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	27772,	1,	'FOOD00503'),
(515,	'Whiting',	'Merlangius merlangus',	'Merlangius merlangus, commonly known as whiting, is an important food fish in the eastern North Atlantic Ocean and the northern Mediterranean, western Baltic, and Black Seas. In English-speaking countries outside the whiting\'s natural range, the name has been applied to various other species of fish.\nMerlangius merlangus has three dorsal fins with a total of 30 to 40 soft rays and two anal fins with 30 to 35 soft rays. The body is long and the head small and a chin barbel, if present, is very small. This fish can reach a maximum length of about 70 cm (28 inches). The colour may be yellowish-brown, greenish or dark blue, the flanks yellowish grey or white and the belly silvery. There is a distinctive black blotch near the base of each pectoral fin.',	'164701',	'Merlangius_merlangus',	'515.jpg',	'image/jpeg',	123866,	'2012-04-20 09:32:25',	542,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8058,	1,	'FOOD00504'),
(516,	'Wild rice',	'Zizania',	'Wild rice (also called Canada rice, Indian rice, and water oats) are four species of grasses forming the genus Zizania, and the grain which can be harvested from them. The grain was historically gathered and eaten in both North America and China. While it is now a delicacy in North America, the grain is eaten less in China, where the plant\'s stem is used as a vegetable.\nWild rice is not directly related to Asian rice (Oryza sativa), whose wild progenitors are O. rufipogon and O. nivara, although they are close cousins, sharing the tribe Oryzeae. Wild rice grains have a chewy outer sheath with a tender inner grain that has a slightly vegetal taste.\nThe plants grow in shallow water in small lakes and slow-flowing streams; often, only the flowering head of wild rice rises above the water. The grain is eaten by dabbling ducks and other aquatic wildlife, as well as humans.',	'41318',	'Wild_rice',	'516.jpg',	'image/jpeg',	85244,	'2012-04-20 09:39:46',	543,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	15949,	1,	'FOOD00505'),
(517,	'Tea leaf willow',	'Salix pulchra',	'Salix pulchra is a species of flowering plant in the willow family, known by the common names diamondleaf willow, tealeaf willow, and thin red willow. It is native to northern North America, where it occurs in Alaska, Yukon, the Northwest Territories, and Nunavut. The species is also found in northern British Columbia, and occurs in Russia. This willow is an erect, deciduous shrub growing up to 4.6 m tall, but usually remaining smaller, especially in the Arctic and in alpine climates. Along with S. richardsonii and S. alaxensis, it is one of the tallest growing willows in the Canadian Arctic Archipelago. The species is dioecious, with male and female reproductive parts occurring on separate individuals. The inflorescence is a catkin. The catkins grow before the leaves appear in the spring. The leaves are green above and whitish underneath, and hairless. This plant is a dominant species on the tundra in many areas. It commonly grows with sedges. It may form thickets with other species of willow along waterways and on floodplains. It grows in spruce woodlands and muskegs. It grows above the timberline in interior Alaska, and at the timberline in northern Alaska. It often sprouts and grows after wildfire, and it persists in open habitat. This species was formerly known as S. planifolia subsp. pulchra, a subspecies of S. planifolia, but has since been treated as a distinct species. The two willow species have overlapping distribution and similar appearance, but can be distinguished by the longer stipules in S. pulchra. In areas where both willows occur, S. pulchra is often found at high elevations. S. pulchra and S. planifolia also form natural hybrids. S. pulchra is one of the least bitter-tasting willows in Alaska, and in the springtime, young leaves may be harvested for human consumption. The leaves and shoots were eaten by the Eskimo raw and dried, or stored in seal oil for future use. The leaves were also used to brew tea and make soup. At Nunivak Island, parts of this plant were chewed to treat ailments such as mouth sores and pain. This willow also provides a good source of vitamin C. Apart from medicinal purposes, Native Americans used parts of willows, including this species, in basket weaving, to make bows and arrows, and for building animal traps.',	'22488',	'Salix pulchra',	'517.jpg',	'image/jpeg',	42818,	'2012-04-20 09:41:39',	544,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	669814,	1,	'FOOD00506'),
(518,	'Winged bean',	'Psophocarpus tetragonolobus',	'The Winged bean (Psophocarpus tetragonolobus), also known as the Goa bean and Asparagus pea, Four-angled bean and Winged pea, is a tropical legume plant native to New Guinea. It grows abundantly in hot, humid equatorial countries, from the Philippines and Indonesia to India, Burma, Thailand and Sri Lanka. It does well in humid tropics with high rainfall. There are also varieties that can be grown in most areas of the U.S.. The winged bean plant grows as a vine with climbing stems and leaves, 3–4 m in height. It is an herbaceous perennial, but can be grown as an annual. It is generally taller and notably larger than the Common bean. The bean pod is typically 15–22 cm (6–9 in) long and has four wings with frilly edges running lengthwise. The skin is waxy and the flesh partially translucent in the young pods. When the pod is fully ripe, it turns an ash-brown color and splits open to release the seeds. The large flower is a pale blue. The beans themselves are similar to soybeans in both use and nutritional content (being 29.8% to 39% protein). The plant is one of the best nitrogen fixers with nodulation accomplished by the soil bacterium Rhizobium. Because of its ability to fix nitrogen from the atmosphere, the plant requires very little or no fertilizers. Being a tropical plant, it is sensitive to frost. Most plants will not flower if the day length is more than 12 hours, meaning they will not produce pods in most temperate zones, although day length neutral cultivars do exist. The seeds have a hard coat and it helps to soak them before planting to hasten germination. The plant grows very quickly, reaching a length of four meters in a few weeks.',	'506265',	'Winged bean',	'518.jpg',	'image/jpeg',	38758,	'2012-04-20 09:41:30',	545,	'Pulses',	'Beans',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	3891,	1,	'FOOD00507'),
(519,	'Yam',	'Dioscorea',	'Yam is the common name for some plant species in the genus Dioscorea (family Dioscoreaceae) that form edible tubers. These are perennial herbaceous vines cultivated for the consumption of their starchy tubers in Africa, Asia, Latin America, the Caribbean and Oceania. There are many cultivars of yam. Although some varieties of sweet potato (Ipomoea batatas) are also called yam in parts of the United States and Canada, it is not part of the family Dioscoreaceae; rather it is in the morning glory family Convolvulaceae.\nThe true yam is a versatile vegetable. It can be barbecued, roasted, fried, grilled, boiled, baked, smoked and when grated it is processed into a dessert recipe. Yams are the staple crop of the Igbo people of Nigeria, in their language it is known as ji, and they commemorate it by having yam festivals known as Iri-ji or Iwa-Ji depending on the dialect.\nYams are a primary agricultural and culturally important commodity in West Africa, where over 95 percent of the world\'s yam crop is harvested. Yams are still important for survival in these regions. Some varieties of these tubers can be stored up to six months without refrigeration, which makes them a valuable resource for the yearly period of food scarcity at the beginning of the wet season. Yam cultivars are also cropped in other humid tropical countries.\nYam tubers can grow up to 1.5 meters (4.9 feet) in length and weigh up to 70 kilograms (154 lb) and 3 to 6 inches high. The vegetable has a rough skin which is difficult to peel, but which softens after heating. The skins vary in color from dark brown to light pink. The majority of the vegetable is composed of a much softer substance known as the \"meat\". This substance ranges in color from white or yellow to purple or pink in mature yams.',	'43366',	'Yam_(vegetable)',	'519.jpg',	'image/jpeg',	74561,	'2012-04-20 09:29:58',	546,	'Vegetables',	'Tubers',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	4672,	1,	'FOOD00508'),
(520,	'Jicama',	'Pachyrhizus erosus',	'Pachyrhizus erosus, commonly known as jicama, Mexican yam, or Mexican turnip, is the name of a native Mexican vine, although the name most commonly refers to the plant\'s edible tuberous root. Jícama is a species in the genus Pachyrhizus in the bean family (Fabaceae). Plants in this genus are commonly referred to as yam bean, although the term \"yam bean\" can be another name for jícama. The other major species of yam beans are also indigenous within the Americas.\nFlowers, either blue or white, and pods similar to lima beans, are produced on fully developed plants. Several species of jicama occur, but the one found in [many] markets is Pachyrrizus erosus. The two cultivated forms of P. erosus are jicama de agua and jicama de leche. The latter has an elongated root and milky juice. The agua form has a top-shaped to oblate root, a translucent juice, and is the preferred form for market.',	'26824',	'Jicama',	'520.jpg',	'image/jpeg',	119712,	'2012-04-20 09:30:46',	547,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	109171,	1,	'FOOD00509'),
(521,	'Yautia',	'Xanthosoma sagittifolium',	'Xanthosoma sagittifolium, the arrowleaf elephant ear or arrowleaf elephant\'s ear, is a species of tropical flowering plant in the genus Xanthosoma, which produces an edible, starchy tuber.',	'42586',	'Xanthosoma sagittifolium',	'521.jpg',	'image/jpeg',	176912,	'2012-04-20 09:42:02',	548,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	28478,	1,	'FOOD00510'),
(522,	'Yellowfin tuna',	'Thunnus albacares',	'The yellowfin tuna (Thunnus albacares) is a species of tuna found in pelagic waters of tropical and subtropical oceans worldwide.\nThe yellowfin tuna is among the larger tuna species, reaching weights of over 180 kg (400 lb), but is significantly smaller than the Atlantic and Pacific bluefin tunas, which can reach over 450 kg (990 lb), and slightly smaller than the bigeye tuna and the southern bluefin tuna.\nThe second dorsal fin and the anal fin, as well as the finlets between those fins and the tail, are bright yellow, giving this fish its common name. The second dorsal and anal fins can be very long in mature specimens, reaching almost as far back as the tail and giving the appearance of sickles or scimitars. The pectoral fins are also longer than the related bluefin tuna, but not as long as those of the albacore. The main body is a very dark metallic blue, changing to silver on the belly, which has about 20 vertical lines.',	'172423',	'Yellowfin_tuna',	'522.jpg',	'image/jpeg',	92608,	'2012-04-20 09:32:31',	549,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8236,	1,	'FOOD00511'),
(523,	'Yellowtail amberjack',	'Seriola lalandi',	'The yellowtail amberjack or great amberjack, Seriola lalandi, buri or hiramasa is a large fish found in the Pacific and Indian Oceans. It can be divided into three subspecies: The California yellowtail, Seriola lalandi dorsalis The southern yellowtail, or in New Zealand and Australia the yellowtail kingfish or kingfish S. l. lalandi The Asian yellowtail, S. l. aureovitta.',	'168695',	'Yellowtail amberjack',	'523.jpg',	'image/jpeg',	130209,	'2012-04-20 09:43:54',	550,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	302047,	1,	'FOOD00512'),
(524,	'Pollock',	'Pollachius',	'Pollock (alternatively spelled pollack) is the common name used for either of the two species of marine fish in the Pollachius (\"P.\") genus. Both P. pollachius and P. virens are commonly referred to as pollock. Other names for P. pollachius include the Atlantic pollock, European pollock, lieu jaune, and lythe; while P. virens is sometimes known as Boston blues (distinct from bluefish), coalfish (or coley), silver bills or saithe.\nBoth species can grow to 3 ft 6 in (1.07 m) and can weigh up to 46 lb (21 kg). P.virens has a strongly-defined, silvery lateral line running down the sides. Above the lateral line, the color is a greenish black. The belly is white, while P.pollachius has a distinctly crocked lateral line, gray-ish to golden belly and a dark brown back. P. pollachius also has a strong under-bite. It can be found in water up to 100 fathoms (180 m) deep over rocks, and anywhere in the water column. Pollock are a \"whitefish\".',	'164726',	'Pollock',	'524.jpg',	'image/jpeg',	9258,	'2012-04-20 09:37:10',	551,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8059,	1,	'FOOD00513'),
(525,	'Albacore tuna',	'Thunnus alalunga',	'The albacore, Thunnus alalunga, is a species of tuna in the family Scombridae. This species is also called albacore fish, albacore tuna, albicore, albie, pigfish, tombo ahi, binnaga, Pacific albacore, German bonito (but see bonito), longfin, longfin tuna, longfin tunny, or even just tuna. It is the only tuna species which may be marketed as \"white meat tuna\" in the United States. It is found in the open waters of all tropical and temperate oceans, and the Mediterranean Sea.\nAlbacore is a prized food, and the albacore fishery is economically significant. Methods of fishing include pole and line, long-line fishing, trolling, and some purse seining. It is also sought after by sport fishers.',	'172419',	'Albacore_tuna',	'525.jpg',	'image/jpeg',	80468,	'2012-04-20 09:42:53',	552,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8235,	1,	'FOOD00514'),
(526,	'Gadus (Common cod)',	'Gadus',	'Gadus is a genus of demersal fish in the family Gadidae, commonly known as cod, although there are additional cod species in other genera. Until recently, three species in the genus were recognized. Modern taxonomy also includes a fourth one, the Alaska pollock (Gadus chalcogrammus), which is not separate from the Norway pollock. Furthermore, Greenland cod (G. ogac) is no longer considered a distinct species but rather a subspecies of Pacific cod (G. macrocephalus).',	'164710',	'Gadus',	'526.jpg',	'image/jpeg',	196359,	'2012-04-20 09:29:55',	553,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8048,	1,	'FOOD00515'),
(527,	'Atlantic halibut',	'Hippoglossus hippoglossus',	'The Atlantic halibut, Hippoglossus hippoglossus, is a flatfish of the family Pleuronectidae. They are demersal fish living on or near sand, gravel or clay bottoms at depths of between 50 and 2,000 m (and ft). The halibut is among the largest teleost (bony) fish in the world. Halibut are strong swimmers and are able to migrate long distances. Halibut size is not age-specific, but rather tends to follow a cycle related to halibut (and therefore food) abundance. The native habitat of the Atlantic halibut is the temperate waters of the northern Atlantic, from Labrador and Greenland to Iceland, the Barents Sea and as far south as the Bay of Biscay. It is the largest flatfish in the Atlantic and one of the largest species of flatfish in the world, reaching lengths of up to 4.7 m and weights of 320 kg . Its lifespan can reach 50 years.',	'172933',	'Atlantic halibut',	'527.jpg',	'image/jpeg',	59479,	'2012-04-20 09:33:33',	554,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8267,	1,	'FOOD00516'),
(528,	'Pacific halibut',	'Hippoglossus stenolepis',	'Hippoglossus stenolepis, the Pacific Halibut, is a species of righteye flounder. This very large species of flatfish is native to the North Pacific and supports important commercial fishery.\nPacific halibut have diamond-shaped bodies. They are more elongated than most flatfishes, the width being about one-third of the length. It has a high arch in the lateral line over the pectoral fin, and a lunate, or crescent-shaped tail, which is different from other flat fishes. Small scales are embedded in the skin. Halibut have both eyes on their dark or upper sides. The color on the dark side varies, but tends to assume the coloration of the ocean bottom. The underside is lighter, appearing more like the sky from below. This color adaptation allows halibut to avoid detection by both prey and predator. They are one of the largest flatfish (only surpassed by the closely related Atlantic halibut), and can weigh up to 500 lb (230 kg) and grow to over 8 ft (2.4 m) long.',	'172932',	'Pacific_halibut',	'528.jpg',	'image/jpeg',	76074,	'2012-04-20 09:40:56',	555,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	195615,	1,	'FOOD00517'),
(529,	'Pacific salmon',	'Oncorhynchus',	'Oncorhynchus is a genus of fish in the family Salmonidae; it contains the Pacific salmon and Pacific trout. The name of the genus is derived from the Greek onkos (\"hook\") and rynchos (\"nose\"), in reference to the hooked jaws of males in the mating season (the \"kype\").\nSalmon and trout with native ranges in waters draining to the Pacific Ocean are members of the genus. Their range extends from Beringia southwards, roughly to Japan in the west and Mexico to the east. In North America, some subspecies of O. clarki are native in the Rocky Mountains and Great Basin, while others are native to the Rio Grande and western tributaries of the Mississippi River Basin which drain to the Gulf of Mexico, rather than to the Pacific. Several species of Oncorhynchus have been introduced into non-native waters around the globe establishing self-sustaining wild populations.',	'161974',	'Pacific_salmon',	'529.jpg',	'image/jpeg',	58659,	'2012-04-20 09:32:42',	556,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8016,	1,	'FOOD00518'),
(530,	'Smelt',	'Osmeridae',	'Smelts are a family of small fish, Osmeridae, found in the Atlantic and Pacific Oceans. They are also known as freshwater smelts or typical smelts to distinguish them from the related Argentinidae, Bathylagidae, and Retropinnidae.\nSome smelt species are common in the North American Great Lakes, and in the lakes and seas of the northern part of Europe, where they run in large shoals along the saltwater coastline during spring migration to their spawning streams.\nIn size, smelts usually grow to about 20 cm (7.9 in) long, although some species can reach 70 cm (28 in). Smelts are a food source for salmon and lake trout.\nLike salmon, many species are anadromous, living most of their lives in the sea, but traveling into fresh water to breed. However, a few exceptions, such as the surf smelt, spend their entire lives at sea.',	'162028',	'Osmeridae',	'530.jpg',	'image/jpeg',	115406,	'2012-04-20 09:39:29',	557,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:46',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8012,	1,	'FOOD00519'),
(531,	'Clupeinae (Herring, Sardine, Sprat)',	'Clupeinae',	'Clupeinae is a subfamily of herrings, sardines and sprats belonging to the family Clupeidae.',	'551153',	'Clupeinae',	'531.jpg',	'image/jpeg',	9510,	'2012-04-20 09:29:57',	558,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	7948,	1,	'FOOD00520'),
(532,	'Spiny lobster',	'Palinuridae',	'Spiny lobsters, also known as langouste or rock lobsters, are a family (Palinuridae) of about 60 species of achelate crustaceans, in the Decapoda Reptantia. Spiny lobsters are also, especially in Australia, New Zealand and South Africa, sometimes called crayfish, sea crayfish or crawfish, terms which elsewhere are reserved for freshwater crayfish.',	'97646',	'Spiny lobster',	'532.jpg',	'image/jpeg',	153311,	'2012-04-20 09:42:03',	559,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	6731,	1,	'FOOD00521'),
(533,	'Snow crab',	'Chionoecetes opilio',	'Chionoecetes is a genus of crabs that live in the northern Pacific and Atlantic Oceans.\r\nOther names for crabs in this genus include \"queen crab\" (in Canada) and \"spider crab\" - they are known by different names in different areas of the world. The generic name Chionoecetes means (χιών, chion) inhabitant (οιχητης, oiketes); opilio means shepherd, and C. opilio is the primary species referred to as snow crab. Marketing strategies, however, employ snow crab for anything in the genus Chionoecetes. Snow crab refers to them being commonly found in cold northern oceans.\r\nSnow crab are caught as far north as the Arctic Ocean, from Newfoundland to Greenland and north of Norway in the Atlantic Ocean, and across the Pacific Ocean, including the Sea of Japan, the Bering Sea, the Gulf of Alaska, Norton Sound, and even as far south as California for Chionoecetes bairdi.',	'98428',	'Snow_crab',	'533.jpg',	'image/jpeg',	60656,	'2012-04-20 09:43:05',	560,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	41210,	1,	'FOOD00522'),
(534,	'Black-eyed pea',	'Vigna unguiculata ssp. unguiculata',	'The black-eyed pea or black-eyed bean, a legume, is a subspecies of the cowpea, grown around the world for its medium-sized, edible bean. The bean mutates easily, giving rise to a number of varieties. The common commercial one is called the California Blackeye; it is pale-colored with a prominent black spot. The currently accepted botanical name is Vigna unguiculata subsp. unguiculata, although previously it was classified in the genus Phaseolus. Vigna unguiculata subsp. dekindtiana is the wild relative and Vigna unguiculata subsp. sesquipedalis is the related asparagus bean. Other beans of somewhat similar appearance, such as the frijol ojo de cabra (goat\'s eye bean) of northern Mexico, are sometimes incorrectly called black-eyed peas, and vice versa.',	'524855',	'Black-eyed pea',	'534.jpg',	'image/jpeg',	97604,	'2012-04-20 09:36:16',	561,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	3920,	1,	'FOOD00523'),
(535,	'Deer',	'Cervidae',	'Deer (singular and plural) are the ruminant mammals forming the family Cervidae. Species in the Cervidae family include white-tailed deer, mule deer such as black-tailed deer, elk, moose, red deer, reindeer (caribou), fallow deer, roe deer and chital. Male deer of all species (except the Chinese water deer) and also female reindeer grow and shed new antlers each year. In this they differ from permanently horned animals such as antelope; these are in the same order as deer and may bear a superficial resemblance. The musk deer of Asia and water chevrotain (or mouse deer) of tropical African and Asian forests are not usually regarded as true deer and form their own families, Moschidae and Tragulidae, respectively.',	'180693',	'Deer',	'535.jpg',	'image/jpeg',	114690,	NULL,	562,	'Animal foods',	'Venison',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	9850,	1,	'FOOD00524'),
(536,	'Macadamia nut',	'Macadamia',	'Macadamia is a genus of four species of trees indigenous to Australia and constituting part of the plant family Proteaceae. They grow naturally in north eastern New South Wales and central and south eastern Queensland. Common names include macadamia, macadamia nut, Queensland nut, bush nut, maroochi nut, queen of nuts and bauple nut; and from Indigenous Australians\' languages bauple, gyndl, jindilli, and boombera. Previously, more species, with disjunct distributions, were named as members of this genus Macadamia. Genetics and morphological studies more recently published in 2008 by Austin Mast and colleagues show they have separated from this genus Macadamia, correlating less closely than thought from earlier morphological studies.\nMacadamia species grow as small to large evergreen trees 2?12 m (6.6?39.4 ft) tall. The leaves are arranged in whorls of three to six, lanceolate to obovate or elliptical in shape, 6?30 cm long and 2?13 cm broad, with an entire or spiny-serrated margin. The flowers are produced in a long, slender, simple raceme 5?30 cm long, the individual flowers 10?15 mm long, white to pink or purple, with four tepals. The fruit is a very hard, woody, globose follicle with a pointed apex, containing one or two seeds.',	'27784',	'Macadamia_nut',	'536.jpg',	'image/jpeg',	68445,	'2012-04-20 09:39:27',	563,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	4329,	1,	'FOOD00525'),
(537,	'Percoidei (Bass and others)',	'Percoidei',	'Percoidei is one of eighteen suborders of bony fish in the order Perciformes. Many commercially harvested fish species are contained in this suborder, including the snappers, jacks, whitings, groupers, bass, perches and porgies.',	'167641',	'Percoidei',	'537.jpg',	'image/jpeg',	7238,	'2012-04-20 09:39:37',	564,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8112,	1,	'FOOD00526'),
(538,	'Perciformes',	'Perciformes',	'Perciformes, also called the Percomorphi or Acanthopteri, are the largest order of vertebrates, containing about 40% of all bony fish. Perciformes means \"perch-like\". They belong to the class of ray-finned fish, and comprise over 10,000 species found in almost all aquatic ecosystems.\nThe order contains about 160 families, which is the most of any order within the vertebrates. It is also the most variably sized order of vertebrates, ranging from the 7-mm (1/4-in) Schindleria brevipinguis to the marlins in the Makaira species. They first appeared and diversified in the Late Cretaceous.\nAmong the well-known members of this group are cichlids, California sheephead, bluegills, damselfish, bass, and perch.',	'167640',	'Perciformes',	'538.jpg',	'image/jpeg',	31767,	'2012-04-20 09:31:27',	565,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	8111,	1,	'FOOD00527'),
(540,	'Rabbit',	'Leporidae',	'Rabbits are small mammals in the family Leporidae of the order Lagomorpha, found in several parts of the world. There are eight different genera in the family classified as rabbits, including the European rabbit (Oryctolagus cuniculus), cottontail rabbits (genus Sylvilagus; 13 species), and the Amami rabbit. There are many other species of rabbit, and these, along with pikas and hares, make up the order Lagomorpha. The male is called a buck and the female is a doe; a young rabbit is a kitten or kit.',	'180110',	'Rabbit',	'540.jpg',	'image/jpeg',	84351,	NULL,	567,	'Animal foods',	'Lagomorphs',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	9979,	1,	'FOOD00528'),
(541,	'Domestic goat',	'Capra aegagrus hircus',	'\"The domestic goat (Capra aegagrus hircus) is a subspecies of goat domesticated from the wild goat of southwest Asia and Eastern Europe. The goat is a member of the family Bovidae and is closely related to the sheep as both are in the goat-antelope subfamily Caprinae. There are over 300 distinct breeds of goat. Goats are one of the oldest domesticated species, and have been used for their milk, meat, hair, and skins over much of the world. In 2011, there were more than 924 million live goats around the globe, according to the UN Food and Agriculture Organization. Female goats are referred to as \"\"does\"\" or \"\"nannies\"\", intact males as \"\"bucks\"\" or \"\"billies\"\", and their offspring are \"\"kids\"\". Castrated males are \"\"wethers\"\". Goat meat from younger animals is called \"\"kid\"\" or cabrito (Spanish), and from older animals is simply known as \"\"goat\"\" or sometimes called chevon (French), or in some areas \"\"mutton\"\" (which more often refers to adult sheep meat).\"',	'180715',	'Domestic_goat',	'541.jpg',	'image/jpeg',	61623,	NULL,	568,	'Animal foods',	'Caprae',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	9925,	1,	'FOOD00529'),
(542,	'Beefalo',	'Bos taurus X Bison bison',	'\"Beefalo are a fertile hybrid offspring of domestic cattle, generally a male in managed breeding programs currently, Bos taurus, and the American bison, usually a female in managed breeding programs currently, Bison bison (generally called buffalo in the US). The breed was created to combine the characteristics of both animals for beef production. Beefalo are primarily cattle in genetics and appearance, with the breed association defining a full beefalo as one with 3?8 (37.5%) bison genetics, while animals with higher percentages of bison genetics are called \"\"bison hybrids\"\".\"',	NULL,	'Beefalo',	'542.jpg',	'image/jpeg',	20154,	NULL,	569,	'Animal foods',	'Bovines',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	297284,	1,	'FOOD00530'),
(544,	'Bivalvia (Clam, Mussel, Oyster)',	'Bivalvia',	'Bivalvia is a class of marine and freshwater molluscs that have laterally compressed bodies enclosed by a shell consisting of two hinged parts. They have no head, and they also lack a radula. Bivalves include clams, oysters, cockles, mussels, scallops, and numerous other families that live in saltwater, and well as a number of families that live in freshwater. The majority are filter feeders. The gills have evolved into ctenidia, specialised organs for feeding and breathing. Most bivalves bury themselves in sediment, where they are relatively safe from predation. Others lie on the sea floor or attach themselves to rocks or other hard surfaces. A few bore into wood, clay or stone and live inside these substances. Some bivalves, such as the scallops, can swim.\nThe shell of a bivalve is composed of calcium carbonate, and consists of two, usually similar, parts called valves. These are joined together along one edge (the hinge line) by a flexible ligament that, usually in conjunction with interlocking \"teeth\" on each of the valves, forms the hinge. This arrangement allows the shell to be opened and closed without the two halves becoming disarticulated. The shell is typically bilaterally symmetrical, with the hinge lying in the sagittal plane. Adult shell sizes of bivalves vary from fractions of a millimetre to over a metre in length, but the majority of species do not exceed 10 cm (4 in).',	'79118',	'Bivalvia',	'544.jpg',	'image/jpeg',	8368,	'2012-04-20 09:42:42',	571,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	6544,	1,	'FOOD00531'),
(545,	'Squid',	'Teuthida',	'Squid are cephalopods of the order Teuthida, which comprises around 300 species. Like all other cephalopods, squid have a distinct head, bilateral symmetry, a mantle, and arms. Squid, like cuttlefish, have eight arms arranged in pairs and two, usually longer, tentacles. Squid are strong swimmers and certain species can \"fly\" for short distances out of the water.',	'82367',	'Squid',	'545.jpg',	'image/jpeg',	93598,	'2012-04-20 09:36:24',	572,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	551290,	1,	'FOOD00532'),
(546,	'Shrimp',	'Caridea',	'The term shrimp is used to refer to some decapod crustaceans, although the exact animals covered can vary. Used broadly, it may cover any of the groups with elongated bodies and a primarily swimming mode of locomotion – chiefly Caridea and Dendrobranchiata. In some fields, however, the term is used more narrowly, and may be restricted to Caridea, to smaller species of either group, or to only the marine species. Under the broader definition, shrimp may be synonymous with prawn, covering stalk-eyed swimming crustaceans with long narrow muscular tails, long whiskers and slender legs. They swim forwards by paddling with swimmerets on the underside of their abdomens. Crabs and lobsters have strong walking legs, whereas shrimp have thin fragile legs which they use primarily for perching. Shrimp are widespread and abundant. They can be found feeding near the seafloor on most coasts and estuaries, as well as in rivers and lakes. To escape predators, some species flip off the seafloor and dive into the sediment. They usually live from one to seven years. Shrimp are often solitary, though they can form large schools during the spawning season. There are thousands of species, and usually there is a species adapted to any particular habitat. Any small crustacean which resembles a shrimp tends to be called one. They play important roles in the food chain and are important food sources for larger animals from fish to whales. The muscular tails of shrimp can be delicious to eat, and they are widely caught and farmed for human consumption. Commercial shrimp species support an industry worth 50 billion dollars a year, and in 2010 the total commercial production of shrimp was nearly 7 million tonnes (see production chart on the right). Shrimp farming took off during the 1980s, particularly in China, and by 2007 the harvest from shrimp farms exceeded the capture of wild shrimp. There are significant issues with excessive bycatch when shrimp are captured in the wild, and with pollution damage done to estuaries when they are used to support shrimp farming. Many shrimp species are small as the term shrimp suggests, about 2 cm long, but some shrimp exceed 25 cm . Larger shrimp are more likely to be targeted commercially, and are often referred to as prawns, particularly in Britain.',	'96106',	'Shrimp',	'546.jpg',	'image/jpeg',	82963,	'2012-04-20 09:36:22',	573,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:26',	NULL,	NULL,	0,	'specific',	6694,	1,	'FOOD00533'),
(547,	'Crayfish',	'Astacidea',	'Crayfish – also called crawfish or crawdads – are freshwater crustaceans resembling small lobsters, to which they are related; taxonomically, they are members of the superfamilies Astacoidea and Parastacoidea. They breathe through feather-like gills and are found in bodies of water that do not freeze to the bottom. They are mostly found in brooks and streams where there is fresh water running, and which have shelter against predators. Most crayfish cannot tolerate polluted water, although some species such as the invasive Procambarus clarkii are more hardy. Crayfish feed on living and dead animals and plants. In Australia, New Zealand and South Africa, the term crayfish or cray generally refers to a saltwater spiny lobster, of the genus Jasus that is indigenous to much of southern Oceania, while the freshwater species are usually called yabby, from the indigenous Australian and Maori names for the animal respectively, or by other names specific to each species. An exception is the freshwater Murray crayfish, which belongs to the family Parastacidae and is found on Australia\'s Murray River.',	'206931',	'Crayfish',	'547.jpg',	'image/jpeg',	23343,	'2012-04-20 09:36:38',	574,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	6712,	1,	'FOOD00534'),
(548,	'Flatfish',	'Pleuronectiformes',	'A flatfish is a member of the order (Pleuronectiformes) of ray-finned demersal fishes, also called the Heterosomata, sometimes classified as a suborder of Perciformes. In many species, both eyes lie on one side of the head, one or the other migrating through and around the head during development. Some species face their left side upward, some face their right side upward, and others face either side upward. Many important food fish are in this order, including the flounders, soles, turbot, plaice, and halibut. There are more than 400 species of this order. Some flatfish can camouflage themselves on the ocean floor.',	'172702',	'Flatfish',	'548.jpg',	'image/jpeg',	207216,	'2012-04-20 09:30:17',	575,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:47',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	8252,	1,	'FOOD00535'),
(549,	'Domestic pig',	'Sus scrofa domestica',	'The domestic pig is a large, domesticated, even-toed ungulate that traces its ancestry to the wild boar; it is considered a subspecies of the wild boar or a distinct species in its own right. Their head plus body length ranges from 0.9 to 1.8 m (35 to 71 in) and adults can weigh between 50 to 350Â kg (110 to 770Â lb). Compared to other artiodactyls, their head is relatively long, pointed, and free of warts. Even-toed ungulates are generally herbivorous, although the domestic pig is an omnivore, like its wild ancestor. Domestic pigs are farmed primarily for the consumption of their flesh, called pork. The animal\'s bones, hide, and bristles have been fashioned into items such as brushes. Domestic pigs, especially the pot-bellied pig, are also kept as pets.',	'898917',	'Domestic pig',	'549.jpg',	'image/jpeg',	136152,	NULL,	576,	'Animal foods',	'Swine',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-17 16:19:45',	NULL,	2,	0,	'specific',	9825,	1,	'FOOD00536'),
(550,	'Walrus',	'Odobenus rosmarus',	'The walrus (Odobenus rosmarus) is a large flippered marine mammal with a discontinuous distribution about the North Pole in the Arctic Ocean and subarctic seas of the Northern Hemisphere. The walrus is the only living species in the Odobenidae family and Odobenus genus. This species is subdivided into three subspecies: the Atlantic walrus (O. r. rosmarus) which lives in the Atlantic Ocean, the Pacific walrus (O. r. divergens) which lives in the Pacific Ocean, and O. r. laptevi, which lives in the Laptev Sea of the Arctic Ocean.\nAdult walruses are easily recognized by their prominent tusks, whiskers, and bulkiness. Adult males in the Pacific can weigh more than 2,000 kg (4,400 lb) and, among pinnipeds, are exceeded in size only by the two species of elephant seals. Walruses live mostly in shallow waters above the continental shelves, spending significant amounts of their lives on the sea ice looking for benthic bivalve mollusks to eat. Walruses are relatively long-lived, social animals, and they are considered to be a \"keystone species\" in the Arctic marine regions.',	'180639',	'Walrus',	'550.jpg',	'image/jpeg',	44335,	'2012-04-20 09:30:31',	577,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	9707,	0,	'FOOD00537'),
(551,	'Alaska wild rhubarb',	'Polygonum alpinum',	'<i>Aconogonon alpinum</i>, commonly known as alpine knotweed, is similar to <i>Aconogonon alaskanum</i>, but differs in leaf size and achene characteristics. (Wikipedia)',	'20870',	'',	'551.jpg',	'image/jpeg',	108146,	'2012-04-20 09:39:50',	578,	'Vegetables',	'Stalk vegetables',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	125586,	1,	'FOOD00538'),
(552,	'Oriental wheat',	'Triticum turanicum',	'Khorasan wheat or Oriental wheat (Triticum turgidum ssp. turanicum also called Triticum turanicum) is a tetraploid wheat species. It is an ancient grain type; Khorasan refers to a historical region in modern-day Afghanistan and the northeast of Iran. This grain is twice the size of modern-day wheat and is known for its rich nutty flavor.',	'506631',	'Khorasan_wheat',	'552.jpg',	'image/jpeg',	295608,	'2012-04-20 09:44:06',	579,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	376534,	1,	'FOOD00539'),
(553,	'Yardlong bean',	'Vigna unguiculata ssp. sesquipedalis',	'Vigna unguiculata subsp. sesquipedalis is a legume cultivated to be eaten as green pods. It is known as the yardlong bean, bora, long-podded cowpea, asparagus bean, snake bean, or Chinese long bean. Despite common name, the pods are actually only about half a yard long; the subspecies name sesquipedalis (one-and-a-half-foot-long) is a rather exact approximation of the pods\' length. This plant is of a different genus than the common bean. It is a vigorous climbing annual vine. The plant is subtropical/tropical and most widely grown in the warmer parts of South Asia, Southeast Asia, and southern China. A variety of the cowpea, it is grown primarily for its strikingly long (35-75 cm) immature pods and has uses very similar to that of the green bean. The many varieties of yardlong beans are usually distinguished by the different colors of their mature seeds. The pods, which can begin to form just 60 days after sowing, hang in groups of two or more. They are best for vegetable use if picked before they reach full maturity; however, overlooked pods can be used like dry beans in soups. When harvesting, it is important not to pick the buds which are above the beans; since the plant will set many more beans on the same stem. The plants take longer to reach maturity than bush beans, but once producing, the beans are quick-growing and daily checking/harvesting is often a necessity. The plants will produce beans until frost.',	'524853',	'Vigna unguiculata subsp. sesquipedalis',	'553.jpg',	'image/jpeg',	158407,	'2012-04-20 09:32:27',	580,	'Pulses',	'Peas',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	138955,	1,	'FOOD00540'),
(555,	'Quail',	'Phasianidae',	'\"Quail is a collective name for several genera of mid-sized birds generally considered in the order Galliformes. Old World quail are found in the family Phasianidae, and New World quail are found in the family Odontophoridae. The buttonquail are named more for their superficial resemblance to quail, and are members of the Turnicidae family in the Charadriiformes order. The King Quail, one of the Old World quail, is often sold in the pet trade; and within this trade is commonly, though mistakenly, referred to as a \"\"button quail\"\". Many of the common larger species are farm-raised for table food or egg consumption, and are hunted on game farms or in the wild, where they may be released to supplement the wild population, or extend into areas outside their natural range. In 2007, the US produced 40 million quail.\"',	'175861',	'Quail',	'555.jpg',	'image/jpeg',	1615896,	NULL,	582,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	9005,	1,	'FOOD00541'),
(556,	'Boysenberry',	'Rubus ursinus X idaeus',	'A boysenberry is a cross between a European Raspberry, a Common Blackberry, and a Loganberry. It is a large aggregate fruit, with large seeds and a deep maroon color, which changes to the typical boysenberry color when the fruit is cooked and made into jam and pies.',	NULL,	'Boysenberry',	'556.jpg',	'image/jpeg',	522628,	'2012-04-20 09:42:41',	583,	'Fruits',	'Berries',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00542'),
(557,	'Persian lime',	'Citrus latifolia',	'Persian lime (Citrus ×latifolia) or Shiraz Limoo also known as Tahiti lime or Bearss lime (named after John T. Bearss, who developed this seedless variety about 1895 in his nursery at Porterville, California), is a citrus fruit related to the standard lime. It has a nearly thornless tree. The Persian lime is of hybrid origin, most likely from a cross between key lime (Citrus aurantiifolia) and either lemon (Citrus ×limon) or citron (Citrus medica).\nIt has a uniquely fragrant, spicy aroma. The fruit is about 6 centimetres (2.4 in) in diameter, often with slightly nippled ends, and is usually sold while green, although it yellows as it reaches full ripeness. It is also widely available dried, as it is often used this way in Persian cooking. It is larger, thicker-skinned, with less intense citrus aromatics than the key lime (Citrus aurantifolia). ',	NULL,	'Persian_lime',	'557.jpg',	'image/jpeg',	47557,	'2012-04-20 09:33:40',	584,	'Fruits',	'Citrus',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	200541,	1,	'FOOD00543'),
(558,	'Feijoa',	'Feijoa sellowiana',	'Acca sellowiana, a species of flowering plant in the myrtle family, Myrtaceae, is native to the highlands of southern Brazil, eastern Paraguay, Uruguay, northern Argentina, and Colombia. It is widely cultivated as a garden plant and fruiting tree in New Zealand, and can be found as a garden plant elsewhere such as in Australia, Azerbaijan, western Georgia and southern Russia. Common names include feijoa, pineapple guava and guavasteen. It is an evergreen, perennial shrub or small tree, 1?7 metres (3.3?23.0 ft) in height, widely cultivated as a garden plant and fruiting tree.\nThe fruit, maturing in autumn, is green, ellipsoid, and about the size of a chicken egg. It has a sweet, aromatic flavor which tastes like pineapple, apple and mint. The flesh is juicy and is divided into a clear gelatinous seed pulp and a firmer, slightly granular, opaque flesh nearer the skin. The fruit falls to the ground when ripe and at its fullest flavor, but it may be picked from the tree prior to falling to prevent bruising.',	'506165',	'Feijoa',	'558.jpg',	'image/jpeg',	3479,	'2012-04-20 09:39:31',	585,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	260130,	1,	'FOOD00544'),
(559,	'Rowal',	'Pangium edule',	'Pangium edule (Indonesian: keluak or keluwak; Malay: kepayang) is a tall tree native to the mangrove swamps of Southeast Asia (Indonesia, Malaysia and Papua New Guinea[2]). It produces a large poisonous fruit (the \"football fruit\") which can be made edible by fermentation.\nThe taxonomy of the tree is uncertain and it may also be classed in the Flacourtiaceae or the Violales.',	'837784',	'Rowal',	'559.jpg',	'image/jpeg',	112355,	'2012-04-20 09:33:43',	586,	'Herbs and Spices',	'Other seeds',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	112823,	1,	'FOOD00545'),
(560,	'Jew\'s ear',	'Auricularia auricula-judae',	'Auricularia auricula-judae, known as the Jew\'s ear, wood ear, jelly ear or by a number of other common names, is a species of edible Auriculariales fungus found worldwide. The fruiting body is distinguished by its noticeably ear-like shape and brown colouration; it grows upon wood, especially elder. Its specific epithet is derived from the belief that Judas Iscariot hanged himself from an elder tree; the common name \"Judas\'s ear\" eventually became \"Jew\'s ear\", while today \"jelly ear\" and other names are sometimes used. The fungus can be found throughout the year in temperate regions worldwide, where it grows upon both dead and living wood.\nThe fruit body of A. auricula-judae is normally 3 to 8 centimetres (1.2 to 3.1 in) across, but can be as much as 12 centimetres (4.7 in). It is distinctively shaped, typically being reminiscent of a floppy ear, though the fruit bodies can also be cup-shaped. It is normally attached to the substrate laterally and sometimes by a very short stalk. The species has a tough, gelatinous, elastic texture when fresh, but it dries hard and brittle. The outer surface is a bright reddish-tan-brown with a purplish hint, often covered in tiny, downy hairs of a grey colour. It can be smooth, as is typical of younger specimens, or undulating with folds and wrinkles. The colour becomes darker with age. The inner surface is a lighter grey-brown in colour and smooth. It is sometimes wrinkled, again with folds and wrinkles, and may have \"veins\", making it appear even more ear-like.',	NULL,	'Jew%27s_ear',	'560.jpg',	'image/jpeg',	97463,	'2012-04-20 09:30:55',	587,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	29892,	1,	'FOOD00546'),
(561,	'Common mushroom',	'Agaricus bisporus',	'Agaricus bisporus—known variously when white as common mushroom, button mushroom, white mushroom, cultivated mushroom, table mushroom, champignon mushroom, crimini mushroom, when brown as Swiss brown mushroom, Roman brown mushroom, Italian brown, Italian mushroom, brown cap mushrooms, chestnut mushroom, and when mature as Portobello mushroom—is an edible basidiomycete mushroom native to grasslands in Europe and North America. Agaricus bisporus is cultivated in more than 70 countries and is one of the most commonly and widely consumed mushrooms in the world.',	NULL,	'Agaricus bisporus',	'561.jpg',	'image/jpeg',	108582,	'2012-04-20 09:36:45',	588,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	5341,	1,	'FOOD00547'),
(562,	'Shiitake',	'Lentinus edodes',	'The Shiitake (Lentinula edodes) is an edible mushroom native to East Asia, which is cultivated and consumed in many Asian countries. It is a feature of many Asian cuisines. It is also considered a medicinal mushroom in some forms of traditional medicine.',	NULL,	'Shiitake',	'562.jpg',	'image/jpeg',	97773,	'2012-04-20 09:38:10',	589,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	5353,	1,	'FOOD00548'),
(563,	'Purple laver',	'Porphyra laciniata',	'Porphyra is a cold water seaweed that grows in cold shallow sea water. More specifically, it is a foliose red algal genus of laver, comprising approximately 70 species. It grows in the intertidal zone, typically between the upper intertidal zone and the splash zone in cold waters of temperate oceans. In East Asia, it is used to produce the sea vegetable products nori (in Japan) and gim (in Korea). There are considered to be 60 to 70 species of Porphyra worldwide and seven in the British Isles.',	NULL,	'Porphyra',	'563.jpg',	'image/jpeg',	5291,	'2012-04-20 09:44:05',	590,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00549'),
(564,	'Wakame',	'Undaria pinnatifida',	'Wakame is a sea vegetable, or edible seaweed. It has a subtly sweet flavour and is most often served in soups and salads. Sea-farmers have grown wakame in Japan from the Nara period. It has been nominated as among 100 of the world\'s worst invasive species according to the Global Invasive Species Database.',	NULL,	'Wakame',	'564.jpg',	'image/jpeg',	55618,	'2012-04-20 09:41:44',	591,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	74381,	1,	'FOOD00550'),
(565,	'Enokitake',	'Flammulina velutipes',	'Enokitake is a long, thin white mushroom used in East Asian cuisine (such as that of China, Japan and Korea). These mushrooms are cultivars of Flammulina velutipes, also known by the name, golden needle mushroom or lily mushroom. Wild forms differing in color, texture, and sliminess are called winter mushrooms, velvet foot or velvet stem, amongst other names.\nThis mushroom is available fresh or canned, with experts recommending fresh enoki specimens with firm, white, shiny caps, rather than those with slimy or brownish stalks that are best avoided.[citation needed] It is traditionally used for soups, but can also be used for salads and other dishes. The mushroom has a crisp texture and can be refrigerated for approximately one week.',	NULL,	'Enokitake',	'565.jpg',	'image/jpeg',	33470,	'2012-04-20 09:36:19',	592,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	38945,	1,	'FOOD00551'),
(566,	'Epazote',	'Dysphania ambrosioides',	'Epazote, wormseed, Jesuit\'s tea, Mexican tea, Paico or Herba Sancti Mariæ (Dysphania ambrosioides, formerly Chenopodium ambrosioides) is an herb native to Central America, South America, and southern Mexico.\nEpazote is used as a leaf vegetable, an herb and an herbal tea for its pungent flavor. Raw, it has a resinous, medicinal pungency, similar to anise, fennel, or even tarragon, but stronger. Epazote\'s fragrance is strong but difficult to describe. A common analogy is to turpentine or creosote. It has also been compared to citrus, savory, or mint.',	'822812',	'Epazote',	'566.jpg',	'image/jpeg',	45511,	'2012-04-20 09:36:00',	593,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	330163,	1,	'FOOD00552'),
(567,	'Oyster mushroom',	'Pleurotus ostreatus',	'Pleurotus is a genus of gilled mushrooms which includes one of the most widely eaten mushrooms, P. ostreatus. Species of Pleurotus may be called oyster, abalone, or tree mushrooms, and are some of the most commonly cultivated edible mushrooms in the world. Pleurotus fungi have been used in mycoremediation of pollutants such as petroleum and polycyclic aromatic hydrocarbons.\nThe caps may be laterally attached (with no stem). If there is a stem, it is normally eccentric and the gills are decurrent along it. The term pleurotoid is used for mushrooms having this general shape.\nThe spores are smooth and elongated (described as \"cylindrical\"). Where hyphae meet, they are joined by clamp connections. Pleurotus is not considered to be a bracket fungus, and most of the species are monomitic (with a soft consistency). However, remarkably, Pleurotus dryinus can sometimes be dimitic, meaning that it has additional skeletal hyphae, which give it a tougher consistency like bracket fungi.',	NULL,	'Oyster_mushroom',	'567.jpg',	'image/jpeg',	67570,	'2012-04-20 09:40:11',	594,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:48',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	5322,	1,	'FOOD00553'),
(568,	'Cloud ear fungus',	'Auricularia polytricha',	'Cloud ear fungus (Auricularia polytricha, syn. Hirneola polytricha) is an edible jelly fungus. It is gray-brown in color and often used in Asian cooking.\nFruit body resupinate or pileate, loosely attached, laterally and sometimes by a very short stalk, elastic, gelatinous; sterile surface dark yellowish brown to dark brown with greyish brown bands, hairy, silky. Hymenium smooth, or wrinkled, pale brown to dark brown to blakish brown with a whitish boom. Hairs thick-walled, up to 0.6mm long. Basidia cylindrical, hyaline, 3-septate, 46-60 × 4-5.5?m with 1-3 lateral sterigmata; sterigmata 9-15 × 1.5-12?m. spores, hyaline, reniform to allantoid, 13-16 × 4-5.5?m, guttulate.',	NULL,	'Cloud_ear_fungus',	'568.jpg',	'image/jpeg',	124801,	'2012-04-20 09:30:07',	595,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	29893,	1,	'FOOD00554'),
(569,	'Maitake',	'Grifola frondosa',	'Grifola frondosa is a polypore mushroom that grows in clusters at the base of trees, particularly oaks. The mushroom is commonly known among English speakers as hen-of-the-woods, ram\'s head and sheep\'s head. In the United States\' supplement market, as well as in Asian grocery stores, the mushroom is known by its Japanese name maitake, which means \"dancing mushroom\". Throughout Italian American communities in the northeastern United States, it is commonly known as the signorina mushroom. G. frondosa should not be confused with Laetiporus sulphureus, another edible bracket fungus that is commonly called chicken of the woods or \"sulphur shelf\". The fungus becomes inedible like all polypores when they are older, because it is too tough to eat.\nG. frondosa grows from an underground tuber-like structure known as a sclerotium, about the size of a potato. The fruiting body, occurring as large as 100 cm, is a cluster consisting of multiple grayish-brown caps which are often curled or spoon-shaped, with wavy margins and 2?7 cm broad. The undersurface of each cap bears approximately one to three pores per millimeter, with the tubes rarely deeper than 3 mm. The milky-white stipe (stalk) has a branchy structure and becomes tough as the mushroom matures.\nIn Japan, the Maitake can grow to more than 50 pounds (20 kilograms), earning this giant mushroom the title \"King of Mushrooms\". Maitake is one of the major culinary mushrooms used in Japan, the others being shiitake, shimeji and enoki. They are used in a wide variety of dishes, often being a key ingredient in nabemono or cooked in foil with butter.',	NULL,	'Maitake',	'569.jpg',	'image/jpeg',	67650,	'2012-04-20 09:42:40',	596,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	5627,	1,	'FOOD00555'),
(570,	'Ostrich fern',	'Matteuccia struthiopteris',	'Matteuccia struthiopteris (common names ostrich fern or shuttlecock fern) is a crown-forming, colony-forming fern, occurring in temperate regions of the Northern Hemisphere in eastern and northern Europe, northern Asia and northern North America. The species epithet struthiopteris comes from Ancient Greek words, struthio meaning ostrich and pterion meaning wing.\nIt grows from a completely vertical crown, favoring riverbanks and sandbars, but sends out lateral stolons to form new crowns. It thus can form dense colonies resistant to destruction by floodwaters.\nThe fronds are dimorphic, with the deciduous green sterile fronds being almost vertical, 100?170 cm (39?67 in) tall and 20?35 cm (7.9?13.8 in) broad, long-tapering to the base but short-tapering to the tip, so that they resemble ostrich plumes, hence the name. The fertile fronds are shorter, 40?60 cm (16?24 in) long, brown when ripe, with highly modified and constricted leaf tissue curled over the sporangia; they develop in autumn, persist erect over the winter and release the spores in early spring.\nMatteuccia species are used as food plants by the larvae of some Lepidoptera species including Sthenopis auratus.',	'17596',	'Ostrich_fern',	'570.jpg',	'image/jpeg',	84015,	'2012-04-23 10:43:12',	597,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	2,	0,	'specific',	3277,	1,	'FOOD00556'),
(571,	'Spot croaker',	'Leiostomus xanthurus',	'The spot croaker (Leiostomus xanthurus) or spot is a small saltwater fish species inhabiting estuary and coastal waters along the eastern coast of United States, Gulf of Mexico, and the Caribbean. The spot croaker derives its name from the prominent dark spot behind each gill. It is also known for its the croaking sound it produces using its swim bladder. It is part of the family Sciaendae and the only species in its the genus, Leiostomus. Spot croakers spawn offshore and the spawn migrate inland to develop into juveniles. They are frequently caught by recreational anglers and make excellent table fare. Their diets consist largely of organic detritus, small crustaceans, and worms. Bloodworms are the ideal bait when fishing for spot croaker. The community of Hampstead, North Carolina hosts the North Carolina Spot Festival the last weekend of September to honor the fish.',	'169267',	'Spot croaker',	'571.jpg',	'image/jpeg',	78158,	'2012-04-20 09:39:39',	598,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	59837,	1,	'FOOD00557'),
(572,	'Sourdock',	'Rumex articus',	'Rumex arcticus, commonly known as Arctic Dock or Sourdock, is a perennial flowering plant that is native to Alaska. Its leaves are an important part of the diet of native Alaskans such as the Yupik people, who include it in various dishes such as akutaq.',	'20935',	'Rumex_arcticus',	'572.jpg',	'image/jpeg',	26763,	'2012-04-20 09:41:04',	599,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-17 16:19:45',	NULL,	NULL,	0,	'specific',	395311,	1,	'FOOD00558'),
(573,	'Tinda',	'Citrullus lanatus var. fistulosus',	'The tinda and plural called tinday, also called Indian round gourd or apple gourd or Indian Baby Pumpkin, is a squash-like cucurbit grown for its immature fruit, a vegetable especially popular in South Asia. It is the only member of the genus Praecitrullus. \"tinda\" is also called \"tindsi\" in rajasthan. In Marathi, it is called Dhemase. In Sindhi language, it is called Meha.\nThe plant is, as with all cucurbits, a prolific vine, and is grown as an annual. The fruit is approximately spherical, and 5?8 cm in diameter. The seeds may also be roasted and eaten. Tinda is a famous nickname among Punjabi families in India. This unique squash-like gourd is native to India, very popular in Indian and Pakistani cooking with curry and many gourmet dishes. Green colored, apple sized fruits are flattish round in shape and 50-60 grams in weight. Plants are vigorous, productive and begin to bear fruits in 70 days after planting.\nCan be confused with Tendli or Kundru due to similar sounding name from different languages and regions. Tinda in Punjabi or most North Indian Languages is \"Indian Baby Pumpkin\".',	NULL,	'Tinda',	'573.jpg',	'image/jpeg',	34713,	'2012-04-20 09:30:05',	600,	'Gourds',	'Gourds',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00559'),
(574,	'Atlantic menhaden',	'Brevoortia tyrannus',	'The Atlantic menhaden (Brevoortia tyrannus) is a silvery, highly compressed fish in the herring family, Clupeidae. A filter feeder, it lives on plankton caught in midwater. Adult fish can filter up to four gallons of water a minute; and they play an important role in clarifying ocean water. They are also a natural check to the deadly red tide. Menhaden have historically been used as a fertilizer for crops. It is likely that menhaden is the fish that Squanto taught the Pilgrims to bury alongside freshly planted seeds as fertilizer. Other uses for menhaden include: feed for animals, bait for fish, oil for human consumption, oil for manufacturing purposes and oil as a fuel source. While many articles today state the menhaden as being inedible, the fish were once consumed as sardines or fried in early American history. Maine fisherman, for example, would eat fried pogies for breakfast. The fish that were not sold for bait would be sold to poorer classes for food. Menhaden historically occurred in large numbers in the North Atlantic, ranging from Nova Scotia, Canada to central Florida, USA, although their presence in northern waters has diminished in the 20th Century. They swim in large schools, some reportedly up to 40 miles long. As a result of their abundance they are important prey for a wide range of predators including bluefish, striped bass, cod, haddock, halibut, mackerel, swordfish, and tuna.',	'161732',	'Atlantic menhaden',	'574.jpg',	'image/jpeg',	112732,	'2012-04-20 09:33:41',	601,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	224708,	1,	'FOOD00560'),
(575,	'Wheat',	'Triticum',	'Wheat (Triticum spp. ) is a cereal grain, originally from the Levant region of the Near East and Ethiopian Highlands, but now cultivated worldwide. In 2010, world production of wheat was 651 million tons, making it the third most-produced cereal after maize (844 million tons) and rice (672 million tons). Wheat was the second most-produced cereal in 2009; world production in that year was 682 million tons, after maize (817 million tons), and with rice as a close third (679 million tons). This grain is grown on more land area than any other commercial food. World trade in wheat is greater than for all other crops combined. Globally, wheat is the leading source of vegetable protein in human food, having a higher protein content than soybeans or the other major cereals, maize (corn) or rice. In terms of total production tonnages used for food, it is currently second to rice as the main human food crop and ahead of maize, after allowing for maize\'s more extensive use in animal feeds. Wheat was a key factor enabling the emergence of city-based societies at the start of civilization because it was one of the first crops that could be easily cultivated on a large scale, and had the additional advantage of yielding a harvest that provides long-term storage of food. Wheat contributed to the emergence of city-states in the Fertile Crescent, including the Babylonian and Assyrian empires. Wheat grain is a staple food used to make flour for leavened, flat and steamed breads, biscuits, cookies, cakes, breakfast cereal, pasta, noodles, couscous and for fermentation to make beer, other alcoholic beverages, or biofuel. Wheat is planted to a limited extent as a forage crop for livestock, and its straw can be used as a construction material for roofing thatch. The whole grain can be milled to leave just the endosperm for white flour. The by-products of this are bran and germ. The whole grain is a concentrated source of vitamins, minerals, and protein, while the refined grain is mostly starch.',	'42236',	'Wheat',	'575.jpg',	'image/jpeg',	751715,	'2012-04-20 09:37:55',	602,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	1,	'specific',	4564,	1,	'FOOD00561'),
(576,	'Common chokecherry',	'Prunus virginiana',	'Prunus virginiana, commonly called bitter-berry, chokecherry, Virginia bird cherry and western chokecherry (also black chokecherry for P. virginiana var. demissa), is a species of bird cherry (Prunus subgenus Padus) native to North America; the natural historic range of P. virginiana includes most of the continent, except for the far north and far south.\nThe fruit are about .4 inch diameter, range in color from bright red to black, with a very astringent taste, being both somewhat sour and somewhat bitter. The very ripe berries are dark in color and less astringent and more sweet than the red berries.',	'24806',	'Common_chokecherry',	'576.jpg',	'image/jpeg',	57884,	'2012-04-20 09:35:29',	603,	'Fruits',	'Drupes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	133204,	1,	'FOOD00562'),
(577,	'Agave',	'Agave',	'Agave is a genus of monocots. The plants are perennial, but each rosette flowers once and then dies. Some species are known by the name century plant.\nIn the APG III system, the genus is placed in the subfamily Agavoideae of the broadly circumscribed family Asparagaceae. Some authors prefer to place it in the segregate family Agavaceae. Traditionally, it was circumscribed to be composed of about 166 species, but it is now usually understood to have about 208 species.\nChiefly Mexican, agaves are also native to the southern and western United States and central and tropical South America. They are succulents with a large rosette of thick, fleshy leaves, each ending generally in a sharp point and with a spiny margin; the stout stem is usually short, the leaves apparently springing from the root. Along with plants from the related genus Yucca, various Agave species are popular ornamental plants.\nEach rosette is monocarpic and grows slowly to flower only once. During flowering, a tall stem or \"mast\" grows from the center of the leaf rosette and bears a large number of short, tubular flowers. After development of fruit, the original plant dies, but suckers are frequently produced from the base of the stem, which become new plants.',	'182659',	'Agave',	'577.jpg',	'image/jpeg',	195698,	'2012-04-20 09:41:03',	604,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	39509,	1,	'FOOD00563'),
(578,	'Narrowleaf cattail',	'Typha angustifolia',	'Typha angustifolia L., (also lesser bulrush or narrowleaf cattail or lesser reedmace), is a perennial herbaceous plant of genus Typha. This cattail is an \"obligate wetland\" species that is commonly found in the northern hemisphere in brackish locations. The plant\'s leaves are flat, very narrow (¼\"-½\" wide), and 3\'-6\' tall when mature; 12-16 leaves arise from each vegetative shoot. At maturity, they have distinctive stalks that are about as tall as the leaves; the stalks are topped with brown, fluffy, sausage-shaped flowering heads. The plants have sturdy, rhizomatous roots that can extend 27\" and are typically ¾\"-1½\" in diameter.\nIt has been proposed that the species was introduced from Europe to North America. In North America, it is also thought to have been introduced from coastal to inland locations.\nSeveral parts of the plant are edible, including during various seasons the dormant sprouts on roots and bases of leaves, the inner core of the stalk, green bloom spikes, ripe pollen, and starchy roots. The edible stem is called b?n b?n in Vietnam.',	'42325',	'Narrowleaf_cattail',	'578.jpg',	'image/jpeg',	88058,	'2012-04-20 09:42:04',	605,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	59011,	1,	'FOOD00564'),
(579,	'Jellyfish',	'Scyphozoa',	'Jellyfish or jellies are the major non-polyp form of individuals of the phylum Cnidaria. They are typified as free-swimming marine animals consisting of a gelatinous umbrella-shaped bell and trailing tentacles. The bell can pulsate for locomotion, while stinging tentacles can be used to capture prey. Jellyfish are found in every ocean, from the surface to the deep sea. A few jellyfish inhabit freshwater. Large, often colorful, jellyfish are common in coastal zones worldwide. Jellyfish have roamed the seas for at least 500 million years, and possibly 700 million years or more, making them the oldest multi-organ animal.',	'51483',	'Jellyfish',	'579.jpg',	'image/jpeg',	174574,	'2012-04-20 09:40:11',	606,	'Aquatic foods',	'Other aquatic foods',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	6142,	0,	'FOOD00565'),
(580,	'Anchovy',	'Engraulidae',	'Anchovies are a family (Engraulidae) of small, common salt-water forage fish. There are 144 species in 17 genera, found in the Atlantic, Indian, and Pacific Oceans. Anchovies are usually classified as an oily fish.',	'553173',	'Anchovy',	'580.jpg',	'image/jpeg',	709689,	'2012-04-20 09:34:04',	607,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	43062,	1,	'FOOD00566'),
(581,	'Blue whiting',	'Micromesistius poutassou',	'The blue whiting, Micromesistius poutassou, one of the two species in the genus Micromesistius in the cod family, is common in the northeast Atlantic Ocean from Morocco to Iceland and Spitsbergen. It also occurs in the northern parts of the Mediterranean, where it may be locally abundant. Blue whiting also occur in the northwest Atlantic Ocean between Canada and Greenland, but is considered rare. It has a long, narrow body and a silvery underbody. The fish can attain a length of more than 40 cm. The average length of blue whiting caught off the west shores of the UK is 31 cm. A related species, southern blue whiting, Micromesistius australis, occurs in the Southern Hemisphere.',	'164774',	'Blue whiting',	'581.jpg',	'image/jpeg',	55087,	'2012-04-20 09:38:23',	608,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	81636,	1,	'FOOD00567'),
(582,	'Carp bream',	'Abramis brama',	'The common bream, freshwater bream, bream, bronze bream or carp bream, Abramis brama, is a European species of freshwater fish in the family Cyprinidae. It is now considered to be the only species in the genus Abramis.\nThe bream is usually 30 to 55 cm (12 to 22 in) long, though some specimens of 75 cm (30 in) have been recorded; it usually weighs 2 to 4 kg (4.4 to 8.8 lb). The maximum length is 90 cm (35.5 in) with a maximum recorded weight of about 9.1 kg (20 lb).\nIt has a laterally flattened and high-backed body and a slightly undershot mouth. It is a silvery grey colour, though older fish can be bronze-coloured especially in clear waters. The fins are greyish to black, but never reddish.\n',	'163666',	'Carp_bream',	'582.jpg',	'image/jpeg',	123248,	'2012-04-20 09:41:55',	609,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	38527,	1,	'FOOD00568'),
(583,	'Chanterelle',	'Cantharellus cibarius',	'Cantharellus cibarius, commonly known as the chanterelle, golden chanterelle or girolle, is a fungus. It is probably the best known species of the genus Cantharellus, if not the entire family of Cantharellaceae. It is orange or yellow, meaty and funnel-shaped. On the lower surface, underneath the smooth cap, it has gill-like ridges that run almost all the way down its stipe, which tapers down seamlessly from the cap. It has a fruity smell, reminiscent of apricots and a mildly peppery taste (hence its German name, Pfifferling) and is considered an excellent edible mushroom.',	NULL,	'Chanterelle',	'583.jpg',	'image/jpeg',	65487,	'2012-04-20 09:41:14',	610,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	36066,	1,	'FOOD00569'),
(584,	'Sturgeon',	'Acipenseridae',	'Sturgeon is the common name used for some 26 species of fish in the family Acipenseridae, including the genera Acipenser, Huso, Scaphirhynchus and Pseudoscaphirhynchus. The term includes over 20 species commonly referred to as sturgeon and several closely related species that have distinct common names, notably sterlet, kaluga and beluga. Collectively, the family is also known as the true sturgeons. Sturgeon is sometimes used more exclusively to refer to the species in the two best-known genera, Acipenser and Huso. One of the oldest families of bony fish in existence, sturgeon are native to subtropical, temperate and sub-Arctic rivers, lakes and coastlines of Eurasia and North America. They are distinctive for their elongated bodies, lack of scales, and occasional great size: sturgeons ranging from 7–12 feet (2-3½ m) in length are common, and some species grow up to 18 feet . Most sturgeons are anadromous bottom-feeders, spawning upstream and feeding in river deltas and estuaries. While some are entirely freshwater, very few venture into the open ocean beyond near coastal areas. Several species of sturgeons are harvested for their roe, which is made into caviar — a luxury food which makes some sturgeons pound for pound the most valuable of all harvested fish. Because they are slow-growing and mature very late in life, they are particularly vulnerable to exploitation and to other threats, including pollution and habitat fragmentation. Most species of sturgeons are currently considered to be at risk of extinction, making them more critically endangered than any other group of species.',	'161064',	'Sturgeon',	'584.jpg',	'image/jpeg',	7266,	'2012-04-20 09:30:47',	611,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	7900,	1,	'FOOD00570'),
(585,	'Charr',	'Salvelinus',	'Salvelinus is a genus of salmonid fish often called char or charr; some species are called \"trout\". Salvelinus is a member of the Salmoninae subfamily of the Salmonidae family. Most char may be identified by light-cream, pink, or red spots over a darker body. Scales tend to be small, with 115-200 along the lateral line. The pectoral, pelvic, anal, and the lower aspect of caudal fins are trimmed in snow white or cream leading edges.\nMany members of this genus are popular sport fish, and a few, such as the lake trout (S. namaycush), are the object of commercial fisheries and aquaculture. Occasionally, such fish escape and become invasive species.',	'161999',	'Salvelinus',	'585.jpg',	'image/jpeg',	8007,	'2012-04-20 09:37:22',	612,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	8033,	1,	'FOOD00571'),
(586,	'Cinnamon',	'Cinnamomum',	'Cinnamon is a spice obtained from the inner bark of several trees from the genus Cinnamomum that is used in both sweet and savoury foods. While Cinnamomum verum is sometimes considered to be \"true cinnamon\", most cinnamon in international commerce is derived from related species, which are also referred to as \"cassia\" to distinguish them from \"true cinnamon\".\nCinnamon is the name for perhaps a dozen species of trees and the commercial spice products that some of them produce. All are members of the genus Cinnamomum in the family Lauraceae. Only a few of them are grown commercially for spice.',	'18174',	'Cinnamon',	'586.jpg',	'image/jpeg',	47417,	'2012-04-20 09:39:42',	613,	'Herbs and Spices',	'Spices',	'Type 1',	'2011-02-09 00:37:49',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	13428,	1,	'FOOD00572'),
(587,	'Crab',	'Brachyura',	'Crabs are decapod crustaceans of the infraorder Brachyura, which typically have a very short projecting \"tail\" (abdomen), usually entirely hidden under the thorax. They live in all the world\'s oceans, in fresh water, and on land, are generally covered with a thick exoskeleton and have a single pair of claws. Many other animals with similar names ? such as hermit crabs, king crabs, porcelain crabs, horseshoe crabs and crab lice ? are not true crabs.',	'98276',	'Crab',	'587.jpg',	'image/jpeg',	8594,	'2012-04-20 09:36:23',	614,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	6752,	1,	'FOOD00573'),
(588,	'Common dab',	'Limanda limanda',	'The common dab, Limanda limanda, is an edible flatfish of the family Pleuronectidae. It is a demersal fish native to shallow seas around Northern Europe, in particular the North Sea, where it lives on sandy bottoms down to depths of about 100 metres . It can reach 40 centimetres in length and can weigh up to 1 kilogram, though most specimens grow no longer than 30 centimetres .',	'172881',	'Common dab',	'588.jpg',	'image/jpeg',	56486,	'2012-04-20 09:30:16',	615,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	27771,	1,	'FOOD00574'),
(589,	'Spiny dogfish',	'Squalus acanthias',	'The spiny dogfish, spurdog, mud shark, or piked dogfish, Squalus acanthias, is one of the best known of the dogfish which are members of the family Squalidae in the order Squaliformes. While these common names may apply to several species, Squalus acanthias is distinguished by having two spines and lacks an anal fin. It is found mostly in shallow waters and further offshore in most parts of the world, especially in temperate waters.',	'160617',	'Spiny dogfish',	'589.jpg',	'image/jpeg',	31080,	'2012-04-20 09:36:34',	616,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	7797,	1,	'FOOD00575'),
(590,	'Anatidae',	'Anatidae',	'The Anatidae are the biological family of birds that includes ducks, geese and swans. The family has a cosmopolitan distribution, occurring on all the world\'s continents except Antarctica and on most of the world\'s islands and island groups. These are birds that are adapted through evolution for swimming, floating on the water surface, and in some cases diving in at least shallow water. (The Magpie Goose is no longer considered to be part of the Anatidae, but is placed in its own family Anseranatidae. ) The family contains around 146 species in 40 genera. They are generally herbivorous, and are monogamous breeders. A number of species undertake annual migrations. A few species have been domesticated for agriculture, and many others are hunted for food and recreation. Five species have become extinct since 1600, and many more are threatened with extinction.',	'174983',	'Anatidae',	'590.jpg',	'image/jpeg',	161920,	NULL,	617,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:27',	NULL,	2,	0,	'specific',	8830,	1,	'FOOD00576'),
(591,	'Anguilliformes',	'Anguilliformes',	'Eels (Anguilliformes) are an order of fish which consists of four suborders, 20 families, 111 genera and approximately 800 species. Most eels are predators. The term \"eel\" (originally referring to the European eel) is also used for some other similarly shaped fish, such as electric eels and spiny eels, but these are not members of the Anguilliformes order.\nEels are elongated fish, ranging in length from 5 cm (2.0 in) in the one-jawed eel (Monognathus ahlstromi) to 4 m (13 ft) in the slender giant moray. Adults range in weight from 30 grams (1.1 oz) to well over 25 kilograms (55 lb). They possess no pelvic fins, and many species also lack pectoral fins. The dorsal and anal fins are fused with the caudal or tail fin, forming a single ribbon running along much of the length of the animal.\nMost eels live in the shallow waters of the ocean and burrow into sand, mud, or amongst rocks. A majority of eel species are nocturnal, and thus are rarely seen. Sometimes they are seen living together in holes, or \"eel pits\". Some species of eels also live in deeper water on the continental shelves and over the slopes deep as 4,000 m (13,000 ft). Only members of the Anguilla family regularly inhabit fresh water, but they too return to the sea to breed.',	'161123',	'Anguilliformes',	'591.jpg',	'image/jpeg',	11986,	'2012-04-20 09:41:45',	618,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	7933,	1,	'FOOD00577'),
(592,	'True frog',	'Ranidae',	'The true frogs, family Ranidae, have the widest distribution of any frog family. They are abundant throughout most of the world, occurring on most continents except Antarctica. The true frogs are present in North America, northern South America, Europe, Asia, Madagascar, Africa, and from the East Indies to New Guinea; the species native to Australia—the Australian wood frog (Hylarana daemelii)—is restricted to the far north. Typically, true frogs are smooth and moist-skinned, with large, powerful legs and extensively webbed feet. The true frogs vary greatly in size, ranging from small—such as the wood frog (Rana sylvatica)—to the largest frog in the world, the goliath frog (Conraua goliath). Many of the true frogs are aquatic or live close to water. Most species lay their eggs in the water and go through a tadpole stage. However, as with most families of frogs, there is large variation of habitat within the family. Those of the genus Tomopterna are burrowing frogs native to Africa and exhibit most of the characteristics common to burrowing frogs around the world. There are also arboreal species of true frogs, and the family includes some of the very few amphibians that can live in brackish water.',	'173433',	'True frog',	'592.jpg',	'image/jpeg',	103696,	'2012-04-20 09:44:34',	619,	'Aquatic foods',	'Amphibians',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:27',	NULL,	NULL,	0,	'specific',	8397,	1,	'FOOD00578'),
(593,	'Garfish',	'Belone belone',	'The garfish (Belone belone), or sea needle, is a pelagic, oceanodromous needlefish found in brackish and marine waters of the Eastern Atlantic, the Mediterranean Sea, the Baltic Sea, etc. The fish lives close to the surface and has a migratory pattern similar to that of the mackerel, arriving a short time before the latter to spawn. It is long and slender, sometimes 2 or 3 feet in length. From the North Sea, garfish migrate to shallow waters in April and May. They spawn in areas with eel grass in May and June. In the autumn they return to the open sea, including the Atlantic west of the British Isles. Garfish are pelagic. They feed on small fish and leap out of the water when hooked. The garfish are oviparous and the eggs are often found attached to objects in the water by tendrils on the egg\'s surface. Garfish have unusually green bones which discourages many people from eating them, but the green color is harmless. They are caught mainly in fixed nets along the coast in shallow waters. Garfish are eaten fried, baked, barbecued or smoked. Its pelvic fins are located in a posterior position as are its dorsal and anal fins. They are positioned for posterior flexing of the body.',	'165594',	'Garfish',	'593.jpg',	'image/jpeg',	202185,	'2012-04-20 09:42:32',	620,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	129037,	1,	'FOOD00579'),
(594,	'Gadiformes',	'Gadiformes',	'Gadiformes are an order of ray-finned fish, also called the Anacanthini, that includes the cod and its allies. Many major food fish are in this order. They are found in marine waters throughout the world, and there are also a small number of freshwater species. Common characteristics include the positioning of the pelvic fins (if present), below or in front of the pectoral fins. Gadiformes are physoclists, which means their gas bladders do not have a pneumatic duct. The fins are spineless. Gadiform fish range in size from the codlets, which may be as small as 7 cm in adult length, to the Atlantic cod, Gadus morhua, which reaches up to 2 m .',	'164665',	'Gadiformes',	'594.jpg',	'image/jpeg',	102162,	'2012-04-20 09:28:55',	621,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8043,	1,	'FOOD00580'),
(595,	'Mountain hare',	'Lepus timidus',	'\"The mountain hare (Lepus timidus), also known as blue hare, tundra hare, variable hare, white hare, snow hare, alpine hare and Irish hare, is a hare that is largely adapted to polar and mountainous habitats. The mountain hare is a large species, though it is slightly smaller than the European hare. It grows to a length of 45?65 cm (18?26 in), with a tail of 4?8 cm (1.6?3.1 in), and a mass of 2?5.3 kg (4.4?11.7 lb), females being slightly heavier than males. In summer, for all populations of mountain hares, the coat is various shades of brown. In preparation for winter most populations moult into a white (or largely white) pelage. The tail remains completely white all year round, distinguishing the mountain hare from the European hare (Lepus europaeus), which has a black upper side to the tail. The subspecies Lepus timidus hibernicus (the Irish mountain hare) stays brown all year and individuals rarely develop a white coat. The Irish variety may also have a dark/grey upper surface to the tail, which in other populations always remains white. This tail colour combined with its large size (in comparison to most other populations of mountain hare) and the various shades of brown that the Irish hare may display, could lead an unexperienced observer to misidentify an Irish mountain hare as a European hare.\"',	'180113',	'Mountain_hare',	'595.jpg',	'image/jpeg',	69805,	NULL,	622,	'Animal foods',	'Lagomorphs',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	62621,	1,	'FOOD00581'),
(596,	'Lake trout',	'Salvelinus namaycush',	'Lake trout (Salvelinus namaycush) is a freshwater char living mainly in lakes in northern North America. Other names for it include mackinaw, lake char (or charr), touladi, togue, and grey trout. In Lake Superior, it can also be variously known as siscowet, paperbelly and lean. The lake trout is prized both as a game fish and as a food fish.\nLake trout are the largest of the charrs; the record weighed almost 46.3 kilograms (102 lb) (netted) with a length of 50 inches (127 cm), and 15? to 40-pound fish are not uncommon. The average length is 24-36 inches (61?92 cm). The largest caught on a rod and reel according to the IGFA was 72 pounds (33 kg), caught in Great Bear Lake in 1995 with a length of 59 inches (150 cm).',	'162002',	'Lake_trout',	'596.jpg',	'image/jpeg',	69417,	'2012-04-20 09:36:59',	623,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8040,	1,	'FOOD00582'),
(597,	'Lemon sole',	'Microstomus kitt',	'The lemon sole, Microstomus kitt, is a flatfish of the family Pleuronectidae. It is native to shallow seas around Northern Europe, where it lives on stony bottoms down to depths of about 200 metres . It grows up to 65 centimetres in length and reaches about 3 kilograms in weight. It is a popular food fish.',	'172888',	'Lemon sole',	'597.jpg',	'image/jpeg',	78352,	'2012-04-20 09:40:27',	624,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	106175,	1,	'FOOD00583'),
(598,	'Clawed lobster',	'Nephropidae',	'Clawed lobsters comprise a family (Nephropidae, sometimes also Homaridae) of large marine crustaceans. They have long bodies with muscular tails, and live in crevices or burrows on the sea floor. Three of their five pairs of legs have claws, including the first pair, which are usually much larger than the others. Highly prized as seafood, lobsters are economically important, and are often one of the most profitable commodities in coastal areas they populate. Commercially important species include two species of Homarus from the northern Atlantic Ocean, and scampi ? the northern-hemisphere genus Nephrops and the southern-hemisphere genus Metanephrops. Although several other groups of crustaceans have the word \"lobster\" in their names, the unqualified term \"lobster\" generally refers to the clawed lobsters of the family Nephropidae. Clawed lobsters are not closely related to spiny lobsters or slipper lobsters, which have no claws (chelae), or to squat lobsters. The closest living relatives of clawed lobsters are the reef lobsters and the three families of freshwater crayfish.',	'97307',	'Clawed_lobster',	'598.jpg',	'image/jpeg',	120417,	'2012-04-20 09:40:16',	625,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	6704,	1,	'FOOD00584'),
(599,	'Lumpsucker',	'Cyclopteridae',	'Lumpsuckers or lumpfish are mostly small scorpaeniform marine fish of the family Cyclopteridae. They are found in the cold waters of the Arctic, North Atlantic, and North Pacific oceans. The greatest number of species are found in the North Pacific.\nLumpsuckers are named appropriately enough; their portly bodies are nearly spherical with generally drab coloration and lithic patterns. The \"sucker\" part refers to the fish\'s modified pelvic fins, which have evolved into adhesive discs (located ventrally, behind the pectoral fins); the fish use these discs to adhere to the substrate. Many species have bony, wart-like tubercles adorning the head and body; these are important taxonomic features of the family.',	'167483',	'Lumpsucker',	'599.jpg',	'image/jpeg',	65427,	'2012-04-20 09:39:39',	626,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8101,	1,	'FOOD00585'),
(600,	'Scombridae (Bonito, Mackerel, Tuna)',	'Scombridae',	'Scombridae is the family of the mackerels, tunas, and bonitos, and thus includes many of the most important and familiar food fishes. The family consists of 51 species in 15 genera and two subfamilies. All species are in the subfamily Scombrinae, except the butterfly kingfish - which is the sole member of subfamily Gasterochismatinae. Scombrids have two dorsal fins, and a series of finlets behind the rear dorsal fin and anal fin. The caudal fin is strongly divided and rigid, with a slender, ridged, base. The first (spiny) dorsal fin and the pelvic fins are normally retracted into body grooves. Species lengths vary from the 20 cm of the island mackerel to the 4.58 m recorded for the immense Atlantic bluefin tuna. Scombrids are generally predators of the open ocean, and are found worldwide in tropical and temperate waters. They are capable of considerable speed, due to a highly streamlined body and retractable fins. Some members of the family, in particular the tunas, are notable for being partially endothermic (warm-blooded), a feature that also helps them to maintain high speed and activity. Other adaptations include a large amount of red muscle, allowing them to maintain activity over long periods. Two of the fastest recorded scombrids are the wahoo and the yellowfin tuna, which can each attain speeds of 75 km/h .',	'172398',	'Scombridae',	'600.jpg',	'image/jpeg',	69172,	'2012-04-20 09:33:21',	627,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8224,	1,	'FOOD00586'),
(601,	'Marine mussel',	'Mytilidae',	'Mytilidae is a family of small to large saltwater mussels, marine bivalve mollusks in the order Mytiloida. It is the only family in the order. This order (and family) contains 32 genera. Species in the family Mytilidae are found world-wide, but they are more abundant in colder seas, where they often form uninterrupted beds on rocky shores in the intertidal zone and the shallow subtidal. The subfamily Bathymodiolinae is found in deep-sea habitats. Mytilids include the well-known edible sea mussels. A common feature of the shells of mussels is an asymmetrical shell which has a thick, adherent periostracum. The animals attached themselves to a solid substrate using a byssus.',	'79451',	'Mytilidae',	'601.jpg',	'image/jpeg',	124474,	'2012-04-20 09:32:15',	628,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	6547,	1,	'FOOD00587'),
(602,	'Norway haddock',	'Sebastes viviparus',	'The rose fish (Sebastes norvegicus), also known as the ocean perch, Atlantic redfish, Norway haddock, red perch, red bream, golden redfish, or hemdurgan, is a species of rockfish from the North Atlantic. Misleadingly, it is sometimes called bergylt, bream, or snapper, though it is unrelated to all of these. In the past, the scientific name Sebastes marinus was frequently used, but this is actually a synonym of Serranus scriba.\nThis food fish lives off the coasts of Europe and North America. Adults are found off the coast at depths of 100 to 1,000 m (330 to 3,280 ft); juveniles may be found in coastal waters such as fjords. The adults are slow-moving, gregarious fish, of some commercial importance. They reach 1 m (3 ft 3 in), though most only are about half that length. They are viviparous. While the young fish are of brownish color, the adults are bright red.',	'166779',	'Norway_haddock',	'602.jpg',	'image/jpeg',	60490,	'2012-04-20 09:36:21',	629,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	394708,	1,	'FOOD00588'),
(603,	'Norway lobster',	'Nephrops norvegicus',	'Nephrops norvegicus, known variously as the Norway lobster, Dublin Bay prawn, langoustine (compare langostino) or scampi, is a slim, orange-pink lobster which grows up to 25 cm (10 in) long, and is \"the most important commercial crustacean in Europe\". It is now the only extant species in the genus Nephrops, after several other species were moved to the closely related genus Metanephrops. It lives in the north-eastern Atlantic Ocean, and parts of the Mediterranean Sea, but is absent from the Baltic Sea and Black Sea. Adults emerge from their burrows at night to feed on worms and fish.',	'97317',	'Norway_lobster',	'603.jpg',	'image/jpeg',	65839,	'2012-04-20 09:44:01',	630,	'Aquatic foods',	'Crustaceans',	'Type 1',	'2011-02-09 00:37:50',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	6829,	1,	'FOOD00589'),
(604,	'Norway pout',	'Trisopterus esmarkii',	'Trisopterus esmarkii, the Norway Pout, is a species of fish found in the Barents Sea, North Sea, Baltic Sea, off the coasts of Norway, Iceland, the British Isles and elsewhere in the northeast Atlantic Ocean. It is in the same family as cod. It can generally be found at depths of 100 m to 200 m. Individuals can reach 35 cm, but average 19 cm. It is extensively fished, mostly for conversion into fishmeal, with 877,910 t taken in 1974, and only 39,223 t taken in 2008.',	'164756',	'Trisopterus esmarkii',	'604.jpg',	'image/jpeg',	320646,	'2012-04-20 09:30:30',	631,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	80723,	1,	'FOOD00590'),
(605,	'Oil palm',	'Elaeis',	'The oil palms (Elaeis) comprise two species of the Arecaceae, or palm family. They are used in commercial agriculture in the production of palm oil. [Wikipedia]',	'500805',	NULL,	'605.jpg',	'image/jpeg',	78044,	'2012-04-20 09:30:16',	632,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	51952,	1,	'FOOD00591'),
(606,	'True oyster',	'Ostreidae',	'The Ostreidae, the true oysters, include most species of molluscs commonly consumed as oysters. Pearl oysters are not true oysters, and belong to the suborder Pterioida. Like scallops, true oysters have a central adductor muscle, which means the shell has a characteristic central scar marking its point of attachment. The shell tends to be irregular as a result of attaching to a substrate. Both oviparous (egg-bearing) and larviparous (larvae-bearing) species are known within Ostreidae. Both types are hermaphrodites. However, the larviparous species show a pattern of alternating sex within each individual, whereas the oviparous species are simultaneous hermaphrodites, producing either female or male gametes according to circumstances. Members of genus Ostrea generally live continually immersed and are quite flat, with roundish shells. They differ from most bivalves by having shells completely made up of calcite, but with internal muscle scars of aragonitic composition. They fare best in somewhat oligotrophic water. They brood their fertilized eggs for various proportions of the period from fertilization to hatching. Members of genera Saccostrea and Crassostrea generally live in the intertidal zone, broadcast sperm and eggs into the sea, and can thrive in eutrophic water. One of the most commonly cultivated oysters is Crassostrea gigas, the Japanese oyster, which is ideally suited for oyster cultivation in seawater ponds.',	'79866',	'Ostreidae',	'606.jpg',	'image/jpeg',	160350,	'2012-04-20 09:43:08',	633,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	6563,	1,	'FOOD00592'),
(607,	'Sago palm',	'Metroxylon sagu',	'True sago palm is a suckering (multiple-stemmed) palm, each stem only flowering once (hapaxanthic) with a large upright terminal inflorescence. A stem grows 7?25 m tall before it ends in an inflorescence. Before flowering, a stem bears about 20 pinnate leaves up to 10 m long. Each leaf has about 150-180 leaflets up to 175 cm long. The inflorescence, 3-7.5 m tall and wide, consists of the continuation of the stem and 15-30 upwardly-curving (first-order) branches spirally arranged on it. Each first-order branch has 15-25 rigid, distichously arranged second-order branches; each second-order branch has 10-12 rigid, distichously arranged third-order branches. Flower pairs are spirally arranged on the third-order branches, each pair consisting of one male and one hermaphrodite flower. The fruit is drupe-like, about 5 cm in diameter, covered in scales which turn from bright green to straw-coloured upon ripening.',	'506732',	'Metroxylon_sagu',	'607.jpg',	'image/jpeg',	135856,	'2012-04-20 09:38:21',	634,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	93297,	1,	'FOOD00593'),
(608,	'Persimmon',	'Diospyros',	'Persimmons are the edible fruit of a number of species of trees in the genus Diospyros. Diospyros is in the family Ebenaceae, and certain species of Diospyros are the sources of most kinds of ebony wood, and not all species bear edible fruit. In color the ripe fruit of the cultivated strains range from light yellow-orange to dark red-orange depending on the species and variety. They similarly vary in size from 1.5 to 9 cm (0.5 to 4 in) in diameter, and in shape the varieties may be spherical, acorn-, or pumpkin-shaped. The calyx generally remains attached to the fruit after harvesting, but becomes easy to remove once the fruit is ripe. The ripe fruit has a high glucose content. The protein content is low, but it has a balanced protein profile. Persimmon fruits have been put to various medicinal and chemical uses. Like the tomato, persimmons are not popularly considered to be berries, but in terms of botanical morphology the fruit is in fact a berry.',	'23853',	'Persimmon',	'608.jpg',	'image/jpeg',	38596,	'2012-04-20 09:34:08',	635,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	13492,	1,	'FOOD00594'),
(609,	'Pikeperch',	'Sander lucioperca',	'Sander (formerly known as Stizostedion) is a genus of fish in the Percidae (perch) family. They are also known as \"pike-perch\" because of their resemblance to fish in the unrelated Esocidae (pike) family.\nLocal names for the fish have been the basis for many geographical names, like River Suda in Russia or Saunags village on the Baltic coast.',	'650172',	'Pikeperch',	'609.jpg',	'image/jpeg',	65687,	'2012-04-20 09:42:04',	636,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	283035,	1,	'FOOD00595'),
(610,	'Pleuronectidae (Dab, Halibut, Plaice)',	'Pleuronectidae',	'Righteye flounders are a family, Pleuronectidae, of flounders. They are called \"righteye flounders\" because most species lie on the sea bottom on their left side, with both eyes on the right side.[1] The Paralichthyidae are the opposite, with their eyes on the left side. A small number of species in Pleuronectidae can also have their eyes on the left side, notably the members of the genus Platichthys.\nTheir dorsal and anal fins are long and continuous, with the dorsal fin extending forward onto the head. Females lay eggs that float in mid-water until the larvae develop, and they sink to the bottom.\nThey are found on the bottoms of oceans around the world, with some species, such as the Atlantic halibut, Hippoglossus hippoglossus, being found down to 2,000 metres (6,600 ft). The smaller species eat sea-floor invertebrates such as polychaetes and crustaceans, but the larger righteye flounders, such as H. hippoglossus, which grows up to 4.7 metres (15 ft) in length, feed on other fishes and cephalopods as well.\nThey include many important commercially fished species, including not only the various fish called flounders, but also the European plaice, the halibuts, the lemon sole, the common dab, the Pacific Dover sole, and the flukes.',	'172859',	'Pleuronectidae',	'610.jpg',	'image/jpeg',	83803,	'2012-04-20 09:38:11',	637,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8256,	1,	'FOOD00596'),
(611,	'Rock ptarmigan',	'Lagopus muta',	'\"The rock ptarmigan (Lagopus muta) is a medium-sized gamebird in the grouse family. It is known simply as the ptarmigan in the UK and in Canada, where it is the official bird for the territory of Nunavut, Canada, and the official game bird for the province of Newfoundland and Labrador, Canada, and colloquially as the snow chicken in the United States. In Japan it is known as the raichou , which means \'thunder bird.\' It is the official bird of Toyama Prefecture and is a protected species nationwide. The rock ptarmigan is 34?36 centimetres (13?14 in) long (tail 8 cm (3.1 in)) with a wing-span of 54?60 centimetres (21?24 in). It is slighter smaller than the willow ptarmigan by about 10%. The male\'s \"\"song\"\" is a loud croaking.\"',	'677542',	'Rock_ptarmigan',	'611.jpg',	'image/jpeg',	90746,	NULL,	638,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	64668,	1,	'FOOD00597'),
(612,	'Pacific ocean perch',	'Sebastes alutus',	'The Pacific ocean perch (Sebastes alutus) has a wide distribution in the North Pacific from southern California around the Pacific rim to northern Honshu, Japan, including the Bering Sea. The species appears to be most abundant in northern British Columbia, the Gulf of Alaska, and the Aleutian Islands (Allen and Smith 1988).',	'166707',	'Pacific ocean perch',	'612.jpg',	'image/jpeg',	109176,	'2012-04-20 09:41:38',	639,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	72055,	1,	'FOOD00598'),
(613,	'Black salsify',	'Scorzonera hispanica',	'Scorzonera hispanica, black salsify or Spanish salsify, also known as black oyster plant, serpent root, viper\'s herb, viper\'s grass or simply scorzonera, is a perennial member of the genus Scorzonera in the sunflower family, cultivated as a root vegetable in the same way as salsify, also in the sunflower family.',	'505091',	'Scorzonera hispanica',	'613.jpg',	'image/jpeg',	53712,	'2012-04-20 09:33:24',	641,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	114289,	1,	'FOOD00599'),
(614,	'True seal',	'Phocidae',	'The true seals or earless seals are one of the three main groups of mammals within the seal superfamily, Pinnipedia. All true seals are members of the family Phocidae. They are sometimes called crawling seals to distinguish them from the fur seals and sea lions of the family Otariidae. Seals live in the oceans of both hemispheres and are mostly confined to polar, subpolar, and temperate climates, with the exception of the more tropical monk seals.',	'180640',	'Earless seal',	'614.jpg',	'image/jpeg',	35757,	'2012-04-20 09:39:36',	642,	'Aquatic foods',	'Pinnipeds',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	9709,	0,	'FOOD00600'),
(615,	'Red algae',	'Rhodophyta',	'The red algae, or Rhodophyta, are one of the oldest groups of eukaryotic algae, and also one of the largest, with about 5,000?6,000 species of mostly multicellular, marine algae, including many notable seaweeds. Other references indicate as many as 10,000 species; more detailed counts indicate about 4,000 in about 600 genera (3,738 marine species in 546 genera and 10 orders (plus the unclassifiable); 164 freshwater species in 30 genera in eight orders).\nThe red algae form a distinct group characterized by these attributes: eukaryotic cells without flagella and centrioles, using floridean polysaccharides as food reserves, with phycobiliproteins as accessory pigments (giving them their red color), and with chloroplasts lacking external endoplasmic reticulum and containing unstacked thylakoids. Most red algae are also multicellular, macroscopic, marine, and have sexual reproduction. They often have alternation of generations and may have three generations rather than two.',	'660046',	'Red_algae',	'615.jpg',	'image/jpeg',	17864,	'2012-04-20 09:30:24',	643,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	2763,	1,	'FOOD00601'),
(616,	'Kombu',	'Saccharina japonica',	'Kombu is edible kelp from the family Laminariaceae widely eaten in East Asia. It may also be referred to as konbu (Japanese), dashima or haidai. Some edible kelps in the family Laminariaceae are not always called kombu, such as arame, kurome  (Ecklonia kurome) or Macrocystis pyrifera. Most kombu is from the species Saccharina japonica (Laminaria japonica), extensively cultivated on ropes in the seas of Japan and Korea. Over 90% of Japanese kombu is cultivated, mostly in Hokkaido, but also as far south as the Seto Inland Sea with the development of cultivation technology today.',	NULL,	'Kombu',	'616.jpg',	'image/jpeg',	71122,	'2012-04-20 09:31:57',	644,	'Aquatic foods',	'Seaweed',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	88149,	1,	'FOOD00602'),
(617,	'Snail',	'Gastropoda',	'Snail is a common name that is applied most often to land snails, terrestrial pulmonate gastropod molluscs. However, the common name \"snail\" is also applied to most of the members of the molluscan class Gastropoda that have a coiled shell that is large enough for the animal to retract completely into. When the word \"snail\" is used in this most general sense, it includes not just land snails but also thousands of species of sea snails and freshwater snails. Occasionally a few other molluscs that are not actually gastropods, such as the Monoplacophora, which superficially resemble small limpets, may also informally be referred to as \"snails\".\nSnail-like animals that naturally lack a shell, or have only an internal shell, are usually called slugs, and land snails that have only a very small shell (that they cannot retract into) are often called semislugs.',	'69459',	'Snail',	'617.jpg',	'image/jpeg',	50883,	'2012-04-20 09:33:54',	645,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	6448,	1,	'FOOD00603'),
(618,	'True sole',	'Soleidae',	'The true soles are a family, Soleidae, of flatfishes. It includes salt and brackish water species in the East Atlantic, Indian Ocean, and West and Central Pacific Ocean. Fresh water species are found in Africa, southern Asia, New Guinea and Australia.\nIn the past soles of the Americas (both fresh and salt water) were included in this family, but they have been separated to their own family, the American soles (Achiridae). The only true sole remaining in that region is Aseraggodes herrei of the Galápagos and Cocos Island.\nThe true soles are bottom-dwelling fishes feeding on small crustaceans and other invertebrates. The family contains 30 genera and a total of about 180 species.\nSoles begin life as bilaterally symmetric larvae, with an eye on each side of the head. But during development the left eye moves around onto the right side of the head. Adult soles lie on their left (blind) side on the sea floor, often covered in mud which, in combination with their dark colours, makes them hard to spot.\nA flatfish resembling a small halibut or sole was observed by the Bathyscaphe Trieste at the bottom of the Mariana Trench at a depth of about 11 km (36,000 ft). This observation has been questioned by fish experts, and recent authorities do not recognize it as valid.\nMany soles are important food species: the common sole, Solea solea, is popular in northern Europe and the Mediterranean.',	'172980',	'True_sole',	'618.jpg',	'image/jpeg',	108291,	'2012-04-20 09:41:01',	646,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	30948,	1,	'FOOD00604'),
(619,	'Catfish',	'Siluriformes',	'Catfishes (order Siluriformes) are a diverse group of ray-finned fish. Named for their prominent barbels, which resemble a cat\'s whiskers, catfish range in size and behavior from the heaviest and longest, the Mekong giant catfish from Southeast Asia and the second longest, the wels catfish of Eurasia, to detritivores (species that eat dead material on the bottom), and even to a tiny parasitic species commonly called the candiru, Vandellia cirrhosa. There are armour-plated types and also naked types, neither having scales. Despite their name, not all catfish have prominent barbels; members of the Siluriformes order are defined by features of the skull and swimbladder. Catfish are of considerable commercial importance; many of the larger species are farmed or fished for food. Many of the smaller species, particularly the genus Corydoras, are important in the aquarium hobby. Many catfish are nocturnal, but others (many Auchenipteridae) are crepuscular or diurnal (most Loricariidae or Callichthyidae for example).',	'163992',	'Catfish',	'619.jpg',	'image/jpeg',	75460,	'2012-04-20 09:40:27',	647,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:51',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	7995,	1,	'FOOD00605'),
(620,	'Thistle',	'Cirsium',	'Thistle is the common name of a group of flowering plants characterised by leaves with sharp prickles on the margins, mostly in the family Asteraceae. Prickles often occur all over the plant – on surfaces such as those of the stem and flat parts of leaves. These are an adaptation that protects the plant against herbivorous animals, discouraging them from feeding on the plant. Typically, an involucre with a clasping shape of a cup or urn subtends each of a thistle\'s flowerheads. The term thistle is sometimes taken to mean exactly those plants in the tribe Cynareae, especially the genera Carduus, Cirsium, and Onopordum. However, plants outside this tribe are sometimes called thistles, and if this is done thistles would form a polyphyletic group. Thistle is the floral emblem of Scotland.',	'36334',	'Thistle',	'620.jpg',	'image/jpeg',	79695,	'2012-04-20 09:44:16',	648,	'Vegetables',	'Root vegetables',	'Type 1',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	41549,	1,	'FOOD00606'),
(621,	'Thunnus',	'Thunnus',	'Thunnus is a genus of ocean-dwelling ray-finned bony fish from the Scombridae (Mackerel) family. More specifically, Thunnus is one of five genera which comprise the Thunnini tribe - a tribe that is collectively (and famously) known as the tunas. Also called the true tunas or real tunas, Thunnus consists of eight species of tuna (more than half of the overall tribe), divided into two subgenera. The word Thunnus is the Middle Latin form of the Ancient Greek: θύννος (thýnnos) \"tunny-fish\"- which is in turn derived from θύνω (thýnō), \"rush, dart along\". The first written use of the word was by Homer.\r\nTheir coloring, metallic blue on top and shimmering silver-white on the bottom, helps camouflage them from above and below. They can grow to 15 feet long and weigh over 1,000 pounds, and can swim up to 50 miles per hour when pursuing prey. Atlantic bluefin tunas are warm-blooded, which is a rare trait among fish, and are comfortable in the cold waters. Bluefin fish are found in Newfoundland and Iceland, as well as the tropical waters of the Gulf of Mexico and the Mediterranean Sea, where they go each year to spawn.\r\nTuna can be a good source of omega-3 fatty acids. It can contain 300 milligrams (0.011 oz) per serving. However, the level of omega-3 oils found in canned tuna is highly variable, since some common manufacturing methods destroy much of the omega-3 oils in the fish.',	'172418',	'Thunnus',	'621.jpg',	'image/jpeg',	10351,	'2012-04-20 09:33:32',	649,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8234,	1,	'FOOD00607'),
(622,	'Walnut',	'Juglans',	'A walnut is an edible seed of any tree of the genus Juglans, especially the Persian or English walnut, Juglans regia. Broken nutmeats of the eastern black walnut from the tree Juglans nigra are also commercially available in small quantities, as are foods prepared with butternut nutmeats from Juglans cinerea. Walnut seeds are a high density source of nutrients, particularly proteins and essential fatty acids. Walnuts, like other tree nuts, must be processed and stored properly. Poor storage makes walnuts susceptible to insect and fungal mold infestations; the latter produces aflatoxin—a potent carcinogen. A mold infested walnut seed batch should not be screened and then consumed; the entire batch should be discarded. Walnuts are rounded, single-seeded stone fruits of the walnut tree. The walnut fruit is enclosed in a green, leathery, fleshy husk. This husk is inedible. After harvest, the removal of the husk reveals the wrinkly walnut shell, which is in two halves. This shell is hard and encloses the kernel, which is also made up of two halves separated by a partition. The seed kernels — commonly available as shelled walnuts — are enclosed in a brown seed coat which contains antioxidants. The antioxidants protect the oil-rich seed from atmospheric oxygen thereby preventing rancidity. The two most common major species of walnuts are grown for their seeds — the Persian or English Walnut and the Black Walnut. The English Walnut (J. regia) originated in Persia, and the Black Walnut (J. nigra) is native to eastern North America. The Black walnut is of high flavor, but due to its hard shell and poor hulling characteristics it is not grown commercially for nut production. The commercially produced walnut varieties are nearly all hybrids of the English walnut. Other species include J. californica, the California Black Walnut (often used as a root stock for commercial breeding of J. regia), J. cinerea (butternuts), and J. major, the Arizona Walnut. Walnuts are late to bear leaves, typically not until more than halfway through the spring. They also secrete chemicals into the soil to prevent competing vegetation from growing. Because of this, flowers or vegetable gardens should not be planted too close to them. The husks of walnut contains a juice that will readily stain anything it comes into contact with. It has been used as a dye for cloth.',	'19248',	'Walnut',	'622.jpg',	'image/jpeg',	127484,	'2012-04-20 09:44:28',	650,	'Nuts',	'Nuts',	'Type 1',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	16718,	1,	'FOOD00608'),
(623,	'Cetacea (Dolphin, Porpoise, Whale)',	'Cetacea',	'The order Cetacea includes the marine mammals commonly known as whales, dolphins, and porpoises. Cetus is Latin and is used in biological names to mean \'whale\'. Its original meaning, \'large sea animal\', was more general. It comes from Ancient Greek ????? (k?tos), meaning \'whale\' or \"any huge fish or sea monster\". In Greek mythology, the monster Perseus defeated was called Ceto, which is depicted by the constellation of Cetus. Cetology is the branch of marine science associated with the study of cetaceans.\nFossil evidence suggests that the cetaceans share a common ancestor with land-dwelling mammals that began living in marine environments around 50 million years ago. Today, they are the mammals best adapted to aquatic life. The body of a cetacean is fusiform (spindle-shaped). The forelimbs are modified into flippers. The tiny hindlimbs are vestigial; they do not attach to the backbone and are hidden within the body. The tail has horizontal flukes. Cetaceans are nearly hairless, and are insulated from the cooler water they inhabit by a thick layer of blubber.',	'180403',	'Cetacea',	'623.jpg',	'image/jpeg',	13054,	'2012-04-20 09:36:49',	651,	'Aquatic foods',	'Cetaceans',	'Type 1',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	9721,	0,	'FOOD00609'),
(624,	'Columbidae (Dove, Pigeon)',	'Columbidae',	'\"Pigeons and doves constitute the bird clade Columbidae, that includes about 310 species. Pigeons are stout-bodied birds with short necks, and have short, slender bills with fleshy ceres. Doves feed on seeds, fruits, and plants. This family occurs worldwide, but the greatest variety is in the Indomalaya and Australasia ecozones. In general, the terms \"\"dove\"\" and \"\"pigeon\"\" are used somewhat interchangeably. Pigeon derives from the Latin pipio, for a \"\"peeping\"\" chick, while dove is a Germanic word that refers to the bird\'s diving flight. In ornithological practice, \"\"dove\"\" tends to be used for smaller species and \"\"pigeon\"\" for larger ones, but this is in no way consistently applied, and historically, the common names for these birds involve a great deal of variation between the terms. The species most commonly referred to as \"\"pigeon\"\" is the feral rock pigeon, common in many cities. Doves and pigeons build relatively flimsy nests ? often using sticks and other debris ? which may be placed in trees, ledges, or, on the ground, depending on species. They lay one or two eggs, and both parents care for the young, which leave the nest after seven to 28 days. Unlike most birds, both sexes of doves and pigeons produce \"\"crop milk\"\" to feed to their young, secreted by a sloughing of fluid-filled cells from the lining of the crop. Young doves and pigeons are called \"\"squabs\"\".\"',	'177061',	'Columbidae',	'624.jpg',	'image/jpeg',	77036,	NULL,	652,	'Animal foods',	'Poultry',	'Type 1',	'2018-01-18 03:18:03',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	8930,	1,	'FOOD00610'),
(625,	'Conch',	'Strombidae',	'Conch is a common name that is applied to a number of different medium to large-sized sea snails or their shells. The term generally applies to large sea snails whose shell has a high spire and a noticeable siphonal canal (in other words, the shell comes to a point at both ends).\nTrue conches are marine gastropod molluscs in the family Strombidae, specifically in the genus Strombus and other closely related genera such as Eustrombus.\nMany species also are often called \"conch\", but are not in the family Strombidae, including Melongena species (family Melongenidae), and the horse conch Pleuroploca gigantea (family Fasciolariidae). They also include the sacred chank or more correctly shankha shell (Turbinella pyrum) and other Turbinella species in the family Turbinellidae.',	'72554',	'Conch',	'625.jpg',	'image/jpeg',	112150,	'2012-04-20 09:43:52',	653,	'Aquatic foods',	'Mollusks',	'Type 1',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	NULL,	0,	'specific',	69694,	1,	'FOOD00611'),
(626,	'Grape wine',	NULL,	'Wine is an alcoholic beverage made from fermented grapes or other fruits. The natural chemical balance of grapes lets them ferment without the addition of sugars, acids, enzymes, water, or other nutrients. Yeast consumes the sugars in the grapes and converts them into alcohol and carbon dioxide. Different varieties of grapes and strains of yeasts produce different styles of wine. The well-known variations result from the very complex interactions between the biochemical development of the fruit, reactions involved in fermentation, terroir and subsequent appellation, along with human intervention in the overall process.',	NULL,	'Grape_wine',	'626.jpg',	'image/jpeg',	24988,	'2012-04-20 09:29:56',	654,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00612'),
(627,	'Berry wine',	NULL,	NULL,	NULL,	'',	'627.jpg',	'image/jpeg',	16358,	'2012-04-20 09:34:03',	655,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00613'),
(628,	'Other wine',	NULL,	NULL,	NULL,	NULL,	'628.jpg',	'image/jpeg',	55077,	'2012-04-20 09:37:43',	656,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-02-09 00:37:52',	'2019-12-11 19:37:56',	NULL,	2,	0,	'specific',	NULL,	0,	'FOOD00614'),
(629,	'Apple cider',	NULL,	'Apple cider (also called sweet cider or soft cider) is the name used in the United States and parts of Canada for an unfiltered, unsweetened, non-alcoholic beverage made from apples. Apple cider is easy and inexpensive to produce. It may be opaque due to fine apple particles in suspension and may be tangier than conventional filtered apple juice, depending on the apples used.',	NULL,	'Apple_cider',	'629.jpg',	'image/jpeg',	60775,	'2012-04-20 09:30:39',	657,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00615'),
(630,	'Liquor',	NULL,	'A distilled beverage, spirit, liquor, or hard liquor is an alcoholic beverage produced by distillation of a mixture produced from alcoholic fermentation, such as wine. This process purifies it and removes diluting components like water, for the purpose of increasing its proportion of alcohol content (commonly known as alcohol by volume, ABV). As distilled beverages contain more alcohol they are considered \"harder\" - in North America, the term hard liquor is used to distinguish distilled beverages from undistilled ones, which are implicitly weaker.\nAs examples, this does not include beverages such as beer, wine, and cider, as they are fermented but not distilled. These all have relatively low alcohol content, typically less than 10%. However, brandy is a spirit, is distinct as a drink from wine (due to distillation), and has an ABV over 35%. Other examples of common distilled beverages include vodka, gin, tequila, rum, whisky, as well as eau de vie (Fruit Brandy or Schnapps), baijiu, soju, aguardiente, pálinka, fernet, and slivovitz.',	NULL,	'Liquor',	'630.jpg',	'image/jpeg',	175237,	'2012-04-20 09:31:58',	658,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00616'),
(631,	'Cheese',	NULL,	'Cheese is a food derived from milk that is produced in a wide range of flavors, textures, and forms by coagulation of the milk protein casein. It comprises proteins and fat from milk, usually the milk of cows, buffalo, goats, or sheep. During production, the milk is usually acidified, and adding the enzyme rennet causes coagulation. The solids are separated and pressed into final form. Some cheeses have molds on the rind or throughout. Most cheeses melt at cooking temperature.',	NULL,	'Cheese',	'631.jpg',	'image/jpeg',	32345,	'2012-04-20 09:41:39',	659,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00617'),
(632,	'Milk (Cow)',	'',	'As an agricultural product, milk is extracted from mammals during or soon after pregnancy and used as food for humans. Worldwide, dairy farms produced about 730 million tonnes of milk in 2011, from 260 million dairy cows. India is the world\'s largest producer and consumer of milk, yet neither exports nor imports milk. New Zealand, the European Union\'s 28 member states, Australia, and the United States are the world\'s largest exporters of milk and milk products. China and Russia are the world\'s largest importers of milk and milk products.\r\nThroughout the world, there are more than 6 billion consumers of milk and milk products. Over 750 million people live within dairy farming households. Milk is a key contributor to improving nutrition and food security particularly in developing countries. Improvements in livestock and dairy technology offer significant promise in reducing poverty and malnutrition in the world.',	'',	'Milk',	'632.jpg',	'image/jpeg',	68993,	'2015-03-10 23:11:22',	660,	'Milk and milk products',	'Unfermented milks',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00618'),
(633,	'Eggs',	NULL,	'An egg is the organic vessel containing the zygote, resulting from fertilization of the ovum, in which an animal embryo develops until it can survive on its own, at which point the animal hatches. Most arthropods, vertebrates, and mollusks lay eggs, although some do not, e.g. scorpions and most mammals.\nOviparous animals are those that lay eggs, with little or no other development within the mother. The study or collecting of eggs, particularly bird eggs, is called oology.\nThe term \"egg\" is used differently outside the animal kingdom. Reproductive structures similar to the egg in other kingdoms are termed \"spores,\" or in spermatophytes \"seeds,\" or in gametophytes \"egg cells\".',	NULL,	'Eggs',	'633.jpg',	'image/jpeg',	27685,	'2012-04-20 09:30:18',	661,	'Eggs',	'Eggs',	'Unknown',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'generic',	NULL,	1,	'FOOD00619'),
(634,	'Yogurt',	NULL,	'Yogurt, yoghurt, or yoghourt is a fermented milk product produced by bacterial fermentation of milk. The bacteria used to make yogurt are known as \"yogurt cultures\". Fermentation of lactose by these bacteria produces lactic acid, which acts on milk protein to give yogurt its texture and its characteristic tang.\nWorldwide, cow\'s milk, the protein of which is mainly casein, is most commonly used to make yogurt. Milk from water buffalo, goats, ewes, mares, camels, and yaks however, is also used to produce yogurt in various parts of the world.',	NULL,	NULL,	'634.jpg',	'image/jpeg',	79588,	'2012-04-20 09:30:23',	662,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2011-02-09 00:37:52',	'2019-05-14 18:05:28',	NULL,	2,	0,	'specific',	NULL,	1,	'FOOD00620'),
(638,	'Bean',	NULL,	'Bean is a common name for large plant seeds used for human food or animal feed of several genera of the family Fabaceae.',	NULL,	'Bean',	'638.jpg',	'image/jpeg',	18138,	'2012-04-20 09:43:20',	NULL,	'Pulses',	'Beans',	'Type 1',	'2011-12-02 17:11:53',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00621'),
(639,	'Vodka',	NULL,	'Vodka is a distilled beverage composed primarily of water and ethanol, sometimes with traces of impurities and flavorings. Traditionally, vodka is made by the distillation of fermented grains or potatoes, though some modern brands use other substances, such as fruits or sugar.',	NULL,	'Vodka',	'639.jpg',	'image/jpeg',	85287,	'2012-04-20 09:29:26',	NULL,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-12-02 17:29:03',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00622'),
(640,	'Whisky',	NULL,	'Whisky or whiskey is a type of distilled alcoholic beverage made from fermented grain mash. Different grains are used for different varieties, including barley, malted barley, rye, malted rye, wheat, and corn. Whisky is typically aged in wooden casks, made generally of charred white oak. Whisky is a strictly regulated spirit worldwide with many classes and types. The typical unifying characteristics of the different classes and types are the fermentation of grains, distillation, and aging in wooden barrels.',	NULL,	'Whisky',	'640.jpg',	'image/jpeg',	136846,	'2012-04-20 09:35:43',	NULL,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-12-02 17:29:41',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00623'),
(641,	'Ice cream',	NULL,	'Ice cream (derived from earlier iced cream or cream ice) is a frozen dessert usually made from dairy products, such as milk and cream and often combined with fruits or other ingredients and flavours. Most varieties contain sugar, although some are made with other sweeteners. In some cases, artificial flavourings and colourings are used in addition to, or instead of, the natural ingredients. The mixture of chosen ingredients is stirred slowly while cooling, in order to incorporate air and to prevent large ice crystals from forming. The result is a smoothly textured semi-solid foam that is malleable and can be scooped.',	NULL,	'Ice_cream',	'641.jpg',	'image/jpeg',	70607,	'2012-04-20 09:44:30',	NULL,	'Confectioneries',	'Frozen desserts',	'Type 2',	'2011-12-02 17:36:03',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00624'),
(642,	'Gin',	NULL,	'Gin is a spirit which derives its predominant flavour from juniper berries (Juniperus communis). From its earliest beginnings in the Middle Ages, gin has evolved over the course of a millennium from a herbal medicine to an object of commerce in the spirits industry. Today, the gin category is one of the most popular and widely distributed range of spirits, and is represented by products of various origins, styles, and flavor profiles that all revolve around juniper as a common ingredient.',	NULL,	'Gin',	'642.jpg',	'image/jpeg',	5618,	'2012-04-23 10:25:45',	NULL,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-12-02 22:06:02',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00625'),
(643,	'Honey',	NULL,	'Honey is a sweet food made by bees using nectar from flowers. The variety produced by honey bees is the one most commonly referred to, as it is the type of honey collected by beekeepers and consumed by humans. Honey produced by other bees and insects has distinctly different properties. Honey bees transform nectar into honey by a process of regurgitation and evaporation. They store it as a primary food source in wax honeycombs inside the beehive. Honey gets its sweetness from the monosaccharides, fructose, and glucose, and has approximately the same relative sweetness as that of granulated sugar. It has attractive chemical properties for baking, and a distinctive flavor that leads some people to prefer it over sugar and other sweeteners. Most microorganisms do not grow in honey because of its low water activity of 0.6. However, honey sometimes contains dormant endospores of the bacterium Clostridium botulinum, which can be dangerous to infants, as the endospores can transform into toxin-producing bacteria in the infant\'s immature intestinal tract, leading to illness and even death. Honey has a long history of human consumption, and is used in various foods and beverages as a sweetener and flavoring. It also has a role in religion and symbolism. Flavors of honey vary based on the nectar source, and various types and grades of honey are available. It is also used in various medicinal traditions to treat ailments. The study of pollens and spores in raw honey can determine floral sources of honey. Bees carry an electrostatic charge whereby they attract other particles in addition to pollen, which become incorporated into their honey; the honey can be analysed by the techniques of melissopalynology in area environmental studies of radioactive particles, dust and particulate pollution.',	NULL,	'Honey',	'643.jpg',	'image/jpeg',	71095,	'2012-04-20 09:43:55',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-02 22:06:27',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00626'),
(644,	'Liquorice',	NULL,	'Liquorice or licorice is the root of Glycyrrhiza glabra from which a somewhat sweet flavor can be extracted. The liquorice plant is a legume that is native to southern Europe and parts of Asia. It is not botanically related to anise, star anise, or fennel, which are sources of similar flavouring compounds. \nIt is a herbaceous perennial, growing to 1 m in height, with pinnate leaves about 7?15 cm (3?6 in) long, with 9?17 leaflets. The flowers are 0.8?1.2 cm (??½ in) long, purple to pale whitish blue, produced in a loose inflorescence. The fruit is an oblong pod, 2?3 cm (1 in) long, containing several seeds. The roots are stoloniferous.',	NULL,	'Liquorice',	'644.jpg',	'image/jpeg',	93291,	'2012-04-20 09:37:10',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-02 22:10:07',	'2020-03-12 20:59:56',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00627'),
(645,	'Vinegar',	NULL,	'Vinegar is a liquid consisting mainly of acetic acid (CH3CO2H) and water. The acetic acid is produced by the fermentation of ethanol by acetic acid bacteria. Vinegar is now mainly used as a cooking ingredient, but historically, as the most easily available mild acid, it had a great variety of industrial, medical, and domestic uses, some of which (such as a general household cleanser) are still promoted today. Commercial vinegar is produced either by fast or slow fermentation processes. In general, slow methods are used with traditional vinegars, and fermentation proceeds slowly over the course of weeks or months. The longer fermentation period allows for the accumulation of a nontoxic slime composed of acetic acid bacteria. Fast methods add mother of vinegar to the source liquid before adding air using a venturi pump system or a turbine to promote oxygenation to obtain the fastest fermentation. In fast production processes, vinegar may be produced in a period ranging from 20 hours to three days.',	NULL,	'Vinegar',	'645.jpg',	'image/jpeg',	44035,	'2012-04-20 09:43:23',	NULL,	'Baking goods',	'Seasonings',	'Type 2',	'2011-12-02 22:11:53',	'2019-05-14 18:05:28',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00628'),
(646,	'Rum',	NULL,	'Rum is a distilled alcoholic beverage made from sugarcane byproducts, such as molasses, or directly from sugarcane juice, by a process of fermentation and distillation. The distillate, a clear liquid, is then usually aged in oak barrels. Rum can be referred to in Spanish by descriptors such as ron viejo (\"old rum\") and ron añejo (\"aged rum\").',	NULL,	'Rum',	'646.jpg',	'image/jpeg',	81153,	'2012-04-20 09:42:36',	NULL,	'Beverages',	'Distilled beverages',	'Type 2',	'2011-12-02 22:13:25',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00629'),
(647,	'Port wine',	'',	'Port wine (also known as Vinho do Porto, Portuguese pronunciation: [ˌviɲuduˈpoɾtu], Porto, and usually simply port) is a Portuguese fortified wine produced exclusively in the Douro Valley in the northern provinces of Portugal. It is typically a sweet, red wine, often served as a dessert wine though it also comes in dry, semi-dry, and white varieties. Fortified wines in the style of port are also produced outside Portugal, most notably in Australia, South Africa, Canada, India, Argentina, and the United States. Under European Union Protected Designation of Origin guidelines, only the product from Portugal may be labelled as port or Porto. In the United States, wines labelled \"port\" may come from anywhere in the world, while the names \"Oporto\", \"Porto\", and \"Vinho do Porto\" have been recognised as foreign, non-generic names for Port wines originating in Portugal. Under European Union Protected Designation of Origin guidelines, only the product from Portugal may be labelled as port or Porto.[2] In the United States, wines labelled \"port\" may come from anywhere in the world,[3] while the names \"Oporto\", \"Porto\", and \"Vinho do Porto\" have been recognised as foreign, non-generic names for Port wines originating in Portugal. Port wine is typically richer, sweeter, heavier, and higher in alcohol content than unfortified wines. This is caused by the addition of distilled grape spirits (aguardente similar to brandy) to fortify the wine and halt fermentation before all the sugar is converted to alcohol, and results in a wine that is usually 19 to 20% alcohol. Port is commonly served after meals as a dessert wine in English-speaking countries, often with cheese, nuts or chocolate; white and tawny ports are often served as an apéritif. In Europe all types of port are frequently consumed as aperitifs.[Wikipedia].',	'',	'Port_wine',	'647.jpg',	'image/jpeg',	66694,	'2012-04-20 09:35:39',	NULL,	'Beverages',	'Fortified wines',	'Type 2',	'2011-12-02 22:15:28',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00630'),
(648,	'Vermouth',	NULL,	'Vermouth is an aromatized fortified wine flavored with various botanicals (roots, barks, flowers, seeds, herbs, spices). The modern versions of the beverage were first produced in 1757 in Turin, Italy. Vermouth was consumed as a medicinal libation until the later 19th century when it became an important ingredient in many of the first classic cocktails, such as the martini, the Manhattan, and the Negroni. In addition to being consumed as an aperitif or cocktail ingredient, vermouth is sometimes used as a substitute for white wine in cooking. Historically, there have been two main types of vermouth, sweet and dry. Recently, however, vermouth manufacturers have begun experimenting and have created various styles, including white or bianco, amber, and rose. Vermouth is produced by starting with a base of a neutral grape wine. Each manufacturer adds additional alcohol and a proprietary mixture of dry ingredients, consisting of aromatic herbs, roots, and barks, to the base wine. After the wine is aromatized and fortified, the vermouth is sweetened with either cane sugar or caramel, depending on the style. Italian and French companies produce most of the vermouth consumed throughout the world.',	NULL,	'Vermouth',	'648.jpg',	'image/jpeg',	25903,	'2012-04-20 09:37:04',	NULL,	'Beverages',	'Fortified wines',	'Type 2',	'2011-12-02 22:17:03',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00631'),
(649,	'Sherry',	NULL,	'Sherry is a fortified wine made from white grapes that are grown near the town of Jerez de la Frontera in Andalusia, Spain. Sherry is produced in a variety of dry styles made primarily from the Palomino grape, ranging from light versions similar to white table wines, such as Manzanilla and Fino, to darker and heavier versions that have been allowed to oxidise as they age in barrel, such as Amontillado and Oloroso. Sweet dessert wines are also made, from Pedro Ximenez or Moscatel grapes, and are sometimes blended with Palomino-based Sherries.',	NULL,	'Sherry',	'649.jpg',	'image/jpeg',	35002,	'2012-04-20 09:33:59',	NULL,	'Beverages',	'Fortified wines',	'Type 2',	'2011-12-02 22:18:04',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00632'),
(650,	'Madeira wine',	NULL,	'Madeira is a fortified Portuguese wine made in the Madeira Islands. Madeira is produced in a variety of styles ranging from dry wines which can be consumed on their own as an aperitif, to sweet wines more usually consumed with dessert. Cheaper versions are often flavoured with salt and pepper for use in cooking.',	NULL,	'Madeira_wine',	'650.jpg',	'image/jpeg',	46719,	'2012-04-20 09:41:52',	NULL,	'Beverages',	'Fortified wines',	'Type 2',	'2011-12-02 22:19:24',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00633'),
(651,	'Nougat',	NULL,	'Nougat is a family of confectioneries made with sugar and/or honey, roasted nuts (almonds, walnuts, pistachios, hazelnuts, and recently macadamia nuts are common), whipped egg whites, and sometimes chopped candied fruit. The consistency of nougat can range from soft and chewy to hard and crunchy, and it is used in a variety of candy bars and chocolates. The word nougat comes from Occitan pan nogat, from Latin nux gatum \'nut cake\'.',	NULL,	'Nougat',	'651.jpg',	'image/jpeg',	806892,	'2012-04-20 09:35:05',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-02 22:46:11',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00634'),
(653,	'Toffee',	NULL,	'Toffee is a confection made by caramelizing sugar or molasses along with butter, and occasionally flour. The mixture is heated until its temperature reaches the hard crack stage of 300 to 310 °F (149 to 154 °C). While being prepared, toffee is sometimes mixed with nuts or raisins. The process of making toffee requires the boiling of ingredients until the mix is stiff enough to be pulled into a shape which holds and has a glossy surface. The resulting mixture will typically be poured into a shallow tray and allowed to cool to form a sheet. Different mixes, processes, and most importantly, temperatures, will result in different textures and hardnesses, from soft and often sticky to a hard, brittle material. A popular variant in the US is English toffee, which is a very buttery toffee often made with almonds. It is available in both chewy and hard versions. Heath bars are a type of candy made with an English toffee core. Although named English toffee it bears little resemblance to the wide range of confectionery known as toffee currently available in the UK. Another variant is honeycomb toffee, which is an aerated version with bubbles introduced by adding baking soda and vinegar while mixing. These react to form carbon dioxide, which is trapped in the highly viscous mixture. In the UK and Canada, the most well known honeycomb candy is the Crunchie bar. The Australian equivalent is the Violet Crumble bar. In New Zealand, this is called hokey pokey. A particular application of toffee is in toffee apples, which are apples on sticks which are coated with toffee. Toffee apples are similar to taffy apples and caramel apples, which are both names for apples covered in caramel. In the UK, toffee apples, sometimes called candy apples, are coated with brittle candy similar to boiled sweets. Toffee used in confectionery can be mixed with many different ingredients to produce a variety of flavors: rum & butter, chocolate covered, vanilla & chocolate, rum & raisin, raspberry, and honeycomb.',	NULL,	'Toffee',	'653.jpg',	'image/jpeg',	132633,	'2012-04-20 09:43:50',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-02 22:50:59',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00635'),
(654,	'Cake',	NULL,	'Cake is a form of bread or bread-like food. In its modern forms, it is typically a sweet baked dessert. In its oldest forms, cakes were normally fried breads or cheesecakes, and normally had a disk shape. Determining whether a given food should be classified as bread, cake, or pastry can be difficult. Modern cake, especially layer cakes, normally contain a combination of flour, sugar, eggs, and butter or oil, with some varieties also requiring liquid and leavening agents. Flavorful ingredients like fruit purées, nuts, dried or candied fruit, or extracts are often added, and numerous substitutions for the primary ingredients are possible. Cakes are often filled with fruit preserves or dessert sauces, iced with buttercream or other icings, and decorated with marzipan, piped borders or candied fruit. Cake is often the dessert of choice for meals at ceremonial occasions, particularly weddings, anniversaries, and birthdays. There are countless cake recipes; some are bread-like, some rich and elaborate, and many are centuries old. Cake making is no longer a complicated procedure; while at one time considerable labor went into cake making (particularly the whisking of egg foams), baking equipment and directions have been simplified so that even the most amateur cook may bake a cake.',	NULL,	'Cake',	'654.jpg',	'image/jpeg',	2175071,	'2012-04-20 09:41:34',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-02 22:54:06',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00636'),
(655,	'Pizza',	NULL,	'Pizza is an oven-baked flat bread typically topped with a tomato sauce, cheese and various toppings. The modern pizza was invented in Naples, Italy, and the dish has since become popular in many parts of the world. An establishment that makes and sells pizzas is called a \"pizzeria\". Many varieties of pizza exist worldwide, along with several dish variants based upon pizza. Pizza is cooked in various types of ovens, and a diverse variety of ingredients and toppings are utilized. In 2009, upon Italy\'s request, Neapolitan pizza was safeguarded in the European Union as a Traditional Speciality Guaranteed dish.',	NULL,	'Pizza',	'655.jpg',	'image/jpeg',	131717,	'2012-04-20 09:42:00',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-02 22:58:04',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00637'),
(656,	'Ymer',	NULL,	'Ymer is a Danish soured milk product which has been known since 1930. It is made by fermenting whole milk with the bacterial culture Lactococcus lactis. When producing fermented milk products such as yogurt, ymer, filmjölk, skyr, qvark and A-38, and also when producing cheese, one can add lactic acid bacteria which convert milk sugar in the milk into lactic acid and other substances. Acidity makes the milk thicker, gives it a tart flavor, and increases the shelf life by several days.\nUnlike other fermented milk products, ymer is drained of its whey. That means that ymer has a higher content of solids, including protein, while the fat content stays at 3.5% as in whole milk.\nYmer is used in breakfasts, snacks, desserts, dressings and baking. The traditional breakfast topping is ymerdrys (\"ymer sprinkle\"), which is a mix of rugbrød breadcrumbs and brown sugar. 1 deciliter of ymer contains 146 kJ (35 kilocalories).',	NULL,	'Ymer_(dairy_product)',	'656.jpg',	'image/jpeg',	46256,	'2012-04-20 09:28:52',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2011-12-02 23:00:55',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00638'),
(657,	'Other snack food',	NULL,	'A snack is a portion of food often smaller than a regular meal, generally eaten between meals. Snacks come in a variety of forms including packaged and processed foods and items made from fresh ingredients at home.\nTraditionally, snacks were prepared from ingredients commonly available in the home. Often leftovers, cold cuts sandwiches, nuts, fruit, and the like were used as snacks. The Dagwood sandwich was originally the humorous result of a cartoon character\'s desire for large snacks. Beverages, such as coffee, are not generally considered snacks though they may be consumed along with snack foods. A beverage may be considered a snack if it possesses a substantive food item (e.g., strawberries, bananas, kiwis) that has been blended to create a smoothie.\nPlain snacks like plain cereals, pasta, and vegetables are also mildly popular, and the word snack has often been used to refer to a larger meal involving cooked or leftover items. Six-meal eating is a form of eating that incorporates healthy snacks in between small meals, to stave off hunger and promote weight loss.',	NULL,	'Snack_food',	'657.jpg',	'image/jpeg',	117195,	'2012-04-20 09:30:06',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-02 23:03:40',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00639'),
(659,	'Crisp bread',	NULL,	'Crisp bread or hard bread (Swedish: knäckebröd, hårt bröd, hårdbröd, spisbröd, Danish: knækbrød, Norwegian: knekkebrød, Finnish: näkkileipä, hapankorppu, Icelandic: hrökkbrauð, German: Knäckebrot or Knäcke) is a flat and dry type of bread or cracker, containing mostly rye flour. It is popular in armies and schools because of its light weight and simple, transport-friendly shape. Also, it is very cheap and if stored in dry conditions it will keep fresh and edible for a very long time. Crisp bread is a staple food and was for a long time considered a poor man\'s diet. However, in recent years there has been renewed interest in crisp bread in the Nordic countries. [Wikipedia]',	NULL,	'Crisp_bread',	'659.jpg',	'image/jpeg',	101558,	'2012-04-20 09:29:04',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-02 23:15:33',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00640'),
(660,	'Pastry',	NULL,	'Pastry is the name given to various kinds of baked products made from ingredients such as flour, sugar, milk, butter, shortening, baking powder, and eggs. Small tarts and other sweet baked products are called \"pastries.\"\nPastry may also refer to the dough from which such baked products are made. Pastry dough is rolled out thin and used as a base for baked products. Common pastry dishes include pies, tarts, quiches and pasties.\nPastry is differentiated from bread by having a higher fat content, which contributes to a flaky or crumbly texture. A good pastry is light and airy and fatty, but firm enough to support the weight of the filling. When making a shortcrust pastry, care must be taken to blend the fat and flour thoroughly before adding any liquid. This ensures that the flour granules are adequately coated with fat and less likely to develop gluten. On the other hand, overmixing results in long gluten strands that toughen the pastry. In other types of pastry such as Danish pastry and croissants, the characteristic flaky texture is achieved by repeatedly rolling out a dough similar to that for yeast bread, spreading it with butter, and folding it to produce many thin layers.',	NULL,	'Pastry',	'660.jpg',	'image/jpeg',	178225,	'2012-04-20 09:42:47',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-02 23:16:48',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00641'),
(661,	'Dragée',	NULL,	'A dragée is a bite-sized, colorful form of confectionery with a hard outer shell ? which is often used for another purpose (e.g. decorative, symbolic, medicinal, etc. ) in addition to consumption purely for enjoyment.',	NULL,	'Dragée',	'661.jpg',	'image/jpeg',	78504,	'2012-04-20 09:35:51',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-02 23:40:07',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00642'),
(662,	'Chewing gum',	NULL,	'Chewing gum is a soft, cohesive substance intended for chewing but not swallowing. Humans have used chewing gum for at least 3,000 years. Modern chewing gum was originally made of chicle, a natural latex. By the 1960s, chicle was replaced by butadiene-based synthetic rubber which is cheaper to manufacture. Most chewing gums are considered polymers.',	NULL,	'Chewing_gum',	'662.jpg',	'image/jpeg',	105643,	'2012-04-20 09:38:17',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-02 23:43:22',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00643'),
(663,	'Marzipan',	NULL,	'Marzipan is a confection consisting primarily of sugar or honey and almond meal, sometimes augmented with almond oil or extract. It is often made into sweets; common uses are marzipan-filled chocolate and small marzipan imitations of fruits and vegetables. It is also rolled into thin sheets and glazed for icing cakes, primarily birthday and wedding cakes and Christmas cakes. This use is particularly common in England, on large fruitcakes. Marzipan may also be used as a cake ingredient, as in stollen. In some countries, it is shaped into small figures of animals as a traditional treat for New Year\'s Day. Marzipan is also used in Tortell, and in some versions of king cake eaten during the Carnival season. Traditional Swedish Princess Cake is typically covered with a layer of marzipan that has been tinted pale green.',	NULL,	'Marzipan',	'663.jpg',	'image/jpeg',	43863,	'2012-04-20 09:41:43',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-02 23:44:14',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00644'),
(664,	'Salad dressing',	NULL,	'Sauces for salads are often called \"dressings\". The concept of salad dressing varies across cultures.\nIn Western culture, there are three basic types of salad dressing:\nVinaigrette;\nCreamy dressings, usually based on mayonnaise or fermented milk products, such as yogurt, sour cream (crème fraîche, smetana), buttermilk;\nCooked dressings, which resemble creamy dressings, but are usually thickened by adding egg yolks and gently heating.\nVinaigrette /v?n???r?t/ is a mixture (emulsion) of salad oil and vinegar, often flavored with herbs, spices, salt, pepper, sugar, and other ingredients. It is also used as a sauce or marinade.\nIn North America, mayonnaise-based Ranch dressing is most popular, with vinaigrettes and Caesar-style dressing following close behind. Traditional dressings in France are vinaigrettes, typically mustard-based, while sour cream (smetana) and mayonnaise are predominant in eastern European countries and Russia. In Denmark, dressings are often based on crème fraîche. In southern Europe, salad is generally dressed by the diner with oil and vinegar.\nIn Asia, it is common to add sesame oil, fish sauce, citrus juice, or soy sauce to salad dressings.',	NULL,	'Salad#Dressings',	'664.jpg',	'image/jpeg',	42317,	'2012-04-20 09:41:37',	NULL,	'Baking goods',	'Dressings',	'Type 2',	'2011-12-05 16:42:26',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00645'),
(665,	'Sauce',	NULL,	'In cooking, a sauce is liquid, creaming or semi-solid food served on or used in preparing other foods. Sauces are not normally consumed by themselves; they add flavor, moisture, and visual appeal to another dish. Sauce is a French word taken from the Latin salsa, meaning salted. Possibly the oldest sauce recorded is garum, the fish sauce used by the Ancient Romans. Sauces need a liquid component, but some sauces may contain more solid elements than liquid. Sauces are an essential element in cuisines all over the world. Sauces may be used for savory dishes or for desserts. They can be prepared and served cold, like mayonnaise, prepared cold but served lukewarm like pesto, or can be cooked like bechamel and served warm or again cooked and served cold like apple sauce. Some sauces are industrial inventions like Worcestershire sauce, HP sauce, or nowadays mostly bought ready-made like soy sauce or ketchup, others still are freshly prepared by the cook. Sauces for salads are called salad dressing. Sauces made by deglazing a pan are called pan sauces. A cook who specializes in making sauces is a saucier.',	NULL,	'Sauce',	'665.jpg',	'image/jpeg',	16500,	'2012-04-20 09:32:30',	NULL,	'Baking goods',	'Sauces',	'Type 2',	'2011-12-05 16:51:37',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00646'),
(666,	'Salt',	NULL,	'Salt, also known as table salt or rock salt, is a crystalline mineral that is composed primarily of sodium chloride, a chemical compound belonging to the larger class of ionic salts. It is absolutely essential for animal life, but can be harmful to animals and plants in excess. Salt is one of the oldest, most ubiquitous food seasonings and salting is an important method of food preservation. The taste of salt (saltiness) is one of the basic human tastes. Salt for human consumption is produced in different forms: unrefined salt, refined salt (table salt), and iodized salt. It is a crystalline solid, white, pale pink or light gray in color, normally obtained from sea water or rock deposits. Edible rock salts may be slightly grayish in color because of mineral content. Because of its importance to survival, salt has often been considered a valuable commodity during human history. However, as salt consumption has increased during modern times, scientists have become aware of the health risks associated with high salt intake, including high blood pressure in sensitive individuals. Therefore, some health authorities have recommended limitations of dietary sodium, although others state the risk is minimal for typical western diets.',	NULL,	'Salt',	'666.jpg',	'image/jpeg',	51925,	'2012-04-20 09:37:48',	NULL,	'Baking goods',	'Seasonings',	'Type 2',	'2011-12-05 16:53:52',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00647'),
(667,	'Butter',	NULL,	'Butter is a dairy product made by churning fresh or fermented cream or milk. It is generally used as a spread and a condiment, as well as in cooking applications, such as baking, sauce making, and pan frying. Butter consists of butterfat, water and milk proteins. Most frequently made from cows\' milk, butter can also be manufactured from the milk of other mammals, including sheep, goats, buffalo, and yaks. Salt, flavorings and preservatives are sometimes added to butter. Rendering butter produces clarified butter or ghee, which is almost entirely butterfat. [Wikipedia]',	NULL,	'Butter',	'667.jpg',	'image/jpeg',	499343,	'2012-04-20 09:41:10',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-05 16:56:38',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00648'),
(668,	'Butter substitute',	NULL,	NULL,	NULL,	NULL,	'668.jpg',	'image/jpeg',	6249,	'2012-04-20 09:28:53',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-05 17:00:11',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00649'),
(669,	'Cream',	NULL,	'Cream is a dairy product composed of the higher-butterfat layer skimmed from the top of milk before homogenization. Different grades of cream are distinguished by their fat content, whether they have been heat-treated, whipped, and so on. In many jurisdictions there are regulations for each type. [Wikipedia]',	NULL,	'Cream',	'669.jpg',	'image/jpeg',	890769,	'2012-04-20 09:37:12',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-05 17:02:39',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00650'),
(670,	'Sugar',	NULL,	'Sugar is the generalised name for a class of chemically-related sweet-flavored substances, most of which are used as food. They are carbohydrates, composed of carbon, hydrogen and oxygen. There are various types of sugar derived from different sources. Simple sugars are called monosaccharides and include glucose (also known as dextrose), fructose and galactose. The table or granulated sugar most customarily used as food is sucrose, a disaccharide (in the body, sucrose hydrolyses into fructose and glucose). Other disaccharides include maltose and lactose. Chemically-different substances may also have a sweet taste, but are not classified as sugars. Some are used as lower-calorie food substitutes for sugar described as artificial sweeteners. Sugars are found in the tissues of most plants but are only present in sufficient concentrations for efficient extraction in sugarcane and sugar beet. Sugarcane is a giant grass and has been cultivated in tropical climates in the Far East since ancient times. A great expansion in its production took place in the 18th century with the setting up of sugar plantations in the West Indies and Americas. This was the first time that sugar became available to the common people who had previously had to rely on honey to sweeten foods. Sugar beet is a root crop and is cultivated in cooler climates and became a major source of sugar in the 19th century when methods for extracting the sugar became available. Sugar production and trade has changed the course of human history in many ways. It influenced the formation of colonies, the perpetuation of slavery, the transition to indentured labour, the migration of peoples, wars between sugar trade-controlling nations in the 19th century, and the ethnic composition and political structure of the new world. The world produced about 168 million tonnes of sugar in 2011. The average person consumes about 24 kilograms of sugar each year (33.1 kg in industrialised countries), equivalent to over 260 food calories per person, per day. Sugar provides energy but no nutrients—empty calories. Since the latter part of the twentieth century, it has been questioned whether a diet high in sugars, especially refined sugars, is bad for health. Sugar has been linked to obesity and suspected of being implicated in diabetes, cardiovascular disease, dementia, macular degeneration and tooth decay. Numerous studies have been undertaken to try to clarify the position but the results remain largely unclear, mainly because of the difficulty of finding populations for use as controls that do not consume sugars.',	NULL,	'Sugar',	'670.jpg',	'image/jpeg',	106764,	'2012-04-20 09:42:30',	NULL,	'Baking goods',	'Sugars',	'Type 2',	'2011-12-05 17:07:39',	'2019-12-11 19:38:00',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00651'),
(671,	'Sausage',	NULL,	'Sausage is a food usually made from ground meat (normally pork or beef), mixed with salt, herbs, and other spices, although vegetarian sausages are available. Typically, a sausage is formed in a casing traditionally made from intestine, but sometimes synthetic. Some sausages are cooked during processing and the casing may be removed afterwards. Sausage making is a traditional food preservation technique. Sausages may be preserved by curing, drying, or smoking. [Wikipedia]',	NULL,	'Sausage',	'671.jpg',	'image/jpeg',	140430,	'2012-04-20 09:30:03',	NULL,	'Dishes',	'Ground meat',	'Type 2',	'2011-12-05 17:08:56',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00652'),
(672,	'Meatball',	NULL,	'Meatball is made from an amount of ground meat rolled into a small ball, sometimes along with other ingredients, such as breadcrumbs, minced onion, spices, and possibly eggs. Meatballs are usually prepared and rolled by hand, and are cooked by frying, baking, steaming, or braising in sauce. There are many kinds of meatball recipes using different types of meats and spices, including vegetarian and fish alternatives, and various methods of preparation. [Wikipedia]',	NULL,	'Meatball',	'672.jpg',	'image/jpeg',	5102677,	'2012-04-20 09:29:29',	NULL,	'Dishes',	'Ground meat',	'Type 2',	'2011-12-05 17:20:18',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00653'),
(673,	'Mustard',	NULL,	'Mustard is a condiment made from the seeds of a mustard plant (white or yellow mustard, Sinapis hirta; brown or Indian mustard, Brassica juncea; or black mustard, B. nigra). The whole, ground, cracked, or bruised mustard seeds are mixed with water, salt, lemon juice, or other liquids, and sometimes other flavorings and spices, to create a paste or sauce ranging in color from bright yellow to dark brown.\nCommonly paired with meats and cheeses, mustard is a popular addition to sandwiches, salads, hamburgers, and hot dogs. It is also used as an ingredient in many dressings, glazes, sauces, soups, and marinades; as a cream or a seed, mustard is used in the cuisine of India, the Mediterranean, northern and southeastern Europe, Asia, the Americas, and Africa, making it one of the most popular and widely used spices and condiments in the world.',	NULL,	'Mustard_(condiment)',	'673.jpg',	'image/jpeg',	71253,	'2012-04-20 09:32:39',	NULL,	'Baking goods',	'Condiments',	'Type 2',	'2011-12-05 17:24:41',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00654'),
(674,	'Pate',	NULL,	'Pâté is a mixture of ground meat and fat minced into a spreadable paste. Common additions include vegetables, herbs, spices, and either wine or cognac, armagnac or brandy. Pâté can be served either hot or cold, but it is considered to develop its fullest flavor after a few days of chilling. [Wikipedia]',	NULL,	'Pâté',	'674.jpg',	'image/jpeg',	80916,	'2012-04-20 09:40:15',	NULL,	'Dishes',	'Ground meat',	'Type 2',	'2011-12-05 17:26:00',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00655'),
(676,	'Sugar substitute',	NULL,	'A sugar substitute is a food additive that duplicates the effect of sugar in taste, usually with less food energy. Some sugar substitutes are natural and some are synthetic. Those that are not natural are, in general, called artificial sweeteners.\nAn important class of sugar substitutes is known as high-intensity sweeteners. These are compounds with many times the sweetness of sucrose, common table sugar. As a result, much less sweetener is required and energy contribution is often negligible. The sensation of sweetness caused by these compounds (the \"sweetness profile\") is sometimes notably different from sucrose, so they are often used in complex mixtures that achieve the most natural sweet sensation.',	NULL,	'Sugar_substitute',	'676.jpg',	'image/jpeg',	34140,	'2012-04-20 09:38:42',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-05 17:29:49',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00656'),
(677,	'Meat bouillon',	NULL,	NULL,	NULL,	NULL,	'677.jpg',	'image/jpeg',	61693,	'2012-04-20 09:43:50',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-05 17:46:06',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00657'),
(679,	'Whey',	NULL,	'Whey (or Milk Serum) is the liquid remaining after milk has been curdled and strained. It is a by-product of the manufacture of cheese or casein and has several commercial uses. Sweet whey is manufactured during the making of rennet types of hard cheese like cheddar or Swiss cheese. Acid whey (also known as \"sour whey\") is obtained during the making of acid types of cheese such as cottage cheese. [Wikipedia]',	NULL,	'Whey',	'679.jpg',	'image/jpeg',	30545,	'2012-04-20 09:40:35',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-05 17:50:54',	'2019-12-11 19:38:06',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00658'),
(680,	'Casein',	NULL,	'Casein is the name for a family of related phosphoprotein proteins (alphaS1, alphaS2, beta, kappa). These proteins are commonly found in mammalian milk, making up 80% of the proteins in cow milk and between 60% and 65% of the proteins in human milk. Casein has a wide variety of uses, from being a major component of cheese, to use as a food additive, to a binder for safety matches. As a food source, casein supplies amino acids; carbohydrates; and two inorganic elements, calcium and phosphorus. [Wikipedia]',	NULL,	'Casein',	'680.jpg',	'image/jpeg',	32868,	'2012-04-20 09:33:29',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-05 17:56:57',	'2019-12-11 19:38:11',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00659'),
(681,	'Fruit preserve',	NULL,	'Fruit preserves are preparations of fruits and sugar, often canned or sealed for long-term storage. The preparation of fruit preserves today often involves adding commercial or natural pectin as a gelling agent, although sugar or honey may be used, as well. Jams, jellies and marmalades are all examples of different styles of fruit preserves that vary based upon the ingredients used. Additionally, the name of the type of fruit preserves will also vary depending on the regional variant of English being used.\r\n[Wikipedia]',	NULL,	'Fruit_preserves',	'681.jpg',	'image/jpeg',	47659,	'2012-04-20 09:29:45',	NULL,	'Fruits',	'Fruit products',	'Type 2',	'2011-12-05 18:47:13',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00660'),
(682,	'Leavening agent',	NULL,	'A leavening agent is any one of a number of substances used in doughs and batters that causes a foaming action that lightens and softens the finished product. Formation of carbon dioxide is induced by chemical agents reacting with moisture, heat, acidity, or other triggers.\nThe leavening agent incorporates gas bubbles into the dough. The alternative or supplement to leavening agents is mechanical leavening by which air is incorporated by mechanical means. Most leavening agents are synthetic chemical compounds, but carbon dioxide can also be produced by biological agents. When a dough or batter is mixed, the starch in the flour mixes with the water in the dough to form a matrix (often supported further by proteins like gluten or other polysaccharides like pentosans or xanthan gum), then gelatinizes and \"sets\"; the holes left by the gas bubbles remain.',	NULL,	'Leavening_agent',	'682.jpg',	'image/jpeg',	267587,	'2012-04-20 09:36:46',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-06 16:47:07',	'2020-03-12 20:59:59',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00661'),
(683,	'Marshmallow',	NULL,	'Marshmallow is a confection that, in its modern form, typically consists of sugar and/or corn syrup, water, and gelatin, whipped to a spongy consistency and coated with corn starch. Some marshmallow recipes call for eggs. This confection is the modern version of a medicinal confection made from Althaea officinalis, the marshmallow plant.',	NULL,	'Marshmallow',	'683.jpg',	'image/jpeg',	60074,	'2012-04-20 09:36:48',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-06 16:47:38',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00662'),
(684,	'Gelatin',	NULL,	'Gelatin is a translucent, colorless, brittle (when dry), flavorless solid substance, derived from the collagen inside animals\' skin and bones. It is commonly used as a gelling agent in food. It is found in some gummy candies as well as other products such as marshmallows, gelatin dessert, and some low-fat yogurt. Household gelatin comes in the form of sheets, granules, or powder. Instant types can be added to the food as they are; others need to be soaked in water beforehand. [Wikipedia]',	NULL,	'Gelatin',	'684.jpg',	'image/jpeg',	64556,	'2012-04-20 09:37:04',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-06 16:48:12',	'2019-12-11 19:38:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00663'),
(685,	'Water',	NULL,	'Water is a chemical compound with the chemical formula H2O. A water molecule contains one oxygen and two hydrogen atoms connected by covalent bonds. Water is a liquid at standard ambient temperature and pressure, but it often co-exists on Earth with its solid state, ice, and gaseous state. Water also exists in a liquid crystal state near hydrophilic surfaces. Water covers 71% of the Earth\'s surface, and is vital for all known forms of life. On Earth, 96.5% of the planet\'s water is found in oceans, 1.7% in groundwater, 1.7% in glaciers and the ice caps of Antarctica and Greenland, a small fraction in other large water bodies, and 0.001% in the air as vapor, clouds (formed of solid and liquid water particles suspended in air), and precipitation. Only 2.5% of the Earth\'s water is freshwater, and 98.8% of that water is in ice and groundwater. Less than 0.3% of all freshwater is in rivers, lakes, and the atmosphere, and an even smaller amount of the Earth\'s freshwater (0.003%) is contained within biological bodies and manufactured products. Water on Earth moves continually through the hydrological cycle of evaporation and transpiration, condensation, precipitation, and runoff, usually reaching the sea. Evaporation and transpiration contribute to the precipitation over land. Safe drinking water is essential to humans and other lifeforms even though it provides no calories or organic nutrients. Access to safe drinking water has improved over the last decades in almost every part of the world, but approximately one billion people still lack access to safe water and over 2.5 billion lack access to adequate sanitation. There is a clear correlation between access to safe water and GDP per capita. However, some observers have estimated that by 2025 more than half of the world population will be facing water-based vulnerability. A recent report (November 2009) suggests that by 2030, in some developing regions of the world, water demand will exceed supply by 50%. Water plays an important role in the world economy, as it functions as a solvent for a wide variety of chemical substances and facilitates industrial cooling and transportation. Approximately 70% of the fresh water used by humans goes to agriculture.',	NULL,	'Water',	'685.jpg',	'image/jpeg',	33633,	'2012-04-20 09:30:04',	NULL,	'Beverages',	'Waters',	'Type 2',	'2011-12-06 16:48:34',	'2019-12-11 19:38:18',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00664'),
(686,	'Other fish product',	NULL,	'Fish and fish products are consumed as food all over the world. With other seafoods, it provides the world\'s prime source of high-quality protein: 14?16 percent of the animal protein consumed worldwide. Over one billion people rely on fish as their primary source of animal protein.\nFish and other aquatic organisms are also processed into various food and non-food products.',	NULL,	'Fish_products',	'686.jpg',	'image/jpeg',	61953,	'2012-04-20 09:39:02',	NULL,	'Aquatic foods',	'Fish products',	'Type 2',	'2011-12-06 16:48:46',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00665'),
(687,	'Milk (Human)',	NULL,	'Milk is a white liquid produced by the mammary glands of mammals. It is the primary source of nutrition for young mammals before they are able to digest other types of food. Early-lactation milk contains colostrum, which carries the mother\'s antibodies to the baby and can reduce the risk of many diseases in the baby. It also contains many other nutrients.',	NULL,	'Milk',	'687.jpg',	'image/jpeg',	402137,	'2012-04-20 09:34:01',	NULL,	'Milk and milk products',	'Unfermented milks',	'Type 2',	'2011-12-06 16:49:02',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00666'),
(689,	'Other beverage',	NULL,	NULL,	NULL,	NULL,	'689.jpg',	'image/jpeg',	53294,	'2012-04-20 09:39:15',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-06 16:49:26',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00667'),
(690,	'Baby food',	NULL,	'Baby food is any soft, easily consumed food, other than breastmilk or infant formula, that is made specifically for infants, roughly between the ages of four to six months to 2 years. The food comes in multiple varieties and tastes may be table food that the rest of the family is eating that has been mashed or otherwise broken down or can be purchased prepared from manufacturers.',	NULL,	'Baby food',	'690.jpg',	'image/jpeg',	19607,	'2012-04-20 09:30:40',	NULL,	'Baby foods',	'Baby foods',	'Type 2',	'2011-12-06 16:49:38',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00668'),
(691,	'Dumpling',	NULL,	'Dumplings are cooked balls of dough. They are based on flour, potatoes or bread, and may include meat, fish, vegetables, or sweets. They may be cooked by boiling, steaming, simmering, frying, or baking. They may have a filling, or there may be other ingredients mixed into the dough. Dumplings may be sweet or spicy. They can be eaten by themselves, in soups or stews, with gravy, or in any other way. [Wikipedia]',	NULL,	'Dumpling',	'691.jpg',	'image/jpeg',	60065,	'2012-04-20 09:43:42',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-06 16:49:50',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00669'),
(692,	'Soup',	NULL,	'Soup is a generally warm food that is made by combining ingredients such as meat and vegetables with stock, juice, water, or another liquid. Hot soups are additionally characterized by boiling solid ingredients in liquids in a pot until the flavors are extracted, forming a broth. Soups are similar to stews, and in some cases there may not be a clear distinction between the two; however, soups generally have more liquid than stews. Here is a \"list of soups\":http://en.wikipedia.org/wiki/List_of_soups. [Wikipedia]',	NULL,	'Soup',	'692.jpg',	'image/jpeg',	1693658,	'2012-04-20 09:29:21',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-06 16:50:21',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00670'),
(693,	'Other vegetable product',	NULL,	NULL,	NULL,	NULL,	'693.jpg',	'image/jpeg',	3855,	'2012-04-20 09:32:35',	NULL,	'Vegetables',	'Vegetable products',	'Type 2',	'2011-12-06 16:50:36',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00671'),
(694,	'Unclassified food or beverage',	NULL,	NULL,	NULL,	NULL,	'694.jpg',	'image/jpeg',	110231,	'2012-04-20 09:38:20',	NULL,	'Unclassified',	'Unclassified',	'Type 2',	'2011-12-06 16:50:49',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00672'),
(695,	'Syrup',	NULL,	'In cooking, a syrup or sirup is a thick, viscous liquid consisting primarily of a solution of sugar in water, containing a large amount of dissolved sugars but showing little tendency to deposit crystals. The viscosity arises from the multiple hydrogen bonds between the dissolved sugar, which has many hydroxyl (OH) groups, and the water. Syrups can be made by dissolving sugar in water or by reducing naturally sweet juices such as cane juice, sorghum juice, or maple sap. Corn syrup is made from corn starch using an enzymatic process that converts it to sugars. Technically and scientifically, the term syrup is also employed to denote viscous, generally residual, liquids, containing substances other than sugars in solution.',	NULL,	'Syrup',	'695.jpg',	'image/jpeg',	49413,	'2012-04-20 09:39:40',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-06 16:51:28',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00673'),
(696,	'Tallow',	NULL,	'Tallow is a rendered form of beef or mutton fat, processed from suet. It is solid at room temperature. Unlike suet, tallow can be stored for extended periods without the need for refrigeration to prevent decomposition, provided it is kept in an airtight container to prevent oxidation. In industry, tallow is not strictly defined as beef or mutton fat. In this context, tallow is animal fat that conforms to certain technical criteria, including its melting point. It is common for commercial tallow to contain fat derived from other animals, such as lard from pigs, or even from plant sources.',	NULL,	'Tallow',	'696.jpg',	'image/jpeg',	70468,	'2012-04-20 09:34:00',	NULL,	'Fats and oils',	'Animal fats',	'Type 2',	'2011-12-06 16:52:17',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00674'),
(697,	'Remoulade',	NULL,	'Remoulade or rémoulade, invented in France, is a popular condiment in many countries. Very much like the tartar sauce of some English-speaking cultures, remoulade is often aioli- or mayonnaise-based. Although similar to tartar sauce, it is often more yellowish (or reddish in Louisiana), often flavored with curry, and sometimes contains chopped pickles or piccalilli. It can also contain horseradish, paprika, anchovies, capers and a host of other items. While its original purpose was possibly for serving with meats, it is now more often used as an accompaniment to seafood dishes, especially pan-fried breaded fish fillets and seafood cakes.',	NULL,	'Remoulade',	'697.jpg',	'image/jpeg',	21165,	'2012-04-20 09:33:22',	NULL,	'Baking goods',	'Condiments',	'Type 2',	'2011-12-06 23:59:03',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00675'),
(698,	'Chocolate spread',	NULL,	'Chocolate spread is a chocolate-flavoured paste which is eaten mostly spread on breads and toasts or similar pastries such as muffins and pitas. Chocolate spread is a product often favored by children and serves as a prevalent spread on their sandwiches. Some adults enjoy chocolate spread sandwiches as a comfort food. Although it tastes, smells, and looks like chocolate it does not solidify. The paste usually contains cocoa and oil, and is also likely to contain milk and additional taste and smell components. At times it also includes nuts or honey. Chocolate spread is normally sold in glass jars or plastic tubs.',	NULL,	'Chocolate spread',	'698.jpg',	'image/jpeg',	123545,	'2012-04-20 09:44:04',	NULL,	'Confectioneries',	'Spreads',	'Type 2',	'2011-12-07 00:09:30',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00676'),
(699,	'Fruit gum',	NULL,	'Rowntree\'s Fruit Gums are circular sweets formerly made by Rowntree\'s, who were later acquired by Nestlé. They appear in different colours, each with a different flavour: strawberry, orange, lemon, blackcurrant and lime. The sweets were first introduced in 1893, and originally marketed as Rowntree\'s Clear Gums - \"The nation\'s favourite sweet\" - and were available in twopenny tubes and sixpenny packets. They are primarily composed of glucose syrup and fruit juices and are as a result similar to wine gums. In addition to the traditional roll packaging, they come in a larger volume box, that contains the sweets in the shape of the fruit or part of the fruit that the flavour represents. Originally the purple fruit gums were blueberry, but this changed to blackcurrant in the 1990s.',	NULL,	'Fruit_Gums',	'699.jpg',	'image/jpeg',	53944,	'2012-04-20 09:38:43',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-07 00:12:29',	'2019-05-14 18:05:29',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00677'),
(700,	'Curry powder',	NULL,	'Curry powder is a spice mix of widely varying composition based on South Asian cuisine. Curry powder and the contemporary English use of the word curry are Western inventions and do not reflect any specific Indian food, though a similar mixture of spices used in north India is called garam masala. Curry powder is actually closer to the Tamil sambar powder, and the word curry is widely believed to be a corruption of the Tamil word kari, variously meaning something like sauce, cooked vegetables or meat. In the western world, curry powder mixtures tend to have a fairly standardized taste, though a great variety of spice mixtures are used in Indian cuisine. Curry powder was largely popularized during the nineteenth and twentieth centuries through the mass export of the condiment to the western table, throughout Europe and North and South America and through its use in British Army nations. Curry powder did not become standardized, as many of the original blends of curry powder were still available throughout the world. The late 1960s and early 1970s saw a growth of Indian-based food consumption in the west and internationally. This led to an increase of Indian restaurants throughout the world. The tradition of keeping special blends of curry powder simply became uneconomical, and curry powder became increasingly standardized outside India. Indian cooks often have readier access to a variety of fresh spices than their foreign counterparts. Some curry cooks will have their own specific mixtures for different recipes. These are often passed down from parent to child.',	NULL,	'Curry powder',	'700.jpg',	'image/jpeg',	51762,	'2012-04-20 09:33:58',	NULL,	'Herbs and Spices',	'Herb and spice mixtures',	'Type 2',	'2011-12-07 00:17:26',	'2020-03-12 21:00:06',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00678'),
(701,	'Other candy',	NULL,	'Candy, also called sweets or lollies, is a confection that features sugar as a principal ingredient. The category, called sugar confectionery, encompasses any sweet confection, including chocolate, chewing gum, and sugar candy. Vegetables, fruit, or nuts which have been glazed and coated with sugar are said to be candied.\nPhysically, candy is characterized by the use of a significant amount of sugar, or, in the case of sugar-free candies, by the presence of sugar substitutes. Unlike a cake or loaf of bread that would be shared among many people, candies are usually made in smaller pieces. However, the definition of candy also depends upon how people treat the food. Unlike sweet pastries served for a dessert course at the end of a meal, candies are normally eaten casually, often with the fingers, as a snack between meals. Each culture has its own ideas of what constitutes candy rather than dessert. The same food may be a candy in one culture and a dessert in another.',	NULL,	'Candy',	'701.jpg',	'image/jpeg',	103989,	'2012-04-20 09:41:40',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-07 00:19:12',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00679'),
(702,	'Meringue',	NULL,	'Meringue, is a type of dessert, often associated with Swiss and French cuisine, made from whipped egg whites and sugar, and occasionally an acid such as cream of tartar or a small amount of vinegar. A binding agent such as cornstarch or gelatin may also be added. The addition of powdered sugar, which usually contains corn starch, to the uncooked meringue produces a pavlova, a national dish of Australia and New Zealand. The key to the formation of a good meringue is the formation of stiff peaks formed by denaturing the protein ovalbumin (a protein in the egg whites) via mechanical shear. Meringues are often flavoured with vanilla and a small amount of almond or coconut extract although if these extracts are based on an oil infusion then this, if used in excess, may inhibit the egg whites into forming a foam due to the fat from the oil. They are light, airy and sweet confections. Homemade meringues are often chewy and soft with a crisp exterior, although a uniform crisp texture may be achieved at home, whilst commercial meringues are crisp throughout.',	NULL,	'Meringue',	'702.jpg',	'image/jpeg',	63916,	'2012-04-20 09:38:34',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-07 00:22:41',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00680'),
(703,	'Lard',	NULL,	'Lard is pig fat in both its rendered and unrendered forms. Lard was commonly used in many cuisines as a cooking fat or shortening, or as a spread similar to butter. Its use in contemporary cuisine has diminished; however, many contemporary cooks and bakers favor it over other fats for select uses. The culinary qualities of lard vary somewhat depending on the part of the pig from which the fat was taken and how the lard was processed.',	NULL,	'Lard',	'703.jpg',	'image/jpeg',	69349,	'2012-04-20 09:28:57',	NULL,	'Fats and oils',	'Animal fats',	'Type 2',	'2011-12-12 18:17:07',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00681'),
(704,	'Other animal fat',	NULL,	'Animal fats and oils are lipid materials derived from animals. Physically, oils are liquid at room temperature, and fats are solid. Chemically, both fats and oils are composed of triglycerides. Although many animal parts and secretions may yield oil, in commercial practice, oil is extracted primarily from rendered tissue fats obtained from livestock animals like pigs, chickens and cows. Dairy products also yield popular animal fat and oil products such as cheese, butter, and milk.\nFlesh and animal fat have a melting temperature of 184 °C, a boiling point of around 200 °C and an ignition point of 280 °C where it will burst into flames without spark. Certain substances such as goose fat produce a higher smoke point than other animal fats, but are still lower than many vegetable oils such as olive or avocado. ',	NULL,	'Animal_fat',	'704.jpg',	'image/jpeg',	64863,	'2012-04-20 09:36:25',	NULL,	'Fats and oils',	'Animal fats',	'Type 2',	'2011-12-12 18:20:47',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00682'),
(705,	'Other cocoa product',	NULL,	NULL,	NULL,	NULL,	'705.jpg',	'image/jpeg',	142916,	'2012-04-20 09:32:01',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 18:39:03',	'2020-03-12 21:02:24',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00683'),
(706,	'Cocoa butter',	NULL,	'Cocoa butter, also called theobroma oil, is a pale-yellow, pure edible vegetable fat extracted from the cocoa bean. It is used to make chocolate, biscuits, and baked goods, as well as some pharmaceuticals, ointments, and toiletries. Cocoa butter has a mild chocolate flavor and aroma. [Wikipedia]',	NULL,	'Cocoa_butter',	'706.jpg',	'image/jpeg',	65352,	'2012-04-20 09:29:59',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 18:49:30',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00684'),
(707,	'Cocoa powder',	NULL,	'Cocoa solids are the low-fat component of chocolate. When sold as an end product, it may also be called cocoa powder, cocoa, and cacao. In contrast, the fatty component of chocolate is cocoa butter. Cocoa butter makes up for 50% to 57% of the weight of cocoa beans and gives chocolate its characteristic melting properties. Cocoa liquor is the melted combination of cocoa butter and cocoa solids. Cocoa solids are obtained by extraction from the cocoa bean. [Wikipedia]',	NULL,	'Cocoa_solids',	'707.jpg',	'image/jpeg',	41587,	'2012-04-20 09:37:45',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 21:30:35',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00685'),
(708,	'Cocoa liquor',	NULL,	'Chocolate liquor (cocoa liquor) is pure chocolate in its liquid form. Like the cocoa beans (nibs) from which it is produced, it contains both cocoa solids and cocoa butter in roughly equal proportion.[Wikipedia]',	NULL,	'Chocolate_liquor',	'708.jpg',	'image/jpeg',	110789,	'2012-04-20 09:38:09',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 21:33:09',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00686'),
(709,	'Chocolate',	NULL,	'Chocolate is a range of products derived from cocoa, mixed with fat (i.e. cocoa butter and/or plant oils) and finely powdered sugar to produce a solid confection. There are several types of chocolate according to the proportion of cocoa used in a particular formulation. The use of particular name designations is sometimes subject to governmental regulation. [Wikipedia]',	NULL,	'Types_of_chocolate',	'709.jpg',	'image/jpeg',	61307,	'2012-04-20 09:38:37',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 21:38:12',	'2020-03-12 21:00:08',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00687'),
(710,	'Hot chocolate',	NULL,	'Hot chocolate (also known as hot cocoa or just cocoa or chocolate milk) is a heated beverage typically consisting of shaved chocolate, melted chocolate or cocoa powder, heated milk or water, and sugar. Drinking chocolate is similar to hot chocolate, but is made from melted chocolate shavings or paste, rather than a powdered mix that is soluble in water, and is usually not as sweet. [Wikipedia]',	NULL,	'Hot_chocolate',	'710.jpg',	'image/jpeg',	81938,	'2012-04-20 09:43:09',	NULL,	'Cocoa and cocoa products',	'Cocoa products',	'Type 2',	'2011-12-12 21:43:28',	'2020-03-12 21:00:11',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00688'),
(711,	'Dried milk',	NULL,	'Powdered milk is a manufactured dairy product made by evaporating milk to dryness. One purpose of drying milk is to preserve it; milk powder has a far longer shelf life than liquid milk and does not need to be refrigerated, due to its low moisture content. Another purpose is to reduce its bulk for economy of transportation. Powdered milk and dairy products include such items as dry whole milk, nonfat dry milk, dry buttermilk, dry whey products and dry dairy blends. [Wikipedia]',	NULL,	'Powdered_milk',	'711.jpg',	'image/jpeg',	30532,	'2012-04-20 09:44:03',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-12 22:14:05',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00689'),
(712,	'Milk (Other mammals)',	NULL,	'As an agricultural product, milk is extracted from mammals during or soon after pregnancy and used as food for humans. Worldwide, dairy farms produced about 730 million tonnes of milk in 2011, from 260 million dairy cows. India is the world\'s largest producer and consumer of milk, yet neither exports nor imports milk. New Zealand, the European Union\'s 28 member states, Australia, and the United States are the world\'s largest exporters of milk and milk products. China and Russia are the world\'s largest importers of milk and milk products.\nThroughout the world, there are more than 6 billion consumers of milk and milk products. Over 750 million people live within dairy farming households. Milk is a key contributor to improving nutrition and food security particularly in developing countries. Improvements in livestock and dairy technology offer significant promise in reducing poverty and malnutrition in the world.',	NULL,	'Milk',	'712.jpg',	'image/jpeg',	145780,	'2012-04-20 09:30:59',	NULL,	'Milk and milk products',	'Unfermented milks',	'Type 2',	'2011-12-12 22:26:15',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00690'),
(713,	'Kefir',	NULL,	'Kefir (alternately kef?rs, keefir, kephir, kewra, talai, mudu kekiya, milkkefir, búlgaros) is a fermented milk drink that originated with shepherds of the North Caucasus region, who discovered that fresh milk carried in leather pouches would occasionally ferment into an effervescent beverage. It is prepared by inoculating cow, goat, or sheep\'s milk with kefir grains. Traditional kefir was made in skin bags that were hung near a doorway; the bag would be knocked by anyone passing through the doorway to help keep the milk and kefir grains well mixed. [Wikipedia]',	NULL,	'Kefir',	'713.jpg',	'image/jpeg',	30328,	'2012-04-20 09:34:30',	NULL,	'Milk and milk products',	'Fermented milks',	'Type 2',	'2011-12-12 22:29:57',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00691'),
(714,	'Buttermilk',	NULL,	'Buttermilk refers to a number of dairy drinks. Originally, buttermilk was the liquid left behind after churning butter out of cream. This type of buttermilk is known as traditional buttermilk. The term buttermilk also refers to a range of fermented milk drinks, common in warm climates (e.g. , the Middle East, Pakistan, India, and the Southern United States) where unrefrigerated fresh milk sours quickly, as well as in colder climates, such as Germany, Poland, Scandinavia and the Netherlands. This fermented dairy product known as cultured buttermilk is produced from cow\'s milk and has a characteristically sour taste caused by lactic acid bacteria. This variant is made using one of two species of bacteria—either Streptococcus lactis or Lactobacillus bulgaricus, which creates more tartness. The tartness of buttermilk is due to acid in the milk. The increased acidity is primarily due to lactic acid produced by lactic acid bacteria while fermenting lactose, the primary sugar in milk. As the bacteria produce lactic acid, the pH of the milk decreases and casein, the primary milk protein, precipitates, causing the curdling or clabbering of milk. This process makes buttermilk thicker than plain milk. While both traditional and cultured buttermilk contain lactic acid, traditional buttermilk tends to be less viscous, whereas cultured buttermilk is more viscous. Buttermilk can be drunk straight, and it can also be used in cooking. Soda bread is a bread in which buttermilk reacts with the rising agent, sodium bicarbonate, to produce carbon dioxide.',	NULL,	'Buttermilk',	'714.jpg',	'image/jpeg',	86704,	'2012-04-20 09:36:29',	NULL,	'Milk and milk products',	'Fermented milks',	'Type 2',	'2011-12-12 23:35:29',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00692'),
(715,	'Other fermented milk',	NULL,	'Fermented milk products, also known as cultured dairy foods, cultured dairy products, or cultured milk products, are dairy foods that have been fermented with lactic acid bacteria such as Lactobacillus, Lactococcus, and Leuconostoc. The fermentation process increases the shelf-life of the product, while enhancing the taste and improving the digestibility of milk. There is evidence that fermented milk products have been produced since around 10,000 BC. A range of different Lactobacilli strains has been grown in laboratories allowing for a wide range of cultured milk products with different tastes.',	NULL,	'Fermented_milk_products',	'715.jpg',	'image/jpeg',	13155,	'2012-04-20 09:34:10',	NULL,	'Milk and milk products',	'Fermented milks',	'Type 2',	'2011-12-12 23:44:50',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00693'),
(716,	'Soy sauce',	NULL,	'Soy sauce (also called soya sauce) is a condiment produced by fermenting soybeans with Aspergillus oryzae or Aspergillus sojae molds, along with water and salt. After the fermentation, which yields fermented soybean paste, the paste is pressed, and two substances are obtained: a liquid, which is the soy sauce, and a cake of (wheat and) soy residue, the latter being usually reused as animal feed. Soy sauce is a traditional ingredient in East and Southeast Asian cuisines, where it is used in cooking and as a condiment. All varieties of soy sauce are salty, earthy, brownish liquids intended to season food while cooking or at the table. [Wikipedia]',	NULL,	'Soy_sauce',	'716.jpg',	'image/jpeg',	8472,	'2012-04-20 09:44:17',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-12 23:57:21',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00694'),
(717,	'Miso',	NULL,	'Miso is a traditional Japanese seasoning produced by fermenting rice, barley and/or soybeans, with salt and the fungus k?jikin, the most typical miso being made with soy. The result is a thick paste used for sauces and spreads, pickling vegetables or meats, and mixing with dashi soup stock to serve as miso soup called misoshiru, a Japanese culinary staple. High in protein and rich in vitamins and minerals, miso played an important nutritional role in feudal Japan. Miso is still very widely used in Japan, both in traditional and modern cooking, and has been gaining world-wide interest. Miso is typically salty, but its flavor and aroma depend on various factors in the ingredients and fermentation process. There is a very wide variety of miso available. Different varieties of miso have been described as salty, sweet, earthy, fruity, and savory. [Wikipedia]',	NULL,	'Miso',	'717.jpg',	'image/jpeg',	66987,	'2012-04-20 09:31:18',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-13 00:03:37',	'2020-03-12 21:00:16',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00695'),
(718,	'Tofu',	NULL,	'Tofu is a food made by coagulating soy milk and then pressing the resulting curds into soft white blocks. It is part of East Asian and Southeast Asian cuisine such as Chinese, Japanese, Korean, Indonesian, Vietnamese, and others. There are many different varieties of tofu, including fresh tofu and tofu that has been processed in some way. Tofu has a subtle flavor and can be used in savory and sweet dishes. It is often seasoned or marinated to suit the dish. Tofu has a low calorie count, relatively large amounts of protein, and little fat. It is high in iron and, depending on the coagulant used in manufacturing, may also be high in calcium and/or magnesium. [Wikipedia]',	NULL,	'Tofu',	'718.jpg',	'image/jpeg',	35262,	'2012-04-20 09:30:22',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-13 00:08:03',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00696'),
(721,	'Zwieback',	NULL,	'Zwieback is a type of crisp, sweetened bread, made with eggs and baked twice. [Wikipedia]',	NULL,	'Zwieback',	'721.jpg',	'image/jpeg',	104822,	'2012-04-20 09:33:55',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-13 23:24:52',	'2020-03-12 21:02:00',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00697'),
(722,	'Roe',	NULL,	'Roe or hard roe is the fully ripe internal egg masses in the ovaries, or the released external egg masses of fish and certain marine animals, such as shrimp, scallop and sea urchins. As a seafood, roe is used both as a cooked ingredient in many dishes and as a raw ingredient. The term soft roe or white roe denotes fish milt. [Wikipedia]',	NULL,	'Roe',	'722.jpg',	'image/jpeg',	99012,	'2012-04-20 09:35:47',	NULL,	'Aquatic foods',	'Roe',	'Type 2',	'2011-12-13 23:46:21',	'2019-05-14 18:05:30',	2,	2,	0,	'generic',	NULL,	1,	'FOOD00698'),
(723,	'Cichlidae (Tilapia)',	'Cichlidae',	'Tilapia is the common name for nearly a hundred species of cichlid fish from the tilapiine cichlid tribe. Tilapia inhabit a variety of fresh water habitats, including shallow streams, ponds, rivers and lakes. Because of their large size, rapid growth, and palatability, tilapiine cichlids are the focus of major farming efforts, specifically various species of Oreochromis, Sarotherodon, and Tilapia, collectively known colloquially as tilapia. Like other large fish, they are a good source of protein and popular among artisanal and commercial fisheries. [Wikipedia]',	'169770',	'Tilapia',	'723.jpg',	'image/jpeg',	92804,	'2012-04-20 09:39:00',	NULL,	'Aquatic foods',	'Fishes',	'Type 1',	'2011-12-13 23:54:09',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	8113,	1,	'FOOD00699'),
(724,	'Icing',	NULL,	'Icing, also called frosting in the United States, is a sweet often creamy glaze made of sugar with a liquid such as water or milk, that is often enriched with ingredients such as butter, egg whites, cream cheese, or flavorings and is used to cover or decorate baked goods, such as cakes or cookies. [Wikipedia]',	NULL,	'Icing_(food)',	'724.jpg',	'image/jpeg',	88245,	'2012-04-20 09:42:49',	NULL,	'Confectioneries',	'Other confectioneries',	'Type 2',	'2011-12-14 00:04:07',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00700'),
(725,	'Snack bar',	NULL,	NULL,	NULL,	NULL,	'725.jpg',	'image/jpeg',	61349,	'2012-04-20 09:41:33',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-14 00:21:10',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00701'),
(726,	'Green turtle',	'Chelonia mydas',	'The green sea turtle (Chelonia mydas), also known as the green turtle, black (sea) turtle, or Pacific green turtle, is a large sea turtle of the family Cheloniidae. It is the only species in the genus Chelonia. Its range extends throughout tropical and subtropical seas around the world, with two distinct populations in the Atlantic and Pacific Oceans. The common name comes from the usually green fat found beneath its carapace. This sea turtle\'s dorsoventrally flattened body is covered by a large, teardrop-shaped carapace; it has a pair of large, paddle-like flippers. It is usually lightly colored, although in the eastern Pacific populations parts of the carapace can be almost black. Unlike other members of its family, such as the hawksbill sea turtle, C. mydas is mostly a herbivorous. The adults usually inhabit shallow lagoons, feeding mostly on various species of seagrasses. Like other sea turtles, green sea turtles migrate long distances between feeding grounds and hatching beaches. Many islands worldwide are known as Turtle Island due to green sea turtles nesting on their beaches. Females crawl out on beaches, dig nests and lay eggs during the night. Later, hatchlings emerge and scramble into the water. Those that reach maturity may live to eighty years in the wild. C. mydas is listed as endangered by the IUCN and CITES and is protected from exploitation in most countries. It is illegal to collect, harm or kill them. In addition, many countries have laws and ordinances to protect nesting areas. However, turtles are still in danger because of several human practices. In some countries, turtles and their eggs are hunted for food. Pollution indirectly harms turtles at both population and individual scales. Many turtles die caught in fishing nets. Also, real estate development often causes habitat loss by eliminating nesting beaches.',	'173833',	'Green sea turtle',	'726.jpg',	'image/jpeg',	71044,	'2012-04-20 09:39:47',	NULL,	'Aquatic foods',	'Other aquatic foods',	'Type 1',	'2011-12-14 16:47:40',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	8469,	0,	'FOOD00702'),
(727,	'Energy drink',	NULL,	'Energy drinks are beverages whose producers advertise that they \"boost energy.\" Energy drinks generally contain methylxanthines (including caffeine), B vitamins, and herbs. Other commonly used ingredients are carbonated water, guarana, yerba mate, açaí, and taurine, plus various forms of ginseng, maltodextrin, inositol, carnitine, creatine, glucuronolactone, and ginkgo biloba. Some contain high levels of sugar, and many brands offer artificially sweetened \'diet\' versions. A common ingredient in most energy drinks is caffeine (often in the form of guarana or yerba mate). Energy drinks contain about three times the amount of caffeine as cola. [Wikipedia]',	NULL,	'Energy_drink',	'727.jpg',	'image/jpeg',	87630,	'2012-04-20 09:29:42',	NULL,	'Beverages',	'Nutritional beverages',	'Type 2',	'2011-12-14 17:08:40',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00703'),
(728,	'Burrito',	NULL,	'A burrito, or taco de harina, is a type of Mexican food. It consists of a wheat flour tortilla wrapped or folded around a filling. The flour tortilla is usually lightly grilled or steamed, to soften it and make it more pliable. In Mexico, refried beans or meat are sometimes the only fillings. In the United States, however, fillings generally include a combination of ingredients such as Mexican-style rice or plain rice, refried beans or beans, lettuce, salsa, meat, avocado, cheese, and sour cream, and the size varies, with some burritos considerably larger than their Mexican counterparts. [Wikipedia]',	NULL,	'Burrito',	'728.jpg',	'image/jpeg',	101182,	'2012-04-20 09:30:33',	NULL,	'Dishes',	'Tex-Mex cuisine',	'Type 2',	'2011-12-14 17:13:45',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00704'),
(729,	'Hamburger',	NULL,	'A hamburger (also called a hamburger sandwich or burger) is a sandwich consisting of a cooked patty of ground meat (usually beef, but occasionally pork or a combination of meats) usually placed inside a sliced bread roll. Hamburgers are often served with lettuce, bacon, tomato, onion, pickles, cheese and condiments such as mustard, mayonnaise, ketchup and relish. The term hamburger or burger can also be applied to the meat patty on its own, especially in the UK where the term \"patty\" is rarely used, although the term \"hamburger\" is rarely used in Commonwealth nations (other than Canada and Australia). [Wikipedia]',	NULL,	'Hamburger',	'729.jpg',	'image/jpeg',	208642,	'2012-04-20 09:40:25',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-14 17:34:31',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00705'),
(730,	'Baked beans',	NULL,	'Baked beans is a dish containing beans, sometimes baked but, despite the name, usually stewed, in a sauce. Most commercial canned baked beans are made from haricot beans, also known as navy beans – a variety of Phaseolus vulgaris – in a sauce. In Ireland and the United Kingdom, a tomato and sugar sauce is most commonly used. In the United States there are multiple styles, Boston baked beans use a sauce prepared with molasses and salt pork, the popularity of which has led to the city being nicknamed \"Beantown\". Beans in a tomato and brown sugar, sugar or corn syrup sauce are a widely available type throughout the US. Maine and Quebec-style beans often use maple syrup. Canned baked beans are used as a convenience food, shortening cooking times for a meal, or may be eaten straight from the can, in camping or emergency settings as they are pre-cooked. [Wikipedia]',	NULL,	'Baked_beans',	'730.jpg',	'image/jpeg',	44339,	'2012-04-20 09:42:44',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-14 17:43:24',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00706'),
(731,	'Chili',	NULL,	'Chili con carne (often known simply as chili) is a spicy stew. The name of the dish derives from the Spanish chile con carne, \"chili pepper with meat\". Traditional versions are made, minimally, from chili peppers, garlic, onions, and cumin, along with chopped or ground beef. Beans and tomatoes are frequently included. Variations, both geographic and personal, may involve different types of meat as well as a variety of other ingredients. [Wikipedia]',	NULL,	'Chili_con_carne',	'731.jpg',	'image/jpeg',	20949,	'2012-04-20 09:42:19',	NULL,	'Dishes',	'Tex-Mex cuisine',	'Type 2',	'2011-12-14 17:49:59',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00707'),
(732,	'Taco',	NULL,	'A taco is a traditional Mexican dish composed of a corn or wheat tortilla folded or rolled around a filling. A taco can be made with a variety of fillings, including beef, chicken, seafood, vegetables and cheese, allowing for great versatility and variety. A taco is generally eaten without utensils and is often accompanied by garnishes such as salsa, avocado or guacamole, cilantro, tomatoes, onions and lettuce. [Wikipedia]',	NULL,	'Taco',	'732.jpg',	'image/jpeg',	68723,	'2012-04-20 09:30:25',	NULL,	'Dishes',	'Tex-Mex cuisine',	'Type 2',	'2011-12-14 17:53:49',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00708'),
(733,	'Tortilla',	NULL,	'Tortilla means \"little torta\" or \"little cake\" in Spanish; the Spanish word applies to several different foods eaten in various Spanish-speaking countries. The Spanish word is used in English for a more restricted range of foods, mainly a potato-based omelette originating in Spain, and for a flatbread made from corn or wheat originally made by Mesoamerican peoples. Tortillas are used to prepare many Mexican and, more generally, Latin American dishes (e.g. burritos, quesadillas, tacos, tostadas). [Wikipedia]',	NULL,	'Tortilla',	'733.jpg',	'image/jpeg',	81659,	'2012-04-20 09:38:04',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-14 17:58:30',	'2020-03-12 21:00:17',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00709'),
(734,	'Nachos',	NULL,	'Nachos are a popular food based on nixtamalized corn, of Mexican origin associated with Tex-Mex cuisine that can be either made quickly to serve as a snack or prepared with more ingredients to make a full meal. In their simplest form, nachos are tortilla chips or totopos covered in melted cheese and salsa. [Wikipedia]',	NULL,	'Nachos',	'734.jpg',	'image/jpeg',	57570,	'2012-04-20 09:44:19',	NULL,	'Dishes',	'Tex-Mex cuisine',	'Type 2',	'2011-12-14 18:35:51',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00710'),
(735,	'Processed cheese',	NULL,	'Processed cheese is a food product made from normal cheese and sometimes other unfermented dairy ingredients, plus emulsifiers, extra salt, food colorings, or whey. Due to the processing and additives, some softer varieties cannot legally be labeled as \"cheese\" in many countries, including the United States and United Kingdom, and so are sold as \"cheese food\", \"cheese spread\", or \"cheese product\", depending primarily on the amount of cheese, moisture, and milkfat present in the final product. The best known processed cheese in the United States is marketed as American cheese by Kraft Foods, Borden, and other companies. [Wikipedia]',	NULL,	'Processed_cheese',	'735.jpg',	'image/jpeg',	64600,	'2012-04-20 09:42:01',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2011-12-14 18:41:24',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00711'),
(736,	'Salad',	NULL,	'Salad is any of a wide variety of dishes, including vegetable salads; salads of pasta, legumes, eggs, or grains; mixed salads incorporating meat, poultry, or seafood; and fruit salads. They may include a mixture of cold and hot, often including raw vegetables or fruits. [Wikipedia]',	NULL,	'Salad',	'736.jpg',	'image/jpeg',	103934,	'2012-04-20 09:41:58',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-14 18:50:01',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00712'),
(737,	'Cream substitute',	NULL,	NULL,	NULL,	NULL,	'737.jpg',	'image/jpeg',	108535,	'2012-04-20 09:31:11',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-14 20:46:19',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00713'),
(738,	'Dulce de leche',	NULL,	'Dulce de leche is a thick, creamy, caramel-like milk-based sauce or spread. Literally translated, dulce de leche means \"sweetness of milk\". It is prepared by slowly heating sweetened milk to create a product that derives its taste from caramelised sugar. It is a popular sweet in Latin America, where it is known under a variety of names. [Wikipedia]',	NULL,	'Dulce_de_leche',	'738.jpg',	'image/jpeg',	61142,	'2012-04-20 09:39:35',	NULL,	'Confectioneries',	'Spreads',	'Type 2',	'2011-12-14 20:57:25',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00714'),
(739,	'Topping',	NULL,	NULL,	NULL,	NULL,	'739.jpg',	'image/jpeg',	169791,	'2012-04-20 09:38:51',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-14 21:15:15',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00715'),
(740,	'Sweet custard',	NULL,	'Custard is a variety of culinary preparations based on a cooked mixture of milk or cream and egg yolk. Depending on how much egg or thickener is used, custard may vary in consistency from a thin pouring sauce (crème anglaise), to a thick pastry cream used to fill éclairs. The most common custards are used as desserts or dessert sauces and typically include sugar and vanilla. Sometimes flour, corn starch, or gelatin is added as in pastry cream or creme patissiere. Custard bases may also be used for quiches and other savory foods. [Wikipedia]',	NULL,	'Custard',	'740.jpg',	'image/jpeg',	74460,	'2012-04-20 09:34:06',	NULL,	'Confectioneries',	'Milk desserts',	'Type 2',	'2011-12-14 21:25:39',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00716'),
(742,	'Egg roll',	NULL,	'An egg roll is an appetizer and dinner, a variant of spring roll that has spread throughout the world as a staple of Asian cuisine. An egg roll is made by wrapping a combination of chopped vegetables (often mostly cabbage), meat, and sometimes noodles, in a sheet of dough, dipping the dough in egg or an egg wash, then deep frying it. When compared with its cousin, the spring roll, the egg roll is generally larger, has a thicker, puffier skin, is crunchier, and has more filling. However, the terms \"spring roll\" and \"egg roll\" are often used somewhat interchangeably. [Wikipedia]',	NULL,	'Egg_roll',	'742.jpg',	'image/jpeg',	37201,	'2012-04-20 09:43:01',	NULL,	'Dishes',	'Asian cuisine',	'Type 2',	'2011-12-14 21:46:50',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00717'),
(743,	'Heart of palm',	NULL,	'Heart of palm, also called palm heart, palmito, burglar\'s thigh, chonta, palm cabbage or swamp cabbage, is a vegetable harvested from the inner core and growing bud of certain palm trees (notably the coconut (Cocos nucifera), Palmito Juçara (Euterpe edulis), Açaí palm (Euterpe oleracea), sabal (Sabal spp.) and pejibaye (Bactris gasipaes) palms). [Wikipedia]',	NULL,	'Heart_of_palm',	'743.jpg',	'image/jpeg',	44122,	'2012-04-20 09:35:37',	NULL,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-12-14 22:00:39',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00718'),
(744,	'Popcorn',	NULL,	'Popcorn, or popping corn, is corn (maize) which expands from the kernel and puffs up when heated. Corn is able to pop because, like sorghum, quinoa and millet, its kernels have a hard moisture-sealed hull and a dense starchy interior. This allows pressure to build inside the kernel until an explosive \"pop\" results. Some strains of corn are now cultivated specifically as popping corns. [Wikipedia]',	NULL,	'Popcorn',	'744.jpg',	'image/jpeg',	122409,	'2012-04-20 09:43:08',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-15 17:15:01',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00719'),
(745,	'Potato chip',	NULL,	'Potato chips (known as crisps in British and Hiberno English; either chips or wafers in Indian English; and chips in American, Australian, New Zealand, Canadian, Singapore, South African, and Jamaican English) are thin slices of potato that are deep fried. Potato chips are commonly served as an appetizer, side dish, or snack. The basic chips are cooked and salted; additional varieties are manufactured using various flavorings and ingredients including seasonings, herbs, spices, cheeses, and artificial additives. [Wikipedia]',	NULL,	'Potato_chip',	'745.jpg',	'image/jpeg',	120116,	'2012-04-20 09:33:21',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-15 17:18:02',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00720'),
(746,	'Tortilla chip',	NULL,	'A tortilla chip is a snack food made from corn tortillas, which are cut into wedges and then fried (alternatively they may be discs pressed out of corn masa then fried or baked). Corn tortillas are made of corn, vegetable oil, salt and water. Though usually made of yellow corn, they can also be made of white, blue, or red corn. Some manufacturers include many other ingredients including wheat and sugar and MSG (monosodium glutamate, a common food additive). [Wikipedia]',	NULL,	'Tortilla_chip',	'746.jpg',	'image/jpeg',	102485,	'2012-04-20 09:36:36',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-15 17:20:18',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00721'),
(747,	'Corn chip',	NULL,	'A corn chip is a snack food made from cornmeal fried in oil or baked, usually in the shape of a small noodle or scoop. Corn chips are thick, rigid and very crunchy. Corn chips have the strong aroma and flavor of roasted corn, and are often heavily dusted with salt. While American-style corn chips and tortilla chips are both made from corn, the corn in tortilla chips is subjected to the nixtamalization process, resulting in a milder flavor and aroma, and a less rigid texture. Tortilla chips also tend to be larger, thinner, and less salty than American-style corn chips. [Wikipedia]',	NULL,	'Corn_chip',	'747.jpg',	'image/jpeg',	108546,	'2012-04-20 09:30:12',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-15 17:31:29',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00722'),
(748,	'Hibiscus tea',	'Hibiscus sabbariffa',	'Hibiscus tea is the infusion made from the calyces (sepals) of the Hibiscus sabdariffa flower, an herbal tea drink consumed both hot and cold by people around the world. It is also referred to as roselle (another common name for the hibiscus flower), flor de Jamaica in Latin America, karkadé in Egypt and Sudan, Chai Kujarat in Iraq, bissap or wonjo in West Africa, sorrel in Jamaica and Trinidad and Tobago, red sorrel in the wider Caribbean, and other names in other regions. Hibiscus tea has a tart, cranberry-like flavor, and sugar is often added to sweeten the beverage. The tea contains vitamin C and minerals and is used traditionally as a mild medicine. Hibiscus tea contains 15-30% organic acids, including citric acid, maleic acid, and tartaric acid. It also contains acidic polysaccharides and flavonoid glycosides, such as cyanidin and delphinidin, that give it its characteristic deep red colour. [Wikipedia]',	'21617',	'Hibiscus_tea',	'748.jpg',	'image/jpeg',	177518,	'2012-04-20 09:43:11',	NULL,	'Teas',	'Herbal teas',	'Type 1',	'2011-12-15 17:58:21',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	183260,	1,	'FOOD00723'),
(749,	'Stew',	NULL,	'A stew is a combination of solid food ingredients that have been cooked in liquid and served in the resultant gravy. Ingredients in a stew can include any combination of vegetables (such as carrots, potatoes, beans, peppers and tomatoes, etc.), meat, especially tougher meats suitable for slow-cooking, such as beef. Poultry, sausages, and seafood are also used. While water can be used as the stew-cooking liquid, wine, stock, and beer are also common. Seasoning and flavourings may also be added. Stews are typically cooked at a relatively low temperature (simmered, not boiled), allowing flavors to mingle. Stews are similar to soups, and in some cases there may not be a clear distinction between the two. Generally, stews have less liquid than soups, are much thicker and require longer cooking over low heat. While soups are almost always served in a bowl, stews may be thick enough to be served on a plate with the gravy as a sauce over the solid ingredients. [Wikipedia]',	NULL,	'Stew',	'749.jpg',	'image/jpeg',	101383,	'2012-04-20 09:39:36',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-15 18:11:17',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00724'),
(750,	'Gelatin dessert',	NULL,	'Gelatin desserts are desserts made with sweetened and flavored gelatin. They can be made by combining plain gelatin with other ingredients or by using a premixed blend of gelatin with additives. Fully prepared gelatin desserts are sold in a variety of forms, ranging from large decorative shapes to individual serving cups. In many of the Commonwealth nations and in Ireland, gelatin desserts are called jelly. In the United States and Canada, gelatin desserts are called jello (a generic name based on the brand name Jell-O) or gelatin, whereas \'jelly\' is a fruit preserve. [Wikipedia]',	NULL,	'Gelatin_dessert',	'750.jpg',	'image/jpeg',	90067,	'2012-04-20 09:33:12',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-15 18:48:40',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00725'),
(751,	'Junket',	NULL,	'Junket is a milk-based dessert, made with sweetened milk and rennet, the digestive enzyme which curdles milk. It might best be described as a custard or a very soft, sweetened cheese. To make junket, milk (usually with sugar and vanilla added) is heated to approximately body temperature and the rennet, which has been dissolved in water, is mixed in to cause the milk to \"set\". In the United States, junket is commonly made with a prepackaged mix of rennet and sweetener from a company eponymously known as Junket. [Wikipedia]',	NULL,	'Junket_(dessert)',	'751.jpg',	'image/jpeg',	56446,	'2012-04-20 09:44:13',	NULL,	'Confectioneries',	'Milk desserts',	'Type 2',	'2011-12-15 18:56:34',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00726'),
(752,	'Falafel',	NULL,	'Falafel is a deep-fried ball or patty made from ground chickpeas and/or fava beans. Falafel is usually served in a pita, which acts as a pocket, or wrapped in a flatbread known as lafa. The falafel balls are topped with salads, pickled vegetables, hot sauce, and drizzled with tahini-based sauces. Falafel balls may also be eaten alone as a snack or served as part of a meze. [Wikipedia]',	NULL,	'Falafel',	'752.jpg',	'image/jpeg',	115110,	'2012-04-20 09:36:02',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-15 19:03:39',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00727'),
(753,	'Frybread',	NULL,	'Frybread is a Native American food found throughout the United States. Frybread is a flat dough fried or deep-fried in oil, shortening, or lard. The dough is generally leavened by yeast or baking powder. Frybread can be eaten alone or with various toppings such as honey or hot beef. It is a simple complement to meals. Frybread is the base of an Indian taco, which is topped with ground beef, tomatoes, cheese, onions, and lettuce. [Wikipedia]',	NULL,	'Frybread',	'753.jpg',	'image/jpeg',	77041,	'2012-04-20 09:44:25',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-15 19:15:42',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00728'),
(754,	'Other frozen dessert',	NULL,	'Frozen dessert is the generic name for desserts made by freezing liquids, semi-solids, and sometimes even solids. They may be based on flavored water (shave ice, sorbet, snow cones, etc.), on fruit purées (such as sorbet), on milk and cream (most ice creams), on custard (frozen custard and some ice creams), on mousse (semifreddo), and others.\nIn some countries including Canada, the term is often used on products which are similar in taste and texture to ice cream, but which do not meet the legal definition of that term (often being made primarily with vegetable oils, i.e. mellorine, as opposed to milk or cream).',	NULL,	'Frozen_dessert',	'754.jpg',	'image/jpeg',	45822,	'2012-04-20 09:29:48',	NULL,	'Confectioneries',	'Frozen desserts',	'Type 2',	'2011-12-15 19:24:23',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00729'),
(755,	'Lasagna',	NULL,	'Lasagne are a wide, flat pasta shape, and possibly one of the oldest types of pasta. The word also refers to a dish made with several layers of lasagne sheets alternated with sauces and various other ingredients.\nLasagne originated in Italy, traditionally ascribed to the city of Bologna (Emilia-Romagna), where the first modern recipe was created and published and became a traditional dish. Traditional lasagne is made by interleaving layers of pasta with layers of sauce, made with ragù, bechamel, and Parmigiano-Reggiano. In other regions and outside of Italy it is common to find lasagne made with ricotta or mozzarella cheese, tomato sauce, various meats (e.g., ground beef, pork or chicken), miscellaneous vegetables (e.g., spinach, zucchini, mushrooms) and typically flavored with wine, garlic, onion, and oregano. In all cases the lasagne are oven-baked.',	NULL,	'Lasagna',	'755.jpg',	'image/jpeg',	59610,	'2012-04-20 09:40:30',	NULL,	'Dishes',	'Pasta dishes',	'Type 2',	'2011-12-15 21:54:04',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00730'),
(756,	'Morchella (Morel)',	'Morchellaceae',	'The Morchellaceae are a family of ascomycete fungi. According to a standard reference work, the family has contained at least 49 species distributed among 4 genera, but in 2012, 5 genera producing the sequestrate and hypogeous ascoma were added. The best-known members are the highly regarded and commercially picked true morels of the genus Morchella, the thimble morels of the genus Verpa, and a genus of cup-shaped fungi Disciotis. The remaining four genera produce the sequestrate fruit bodies. Analysis of the ribosomal DNA of many of the Pezizales showed the three genera Verpa, Morchella, and Disciotis to be closely related. Thus they are now included in the family Morchellaceae.',	'612936',	'Morchellaceae',	'756.jpg',	'image/jpeg',	47797,	'2012-04-20 09:43:02',	NULL,	'Vegetables',	'Mushrooms',	'Type 1',	'2011-12-15 22:23:06',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	5192,	1,	'FOOD00731'),
(757,	'Pancake',	NULL,	'A pancake is a thin, flat, round cake prepared from a batter, and cooked on a hot griddle or frying pan. Most pancakes are quick breads; some use a yeast-raised or fermented batter. Most pancakes are cooked one side on a griddle and flipped partway through to cook the other side. Depending on the region, pancakes may be served at any time, with a variety of toppings or fillings including jam, chocolate chips, fruit, syrup or meat. [Wikipedia]',	NULL,	'Pancake',	'757.jpg',	'image/jpeg',	75183,	'2012-04-20 09:34:14',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-15 22:34:37',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00732'),
(758,	'Pectin',	NULL,	'Pectin is a structural heteropolysaccharide contained in the primary cell walls of terrestrial plants. It is produced commercially as a white to light brown powder, mainly extracted from citrus fruits, and is used in food as a gelling agent particularly in jams and jellies. It is also used in fillings, medicines, sweets, as a stabilizer in fruit juices and milk drinks and as a source of dietary fiber. [Wikipedia]',	NULL,	'Pectin',	'758.jpg',	'image/jpeg',	10575,	'2012-04-20 09:29:08',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-15 22:39:04',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00733'),
(759,	'Pudding',	NULL,	'In the United States, pudding characteristically denotes a sweet milk-based dessert similar in consistency to egg-based custards, though it may also refer to other types such as bread and rice pudding. In the United Kingdom and some Commonwealth countries, pudding refers to rich, fairly homogeneous starch- or dairy- based desserts such as rice pudding and Christmas pudding, or, informally, any sweet dish after the main course. The word is also used for savory dishes such as Yorkshire pudding, black pudding, suet pudding and steak and kidney pudding. [Wikipedia]',	NULL,	'Pudding',	'759.jpg',	'image/jpeg',	60967,	'2012-04-20 09:31:20',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-15 22:52:17',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00734'),
(760,	'Waffle',	NULL,	'A waffle is a batter- or dough- based cake cooked in a waffle iron patterned to give a distinctive and characteristic shape. There are many variations based on the type and shape of the iron and the recipe used. Waffles are eaten throughout the world, particularly in Belgium and the United States. Common toppings are strawberries, chocolate, sugar, honey, syrups, ice cream, and more. [Wikipedia]',	NULL,	'Waffle',	'760.jpg',	'image/jpeg',	135284,	'2012-04-20 09:43:37',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-15 23:41:00',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00735'),
(761,	'Soy milk',	NULL,	'Soy milk is a beverage made from soybeans. A stable emulsion of oil, water, and protein, it is produced by soaking dry soybeans and grinding them with water. Soy milk contains about the same proportion of protein as cow\'s milk: around 3.5%; also 2% fat, 2.9% carbohydrate, and 0.5% ash. The coagulated protein from soy milk can be made into tofu, just as dairy milk can be made into cheese. [Wikipedia]',	NULL,	'Soy_milk',	'761.jpg',	'image/jpeg',	34248,	'2012-04-20 09:34:05',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-15 23:47:00',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00736'),
(762,	'Meatloaf',	NULL,	'Meatloaf is a dish of ground meat formed into a loaf shape and baked or smoked. The loaf shape is formed by either cooking it in a loaf pan, or forming it by hand on a flat baking pan. It is usually made from ground beef, although lamb, pork, veal, venison, and poultry or a combination are also used. [Wikipedia]',	NULL,	'Meatloaf',	'762.jpg',	'image/jpeg',	6730,	'2012-04-20 09:42:18',	NULL,	'Dishes',	'Ground meat',	'Type 2',	'2011-12-15 23:56:30',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00737'),
(763,	'Sake',	NULL,	'Sake, also known as Nihonshu, is a rice-based alcoholic beverage of Japanese origin. Sake is also referred to in English as a form of rice wine. However, unlike true wine, in which alcohol is produced by fermenting the sugar naturally present in fruit, sake is made through a brewing process more like that of beer, thus it is more like a rice brew than a rice wine. [Wikipedia]',	NULL,	'Sake',	'763.jpg',	'image/jpeg',	32423,	'2012-04-20 09:30:02',	NULL,	'Beverages',	'Fermented beverages',	'Type 2',	'2011-12-16 00:02:30',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00738'),
(764,	'Cocktail',	NULL,	'A cocktail is a mixed drink typically made with a distilled beverage (such as gin, vodka, whiskey, tequila, or rum) that is mixed with other ingredients. Cocktails contain one or more types of liqueur, juice, fruit, sauce, honey, milk or cream, spices, or other flavorings. [Wikipedia]',	NULL,	'List_of_cocktails',	'764.jpg',	'image/jpeg',	15344,	'2012-04-20 09:37:47',	NULL,	'Beverages',	'Alcoholic beverages',	'Type 2',	'2011-12-16 00:05:31',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00739'),
(765,	'Couscous',	NULL,	'Couscous is a Berber pasta dish of semolina traditionally served with a meat or vegetable stew spooned over it. Couscous is a staple food throughout Algeria, Morocco and Tunisia. [Wikipedia]',	NULL,	'Couscous',	'765.jpg',	'image/jpeg',	283168,	'2012-04-20 09:29:15',	NULL,	'Dishes',	'Berber cuisine',	'Type 2',	'2011-12-16 00:21:11',	'2019-05-14 18:05:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00740'),
(766,	'Bulgur',	NULL,	'Bulgur (also bulghur, burghul or bulgar) is a cereal food made from several different wheat species, most often from durum wheat. In the United States it is most often made from white wheat. Its use is most common in Middle Eastern cuisine, Iran, Turkey, Greece, Armenia and Bulgaria. In India it is called Lapsi. [Wikipedia]',	NULL,	'Bulgur',	'766.jpg',	'image/jpeg',	126235,	'2012-04-20 09:37:20',	NULL,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-12-16 17:06:03',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00741'),
(767,	'Coffee substitute',	NULL,	'Coffee substitutes are non-coffee products, usually without caffeine, that are used to imitate coffee. Coffee substitutes can be used for medical, economic and religious reasons, or simply because coffee is not readily available. Roasted grain beverages are common substitutes for coffee. Some ingredients used include: almond, acorn, asparagus, malted barley, beechnut, beetroot, carrot, chicory root, corn, cottonseed, dandelion root, fig, boiled-down molasses, okra seed, pea, persimmon seed, potato peel, rye, sassafras pits, sweet potato, wheat bran. Ground roasted chicory root has been sold commercially on a large scale since around 1970, and it has become a mainstream product, both alone and mixed with real coffee. [Wikipedia]',	NULL,	'Coffee_substitute',	'767.jpg',	'image/jpeg',	183689,	'2012-04-20 09:35:37',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-16 17:10:13',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00742'),
(768,	'Coffee mocha',	NULL,	'A caffè mocha is a variant of a caffè latte. Like a caffe latte, it is based on espresso and hot milk, but with added chocolate, typically in the form of sweet cocoa powder, although many varieties use chocolate syrup. Mochas can contain dark or milk chocolate. Mocha is also used to describe a type of coffee bean. Smaller and rounder than most other varieties, these beans are derived from the coffee species Coffea arabica; \"mocha coffee\" can refer either to the coffee-with-chocolate drink, or simply to coffee brewed with mocha beans. [Wikipedia]',	NULL,	'Cafe_mocha',	'768.jpg',	'image/jpeg',	36906,	'2012-04-20 09:36:20',	NULL,	'Coffee and coffee products',	'Coffee products',	'Type 2',	'2011-12-16 17:14:58',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00743'),
(769,	'Chimichanga',	NULL,	'Chimichanga, also known as chivichanga or chimmy chonga, is a deep-fried burrito that is popular in Southwestern U.S. cuisine, Tex-Mex cuisine, and the Mexican states of Sinaloa and Sonora. The dish is typically prepared by filling a flour tortilla with a wide range of ingredients, most commonly rice, cheese, machaca, carne adobada, or shredded chicken, and folding it into a rectangular package. It is then deep-fried and can be accompanied with salsa, guacamole, sour cream and/or cheese. Many restaurants offer non-fried chimichangas, which are similar to normal burrito, with cheese sauce, guacamole, and tomato. [Wikipedia]',	NULL,	'Chimichanga',	'769.jpg',	'image/jpeg',	44848,	'2012-04-20 09:44:14',	NULL,	'Dishes',	'Mexican cuisine',	'Type 2',	'2011-12-16 17:23:24',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00744'),
(770,	'Semolina',	NULL,	'Semolina is the coarse, purified wheat middlings of durum wheat used in making pasta, and also used for breakfast cereals and puddings. Semolina is also used to designate coarse middlings from other varieties of wheat, and from other grains such as rice and corn. [Wikipedia]',	NULL,	'Semolina',	'770.jpg',	'image/jpeg',	92539,	'2012-04-20 09:41:02',	NULL,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-12-16 17:42:02',	'2020-03-12 21:01:19',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00745'),
(771,	'Tapioca pearl',	NULL,	'Tapioca is a starch extracted from Manihot esculenta. In India, the term \'Tapioca\' is used to represent the root of the plant (Cassava), rather than the starch. In Vietnam, it is called bot nang. In Indonesia, it is called singkong. In the Philippines, it is called sago. Tapioca is a staple food in some regions and is used worldwide as a thickening agent, mainly in foods. In Britain, the word tapioca often refers to a milk pudding thickened with arrowroot, while in Asia the sap of the sago palm is often part of its preparation. Tapioca is gluten-free, and almost completely protein-free. [Wikipedia]',	NULL,	'Tapioca',	'771.jpg',	'image/jpeg',	73617,	'2012-04-20 09:40:34',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-16 17:49:21',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00746'),
(772,	'Tostada',	NULL,	'Tostada is a Spanish word which literally means \"toasted\". It is used in Latin America to name several different traditional local dishes which have in common the fact they are toasted or use a toasted ingredient as the main base of their preparation. [Wikipedia]',	NULL,	'Tostada',	'772.jpg',	'image/jpeg',	66896,	'2012-04-20 09:42:07',	NULL,	'Dishes',	'Mexican cuisine',	'Type 2',	'2011-12-16 17:55:08',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00747'),
(773,	'Quesadilla',	NULL,	'A quesadilla is a flour or corn tortilla filled with a savoury mixture containing cheese and other ingredients, then folded in half to form a half-moon shape. [Wikipedia]',	NULL,	'Quesadilla',	'773.jpg',	'image/jpeg',	53623,	'2012-04-20 09:44:17',	NULL,	'Dishes',	'Mexican cuisine',	'Type 2',	'2011-12-16 17:58:12',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00748'),
(774,	'Baked potato',	NULL,	'A baked potato, or jacket potato, is the edible result of baking a potato. When well cooked, a baked potato has a fluffy interior and a crisp skin. It may be served with fillings and condiments such as butter, cheese or ham. Potatoes can be baked in a conventional gas or electric oven, a convection oven, a microwave oven, on a barbecue grill, or on/in an open fire. Some restaurants use special ovens designed specifically to cook large numbers of potatoes then keep them warm and ready for service. [Wikipedia]',	NULL,	'Baked_potato',	'774.jpg',	'image/jpeg',	31842,	'2012-04-20 09:39:04',	NULL,	'Dishes',	'Potato dishes',	'Type 2',	'2011-12-16 18:03:47',	'2019-12-11 19:38:25',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00749'),
(775,	'Hot dog',	NULL,	'A hot dog is a sausage served in a sliced bun. It is very often garnished with mustard, ketchup, onions, mayonnaise, relish and/or sauerkraut. [Wikipedia]',	NULL,	'Hot_dog',	'775.jpg',	'image/jpeg',	53442,	'2012-04-20 09:42:50',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-16 18:05:46',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00750'),
(776,	'Spread',	NULL,	'A spread is a food that is spread with a knife onto bread, crackers, or other bread products. Spreads are added to bread products to provide flavor and texture, and are an integral part of the dish, i.e. they should be distinguished from condiments, which are optional additions. Spreads should also be distinguished from dips, which do not employ a knife in applying it to crackers or chips, such as salsa. [Wikipedia]',	NULL,	'Spread_(food)',	'776.jpg',	'image/jpeg',	136322,	'2012-04-20 09:29:20',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-16 18:12:53',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00751'),
(777,	'Enchilada',	NULL,	'An enchilada is a corn tortilla rolled around a filling and covered with a chili pepper sauce. Enchiladas can be filled with a variety of ingredients, including meat, cheese, beans, potatoes, vegetables, seafood or combinations. [Wikipedia]',	NULL,	'Enchilada',	'777.jpg',	'image/jpeg',	120953,	'2012-04-20 09:38:45',	NULL,	'Dishes',	'Mexican cuisine',	'Type 2',	'2011-12-16 18:16:44',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00752'),
(778,	'Egg substitute',	NULL,	'For those who do not consume eggs, alternatives used in baking include other rising agents or binding materials, such as ground flax seeds or potato starch flour. Tofu can also act as a partial binding agent, since it is high in lecithin due to its soy content. Applesauce can be used, as well as arrowroot and banana. Extracted soybean lecithin, in turn, is often used in packaged foods as an inexpensive substitute for egg-derived lecithin.\nOther egg substitutes are made from just the white of the egg for those who worry about the high cholesterol and fat content in eggs. These products usually have added vitamins and minerals, as well as vegetable-based emulsifiers and thickeners such as xanthan gum or guar gum. These allow the product to maintain the nutrition and several culinary properties of real eggs, making possible foods such as Hollandaise sauce, custard, mayonnaise, and most baked goods with these substitutes.',	NULL,	'Egg_substitute#Cooking_substitutes',	'778.jpg',	'image/jpeg',	122710,	'2012-04-20 09:32:17',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-16 18:20:45',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00753'),
(779,	'Nutritional drink',	NULL,	'An energy drink is a type of beverage containing stimulant drugs, chiefly caffeine, which is marketed as providing mental or physical stimulation. There are myriad brands and varieties of energy drinks. They generally contain large amounts of caffeine and other stimulants. Many also contain sugar or other sweeteners, herbal extracts and amino acids and may or may not be carbonated. They are a subset of the larger group of energy products, which includes bars and gels. Coffee, tea and other naturally caffeinated beverages are usually not considered energy drinks. Soft drinks such as cola, may contain caffeine, but are also not energy drinks. Some alcoholic beverages, such as Four Loko, contain caffeine and other stimulants and are marketed as energy drinks, although such drinks are banned in some American states.',	NULL,	'Energy drink',	'779.jpg',	'image/jpeg',	44182,	'2012-04-20 09:41:18',	NULL,	'Beverages',	'Nutritional beverages',	'Type 2',	'2011-12-16 18:23:35',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00754'),
(780,	'Other sandwich',	NULL,	'A sandwich is a food item, typically consisting of two or more slices of bread with one or more fillings between them, or one slice of bread with a topping or toppings, commonly called an open sandwich. Sandwiches are a widely popular type of lunch food, typically taken to work or school, or picnics to be eaten as part of a packed lunch. They generally contain a combination of salad vegetables, meat, cheese, and a variety of sauces or savoury spreads. The bread can be used as it is, or it can be coated with any condiments to enhance flavour and texture. They are widely sold in restaurants and cafes. See a \"list of sandwiches\":http://en.wikipedia.org/wiki/List_of_sandwiches. [Wikipedia]',	NULL,	'Sandwich',	'780.jpg',	'image/jpeg',	132418,	'2012-04-20 09:33:41',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-16 18:32:22',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00755'),
(781,	'Ketchup',	NULL,	'Ketchup (sometimes catsup in American English or tomato sauce in Commonwealth English) is a sweet-and-tangy condiment typically made from tomatoes, vinegar, sugar or high-fructose corn syrup and an assortment of vegetable seasonings and spices such as onions, allspice, cloves, cinnamon, garlic, and celery. Ketchup is often used with french fries (chips in the UK), hamburgers, sandwiches and grilled or fried meat. In Australia and New Zealand, where it is known as tomato sauce, it is a typical accompaniment for meat pies. Ketchup is sometimes used as a basis or ingredient for other sauces and dressings. [Wikipedia]',	NULL,	'Ketchup',	'781.jpg',	'image/jpeg',	19855,	'2012-04-20 09:33:43',	NULL,	'Baking goods',	'Condiments',	'Type 2',	'2011-12-16 18:37:33',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00756'),
(782,	'Breakfast sandwich',	NULL,	'A breakfast sandwich is a sandwich served for breakfast at fast food restaurants and delis or bought as a fast ready to heat and eat sandwich from a store. Breakfast sandwiches can also be made from scratch in the home. Breakfast sandwiches typically are made using breakfast meats (which are e.g. Spam, sausages, patty sausages, bacon, country ham and pork roll), breads, eggs and cheese. These sandwiches were typically regional specialties until fast food restaurants began serving breakfast. Because the types of bread common, such as biscuits, bagels, and English muffins were similar in size to a fast food hamburger buns, they made an obvious choice for fast food restaurants. Unlike other breakfast items, they were perfect for the innovation of the drive-through. These sandwiches have also become a staple of many convenience stores, that serve them as take-away items. [Wikipedia]',	NULL,	'Breakfast_sandwich',	'782.jpg',	'image/jpeg',	86936,	'2012-04-20 09:32:22',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-16 18:49:45',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00757'),
(783,	'Adobo',	NULL,	'Adobo (Spanish: marinade, sauce, or seasoning) is the immersion of raw food into a preparation of different components including paprika (from red peppers), oregano, salt, garlic, and vinegar. The cooking technique is native to Spanish cuisine. Once becoming widely used in Latin America it was subsequently adopted in other countries such as the United States. In Venezuela, adobo refers to a mixture of salt with various spices technically known as sal condimentada (seasoned salt). Adobo is also the name given by Spanish colonists to an unrelated but superficially similar Philippine cooking process which primarily uses vinegar. [Wikipedia]',	NULL,	'Adobo',	'783.jpg',	'image/jpeg',	100196,	'2012-04-20 09:28:46',	NULL,	'Baking goods',	'Seasonings',	'Type 2',	'2011-12-16 18:55:54',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00758'),
(784,	'Macaroni and cheese',	NULL,	'Macaroni and cheese, also known as \"mac and cheese\", \"macaroni cheese\" in British English, or \"macaroni pie\" in Caribbean English, is a casserole consisting of cooked elbow macaroni and cheese sauce. Macaroni and cheese is often prepared using a packaged food mix. [Wikipedia]',	NULL,	'Macaroni_and_cheese',	'784.jpg',	'image/jpeg',	66369,	'2012-04-20 09:37:06',	NULL,	'Dishes',	'Pasta dishes',	'Type 2',	'2011-12-16 19:06:08',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00759'),
(785,	'Butterfat',	NULL,	'Butterfat or milkfat is the fatty portion of milk. Milk and cream are often sold according to the amount of butterfat they contain. [Wikipedia] See also \"dairyforall.com\":http://www.dairyforall.com/butteroil.php',	NULL,	'Butterfat',	'785.jpg',	'image/jpeg',	24494,	'2012-04-20 09:38:02',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-16 19:29:14',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00760'),
(786,	'Horned melon',	'Cucumis metuliferus',	'The horned melon, also called African horned cucumber or melon, jelly melon, hedged gourd, English tomato, melano, kiwano, or cherie, is an annual vine in the cucumber and melon family. It is considered to be the ancestor of the other cultivated melons. Often known by its nickname in the southeastern United States, blowfish fruit, it is grown for its fruit, which looks like an oval melon with horn-like spines. The fruit of this plant is edible, but it is used as often for decoration as for food. When ripe, it has a yellow-orange skin and a lime green jelly-like flesh with a tart taste, and texture similar to a cucumber. The horned melon is native to Africa, and it is now grown in California, Chile, Australia and New Zealand as well. [Wikipedia]',	'501835',	'Horned_melon',	'786.jpg',	'image/jpeg',	61354,	'2012-04-20 09:31:21',	NULL,	'Gourds',	'Gourds',	'Type 2',	'2011-12-16 22:22:18',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	61886,	1,	'FOOD00761'),
(787,	'Hushpuppy',	NULL,	'A hushpuppy or cornbread ball is a savory, starch-based food made from cornmeal batter that is deep fried or baked in small ball or sphere shapes, or occasionally oblong or ring shapes. Hushpuppies are frequently served as a side dish, usually at seafood restaurants in the United States. Typical hushpuppy ingredients include cornmeal, wheat flour, eggs, salt, baking soda, milk or buttermilk, and water, and may include onion, spring onion (scallion), garlic, whole kernel corn, and peppers. Sometimes pancake batter is used. [Wikipedia]',	NULL,	'Hushpuppy',	'787.jpg',	'image/jpeg',	59179,	'2012-04-20 09:41:23',	NULL,	'Dishes',	'American cuisine',	'Type 2',	'2011-12-16 22:27:01',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00762'),
(788,	'Fruit juice',	NULL,	'Juice is the liquid that is naturally contained in fruit or vegetable tissue. Juice is prepared by mechanically squeezing or macerating fruit or vegetable flesh without the application of heat or solvents. Many commercial juices are filtered to remove fiber or pulp, but high-pulp fresh orange juice is a popular beverage. Common methods for preservation and processing of fruit juices include canning, pasteurization, freezing, evaporation and spray drying. [Wikipedia]',	NULL,	'Juice',	'788.jpg',	'image/jpeg',	125913,	'2012-04-20 09:39:14',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-16 22:43:15',	'2020-03-16 16:32:15',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00763'),
(789,	'Relish',	NULL,	'A relish is a cooked, pickled, or chopped vegetable or fruit food item which is typically used as a condiment. In North America, relish commonly alludes to sweet pickle relish-like sauce that often condiments hot dogs, hamburgers and other types of fast food. [Wikipedia]',	NULL,	'Relish',	'789.jpg',	'image/jpeg',	86991,	'2012-04-20 09:37:46',	NULL,	'Baking goods',	'Condiments',	'Type 2',	'2011-12-16 22:48:35',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00764'),
(790,	'Other fruit product',	NULL,	NULL,	NULL,	NULL,	'790.jpg',	'image/jpeg',	107811,	'2012-04-20 09:30:38',	NULL,	'Fruits',	'Fruit products',	'Type 2',	'2011-12-16 22:55:08',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00765'),
(791,	'Fruit salad',	NULL,	'Fruit salad (also called Macedonia) is a dish consisting of various kinds of fruit, served in a liquid, either in their own juices or a syrup. When served as an appetizer or as a dessert, a fruit salad is sometimes known as a fruit cocktail or fruit cup. [Wikipedia]',	NULL,	'Fruit_salad',	'791.jpg',	'image/jpeg',	52416,	'2012-04-20 09:30:00',	NULL,	'Fruits',	'Fruit products',	'Type 2',	'2011-12-16 22:57:28',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00766'),
(792,	'Soy yogurt',	NULL,	'Soy yogurt, also referred to as Soya yogurt, Soygurt or Yofu (a portmanteau of yogurt and tofu), is a yogurt prepared with soy milk. Soy yogurt is made using soy milk, adding yogurt bacteria (Lactobacillus delbrueckii subsp. bulgaricus and Streptococcus salivarius subsp. thermophilus), sometimes adding sweeteners such as fructose, glucose, or sugar. [Wikipedia]',	NULL,	'Soy_yogurt',	'792.jpg',	'image/jpeg',	69601,	'2012-04-20 09:36:56',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-16 23:10:26',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00767'),
(793,	'Vegetarian food',	NULL,	'Vegetarian cuisine refers to food that meets vegetarian standards by not including meat and animal tissue products. For lacto-ovo vegetarianism (the most common type of vegetarianism in the Western world), eggs and dairy products such as milk and cheese are permitted. For lacto vegetarianism, the earliest known type of vegetarianism, dairy products such as milk and cheese are permitted. The strictest forms of vegetarianism are veganism and fruitarianism, which exclude all animal products, including dairy products as well as honey, and even some refined sugars if filtered and whitened with bone char. Vegetarian foods can be classified into several different types: Traditional foods that have always been vegetarian Soy products including tofu and tempeh which are common protein sources Textured vegetable protein (TVP), made from defatted soy flour, often included in chili and burger recipes in place of ground meat Meat analogues, which mimic the taste, texture, and appearance of meat and are often used in recipes that traditionally contained meat. Vegans may also use analogues for eggs and dairy products',	NULL,	'Vegetarian cuisine',	'793.jpg',	'image/jpeg',	95771,	'2012-04-20 09:36:47',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-16 23:19:19',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00768'),
(794,	'Veggie burger',	NULL,	'A veggie burger is a hamburger-style patty that does not contain meat. The patty of a veggie burger may be made, for example, from vegetables, textured vegetable protein (soy meat), legumes, nuts, dairy products, mushrooms, wheat, or eggs. [Wikipedia]',	NULL,	'Veggie_burger',	'794.jpg',	'image/jpeg',	116651,	'2012-04-20 09:35:59',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-19 17:08:02',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00769'),
(795,	'Cold cut',	NULL,	'Cold cuts (also known as lunch meats, luncheon meats, sandwich meats, cooked meats, sliced meats, cold meats and deli meats) are cheeses or precooked or cured meat, often sausages or meat loaves, that are sliced and usually served cold on sandwiches or on party trays. In Commonwealth countries and the U.K., luncheon meat refers specifically to products that can include mechanically reclaimed meat (paste-like meat product produced by forcing beef, pork, turkey or chicken, under high pressure through a sieve or similar device to separate the bone from the edible meat tissue). In British English, the terms cold meats, cooked meats, or sliced meats are used instead. [Wikipedia]',	NULL,	'Cold_cut',	'795.jpg',	'image/jpeg',	45201,	'2012-04-20 09:43:28',	NULL,	'Dishes',	'Ground meat',	'Type 2',	'2011-12-19 17:12:46',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00770'),
(796,	'Mixed nuts',	NULL,	'Mixed nuts are a snack food consisting of any mixture of mechanically or manually combined nuts. Peanuts (actually a legume), almonds, walnuts, Brazil nuts, cashews, filberts, hazelnuts, and pecans are common constituents of mixed nuts. Mixed nuts may be salted, roasted, cooked, or blanched. [Wikipedia]',	NULL,	'Mixed_nuts',	'796.jpg',	'image/jpeg',	6853,	'2012-04-20 09:37:17',	NULL,	'Nuts',	'Nuts',	'Type 2',	'2011-12-19 17:27:57',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00771'),
(797,	'Canola',	NULL,	'Canola refers to a cultivar of either Rapeseed (Brassica napus L.) or field mustard (Brassica campestris L. or Brassica Rapa var.). Its seeds are used to produce edible oil suitable for consumption by humans and livestock. Originally, Canola was bred naturally from rapeseed in Canada by Keith Downey and Baldur R. Stefansson in the early 1970s, but it has a very different nutritional profile in addition to much less erucic acid. The name \"canola\" was derived from \"Canadian oil, low acid\" in 1978. [Wikipedia]',	NULL,	'Canola',	'797.jpg',	'image/jpeg',	29373,	'2012-04-20 09:30:48',	NULL,	'Herbs and spices',	'Oilseed crops',	'Type 2',	'2011-12-19 17:46:32',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	138011,	1,	'FOOD00772'),
(798,	'Babassu palm',	'Attalea speciosa',	'Babassu palm (Babaçu, Cusi) is a palm native to the Amazon Rainforest region. The Babassu palm is the predominant species in the Maranhão Babaçu forests of Maranhão and Piauí states. This plant has commercial value because its seeds produce an edible oil called babassu oil, which is also used in cleaners and skin care products. The fruit is used to produce products such as medicines, beauty aids, and beverages. Traditional communities of the Maranhão region also produce a flour from the fruit and this is commercialized as a nutritional supplement. The leaves are also used to provide thatch for houses and can be woven into mats for constructing house walls. The stems are used for timbers. [Wikipedia]',	'509373',	'Attalea_speciosa',	'798.jpg',	'image/jpeg',	54637,	'2012-04-20 09:43:19',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-12-19 17:51:25',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	145700,	1,	'FOOD00773'),
(799,	'Cupuaçu',	'Theobroma grandiflorum',	'Cupuaçu (also spelled Cupuassu, Cupuazú, and Copoasu), is a tropical rainforest tree related to cacao. Common throughout the Amazon basin, it is widely cultivated in the jungles of Colombia, Bolivia and Peru and in the north of Brazil, with the largest production in Pará, followed by Amazonas, Rondônia and Acre. The white pulp of the cupuaçu is uniquely fragrant (described as a mix of chocolate and pineapple), and it contains theacrine (1,3,7,9-tetramethyluric acid) instead of the xanthines (caffeine, theobromine, and theophylline) found in cacao. It is frequently used in desserts, juices and sweets. The juice tastes primarily like a pear, with a hint of banana. [Wikipedia]',	'506108',	'Cupuaçu',	'799.jpg',	'image/jpeg',	63613,	'2012-04-20 09:29:47',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-12-19 17:57:43',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	108881,	1,	'FOOD00774'),
(800,	'Shea tree',	'Vitellaria paradoxa',	'Shea tree is a tree indigenous to Africa, occurring in Mali, Cameroon, Congo, Côte d\'Ivoire, Ghana, Guinea, Togo, Nigeria, Senegal, Sudan, Burkina Faso and Uganda. The shea fruit consists of a thin, tart, nutritious pulp that surrounds a relatively large, oil-rich seed from which shea butter is extracted. Throughout Africa, shea butter is used extensively for food and medicinal purposes, and is a major source of dietary fat. The fruit is edible and delicious. It tastes roughly like a fig. [Wikipedia]',	'505960',	'Shea_tree',	'800.jpg',	'image/jpeg',	124608,	'2012-04-20 09:33:37',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-12-19 18:01:22',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	292385,	1,	'FOOD00775'),
(801,	'Oil-seed Camellia',	'Camellia oleifera',	'Oil-seed camellia (or tea oil camellia) is an important source of edible oil (known as tea oil or camellia oil) obtained from its seeds. Tea oil is a sweetish seasoning and cooking oil that should not be confused with tea tree oil, an essential oil that is used for medical and cosmetical purposes and originates from the leaves of a different plant. [Wikipedia]',	NULL,	'Camellia_oleifera',	'801.jpg',	'image/jpeg',	23106,	'2012-04-20 09:32:26',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-12-19 18:12:02',	'2019-05-14 18:05:31',	2,	2,	0,	'specific',	385388,	1,	'FOOD00776'),
(802,	'Ucuhuba',	'Virola surinamensis',	'The ucuhuba tree grows in South America. Ucuhuba seed oil is the oil extracted from its seed. [Wikipedia]',	'18123',	'Virola_surinamensis',	'802.jpg',	'image/jpeg',	23021,	'2012-04-20 09:35:58',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 1',	'2011-12-19 18:44:49',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	224910,	1,	'FOOD00777'),
(803,	'Phyllo dough',	NULL,	'Phyllo, filo, or fillo dough is paper-thin sheets of unleavened flour dough used for making pastries in Middle Eastern and Balkan cuisine. Phyllo dough is made with flour, water, and a small amount of oil and rak? or white vinegar, though some dessert recipes also call for egg yolks. Phyllo can be used in many ways: layered, folded, rolled, or ruffled, with various fillings. [Wikipedia]',	NULL,	'Phyllo',	'803.jpg',	'image/jpeg',	39191,	'2012-04-20 09:41:28',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-19 18:48:08',	'2020-03-12 21:01:23',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00778'),
(804,	'Cooking oil',	NULL,	'Cooking oil is any fat that is used for cooking and is usually liquid at room temperature. Cooking oil may be of plant or animal origin. Types of cooking oil include: ghee, olive oil, palm oil, soybean oil, canola oil, pumpkin seed oil, corn oil, sunflower oil, safflower oil, peanut oil, grape seed oil, sesame oil, argan oil, rice bran oil and other vegetable oils. [Wikipedia] See also a \"list of vegetable oils\":http://en.wikipedia.org/wiki/List_of_vegetable_oils',	NULL,	'Cooking_oil',	'804.jpg',	'image/jpeg',	50487,	'2012-04-20 09:42:35',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-19 20:44:23',	'2019-12-11 19:38:30',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00779'),
(805,	'Pie crust',	NULL,	'A pie is a baked dish which is usually made of a pastry dough casing that covers or completely contains a filling of various sweet or savoury ingredients.\nPies are defined by their crusts. A filled pie (also single-crust or bottom-crust), has pastry lining the baking dish, and the filling is placed on top of the pastry but left open. A top-crust pie, which may also be called a cobbler, has the filling in the bottom of the dish and is covered with a pastry or other covering before baking. A two-crust pie has the filling completely enclosed in the pastry shell. Flaky pastry is a typical kind of pastry used for pie crusts, but many things can be used, including baking powder biscuits, mashed potatoes, and crumbs.',	NULL,	'Pie_crust',	'805.jpg',	'image/jpeg',	166481,	'2012-04-20 09:35:45',	NULL,	'Baking goods',	'Wrappers',	'Type 2',	'2011-12-19 20:50:42',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00780'),
(806,	'Pie filling',	NULL,	NULL,	NULL,	NULL,	'806.jpg',	'image/jpeg',	77806,	'2012-04-20 09:29:58',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-19 20:52:20',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00781'),
(807,	'Pie',	NULL,	'A pie is a baked dish which is usually made of a pastry dough casing that covers or completely contains a filling of various sweet or savoury ingredients. [Wikipedia]',	NULL,	'Pie',	'807.jpg',	'image/jpeg',	128788,	'2012-04-20 09:32:05',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-19 20:54:01',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00782'),
(808,	'Shortening',	NULL,	'Shortening is a solid fat made from vegetable oils, such as soybean and cottonseed oil, which have been hydrogenated to create a solid. This process creates trans fatty acids which turns polyunsaturated fats into saturated fats. Vegetable shortening is virtually flavorless, and is used to make baked goods light and flaky. Crisco is a popular brand of vegetable shortening. [\"Kitchen Dictionary\":http://www.food.com/library/shortening-430]',	NULL,	'Shortening',	'808.jpg',	'image/jpeg',	3390,	'2012-04-20 09:37:52',	NULL,	'Fats and oils',	'Vegetable fats',	'Type 2',	'2011-12-19 21:02:30',	'2020-03-12 21:01:24',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00783'),
(809,	'Soy cream',	NULL,	NULL,	NULL,	NULL,	'809.jpg',	'image/jpeg',	45680,	'2012-04-20 09:42:39',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-19 21:13:10',	'2020-03-12 21:01:29',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00784'),
(810,	'Ice cream cone',	NULL,	'An ice cream cone, poke or cornet is a dry, cone-shaped pastry, usually made of a wafer similar in texture to a waffle, allowing ice cream to be eaten without a bowl or spoon. Various types of ice-cream cones include waffle cones, cake cones (or wafer cones), pretzel cones, and sugar cones. [Wikipedia]',	NULL,	'Ice_cream_cone',	'810.jpg',	'image/jpeg',	27559,	'2012-04-20 09:35:51',	NULL,	'Baking goods',	'Wrappers',	'Type 2',	'2011-12-19 21:22:20',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00785'),
(811,	'Molasses',	NULL,	'Molasses is a viscous by-product of the processing of sugar cane, grapes or sugar beets into sugar. The quality of molasses depends on the maturity of the sugar cane or sugar beet, the amount of sugar extracted, and the method of extraction. Sweet sorghum syrup is known in some parts of the United States as molasses, though it is not true molasses. [Wikipedia]',	NULL,	'Molasses',	'811.jpg',	'image/jpeg',	60830,	'2012-04-20 09:32:29',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-19 21:29:19',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00786'),
(812,	'Cracker',	NULL,	'A cracker is a baked good typically made from grain flour dough and usually manufactured in large quantities. Crackers (equivalent to savory biscuits in the UK) are usually flat, crisp, small in size and are made in various shapes, though are commonly round or square. Flavorings or seasonings, such as salt, herbs, seeds, and/or cheese, may be added to the dough or sprinkled on top before baking. Crackers are eaten on their own, or can accompany other food items, such as cheese or meat slices, or dips. [Wikipedia]',	NULL,	'Cracker_(food)',	'812.jpg',	'image/jpeg',	94508,	'2012-04-20 09:37:25',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-19 21:31:48',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00787'),
(813,	'Nance',	'Byrsonima crassifolia',	'Nance (also called craboo, kraabu, Savanna Serrette and Golden Spoon) is a species native to tropical America. It is valued for its small, sweet, yellow fruit, which are strongly scented. The fruits are eaten raw or cooked as dessert. In rural Panama, the dessert prepared with the addition of sugar and flour, known as pesada de nance, is quite popular. The fruits are also made into dulce de nance, a candy prepared with the fruit cooked in sugar and water. In Nicaragua (where the fruit is called nancite), it is a popular ingredient for several desserts, including raspados (mixed with ice). The fruits are often used to prepare carbonated beverages, flavor mezcal-based liqueurs, or make an oily, acidic, fermented beverage known as chicha, the standard term applied to assorted beer-like drinks made of fruits or maize. Nance is used to distill a rum-like liquor called crema de nance in Costa Rica. Mexico produces a licor de nanche. [Wikipedia]',	'29263',	'Byrsonima_crassifolia',	'813.jpg',	'image/jpeg',	111137,	'2012-04-20 09:32:26',	NULL,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-12-19 21:44:22',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	4270,	1,	'FOOD00788'),
(814,	'Naranjilla',	'Solanum quitoense',	'Naranjilla in Ecuador or lulo in Colombia, is a subtropical perennial plant from northwestern South America. The fruit has a citrus flavour, sometimes described as a combination of rhubarb and lime. The juice of the naranjilla is green and is often used as a drink. [Wikipedia]',	'30475',	'Solanum_quitoense',	'814.jpg',	'image/jpeg',	98278,	'2012-04-20 09:39:06',	NULL,	'Fruits',	'Tropical fruits',	'Type 1',	'2011-12-19 21:52:37',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	227725,	1,	'FOOD00789'),
(815,	'Natto',	NULL,	'Natto is a traditional Japanese food made from soybeans fermented with Bacillus subtilis. It is popular especially as a breakfast food. As a rich source of protein and probiotics, natto and the soybean paste miso formed a vital source of nutrition in feudal Japan. Natto can be an acquired taste because of its powerful smell, strong flavor, and slippery texture. In Japan natto is most popular in the eastern regions, including Kanto, Tohoku, and Hokkaido. [Wikipedia]',	NULL,	'Natto',	'815.jpg',	'image/jpeg',	85558,	'2012-04-20 09:29:17',	NULL,	'Soy',	'Soy products',	'Type 2',	'2011-12-19 22:02:14',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00790'),
(816,	'Ravioli',	NULL,	'Ravioli are a traditional type of Italian filled pasta. They are composed of a filling sealed between two layers of thin egg pasta dough and are served either in broth or with a pasta sauce. [Wikipedia]',	NULL,	'Ravioli',	'816.jpg',	'image/jpeg',	118448,	'2012-04-20 09:43:20',	NULL,	'Dishes',	'Pasta dishes',	'Type 2',	'2011-12-19 22:10:03',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00791'),
(817,	'Scrapple',	NULL,	'Scrapple, also known by the Pennsylvania Dutch name pon haus, is traditionally a mush of pork scraps and trimmings combined with cornmeal and flour, often buckwheat flour, and spices. The mush is formed into a semi-solid congealed loaf, and slices of the scrapple are then panfried before serving. Scraps of meat left over from butchering, not used or sold elsewhere, were made into scrapple to avoid waste. Scrapple is best known as a rural American food of the Mid-Atlantic states (Delaware, Pennsylvania, New Jersey, and Maryland). Scrapple and pon haus are commonly considered an ethnic food of the Pennsylvania Dutch, including the Mennonites and Amish. [Wikipedia]',	NULL,	'Scrapple',	'817.jpg',	'image/jpeg',	51100,	'2012-04-20 09:40:32',	NULL,	'Dishes',	'American cuisine',	'Type 2',	'2011-12-19 22:19:04',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00792'),
(818,	'Other pasta dish',	NULL,	NULL,	NULL,	NULL,	'818.jpg',	'image/jpeg',	89213,	'2012-04-20 09:29:03',	NULL,	'Dishes',	'Pasta dishes',	'Type 2',	'2011-12-19 22:23:16',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00793'),
(819,	'Succotash',	NULL,	'Succotash is a food dish consisting primarily of corn and lima beans or other shell beans. Other ingredients may be added including tomatoes and green or sweet red peppers. Because of the relatively inexpensive and more readily available ingredients, the dish was popular during the Great Depression in the United States. It was sometimes cooked in a casserole form, often with a light pie crust on top as in a traditional pot pie. Succotash is a traditional dish of many Thanksgiving celebrations in New England as well as in Pennsylvania and other states. In some parts of the American South, any mixture of vegetables prepared with lima beans and topped with lard or butter is called succotash. [Wikipedia]',	NULL,	'Succotash',	'819.jpg',	'image/jpeg',	903077,	'2012-04-20 09:39:52',	NULL,	'Dishes',	'American cuisine',	'Type 2',	'2011-12-19 22:26:12',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00794'),
(820,	'Tamale',	NULL,	'A tamale is a traditional Latin American dish made of masa (a starchy dough, usually corn-based), which is steamed or boiled in a leaf wrapper. The wrapping is discarded before eating. Tamales can themselves be filled with meats, cheese, fruits, vegetables, chilies or any preparation according to taste, and both the filling and the cooking liquid may be seasoned. The diversity of native languages in Mesoamerica led to a number of local words for the tamal, many of which remain in use. [Wikipedia]',	NULL,	'Tamale',	'820.jpg',	'image/jpeg',	104901,	'2012-04-20 09:36:01',	NULL,	'Dishes',	'Latin American cuisine',	'Type 2',	'2011-12-19 22:30:31',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00795'),
(822,	'Rice cake',	NULL,	'A rice cake may be any kind of food item made from rice that has been shaped, condensed, or otherwise combined into a single object. A wide variety of rice cakes exist in many different cultures in which rice is eaten, and are particularly prevalent in Asia. Common variations include cakes make with rice flour, those made from ground rice, and those made from whole grains of rice compressed together or combined with some other binding substance. [Wikipedia]',	NULL,	'Rice_cake',	'822.jpg',	'image/jpeg',	290643,	'2012-04-20 09:42:56',	NULL,	'Dishes',	'Asian cuisine',	'Type 2',	'2011-12-19 23:01:45',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00796'),
(823,	'Tree fern',	'Cyathea',	'The order Cyatheales, which includes the tree ferns, is a taxonomic division of the fern class, Polypodiopsida. No clear morphological features characterize all of the Cyatheales, but DNA sequence data indicate the order is monophyletic. Some species in the Cyatheales have tree-like growth forms, but others have creeping rhizomes (stems). Some species have scales on the stems and leaves, while others have hairs. However, most plants in the Cyatheales are tree ferns and have trunk-like stems up to 20 metres (66 ft) tall. It is unclear how many times the tree form has evolved and been lost in the order.',	'17937',	'Cyatheales',	'823.jpg',	'image/jpeg',	125837,	'2012-04-20 09:36:00',	NULL,	'Vegetables',	'Other vegetables',	'Type 1',	'2011-12-19 23:09:02',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00797'),
(824,	'Evaporated milk',	NULL,	'Evaporated milk, also known as dehydrated milk, is a shelf-stable canned milk product with about 60% of the water removed from fresh milk. It differs from sweetened condensed milk, which contains added sugar. Sweetened condensed milk requires less processing since the added sugar inhibits bacterial growth. Evaporated milk should not be confused with condensed milk, dry milk, or powdered milk. [Wikipedia]',	NULL,	'Evaporated_milk',	'824.jpg',	'image/jpeg',	54919,	'2012-04-20 09:42:54',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-19 23:27:37',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00798'),
(825,	'Flour',	NULL,	'Flour is a powder which is made by grinding cereal grains, other seeds, or roots (like Cassava). It is the main ingredient of bread, which is a staple food for many cultures, making the availability of adequate supplies of flour a major economic and political issue at various times throughout history. Wheat flour is one of the most important foods in European, North American, Middle Eastern and North African cultures, and is the defining ingredient in most of their styles of breads and pastries. Maize flour has been important in Mesoamerican cuisine since ancient times, and remains a staple in much of Latin American cuisine. Rye flour is an important constituent of bread in much of central/northern Europe. [Wikipedia]',	NULL,	'Flour',	'825.jpg',	'image/jpeg',	77258,	'2012-04-20 09:43:55',	NULL,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-12-19 23:59:48',	'2019-05-14 18:05:32',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00799'),
(826,	'Akutaq',	NULL,	'Akutaq or agutak, also known as Eskimo ice cream, is a common food in western Alaska, consisting of whipped fat mixed with berries, with optional additions such as fish and sugar. The word comes from Yupik and means \"something mixed\". There are many variations of Akutaq, but most are based around mixing berries, meat, leaves, or roots with animal oil or fat (these are now often replaced by Crisco). Cranberries, salmonberries, crowberries, cloudberries, and blueberries are common fruits. Salmon and caribou are common meats. Reindeer tallow, moose tallow, walrus tallow, caribou tallow, or seal oil can be used. Sugar is sometimes added (although not traditionally). Occasionally, extra water is needed as well. [Wikipedia]',	NULL,	'Akutaq',	'826.jpg',	'image/jpeg',	135264,	'2012-04-20 09:39:48',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-20 00:06:50',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00800'),
(828,	'Dough',	NULL,	'Dough is a paste made out of any cereals (grains) or leguminous crops by mixing flour with a small amount of water and/or other liquid. This process is a precursor to making a wide variety of foodstuffs, particularly breads and bread-based items (e.g., crusts, dumplings), flatbreads, noodles, pastry, and similar items). This includes all kinds of breads or similar recipes made from maize, rice, sorghum, wheat, and other cereals or related crops used around the world. [Wikipedia]',	NULL,	'Dough',	'828.jpg',	'image/jpeg',	72052,	'2012-04-20 09:38:35',	NULL,	'Cereals and cereal products',	'Doughs',	'Type 2',	'2011-12-20 17:12:38',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00801'),
(829,	'Pita bread',	NULL,	'Pita or pitta is a round pocket bread widely consumed in many Middle Eastern, Mediterranean, and Balkan cuisines. It is prevalent in Greece, the Balkans the Levant, the Arabian Peninsula and Turkey. The \"pocket\" in pita bread is created by steam, which puffs up the dough. As the bread cools and flattens, a pocket is left in the middle. Pita is used to scoop sauces or dips such as hummus and to wrap kebabs, gyros or falafel in the manner of sandwiches. Much of pita\'s popularity in the Western world since the 1970s is due to expanded use of the pocket for a type of sandwich. Instead of using pita to scoop foods, people fill the pocket with various ingredients to form a sandwich. [Wikipedia]',	NULL,	'Pita_bread',	'829.jpg',	'image/jpeg',	93898,	'2012-04-20 09:37:47',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-20 17:24:04',	'2020-03-12 21:01:33',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00802'),
(830,	'Focaccia',	NULL,	'Focaccia is a flat oven-baked Italian bread, which may be topped with herbs or other ingredients. It is related to pizza, but not considered to be the same. Focaccia is popular in Italy and is usually seasoned with olive oil and salt, and sometimes herbs, and may be topped with onion, cheese and meat, or flavored with a number of vegetables. [Wikipedia]',	NULL,	'Focaccia',	'830.jpg',	'image/jpeg',	1470501,	'2012-04-20 09:41:05',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-20 17:28:14',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00803'),
(831,	'Bagel',	NULL,	'A bagel is a bread product, traditionally shaped by hand into the form of a ring from yeasted wheat dough, roughly hand-sized, which is first boiled for a short time in water and then baked. The result is a dense, chewy, doughy interior with a browned and sometimes crisp exterior. Bagels are often topped with seeds baked on the outer crust, with the traditional ones being poppy or sesame seeds. Some also may have salt sprinkled on their surface, and there are also a number of different dough types such as whole-grain or rye. [Wikipedia]',	NULL,	'Bagel',	'831.jpg',	'image/jpeg',	8045,	'2012-04-20 09:29:41',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 17:31:12',	'2020-03-12 21:02:07',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00804'),
(832,	'Other bread product',	NULL,	NULL,	NULL,	NULL,	'832.jpg',	'image/jpeg',	1978370,	'2012-04-20 09:43:45',	NULL,	'Cereals and cereal products',	'Bread products',	'Type 2',	'2011-12-20 18:04:17',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00805'),
(834,	'Piki bread',	NULL,	'Piki (or piki bread) is a rolled bread made by the Hopi with nixtamalized corn meal. Blue corn and culinary ash give it a dark grayish-blue color. The light, thin sheets are dry to the point of brittleness and have a delicate corn flavor. It is considered the Hopi version of the tortilla. [Wikipedia]',	NULL,	'Piki',	'834.jpg',	'image/jpeg',	14039,	'2012-04-20 09:31:18',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-20 18:19:12',	'2020-03-12 21:01:35',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00806'),
(835,	'French toast',	NULL,	'French toast or eggy bread is a dish of bread soaked in eggs then fried. Where French toast is served as a sweet dish, milk, sugar, or cinnamon are also commonly added before frying, and it may be then topped with sugar, butter, fruit, syrup, or other items. Where it is a savory dish, it is generally fried with a pinch of salt, and then served with a sauce such as ketchup or mayonnaise. [Wikipedia]',	NULL,	'French_toast',	'835.jpg',	'image/jpeg',	39581,	'2012-04-20 09:43:35',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 18:26:09',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00807'),
(836,	'Wheat bread',	NULL,	'Brown bread is a designation often given to breads made with significant amounts of whole grain flour, usually rye or wheat, and sometimes dark-coloured ingredients such as molasses or coffee. In Canada and the United Kingdom it simply refers to whole wheat bread, except in the Maritimes, where it implies a bread made with molasses.\nWhole wheat flours that contain raw wheat germ, instead of toasted germ, have higher levels of glutathione, and thus are said to result in lower loaf volumes.',	NULL,	'Wheat_bread',	'836.jpg',	'image/jpeg',	52290,	'2012-04-20 09:43:44',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 20:35:18',	'2020-03-12 21:01:42',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00808'),
(837,	'Rye bread',	NULL,	'Rye bread is a type of bread made with various percentages of flour from rye grain. It can be light or dark in color, depending on the type of flour used and the addition of coloring agents, and is typically denser than bread made from wheat flour. It is higher in fiber than many common types of bread and is often darker in color and stronger in flavor. [Wikipedia]',	NULL,	'Rye_bread',	'837.jpg',	'image/jpeg',	76755,	'2012-04-20 09:29:14',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 20:36:59',	'2020-01-24 17:10:08',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00809'),
(838,	'Oat bread',	'',	'Oat bread was first manufactured in Britain, where the first oat bread factory was established in 1899. In Scotland, they were, and still are, held in high esteem, as a mainstay of the national diet. (Wikipedia)',	'',	'',	'838.jpg',	'image/jpeg',	88321,	'2012-04-20 09:42:52',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 20:38:27',	'2020-03-12 21:01:40',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00810'),
(839,	'Potato bread',	NULL,	'Potato bread is a form of bread in which potato replaces a portion of the regular wheat flour. It is cooked in a variety of methods, including by baking it on a hot griddle or pan, or in an oven. It may be leavened or unleavened, and may have a variety of other ingredients baked into it. The ratio of potato to wheat flour varies significantly from recipe to recipe, with some recipes having a majority of potato, and others having a majority of wheat flour. Some recipes call for mashed potatoes, with others calling for dehydrated potato flakes. It is available as a commercial product in many countries, with similar variations in ingredients, cooking method, and other variables. [Wikipedia]',	NULL,	'Potato_bread',	'839.jpg',	'image/jpeg',	125545,	'2012-04-20 09:39:21',	NULL,	'Cereals and cereal products',	'Other breads',	'Type 2',	'2011-12-20 20:42:45',	'2020-03-12 21:01:37',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00811'),
(840,	'Cornbread',	NULL,	'Cornbread is a generic name for any number of quick breads containing cornmeal and leavened by baking powder. Cornbread is a popular item in soul food enjoyed by many people for its texture and scent. Cornbread can be baked, fried or, rarely, steamed. Steamed cornbreads are mushy, chewier and more like cornmeal pudding than what most consider to be traditional cornbread. Cornbread can also be baked into corn cakes. [Wikipedia]',	NULL,	'Cornbread',	'840.jpg',	'image/jpeg',	58269,	'2012-04-20 09:37:33',	NULL,	'Cereals and cereal products',	'Flat breads',	'Type 2',	'2011-12-20 20:58:52',	'2020-03-12 21:01:38',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00812'),
(841,	'Corn grits',	NULL,	'Grits are a food of American Indian origin common in the Southern United States and mainly eaten at breakfast. They consist of coarsely ground corn, or sometimes alkali-treated corn (hominy). They are also sometimes called sofkee or sofkey from the Muskogee (Creek) language word. Grits are similar to other thick maize-based porridges from around the world, such as polenta, or the thinner farina. [Wikipedia]',	NULL,	'Grits',	'841.jpg',	'image/jpeg',	7516,	'2012-04-20 09:42:55',	NULL,	'Cereals and cereal products',	'Cereal products',	'Type 2',	'2011-12-20 21:12:47',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00813'),
(842,	'Multigrain bread',	NULL,	NULL,	NULL,	NULL,	'842.jpg',	'image/jpeg',	127162,	'2012-04-20 09:43:42',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 21:15:47',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00814'),
(843,	'Rice bread',	NULL,	'Rice bread is a type of bread that is made from rice flour rather than wheat flour. Being gluten free it will not cause adverse reactions for people with gluten intolerance. [Wikipedia]',	NULL,	'Rice_bread',	'843.jpg',	'image/jpeg',	71599,	'2012-04-20 09:30:26',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 21:18:59',	'2020-03-12 21:01:54',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00815'),
(844,	'Pan dulce',	NULL,	'Pan dulce is a staple food in Mexico and other Latin American countries. It is eaten at Christmas time. Its main ingredients can include lard, margarine, sugar, self-raising flour, blanched almonds, raisins, sultanas, pine nuts, candied peel, eggs, aniseed and anisette among others. It is sometimes decorated with hundreds and thousands just like the bollo de hornasso. [Wikipedia]',	NULL,	'Gibraltarian_cuisine#Pan_dulce',	'844.jpg',	'image/jpeg',	131652,	'2012-04-20 09:37:39',	NULL,	'Cereals and cereal products',	'Leavened breads',	'Type 2',	'2011-12-20 21:24:29',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00816'),
(845,	'Raisin bread',	NULL,	'Raisin bread is a bread that contains raisins. It is often classified as a sweet bread and is sometimes combined with cinnamon sugar. Served toasted or as a dessert, the bread is commonly found in the United States, Northern Europe, Germany and Australia, where it is served toasted for breakfast. [Wikipedia]',	NULL,	'Raisin_bread',	'845.jpg',	'image/jpeg',	109998,	'2012-04-20 09:30:45',	NULL,	'Cereals and cereal products',	'Sweet breads',	'Type 2',	'2011-12-20 21:33:50',	'2020-03-12 21:01:56',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00817'),
(846,	'Wonton wrapper',	NULL,	NULL,	NULL,	NULL,	'846.jpg',	'image/jpeg',	56056,	'2012-04-20 09:44:23',	NULL,	'Baking goods',	'Wrappers',	'Type 2',	'2011-12-20 22:08:05',	'2020-03-12 21:00:20',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00818'),
(848,	'Trail mix',	NULL,	'Trail mix is a combination of dried fruit, grains, nuts, and sometimes chocolate, developed as a snack food to be taken along on outdoor hikes. Trail mix is considered an ideal snack food for hikes, because it is tasty, lightweight, easy to store, and nutritious, providing a quick boost from the carbohydrates in the dried fruit and/or granola, and sustained energy from the mono- and polyunsaturated fats in nuts. [Wikipedia]',	NULL,	'Trail_mix',	'848.jpg',	'image/jpeg',	128858,	'2012-04-20 09:39:19',	NULL,	'Snack foods',	'Snack foods',	'Type 2',	'2011-12-20 22:17:56',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00819'),
(849,	'Greenthread tea',	'Thelesperma',	'Thelesperma is a genus of flowering plants within the sunflower family used by a number of the southwestern Native American tribes as a tea, as such it is sometimes called \"Navajo Tea,\" \"Hopi Tea,\" etc. Greenthread is a common name for plants in this genus. Thelesperma species are native to western North America, South America, and Mexico. [Wikipedia] ',	'38517',	'Thelesperma',	'849.jpg',	'image/jpeg',	34319,	'2012-04-20 09:42:08',	NULL,	'Teas',	'Herbal teas',	'Type 1',	'2011-12-20 23:26:51',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	153159,	1,	'FOOD00820'),
(850,	'Fruit-flavor drink',	NULL,	NULL,	NULL,	NULL,	'850.jpg',	'image/jpeg',	39730,	'2012-04-20 09:36:51',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-20 23:40:06',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00821'),
(851,	'Vegetable juice',	NULL,	'Vegetable juice is a drink made primarily of blended vegetables. Vegetable juice is often mixed with fruits such as tomatoes or grapes to improve flavor. It is often touted as a low-sugar alternative to fruit juice, although some commercial brands of vegetable juices use fruit juices as sweeteners, and may contain large amounts of sodium.',	NULL,	'Vegetable juice',	'851.jpg',	'image/jpeg',	134878,	'2012-04-20 09:32:02',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-21 00:03:05',	'2019-05-14 18:05:33',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00822'),
(852,	'Horchata',	NULL,	'Horchata is the name of several kinds of traditional beverages, made of ground almonds, sesame seeds, rice, barley, or tigernuts (chufas). [Wikipedia]',	NULL,	'Horchata',	'852.jpg',	'image/jpeg',	69507,	'2012-04-20 09:39:42',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-21 00:07:18',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00823'),
(853,	'Soft drink',	NULL,	'A soft drink (also called a soda, pop, coke, soda pop, fizzy drink, tonic, or carbonated beverage) is a non-alcoholic beverage that typically contains water (often, but not always carbonated water), a sweetener, and a flavoring agent. The sweetener may be sugar, high-fructose corn syrup, or a sugar substitute (in the case of diet drinks). A soft drink may also contain caffeine, fruit juice, or both. Widely sold soft drink flavors are cola, lemon-lime, root beer, orange, grape, vanilla, ginger ale, fruit punch, and sparkling lemonade. Soft drinks may be served chilled or at room temperature. They are rarely heated. [Wikipedia]',	NULL,	'Soft_drink',	'853.jpg',	'image/jpeg',	22832,	'2012-04-20 09:33:45',	NULL,	'Beverages',	'Other beverages',	'Type 2',	'2011-12-21 00:10:20',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00824'),
(854,	'Frozen yogurt',	NULL,	'Frozen yogurt (also known as frozen yoghurt or by the tradenames FroYo and Frogurt) is a frozen dessert containing yogurt or other dairy products. It is slightly more tart than ice cream, as well as lower in fat (due to the use of milk instead of cream). Frozen yogurt usually consists of milk solids, some kind of sweetener, milk fat, yogurt culture, coloring, and flavoring. Frozen yogurt has come to be used much like ice cream, and is served in a wide variety of flavors and styles. [Wikipedia]',	NULL,	'Frozen_yogurt',	'854.jpg',	'image/jpeg',	34879,	'2012-04-20 09:43:53',	NULL,	'Confectioneries',	'Frozen desserts',	'Type 2',	'2011-12-21 00:30:57',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00825'),
(855,	'Milkshake',	NULL,	'A milkshake is a sweet, cold beverage which is made from milk, ice cream or iced milk, and flavorings or sweeteners such as fruit syrup or chocolate sauce. Outside the United States, the drink is sometimes called a thick shake or a thick milkshake, to differentiate it from other less-viscous forms of flavored milk. [Wikipedia]',	NULL,	'Milkshake',	'855.jpg',	'image/jpeg',	27090,	'2012-04-20 09:33:56',	NULL,	'Confectioneries',	'Frozen desserts',	'Type 2',	'2011-12-21 00:44:39',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00826'),
(856,	'Chocolate mousse',	NULL,	'A mousse is a prepared food that incorporates air bubbles to give it a light and airy texture. It can range from light and fluffy to creamy and thick, depending on preparation techniques. A mousse may be sweet or savory. Dessert mousses are typically made with whipped egg whites or whipped cream, and generally flavored with chocolate or puréed fruit. For savory mousse, hard boiled egg, fish or liver may be used.',	NULL,	'Mousse',	'856.jpg',	'image/jpeg',	36326,	'2012-04-20 09:44:05',	NULL,	'Confectioneries',	'Desserts',	'Type 2',	'2011-12-21 01:01:29',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00827'),
(857,	'Dripping',	NULL,	'Dripping, also known usually as beef dripping or more rarely as pork dripping, is an animal fat produced from the fatty or otherwise unusable parts of cow or pig carcasses. It is similar to lard and tallow although tallow is an unacceptable flavor for shortening or cooking generally. It is used for cooking, especially in British cuisine, significantly so in Northern England, though towards the end of the 20th century dripping fell out of favor due to it being regarded as less healthy than vegetable oils such as olive or sunflower. [Wikipedia]',	NULL,	'Dripping',	'857.jpg',	'image/jpeg',	21805,	'2012-04-20 09:36:35',	NULL,	'Fats and oils',	'Animal fats',	'Type 2',	'2011-12-21 01:10:21',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00828'),
(858,	'Pupusa',	NULL,	'A pupusa (from Pipil pupusaw) is a traditional Salvadoran dish made of thick, hand-made corn tortilla that is usually filled with a blend of the following: cheese, cooked pork meat ground to a paste consistency, refried beans, or queso con loroco (loroco is a vine flower bud from Central America). Pupusas are typically served with curtido (lightly fermented cabbage slaw with red chilies and vinegar) and a watery tomato salsa. [Wikipedia]',	NULL,	'Pupusa',	'858.jpg',	'image/jpeg',	58593,	'2012-04-20 09:35:46',	NULL,	'Dishes',	'Latin American cuisine',	'Type 2',	'2011-12-21 01:36:53',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00829'),
(859,	'Empanada',	NULL,	'An empanada is a stuffed bread or pastry baked or fried in many countries in Latin America, Southern Europe and parts of Southeast Asia. The name comes from the verb empanar, meaning to wrap or coat in bread. Empanada is made by folding a dough or bread patty around the stuffing. The stuffing can consist of a variety of meats, cheese, huitlacoche, vegetables or fruits among others. [Wikipedia]',	NULL,	'Empanada',	'859.jpg',	'image/jpeg',	56332,	'2012-04-20 09:30:50',	NULL,	'Dishes',	'Latin American cuisine',	'Type 2',	'2011-12-21 01:40:47',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00830'),
(860,	'Arepa',	NULL,	'An arepa is a dish made of ground corn dough or cooked flour, popular in Colombia, Venezuela and other Spanish-speaking countries. It is similar in shape to the Salvadoran pupusa. Arepas can also be found in Panama, Puerto Rico and the Canary Islands. [Wikipedia]',	NULL,	'Arepa',	'860.jpg',	'image/jpeg',	97920,	'2012-04-20 09:42:19',	NULL,	'Dishes',	'Latin American cuisine',	'Type 2',	'2011-12-21 01:43:07',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00831'),
(861,	'Ascidians',	'Ascidiacea',	'Ascidiacea (commonly known as the ascidians or sea squirts) is a class in the Tunicata subphylum of sac-like marine invertebrate filter feeders. Ascidians are characterized by a tough outer \"tunic\" made of the polysaccharide tunicin, as compared to other tunicates which are less rigid.\nAscidians are found all over the world, usually in shallow water with salinities over 2.5%. While members of the Thaliacea and Larvacea swim freely like plankton, sea squirts are sessile animals: they remain firmly attached to substratum, such as rocks and shells.\nThere are 2,300 species of ascidians and three main types: solitary ascidians, social ascidians that form clumped communities by attaching at their bases, and compound ascidians that consist of many small individuals (each individual is called a zooid) forming colonies up to several meters in diameter.\nSea squirts feed by taking in water through the oral siphon. The water enters the mouth and pharynx, flows through mucus-covered gill slits (also called pharyngeal stigmata) into a water chamber called the atrium, then exits through the atrial siphon.',	'158854',	'Ascidiacea',	'861.jpg',	'image/jpeg',	210689,	'2012-04-20 09:32:18',	NULL,	'Aquatic foods',	'Other aquatic foods',	'Type 2',	'2011-12-21 01:50:02',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	7713,	0,	'FOOD00832'),
(862,	'Gefilte fish',	NULL,	'Gefilte fish is a Ashkenazi Jewish dish made from a poached mixture of ground deboned fish, such as carp, whitefish and/or pike, which is typically eaten as an appetizer. [Wikipedia]',	NULL,	'Gefilte_fish',	'862.jpg',	'image/jpeg',	92690,	'2012-04-20 09:38:57',	NULL,	'Dishes',	'Jewish cuisine',	'Type 2',	'2011-12-21 01:53:28',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00833'),
(863,	'Yellow pond-lily',	'Nuphar lutea',	'Yellow pond-lily is an aquatic plant of the family Nymphaeaceae, native to temperate regions of Europe, northwest Africa, and western Asia. This aquatic plant grows in shallow water and wetlands, with its roots in the sediment and its leaves floating on the water surface; it can grow in water up to 5 metres deep. It is usually found in shallower water than the white water lily, and often in beaver ponds. [Wikipedia]',	'503968',	'Nuphar_lutea',	'863.jpg',	'image/jpeg',	97342,	'2012-04-20 09:39:27',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2011-12-21 01:58:50',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	77113,	1,	'FOOD00834'),
(864,	'Fish burger',	NULL,	NULL,	NULL,	'Filet-O-Fish',	'864.jpg',	'image/jpeg',	113035,	'2012-04-20 09:29:40',	NULL,	'Dishes',	'Sandwiches',	'Type 2',	'2011-12-21 02:03:28',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00835'),
(865,	'Other dish',	NULL,	NULL,	NULL,	NULL,	'865.jpg',	'image/jpeg',	153866,	'2012-04-20 09:35:53',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-21 02:21:44',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00836'),
(866,	'Pot pie',	NULL,	'A pot pie is a type of baked savory pie with a bottom and top completely encased by flaky crusts and baked inside a pie tin to support its shape. An American pot pie typically has a filling of meat (particularly beef, chicken or turkey), gravy, and mixed vegetables (potatoes, carrots, green beans and peas). Frozen pot pies are often available in individual serving size. [Wikipedia]',	NULL,	'Pot_pie',	'866.jpg',	'image/jpeg',	72437,	'2012-04-20 09:44:06',	NULL,	'Dishes',	'Other dishes',	'Type 2',	'2011-12-21 02:23:44',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00837'),
(867,	'Stuffing',	NULL,	'In cooking, stuffing or filling (specifically for poultry) is an edible substance or mixture, often a starch, used to fill a cavity in another food item. Many foods may be stuffed, including meats, vegetables, egg, and fruits. Turkey stuffing usually consists of bread crumbs or cubes, dried bread, with onion, celery, salt, pepper, and other spices and herbs such as summer savoury, sage, or a mixture like poultry seasoning. [Wikipedia]',	NULL,	'Stuffing',	'867.jpg',	'image/jpeg',	78211,	'2012-04-20 09:39:20',	NULL,	'Baking goods',	'Baking goods',	'Type 2',	'2011-12-21 02:37:46',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00838'),
(868,	'Edible shell',	NULL,	NULL,	NULL,	NULL,	'868.jpg',	'image/jpeg',	51634,	'2012-04-20 09:39:05',	NULL,	'Baking goods',	'Wrappers',	'Type 2',	'2011-12-21 02:40:48',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00839'),
(869,	'Fudge',	NULL,	'Fudge is a type of Western confectionery which is usually very sweet, and extremely rich. It is made by mixing sugar, butter, and milk and heating it to the soft-ball stage at 240 °F (116 °C), and then beating the mixture while it cools so that it acquires a smooth, creamy consistency. Many variations with other flavourings added are possible. [Wikipedia]',	NULL,	'Fudge',	'869.jpg',	'image/jpeg',	131762,	'2012-04-20 09:34:17',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-22 17:16:07',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00840'),
(870,	'Candy bar',	NULL,	'A candy bar (called a chocolate bar in Australian English, British English, Canadian English, Indian English, Irish English, New Zealand English and South African English) is a form of confectionery usually packaged in a bar or log form, often coated with chocolate, and sized as a snack for one person. But within that term, a wide variety of products exists, ranging from solid chocolate bars to multiple layerings or mixtures of ingredients such as nuts, fruit, caramel or fondant containing no chocolate. [Wikipedia]',	NULL,	'Chocolate_bar',	'870.jpg',	'image/jpeg',	37059,	'2012-04-20 09:40:24',	NULL,	'Confectioneries',	'Candies',	'Type 2',	'2011-12-22 17:19:13',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00841'),
(871,	'Condensed milk',	NULL,	'Condensed milk is cow\'s milk from which water has been removed. It is most often found in the form of sweetened condensed milk, with sugar added, and the two terms \'condensed milk\' and \'sweetened condensed milk\' are often used synonymously. Condensed milk is used in numerous dessert dishes in many countries. A related product is evaporated milk, which has undergone a more complex process and which is not sweetened. [Wikipedia]',	NULL,	'Condensed_milk',	'871.jpg',	'image/jpeg',	29385,	'2012-04-20 09:30:31',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2011-12-22 19:16:21',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00842'),
(872,	'Margarine',	NULL,	'Margarine can indicate any of a wide range of butter or butter substitutes, typically composed of vegetable oils. Specifically the principle difference between butter and margarine is that butter is derived from animal fats (typically milk fats) while margarine is derived from plant fats (oils) and skim milk. [Wikipedia]',	NULL,	'Margarine',	'872.jpg',	'image/jpeg',	44069,	'2012-04-20 09:32:06',	NULL,	'Fats and oils',	'Vegetable fats',	'Type 2',	'2011-12-22 19:24:42',	'2019-05-14 18:05:34',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00843'),
(873,	'Margarine-like spread',	NULL,	NULL,	NULL,	NULL,	'873.jpg',	'image/jpeg',	42021,	'2012-04-20 09:43:45',	NULL,	'Fats and oils',	'Vegetable fats',	'Type 2',	'2011-12-22 20:08:42',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	NULL,	1,	'FOOD00844'),
(874,	'Hummus',	NULL,	'Hummus is a Levantine Arab food dip or spread made from cooked, mashed chickpeas, blended with tahini, olive oil, lemon juice, salt and garlic. Hummus is high in iron and vitamin C and also has significant amounts of folate and vitamin B6. The chickpeas make it a good source of protein and dietary fiber; the tahini consists mostly of sesame seeds, which are an excellent source of the amino acid methionine, complementing the proteins in the chickpeas. [Wikipedia]',	NULL,	'Hummus',	'874.jpg',	'image/jpeg',	359425,	'2012-04-20 09:43:39',	NULL,	'Dishes',	'Levantine cuisine',	'Type 2',	'2011-12-22 20:24:32',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00845'),
(876,	'Potato puffs',	NULL,	NULL,	NULL,	NULL,	'876.jpg',	'image/jpeg',	21111,	'2012-04-20 09:44:18',	NULL,	'Dishes',	'Potato dishes',	'Type 2',	'2011-12-22 22:10:27',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00846'),
(877,	'Potato gratin',	NULL,	'Gratin is a widespread culinary technique in food preparation in which an ingredient is topped with a browned crust, often using breadcrumbs, grated cheese, egg and/or butter. Gratin originated in French cuisine and is usually prepared in a shallow dish of some kind. A gratin is baked or cooked under an overhead grill or broiler to form a golden crust on top and is traditionally served in its baking dish. A gratin dish refers to the shallow oven-proof container traditionally used to prepare gratins and similar dishes.',	NULL,	'Gratin',	'877.jpg',	'image/jpeg',	97519,	'2012-04-20 09:33:53',	NULL,	'Dishes',	'Potato dishes',	'Type 2',	'2011-12-22 22:11:44',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00847'),
(878,	'Milk substitute',	NULL,	'A milk substitute is a liquid that replaces milk in a diet or recipe. This overlaps with but is distinct from the group of milk-like liquids called \"milks\" because of their similarity to the liquid produced by mammary glands.\nLactose intolerance or a milk allergy can prompt the use of milk substitutes; they are also commonly consumed by vegans. Some milk substitutes are marketed to consumers as being more healthy than cow\'s milk, by being lower in saturated fat and for not containing cholesterol. When milk substitutes are lacking in vitamins or dietary minerals present in milk (such as vitamin B12 or calcium), they are sometimes fortified.\nThe two most common categories of milk substitutes are grain milk and plant milk. The most common grain milk is rice milk, while the most common plant milk is soy milk. Other examples include hemp milk, coconut milk, almond milk, and peanut milk. Gluten-Free Milk substitutes are also available.',	NULL,	'Milk_substitute',	'878.jpg',	'image/jpeg',	42023,	'2012-04-20 09:34:20',	NULL,	'Baking goods',	'Substitutes',	'Type 2',	'2011-12-22 22:26:59',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	NULL,	0,	'FOOD00848'),
(879,	'Pepper (C. pubescens)',	'Capsicum pubescens',	'Capsicum pubescens is a species of the genus Capsicum (pepper), which is found primarily in Central and South America. The plants, but especially the fruits, are often referred to as \"rocoto\":http://en.wikipedia.org/wiki/Rocoto and locoto. As they reach a relatively advanced age and the roots lignify quickly, sometimes the familiar name is tree chili. Of all the domesticated species of peppers, this is the least widespread and systematically furthest away from all others. [Wikipedia]\r\n\r\nSee a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'505855',	'Capsicum_pubescens',	'879.jpg',	'image/jpeg',	85215,	'2012-04-20 09:38:16',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2012-01-10 02:28:37',	'2019-05-14 18:05:35',	2,	2,	0,	'specific',	113210,	1,	'FOOD00849'),
(880,	'Soft-necked garlic',	'Allium sativum L. var. sativum',	'Soft-necked garlic is one of the most commonly found subspecies of garlic. Soft-necked garlic includes artichoke garlic, silverskin garlic, and creole garlic. [Wikipedia]',	NULL,	'Garlic',	'Soft-necked_garlic.png',	'image/png',	28914,	'2020-04-17 16:22:42',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2012-09-05 12:56:59',	'2020-04-17 16:22:43',	2,	2,	0,	'specific',	4682,	1,	'FOOD00850'),
(881,	'Cabbage',	'Brassica oleracea var. capitata',	'Cabbage (Brassica oleracea or variants) is a leafy green biennial, grown as an annual vegetable for its dense-leaved heads. Closely related to other cole crops, such as broccoli, cauliflower and brussels sprouts, it descends from B.  oleracea var. oleracea, a wild field cabbage. Cabbage heads generally range from 1 to 8 pounds (to kg), and can be green, purple and white. Smooth-leafed firm-headed green cabbages are the most common, with smooth-leafed red and crinkle-leafed savoy cabbages of both colors seen more rarely. It is difficult to trace the exact history of cabbage, but it was most likely domesticated somewhere in Europe before 1000 BC. By the Middle Ages it was a prominent part of European cuisine, although savoys were not developed until the 16th century. Cabbage heads are generally picked during the first year of the plants\' life cycles, but those intended for seed are allowed to grow a second year, and must be kept separated from other cole crops to prevent cross pollination. Cabbage is prone to several nutrient deficiencies, as well as multiple pests, bacteria and fungal diseases. The Food and Agriculture Organization of the United Nations (FAO) reports that world production of cabbage and other brassicas (these plants are combined by the FAO for reporting purposes) for calendar year 2010 was almost 58,000,000 metric tons . Almost half were grown in China. Cabbages are prepared in many different ways for eating, although pickling, in dishes such as sauerkraut, is the most popular. Cabbage is a good source of beta-carotene, vitamin C and fiber. Cabbage when contaminated is sometimes a source of food-borne illness in humans.',	'526962',	'Cabbage',	'Cabbage.jpg',	'image/jpeg',	2217174,	'2020-04-17 16:22:43',	NULL,	'Vegetables',	'Cabbages',	'Type 1',	'2012-09-05 15:25:14',	'2020-04-17 16:22:45',	2,	2,	0,	'specific',	3716,	1,	'FOOD00851'),
(882,	'Chinese bayberry',	'Myrica rubra',	'Myrica rubra, also called yangmei, yamamomo, Chinese Bayberry, Japanese Bayberry, Red Bayberry, Yumberry, Waxberry, or Chinese strawberry tree (and often mistranslated from Chinese as arbutus) is a subtropical tree grown for its sweet, crimson to dark purple-red, edible fruit.',	'845180',	'Myrica rubra',	'Yangmei.jpg',	'image/jpeg',	2062000,	'2012-09-06 00:54:35',	NULL,	'Fruits',	'Berries',	'Type 1',	'2012-09-06 07:51:37',	'2019-05-17 16:19:46',	2,	2,	0,	'specific',	262757,	1,	'FOOD00852'),
(883,	'Mushrooms',	NULL,	'A mushroom (or toadstool) is the fleshy, spore-bearing fruiting body of a fungus, typically produced above ground on soil or on its food source. The standard for the name \"mushroom\" is the cultivated white button mushroom, Agaricus bisporus; hence the word \"mushroom\" is most often applied to those fungi (Basidiomycota, Agaricomycetes) that have a stem (stipe), a cap (pileus), and gills (lamellae, sing. lamella) or pores on the underside of the cap. These pores or gills produce microscopic spores that help the fungus spread across the ground or its occupant surface.\n\"Mushroom\" describes a variety of gilled fungi, with or without stems, and the term is used even more generally, to describe both the fleshy fruiting bodies of some Ascomycota and the woody or leathery fruiting bodies of some Basidiomycota, depending upon the context of the word.\nForms deviating from the standard morphology usually have more specific names, such as \"puffball\", \"stinkhorn\", and \"morel\", and gilled mushrooms themselves are often called \"agarics\" in reference to their similarity to Agaricus or their place Agaricales. By extension, the term \"mushroom\" can also designate the entire fungus when in culture; the thallus (called a mycelium) of species forming the fruiting bodies called mushrooms; or the species itself.',	NULL,	'Mushrooms',	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Mushrooms',	'Unknown',	'2012-09-11 14:51:43',	'2019-12-11 19:38:40',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00853'),
(884,	'Alcoholic beverages',	NULL,	'An alcoholic beverage is a drink that typically contains 3% ? 40% ethanol (commonly called alcohol). Alcoholic beverages are divided into three classes: beers, wines, and spirits (distilled beverages). They are legally consumed in most countries around the world. More than 100 countries have laws regulating their production, sale, and consumption.',	NULL,	'Alcoholic_beverages',	NULL,	NULL,	NULL,	NULL,	NULL,	'Beverages',	'Alcoholic beverages',	'Unknown',	'2012-09-11 14:54:38',	'2019-12-11 19:38:46',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00854'),
(885,	'Onion-family vegetables',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Onion-family vegetables',	'Unknown',	'2012-09-11 14:56:18',	'2019-12-11 19:38:51',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00855'),
(886,	'Pomes',	NULL,	'In botany, a pome (after the Latin word for fruit: p?mum) is a type of fruit produced by flowering plants in the subtribe Malinae of the family Rosaceae.\nA pome is an accessory fruit composed of one or more carpels surrounded by accessory tissue. The accessory tissue is interpreted by some specialists as an extension of the receptacle and is then referred to as \"fruit cortex\", and by others as a fused hypanthium or \"torus\"; it is the most edible part of this fruit.\nThe carpels of a pome are fused within the \"core\". Although the exocarp, mesocarp, and endocarp of some other fruit types look very much like the skin, flesh, and core respectively of a pome, they are parts of the carpel. The exocarp and mesocarp of a pome may be fleshy and difficult to distinguish from one another and from the hypanthial tissue. The endocarp forms a leathery or stony case around the seed, and corresponds to what is commonly called the core. The shriveled remains of the sepals, style and stamens can sometimes be seen at the end of a pome opposite the stem, and the ovary is therefore often described as inferior in these flowers.',	NULL,	'Pomes',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Pomes',	'Unknown',	'2012-09-11 14:58:51',	'2019-12-11 19:39:11',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00856'),
(887,	'Brassicas',	NULL,	'Brassica is a genus of plants in the mustard family. The members of the genus are collectively known as cruciferous vegetables, cabbages, or mustards. Crops from this genus are sometimes called cole crops, which is derived from the Latin caulis, meaning stem or cabbage. Common types of brassica used for food include cabbage, cauliflower, broccoli, Brussels sprouts, and some types of seeds. The genus is known for containing many important agricultural and horticultural crops. It also includes a number of weeds, both wild taxa and escapees from cultivation. It includes over 30 wild species and hybrids, and numerous additional cultivars and hybrids of cultivated origin. Most are annuals or biennials, but some are small shrubs. Due to their agricultural importance, Brassica plants have been the subject of much scientific interest. Six particularly important species (Brassica carinata, B. juncea, B. oleracea, B. napus, B. nigra and B. rapa) are derived by combining the chromosomes from three earlier species, as described by the Triangle of U theory. The genus is native in the wild in western Europe, the Mediterranean and temperate regions of Asia. In addition to the cultivated species, which are grown worldwide, many of the wild species grow as weeds, especially in North America, South America, and Australia. A dislike for cabbage, broccoli et. al. can be due to the Brassica species containing a chemical similar to phenylthiocarbamide (PTC), a chemical which is either bitter or tasteless depending on one\'s genetic makeup.',	NULL,	'Brassica',	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Brassicas',	'Unknown',	'2012-09-11 15:00:37',	'2019-12-11 19:39:23',	2,	2,	0,	'generic',	3705,	0,	'FOOD00857'),
(888,	'Cereals and cereal products',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Cereals and cereal products',	'Cereals and cereal products',	'Unknown',	'2012-09-11 15:03:19',	'2019-12-11 19:39:32',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00858'),
(889,	'Citrus',	NULL,	'Citrus is a common term and genus (Citrus) of flowering plants in the rue family, Rutaceae. The most recent research indicates an origin in Australia, New Caledonia and New Guinea.  Some researchers believe that the origin is in the part of Southeast Asia bordered by Northeast India, Burma (Myanmar) and the Yunnan province of China, and it is in this region that some commercial species such as oranges, mandarins, and lemons originally came. Citrus fruit has been cultivated in an ever-widening area since ancient times; the best-known examples are the oranges, lemons, grapefruit, and limes.\nThe generic name originated in Latin, where it specifically referred to the plant now known as Citron (C. medica). It was derived from the ancient Greek word for cedar, ?????? (kédros). Some believe this was because Hellenistic Jews used the fruits of C. medica during Sukkot (Feast of the Tabernacles) in place of a cedar cone, while others state it was due to similarities in the smell of citrus leaves and fruit with that of cedar. Collectively, Citrus fruits and plants are also known by the Romance loanword agrumes (literally \"sour fruits\").',	'28882',	'Citrus',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Citrus',	'Unknown',	'2012-09-11 15:04:38',	'2019-12-11 19:39:47',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00859'),
