(892,	'Crustaceans',	NULL,	'Crustaceans (Crustacea) form a very large group of arthropods, usually treated as a subphylum, which includes such familiar animals as crabs, lobsters, crayfish, shrimp, krill and barnacles. The 67,000 described species range in size from Stygotantulus stocki at 0.1 mm (0.004 in), to the Japanese spider crab with a leg span of up to 3.8 m (12.5 ft) and a mass of 20 kg (44 lb). Like other arthropods, crustaceans have an exoskeleton, which they moult to grow. They are distinguished from other groups of arthropods, such as insects, myriapods and chelicerates, by the possession of biramous (two-parted) limbs, and by the nauplius form of the larvae.\nMost crustaceans are free-living aquatic animals, but some are terrestrial (e.g. woodlice), some are parasitic (e.g. Rhizocephala, fish lice, tongue worms) and some are sessile (e.g. barnacles). The group has an extensive fossil record, reaching back to the Cambrian, and includes living fossils such as Triops cancriformis, which has existed apparently unchanged since the Triassic period. ',	'83677',	'Crustaceans',	NULL,	NULL,	NULL,	NULL,	NULL,	'Aquatic foods',	'Crustaceans',	'Unknown',	'2012-09-11 15:09:01',	'2019-12-11 19:40:03',	2,	2,	0,	'generic',	6657,	0,	'FOOD00862'),
(893,	'Milk and milk products',	NULL,	'A dairy product is food produced from the milk of mammals. Dairy products are usually high energy-yielding food products. A production plant for the processing of milk is called a dairy or a dairy factory. Apart from breastfed infants, the human consumption of dairy products is sourced primarily from the milk of cows, yet goats, sheep, yaks, horses, camels, and other mammals are other sources of dairy products consumed by humans. Dairy products are commonly found in European, Middle Eastern, and Indian cuisine, whereas aside from Mongolian cuisine they are little-known in traditional Asian cuisine.',	NULL,	'Dairy_product',	NULL,	NULL,	NULL,	NULL,	NULL,	'Milk and milk products',	'Milk and milk products',	'Unknown',	'2012-09-11 15:10:31',	'2019-12-11 19:40:06',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00863'),
(894,	'Fats and oils',	NULL,	'Fats are a wide group of compounds that are generally soluble in organic solvents and generally insoluble in water. Chemically, fats are triglycerides: triesters of glycerol and any of several fatty acids. Fats may be either solid or liquid at room temperature, depending on their structure and composition. Although the words \"oils\", \"fats\", and \"lipids\" are all used to refer to fats, in reality, fat is a subset of lipid. \"Oils\" is usually used to refer to fats that are liquids at normal room temperature, while \"fats\" is usually used to refer to fats that are solids at normal room temperature. \"Lipids\" is used to refer to both liquid and solid fats, along with other related substances, usually in a medical or biochemical context, which are not soluble in water. The word \"oil\" is also used for any substance that does not mix with water and has a greasy feel, such as petroleum (crude oil), heating oil, and essential oils, regardless of its chemical structure.\nFats form a category of lipid, distinguished from other lipids by their chemical structure and physical properties. This category of molecules is important for many forms of life, serving both structural and metabolic functions. They are an important part of the diet of most heterotrophs (including humans). Fats or lipids are broken down in the body by enzymes called lipases produced in the pancreas.\nExamples of edible animal fats are lard, fish oil, butter/ghee and whale blubber. They are obtained from fats in the milk and meat, as well as from under the skin, of an animal. Examples of edible plant fats include peanut, soya bean, sunflower, sesame, coconut and olive oils, and cocoa butter. Vegetable shortening, used mainly for baking, and margarine, used in baking and as a spread, can be derived from the above oils by hydrogenation.',	NULL,	'Fats_and_oils',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fats and oils',	'Fats and oils',	'Unknown',	'2012-09-11 15:11:54',	'2019-12-11 19:40:09',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00864'),
(896,	'Fishes',	NULL,	'A fish is any member of a paraphyletic group of organisms that consist of all gill-bearing aquatic craniate animals that lack limbs with digits. Included in this definition are the living hagfish, lampreys, and cartilaginous and bony fish, as well as various extinct related groups. Most fish are ectothermic (\"cold-blooded\"), allowing their body temperatures to vary as ambient temperatures change, though some of the large active swimmers like white shark and tuna can hold a higher core temperature. Fish are abundant in most bodies of water. They can be found in nearly all aquatic environments, from high mountain streams (e.g., char and gudgeon) to the abyssal and even hadal depths of the deepest oceans (e.g., gulpers and anglerfish). At 32,000 species, fish exhibit greater species diversity than any other group of vertebrates.\nFish are an important resource for humans worldwide, especially as food. Commercial and subsistence fishers hunt fish in wild fisheries (see fishing) or farm them in ponds or in cages in the ocean (see aquaculture). They are also caught by recreational fishers, kept as pets, raised by fishkeepers, and exhibited in public aquaria. Fish have had a role in culture through the ages, serving as deities, religious symbols, and as the subjects of art, books and movies.',	NULL,	'Fishes',	NULL,	NULL,	NULL,	NULL,	NULL,	'Aquatic foods',	'Fishes',	'Unknown',	'2012-09-11 15:15:49',	'2019-12-11 19:40:14',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00865'),
(897,	'Herbs and Spices',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Herbs and Spices',	'Herbs and Spices',	'Unknown',	'2012-09-11 15:17:28',	'2019-12-11 19:40:17',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00866'),
(898,	'Pulses',	'',	'A pulse (Latin \"puls\", from Ancient Greek πόλτος póltos, “porridge”), sometimes called a \"grain legume\", is an annual leguminous crop yielding from one to twelve seeds of variable size, shape, and color within a pod. Pulses are used for food for humans and other animals. Included in the pulses are: dry beans like pinto beans, kidney beans and navy beans; dry peas; lentils; and others.\r\nLike many leguminous crops, pulses play a key role in crop rotation due to their ability to fix nitrogen. To support the awareness on this matter, the United Nations declared 2016 the UN International Year of Pulses.\r\nThe words \"bean\", \"lentil\", and \"pulse\" may refer to just the seed or to the entire plant.',	'',	'Pulse_(legume)',	NULL,	NULL,	NULL,	NULL,	NULL,	'Pulses',	'Pulses',	'Unknown',	'2012-09-11 15:18:21',	'2019-12-11 19:40:32',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00867'),
(900,	'Mollusks',	NULL,	'The molluscs or mollusks compose the large phylum of invertebrate animals known as the Mollusca. Around 85,000 extant species of molluscs are recognized. Molluscs are the largest marine phylum, comprising about 23% of all the named marine organisms. Numerous molluscs also live in freshwater and terrestrial habitats. They are highly diverse, not only in size and in anatomical structure, but also in behaviour and in habitat. The phylum is typically divided into 9 or 10 taxonomic classes, of which two are entirely extinct. Cephalopod molluscs, such as squid, cuttlefish and octopus, are among the most neurologically advanced of all invertebrates?and either the giant squid or the colossal squid is the largest known invertebrate species. The gastropods (snails and slugs) are by far the most numerous molluscs in terms of classified species, and account for 80% of the total. \nMolluscs have been and still are an important food source for anatomically modern humans, but with a risk of food poisoning from toxins that accumulate in molluscs under certain conditions, and many countries have regulations to reduce this risk. Molluscs have, for centuries, also been the source of important luxury goods, notably pearls, mother of pearl, Tyrian purple dye, and sea silk. Their shells have also been used as money in some preindustrial societies.',	'69458',	'Mollusks',	NULL,	NULL,	NULL,	NULL,	NULL,	'Aquatic foods',	'Mollusks',	'Unknown',	'2012-09-11 15:20:25',	'2019-12-11 19:40:42',	2,	2,	0,	'generic',	6447,	0,	'FOOD00868'),
(901,	'Nuts',	NULL,	'A nut is defined botanically as a fruit composed of a hard shell and a seed, where the hard-shelled fruit does not open to release the seed (indehiscent). In a culinary context, a wide variety of dried seeds are often called nuts, but in a botanical context, only ones that include the indehiscent fruit are considered true nuts.\nMost seeds come from fruits that naturally free themselves from the shell, unlike nuts such as hazelnuts, chestnuts, and acorns, which have hard shell walls and originate from a compound ovary. Culinary usage of the term is less restrictive, and some nuts as defined in food preparation, like almonds, pecans, pistachios, walnuts, and Brazil nuts, are not nuts in a botanical sense. Common usage of the term often refers to any hard-walled, edible kernel as a nut.',	NULL,	'Nut_(fruit)',	NULL,	NULL,	NULL,	NULL,	NULL,	'Nuts',	'Nuts',	'Unknown',	'2012-09-11 15:21:27',	'2019-12-11 19:40:45',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00869'),
(902,	'Beverages',	NULL,	'Drinks, or beverages, are liquids specifically prepared for human consumption. In addition to basic needs, beverages form part of the culture of human society. Despite the fact that most beverages, including juice, soft drinks, and carbonated drinks, have some form of water in them; water itself is often not classified as a beverage, and the word beverage has been recurrently defined as not referring to water.\nAn alcoholic beverage is a drink containing ethanol, commonly known as alcohol, although in chemistry the definition of an alcohol includes many other compounds. Alcoholic beverages, such as wine, beer, and liquor have been part of human culture and development for 8,000 years.\nNon-alcoholic beverages often signify drinks that would normally contain alcohol, such as beer and wine but are made with less than .5 percent alcohol by volume. The category includes drinks that have undergone an alcohol removal process such as non-alcoholic beers and de-alcoholized wines.',	NULL,	'Beverages',	NULL,	NULL,	NULL,	NULL,	NULL,	'Beverages',	'Beverages',	'Unknown',	'2012-09-11 15:25:20',	'2019-12-11 19:40:53',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00870'),
(903,	'Fruits',	NULL,	'In botany, a fruit is a part of a flowering plant that derives from specific tissues of the flower, one or more ovaries, and in some cases accessory tissues. Fruits are the means by which these plants disseminate seeds. Many of them that bear edible fruits, in particular, have propagated with the movements of humans and animals in a symbiotic relationship as a means for seed dispersal and nutrition, respectively; in fact, humans and many animals have become dependent on fruits as a source of food. Fruits account for a substantial fraction of the world\'s agricultural output, and some (such as the apple and the pomegranate) have acquired extensive cultural and symbolic meanings.\nIn common language usage, \"fruit\" normally means the fleshy seed-associated structures of a plant that are sweet or sour and edible in the raw state, such as apples, oranges, grapes, strawberries, bananas, and lemons. On the other hand, the botanical sense of \"fruit\" includes many structures that are not commonly called \"fruits\", such as bean pods, corn kernels, wheat grains, and tomatoes.\nThe section of a fungus that produces spores is also called a fruiting body.',	NULL,	'Fruits',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Fruits',	'Unknown',	'2012-09-11 15:27:05',	'2019-12-11 19:40:57',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00871'),
(904,	'Green vegetables',	NULL,	'Leaf vegetables, also called potherbs, greens, vegetable greens, leafy greens or salad greens, are plant leaves eaten as a vegetable, sometimes accompanied by tender petioles and shoots. Although they come from a very wide variety of plants, most share a great deal with other leaf vegetables in nutrition and cooking methods.\nNearly one thousand species of plants with edible leaves are known. Leaf vegetables most often come from short-lived herbaceous plants such as lettuce and spinach. Woody plants whose leaves can be eaten as leaf vegetables include Adansonia, Aralia, Moringa, Morus, and Toona species.\nThe leaves of many fodder crops are also edible by humans, but usually only eaten under famine conditions. Examples include alfalfa, clover, and most grasses, including wheat and barley. These plants are often much more prolific than more traditional leaf vegetables, but exploitation of their rich nutrition is difficult, primarily because of their high fiber content. This obstacle can be overcome by further processing such as drying and grinding into powder or pulping and pressing for juice.\nLeaf vegetables contain many typical plant nutrients, but since they are photosynthetic tissues, their vitamin K levels in relation to those of other fruits and vegetables, as well as other types of foods, is particularly notable. The reason is that phylloquinone, the most common form of the vitamin, is directly involved in photosynthesis. This causes leaf vegetables to be the primary food class that interacts significantly with the anticoagulant pharmaceutical warfarin.',	NULL,	'Green_vegetables',	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Green vegetables',	'Unknown',	'2012-09-11 15:28:06',	'2019-12-11 19:41:16',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00872'),
(905,	'Root vegetables',	NULL,	'Root vegetables are plant roots used as vegetables. Here \"root\" means any underground part of a plant.\nRoot vegetables are generally storage organs, enlarged to store energy in the form of carbohydrates. They differ in the concentration and the balance between sugars, starches, and other types of carbohydrate. Of particular economic importance are those with a high carbohydrate concentration in the form of starch. Starchy root vegetables are important staple foods, particularly in tropical regions, overshadowing cereals throughout much of West Africa, Central Africa, and Oceania, where they are used directly or mashed to make fufu or poi.\nBotany distinguishes true roots such as tuberous roots and taproots from non-roots such as tubers, rhizomes, corms, and bulbs, though some contain both taproot and hypocotyl tissue, making it difficult to tell some types apart. In ordinary, agricultural, and culinary use, \"root vegetable\" can apply to all these types.',	NULL,	'Root_vegetables',	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Root vegetables',	'Unknown',	'2012-09-11 15:29:35',	'2019-12-11 19:41:44',	2,	2,	0,	'generic',	NULL,	0,	'FOOD00873'),
(906,	'Sunburst squash (pattypan squash)',	'Cucurbita pepo var. clypeata',	'Pattypan squash is a variety of summer squash (<i>Cucurbita pepo</i>) notable for its small size, round and shallow shape, and scalloped edges, somewhat resembling a small toy top, or flying saucer. The name \"pattypan\" derives from \"a pan for baking a patty\". Its French name, <i>pâtisson</i>, derives from a Provençal word for a cake made in a scalloped mould. The pattypan squash is also known as scallop squash, sunburst squash, granny squash, custard marrow, custard squash, cibleme in Cajun French, white squash, scallopini or simply \"squash\" in Australian English, or schwoughksie squash (pronounced \"shwooxie squash\"), especially if grown in the Poughkeepsie, New York, area. (Wikipedia)',	'',	'Pattypan squash',	'PetitPanSquash.jpg',	'image/jpeg',	285159,	'2015-02-26 17:41:14',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2015-02-26 17:41:15',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00874'),
(907,	'Green zucchini',	'Cucurbita pepo var. cylindrica',	'Zucchini or courgette is a summer squash which can reach nearly a meter in length, but which is usually harvested at half that size or less. Along with certain other squashes and pumpkins, it belongs to the species <i>Cucurbita pepo</i>. Zucchini can be dark or light green. A related hybrid, the golden zucchini, is a deep yellow or orange color. In a culinary context, zucchini is treated as a vegetable; it is usually cooked and presented as a savory dish or accompaniment. Botanically, however, zucchini is a fruit, being the swollen ovary of the zucchini flower. Zucchini, like all squash, has its ancestry in the Americas. However, the varieties of squash typically called \"zucchini\" were developed in Italy, many generations after their introduction from the Americas. (Wikipedia)',	'',	'Zucchini',	'1200px-CSA-Striped-Zucchini.jpg',	'image/jpeg',	120301,	'2015-02-26 17:52:13',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2015-02-26 17:52:13',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00875'),
(908,	'Yellow zucchini',	'Cucurbita pepo var. cylindrica',	'Zucchini or courgette is a summer squash which can reach nearly a meter in length, but which is usually harvested at half that size or less. Along with certain other squashes and pumpkins, it belongs to the species <i>Cucurbita pepo</i>. (Wikipedia) Yellow zucchini, or golden zucchini, was developed by the W. Atlee Burpee Seed Company from a Fordhook Zucchini crossed with a Bicolored Gourd and released in 1973 (http://www.cooksinfo.com/burpee-golden-zucchini). It is said to have a distinctive flavour that is somewhat sweeter than green zucchini.',	'',	'',	'e33ef9656c74fba63c2d88e618456067.jpg',	'image/jpeg',	41498,	'2015-02-26 18:11:44',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2015-02-26 18:11:44',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00876'),
(909,	'Green bell pepper',	'Capsicum annuum',	'Green bell peppers are members of the domesticated plant species <i>Capsicum annuum</i>. Green, yellow, orange and red bell peppers all belong to the same species, with the differences arising from the time at which they are harvested. Green bell peppers are bell peppers that have been harvested early. Yellow and orange bell peppers have been allowed more time to ripen, and red bell peppers are the most mature. <i>Capsicum annuum</i> is a domesticated species of the plant genus <i>Capsicum</i> native to southern North America and northern South America. The three species <i>C. annuum</i>, <i>C. frutescens</i> and <i>C. chinense</i> all evolved from a single common ancestor located somewhere in the northwest Brazil - Colombia area. <i>Capsicum annuum</i> is the most common and extensively cultivated of the five domesticated capsicums. The species is a source of popular \"sweet peppers\":http://en.wikipedia.org/wiki/Bell_peppers and \"hot chilis\":http://en.wikipedia.org/wiki/Chili_pepper with numerous varieties cultivated all around the world. In American English the plant is commonly known as a chili pepper or bell pepper. In British English, the sweet varieties are called red or green peppers and the hot varieties chillies, whereas in Australian and Indian English the name capsicum is commonly used for bell peppers exclusively and chilli is often used to encompass the hotter varieties. [Wikipedia] See a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30492',	'Capsicum_annuum',	'428px-Green-Bell-Pepper.jpg',	'image/jpeg',	26784,	'2015-02-26 18:37:27',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2015-02-26 18:37:27',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	4072,	1,	'FOOD00877'),
