(911,	'Orange bell pepper',	'Capsicum annuum',	'Orange bell peppers are members of the domesticated plant species <i>Capsicum annuum</i>. Green, yellow, orange and red bell peppers all belong to the same species, with the differences arising from the time at which they are harvested. Green bell peppers are bell peppers that have been harvested early. Yellow and orange bell peppers have been allowed more time to ripen, and red bell peppers are the most mature. <i>Capsicum annuum</i> is a domesticated species of the plant genus <i>Capsicum</i> native to southern North America and northern South America. The three species <i>C. annuum</i>, <i>C. frutescens</i> and <i>C. chinense</i> all evolved from a single common ancestor located somewhere in the northwest Brazil - Colombia area. <i>Capsicum annuum</i> is the most common and extensively cultivated of the five domesticated capsicums. The species is a source of popular \"sweet peppers\":http://en.wikipedia.org/wiki/Bell_peppers and \"hot chilis\":http://en.wikipedia.org/wiki/Chili_pepper with numerous varieties cultivated all around the world. In American English the plant is commonly known as a chili pepper or bell pepper. In British English, the sweet varieties are called red or green peppers and the hot varieties chillies, whereas in Australian and Indian English the name capsicum is commonly used for bell peppers exclusively and chilli is often used to encompass the hotter varieties. [Wikipedia] See a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30492',	'Capsicum_annuum',	'orange-bell-pepper-02.jpg',	'image/jpeg',	6881,	'2015-02-26 18:44:18',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2015-02-26 18:44:18',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	4072,	1,	'FOOD00879'),
(912,	'Red bell pepper',	'Capsicum annuum',	'Red bell peppers are members of the domesticated plant species <i>Capsicum annuum</i>. Green, yellow, orange and red bell peppers all belong to the same species, with the differences arising from the time at which they are harvested. Green bell peppers are bell peppers that have been harvested early. Yellow and orange bell peppers have been allowed more time to ripen, and red bell peppers are the most mature. <i>Capsicum annuum</i> is a domesticated species of the plant genus <i>Capsicum</i> native to southern North America and northern South America. The three species <i>C. annuum</i>, <i>C. frutescens</i> and <i>C. chinense</i> all evolved from a single common ancestor located somewhere in the northwest Brazil - Colombia area. <i>Capsicum annuum</i> is the most common and extensively cultivated of the five domesticated capsicums. The species is a source of popular \"sweet peppers\":http://en.wikipedia.org/wiki/Bell_peppers and \"hot chilis\":http://en.wikipedia.org/wiki/Chili_pepper with numerous varieties cultivated all around the world. In American English the plant is commonly known as a chili pepper or bell pepper. In British English, the sweet varieties are called red or green peppers and the hot varieties chillies, whereas in Australian and Indian English the name capsicum is commonly used for bell peppers exclusively and chilli is often used to encompass the hotter varieties. [Wikipedia] See a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30492',	'Capsicum_annuum',	'red-bell-pepper.jpg',	'image/jpeg',	76376,	'2015-02-26 18:47:15',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2015-02-26 18:47:16',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	4072,	1,	'FOOD00880'),
(913,	'Italian sweet red pepper',	'Capsicum annuum',	'The Italian sweet pepper is a variety of the species <i>Capsicum annuum</i>, like bell peppers and chilli peppers. It has the appearance of a large chilli pepper but the mild taste of sweet peppers such as the bell pepper. <i>Capsicum annuum</i> is a domesticated species of the plant genus <i>Capsicum</i> native to southern North America and northern South America. The three species <i>C. annuum</i>, <i>C. frutescens</i> and <i>C. chinense</i> all evolved from a single common ancestor located somewhere in the northwest Brazil - Colombia area. <i>Capsicum annuum</i> is the most common and extensively cultivated of the five domesticated capsicums. The species is a source of popular \"sweet peppers\":http://en.wikipedia.org/wiki/Bell_peppers and \"hot chilis\":http://en.wikipedia.org/wiki/Chili_pepper with numerous varieties cultivated all around the world. In American English the plant is commonly known as a chili pepper or bell pepper. In British English, the sweet varieties are called red or green peppers and the hot varieties chillies, whereas in Australian and Indian English the name capsicum is commonly used for bell peppers exclusively and chilli is often used to encompass the hotter varieties. [Wikipedia] See a \"list of capsicum cultivars\":http://en.wikipedia.org/wiki/List_of_Capsicum_cultivars.',	'30492',	'Italian sweet pepper',	'939px-Italian_sweet_peppers.jpg',	'image/jpeg',	124244,	'2015-02-26 18:54:22',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2015-02-26 18:54:23',	'2019-05-17 16:19:47',	NULL,	NULL,	1,	'specific',	4072,	1,	'FOOD00881'),
(914,	'Yellow wax bean',	'Phaseolus vulgaris',	'Yellow Wax beans are a member of the <i>Fabaceae</i> family, along with common beans, pulses and peas. \"Yellow Wax\" is a given name to dozens of wax bush bean varieties that individually simply happen to have different shades of yellow in appearance and variance in waxiness depending on the cultivar. Yellow Wax beans are nearly identical to Green beans in all aspects except for color. One of the most famous heritage Yellow Wax bean varieties is the Beurre De Rocquencourt Bush Wax bean, named for the rich farming region, Rocquencourt, France. It is the single most responsible bean for catalysing the popularity of the Wax bean within the 20th century. Yellow Wax beans\' ancestors are native to Central and South America. Many Yellow Wax bean varieties, though, were first introduced to their respective culinary regions from Algeria. The Algerian Wax bean is responsible for the development of several varieties of Wax beans from the 18th to the 20th Century. It is considered the oldest known cultivar still in production. (http://www.specialtyproduce.com/produce/Yellow_Wax_Beans_602.php)',	'26857',	'Phaseolus_vulgaris',	'7004.png',	'image/png',	369202,	'2015-02-26 20:46:42',	NULL,	'Pulses',	'Beans',	'Type 1',	'2015-02-26 20:46:43',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	3885,	1,	'FOOD00882'),
(915,	'Green bean',	'Phaseolus vulgaris',	'Green beans, also known as string beans, snap beans in the northeastern and western United States, or ejotes in Mexico, are the unripe fruit of various cultivars of the common bean (<i>Phaseolus vulgaris</i>). Green bean cultivars have been selected especially for the fleshiness, flavor, or sweetness of their pods. Haricots verts, French for \"green beans\", also known as French beans, French green beans, French filet beans, Fine beans (British English), is a variety of green bean that is longer, thinner, crisp, and tender. It is different from the haricot bean, which is a dry bean. (Wikipedia)',	'26857',	'Phaseolus vulgaris',	'fresh-greenbeans.jpg',	'image/jpeg',	80699,	'2015-02-26 20:54:13',	NULL,	'Pulses',	'Beans',	'Type 1',	'2015-02-26 20:54:13',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	3885,	1,	'FOOD00883'),
(916,	'Saskatoon berry',	'Amelanchier alnifolia',	'<i>Amelanchier alnifolia</i>, the saskatoon, Pacific serviceberry, western serviceberry, alder-leaf shadbush, dwarf shadbush, chuckley pear, or western juneberry, is a shrub with edible berry-like fruit, native to North America from Alaska across most of western Canada and in the western and north-central United States. Historically, it was also called pigeon berry. It grows from sea level in the north of the range, up to 2,600 m (8,530 ft) elevation in California and 3,400 m (11,200 ft) in the Rocky Mountains, and is a common shrub in the forest understory. (Wikipedia)',	'25109',	'Amelanchier alnifolia',	'a10d82d96a5429dd574a4d0d3f6dbad3.jpg',	'image/jpeg',	57788,	'2015-02-26 20:58:39',	NULL,	'Fruits',	'Berries',	'Type 1',	'2015-02-26 20:58:40',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	32219,	1,	'FOOD00884'),
(917,	'Nanking cherry',	'Prunus tomentosa',	'The Nanking cherry (<i>Prunus tomentosa</i>) is a species of Prunus native to northern and western China (including Tibet), Korea, Mongolia, and possibly northern India (Jammu and Kashmir, though probably only cultivated there). Other common names for <i>P. tomentosa</i> include Korean cherry, Manchu cherry, downy cherry, Shanghai cherry, Ando cherry, mountain cherry, Chinese bush cherry, Chinese dwarf cherry, or Hansen\'s bush cherry. (Wikipedia)',	'504627',	'Prunus tomentosa',	'1200px-Berries_and_leaves_of_Prunus_Cerasus_tomentosa.jpg',	'image/jpeg',	170325,	'2015-02-26 21:10:48',	NULL,	'Fruits',	'Berries',	'Type 1',	'2015-02-26 21:10:49',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	105667,	1,	'FOOD00885'),
(918,	'Japanese pumpkin',	'Cucurbita maxima',	'Kabocha, Danhobak, or Fak Thong is an Asian variety of winter squash of the species <i>Cucurbita maxima</i>. The word kabocha has come to mean a general type of winter squash to many English-speaking growers and buyers. In some cultures it is revered as an aphrodisiac. Kabocha is commonly called Japanese pumpkin, especially in Australia and New Zealand. It is also called kabocha squash in North America. In Japan, the word kabocha may refer to either this squash or to the Western-style pumpkin. Varieties include: Ajihei, Ajihei No. 107, Ajihei No. 331, Ajihei No. 335, Cutie, Ebisu, Emiguri, and Miyako. Today, many of the kabocha in the market are of the type called Kuri kabocha, which was created based on Seiyo kabocha (buttercup squash). It is popular for its strong yet sweet flavor and moist, fluffy texture, which is like chestnuts. It is found in the market under such brand names as Miyako, Ebisu, Kurokawa, and Akazukin. (Wikipedia)',	'22369',	'Kabocha',	'Kabocha.jpg',	'image/jpeg',	22549,	'2015-02-27 00:25:00',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2015-02-27 00:25:01',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	3661,	1,	'FOOD00886'),
(919,	'White cabbage',	'Brassica oleracea L. var. capitata L. f. alba DC.',	'Cabbage (<i>Brassica oleracea</i> or variants) is a leafy green or purple biennial plant, grown as an annual vegetable crop for its dense-leaved heads. Closely related to other cole crops, such as broccoli, cauliflower, and brussels sprouts, it descends from <i>B. oleracea</i> var. <i>oleracea</i>, a wild field cabbage. Cabbage heads generally range from 0.5 to 4 kilograms (1 to 9 lb), and can be green, purple and white. Smooth-leafed firm-headed green cabbages are the most common, with smooth-leafed red and crinkle-leafed savoy cabbages of both colors seen more rarely. It is a multi-layered vegetable. Under conditions of long sunlit days such as are found at high northern latitudes in summer, cabbages can grow much larger. (Wikipedia)',	'526962',	'Cabbage',	'1200px-Cabbage_and_cross_section_on_white.jpg',	'image/jpeg',	156948,	'2015-02-27 17:39:22',	NULL,	'Vegetables',	'Cabbages',	'Type 1',	'2015-02-27 17:39:23',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00887'),
(920,	'Romaine lettuce',	'Lactuca sativa L. var. longifolia',	'Romaine or cos lettuce is a variety of lettuce (<i>Lactuca sativa</i> L. var. <i>longifolia</i>) that grows in a tall head of sturdy leaves with firm ribs down their centers. Unlike most lettuces, it is tolerant of heat. As with other dark leafy greens, the antioxidants contained within romaine lettuce are believed to help prevent cancer. (Wikipedia)',	'',	'Romaine lettuce',	'1200px-Starr_070730-7911_Lactuca_sativa.jpg',	'image/jpeg',	204887,	'2015-02-27 17:53:43',	NULL,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2015-02-27 17:53:44',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00888'),
(921,	'Cow milk, pasteurized, vitamin A + D added, 0% fat',	'',	'As an agricultural product, milk is extracted from mammals during or soon after pregnancy and used as food for humans. Worldwide, dairy farms produced about 730 million tonnes of milk in 2011, from 260 million dairy cows. India is the world\'s largest producer and consumer of milk, yet neither exports nor imports milk. New Zealand, the European Union\'s 28 member states, Australia, and the United States are the world\'s largest exporters of milk and milk products. China and Russia are the world\'s largest importers of milk and milk products. Throughout the world, there are more than 6 billion consumers of milk and milk products. Over 750 million people live within dairy farming households. Milk is a key contributor to improving nutrition and food security particularly in developing countries. Improvements in livestock and dairy technology offer significant promise in reducing poverty and malnutrition in the world.',	'',	'Milk',	'632.jpg',	'image/jpeg',	68993,	'2015-03-10 23:09:56',	NULL,	'Milk and milk products',	'Unfermented milks',	'Type 2',	'2015-03-10 23:09:57',	'2019-05-14 18:05:36',	NULL,	NULL,	1,	'specific',	NULL,	1,	'FOOD00889'),
