(930,	'Rabbiteye blueberry',	'Vaccinium virgatum',	'Vaccinium virgatum, commonly called rabbiteye blueberry, samllflower blueberry or southern black blueberry, is a species of blueberry native to the Southeastern United States, from North Carolina south to Florida and west to Texas. Rabbiteye blueberry is a deciduous shrub that can grow to 3-6 feet tall and with up to a 3-foot spread. The leaves are red-bronze in the spring and then turn into a dark-green color. The fruits are dark blue to black. The rabbiteye blueberries are edible and are used to make jams, sauces for breads, muffins, etc. Research has shown that the rabbiteye blueberry was a good source of polyphenols, anthocyanins and flavonoids, their antioxidant activity is beneficial to human health (PMID: 23268789; PMID: 29682153) [Wikipedia]',	'505636',	'Vaccinium_virgatum',	'Vaccinium_virgatum.jpg',	'image/jpeg',	12395020,	'2019-08-21 17:44:14',	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-21 17:34:16',	'2019-08-22 16:32:24',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00898'),
(931,	'Yali pear',	'Pyrus × bretschneideri',	'Yali pear, also called Chinese White Pear, is an interspecific hybrid species of pear widely grown in northern China. It is a type of Asian pear. Unlike the European pear, firm to touch and crispy. Yali pear is juicy and slightly sweet. [Wikipedia]',	NULL,	'Pyrus_×_bretschneideri',	'yali.jpg',	'image/jpeg',	483996,	'2019-08-22 16:41:10',	NULL,	'Fruits',	'Pomes',	'Type 1',	'2019-08-22 16:41:11',	'2020-03-12 21:00:53',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00899'),
(932,	'Asparagus racemosus',	'Asparagus racemosus',	'Asparagus racemosus, also called Shatavari, is a flowering perennial plant species in the genus Asparagus commonly found in Nepal, Sri Lanka, India and the Himalayas. Its extracts from the roots are used in traditional Ayurvedic medicine in India to treat various hormonal and reproductive tissues in women, and gastric ulcers and loss of appetite as well. However, only few studies support the effect of Shatavari on our health. Due to the destructive harvesting, habitat destruction and deforestation, Ayurvedic is now endangered in its natural habitat. [Wikipedia]',	NULL,	'Asparagus_racemosus',	'asparagus_racemosus.jpg',	'image/jpeg',	567407,	'2019-08-22 16:41:11',	NULL,	'Vegetables',	'Shoot vegetables',	'Type 1',	'2019-08-22 16:41:12',	'2019-08-22 16:41:12',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00900'),
(933,	'Evergreen blackberry',	'Rubus laciniatus',	'Rubus laciniatus, commonly called evergreen blackberry or cutleaf blackberry, is a species of blackberry that is native to Eurasia. It has been introduced to Australia and North America, and become a weed and highly invasive species in forested habitats in the United States and Canada, it is very difficult to control. Evergreen blackberry is a deciduous shrub that grows up to 3 meters tall with prickly shoots. The flowers are in clusters, the petals are pink or white. The fruits are shiny and black, similar to the common blackberry, with a unique and fruitier taste. The fruits are not true berries in the botanical sense. [Wikipedia]',	'24853',	'Rubus_laciniatus',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-22 22:55:49',	'2019-08-22 22:55:49',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00901'),
(934,	'Asparagus fern',	'Asparagus setaceus',	'Asparagus setaceus, commonly called common asparagus fern, lace fern, climbing asparagus, or ferny asparagus, is native to South Africa. It is considered a weed in some locations. Asparagus setaceus is a climbing perennial herb, the small flowers are greenish-white in bell-shape, the berries are black when it is mature. [Wikipedia]',	'193453',	'Asparagus_setaceus',	'Asparagus_fern.jpg',	'image/jpeg',	1041515,	'2019-08-22 22:55:49',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2019-08-22 22:55:50',	'2019-08-22 22:55:50',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00902'),
(935,	'Thornless blackberry',	'Rubus ulmifolius',	'Rubus ulmifolius, commonly called thornless blackberry or elmleaf blackberry, is a species of wild blackberry. It is native to the Netherlands, Spain, Portugal, Britain, Ireland and North Africa, and naturalized in USA, Australia, southern and western South America. The thornless blackberry is shrub that can grow up to 5 meters tall, sometimes with spines. The flowers are usually pink or white, the fruits are dark purple, almost black. [Wikipedia]',	'530155',	'Rubus_ulmifolius',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-22 22:55:50',	'2019-08-22 22:55:50',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00903'),
(936,	'Tropical highland blackberry',	'Rubus adenotrichos',	'Rubus adenotrichos is commonly called tropical highland blackberry. It grows in Central America, northwestern South America, and central and southern Mexico, belongs to the Rosaceae family. Rubus adenotrichos is a shrub that can grow up to 6 meters tall. The flowers are pink or white, the fruits are red or black. [Wikipedia] Rubus adenotrichos contains phenolic compounds, mainly ellagitannins, and anthocyanins, it is a good source of antioxidants. Research has shown that Rubus adenotrichos had potential effects against oxidative stress and inflammation. (PMID: 23697506)',	NULL,	'Rubus_adenotrichos',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-22 22:55:50',	'2019-08-22 22:55:50',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00904'),
(937,	'Andean blackberry',	'Rubus glaucus',	'Rubus glaucus, commonly called Andean blackberry, Andes berry or mora de Castilla, is a species of blackberry, it belongs to the Rosaceae family. It grows in Latin America from Oaxaca to Bolivia. Rubus glaucus is a perennial semi-erect climbing shrub, it can grow up to 3 meters. The fruit is bright purple when ripe. Rubus glaucus is rich in vitamin C, phenols, anthocyanin, it shows a high antioxidant activity. (PMID: 20170356) [Wikipedia]',	'506228',	'Rubus_glaucus',	NULL,	NULL,	NULL,	NULL,	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-22 22:55:51',	'2019-08-22 22:55:51',	NULL,	NULL,	0,	'specific',	NULL,	0,	'FOOD00905'),
(938,	'Blackberry',	'Rubus',	'The blackberry is an edible fruit produced by many species in the genus Rubus in the family Rosaceae. Blackberry is a perennial plant that grows to 3-6 meter tall. The pale pink flowers are produced in late spring and early summer. The fruits are rich in vitamin C, anthocyanins, flavonols and ellagitannins (PMID: 22082199), they have shown the beneficial effects to human health (PMID: 22082199)',	NULL,	'Blackberry',	'blackberry.jpg',	'image/jpeg',	387007,	'2019-08-22 22:55:51',	NULL,	'Fruits',	'Berries',	'Type 1',	'2019-08-22 22:55:52',	'2020-03-12 21:01:01',	NULL,	NULL,	0,	'specific',	NULL,	1,	'FOOD00906'),
(939,	'Black tea',	NULL,	'Black tea is a type of tea that is more oxidized than oolong, green, and white teas.Black tea is generally stronger in flavour than other teas.It is made from leaves of the shrub (or small tree) Camellia sinensis.In China, where black tea was discovered,the beverage is called \"red tea\" due to the color of the oxidized leaves when processed appropriately.Plain black tea without sweeteners or additives contains caffeine, but negligible quantities of calories or nutrients.',	NULL,	NULL,	'Black_tea.jpg',	'image/jpeg',	413816,	'2020-04-17 16:22:46',	NULL,	'Teas',	'Teas',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:47',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00907'),
(940,	'Green tea',	NULL,	'Green tea is a type of tea that is made from Camellia sinensis leaves and buds that have not undergone the same withering and oxidation process used to make oolong teas and black teas.Green tea originated in China, but its production and manufacture has spread to many other countries in Asia. Several varieties of green tea exist, which differ substantially based on the variety of C. sinensis used, growing conditions, horticultural methods, production processing, and time of harvest.',	NULL,	NULL,	'Green_tea.jpg',	'image/jpeg',	190629,	'2020-04-17 16:22:47',	NULL,	'Teas',	'Teas',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:48',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00908'),
(941,	'Olive oil',	NULL,	'Olive oil is a liquid obtained from olives (the fruit of Olea europaea; family Oleaceae), a traditional tree crop of the Mediterranean Basin. The oil is produced by pressing whole olives. It is commonly used in cooking, whether for frying or as a salad dressing.It consists mainly of oleic acid (up to 83%), with smaller amounts of other fatty acids including linoleic acid (up to 21%) and palmitic acid (up to 20%).',	NULL,	NULL,	'Olive_oil.jpg',	'image/jpeg',	99743,	'2020-04-17 16:22:48',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:48',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00909'),
(942,	'Macroalgae',	NULL,	'Seaweed, or macroalgae, refers to several species of macroscopic, multicellular, marine algae. The term includes some  types of Rhodophyta (red), Phaeophyta (brown) and Chlorophyta (green) macroalgae.Seaweed species such as kelps provide essential nursery habitat for fisheries and other marine species and thus protect food sources; other species, such as planktonic algae, play a vital role in capturing carbon, producing up to 90% of Earth\'s oxygen.',	NULL,	NULL,	'Macroalgae.jpg',	'image/jpeg',	87093,	'2020-04-17 16:22:49',	NULL,	'Aquatic foods',	'Seaweed',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:49',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00910'),
(943,	'Red wine',	NULL,	'Red wine is a type of wine made from dark-colored (black) grape varieties. The actual color of the wine can range from intense violet, typical of young wines, through to brick red for mature wines and brown for older red wines. The juice from most purple grapes is greenish-white, the red color coming from anthocyan pigments (also called anthocyanins) present in the skin of the grape; exceptions  are the relatively uncommon teinturier varieties, which produce a red-colored juice.Much of the red-wine production process therefore involves extraction of color and flavor components from the grape skin.',	NULL,	NULL,	'Red_wine.jpg',	'image/jpeg',	55008,	'2020-04-17 16:22:49',	NULL,	'Beverages',	'Fermented beverages',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:49',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00911'),
(944,	'linseed oil',	NULL,	'Linseed oil, also known as flaxseed oil or flax oil, is a colourless to yellowish oil obtained from the dried, ripened seeds of the flax plant (Linum usitatissimum). The oil is obtained by pressing, sometimes followed by solvent extraction. Linseed oil is a drying oil, meaning it can polymerize into a solid form.Linseed oil is an edible oil in demand as a nutritional supplement, as a source of α-Linolenic acid, (an omega-3 fatty acid).',	NULL,	NULL,	'linseed_oil.jpg',	'image/jpeg',	64505,	'2020-04-17 16:22:49',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:50',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00912'),
(945,	'Rapeseed oil',	NULL,	'Rapeseed oil is produced from the bright yellow rape plant. The oil can then used drizzled as salad dressing, or heated to fry or bake.It\'s low in saturated fat and contains omegas 3, 6 and 9',	NULL,	NULL,	'Rapeseed_oil.jpg',	'image/jpeg',	191152,	'2020-04-17 16:22:50',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:50',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00913'),
(946,	'Soybean oil',	NULL,	'Soybean oil is a vegetable oil extracted from the seeds of the soybean (Glycine max). It is one of the most widely consumed cooking oils. As a drying oil, processed soybean oil is also used as a base for printing inks (soy ink) and oil paints.',	NULL,	NULL,	'Soybean_oil.jpg',	'image/jpeg',	78352,	'2020-04-17 16:22:50',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:51',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00914'),
(947,	'Guarana',	'Paullinia cupana',	'Guarana is a climbing plant in the family Sapindaceae, native to the Amazon basin and especially common in Brazil.Guarana has large leaves and clusters of flowers and is best known for the seeds from its fruit, which are about the size of a coffee bean.It contains about twice the concentration of caffeine found in coffee seeds. The additive has gained notoriety for being used in energy drinks.The colour of the fruit ranges from brown to red and it contains black seeds that are partly covered by white arils.',	NULL,	NULL,	'Guarana.jpg',	'image/jpeg',	12937,	'2020-04-17 16:22:51',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:51',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00915'),
(948,	'Mate',	'Ilex paraguariensis',	'Mate is a traditional South American caffeine-rich infused drink.It is prepared by steeping dried leaves of yerba mate (Ilex paraguariensis, known in Portuguese as erva-mate) in hot water and is served with a metal straw from a shared hollow calabash gourd.The mate leaves are dried, chopped, and ground into a powdery mixture called yerba, \"erva\" in Portuguese, which means \"herb\".',	NULL,	NULL,	'Mate.jpg',	'image/jpeg',	82357,	'2020-04-17 16:22:51',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:52',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00916'),
(949,	'White wine',	NULL,	'White wine is a wine that is fermented without skin contact. The colour can be straw-yellow, yellow-green, or yellow-gold.It is produced by the alcoholic fermentation of the non-coloured pulp of grapes, which may have a skin of any colour.White wine is mainly from \"white\" grapes, which are green or yellow in colour, such as the Chardonnay, Sauvignon, and Riesling.',	NULL,	NULL,	'White_wine.jpg',	'image/jpeg',	10149,	'2020-04-17 16:22:52',	NULL,	'Beverages',	'Fermented beverages',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:52',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00917'),
(950,	'Sour orange',	'Citrus × aurantium',	'Sour orange, bigarade orange,bitter orange, Seville orange, or marmalade orange is the citrus tree Citrus × aurantium and its fruit. It is native to southeast Asia and has been spread by humans to many parts of the world.',	NULL,	NULL,	'Sour_orange.jpg',	'image/jpeg',	832216,	'2020-04-17 16:22:52',	NULL,	'Fruits',	'Citrus',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:53',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00918'),
(951,	'Egg yolk',	NULL,	'The egg yolk is the yellow center of an egg. It is only one cell. It is commonly seen in fried eggs. When it is mixed with the whites, it makes scrambled eggs. It is sometimes used in cooking. It is much higher in calories than the egg white. It has Vitamin D in it. ',	NULL,	NULL,	'Egg_yolk.jpg',	'image/jpeg',	1719038,	'2020-04-17 16:22:53',	NULL,	'Eggs',	'Eggs',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:55',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00919'),
(952,	'Rosé wine',	NULL,	'Rosé wine is a kind of wine. It is made from red grapes by letting the juice have only very short skin contact. All colour and tannins come from the skin of the grape.',	NULL,	NULL,	'Rose_wine.png',	'image/jpeg',	64987,	'2020-04-17 16:27:35',	NULL,	'Beverages',	'Fermented beverages',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:27:36',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00920'),
(953,	'White mulberry',	'Morus alba',	'White mulberry trees that produce pure white fruit are rare. Typically, the fruits are white when immature, but gradually ripen to shades of pink or purple. They are a small variety, just a few centimeters long, and far sweeter than the black and red mulberries. They have a low acidity and a mild honey-like flavor. White mulberries are best when slightly overripe',	NULL,	NULL,	'White_mulberry.jpg',	'image/jpeg',	206357,	'2020-04-17 16:22:55',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:56',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00921'),
(954,	'Canola oil',	NULL,	'Canola oil is a vegetable oil derived from a variety of rapeseed that is low in erucic acid, as opposed to colza oil.There are both edible and industrial forms produced from the seed of any of several cultivars of the plant family Brassicaceae.',	NULL,	NULL,	'Canola_oil.jpg',	'image/jpeg',	10702,	'2020-04-17 16:22:56',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:57',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00922'),
(955,	'Dessert wine',	NULL,	'Dessert wines, sometimes called pudding wines, are sweet wines typically served with dessert.',	NULL,	NULL,	'Dessert_wine.jpg',	'image/jpeg',	35789,	'2020-04-17 16:22:57',	NULL,	'Beverages',	'Fermented beverages',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:22:57',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00923'),
(956,	'Red champagne',	NULL,	'Red champagne is also known as Rosé champagne, which is a type of alcoholic drinks that is produced with red grapes. The gentle extracting process minimized the contact between the skins and juice, which gives the liquid red colour. Red (Rosé) Champagne is one of the few wines that allow the production of rosé by the addition of a small amount of red wine during blending.',	NULL,	NULL,	'Red_champagne.jpg',	'image/jpeg',	47130,	'2020-04-17 16:22:57',	NULL,	'Beverages',	'Alcoholic beverages',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:58',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00924'),
(957,	'Red tea',	NULL,	'Rooibos tea is also known as red tea or red bush tea.It is made using leaves from a shrub called Aspalathus linearis, usually grown on the western coast of South Africa.Rooibos is a herbal tea and is not related to green or black tea.',	NULL,	NULL,	'Red_tea.jpg',	'image/jpeg',	34747,	'2020-04-17 16:22:58',	NULL,	'Teas',	'Teas',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:58',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00925'),
(958,	'White champagne',	NULL,	'The white champagne is produced from grape juice obtained after minimal possible contact with the skins produces essentially white wine, with a slightly yellower colour than wine from white grapes (due to lack of red skin pigments).',	NULL,	NULL,	'White_champagne.jpg',	'image/jpeg',	4471,	'2020-04-17 16:22:58',	NULL,	'Beverages',	'Alcoholic beverages',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:58',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00926'),
(959,	'Red grape juice',	NULL,	'Red grape juice is typically manufactured from red-skinned grapes (e.g. Pinot Noir, Sweet Jubilee, etc.). Not a significant source of Calories from Fat, Saturated Fat, Trans Fat, Cholesterol, Dietary fiber, Vitamin A and Iron.',	NULL,	NULL,	'Red_grape_juice.jpg',	'image/jpeg',	74069,	'2020-04-17 16:22:58',	NULL,	'Beverages',	'Beverages',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:59',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00927'),
(960,	'White grape juice',	NULL,	'White grape juice is typically manufactured from green-skinned grapes.It has a refreshing, crisp flavor that comes from Niagara grapes. Not a significant source of Calories from Fat, Saturated Fat, Trans Fat, Cholesterol, Dietary fiber, Vitamin A and Iron.',	NULL,	NULL,	'White_grape_juice.jpg',	'image/jpeg',	77457,	'2020-04-17 16:22:59',	NULL,	'Beverages',	'Beverages',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:22:59',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00928'),
(961,	'Crosne',	'Stachys affinis',	'Stachys affinis, commonly called crosne, chinese artichoke, japanese artichoke, knotroot, or artichoke betony, is a perennial herbaceous plant of the family Lamiaceae, originating from China. Its rhizome is a root vegetable that can be eaten raw, pickled, dried or cooked.',	NULL,	NULL,	'Crosne.jpg',	'image/jpeg',	120626,	'2020-04-17 16:22:59',	NULL,	'Vegetables',	'Root vegetables',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:00',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00929'),
(962,	'Red clover',	'Trifolium pratense',	'Red clover is a herbaceous, short-lived perennial plant, variable in size, growing to 20–80 cm (8–31 in) tall. The red clover is native to Europe, Western Asia, and northwest Africa.Red clover’s flowers and leaves are edible, and can be added as garnishes to any dish.The flowers often are used to make jelly and tisanes, and are used in essiac recipes.',	NULL,	NULL,	'Red_clover.jpg',	'image/jpeg',	270440,	'2020-04-17 16:23:00',	NULL,	'Herbs and Spices',	'Herbs',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:01',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00930'),
(963,	'Partridge berry',	'Mitchella repens',	'Partridgeberries are internationally known as lingonberries. This relative of the cranberry family is a low mat forming evergreen shrub with tiny rounded leaves.These berries grow in the dry,acidic soils of Newfoundland and Labrador\'s barrens and coastal headlands.Tart in flavour they are high in vitamin C, tannin anthocyanin, and antioxidants.',	NULL,	NULL,	'Partridge_berry.jpg',	'image/jpeg',	91039,	'2020-04-17 16:23:01',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:01',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00931'),
(964,	'Mikan',	'Citrus unshiu',	'A Mikan is a citrus fruit, also variously called Citrus unshiu, unshu mikan, Wenzhou migan, or a satsuma.',	NULL,	NULL,	'Mikan.jpg',	'image/jpeg',	7821,	'2020-04-17 16:23:01',	NULL,	'Fruits',	'Citrus',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:01',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00932'),
(965,	'Mozzarella cheese',	NULL,	'Mozzarella is a traditionally southern Italian cheese made from Italian buffalo\'s milk by the pasta filata method.Fresh mozzarella is generally white but may vary seasonally to slightly yellow depending on the animal\'s diet. Mozzarella of several kinds is used for most types of pizza and several pasta dishes or served with sliced tomatoes and basil in Caprese salad.',	NULL,	NULL,	'Mozzarella_cheese.jpg',	'image/jpeg',	106437,	'2020-04-17 16:23:01',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:02',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00933'),
(966,	'Plain cream cheese',	NULL,	'Cream cheese is a soft, usually mild-tasting fresh cheese made from milk and cream.Stabilizers such as carob bean gum and carrageenan are typically added in industrial production',	NULL,	NULL,	'Plain_cream_cheese.jpg',	'image/jpeg',	37820,	'2020-04-17 16:23:02',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:03',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00934'),
(967,	'Cheddar Cheese',	'Cheddar Cheese',	'Cheddar cheese is a relatively hard, off-white (or orange if colourings such as annatto are added), sometimes sharp-tasting, natural cheese.Originating in the English village of Cheddar in Somerset,[1] cheeses of this style are now produced beyond the region and in several countries around the world.',	NULL,	NULL,	'Cheddar_Cheese.jpg',	'image/jpeg',	41086,	'2020-04-17 16:23:03',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:03',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00935'),
(968,	'Parmesan cheese',	NULL,	'Parmesan cheese is the name of an Italian extra-hard cheese made of cow\'s milk.  It is usually the cheese to go with Spaghetti and other typical Italian pasta, but it also has many other uses. Parmesan is a part of Italian national cuisine and it can be consumed both grated and in slivers. It is hard, sharp and dry.',	NULL,	NULL,	'Parmesan_cheese.jpg',	'image/jpeg',	259766,	'2020-04-17 16:23:03',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:05',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00936'),
(969,	'Almond milk',	NULL,	'Almond milk is a plant milk manufactured from almonds with a creamy texture and nutty flavor,although some types  or brands are flavored in imitation of dairy milk. It does not contain cholesterol, saturated fat or lactose, and is often consumed by those who are lactose-intolerant and others, such as vegans who avoid dairy products. Commercial almond milk comes in sweetened, unsweetened, vanilla and chocolate flavors, and is usually fortified with micronutrients.',	NULL,	NULL,	'Almond_milk.jpg',	'image/jpeg',	70668,	'2020-04-17 16:23:05',	NULL,	'Milk and milk products',	'Other milk products',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:05',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00937'),
(970,	'Coconut milk',	NULL,	'Coconut milk is an opaque, milky-white liquid extracted from the grated pulp of mature coconuts.The opacity and rich taste of coconut milk is due to its high oil content, most of which is saturated fat.',	NULL,	NULL,	'Coconut_milk.jpg',	'image/jpeg',	49285,	'2020-04-17 16:23:05',	NULL,	'Milk and milk products',	'Other milk products',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:06',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00938'),
(971,	'Salted butter',	NULL,	'Salted butter is simply butter that contains added salt. In addition to giving a saltier taste, the salt actually acts as a preservative and prolongs the shelf life of the butter.Salted butter is perfect for spreading over crusty bread or melting over homemade pancakes or waffles.',	NULL,	NULL,	'Salted_butter.jpg',	'image/jpeg',	136596,	'2020-04-17 16:23:06',	NULL,	'Milk and milk products',	'Other milk products',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:07',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00939'),
(972,	'Sunflower oil',	NULL,	'Sunflower oil is the non-volatile oil pressed from the seeds of sunflower (Helianthus annuus). Sunflower oil is commonly used in food as a frying oil, and in cosmetic formulations as an emollient.Sunflower oil is primarily composed of linoleic acid, a polyunsaturated fat, and oleic acid, a monounsaturated fat. ',	NULL,	NULL,	'Sunflower_oil.jpg',	'image/jpeg',	417274,	'2020-04-17 16:23:07',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:08',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00940'),
(973,	'Coconut oil',	NULL,	'Coconut oil, or copra oil, is an edible oil extracted from the kernel or meat of mature coconuts harvested from the coconut palm (Cocos nucifera). It has various applications. Because of its high saturated fat content, it is slow to oxidize and, thus, resistant to rancidification, lasting up to six months at 24 °C (75 °F) without spoiling.',	NULL,	NULL,	'Coconut_oil.jpg',	'image/jpeg',	79808,	'2020-04-17 16:23:08',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:08',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00941'),
(974,	'Peanut oil',	NULL,	'Peanut oil, also known as groundnut oil or arachis oil, is a vegetable oil derived from peanuts. The oil has a strong peanut flavor and aroma.t is often used in American, Chinese, South Asian and Southeast Asian cuisine, both for general cooking, and in the case of roasted oil, for added flavor.',	NULL,	NULL,	'Peanut_oil.jpg',	'image/jpeg',	44632,	'2020-04-17 16:23:08',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:08',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00942'),
(975,	'Cottonseed oil',	NULL,	'Cottonseed oil is cooking oil from the seeds of cotton plants of various species, mainly Gossypium hirsutum and Gossypium herbaceum, that are grown for cotton fiber, animal feed, and oil.Cottonseed oil is used for salad oil, mayonnaise, salad dressing, and similar products because of its flavor stability.',	NULL,	NULL,	'Cottonseed_oil.jpg',	'image/jpeg',	310612,	'2020-04-17 16:23:08',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:09',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00943'),
(976,	'Corn oil',	NULL,	'Corn oil (maize oil) is oil extracted from the germ of corn (maize). Its main use is in cooking, where its high smoke point makes refined corn oil a valuable frying oil.',	NULL,	NULL,	'Corn_oil.jpg',	'image/jpeg',	97183,	'2020-04-17 16:23:09',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:10',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00944'),
(977,	'Avocado oil',	NULL,	'Avocado oil is an edible oil pressed from the fruit of the Persea americana (avocado). As a food oil, it is used as an ingredient in other dishes, and as a cooking oil. It is also used for lubrication and in cosmetics, where it is valued for its supposed regenerative and moisturizing properties.',	NULL,	NULL,	'Avocado_oil.jpg',	'image/jpeg',	36851,	'2020-04-17 16:23:10',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:10',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00945'),
(978,	'Grapeseed oil',	NULL,	'Grape seed oil (also called grapeseed oil or grape oil) is pressed from the seeds of grapes, and is thus an abundant by-product of winemaking.It is widely used in baked goods, pancakes, and waffles. It is sprayed on raisins to help them retain their flavor.',	NULL,	NULL,	'Grapeseed_oil.jpg',	'image/jpeg',	24780,	'2020-04-17 16:23:10',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:10',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00946'),
(979,	'Sesame oil',	NULL,	'Sesame oil is an edible vegetable oil derived from sesame seeds. Besides being used as a cooking oil, it is used as a flavor enhancer in many cuisines, having a distinctive nutty aroma and taste.The oil is one of the earliest-known crop-based oils.',	NULL,	NULL,	'Sesame_oil.jpg',	'image/jpeg',	57317,	'2020-04-17 16:23:11',	NULL,	'Herbs and Spices',	'Oilseed crops',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:11',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00947'),
(980,	'Monterey Jack cheese',	NULL,	'Monterey Jack, sometimes shortened to Jack, is an American white, semi-hard cheese made using cow\'s milk. It is noted for its mild flavor and slight sweetness.Dry Jack is a harder cheese with a longer aging time.',	NULL,	NULL,	'Monterey_Jack_cheese.jpg',	'image/jpeg',	10904,	'2020-04-17 16:23:11',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:11',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00948'),
(981,	'Swiss cheese',	NULL,	'Swiss cheese is a generic name in North America for several related varieties of cheese, mainly of North American manufacture, which resemble Emmental cheese, a yellow, medium-hard cheese that originated in the area around Emmental, in Switzerland. Some types of Swiss cheese have a distinctive appearance, as the blocks of the cheese are riddled with holes known as \"eyes\". Swiss cheese without eyes is known as \"blind\".',	NULL,	NULL,	'Swiss_cheese.jpg',	'image/jpeg',	164548,	'2020-04-17 16:23:11',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:12',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00949'),
(982,	'Cottage cheese',	NULL,	'Cottage cheese is a fresh cheese curd product with a mild flavor.It is made by draining the cheese, as opposed to pressing it - retaining some of the whey, keeping the curds loose.Cottage cheese is low in food energy compared to other types of cheese, making it popular among dieters and some health devotees.',	NULL,	NULL,	'Cottage_cheese.jpg',	'image/jpeg',	62302,	'2020-04-17 16:23:12',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:13',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00950'),
(983,	'Blue cheese',	NULL,	'Blue cheese is a general classification of cheese that have cultures of the mold Penicillium added so that the final product is spotted or veined throughout with blue mold. Blue cheese can be eaten by itself or can be spread, crumbled or melted into or over a range of other foods.',	NULL,	NULL,	'Blue_cheese.jpg',	'image/jpeg',	2154764,	'2020-04-17 16:23:13',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:15',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00951'),
(984,	'Clam',	NULL,	'In culinary usage, clams are commonly eaten marine bivalves, as in clam digging and the resulting soup, clam chowder. Many edible clams such as palourde clams are oval or triangular; however, razor clams have an elongated parallel-sided shell, suggesting an old-fashioned straight razor.',	NULL,	NULL,	'Clam.jpg',	'image/jpeg',	215854,	'2020-04-17 16:23:15',	NULL,	'Aquatic foods',	'Bivalvia',	'Type 1',	'2020-01-24 17:05:36',	'2020-04-17 16:23:16',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00952'),
(985,	'Sour cream',	NULL,	'Sour cream (American English) or soured cream (British English) is a dairy product obtained by fermenting regular cream with certain kinds of lactic acid bacteria.The bacterial culture, which is introduced either deliberately or naturally, sours and thickens the cream. Its name comes from the production of lactic acid by bacterial fermentation, which is called souring.',	NULL,	NULL,	'Sour_cream.jpg',	'image/jpeg',	78882,	'2020-04-17 16:23:16',	NULL,	'Milk and milk products',	'Other milk products',	'Type 2',	'2020-01-24 17:05:36',	'2020-04-17 16:23:16',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00953'),
(986,	'Whole wheat bread',	NULL,	'Whole wheat bread or wholemeal bread is a type of bread made using flour that is partly or entirely milled from whole or almost-whole wheat grains, see whole-wheat flour and whole grain. It is one kind of brown bread.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2020-01-24 17:05:37',	'2020-01-24 17:05:37',	NULL,	NULL,	0,	NULL,	NULL,	0,	'FOOD00954'),
(987,	'Jalapeno pepper',	'Capsicum annuum \'Jalapeño\'',	'The jalapeño is a medium-sized chili pepper pod type cultivar of the species Capsicum annuum.Commonly picked and consumed while still green, it is occasionally allowed to fully ripen and turn red, orange, or yellow.',	NULL,	NULL,	'Jalapeno_pepper.jpg',	'image/jpeg',	91645,	'2020-04-17 16:23:16',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:17',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00955'),
(988,	'Greek feta cheese',	NULL,	'Feta is a brined curd white cheese made in Greece from sheep\'s milk or from a mixture of sheep and goat\'s milk.t is a crumbly aged cheese, commonly produced in blocks, and has a slightly grainy texture. ',	NULL,	NULL,	'Greek_feta_cheese.jpg',	'image/jpeg',	856835,	'2020-04-17 16:23:17',	NULL,	'Milk and milk products',	'Fermented milk products',	'Type 2',	'2020-01-24 17:05:37',	'2020-04-17 16:23:18',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00956'),
(989,	'Eddoe',	'Colocasia antiquorum',	'Eddoe or eddo is a tropical vegetable often considered identifiable as the species Colocasia antiquorum,closely related to taro (dasheen, Colocasia esculenta), which is primarily used for its thickened stems (corms).It has smaller corms than taro, and in most cultivars there is an acrid taste that requires careful cooking.The young leaves can also be cooked and eaten, but (unlike taro) they have a somewhat acrid taste.',	NULL,	NULL,	'Eddoe.jpg',	'image/jpeg',	22453,	'2020-04-17 16:23:18',	NULL,	'Vegetables',	'Root vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:19',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00957'),
(990,	'Plantain',	'Musa × paradisiaca',	'Plantains are very starchy, green, and not as sweet as bananas. The word plantain can describe a specific, weedy plant, but it\'s also used more loosely for any bananas or banana-type fruits that are cooked rather than eaten raw. Plantains are made into sweet drinks, chips, snacks, soups, dumplings, and many more dishes. Plantain comes from the Spanish plátano, \"banana.\"',	NULL,	NULL,	'Plantain.png',	'image/png',	336909,	'2020-04-17 16:23:19',	NULL,	'Fruits',	'Tropical fruits',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:19',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00958'),
(991,	'Clementine',	'Citrus × clementina',	'Clementine or easy peeler (British English) is a tangor, a citrus fruit hybrid between a willowleaf mandarin orange and a sweet orange named for its late 19th-century discoverer.The exterior is a deep orange colour with a smooth, glossy appearance.They are typically juicy and sweet, with less acid than oranges.Their oils, like other citrus fruits, contain mostly limonene as well as myrcene, linalool, α-pinene and many complex aromatics.',	NULL,	NULL,	'Clementine.jpg',	'image/jpeg',	210923,	'2020-04-17 16:23:19',	NULL,	'Fruits',	'Citrus',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:20',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00959'),
(992,	'Green apple',	NULL,	'Green apples are light green in colour and have crisp and juicy white flesh, which has a tart taste compared to red apples.',	NULL,	NULL,	'Green_apple.jpg',	'image/jpeg',	74879,	'2020-04-17 16:23:20',	NULL,	'Fruits',	'Pomes',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:21',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00960'),
(993,	'White onion',	NULL,	'White onion (Allium cepa, \'sweet onion\') is a cultivar of dry onion, that has a pure white papery skin and a sweet, mild white flesh.Similar to red onions, due to the high sugar content, they have a short shelf life, lasting up to 2 days, or if refrigerated, they can last up to a month.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-03-12 21:00:51',	NULL,	NULL,	0,	NULL,	NULL,	0,	'FOOD00961'),
(994,	'Red onion',	NULL,	'Red onions are cultivars of the onion (Allium cepa) with purplish-red skin and white flesh tinged with red.These onions tend to be medium to large in size and have a mild flavor.Red onions are available throughout the year and are high in flavonoids and fibre (compared to white and yellow onions).',	NULL,	NULL,	'Red_onion.jpg',	'image/jpeg',	43612,	'2020-04-17 16:23:21',	NULL,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:21',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00962'),
(995,	'Green onion',	NULL,	'Scallions (also known as green onions, spring onions, chinese onions, or salad onions) are vegetables of various Allium onion species. Scallions have a milder taste than most onions. Their close relatives include garlic, shallot, leek,chive,and Chinese onion.',	NULL,	NULL,	'Green_onion.jpg',	'image/jpeg',	17678,	'2020-04-17 16:23:21',	NULL,	'Vegetables',	'Onion-family vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:21',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00963'),
(996,	'Green grape',	NULL,	'Green seedless grapes are small to medium in size and are round to slightly oval in shape, growing in tight or loose clusters depending on the variety. The skin ranges from yellow-green to bright green and is typically crisp, firm, and smooth. The flesh is pale green, semi-translucent, and seedless, though some seedless varieties may have a few underdeveloped seeds that are undetectable when consumed. Green seedless grapes are mild and sweet with a slightly tart flavor. ',	NULL,	NULL,	'Green_grape.png',	'image/png',	504650,	'2020-04-17 16:23:21',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:22',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00964'),
(997,	'Red grape',	NULL,	'Red seedless grapes are small to medium in size and are round to slightly oblong in shape, growing in medium to large clusters. The hue of a Red seedless grape can vary widely depending on the variety and local growing conditions, but it usually ranges from a light red to a deep burgundy. The thin skin may also contain a dusty film, also known as a bloom, and this layer forms a natural waterproof barrier which prevents the delicate skin from cracking. The translucent flesh is juicy and is considered seedless, though a few small undetectable and undeveloped seeds may be present. Red seedless grapes are firm, crisp, and sweet with a mild, neutral flavor. ',	NULL,	NULL,	'Red_grape.jpg',	'image/jpeg',	52396,	'2020-04-17 16:23:22',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:22',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00965'),
(998,	'Black plum',	'Syzygium cumini',	'The Black Plum is oval and about 1 to 2 centimeters in length. It is dark purple to black in color, fleshy and one-seeded, with a tart, sweet-astringent taste.',	NULL,	NULL,	'Black_plum.jpg',	'image/jpeg',	17581,	'2020-04-17 16:23:22',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:22',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00966'),
(999,	'Green cabbage',	'Brassica oleracea var. sabauda L.',	'Green cabbage has numerous pale green leaves that are thick and broad with prominent veins and a slightly waxy finish.They overlap to form a dense round to oblate ball and can measure 15 to 18 centimeters in diameter and may weigh up to 10 pounds each. The leaves are firm when raw and tender when cooked and it offers a sweet, grassy flavor.',	NULL,	NULL,	'Green_cabbage.jpg',	'image/jpeg',	143348,	'2020-04-17 16:23:22',	NULL,	'Vegetables',	'Cabbages',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:23',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00967'),
(1000,	'Black raisin',	NULL,	'Black raisins are made by drying out black Corinth seedless grapes under the sun or in a dehydrator. They have a darker colour compared to the other raisin varieties and are tangy and sweet. Black raisins are used in preparing smoothies, desserts and even as a garnish on salads.',	NULL,	NULL,	'Black_raisin.jpg',	'image/jpeg',	72539,	'2020-04-17 16:23:23',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:24',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00968'),
(1001,	'Cannellini bean',	NULL,	'Cannellini beans are the largest of the group and because of their traditional kidney shape, they can also be referred to as White Kidney Beans.Meatier than Navy or Great Northern beans, they have a nutty, earthy flavor and tender flesh, and are often used in Italian dishes like Minestrone. They retain their shape and texture well, so they’re perfect to use in salads, soups, stews, and chili.',	NULL,	NULL,	'Cannellini_bean.jpg',	'image/jpeg',	282581,	'2020-04-17 16:23:24',	NULL,	'Pulses',	'Beans',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:25',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00969'),
(1002,	'Green lentil',	'Lens culinaris',	'Green lentil is a small annual legume of the pea family and it is edible seed.Green lentils can be pale or mottled green-brown in color with a glossy exterior.They have a robust, somewhat peppery flavor.It is used chiefly in soups and stews, and the herbage is used as fodder in some places.',	NULL,	NULL,	'Green_lentil.jpg',	'image/jpeg',	61925,	'2020-04-17 16:23:25',	NULL,	'Pulses',	'Pulses',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:26',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00970'),
(1003,	'Cubanelle pepper',	NULL,	'The Cubanelle, also known as \"Cuban pepper\" and \"Italian frying pepper\",is a variety of sweet pepper of the species Capsicum annuum. When unripe, it is light yellowish-green in color, but will turn bright red if allowed to ripen. ',	NULL,	NULL,	'Cubanelle_pepper.jpg',	'image/jpeg',	119030,	'2020-04-17 16:23:26',	NULL,	'Vegetables',	'Fruit vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:27',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00971'),
(1004,	'Acorn squash',	'Cucurbita pepo var. turbinata',	'Acorn squash also called pepper squash or Des Moines squash is a winter squash with distinctive longitudinal ridges on its exterior and sweet, yellow-orange flesh inside.Although considered a winter squash, acorn squash belongs to the same species (Cucurbita pepo) as all summer squashes (including zucchini and crookneck squash).',	NULL,	NULL,	'Acorn_squash.jpg',	'image/jpeg',	41436,	'2020-04-17 16:23:27',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:28',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00972'),
(1005,	'Iceberg lettuce',	NULL,	'Crisphead, also called Iceberg: lettuces form tight, dense heads that resemble cabbage. They are generally the mildest of the lettuces, valued more for their crunchy texture than for flavor. Varieties of iceberg lettuce are the most familiar lettuces in the USA. The name Iceberg comes from the way the lettuce was transported in the US in the 1930s. It was transported on trainwagons all covered in crushed ice - making it look like icebergs.',	NULL,	NULL,	'Iceberg_lettuce.jpg',	'image/jpeg',	201005,	'2020-04-17 16:23:28',	NULL,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:29',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00973'),
(1006,	'Japanese sea bass',	'Lateolabrax japonicus',	'The Japanese seabass, also suzuki is a species of Asian sea bass native to the western Pacific Ocean, where it occurs from Japan to the South China Sea.The Japanese sea bass is also commonly referenced to as Suzuki when it comes to food. It is widely fished and even farmed in order to be used as a delicacy that is served as sushi.',	NULL,	NULL,	'Japanese_sea_bass.jpg',	'image/jpeg',	26754,	'2020-04-17 16:23:29',	NULL,	'Aquatic foods',	'Fishes',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:29',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00974'),
(1007,	'Pea shoots',	NULL,	'Pea shoots have long been prominent in Asian cuisine, but they\'re one of the newer ingredients showing up in U.S. farmer\'s markets.Their soft leaves, curly-cue tendrils and watery stems hold the promise of spring peas to come. But even better than that, they hold the flavor of them, too.And one of the reasons home cooks are taking to them (apart from their flavor) is because they\'re rich in nutrients.',	NULL,	NULL,	'Pea_shoots.png',	'image/png',	1293426,	'2020-04-17 16:23:29',	NULL,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:30',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00975'),
(1008,	'Yau choy',	NULL,	'Yu choy is a leafy vegetable that produces fleshy stalks 20-30 cm high with oval-shaped leaves. The branching stems are slender, crisp, smooth, and pale green, and attached to the stems are broad and flat, dark green leaves that have prominent veining spanning across the surface. There are also small, bright yellow flowers that first appear as green buds in loosely compacted clusters of 10-20 buds. The leaves, stems, and flowers of Yu choy are all edible and have a crunchy, tender consistency. Yu choy has a sweet, green taste similar to baby spinach, with subtle bitter and peppery notes. ',	NULL,	NULL,	'Yau_choy.png',	'image/png',	433321,	'2020-04-17 16:23:30',	NULL,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:30',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00976'),
(1009,	'Water spinach',	'Ipomoea aquatica',	'Ipomoea aquatica is a semi-aquatic, tropical plant grown as a vegetable for its tender shoots and it is not known where it originated. This plant is known in English as water spinach, river spinach, water morning glory, water convolvulus, or by the more ambiguous names Chinese spinach, Chinese Watercress, Chinese convolvulus, swamp cabbage or kangkong in Southeast Asia.',	NULL,	NULL,	'Water_spinach.jpg',	'image/jpeg',	129825,	'2020-04-17 16:23:30',	NULL,	'Vegetables',	'Leaf vegetables',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:31',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00977'),
(1010,	'Chineese plum',	NULL,	'Prunus salicina commonly called the Japanese plum or Chinese plum.The fruit is a drupe 4-7 cm in diameter with yellow-pink flesh; it can be harvested in the summer. When fully ripe it can be eaten raw.',	NULL,	NULL,	'Chineese_plum.jpg',	'image/jpeg',	57285,	'2020-04-17 16:23:31',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:31',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00978'),
(1011,	'Green plum',	NULL,	'Green Plum is known by various names, like greengage, kakadu plum, wild plum, and murunga. They contain a lot of fiber and are rich in Vitamin C, sodium, calcium, potassium, Vitamin K, Vitamin A, and phytonutrients.Usually, they are used in the preparation of jams, pies, tarts, and sorbets. However, some people are fond of eating them raw with salt. ',	NULL,	NULL,	'Green_plum.jpg',	'image/jpeg',	18796,	'2020-04-17 16:23:31',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:32',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00979'),
(1012,	'Wampee',	'Clausena lansium',	'Clausena lansium, also known as wampee or wampi is a species of strongly scented evergreen trees in the family Rutaceae, native to southeast Asia.The wampee is cultivated for its fruit, which looks like a grape.A hybrid, seedless wampee that is larger and juicier than the normal variety; however, it is still more sour thansweet.',	NULL,	NULL,	'Wampee.jpg',	'image/jpeg',	38271,	'2020-04-17 16:23:32',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:32',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00980'),
(1013,	'Pitaya',	'Hylocereus undatus',	' Pitaya or pitahaya is the fruit of several different cactus species indigenous to the Americas.The fruit\'s texture is sometimes likened to that of the kiwifruit because of its black, crunchy seeds. The seed oil contains the fatty acids, linoleic acid and linolenic acid.',	NULL,	NULL,	'Pitaya.jpg',	'image/jpeg',	878038,	'2020-04-17 16:23:32',	NULL,	'Fruits',	'Tropical fruits',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:33',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00981'),
(1014,	'Goji',	NULL,	'Goji, goji berry or wolfberry is the fruit of Lycium barbarum and Lycium chinense. These are two very closely related species of boxthorn in the family Solanaceae (which also includes the potato, tomato, eggplant, deadly nightshade, chili pepper, and tobacco). The two species are native to Asia.',	NULL,	NULL,	'Goji.jpg',	'image/jpeg',	70003,	'2020-04-17 16:23:33',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:34',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00982'),
(1015,	'Monk fruit',	'Siraitia grosvenorii',	'Siraitia grosvenorii (monk fruit or luo han guo) is a herbaceous perennial vine of the gourd family, Cucurbitaceae, native to southern China and northern Thailand. The plant is cultivated for its fruit, whose extract is nearly 300 times sweeter than sugar and has been used in China as a low-calorie sweetener for cooling drinks and in traditional Chinese medicine.',	NULL,	NULL,	'Monk_fruit.jpg',	'image/jpeg',	9303664,	'2020-04-17 16:23:34',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:38',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00983'),
(1016,	'Cantaloupe melon',	'Cucumis melo var. cantalupensis',	'The cantaloupe, rockmelon (Australia), sweet melon, or spanspek (South Africa) is a melon that is a variety of the muskmelon species from the family Cucurbitaceae.',	NULL,	NULL,	'Cantaloupe_melon.jpg',	'image/jpeg',	1166057,	'2020-04-17 16:23:38',	NULL,	'Gourds',	'Gourds',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:40',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00984'),
(1017,	'Hawthorn',	'Crataegus',	'Crataegus commonly called hawthorn, quickthorn, thornapple,May-tree,whitethorn,or hawberry, is a genus of several hundred species of shrubs and trees in the family Rosaceae,native to temperate regions of the Northern Hemisphere in Europe, Asia and North America.',	NULL,	NULL,	'Hawthorn.jpg',	'image/jpeg',	504680,	'2020-04-17 16:23:40',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:41',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00985'),
(1018,	'Lantern fruit',	'Physalis alkekengi',	'Physalis alkekengi (bladder cherry, Chinese lantern,Japanese-lantern,strawberry groundcherry,or winter cherry) is a relative of P. peruviana.It is easily identifiable by the large, bright orange to red papery covering over its fruit, which resembles paper lanterns. It grows naturally in the regions covering Southern Europe to South Asia and Northeast Asia.',	NULL,	NULL,	'Lantern_fruit.jpg',	'image/jpeg',	207149,	'2020-04-17 16:23:41',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:42',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00986'),
(1019,	'White bread',	NULL,	'White bread typically refers to breads made from wheat flour from which the bran and the germ layers have been removed (and set aside) from the whole wheatberry as part of the flour grinding or milling process, producing a light colored flour.White bread contains 1/2 of the magnesium found in whole-wheat bread.',	NULL,	NULL,	'White_bread.jpg',	'image/jpeg',	7705,	'2020-04-17 16:23:42',	NULL,	'Cereals and cereal products',	'Cereals',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:42',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00987'),
(1020,	'Cape gooseberry',	'Physalis peruviana',	'Physalis peruviana, a plant species of the genus Physalis in the nightshade family Solanaceae, has its origin in Peru.The plant and its fruit are commonly called Cape gooseberry, goldenberry, and physalis, among numerous regional names.Cape gooseberry is made into fruit-based sauces, pies, puddings, chutneys, jams, and ice cream, or eaten fresh in salads and fruit salads.',	NULL,	NULL,	'Cape_gooseberry.jpg',	'image/jpeg',	10136,	'2020-04-17 16:23:42',	NULL,	'Fruits',	'Berries',	'Type 1',	'2020-01-24 17:05:37',	'2020-04-17 16:23:43',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00988'),
(1021,	'Herbal tea',	NULL,	'Herbal teas are the beverages made from the infusion or decoction of herbs, spices, or other plant material in hot water. While most herbal teas are safe for regular consumption, some herbs have toxic or allergenic effects. The most herbal teas include Chamomile Tea, Peppermint Tea, Ginger Tea, etc.',	NULL,	NULL,	'Herbal_tea.jpg',	'image/jpeg',	268769,	'2020-04-17 16:23:43',	NULL,	'Teas',	'Teas',	'Type 1',	'2020-03-12 20:55:17',	'2020-04-17 16:23:43',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00989'),
(1022,	'Fish oil',	NULL,	'Fish oil is oil derived from the tissues of oily fish. Fish oils contain the omega-3 fatty acids eicosapentaenoic acid (EPA) and docosahexaenoic acid (DHA), precursors of certain eicosanoids that are known to reduce inflammation in the body and improve hypertriglyceridemia. Fish oil has been shown the benefit for cardiovascular disease. The most promising evidence supports supplementation for prevention of cardiac death.',	NULL,	NULL,	'Fish_oil.jpg',	'image/jpeg',	14684,	'2020-04-17 16:23:43',	NULL,	NULL,	NULL,	'Type 1',	'2020-03-12 21:00:02',	'2020-04-17 16:23:44',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00990'),
(1023,	'Taco shell',	NULL,	'The hard-shell or crispy taco is a tradition that developed in the United States. The most common type of taco in the US is the hard-shell, U-shaped version, first described in a cookbook in 1949.',	NULL,	NULL,	'Taco_shell.jpg',	'image/jpeg',	62320,	'2020-04-17 16:23:44',	NULL,	NULL,	NULL,	'Type 2',	'2020-03-12 21:01:58',	'2020-04-17 16:23:44',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00991'),
(1024,	'Tostada shell',	NULL,	NULL,	NULL,	NULL,	'Tostada_shell.jpg',	'image/jpeg',	85189,	'2020-04-17 16:23:44',	NULL,	NULL,	NULL,	'Type 2',	'2020-03-12 21:01:58',	'2020-04-17 16:23:45',	NULL,	NULL,	0,	NULL,	NULL,	1,	'FOOD00992');
